(21, 222, 21, 'Kung Fu', 2, 1, 1, 3, 'Julien Levray', 4, '0645696987', 'jlevray@e-dentic.fr', NULL, 1, 0, 0, 0, 'Pelouse des humas', 45.783232792044, 4.8748227936401, 1, '<p>Avez-vous déjà rêvé d''être un maître Kung-Ju, de connaître la posture du Lion, du Singe ou du Cobra enflammé? Avez-vous déjà imaginé pouvoir vaincre Jackie Chan dans un magasin de meubles? Eh bien venez à l''animation de Kung-Fu ouvert à tous! Vous aller avoir l''occasion d''essayer le Kung-Fu pour la première fois de votre vie sur la Pelouse des humas de 10h30 à 12h30 le samedi 24 mai.</p>', 0, 1, 'a:1:{i:0;a:3:{s:4:"jour";s:6:"Samedi";s:5:"debut";s:5:"10h30";s:3:"fin";s:5:"12h30";}}', 0, 1, 0, 0, 0, 0, 0, NULL, 0, NULL, 'a:14:{i:0;a:4:{s:6:"auteur";s:20:"Cédric Le Bars (3G)";s:4:"type";i:0;s:5:"texte";s:21:"Création de la fiche";s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-03-04 23:23:29";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:1;a:4:{s:6:"auteur";s:26:"Guerric Bouvarel (Cul-sec)";s:4:"type";i:1;s:5:"texte";N;s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-03-17 13:30:59";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:2;a:4:{s:6:"auteur";s:25:"Nicolas Minghetti (Carla)";s:4:"type";i:8;s:5:"texte";s:193:"le sac poubelle c''est pour quoi ? Les bouteilles je les vire, ça serra à mettre dans les fiches taches, une personnes ferra le tour de toutes les anims le matin pour distribuer les bouteilles";s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-03-17 14:25:23";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:3;a:4:{s:6:"auteur";s:20:"Cédric Le Bars (3G)";s:4:"type";i:1;s:5:"texte";N;s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-03-18 19:39:45";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:4;a:4:{s:6:"auteur";s:25:"Nicolas Minghetti (Carla)";s:4:"type";i:5;s:5:"texte";s:101:"Je valide mais tu verras avec la barrière pour la vauban, si elle sert à rien autant la dégager :)";s:4:"date";O:8:"DateTime":3:{s: