(50, 210, 22, '14 heures d''impro', 2, 1, 1, 1, 'TTI', 1, '0699908668', 'tti@insa-lyon.fr', NULL, 1, 0, 0, 0, 'Rotonde', 45.783846314372, 4.8740959149971, 1, '<p>Véritable marathon du match d’improvisation, ce festival théâtral verra s’affronter des équipes venues de la France entière pendant le week-end des 24h de l’INSA, les 24 et 25 mai, de 14h à 21h le samedi et le dimanche.<br><br>Plus d''informations sur http://tti.insa-lyon.fr/</p>', 0, 0, 'a:2:{i:0;a:3:{s:4:"jour";s:6:"Samedi";s:5:"debut";s:5:"14h00";s:3:"fin";s:5:"21h00";}i:1;a:3:{s:4:"jour";s:8:"Dimanche";s:5:"debut";s:5:"14h00";s:3:"fin";s:5:"21h00";}}', 1, 0, 1, 16, 0, 0, 0, '1 AS (SSIAP1) de 13h30 à 21h30. La TTI doit se charger de fermer le baitment le soir et utilise ses propres badges', 1, 'Panneaux directifs indiquant les "14h de l''impro".', 'a:9:{i:0;a:4:{s:6:"auteur";s:22:"Morgane Barra (Jeanne)";s:4:"type";i:0;s:5:"texte";s:21:"Création de la fiche";s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-03-09 20:12:22";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:1;a:4:{s:6:"auteur";s:22:"Morgane Barra (Jeanne)";s:4:"type";i:1;s:5:"texte";N;s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-03-10 21:02:50";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:2;a:4:{s:6:"auteur";s:29:"Nicolas Minghetti (Saupiquet)";s:4:"type";i:0;s:5:"texte";s:7:"Elec Ok";s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-03-10 21:15:50";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:3;a:4:{s:6:"auteur";s:23:"Alexis Habert (Cetelem)";s:4:"type";i:5;s:5:"texte";N;s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-03-11 22:23:16";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:4;a:4:{s:6:"auteur";s:27:"Clément Niepceron (Cheval)";s:4:"type";i:6;s:5:"texte";N;s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-03-12 15:40:32";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:5;a:4:{s:6:"auteur";s:27:"Clément Niepceron (Cheval)";s:4:"type";i