(56, 210, 22, 'Festival de Bédéologie', 2, 1, 1, 0, 'Typhaine Moreau', 1, '0472436167', 'clubbdinsa@gmail.com', NULL, 1, 0, 0, 0, 'Grillon', 45.783915522266, 4.8750722390785, 1, '<p dir="ltr" style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255); line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap; background-color: transparent; font-family: Arial;">La </span><span style="vertical-align: baseline; white-space: pre-wrap; background-color: transparent; font-family: Arial; font-weight: bold;">18e édition</span><span style="vertical-align: baseline; white-space: pre-wrap; background-color: transparent; font-family: Arial;"><b> du Festival de Bédéologie</b> se tiendra les </span><span style="vertical-align: baseline; white-space: pre-wrap; background-color: transparent; font-family: Arial; font-weight: bold;">24 et 25 mai</span><span style="vertical-align: baseline; white-space: pre-wrap; background-color: transparent; font-family: Arial;"> 2014, sur le </span><span style="vertical-align: baseline; white-space: pre-wrap; background-color: transparent; font-family: Arial; font-weight: bold;">campus de la Doua à Villeurbanne</span><span style="vertical-align: baseline; white-space: pre-wrap; background-color: transparent; font-family: Arial;">. Venez à la rencontre des auteurs de bandes dessinées, des fanzines et des formidables membres du Club BD Manga, au plus fort des</span><span style="vertical-align: baseline; white-space: pre-wrap; background-color: transparent; font-family: Arial; font-weight: bold;"> 24H de l’INSA</span><span style="vertical-align: baseline; white-space: pre-wrap; background-color: transparent; font-family: Arial;"> ! </span></p><p dir="ltr" style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255); line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt; text-indent: 36pt; text-align: justify;"><span style="vertical-align: baseline; white-space: pre-wrap; background-color: transparent; font-family: Arial;">Vous pourrez entre autre rencontrer JBX et Le Fab, Rémi Jiguel, Franck Chantelouve, Marie Ligier de Laprade, Marc Salet, Sophiane Nemra, Eric Lescure, Couleur Corbeau ainsi que les fanzines Mikromix et Kartina.</span></p><p dir="ltr" style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255); line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt; text-indent: 36pt; text-align: justify;"><span style="vertical-align: baseline; white-space: pre-wrap; background-color: transparent; font-family: Arial;">En plus des ventes de BD et dédicaces, vous seront proposées diverses animations : exposition de planches originales et des participations à notre concours BD, coin lecture, blind test et quiz BD et Manga avec lots à la clé. Enfin, une tombola vous permettra de remporter un planche dédicacée par tous les auteurs présent !</span></p><p dir="ltr" style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255); line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt; text-indent: 36pt; text-align: justify;"><span style="vertical-align: baseline; white-space: pre-wrap; background-color: transparent; font-family: Arial; font-weight: bold;">Entrée Libre &nbsp;&nbsp;/ &nbsp;Samedi 24 mai &nbsp;&nbsp;10h - 18h &nbsp;/ &nbsp;Dimanche 25 mai &nbsp;12h - 18h </span><span style="vertical-align: baseline; white-space: pre-wrap; background-color: transparent; font-family: Arial;">&nbsp;&nbsp;</span></p><p dir="ltr" style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255); line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt; text-indent: 36pt; text-align: justify;"><span style="vertical-align: baseline; white-space: pre-wrap; background-color: transparent; font-family: Arial;">Plus d’infos &nbsp;sur </span><a href="http://clubbdinsa.free.fr/" target="_blank" style="color: rgb(17, 85, 204); text-decoration: none;"><span style="font-family: Arial; background-color: transparent; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;">clubbdinsa.free.</span><span style="font-family: Arial; background-color: transparent; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;">fr</span></a><span style="vertical-align: baseline; white-space: pre-wrap; background-color: transparent; font-family: Arial;"> ou notre </span><span style="text-decoration: underline; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap;"><a href="https://www.facebook.com/pages/Festival-de-B%C3%A9d%C3%A9ologie/299276113552977?fref=ts" target="_blank" style="color: rgb(17, 85, 204); text-decoration: none;">page facebook</a></span></p>', 0, 0, 'a:2:{i:0;a:3:{s:4:"jour";s:6:"Samedi";s:5:"debut";s:5:"10h00";s:3:"fin";s:5:"18h00";}i:1;a:3:{s:4:"jour";s:8:"Dimanche";s:5:"debut";s:5:"12h00";s:3:"fin";s:5:"18h00";}}', 0, 1, 1, 16, 0, 0, 0, NULL, 1, 'Mettre des flèches avec marqué "Festival de BD" là où l''on peut\r\nPas besoin de panneau au niveau du grillon, ça ils gèrent.', 'a:13:{i:0;a:4:{s:6:"auteur";s:12:"Simon Biarez";s:4:"type";i:0;s:5:"texte";s:21:"Création de la fiche";s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-03-10 18:27:05";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:1;a:4:{s:6:"auteur";s:12:"Simon Biarez";s:4:"type";i:1;s:5:"texte";s:47:"Horaires et matos à compléter dans la semaine";s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-03-10 21:48:42";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:2;a:4:{s:6:"auteur";s:12:"Simon Biarez";s:4:"type";i:11;s:5:"texte";N;s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-03-10 21:48:57";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:3;a:4:{s:6:"auteur";s:12:"Simon B