(72, 210, 22, '12 heures de danse', 2, 1, 1, 1, 'Club rock, Ragda, Slide, Amel & les Almées, Kaz''Kreyol, Kwanza''a', 2, NULL, NULL, 'Toutes les assos sont de l''INSA, saul AMEL&les Almées (danse orientale, Villeurbanne)\r\n\r\nKaz Kreyol  kaz.kreyol.insa@gmail.com\r\nKwanza''a    kwanza.bureau.asso@led.insa-lyon.fr\r\nClub rock    berenice.bernicchia@insa-lyon.fr\r\nSlide           myrtille.michel@insa-lyon.fr\r\nRagda        ragda@listes.insa-lyon.fr\r\nAmel           danseuseamel@sfr.fr', 1, 0, 0, 0, 'Podium Humas', 45.783474086691, 4.8752117139473, 1, '<p><span style="font-family: Arial, Arial, Helvetica, sans-serif; text-align: justify; background-color: rgb(255, 255, 255);">12h en continu de spectacles de Danse Moderne, de Rock, de Salsa, de Danse Orientale, de Zouk, et bien d''autres !&nbsp;</span></p><p><span style="background-color: rgb(255, 255, 255); font-family: Arial, Arial, Helvetica, sans-serif; text-align: justify;">Ragda,&nbsp;</span><span style="text-align: justify; background-color: rgb(255, 255, 255);"><font face="Arial, Arial, Helvetica, sans-serif">Club rock, &nbsp;Slide, Amel &amp; les Almées, Kaz''Kreyol, Kwanza''a.</font><br></span></p><p><span style="font-family: Arial, Arial, Helvetica, sans-serif; text-align: justify; background-color: rgb(255, 255, 255);">Pour les plus curieux, une initiation à certaines danses est possible.</span></p>', 0, 0, 'a:2:{i:0;a:3:{s:4:"jour";s:6:"Samedi";s:5:"debut";s:5:"12h30";s:3:"fin";s:5:"18h30";}i:1;a:3:{s:4:"jour";s:8:"Dimanche";s:5:"debut";s:5:"12h30";s:3:"fin";s:5:"18h30";}}', 0, 1, 1, 16, 0, 0, 0, NULL, 1, '1 Panneau A3 planté "12 Heures de danse" avec le planning du week-end (dès que je saurai)', 'a:13:{i:0;a:4:{s:6:"auteur";s:22:"Morgane Barra (Jeanne)";s:4:"type";i:0;s:5:"texte";s:21:"Création de la fiche";s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-03-10 21:45:47";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:1;a:4:{s:6:"auteur";s:22:"Morgane Barra (Jeanne)";s:4:"type";i: