(73, 210, 22, 'Festival d''Europe -Paul Predki', 2, 1, 0, 1, 'Festival Printemps d''Europe', 2, '0617436006', 'europeetcies@free.fr', 'Le Festival Printemps d''Europe se déroule en même temps que le notre (dans Lyon 7ème). Ils veulent nous prêter une troupe de théâtre pour avoir une visibilité sur notre festival (étudiant + villeurbannais)', 1, 0, 0, 0, 'Podium MDE', 45.783975377638, 4.8743869346752, 1, '<p>Pour la première fois cette année, le festival des 24H s''associe à un autre festival. Nous sommes très heureux d’accueillir Printemps d''Europe, le festival européen des arts et de la scène (Lyon 8ème).&nbsp;</p><p>La 7<sup>ème</sup> édition du Festival Printemps d''Europe aura lieu du 8 au 25 mai. Plus d''informations sur http://europeetcies.eu/ et sur la page facebook Festival Printemps d''Europe.</p><p><b>Paul Predki</b> propose régulièrement des ateliers-récitals à l''adresse de publics variés autour de la chanson et de la poésie. L''acteur, chanteur et animateur s''accompagne de son instrument, l''accordéon. Il déambulera sur le campus puis rejoindra le podium de la MdE !</p>', 1, 0, 'a:1:{i:0;a:3:{s:4:"jour";s:6:"Samedi";s:5:"debut";s:5:"15h30";s:3:"fin";s:5:"16h30";}}', 0, 1, 1, 16, 0, 0, 0, NULL, 0, NULL, 'a:12:{i:0;a:4:{s:6:"auteur";s:22:"Morgane Barra (Jeanne)";s:4:"type";i:0;s:5:"texte";s:21:"Création de la fiche";s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-03-10 21:59:55";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:1;a:4:{s:6:"auteur";s:22:"Morgane Barra (Jeanne)";s:4:"type";i:1;s:5:"texte";N;s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-03-10 22:05:49";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:2;a:4:{s:6:"auteur";s:22:"Morgane Barra (Jeanne)";s:4:"type";i:11;s:5:"texte";N;s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-03-10 22:08:10";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:3;a:4:{s:6:"auteur";s:22:"Morgane Barra (Jeanne)";s:4:"type";i:1;s:5:"texte";s:39:"Horaires, l