(144, 215, 21, 'Foot US - Match', 2, 1, 1, 4, 'GONES- Foot US', 2, '0628204065', 'jorischorot@gmail.com', 'Joris CHOROT', 1, 0, 0, 0, 'Terrain de Rugby', 45.786019775087, 4.8788622004165, 1, '<P>Qui n''a jamais entendu parlé du Football américain dans les séries et les films? Tu as toujours voulu découvrir ce sport en France, de connaitre les règles? Vient assister au match de Football Américain, où l''équipe des Gones de Lyon rencontrera celle des Apaches de CPE. Spectacle garanti.</P>\r\n<P>Pour bien te préparer à ça, assiste dès 16h dimanche à une démonstration de Flag, ainsi qu''à la prestation des Cheerleaders des Gones de Lyon.&nbsp;</P>', 0, 0, 'a:1:{i:0;a:3:{s:4:"jour";s:8:"Dimanche";s:5:"debut";s:5:"16h00";s:3:"fin";s:5:"18h00";}}', 0, 1, 0, 0, 0, 0, 0, NULL, 1, 'Panneau\r\nMatchs Football Américain\r\nTerrain de Rugby\r\nMatch de Flag\r\nCheerleaders\r\nGones Lyon VS Les Apaches de CPE\r\nDimanche 16h- 18h', 'a:11:{i:0;a:4:{s:6:"auteur";s:13:"Sandra Ulrici";s:4:"type";i:0;s:5:"texte";s:21:"Création de la fiche";s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-03-30 20:49:08";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:1;a:4:{s:6:"auteur";s:13:"Sandra Ulrici";s:4:"type";i:1;s:5:"texte";N;s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-04-06 20:58:55";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:2;a:4:{s:6:"auteur";s:13:"Sandra Ulrici";s:4:"type";i:11;s:5:"texte";N;s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-04-06 21:01:27";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:3;a:4:{s:6:"auteur";s:13:"Sandra Ulrici";s:4:"type";i:1;s:5:"texte";N;s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-04-06 21:02:02";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:4;a:4:{s:6:"auteur";s:18:"Hugo Morales (S.M)";s:4:"type";i:7;s:5:"texte";N;s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-04-08 18:38:40";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:5;a:4:{s:6:"auteu