(145, 28, 21, 'Slack-Line', 2, 1, 1, 0, 'Bouvarel Guerric', 0, '0604476430', 'g.bouvarel@gmail.com', 'C''est moiiiiiiiiiiiiiiiiii!', 0, 0, 0, 0, 'Pelouse Rotonde', 45.783522719607, 4.8734736425056, 1, '<p>Tu as un grand talent d''équilibriste? Tu as toujours voulu marcher sur un fil? Tu aimes te ramasser comme une merde? Alors viens nous montrer tes talents sur la slack-line située entre deux arbres à côté du mur d''escalade.</p><div><br>Attention: Animation sous la responsabilité des utilisateurs.</div><div><br></div><p></p>', 0, 0, 'a:2:{i:0;a:3:{s:4:"jour";s:6:"Samedi";s:5:"debut";s:5:"11h00";s:3:"fin";s:5:"18h00";}i:1;a:3:{s:4:"jour";s:8:"Dimanche";s:5:"debut";s:5:"11h00";s:3:"fin";s:5:"18h00";}}', 1, 0, 0, 0, 0, 0, 0, 'Placer un panneau dédouanant toute responsabilité en cas de problèmes\r\n"Animation sous la responsabilité des utilisateurs"', 0, NULL, 'a:11:{i:0;a:4:{s:6:"auteur";s:26:"Guerric Bouvarel (Cul-sec)";s:4:"type";i:0;s:5:"texte";s:21:"Création de la fiche";s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-03-31 17:18:43";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:1;a:4:{s:6:"auteur";s:26:"Guerric Bouvarel (Cul-sec)";s:4:"type";i:1;s:5:"texte";s:105:"La slack, on se démerdera pour la trouver (karna ou autres) pas besoin de la demander à Villeurbanne ;)";s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-03-31 17:35:50";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:2;a:4:{s:6:"auteur";s:23:"Alexis Habert (Cetelem)";s:4:"type";i:5;s:5:"texte";N;s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-03-31 17:45:19";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:3;a:4:{s:6:"auteur";s:27:"Clément Niepceron (Cheval)";s:4:"type";i:6;s:5:"texte";N;s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-03-31 17:50:39";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:4;a:4:{s:6:"auteur";s:18:"Hugo Morales (S.M)";s:4:"type";i:7;s:5:"texte";s:38:"Tu seras sur l''anim toute la journée?";s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-04-01 18:55:39";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:5;a:4:{s:6:"auteur";s:26:"Guerric Bouvarel (Cul-sec)";s:4:"type";i:0;s:5:"texte";s:54:"Non. J''ai autre chose à faire comme manger du pâté.";s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-04-09 20:38:19";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:6;a:4:{s:6:"auteur";s:25:"Nicolas Minghetti (Carla)";s:4:"type";i:8;s:5:"texte";N;s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-04-12 19:47:54";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:7;a:4:{s:6:"auteur";s:24:"Guerric Bouvarel (Tacos)";s:4:"type";i:1;s:5:"texte";s:257:"La moquette et les matelas, c''est pour sécuriser un max l''animation. On prendra 2 rouleaux de moquettes et des matelas de la salle dodo qui sera à côté La moquette protégera les matelas pour qu''ils soient tout propres des 2 côtés pour dormir le soir.";s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-04-13 16:45:58";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:8;a:4:{s:6:"auteur";s:23:"Alexis Habert (Cetelem)";s:4:"type";i:8;s:5:"texte";s:260:"Euh, j''ai envie de dire que les matelas sont dégueu, certes, mais que j''ai pas envie de les mettre dehors sur la pelouse humide --> champignons !\r\nEt pour la moquette, il me faut les dimensions de tes rouleaux .. je pense que des 1*2m tu va faire la gueule ..";s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-04-13 19:47:13";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:9;a:4:{s:6:"auteur";s:24:"Guerric Bouvarel (Tacos)";s:4:"type";i:1;s:5:"texte";s:180:"C''est pour ça qu''on fait: Herbe<1ere epaisseur de moquette<Matelas<2eme epaisseur de moquette<air<Slack<monde pour protéger la moquette\r\nPour la moquette il faudrait du 10*1.5 :)";s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-05-07 18:55:26";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:10;a:4:{s:6:"auteur";s:23:"Alexis