(155, 212, 18, 'Drift Trikes', 2, 1, 1, 0, 'Maximilien Fontana', 0, '0666514506', 'maximilien.fontana@insa-lyon.fr', NULL, 1, 0, 0, 0, 'Parking Eiffel', 45.784216669094, 4.8753967863693, 1, '<p>Envie de t''initier au Drift Trikes pour réaliser des dérapages endiablés ? Rejoins nous samedi et dimanche après-midi ! Fun garanti !</p><p>Sport encore trop inconnu en France, le drift trike est la dernière pratique à la mode sur le territoire. Cependant jusqu’à maintenant il ne se pratique que dans des descentes, sur des routes non sécurisées. Voilà pourquoi 3 Insaliens vous proposent de vous initier à ce nouveau sport mécanique grâce à leur prototype construit au coeur même du campus.<br>Ce véhicule, contrairement au drift trikes normaux, est motorisé et permet donc la pratique dans n’importe quel lieu et surtout permet au conducteur de gérer sa vitesse afin de réaliser les plus belle figures tout en gardant le contrôle de son véhicule. Le drift n’est peut être pas quelque chose d’inné mais avec ce véhicule quelques minutes de pratique suffises à sa prise en main et les sensations de glisse vous donneront vite envie de ne pas vous arrêter…<br>Alors si vous êtes tentés par l’expérience, venez donc l’essayer lors du festival des 24h de<br>l’INSA !!<br>/!\\ Port de CHAUSSURES et CASQUE obligatoire<br></p>', 0, 0, 'a:2:{i:0;a:3:{s:4:"jour";s:6:"Samedi";s:5:"debut";s:5:"14h00";s:3:"fin";s:5:"18h00";}i:1;a:3:{s:4:"jour";s:8:"Dimanche";s:5:"debut";s:5:"14h00";s:3:"fin";s:5:"18h00";}}', 0, 0, 1, 16, 0, 0, 0, NULL, 1, 'A3 : Initiation au Drift Trikes', 'a:8:{i:0;a:4:{s:6:"auteur";s:24:"Clara Chovelon (Cagoule)";s:4:"type";i:0;s:5:"texte";s:21:"Création de la fiche";s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-04-10 18:18:01";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:1;a:4:{s:6:"auteur";s:17:"Constant Palliere";s:4:"type";i:1;s:5:"texte";N;s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-04-15 19:10:50";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Eu