(158, 210, 22, 'Festival d''Europe -Art Dreams', 2, 1, 0, 1, 'Festival Printemps d''Europe', 2, '0617436006', 'europeetcies@free.fr', NULL, 1, 0, 0, 0, 'Podium MDE', 45.783980989098, 4.8744016868248, 1, '<div><p>Pour la première fois cette année, le festival des 24H s''associe à un autre festival. Nous sommes très heureux d’accueillir Printemps d''Europe, le festival européen des arts et de la scène (Lyon 8ème).&nbsp;</p><p>La 7<sup>ème</sup>&nbsp;édition du Festival Printemps d''Europe aura lieu du 8 au 25 mai. Plus d''informations sur http://europeetcies.eu/ et sur la page facebook Festival Printemps d''Europe.</p><p>Art Dreams présente son spectacle Djoha, inspiré de contes indiens et persans. Djoha est un personnage mythique du folklore traditionnel, célèbre notamment au Proche &amp; Moyen Orient. A partir de 7 ans.</p></div>', 1, 0, 'a:1:{i:0;a:3:{s:4:"jour";s:8:"Dimanche";s:5:"debut";s:5:"17h00";s:3:"fin";s:5:"18h00";}}', 0, 1, 1, 16, 0, 0, 0, NULL, 1, 'Un panneau "Spectacle Djoha: Conte et légende d''orient. 17h" à côté du podium + pour indiquer depuis la pelouse des humas.', 'a:9:{i:0;a:4:{s:6:"auteur";s:22:"Morgane Barra (Jeanne)";s:4:"type";i:0;s:5:"texte";s:21:"Création de la fiche";s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-04-11 06:35:10";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:1;a:4:{s:6:"auteur";s:27:"Morgane Gogo Barra (Jeanne)";s:4:"type";i:1;s:5:"texte";N;s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-05-07 19:07:05";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:2;a:4:{s:6:"auteur";s:27:"Morgane Gogo Barra (Jeanne)";s:4:"type";i:11;s:5:"texte";N;s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-05-07 19:07:23";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:3;a:4:{s:6:"auteur";s:27:"Morgane Gogo Barra (Jeanne)";s:4:"type";i:1;s:5:"texte";N;s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-05-07 19:23:37";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:4;a:4: