(162, 197, 22, 'Débat interactif: Rivière du doute', 1, 1, 0, 0, 'Esprits critiques', 2, '0624899077', 'espritscritiques.jeunes@gmail.com', 'Asso qui fait partie de la Maison des Etudiants de Lyon. Ils animent le débat, en fonction des gens qui s''approchent.', 1, 0, 0, 0, 'Pelouse des Humas', 45.783111209016, 4.8743346315994, 1, '<p><span style="color: rgb(102, 102, 102); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 12px; line-height: 18px; text-align: justify;">C’est une technique de débat interactive ouverte à tous, visant à créer l’échange à partir d’une affirmation polémique. Chaque participant est invité physiquement et intellectuellement à se positionner dans l’espace du débat et à partager ses arguments dans une ambiance conviviale. L''animateur lance une affirmation, et chacun, selon son opinion, se positionne d''un côté ou de l''autre de l''animateur. Les personnes hésitantes se placeront au milieu: sur la rivière du doute.</span> </p><div style="text-align: justify;"><font color="#666666" face="Verdana, Arial, Helvetica, sans-serif"><span style="font-size: 12px; line-height: 18px;">Chacun est invité à s''exprimer dans la langue de son choix !</span></font></div><p></p>', 0, 0, 'a:1:{i:0;a:3:{s:4:"jour";s:6:"Samedi";s:5:"debut";s:5:"14h00";s:3:"fin";s:5:"18h00";}}', 0, 0, 0, 0, 0, 0, 0, NULL, 1, 'Fléchage:  "ESPRITS CRITIQUES: Débats interactifs"', 'a:9:{i:0;a:4:{s:6:"auteur";s:22:"Morgane Barra (Jeanne)";s:4:"type";i:0;s:5:"texte";s:21:"Création de la fiche";s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-04-15 16:39:28";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:1;a:4:{s:6:"auteur";s:27:"Morgane Gogo Barra (Jeanne)";s:4:"type";i:1;s:5:"texte";N;s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-05-07 19:40:09";s:13:"timezone_type";i:3;s:8:"timezone";s:13:"Europe/Berlin";}}i:2;a:4:{s:6:"auteur";s:27:"Morgane Gogo Barra (Jeanne)";s:4:"type";i:11;s:5:"texte";N;s:4:"date";O:8:"DateTime":3:{s:4:"date";s:19:"2014-05-0