(3330, 282, 26, '2014-04-24 16:14:55', 'Alors, les tables, c''est vu avec Alexis, l''arche TdR sera au QG pédale et l''arche 24 à la cave.\r\nLes ordis seront récupérés par une pédale le samedi matin en allant tenir le village coureur (ils sont marqués sur la fiche tache d la liste du matos, mais pas sur celle-ci parce qu''elle est pour les softs. Voilà ! :)', 0),
