(3332, 95, 48, '2014-04-24 16:17:36', NULL, 1),
(3333, 283, 26, '2014-04-24 16:17:43', 'Je pense que le matos va mettre du temps à arriver, on pourra pas installer tout de suite. Je peux avancer un peu, mais ça sert à rien de commencer trop tôt si on a rien à installer ^^\r\nLe vidéo proj'' c''est samedi matin qu''on le prend, effectivement. Et je crois que normalement, Kleson aura déjà posé le matos, oui.', 0),
