(3736, 735, 352, '2014-04-28 00:48:51', 'Sérieusement... Comment peux-tu juger du temps qu''il faut pour installer la déco de la BA sans savoir ni le thème, ni la quantité de déco à installer. Sans compter qu''on a le hall de la mde à partir de 14h, et qu''il faut donc aussi intégralement passer la serpillières dans le hall et le salon de lecture, déplacer des meubles, bouger des tables, trouver des chaises, installer les lumières, drapper toutes les fenêtres de la MdE, et tout cela à faire en plus des 75 repas à préparer pour le soir même, et à ce moment précis, la vaisselle du midi à faire... Je te promet que si à un quelconque moment, je me rends compte que j''ai trop d''orgas, je te les renvois... mais honnêtement, non, je ne pense pas abuser. J''ai vraiment limité au stricte minimum...', 1),
(3737, 745, 352, '2014-04-28 00:59:37', 'Là encore... je ne pense pas avoir abusé sur le nombre d''orgas le dimanche... mais j''ai les gens en cuisine qui doivent préparer pour le lendemain car on perd une partie du matériel dans la nuit, et puis il faut absolument que tout soit rangé avant la fermeture de la mde le soir donc avant minuit. La MdE étant ouvert le lendemain, toutes les salles qui ont été prêtées pour le WE doivent être rangées et toute la déco démontée. Il faut également repasser un grand coup de nettoyage dans toutes les salles et le hall alors oui, cela peut paraître beaucoup, mais la MDE doit absolument être propre à minuit. C''est une condition non discutable pour continuer à bénéficier de la MdE d''années en années. Mais promis, si les gens ont terminés plus tôt que prévu, alors je te les enverrais.', 1),
(3738, 741, 352, '2014-04-28 01:05:23', 'On a le choix entre un soft à plein temps ou mettre un AS... Règle cela avec Cheval. Mais non, on ne peux pas faire avec les talkies car seul le resp concert en a un, et ce n''est pas lui qui amène les artistes à la BA... il a un peu autre chose à foutre... comme gérer la grande scène. Ou alors, vous mettez des talkies à tous les resp concerts. Oui, ce n''est pas une super tâche, je comprends parfaitement, mais bon, ce gars là aura la chance de rencontrer tous les artistes, de les accueillir, les installer et s''assurer qu''ils vont bien. Et puis il aura droit à manger à la BA... cela récompensera bien sa peine.', 1),
(3739, 743, 352, '2014-04-28 01:06:20', 'On a le choix entre un soft à plein temps ou mettre un AS... Règle cela avec Cheval. Mais non, on ne peux pas faire avec les talkies car seul le resp concert en a un, et ce n''est pas lui qui amène les artistes à la BA... il a un peu autre chose à foutre... comme gérer la grande scène. Ou alors, vous mettez des talkies à tous les resp concerts. Oui, ce n''est pas une super tâche, je comprends parfaitement, mais bon, ce gars là aura la chance de rencontrer tous les artistes, de les accueillir, les installer et s''assurer qu''ils vont bien. Et puis il aura droit à manger à la BA... cela récompensera bien sa peine.\r\n\r\nEt non, il y a bien 2 accès à la MdE pour les coureurs et le cocktail de presse.', 1),
(3740, 749, 352, '2014-04-28 01:06:35', 'On a le choix entre un soft à plein temps ou mettre un AS... Règle cela avec Cheval. Mais non, on ne peux pas faire avec les talkies car seul le resp concert en a un, et ce n''est pas lui qui amène les artistes à la BA... il a un peu autre chose à foutre... comme gérer la grande scène. Ou alors, vous mettez des talkies à tous les resp concerts. Oui, ce n''est pas une super tâche, je comprends parfaitement, mais bon, ce gars là aura la chance de rencontrer tous les artistes, de les accueillir, les installer et s''assurer qu''ils vont bien. Et puis il aura droit à manger à la BA... cela récompensera bien sa peine.\r\n\r\nEt non, il y a bien 2 accès à la MdE pour les coureurs et le cocktail de presse.', 1),
