(2, 'manifestation_plages', 'Plages de la manifestation', '{"1":{"nom":"PreManif","debut":"2014-05-19 00:00","fin":"2014-05-23 18:00"},"2":{"nom":"Manif","debut":"2014-05-23 18:00","fin":"2014-05-26 08:00"},"3":{"nom":"PostManif","debut":"2014-05-26 08:00","fin":"2014-06-01 00:00"},"4":{"nom":"PrePreManif","debut":"2014-04-14 00:00","fin":"2014-05-18 00:00"}}', 'Tableau JSON associatif de plages. Exemple : "{"1":{"nom":"Prémanif","debut":"2012-05-16 00:00","fin":"2012-05-24 00:00"}}". Les plages doivent commencer et finir à 0h00.'),
(3, 'manifestation_organisation_nom', 'Nom de l''organisation', '24 Heures de l''INSA', NULL),
