(7, 'manifestation_orga_responsableconfiancemin', 'Confiance minimale pour être responsable d''une tâche', '500', NULL),
(8, 'manifestation_permis_libelles', 'Libellés des permis', '{"0": "Pas de permis","1": "Permis - de 1 an","2": "Permis de + de 1 an" }', 'Objet JSON. Exemple : "{"0": "Pas de permis","1": "Permis - de 2 ans","2": "Permis de + de 2 ans" }"'),
(9, 'animations_db_path', 'Chemin vers la BDD des anims', '/var/www/animaker/Backend/Data/DB/DB.sqlite', 'Chemin absolu vers la base SQLite des animations, au format Animaker. Laisser nul sinon.'),
(10, 'manifestation_edition', 'Numéro de l''édition', '40', NULL),
(11, 'phpm_contenu_page_principale', 'Contenu de la page principale', '<div class="row-fluid">\r\n<img src ="http://application.24heures.org/public/images/Assomaker.png" class="span4" />\r\n</div>\r\n<blockquote>\r\n              <p>Software of tomorrow, for the people of today&trade;</p>\r\n              <small>24 Heures de l''INSA</small>\r\n</blockquote>\r\n<p></p>', NULL),
(12, 'phpm_orgasoft_inscription_returnURL', 'URL de retour  inscription orga', 'http://www.24heures.org/orga', NULL),
(13, 'phpm_admin_email', 'Email de l''administrateur', 'humain@24heures.org', NULL),
(14, 'phpm_contenu_mail_confirmation_soft', 'Contenu du mail de confirmation soft', '<p>Ton inscription en tant qu''Orga Soft  pour la 40<sup>e</sup> édition des 24 Heures de l''INSA a bien été prise en compte.</p><p>Pour toute question, envoie un email à <a href="mailto:humain@24heures.org">humain@24heures.org</a> ou répond à cet email.</p><p>Merci beaucoup de ton aide et à très bientôt sur la manif'' !</p><p><em>Dina et Hugo.</em></p>', NULL),
(15, 'manifestation_charisme_minimum', 'Charisme minimum pour s''inscrire', '30', NULL),
(16, 'phpm_inscription_disponibilites_consignes', 'Consignes concernant les disponibilités', NULL, NULL),
(17, 'manifestation_orga_plagehoraireconfiancemin', 'Confiance minimale pour être désigné dans une plage horaire', '499', NULL),
(18, 'phpm_planning_message', 'Message affiché sur les plannings', '<em>Attention : planning non définitif.</em>', NULL),
(19, 'phpm_planning_fin', 'Heure de fin des plannings', '28-05-2014 00:00:00', NULL),
(20, 'phpm_secret_salt', 'Clé secrète pour générer les URL de login', 'ayfgsrhtrfsh', NULL),
(21, 'phpm_tache_heure_limite_validation', 'Heure limite pour envoyer les fiches tâches en validation', '2014-05-21 00:00:00', NULL),
(22, 'phpm_planning_visiteurs', 'Autoriser les visiteurs à accéder à leur planning', 'false', NULL),
(23, 'phpm_contenu_mail_planning', 'Contenu du mail de notification de planning', '<p>Au risque d''en spammer certains, pour lesquels on s''excuse, il semblerait que nous ayons eu des soucis informatiques. Tu pourras trouver le lien pour consulter ton planning jusqu''à mercredi en bas de ce mail. <br/><br/>\r\nJ''en profite pour rappeler la date du briefing :<strong> mercredi 15 mai à 19h en amphi Freyssinet (GCU).</strong> C''est à ce moment là que tu auras ton planning définitif pour le week-end.<br/><br/>Merci à toi !</p><p><em>Samia et Ludo.</em></p>', NULL),
