(16, 12, 1, '3', '2012-12-30 12:00:50', 'Bonsoir Laurent,\r\n \r\nSuite à notre conversation téléphonique, voici un récapitulatif du partenariat entre TCL/SYTRAL et les 24h de l’Insa :\r\n \r\nContreparties SYTRAL :\r\n-          Dispositif voile métro du 13/05 au 19/05/13\r\n\r\n-          Dispositif écrans ITCL du 13/05 au 19/05/13\r\n\r\n \r\nContrepartie INSA :\r\n-          Logo SYTRAL/TCL sur documents de communication.\r\n\r\n \r\nPascaline Comas en copie de ce mail vous fera parvenir les éléments techniques indispensables à la création des supports de communication ainsi que les dates limites d’envoi de ces derniers.\r\n \r\nJe reste bien sur à votre disposition pour tout complément d’information.'),
(17, 13, 16, '0', '2013-01-02 20:14:18', 'Le Centre des Jeunes Dirigeants de Lyon font une étude sur l''effet du sport et la santé du dirigeant sur celle de leur entreprise. Leur épreuve finale est de participer aux courses des 24heures de l''INSA'),
(18, 15, 1, '0', '2013-01-12 15:55:22', 'À tenter de vendre &nbsp;le silver<div><br></div><div>*Demander le nombre de personnes</div><div><br></div><div>* Leur évoquer en premier le bronze :&nbsp;</div><div>400 avec 4 participants + 25/p sup.</div><div>Exemple 560 p 12 personnes</div><div><br></div><div><i>Cependant, avec ce que vous m''avez dit ....</i></div><div><br></div><div>FAIRE RÊVER LA FILLE POUR VENDRE LE SILVER !!!<br></div><div><div><br>lui proposer 15% de réduction</div><div>* En priorité : Le silver&nbsp;</div><div>Proposer de faire deux équipes en compétition</div><div><span style="vertical-align: baseline;">Espace pour votre équipe : Campement</span><br><span style="vertical-align: baseline;">Vélo fournis</span><br><span style="vertical-align: baseline;">Classement des coureurs de votre société</span><br><span style="vertical-align: baseline;">Maillots au couleurs de votre entreprise</span><br><span style="vertical-align: baseline;">Une remise des prix dédiée, interne</span><br><span style="vertical-align: baseline;">Repas en terrasse avec vue panoramique sur la course</span><br></div><div><span style="vertical-align: baseline;"><br></span></div><div><b>Leur évoquer en premier le bronze</b><br></div><div><br></div><div>Mentionner qu''il n''y a pas de pub dans le silver, évoquer le gold si ils nous en parlent</div><div><br></div><div><br></div><div><br></div></div>'),
