INSERT INTO `Tache` (`id`, `responsable_id`, `groupetache_id`, `importid`, `nom`, `consignes`, `materielSupplementaire`, `permisNecessaire`, `lieu`, `statut`, `commentaireLog`) VALUES
(1, 16, 305, NULL, 'Tache N°1', '<p>Racheter la tâche N°1 parce que c''est beaucoup de charisme</p><div><br></div><p></p>', 'Une demi pince coupante', 0, 'ZC', -1, 'raf'),
(2, 45, 307, NULL, 'Suivi montage structure', '<p>S''assurer que les layhers pour les bars et la rampe PMR sont livrés ainsi que les arches d''entrée.</p><div>Faire un point avec Gilles sur l''avancement du montage.</div><div>Répondre aux éventuels besoins des tecks en cette fin de journée difficile si besoin.</div><div><br></div><div>Prendre l''apéro avec tous les teckos parce que bon, c''est un principe...</div>', NULL, 0, 'Grande scène', 3, 'non'),
(3, 45, 307, NULL, 'Accueil Gilles et Ertse', '<p>Etre dispo pour accueillir Gilles, Yves et le personnel de Ertse.</p><div>On leur montre la backline et tout comme c''est joli dedans. On fait venir Valerie Damidot pour réaménager l''intérieur pour que ce soit cosy et design.</div><div><br></div><div>On leur donne des coups de pied au cul pour qu''ils aillent bosser parceque bon il faudrait quand même pas qu''ils soient là pour glander. De toute façon tout le monde déteste les teckos...</div>', NULL, 0, 'Grande scène', 3, 'non'),
(4, 45, 307, NULL, 'Montage Light & Son', '<p>Rends-toi sur la zone concert et trouve Hermione (c''est facile : c''est marqué "Hermione" sur son T-shirt, il a un talkie dans l''oreille, et tu n''a jamais vu quelqu''un dégager autant de charisme. Tu ne peux pas le louper). Il traîne toujours autour de la grande scène ou dans la zone concert. (Sinon certains l''appellent Thomas aussi il parait...)</p><div><br></div><div>Il te remettra tes EPI (gants, chaussures de sécu, casque) et te&nbsp;briefera sur ta mission.</div><div><br></div><div>Attention, tu travailles avec des&nbsp;professionnels, ne fais pas n''importe quoi, écoute leurs remarques si ils en ont, et en cas de soucis, n''hésite pas à demander à Thomas ou Gilles (régisseur général).</div>', NULL, 0, 'Grande scène', 3, 'non'),
(5, 45, 308, NULL, 'Piliers de comptoir', '<p>Viens sur la ZC, trouve Hermione (le mec bizarre qui déteste tout le monde et qui conduit le manitou), il te donnera des chaussures de sécu (si tu n''en a pas), un casque de chantier (si tu n''en a pas), des gants (si tu n''en a pas) et il te prêtera du charisme (si tu n''en a pas).</p><div>Il t''expliquera tout ce qu''il attend de toi !</div><div><br></div><div>Le but de la journée est de monter la structure de tous les bars et du stand bouffe des 24h, et ça c''est du charisme !</div>', NULL, 0, 'ZC', 3, 'non'),
(6, 3, 309, NULL, 'Réception de la petite scène de Villeurbanne', '<p>Accueillir le camion scène de Villeurbanne sur le campus et lui montrer son emplacement.</p>', NULL, 0, 'Petite scène', 3, 'non'),
(7, 3, 310, NULL, 'Préparation des loges artistes', '<p></p><div><ul><li>Se rendre dans le creux GCU et récupérer 5 frigos / <b>Attention à ne pas trop malmener les frigos, \r\nil faut qu''ils marchent le soir même</b></li><li>Monter les frigos au premier étage de GCU<br></li><li>À 14h30, récupérer les clés d''un 20m3 et prendre le volant de ce charismatique véhicule</li><li>Se\r\n rendre à la cave du Premier Cycle pour récupérer 5 canapés et 7 fauteuils</li><li>Se rendre derrière la grande scène pour récupérer le petit matériel dans la cabane backline</li><li>Se rendre dans le creux GCU pour décharger tout ce matériel au pied des escaliers qui mènent aux loges</li><li>Ramener le 20m3 et ses clés au QG orga</li><li>Monter tout le matériel au premier étage<br></li><li>Aménager\r\n les salles (pousser les tables contre les murs, ranger les chaises, \r\néventuellement éteindre les ordinateurs et les vidéoprojecteurs, effacer les \r\ntableaux, etc.)</li><li>Donner un petit coup de balai si nécessaire...</li><li>Mettre le mobilier en place dans les loges (un frigo par loge, un canapé \r\net un fauteuil par loge, mettre en place au moins un sac poubelle\r\n par loge, etc.)</li><li>Récupérer les kits caterings des artistes</li><li>Disposer les caterings dans les loges</li><li>Mettre sur les portes des petites affichettes avec le nom des \r\ngroupes sur leur loge et le timing de la soirée (à défaut : écrire sur \r\nla porte avec une craie façon gros sale mais le plus propre possible)</li><li>Stocker le mobilier ou le catering en rab'' dans un lieu qui reste à définir<br></li><li>Dégager le couloir des loges (éventuellement petit coup de balai si nécessaire)</li></ul></div><p></p>', NULL, 0, 'GCU', 3, 'non'),
(8, 3, 311, NULL, 'Récupérer les clés des chambres', '<p></p><ul><li>Aller à la DDR pour prendre le bon pour récupérer les clés</li><li>Récupérer les clés des chambres auprès des régisseurs des résidences concernées</li><li>Accrocher les clés sur un tableau à clés où il n''y aura que les clés des chambres (local ou QG orga)</li><li>Imprimer la fiche de répartition des chambres et le planning de répartition du matériel</li><li>Rassembler le papier toilette, les serviettes, les savons et les sacs poubelle qui iront dans les chambres</li></ul><p></p>', 'Fiche de répartition des chambres', 0, 'Résidences INSA', -1, 'non (raf)'),
(9, 45, 312, NULL, 'Accueil Afterglow', '<p></p><ul><li>Récupérer les bracelets sécu du groupe</li><li>Se tenir prêt à l''arrivée du groupe (téléphone chargé, allumé et pas en mode vibreur)</li><li>Leur remettre leurs bracelets sécu</li><li>Les emmener sur la zone concerts et les confier à Thomas pour qu''il les mette en relation avec les équipes techniques</li><li>Leur montrer l''emplacement du restaurant artistes</li><li>Se tenir à leur disposition (téléphone chargé, etc.)</li></ul><u>Après le concert :</u><br><ul><li>Leur faire remplir les documents de la Sacem (ou récupérer leur version pré-remplie)</li></ul><u>Timing du groupe :</u><br><ul><li>Get-in :17h00</li><li>Balances :18h00-19h30</li><li>Concert : 20h30-21h15</li><li>Repas : 21h30</li></ul><div><u>Logement :</u> Pas de logement</div><div><br></div><u>Contacts :</u><br><ul><li>Simon Delicata (Chanteur) : 06 10 95 60 35</li><li>Xavier Desprat (Son) : 06 74 34 25 25<br></li><li>Cindy Legrand (Lumière) : 06 74 62 62 39<br></li></ul><p></p>', NULL, 0, 'Everywhere', 3, 'non'),
(10, 3, 313, NULL, 'Runs artistes', '<p>Tu es le king des chauffeurs.</p><p><br></p><p>Tu vas aller chercher des artistes à l''aéroport, à la gare, à leur hôtel, tu vas taper la convers avec les gros noms du festival et tu pourras même voir des petits bouts de leurs concerts. Elle est pas belle la vie ? Il faut juste que tu sois pas plein de boue et habillé comme un clochard, que tu aies ton permis, que tu n''ais pas bu et que tu sois motivé !</p><p>Pour un artiste logeant à l''hôtel, les trajets à assurer sont les suivants :</p><p>Avion/Train =&gt; Hôtel =&gt; Festival (concert) =&gt; Hôtel =&gt; Avion/Train</p><p>Pour un artiste logeant à l''Insa, les trajets à assurer sont les suivants :</p><p>Avion/Train =&gt; Festival (concert) =&gt; Avion/Train</p><p><br></p><p>Attention : les trajets Hôtel =&gt; Festival et Festival =&gt; Hôtel sont difficiles à anticiper car ils se font souvent un peu à la demande des artistes.</p><p><br></p><p>Récap des horaires de tout le monde :</p><p><br></p><p>DIGITALISM (Hôtel Novotel Confluence) :</p><p></p><ul><li>le manager (Piet) arrive en train à la Part-Dieu vendredi à 16h</li><li>les deux artistes arrivent en avion à St-Exupéry vendredi à 18h20</li><li>tout le monde repart en avion, décolage à 16h samedi de St-Ex</li></ul><div>Contact : Piet (+32 473 65 33 95)</div><div><br></div><div><br></div><div>OVERWERK (Hôtel Ariana Villeurbanne) :</div><div><ul><li>l''artiste arrive vendredi à 17h56 en train à la Part Dieu</li><li>L''artiste repart samedi à 14h04 en train à la Part Dieu</li></ul><div>Contact : ???</div></div><div><br></div><div><br></div><div>GOLDFISH (logement Insa) :</div><div><ul><li>arrivée en avion à St-Exupéry samedi à 17h10</li><li>repart en avion, décolage à 15h50 dimanche de St-Ex</li></ul><div>Contact : Nick (+27 82 258 2828)</div></div><div><br></div><div><br></div><div>SEBASTIAN et CANBLASTER (Hôtel Ariana Vileurbanne) :</div><div><ul><li>arrivée en train à la Part-Dieu samedi à 20h56</li><li>départ en train de la Part-Dieu dimanche à 14h04</li></ul>Contact : Sébastien Akchoté (SebastiAn) (07 85 53 89 07), et Cédric Steffens (Canblaster) (06 78 34 42 54)</div><div><br></div><div><br></div><div>DARIUS (Hôtel Ariana VIlleurbanne) :</div><div><ul><li>arrivée en train à la Part-Dieu samedi à 19h56</li><li>départ en train de la Part-Dieu dimanche à 14h04 (trajet à coupler avec celui de SEBASTIAN et de CANBLASTER)</li></ul>Contact : Terence N''Guyen</div><div><br></div><div><br></div><div>Quand tu as des creux dans ton planning, n''hésite pas à venir demander des infos complémentaires sur les artistes aux référents concerts qui seront sur le festival.</div><div><br></div><div>En cas de souci, si les artistes demandent des choses non prévues et/ou abérrantes ou que ça ne semble pas possible de réaliser tous les trajets, appelles Thomas (06.08.94.44.88) ou Jérémie (06.45.52.58.66), ils sauront te dire quoi faire ou bien envoyer du renfort pour assurer un trajet avec un autre véhicule.</div><p></p>', NULL, 0, 'Everywhere', 0, 'non'),
(11, 3, 314, NULL, 'Installer le troll', '<p>Blank</p>', NULL, 0, 'MdE', -1, 'non'),
(12, 45, 315, NULL, 'Garder vaillamment la grande scène', '<p>Ici, c''est toi le king.</p><p>Une ombre qui bouge ? Un romano qui passe ? Une chauve-souris à l''oeil fourbe ?</p><p>Tu dois l''arrêter !</p><p>Ta mission (si toutefois tu l''accepte), est de prendre place sur la grande scène avec ton joyeux acolyte, d''avoir l''oeil vif et de patrouiller vaillamment pour garder la scène, tout le matériel stocké autour et les bars devant la scène avec ce qu''il y a derrière.</p><p>Un seul mot d''ordre : personne ne passe (à l''exception des orgas hard des 24, des techniciens qui viennent travailler le matin à partir de 7h au plus tôt, et de ton relais de gardiennage si il y en a sinon ta mission va être très très longue...)</p><p>Ton contact ? =&gt; Hermione, resp grande scène <a href="tel:(06.08.94.44.88">(06.08.94.44.88</a>)</p><p>Ton matériel ? =&gt; Ta bravoure et un talkie walkie</p><p>Je beaucoup sur vous.</p>', NULL, 0, 'Grande scène', 3, 'non'),
(13, 223, 316, NULL, 'Départ concession churros', '<p>Demander à la concession d''arrêter ses ventes à 16h00.</p><p>Appeler le QG sécu au talkie.<br></p><p>Faire l''état des lieux de la concession quand elle s''en va.</p><p>Lui rendre son chèque de caution si elle a été sage.</p>', NULL, 0, 'Entre piscine et GCU', 3, 'non'),
(14, 223, 316, NULL, 'Accueil concession churros', '<p>Prévenir la log au talkie de l''arrivée de la presta.</p><p>Accueillir Mme Pelli.&nbsp;son numéro : 04 90 25 00 62</p><p>Faire l''état des lieux. Récupérer le reste de la location (1872€) et le chèque de caution (1000€). Communiquer le numéro sécu : 04 72 43 70 70 ou&nbsp; 04 72 43 60 00</p><p>Pour le branchement élec, s''assurer que la presta possède bien son propre groupe électrogène et qu''elle ne se branche pas à côté.</p>', NULL, 0, 'entre piscine et GCU', -1, 'non'),
(15, 206, 317, NULL, 'Installation espace détente', '<p>Sacré veinard, tu as été affecté à l''installation de l''espace détente, l''atelier de musculation phare des 24h !</p><div>Rejoins Mamie Caro (06 79 12 17 05) ou Doc-X (07 77 89 97 97) au bar bouffe.</div><div><br></div><div>Accompagne-le au local de stockage des tables et des bancs (dépôt AIP, l''orga bouffe qui sera avec toi te guidera), et à l''aide de tes bras musclés, fait vibrer toutes les filles, avant de déposer tout le matos au niveau de l''espace détente, à côté du bar bouffe.</div><p></p>', NULL, 0, 'Bar bouffe', 3, 'non'),
(16, 206, 317, NULL, 'Désinstallation espace détente', '<p></p><ul><li>Rejoins Mamie Caro (06 79 12 17 05) ou Doc-X (07 77 89 97 97) au bar bouffe et prends toutes les indications nécessaires de leur part.</li><li>Passe un coup d''éponge sur les tables pour les nettoyer (il faut les rendre propres à ceux qui nous les prêtent)</li><li>Fais appel à ta force pour ramener les tables et les bancs au dépôt AIP</li></ul><div>(pour l''emplacement des tables au dépôt AIP, demande à Léo ou Caro de faire le premier voyage avec toi !)</div><p></p>', '- LOG : retour des tables et bancs', 0, 'Entre piscine et GCU', 3, 'non'),
(17, 206, 318, NULL, 'Préparation de l''ambiance', '<p><b>Samedi :&nbsp;</b></p><p>Checker TOUTES les listes de courses : BA (lundi), BA frais + Coms (jeudi) --&gt; Caro garde toutes les listes de courses.</p><p><b>Dimanche :&nbsp;</b></p><p>Préparer les pochettes avec tous les papiers nécessaires pour chacune de nos <b><u>concessions</u></b> (Churros, Bonbons et Glace) :</p><div><ul><li>Fiche contact</li><li>Contrat qui mentionne les sommes</li><li>Fiche d''état des lieux</li><li>Enveloppe pour mettre les chèques (caution + solde)</li></ul><div>Préparer les pochettes <u><b>fournisseurs</b></u> :</div></div><div><ul><li>Options (photocopie du contrat signé, chèque de règlement)</li><li>Pomona (devis et facture)</li><li>Cottendin (facture)</li></ul><div>Faire des mémos prix pour les orgas. Préparer et imprimer les tickets boissons/repas pour les différentes com''.</div></div><div><br></div><div>Préparer une pochette de matos (ciseaux, scotch, stylos, carnets pour les grosses commandes)</div><div><br></div><div>Préparer le sac et les étiquettes des lots de produits vendus, et accompagner le tout d''une fiche d''explications.</div><div><br></div><div><b>Jeudi :&nbsp;</b></div><div>Passer au Bocal récupérer les pochettes utiles sur la manif qui seront stockés dans le casier bouffe (Caro et Léo les gardent sur eux).&nbsp;</div><p></p>', NULL, 0, 'Local', 3, 'non'),
(18, 206, 318, NULL, 'Service Bouffe', '<p>Ton défi si tu l''acceptes : payer ton charisme pour vendre des hot-dogs, des frites et des saucisses. :)</p><div><b><u>Quand tu arrives :</u></b></div><div><ul><li>cherche le resp du stand : demande Mamie Caro (06 79 12 17 05) ou Doc-X (07 77 89 97 97)</li><li>fais-toi briefer</li></ul><div><b><u>A ton poste</u></b>, voici comme se déroule une commande type (relis bien ce topo avant de venir, on ira plus vite ;) ) :</div></div><div><ul><li>prendre la commande d''un client. Attention : mémorise bien son visage pour ne pas refiler la commande à un autre rôti ;</li><li>maintenant, prends-lui son argent ;</li><li>va voir le monsieur et la dame à la caisse et donne lui les sous sous (eh non, ce n''est pas pour toi !) ;</li><li>il/elle encaisse les sous et te rend la monnaie ;</li><li>tu donnes la commande au pivot (c''est le gaillard derrière qui s''active avec les frites, les sandwichs et les sauces)</li><li>tu patientes, et le pivot finit par te filer ta commande</li><li>tu donnes au client ce qu''il a demandé, en n''oubliant pas de lui rendre sa monnaie</li></ul><div>Pour les grosses commandes, utilise les carnets disponibles au niveau des caisses pour ne rien oublier.</div></div><div><br></div><div>Attention : si un client n''a pas de monnaie et veut payer par carte bancaire, appelle le resp CB (tu le reconnaitra car il porte un terminal CB portable) et il encaissera pendant que tu passes la commande au pivot.</div><div><br></div><div><b>Important : <u>on ne sert pas de bière</u> SANS NOURRITURE <u>après 19H</u>.</b></div><div><b><br></b></div><div>Si tu rencontres un problème pendant ton créneau, adresse-toi à un resp'' bouffe, il est là pour t''aider ! ;)</div><p></p>', '- Carnets pour prendre les commandes\r\n- Stylos', 0, 'Bar bouffe', -1, 'non'),
(19, 206, 318, NULL, 'Pivot Bar Bouffe', '<p>Ta mission pendant ce créneau : faire le relais entre ceux qui prennent les commandes et les gens du Karna qui les préparent.</p><div><br></div><div><u><b>Quand tu arrives :</b></u></div><div><ul><li>cherche le resp du stand : demande Mamie Caro (06 79 12 17 05) ou Doc-X (07 77 89 97 97)</li><li>fais-toi briefer</li></ul><div><b><u>A ton poste</u></b>, tu devras (dans l''ordre) :</div></div><div><ul><li>écouter la commande du serveur</li><li>aller chercher la commande à la zone de préparation</li><li>poser la commande sur les tables situées entre les caisses</li></ul><div>C''est tout ce que tu as à faire !</div></div><div><br></div><div>Si tu rencontres un problème pendant ton créneau, adresse-toi à un resp'' bouffe, il est là pour t''aider ! ;)<br></div><p></p>', NULL, 0, 'Bar bouffe', -1, 'non'),
(20, 206, 318, NULL, 'Responsable CB', '<p>Félicitation, tu as été choisi pour gérer les paiements par carte bancaire. :) </p><div><br></div><div><b><u>Quand tu arrives :</u></b></div><div><ul><li>cherche le resp du stand : demande Mamie Caro (<a href="tel:06 79 12 17 05">06 79 12 17 05</a>) ou Doc-X (<a href="tel:07 77 89 97 97">07 77 89 97 97</a>)</li><li>fais-toi briefer</li><li>récupère ton terminal CB</li></ul><div><b><u>A ton poste :</u></b></div></div><div><ul><li>pose-toi derrière le bar et attends qu''un serveur t''appelle pour encaisser une commande par CB</li><li>prends la commande et dis au serveur d''aller la chercher</li><li>en attendant, encaisse le client :</li><ul><li>tape le montant de la commande avec les centimes</li><li>appuie sur le bouton Valider (c''est facile, c''est le bouton vert)</li><li>insère la carte du client dans le terminal et tends-le lui pour qu''il tape son code (tu ne dois JAMAIS laisser le terminal CB au rôti en face de toi !!)</li><li>un reçu va sortir. Vérifie que le paiement est bien accepté (car si le paiement est refusé, un reçu sort aussi), découpe-le et donne-le lui</li><li>ré-appuie sur Valider et un autre reçu va sortir. Garde-le précieusement dans la pochette "reçus" prévue à cet effet que tu trouveras aux caisses</li></ul><li>donne la commande au caissier afin qu''il la comptabilise</li></ul><div>N''oublie pas de poser ton terminal sur sa base pour le recharger.</div><div><br></div><div><b><u>Attention :</u> tu ne dois jamais quitter ton poste tant que la relève n''est pas arrivée !</b></div></div><div><b><br></b></div><div><b><u>Attention :</u> ne pers pas le terminal ni le reçus, ils sont très importants !</b></div><p></p>', '- 2 terminaux CB\r\n- 2 pochette "Reçus" charismatiques pour garder les reçus de CB', 0, 'Bar bouffe', 3, 'non (raf)'),
(21, 206, 318, NULL, 'Caissier Bar Bouffe', '<p><b><u>Cette tâche est IMPORTANTE, tu dois être bien à l''heure !</u></b></p><div><b><u><br></u></b></div><div>Félicitations, tu es affecté aux caisses du meilleur bar de la manif : le bar bouffe de l''ambiance !</div><div><br></div><div><div><b><u>Quand tu arrives :</u></b></div><div><ul><li>cherche le resp du stand : demande Mamie Caro (<a href="tel:06 79 12 17 05">06 79 12 17 05</a>) ou Doc-X (<a href="tel:07 77 89 97 97">07 77 89 97 97</a>)</li><li>fais-toi briefer</li></ul><div><b><u>A ton poste</u></b>, ta mission est de :</div></div></div><div><ul><li>écouter le serveur qui te donnera la commande et l''argent</li><li>dire au serveur de patienter pendant que tu comptes les sous (il ne faudrait pas refiler la commande à un rôti qui n''a pas payé assez)</li><li>compter les sous et rendre la monnaie au serveur. S''il en manque, renvoie le serveur voir le client pour réclamer les sous</li></ul><div>Certains consommateurs paient avec les tickets "repas" ou "boisson". Le premier donne droit à un menu (1 sandwich + 1 barquette de frites + 1 boisson), l''autre à une boisson au choix (ça peut être une bière).</div><div>Garde bien ces tickets dans la caisse quand tu les récupères, et vérifie qu''ils sont valables pour le jour-même quand on te les donne.</div><div><b>Il n''y a pas de conso gratuite, quel que soit le motif !</b></div></div><div><b><br></b></div><div>Si tu as un paiement par CB : tu appelles le responsable CB et tu fais attention de bien stocker le reçu CB commerçant si le responsable CB ne l''a pas fait : il est TRES important !</div><div><br></div><div>Si le paiement est effectué par chèque, vérifie le montant. L''ordre doit être "Club des 24 heures de l''INSA". &nbsp;Vérifie qu''il est bien daté ET signé !</div><div>&nbsp;<b>/!\\ ne pas accepter les chèques en dessous de 7€ /!\\</b><br></div><div><b><br></b></div><div><b>Surtout, attends bien la relève avant de partir de ton poste. Si tu es sur le dernier créneau de la soirée, attends que la trésorière vienne récupérer la caisse, ou adresse-toi à un resp'' bouffe.</b></div><p></p>', NULL, 0, 'Bar bouffe', 3, 'non'),
(22, 206, 318, NULL, 'Tireur', '<p>Félicitation, tu as été choisi pour tirer des bières.</p><div><b><u>Quand tu arrives :</u></b><br></div><div><ul><li>cherche le resp du stand : demande Mamie Caro (06 79 12 17 05) ou Doc-X (07 77 89 97 97)</li><li>fais-toi briefer</li><li>apprends l''art de tirer une bière sans la faire TROP mousser et dans le respect de la tireuse</li></ul><div><b><u>A ton poste :</u></b></div></div><div><ul><li>attends la commande d''un serveur</li><li>tires la bière dans une eco-cup</li><li>donne-la au serveur</li></ul><div><p>Attention, n''oublie pas qu''une bière sans mousse, c''est un peu comme:</p><p></p><ul><li>une soupe sans sel</li><li>une fille sans cheveux (non mais allô quoi?!)</li><li>un jour sans soleil</li><li>une femme sans sein</li><li>une éjaculation sans sperme..</li><li>enfin, j''espère que tu m''as compris xD</li></ul><p></p><p>Vive la bière :)</p></div></div>', NULL, 0, 'Bar bouffe', -1, 'non'),
(23, 223, 321, NULL, 'Accueil concession glaces', '<p>Prévenir la log au talkie de l''arrivée de la presta (pour raccordement électrique).</p><p>Accueillir Jérôme Aillaud. Son numéro : 06 22 61 62 22</p><p>Faire l''état des lieux. Récupérer le reste de la location (768€) et le chèque de caution (1000€). Communiquer le numéro sécu : 04 72 43 70 70 ou&nbsp; 04 72 43 60 00</p><p>Pour le branchement élec, attendre que la log arrive et voir avec elle.</p>', 'Pochette du concessionnaire Aillaud.', 0, 'Trottoir devant le nouveau bâtiment de la piscine', -1, 'non'),
(24, 223, 321, NULL, 'Départ concession glaces', '<p>Demander à la concession d''arrêter ses ventes à 16h00.</p><p>Appeler le QG sécu au talkie.<br></p><p>Faire l''état des lieux de la concession quand elle s''en va.</p><p>Lui rendre son chèque de caution si tout est OK (même si on l''aime pas parce que c''est un gros con !).</p>', 'Pochette concession Aillaud.', 0, 'Trottoir devant le nouveau bâtiment de la piscine', 3, 'non (raf)'),
(25, 223, 322, NULL, 'Briefing Karna', '<p>Briefer le Karna.</p><p>Aller pendant leur réunion pour avoir un max de gens et les brieffer sérieusement ! (sans boire trop de bière parce qu''on sera fatigués et occupés)</p>', 'Pense à prendre ton mémo pour ne rien oublier !', 0, 'Local Karna', 3, 'non'),
(26, 223, 322, NULL, 'Briefing Karna Manif', '<p>Donner rendez-vous au Karna assez tôt sur le stand bouffe pour leur montrer le matos et tous les équipements, réexpliquer le boulot, et puis peut être qu''ils pourront nous aider à finir d''arranger le stand!</p><p>Avec fiche "consignes orga bouffe" que l''on va afficher.</p>', NULL, 0, 'Bar bouffe', 3, 'non'),
(27, 23, 323, NULL, 'Installer le QG sécu', '<p></p><ul><li>Aller au bocal récupérer le matos du QG sécu, en faisant attention de ne pas oublier :</li><ul><li>2 ordinateurs (Poulpe et Cheval)</li><li>Megaphones</li><li>Imprimante</li><li>Kit sécu dans carton "sécu"</li></ul></ul><ul><li>Aller au QG orga récupérer le matos qui manque :</li><ul><li>3 talkies (1 pour STAFF, 1 pour la croix rouge, 1 de secours)</li><li>Clés du PC Secouristes</li><li>Matelas x2</li><li>Les clefs des chambres pour staff (3 chambres doubles)</li><li>La bouffe pour la sécu (sans oublier les baguettes de pain)</li></ul></ul><ul><li>Récupérer un frigo au creux GCU (si la log a bien bossé, ce sera écrit "sécu" dessus, sinon, prends le plus dégueu.&nbsp;</li><li>Se rendre jusqu''au QG sécu, poser tout le bordel dans la salle 206. Vérifier que les lignes téléphoniques sont fonctionnelles :&nbsp;</li></ul><blockquote style="margin: 0 0 0 40px; border: none; padding: 0px;"><ol><li>7200 sur la prise A307.160 (couloir)&nbsp;<br></li><li>6000 sur la prise A307.62 en salle 307206<br></li><li>7070 sur la prise A307.61 en salle 307206<br></li><li>6010 sur la prise A307.112 en salle 307204</li></ol></blockquote><ul><li>Faire du bruit pour signifier ta présence aux gens qui sont encore en cours</li></ul><p></p><blockquote style="margin: 0 0 0 40px; border: none; padding: 0px;"><p></p><blockquote style="margin: 0 0 0 40px; border: none; padding: 0px;"><p><br></p></blockquote><p></p></blockquote>', NULL, 0, '2eme étage GCU', 3, 'non'),
(28, 23, 323, NULL, 'Ranger le QG sécu', '<p></p><ul><li>Va au QG sécu, regroupe tout le bordel, ramasse les capotes usagées et les boites de paté qui trainent</li><li>Ramener le frigo au creux GCU</li><li>Mets tout ça dans un carton</li><li>Récupère les balais que Jérem t''a laissé au 1er étage</li><li>Lave, frotte</li><li>Ramène tout au bocal</li><li>Range ça a un endroit ou tu le retrouveras</li></ul><p></p>', NULL, 0, '2eme étage GCU', 3, 'non'),
(29, 21, 324, NULL, 'Conducteur +21ans - Aller chercher les 20m3', 'Rendez-vous au local des 24,<div><p>Prend ton permis de conduire. Il faut avoir 21 ans et 1 an de permis, il vont demander ton permis =)</p><p>Prendre les bons de location préparé avec amour (dans la pochette bon de location dans le casier log). <b><u>Prend les bons bons de location ! Celui des 20m3 du 21 mai au 28 et du 21 au 27 mai ! Je beaucoup sur toi !</u></b></p><div>Se rendre à l''adresse suivante en TCL :&nbsp;</div><div><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">HERTZ FRANCE S.A.S.</span><br style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);"><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">102, av. Jean Jaurès - 69007 Lyon</span><br style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);"><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">Tél : 04.72.80.76.86</span><br style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);"><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">Mob : 06.74.70.97.48</span></div><div><br></div><div><div>Demander les clés des 20m3 avec haillon réservé pour les 24.</div><div>Donner les bons de location, les faire remplir.</div><div>Signer le contrat de location du véhicule.</div><div><br></div><div>Rentrer à l''INSA en 20m3.</div><div><br></div><div>Se garer derrière le beurk sur le parking.</div><div><br></div><div>Trouver un orgras humain et lui donner les clés (Dina ou Hugo).</div></div></div><div><br></div>', NULL, 2, 'Local des 24H', 3, 'non'),
(30, 21, 324, NULL, 'Aller chercher le 2ème 20m3', '<p>Rendez-vous au local des 24,</p><div><p>Prend ton permis de conduire. Il faut avoir 21 ans et 1 an de permis.</p><p>Prendre les bons de location préparés avec amour (dans la pochette bon de location dans le casier log).&nbsp;<b><u>Prend les bons bons de location ! Celui du 20m3 du 22 au 27 mai ET celui du 7m3 du 22 au 28 mai ! Je beaucoup sur toi !</u></b><br></p><div>Se rendre à l''adresse suivante en TCL :&nbsp;</div><div><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">HERTZ FRANCE S.A.S.</span><br style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);"><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">102, av. Jean Jaurès - 69007 Lyon</span><br style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);"><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">Tél : 04.72.80.76.86</span><br style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);"><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">Mob : 06.74.70.97.48</span></div><div><br></div><div><div>Demander les clés du 20m3 avec haillon et du 7m3 réservés pour les 24.</div><div>Donner les bons de location</div><div>Signer le contrat de location du véhicule.</div><div><br></div><div>Rentrer à l''INSA en camion.</div><div><br></div><div>Se garer derrière le beurk sur le parking.</div><div><br></div><div>Trouver un orgras humain et lui donner les clés.</div></div></div><div><br></div>', NULL, 2, 'Local des 24H', -1, 'non'),
(31, 21, 324, NULL, 'Aller chercher le 7m3', 'Rendez-vous au local des 24,<div><p>Prend ton permis de conduire. Il faut avoir 21 ans et 1 an de permis.</p><p>Prendre le bon de location (Appeler Cetelem 06 80 52 08 62, il te dira où il est)</p><div>Se rendre à l''adresse suivante en TCL :&nbsp;</div><div><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">HERTZ FRANCE S.A.S.</span><br style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);"><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">102, av. Jean Jaurès - 69007 Lyon</span><br style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);"><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">Tél : 04.72.80.76.86</span><br style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);"><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">Mob : 06.74.70.97.48</span></div><div><br></div><div><div>Demander les clés du 7m3 réservé pour les 24.</div><div>Signer le contrat de location du véhicule.</div><div><br></div><div>Rentrer à l''INSA en 7m3.</div><div><br></div><div>Se garer derrière le beurk sur le parking.</div><div><br></div><div>Trouver un orgras humain et lui donner les clés (Dina ou Hugo).</div></div></div>', NULL, 2, 'Local des 24H', -1, 'non'),
(32, 21, 324, NULL, 'Aller chercher le minibus', 'Rendez-vous au QG orga,<div><p>Prend ton permis de conduire. Il faut avoir 21 ans et 1 an de permis.</p><p>Prendre le bon de location (demander aux humains, et au pire appeler Cetelem 06 80 52 08 62, il te dira où il est)</p><div>Se rendre à l''adresse suivante en TCL :&nbsp;</div><div><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">HERTZ FRANCE S.A.S.</span><br style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);"><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">102, av. Jean Jaurès - 69007 Lyon</span><br style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);"><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">Tél : 04.72.80.76.86</span><br style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);"><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">Mob : 06.74.70.97.48</span></div><div><br></div><div>Tu vas récupérer un minibus !</div><div><div>Du coup, demande les clés du minibus réservé pour les 24 et <b>signe le contrat de location du véhicule</b>.</div><div><br></div><div>Rentrer à l''INSA en minibus de l''ambiance.</div><div><br></div><div>Se garer derrière la scène sur le parking.</div><div><br></div><div>Trouver un orga humain et lui donner les clés.</div></div></div>', NULL, 2, 'QG Orga', 3, 'non'),
(33, 21, 324, NULL, 'Ramener le 1er 20m3', '<p></p><ul><li>Aller au local des 24</li><li><b>Prend ton permis, un ticket de tram et ta carte bleu&nbsp;</b></li><li>Demander les clés du 20m3 Brandon à Dina ou Hugo<br></li><li>Prendre un balais dans le local</li><li>Aller balayer l''arrière du 20m3</li><li>Enlever tout le foutre qu''on a mis dans la cabine et nettoyer si nécessaire</li><li>Ranger tout le matos de nettoyage qui t''a été nécessaire dans le local</li><li>Démarrer le 20m3 et aller chez BP en face du DBM</li><li><b><u>Faire le plein</u></b>. Pas oublier la facture de l''essence à donner à Fatna.</li><li>Aller à Hertz en 20m3 :</li></ul><p></p><div><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">HERTZ FRANCE S.A.S.</span><br style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);"><span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;">102, av. Jean Jaurès - 69007 Lyon</span><br><span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;">Tél :&nbsp;</span><a href="tel:04.72.80.76.86" style="font-family: arial, sans-serif; font-size: 13px;">04.72.80.76.86</a><br><span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;">Mob :&nbsp;</span><a href="tel:06.74.70.97.48" style="font-family: arial, sans-serif; font-size: 13px;">06.74.70.97.48</a><br><div style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);"><span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;"><br></span></div><ul><li>Demander si il y a une facture<br></li><li>Rendre les clés<br></li><li>Remercier<br></li><li>Rentrer au local en TCL (ou en stop, ou en poney préalablement chargé dans le 20m3)<br></li><li>Ne pas jeter la facture&nbsp;<br></li></ul> </div><p></p>', NULL, 2, 'Local des 24H', 3, 'non'),
(34, 21, 324, NULL, 'Ramener le 2ème 20m3', '<p>Aller au local des 24</p><div><b>Prend ton permis</b>&nbsp;</div><div><br>Demander les clés du 20m3 à Dina ou Hugo<br><b><u>Faire le plein</u></b>. Pas oublier la facture de l''essence à donner à Fatna.</div><div><br>Aller à Hertz en 20m3 :</div><div><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">HERTZ FRANCE S.A.S.</span><br style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);"><ul><li><span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;">102, av. Jean Jaurès - 69007 Lyon</span><br></li><li><span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;">Tél :&nbsp;</span><a href="tel:04.72.80.76.86" style="font-family: arial, sans-serif; font-size: 13px;">04.72.80.76.86</a><br></li><li><span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;">Mob :&nbsp;</span><a href="tel:06.74.70.97.48" style="font-family: arial, sans-serif; font-size: 13px;">06.74.70.97.48</a><br></li></ul><span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;"><div><br></div>Demander si il y a une facture</span><br><span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;">Rendre les clés</span><br><span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;">Remercier</span><br><span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;">Rentrer au local en TCL (ou en stop, ou en poney préalablement chargé dans le 20m3)</span></div>', NULL, 2, 'Local des 24H', 3, 'non'),
(35, 21, 324, NULL, 'Ramener le 7 m3', '<p>Aller au local des 24</p><div><br></div><div><b>Prend ton permis</b>&nbsp;</div><div><br>Demander les clés du 7m3 à Dina ou Hugo<br><b><u>Faire le plein</u></b>. Pas oublier la facture de l''essence à donner à Fatna.</div><div><br>Aller à Hertz en 20m3 :</div><div><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">HERTZ FRANCE S.A.S.</span><br style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);"><ul><li><span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;">102, av. Jean Jaurès - 69007 Lyon</span><br></li><li><span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;">Tél :&nbsp;</span><a href="tel:04.72.80.76.86" style="font-family: arial, sans-serif; font-size: 13px;">04.72.80.76.86</a><br></li><li><span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;">Mob :&nbsp;</span><a href="tel:06.74.70.97.48" style="font-family: arial, sans-serif; font-size: 13px;">06.74.70.97.48</a><br></li></ul><span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;"><div><br></div>Demander si il y a une facture</span><br><span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;">Rendre les clés</span><br><span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;">Remercier</span><br><span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;">Rentrer au local en TCL (ou en stop, ou en poney préalablement chargé dans le 7m3)</span></div>', NULL, 2, 'QG Orgras', -1, 'non'),
(36, 21, 324, NULL, 'Ramener le minibus', '<p></p><ul><li>Aller au local des 24<br></li><li><b>Prend ton permis</b>&nbsp;</li></ul><ul><li>Demander les clés du minibus à Dina ou Hugo<br></li><li>Demander une enveloppe aux humains</li><li>Marquer "Minibus 24 Heures" dessus.</li><li><b><u>Faire le plein</u></b>. Pas oublier la facture de l''essence à donner à Fatna.</li></ul><ul><li>Aller à Hertz en 20m3 :<br></li></ul><span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;">HERTZ FRANCE S.A.S.</span><br><p></p><div><span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;">102, av. Jean Jaurès - 69007 Lyon</span><br><ul><li>Se garer proprement dans la rue,<br></li><li>Mettre les clés dans l''enveloppe,<br></li><li>Fermer l''enveloppe,<br></li><li>Mettre l''enveloppe dans la boîte au lettre (<b><u>NE PAS SE TROMPER DE BOÎTE AU LETTRE</u></b>)</li><li>Appeler Cetelem (06 80 52 08 62) et lui dire que ça s''est bien passé et que le minibus est en état :)</li><li>Rentrer au local en TCL (ou en stop, ou en poney préalablement chargé sur la banquette arrière du minibus)</li><li>Se pignoler au QG</li></ul></div>', 'enveloppe', 2, 'QG Orgras', 3, 'non'),
(37, 21, 325, NULL, 'Conducteur +21ans  - Aller chercher les camions frigo', '<p>Rendez-vous au local des 24 !</p><p><b>Prend ton permis</b> et retrouve tes amis qui font la même tâche que toi !</p><p>Va voir les humains et demande les clés d''une voiture.&nbsp;</p><p><u><b>Prend la pochette concernant les camions frigo du mercredi dans le casier log</b></u>. Si tu ne l''as pas, tu va faire un voyage pour rien :)</p><p>Embarquer dans la voiture avec 3 orgas qui ont 21 ans et 1 an de permis et aller chez Petit Forestier.&nbsp;</p><p>Adresse : 43 avenue Gabriel Péri 69 960 Corbas,&nbsp;<span style="background-color: rgb(255, 255, 255); font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap;"> 04 78 21 69 99</span></p><p>Arrivé là-bas, trouve le mec et dis que tu es des 24. Ouvre la pochette et donne lui ce qu''il te demande (chèques de caution, payer la location... etc)</p><p>Ramène 3 camions frigos sur l''INSA</p><p>Appel Alexis (Cetelem) au 06 80 52 08 62 et emmener les camions vers le creux GCU</p>', NULL, 2, 'Local des 24H', 3, 'non (raf)'),
(38, 21, 324, NULL, 'Tâche sans nom', 'fssd', NULL, 0, 'QG Orgras', -1, 'non'),
(39, 32, 326, NULL, 'Pipi', '<p>Aller chercher la grosse moche<span class="Apple-tab-span" style="white-space:pre">	</span></p><div><br></div><div><br></div><p></p>', NULL, 0, 'Moitié entre piscine et direction - Moitié rond point manège', -1, 'non'),
(40, 227, 327, NULL, 'Installer le village challenge', '<p>RDV : Retrouver un orga course (PA) au gymnase Colette Besson</p><div>Prendre le plan du village challenge</div><div><br></div><div>Aller chercher des barrières près du village challenge et barrièrer si ce n''est pas déjà fait&nbsp;</div><div><br></div><div>Aller chercher les clefs du QG pédales, tentes, tables, &nbsp;et les BBQ au gymnase Collette Besson</div><div><br></div><div>Tout ramener au village challenge</div><div><br></div><div>Monter les tentes, installer les tables et les BBQ : arranger le village pour qu''il soit sympa pour les entreprises</div><div><br></div><div>Pendant ce temps là un autre soft va chercher la signalétique Challenge entreprise au QG Pédale et les installer sur place à l''aide du caddie (qui sera au QG pédales que PA doit poser là-bas)</div><div><br></div><div>Aller au QG pédales (L''insatiable bat.H) &nbsp;(PA)<br></div><div><div>Récupérer les banderoles des entreprises et le kit banderole<br></div><div><br></div><div>Prendre 20 colsons, 1 scotch, 1 cutter et de la ficelle ( au QG pédales) et tout mettre dans un sac<br></div><div><br></div><div>Mettre en place les banderoles avec un orga Hard sur le départ des courses et/ou à d''autres endroits de la courses suivant le nombre et la demande des entreprises</div><div><br></div><div>Ramener le matos au QG</div></div><div><br></div><div><br></div><p></p>', NULL, 0, 'Pelouse au nord de colette besson', 3, 'non'),
(41, 225, 328, NULL, 'Installer CLES-FACIL', '- Se&nbsp;rendre au dépôt AIP&nbsp;<br>&nbsp;-Prendre&nbsp;3&nbsp;tables&nbsp;2&nbsp;personnes, 6 chaises et 1 parasol (faites plusieurs voyages si besoin) ­\r\n<div>- Les&nbsp;amener&nbsp;au&nbsp;terrain&nbsp;de&nbsp;foot&nbsp;en&nbsp;terre&nbsp;(au&nbsp;nord&nbsp;de la piscine)&nbsp;<br>- Dire&nbsp;bonjour&nbsp;aux&nbsp;membres&nbsp;de&nbsp;CLES­-FACIL, vérifier qu''ils aient tout ce qu''il leur faut.&nbsp; \r\n<div>- Leur&nbsp;proposer&nbsp;de&nbsp;les aider&nbsp;à&nbsp;installer</div>\r\n<div>- Leur fournir le numéro du&nbsp;<b>PC sécu</b>&nbsp;(num en cas d''accident) :&nbsp;<b><span style="BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: arial, sans-serif; COLOR: rgb(34,34,34); FONT-SIZE: 13px">04 72 43 70 70 ou&nbsp;</span><span style="BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: Arial, sans-serif; COLOR: rgb(34,34,34); FONT-SIZE: 11pt">04 72 43 60 00</span></b></div>\r\n<div>- Aller te pignoler et manger tu&nbsp;pâté&nbsp;au QG ou aller bosser sur ta prochaine tâche.</div>\r\n<div><br></div>\r\n<div><br>\r\n<p>En cas de&nbsp;problème: Rani 07.50.40.06.74</p></div></div>', 'Un parasol et des bras musclés', 0, 'dépot AIP', 3, 'non'),
(42, 225, 330, NULL, 'accueil artificiers', '<ul>\r\n<li>Vérifier que les&nbsp;4 tickets repas soient bien dans mon sac</li>\r\n<li>Prendre la clef du terrain d''athlétisme au qg orga&nbsp;</li>\r\n<li>Accueillir les artificiers<br></li>\r\n<li>Ouvrir la barrière du terrain du haut pour qu''il puisse poser sa camionnette sur le terrain du haut<br></li>\r\n<li>Lui donner le numéro de téléphone du PC Sécu (<b>04 72 43 70 70&nbsp;<span style="BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: arial, sans-serif; COLOR: rgb(34,34,34); FONT-SIZE: 13px">ou&nbsp;</span><span style="BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: Arial, sans-serif; COLOR: rgb(34,34,34); FONT-SIZE: 11pt">04 72 43 60 00</span></b>) et de Rani : 07 50 40 06 74 si l''électricité n''a pas encore été installée.</li>\r\n<li>Lui filer 4 tickets repas</li>\r\n<li>Reposer la clef du terrain d''athlétisme au qg orga</li></ul>\r\n<p></p>\r\n<p><span style="TEXT-ALIGN: justify; BACKGROUND-COLOR: rgb(255,255,255)">Contact artificier : Eric Mazioux&nbsp;</span>&nbsp;<span style="TEXT-ALIGN: justify; BACKGROUND-COLOR: rgb(255,255,255)">06 66 26 13 30</span>&nbsp;&nbsp;<br style="TEXT-ALIGN: justify; BACKGROUND-COLOR: rgb(255,255,255)"></p>\r\n<div><br></div>', 'Clé de la chaine de derrière la piscine\r\nClés du terrain du haut,', 0, 'terrain de football stabilisé', 3, 'non'),
(43, 225, 330, NULL, 'protection du public', '<p>Rends toi sur le chemin entre les terrains de tennis et le terrain d''athlétisme.</p><p>Ta mission est de veiller à ce que personne ne rentre sur ce terrain par derrière pendant que le feu d''artifice est tiré.</p><p>En détail :</p><p>Retrouve ton coéquipier sur le chemin entre le terrain d''athlétisme et le terrain de rugby.&nbsp;</p><p>Empêche les personnes de s''installer sur terrain, et demande aux personnes qui veulent passer par ce chemin de faire le tour par le sud, en leur disant que c''est dangereux.</p><p>Ne te mets pas en danger, en cas de problème, appelle le responsable sur son portable. Signale-lui immédiatement &nbsp;les relous qui ne veulent pas dégager.</p><p>Profites du feu d''artifice, tu es aux premières loges! Et quand c''est fini rejoins-nous sur le terrain!</p><p>En cas de problème : Laurent BILLON 06 32 57 58 24</p>', NULL, 0, 'terrain de football stabilisé', -1, 'non'),
(44, 225, 331, NULL, 'installation du molkky', '<p>-Rends toi au dépôt AIP</p>\r\n<p>-Prends les 3 kits de molkky #pétanquefinlandaise (un kit=12 quilles numérotées + un bâton sans numéro: le molkky + les règles du jeu)</p>\r\n<p>-prends les kits de la main gauche, ou de la main droite...&nbsp;</p>\r\n<p>-Va au terrain d''athlétisme (entre le terrain de foot et le terrain de rugby)</p>\r\n<p>-Une fois que tu es au terrain d''athlétisme, déballe le matos</p>\r\n<p>-Répartis les 3 jeux et assure toi que tout est prêt pour lancer l''anim</p>\r\n<p>-Attends que l''orga qui assure l''anim à partir de 10h soit là (si ce n''est pas toi)</p>\r\n<p><br></p>\r\n<p>En cas de&nbsp;problème: Rani : 07.50.40.06.74</p>', NULL, 0, 'dépot AIP', 3, 'non'),
(45, 225, 331, NULL, 'rangement du molkky', '<p>-Tu dois te rendre sur le terrain d''athlétisme (entre le terrain de foot et le terrain de rugby)</p>\r\n<p>-Là tu apercevras 2 orgas softs exténués, passe ton chemin et récupère les bouts de bois qui traînent à leurs côtés</p>\r\n<p>-Vérifies que ce sont bien les 3 Kits de jeu de Molkky, complets et en bon état (un kit =&nbsp;12 quilles numérotées de 1 a 12 + 1 (gros) bâton&nbsp;non&nbsp;numéroté: le Molkky + la notice d''utilisation)</p>\r\n<p>-Ranges les méticuleusement dans leur sac</p>\r\n<p>-Tu peux maintenant les ramener au&nbsp;dépôt&nbsp;AIP</p>\r\n<p>-Si il reste des gens en train de jouer, laisse les finir mais arrête les si y en a encore pour 30 minutes</p>\r\n<p>En cas de&nbsp;problème: Rani : 07.50.40.06.74</p>', NULL, 0, 'terrain athlétisme', 3, 'non'),
(46, 225, 328, NULL, 'Désinstallation CLES-FACIL', '- Se&nbsp;rendre&nbsp;sur&nbsp;le&nbsp;lieu&nbsp;de&nbsp;l''animation&nbsp;:&nbsp;terrain&nbsp;de&nbsp;foot&nbsp;en&nbsp;terre&nbsp;au nord de la piscine&nbsp;<br>- Si&nbsp;les&nbsp;animateurs&nbsp;de&nbsp;CLES­-FACIL&nbsp;sont&nbsp;encore&nbsp;là,&nbsp;leur&nbsp;proposer&nbsp;votre&nbsp;aide&nbsp;pour&nbsp;ranger&nbsp;<br>- Leur&nbsp;demander&nbsp;comment&nbsp;s''est&nbsp;passée&nbsp;leur&nbsp;journée,&nbsp;et&nbsp;leur&nbsp;souhaiter&nbsp;une&nbsp;bonne&nbsp;soirée&nbsp;! ­<br>- Récupérer&nbsp;les&nbsp;3&nbsp;tables&nbsp;2&nbsp;personnes, les 6 chaises ainsi que le parasol.&nbsp; \r\n<div>- Les&nbsp;emmener&nbsp;au&nbsp;dépôt&nbsp;AIP \r\n<p>En cas de&nbsp;problème : Rani : 07.50.40.06.74</p></div>', 'Parasol', 0, 'Terrain d''athlétisme', 3, 'non');
INSERT INTO `Tache` (`id`, `responsable_id`, `groupetache_id`, `importid`, `nom`, `consignes`, `materielSupplementaire`, `permisNecessaire`, `lieu`, `statut`, `commentaireLog`) VALUES
(47, 225, 331, NULL, 'animer le molkky', '<p>-Rends toi au terrain d''athlétisme (entre le terrain de foot et le terrain de rugby)</p>\r\n<p>-Trouves-y les 3 jeux de Molkky. S''il manque des quilles ou un baton ou une notice, préviens le responsable, sinon ça sera de ta faute si le mec qui te remplace à la fin de ton créneau dis qu''il manque du matos.</p>\r\n<p>-Prends bien connaissance des règles du jeu en français et en finlandais pour plus d''authenticité (tu as une fiche briefing "Molkky" dans chaque jeu)</p>\r\n<p>-Maintenant organise l''anim et envoie du rêve. Si y a personne, hésite pas à jouer avec le pote qu''il y a à côté de toi pour attirer du monde!!!</p>\r\n<p>En cas de probleme: Rani : 07.50.40.06.74</p>', NULL, 0, 'terrain athlétisme', 3, 'non'),
(48, 213, 332, NULL, 'Installation des Jeux en Bois (Samedi)', '<p>-Aller chercher 4 tables (format 2 personnes) et 2 chaises au dépôt AIP et les amener sur la pelouse des Humas à l''intersection entre les 2 routes devant GCU.<br></p><p>-Le prestataire fournissant les jeux en bois arrive à 9h. Une fois que Romain aura réglé les formalités avec lui, installer les jeux en bois qu''il a apporté au même endroit que les tables/chaises.</p><p>-Surveiller le matériel jusqu''à 10h.</p><p><br></p><p>------Informations supplémentaires------------</p><p>Attends la relève de 10h, ne pas pas avant qu''elle soit là.</p><p>Ne laisse jamais le matériel sans surveillance.</p><div>N''hésite pas à appeler Romain en cas de problème majeur : 06 36 94 28 11.<br></div>', NULL, 0, 'Dépôt AIP', -1, 'non'),
(49, 223, 334, NULL, 'Conducteurs - Courses bouffe artistes', '<p>Te voila chargé d''une mission de haute importance : faire les courses pour les artistes et les techos charismatiques du festival.</p><div><ul><li>Rendez-vous au local des 24h&nbsp;</li><li>Retrouve Mamie Caro et ton autre co-tâche (ceux que tu vas devoir supporter pour faire les courses du Troll)</li><li>Prends le chèque de Fatna dans le casier bouffe, et <b>ne le perds pas</b> ! Prends aussi <b>la liste des courses </b>dans le même casier (ça peut servir) + <b>la carte METRO</b> !&nbsp;</li><li>Partez en direction du METRO avec 3 voitures (ouais les artistes, ça bouffe beaucoup !) :<br>METRO<br><span class="Apple-tab-span" style="white-space: pre;">Z.I. Les Rubines - 2 avenue Charles de Gaulle</span><br>69512 Vaulx-en-Velin<br><b><u>N''oubliez pas vos permis, bande de rôtis !!</u></b></li><li>Fais les courses</li><li>Paye</li><li>Reviens sur la campus, à la MDE</li></ul><div>Numéro du troll au cas où : 06 61 41 15 17 (ne pas l''appeler, sinon il ne vous lâchera plus !!!!!!)</div></div>', NULL, 1, 'Local 24h', 3, 'non (raf)'),
(50, 21, 325, NULL, 'Conducteur +21ans - Rendre les camions frigos', '<p>Rendez-vous au local des 24 Heures !</p><div>Prend ton permis !</div><div><br></div><div>Retrouve tes copains qui font la même tâche que toi !</div><div><br></div><div>Aller voir les humains et demander les clés d''une voiture et des 3 camions frigos. Vous allez partir à 1 voiture et 3 camions frigos et rentrer en voiture.</div><div><br></div><div>Partez chez le petit forestier au 43 avenue Gabriel Péri 69 960 Corbas,&nbsp;<span style="background-color: rgb(255, 255, 255); font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap;"> 04 78 21 69 99.</span></div><div><span style="background-color: rgb(255, 255, 255); font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap;"><br></span></div><div>Trouvez le mec là-bas et rendez lui les clés. Signez les papiers et rentrez !</div><div><br></div><div>Revenir au bocal et rendre les clés de la voiture aux humains.</div><p></p>', NULL, 2, 'Local des 24H', 3, 'non (raf)'),
(51, 21, 335, NULL, 'Vider le dépôt AIP', '<p>RDV au QG orga</p><div><br></div><div>Trouve Alexis (aka Cetelem, le petit homme vert)</div><div><br></div><div>Prenez les clefs d''un 20m3 et c''est parti pour le dépôt AIP !</div><div><br></div><div>Mettre le matos du dépôt AIP qui va au bocal dans le 20m3 (donc pas les tables/chaises)</div><div><br></div><div>Aller au local des 24.</div><div><br></div><div>Décharger le 20m3 et ranger à peu près le bocal.</div><div><br></div><div>Ramener le 20m3 et rendre les clefs au QG.</div><div><br></div><div>Prendre une RedBull, se retrousser les manches, et c''est reparti !</div><p></p>', 'De la volonté et du charisme', 0, 'QG orga', -1, 'non'),
(52, 21, 335, NULL, 'Gardiennage dépôt AIP', '<p></p><ul><li>Rendez-vous au dépôt AIP (voir plan)<br></li><li>Trouve ceux qui sont à ton poste avant et prend la relève (ils ont un T-shirt orange et un talkie !)</li><li>Récupère le talkie</li><li>Tu dois être placé à coté de l''entrée de la zone orga (extérieur du dépôt)</li><li>Ton rôle : Ne laisser passer que les orgas (T-shirt + bracelet) dans le dépôt. En cas de problème, préviens la sécu au talkie. ("dépôt AIP pour sécu")</li><li>Si tu te pignoles sévère, tu peux ranger le dépôt.</li></ul><div>En cas de problème, appelle Cetelem au 06 80 52 08 62 ou au talkie<br></div><div><div><br></div><div>Si le talkie fait bip bip c''est qu''il a plus de batterie, faut prévenir le QG pour que la maman te ramène une nouvelle batterie :) !</div></div><div><div><b>Si la relève n''arrive pas ne surtout pas quitter son poste et demander l''humain au talkie :)</b></div></div><div><b><br></b></div><div><b>En attendant, tu peux aussi chanter My Heart Will Go On de Céline Dion, voici les paroles :&nbsp;</b></div><div><i><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">Every night in my dreams</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">I see you, I feel you,</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">That is how I know you go on</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">Far across the distance</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">And spaces between us</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">You have come to show you go on&nbsp;</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">Near, far, wherever you are</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">I believe that the heart does go on&nbsp;</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">Once more you open the door</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">And you''re here in my heart</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">And my heart will go on and on</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">Love can touch us one time</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">And last for a lifetime</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">And never let go till we''re gone&nbsp;</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">Love was when I loved you</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">One true time I hold to</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">In my life we''ll always go on&nbsp;</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">Near, far, wherever you are</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">I believe that the heart does go on</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">Once more you open the door</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">And you''re here in my heart</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">And my heart will go on and on</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">You''re here, there''s nothing I fear,</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">And I know that my heart will go on</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">We''ll stay forever this way</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">You are safe in my heart&nbsp;</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">And my heart will go on and on</span></i><b><br></b></div><p></p>', NULL, 0, 'Dépôt AIP', 3, 'non'),
(53, 219, 336, NULL, 'Mise en place des poubelles AREMACS', '<p>Recupere les 10 poubelles noires Aremacs au QG orga dans la rotonde avec le kit dedans.\r\n</p><p>\r\nVa en placer 3 à l''entrée de la file d''attente et 3 à l''entrée de la zone concert. Les 4 restantes tu les poses dans la zone orga, dans le creux AIP (à l''entrée du bâtiment, vers les silos à verre, derrière le bar AIP).</p><p>\r\n\r\nSi ton créneau est vendredi soir, tu sautes les 2 prochains paragraphes.\r\n</p><p>\r\n Fais le tour de la zone concert (qui sera sur le point d''être fermée, avant le début des concerts) et récupère tous les sacs verts se trouvant sur chaque triangle de barrière (cf plan) qu''ils soient vides ou pas et leur pancarte verte où est écrit verre dessus (et oui ça fait beaucoup de verre/vert dans la même phrase).\r\n</p><p>\r\nRamène tous ces sacs verts contenant le verre dans le creux orga AIP et met le verre dans les silos prévus à cet effet. Les bouteilles en plastiques sont à mettre dans un sac jaune et tous les autres déchets sont à mettre dans un sac noir qui lui-même se met dans la grosse benne RDS se trouvant au même endroit.\r\n</p><p>\r\nMets les pancartes vertes où est inscrit verre dessus sur chacune des poubelles noires en dures que tu as placées un peu plus tôt dans cette tâche. Pour cela, utilise le scotch pour coller les pancartes à l''intérieur de la poubelle avec le haut qui dépasse (la pancarte doit être au dessus de la poubelle). Si ta pas compris la dernière phrase, appelle la resp Marie : 06 61 23 21 55\r\n</p><p>\r\nRetourne au QG Orga dans la joie et la bonne humeur : bravo, tu as finis ta tâche !</p>', '10 poubelles AREMACS\r\nKit propreté : gants en plastique, sacs poubelle noirs,jaune et verts', 0, 'Rotonde', 3, 'non'),
(54, 223, 334, NULL, 'Tâche sans nom', '<p>fv</p>', NULL, 0, 'Bar bouffe', -1, 'non'),
(55, 206, 337, NULL, 'Livraison Cottendin', '<p>Attendre la livraison de Cottendin au bar bouffe.&nbsp;<br></p><p>Une fois qu''elle est arrivée, diriger le chauffeur à la MDE pour tout déposer au QG orga. Répartir entre les besoins du bar bouffe, de la Bouffe Artiste à la MDE et des humains au QG orga (comprend aussi les besoins des pédales qui viendront chercher leur bouffe le samedi).</p><p>SI et Seulement SI il y a de la place dans les frigos ou le camion frigo du stand bouffe, vous pouvez ramener de la MDE au bar bouffe sinon, on ira chercher nos fruits et légumes plus tard (quand le camion frigo du grand resto sera arrivé).</p>', NULL, 0, 'Bar bouffe', -1, 'non'),
(56, 223, 337, NULL, 'Livraisons vendredi matin', '<p><u style="font-weight: bold;">Attention !</u>&nbsp;Clé pompier... quand une livraison va arriver, si la barrière n''est pas encore ouverte, aller chercher la clé pompier du QG Orga ! (ou appeler la Sécu s''ils se pignolent)</p><p><b><u>Pour Options (matos) (entre 6h et 10h)<br></u></b>Attendre tout le matos à installer sur le stand restauration. Le matos sera lourd, il faut moultes orgas.</p><div>Ne pas oublier de prévenir l''humain une demi h au moins avant l''arrivée de la livraison pour qu''il prévoit 4 orgas afin de décharger (prévoir 1/2h).</div><div>NE PAS tout mettre devant le stand pour laisser le passage au camion du beurk (sinon il ne pourra pas manœuvrer).</div><div><br></div><div><b><u>Pour Cottendin (légumes) :</u></b><br>Attendre la livraison de Cottendin au bar bouffe.&nbsp;</div><div><p>Une fois qu''elle est arrivée, diriger le chauffeur à la MDE pour tout déposer au QG orga. Répartir entre les besoins du bar bouffe, de la Bouffe Artiste à la MDE et des humains au QG orga (comprend aussi les besoins des pédales qui viendront chercher leur bouffe le samedi).</p><p>SI et Seulement SI il y a de la place dans les frigos ou le camion frigo du stand bouffe, vous pouvez ramener de la MDE au bar bouffe sinon, on ira chercher nos fruits et légumes plus tard (quand le camion frigo du grand resto sera arrivé).</p><p><b><u>Pour Pomona (frais) (entre 10h et 12h)</u></b></p><p>Réceptionner les produits Pomona. Stocker les marchandises du stand bouffe dans les camions frigo, et amener celles de la bouffe artistes aux troll (à la MDE, premier étage, salle Hibiscus). Remplir aussi à fond les congélos de frites. Prévenir l''humain 1/2 heure avant pour qu''il envoie 4 softs pour décharger et tout mettre dans les camions frigos. (Prévoir 1h)</p><p><b><u>Pour camion frigo GR (à partir de 11h)</u></b></p><p>Réceptionner et guider le camion du beurk sur le stand bouffe.</p></div>', NULL, 0, 'Bar bouffe', 3, 'non'),
(57, 21, 338, NULL, 'Aller chercher le matos GMD/PC', '<p>RDV au local des 24H</p><div><br></div><div>Trouve Alexis,</div><div>Récupérez un 20m3 <b>et une clef pompier.</b></div><div><br></div><div>Aller à la Dirpat et récupérer les clefs de la cave du PC à l''entrée (demander celles de derrière, ça rentre toujours mieux par derrière).</div><div><br></div><div>Passer derrière les travées grâce à la clef pompier.</div><div>Aller jusqu''en GMD et trouver <b>Claude COURTOIS.&nbsp;</b></div><div>Il y a 25 tables 2 places à récupérer dans la cave de GMD.</div><div><br></div><div>Une fois chargées, aller à la cave du PC (sous la première travée) et charger toutes les tables 2 places que tu peux dans le 20m3.</div><div><br></div><div><br></div><div><b><i><u>Des trucs cool, des trucs moins cool et du scotch&nbsp;</u></i></b></div><p></p>', 'Clef pompier', 2, 'QG Orgras', -1, 'non'),
(58, 21, 338, NULL, 'Aller chercher les tables GI', '<p></p><ul><li>RDV au QG orga.</li><li>Retrouve Cetelem (Alexis)</li><li>Prendez un 20m3 et c''est parti pour GI !&nbsp;</li><li>Aller se garer devant GI.</li><li>Aller voir Nathalie Follet au secrétariat de la direction GI (bout du bâtiment jules verne)</li><li>Charger 30 tables 1 place dans le 20m3</li><li>Aller se garer sur le parking de la piscine<br></li><li>Décharger les tables dans la salle en dessous du gymnase</li><li>Mettre 1 table en face de chaque poteau</li></ul><p></p><p></p>', NULL, 0, 'QG Orgras', -1, 'non'),
(59, 21, 338, NULL, 'Aller chercher les tables GE', '<p>RDV au QG orga.</p><div>Retrouve Alexis (cetelem)</div><div><br></div><div>Prendez un 20m3 et c''est parti pour GE !&nbsp;</div><div><br></div><div>Aller se garer derrière GE.</div><div><br></div><div>Aller voir <b><u><i>TA CHATTE</i></u></b> au secrétariat de la direction GE</div><div><br></div><div>Charger 24 tables 2 places dans le 20m3</div><div><br></div><div>Les emmener&nbsp;<b><i><u>dans ton cul</u></i></b></div>', NULL, 0, 'QG Orgras', -1, 'non'),
(60, 223, 334, NULL, 'Courses METRO', '<p></p><ul class="ul1">\r\n<li class="li1">Rendez-vous au local des 24h (RdC Bât D)<br></li><li class="li1">Prends la liste de courses dans le casier bouffe, ainsi que le chèque préparé par Fatna (ne le perds pas !!)</li><li class="li1">Prends les clé de Josh, le 11m3 de l''ambiance, et les clés du camion frigo (il faudra peut-être aller au nouveau QG en cours de déplacement pour trouver les clés)</li><li class="li1">Caro conduit le camion frigo. Sois un co-pilote de l''ambiance !&nbsp;</li><li class="li1">Va à METRO :&nbsp;<br>Z.I. Les Rubines - 2 avenue Charles de Gaulle<br>69512 Vaulx-en-Velin</li><li class="li1">Fais les courses</li><li class="li1">Paye</li><li class="li1">Reviens au QG orga de l''ambiance à la Rotonde ! Si tu n''as pas d''autres tâches, tu peux aider au déchargement ! (sinon, il y a du renfort pour décharger à 18h)</li></ul>', NULL, 2, 'Local 24h', 3, 'non'),
(61, 21, 338, NULL, 'Nettoyage cave PC', '<p></p><ul><li>RDV au local des 24 heures (RDC bâtiment D)<br></li><li>Retrouve Cetelem (alexis)<br></li><li>Préparer de quoi nettoyer des tables en masse : éponges, sceaux, produit, chiffons<br></li><li>Préparer de quoi noter les tables : 2 rouleaux de scotch marron, 2 marqueurs<br></li><li>Tout mettre dans un caddie</li><li>Attendre tout le monde<br></li><li>Aller à la dirpat<br></li><li>Récupérer les clefs de la cave PC<br></li><li>Nettoyer les tables 2 places et les quelques chaises<br></li><li>Marquer le matos "AIP" (scotch + marqueur)</li><li>Noter le nombre exact de trucs utilisables<br></li><li>Refermer la cave, rendre la clef et retourner au local</li><li>Ranger le matos de nettoyage</li><li>Manger du paté</li></ul><div><br></div><p></p>', 'Masque à gaz', 0, 'Local des 24 Heures', -1, 'non'),
(62, 21, 339, NULL, 'Aller chercher le matos GI/GE', '<p>Bonsoir ! Tu as été choisi comme aide logistique !</p><div><ul><li>Retrouve Cetelem (alexis) au QG orga</li><li>Récupérez :</li></ul>- les clefs de la salle sous la piscine</div><div>- de&nbsp;quoi nettoyer des tables (3 éponges, 2 sceaux, produit)</div><div>- de quoi noter les tables (2 rouleaux de scotch marron et 2 marqueurs)<ul><li>Prenez un 20m3 et c''est parti !</li></ul><div>Premier job : chercher les tables en GI :</div><div><ul><li>Aller se garer devant GI.</li><li>Aller voir Nathalie Follet au secrétariat de la direction GI (bout du bâtiment jules verne)</li><li>Charger 30 tables 1 place dans le 20m3</li><li>Dire merci</li><li>Aller se garer sur le parking de la piscine<br></li><li>Décharger les tables dans la salle en dessous du gymnase</li><li>Nettoyer les tables sales</li><li>Mettre 1 table en face de chaque poteau</li></ul><div><br></div></div><div>Deuxième job : même chose mais en GE :</div><div><ul><li>Aller se garer derrière GE.</li><li>Aller voir&nbsp;au secrétariat de GE pour qu''ils ouvrent la cave du départ</li><li>Charger 24 tables 2 places dans le 20m3</li><li>Dire merci</li><li>Aller au dépôt AIP</li><li>Décharger les tables</li><li>Nettoyer celles qui sont sales</li><li>Marquer AIP sur toutes les tables</li><li>Ranger correctement les tables (on empiète pas sur le passage ou devant une porte, on est pas encore entièrement chez nous)</li></ul></div><div><br></div></div><p></p>', 'Charisme, bras musclés', 0, 'QG Orgras', -1, 'non'),
(63, 21, 339, NULL, 'Préparer le matos des dépôts', '<p>Bonsoir !&nbsp;</p><div><br></div><div>Premier job : trier le matos au local des 24<br><div><ul><li>Rendez-vous au local des 24 heures (RdC bât D)</li><li>Retrouver Cetelem (Alexis)</li><li>Trouver la liste du matos à mettre dans les dépôts humas et AIP</li><li>Préparer la grande salle du local en la vidant/rangeant comme on peut</li><li>Chercher le matos de TOUT le local, regarder sur quelle liste il est et le mettre dans le tas correspondant</li><li>Marquer tout le matériel (scotch marron + marqueur "AIP" ou "humas")</li><li>Cetelem sera là tout le temps si tu as une question pose-lui :)</li></ul><div>Deuxième job : emmener le matos dans les dépôts</div></div></div><div><ul><li>Aller chercher un 20m3 au QG orga</li><li>Ramener le 20m3 devant le local</li><li>Charger le matos pour le dépôt AIP dedans</li><li>Aller au dépôt AIP</li><li>Décharger le matos et le ranger</li><li>Retourner au local, recharger le 20m3 avec le matos humas</li><li>Aller aux humas, décharger le 20m3</li><li>Ranger le 20m3 et rendre les clefs au QG orga</li></ul><div>Merci !</div></div><p></p>', NULL, 0, 'QG orga', -1, 'non'),
(64, 21, 339, NULL, 'Mission PC', '<p>Bonsoir !</p><div><br></div><div>Premier job : trouver Cetelem</div><div><ul><li>Rendez-vous au dépôt AIP (bâtiment GMC avec marqué AIP au-dessus de la porte, il y a un plan au QG si tu veux !)</li><li>Retrouve Cetelem (Alexis), il va arriver en 20m3</li><li>Décharger le 20m3 avec lui et écouter ses consignes</li><li>Ranger le matériel</li></ul><div>Deuxième job : la mission PC</div><ul><li><b>Aller au QG chercher une clef pompier, la clef des dépôts humas et AIP et la clef du poste de secouriste</b></li><li>Aller au PC, se garer derrière la 1ere travée</li><li>Trouver le gardien du PC: 04 72 43 85 85</li><li>Récupérer 250 chaises et les chargées dans le 20m3, mais 2 consignes importantes :</li></ul><u><b>Marquer le nombre de chaises prises dans chaque salle au tableau</b></u></div><div><u><b>Identifier chaque chaise avec du scotch (couleur donnée par le resp)</b></u></div><div><ul><li>Aller au PC secouriste et y déposer 30 chaises</li><li>Aller aux dépôts AIP et humas pour déposer les chaises qu''il faut, le resp a la liste</li><li>Ranger les dépôts !</li><li>Ranger le 20m3</li><li>Rendre toutes les clefs aux zumains de l''ambiance</li></ul><div>Merci !</div></div><p></p>', NULL, 0, 'Dépôt AIP', -1, 'non'),
(65, 21, 339, NULL, 'SHOTGUN LE 20M3', '<p>Coucou monsieur 20m3,</p><div><br></div><div>Retrouvez cetelem, il va vous conduire TOUTE l''après-midi.</div><div>Votre mission si vous l''acceptez est de porter tout ce qu''il vous donne et de ne pas faire d''accident (ou juste avec les sécuritas et l''armée).</div><div><br></div><div>Je beaucoup sur vous !</div><p></p>', NULL, 0, 'QG Orgras', -1, 'non'),
(66, 21, 340, NULL, 'Rendre le matos aux départs', '<p></p><ul><li>Rendez-vous au QG de l''ambiance !<br></li><li>Mange bien, réchauffe toi, fait toi masser !</li><li>Retrouve Cetelem et Bradley le 20m3<br></li><li>Trouve 2 sceaux, 3 éponges, 3 chiffons et du produit</li><li>Trouve au passage <b>une clef pompier et la clef du PC secouriste</b></li><li>Attrape ton courage à deux mains et dit&nbsp;à bientôt aux mamans<br></li><li>Partir en 20m3 pour le dépôt AIP</li></ul><div>Pause 20m3 !</div><ul><li>Charger toutes les chaises du PC. Cetelem aura le nombre de chaises empruntés sur lui. Il faut que le nombre de chaises chargées corresponde (environ <b>250 chaises</b>) !</li><li><u><b>Nettoyer les chaises encore sales</b></u></li><li>Aller au PC, se garer entre le PC et GMD derrière la 1ere travée</li><li>Le bâtiment ouvre à 7h, sinon appelle le gardien :&nbsp;04 72 43 85 85</li><li>Ranger toutes les tables dans les salles. <b>le nombre de chaises empruntées est noté sur chaque tableau.</b></li></ul><div>Pause 20m3 !</div><div><ul><li>Aller au PC secouriste</li><li>Nettoyer les tables encore sales</li><li>Charger les <b>30 tables 1 place</b> dans le 20m3</li><li>Aller devant GI</li><li>Trouver Nathalie Follet au secrétariat de la direction</li><li>Remettre les tables dans la salle où on les a prises</li><li>Remercier</li><li>Rentrer au QG orga</li><li>Rendre tout le matos pris</li></ul>Pignole !<br>On peut mourir en paix, les gens pourront s’asseoir en cours !<br></div><p></p>', 'Du courage, 1246 RB, de la motivation !', 0, 'QG Orga', -1, 'non'),
(67, 21, 324, NULL, 'Aller chercher le camion de Gaelis', '<p>MA BIIIITEEEEEE</p>', NULL, 1, 'QG Orgras', -1, 'non'),
(68, 21, 338, NULL, 'Mission PC', '<p>Bonsoir !</p><div><br></div><div>Premier job : trouver Cetelem</div><div><b>Attention, si ton créneau commence à 18h, tu dois retrouver <u>Fanny</u> au QG Orga (Mouillette : 06 87 52 47 46)</b></div><div><ul><li>Rendez-vous au dépôt AIP (bâtiment GMC avec marqué AIP au-dessus de la porte, il y a un plan au QG si tu veux !)</li><li>Retrouve Cetelem (Alexis, 06 80 52 08 62), il va arriver en 20m3</li><li>Décharge le 20m3 avec lui et écoute ses consignes. Tu es là pour l''aider pendant 2h30 !</li><li>Ranger le matériel</li></ul><div>Deuxième job : la mission PC</div><ul><li>Aller au PC en 20m3, se garer derrière la 1ère travée</li><li>Trouver le gardien du PC: 04 72 43 85 85</li><li>Récupérer 250 chaises et les charger dans le 20m3, mais 2 consignes importantes :</li></ul><u><b>Marquer le nombre de chaises prises dans chaque salle au tableau</b></u></div><div><u><b>Identifier chaque chaise avec du scotch elec orange (donné par cetelem)</b></u></div><div><ul><li>Dire merci</li><li>Fermer la barrière pompier</li><li>Aller au dépôt AIP pour déposer les chaises qu''il faut, le resp a la liste</li><li>Aller au PC secouriste et y déposer 30 chaises</li><li>Aller au dépôt humas pour déposer les chaises qui reste.</li><li>Ranger les dépôts !</li><li>Ranger le 20m3</li><li>Rendre toutes les clefs aux zumains de l''ambiance</li></ul><div>Merci !</div></div>', NULL, 0, 'Dépôt AIP', 3, 'non'),
(69, 21, 338, NULL, 'Aller chercher le matos GI', '<p>Bonsoir ! Tu as été choisi comme aide logistique !</p><div><ul><li>Retrouve Cetelem (alexis) au QG orga</li><li>Récupérez :</li></ul></div><div>- de&nbsp;quoi nettoyer des tables (3 éponges, 1 sceau, produit)</div><div>- de quoi noter les tables (2 rouleaux de scotch marron et 2 marqueurs)</div><div>- une clef pompier</div><div>- la clef de Bradley</div><div>- la clef du PC secouriste<br><ul><li>Prenez un 20m3 et c''est parti !</li><li>Aller se garer devant GI (utiliser la clef pompier avec parcimonie pour te frayer un chemin vers la liberté !)</li><li>Aller voir Nathalie Follet au secrétariat de la direction GI (bout du bâtiment jules verne)</li><li>Charger 30 tables 1 place dans le 20m3</li><li>Dire merci</li><li>Sortir du parking, fermer ce que tu as ouvert avec la clef pompier</li><li>Aller se garer sur le parking de la piscine<br></li><li>Décharger les tables dans le PC secouriste (salle de l''AS pingpong ou tir à l''arc)</li><li>Nettoyer les tables sales</li><li>Aller au QG orga, ranger le matos pris</li><li>Rendre les clefs</li></ul></div>', NULL, 0, 'Local des 24 Heures', 3, 'non'),
(70, 21, 335, NULL, 'Préparer le matos des dépôts', '<p>Bonsoir !&nbsp;</p><div>Premier job : trier le matos au local des 24<br><div><ul><li>Rendez-vous au local des 24 heures (RdC bât D)</li><li>Retrouver Cetelem (Alexis)</li><li>Lui demander la liste du matos à mettre dans les dépôts humas et AIP.</li><li>Vérifier que le matos présent dans les tas au local soit au bon endroit.</li></ul><div><b>Aller chercher un 20m3,&nbsp;</b><b>une clef pompier, la clef des dépôts humas et AIP, la clef de la salle A302 et la clef du poste de secouriste</b><b>&nbsp;au QG de l''ambiance. Prends aussi des marqueurs et du scotch pour les gens qui attendent à l''AIP.</b></div><div><br></div><div>Deuxième job : emmener le matos dans les dépôts</div></div></div><div><ul><li>Quand cetelem revient,</li><li>Charger le matos pour le dépôt humas dans le 20m3</li><li>Aller au dépôt humas</li><li>Décharger le matos et le ranger</li><li>Retourner au local, recharger le 20m3 avec le matos AIP</li><li>Aller au dépôt AIP, décharger le 20m3</li><li>Trouver les orgas qui prennent la relève</li><li>Ne pas être en retard, c''est un peu la foulie.</li></ul><div>Merci !</div></div>', 'Casquettes Mcdal', 0, 'Local des 24 Heures', 3, 'non'),
(71, 21, 338, NULL, 'Mission PC le retour', '<p></p><ul><li>Rendez-vous au dépôt AIP de l''ambiance !</li><li>Retrouve Cetelem (Alexis, resp log, petit et vert, 06 80 52 08 62) et Bradley (le 20m3 de l''ambiance)<br></li><li>Trouve de quoi nettoyer (éponge, seau, chiffon, produit)</li><li>Nettoyer tout le matos présent, et surtout enlever le scotch "AIP"</li><li>La priorité est de <u style="font-weight: bold;">nettoyer les chaises encore sales</u></li><li>Charger toutes les chaises propres du PC dans Bradley (attention, ne pas les ranger en foutre). Cetelem aura le nombre de chaises empruntés sur lui. Il faut que le nombre de chaises chargées corresponde (environ&nbsp;<b>250 chaises</b>) !</li><li>Aller au PC, se garer entre le PC et GMD derrière la 1ere travée</li><li>Le bâtiment ouvre à 7h, sinon appelle le gardien :&nbsp;04 72 43 85 85</li><li>Ranger toutes les chaises dans les salles.<u>&nbsp;</u><b><u>le nombre de chaises empruntées est noté sur chaque tableau</u></b></li></ul><div>Pignole !<br>On peut mourir en paix, les gens pourront s’asseoir en cours !<br></div><div><br></div><div>Retourner au dépôt AIP</div><div>Trouver les orgas qui attendent là-bas et passer à la tâche suivante !</div><div><br></div><p></p>', NULL, 0, 'Dépôt AIP', 3, 'non'),
(72, 21, 338, NULL, 'Rendre les tables en GI', '<p></p><ul><li>Rendez-vous au QG de l''ambiance !<br></li><li>Mange bien, réchauffe toi, fait toi masser !</li><li>Retrouve Brandon (le 20m3 de l''ambiance) et tes co-tâches<br></li><li>Prend de quoi nettoyer des tables (1 seau, 3 éponges, 3 chiffons)</li><li>Demande&nbsp;<b>la clef du PC secouriste et une clef pompier</b></li><li>Attrape ton courage à deux mains et dit&nbsp;à bientôt aux mamans</li><li>Partir avec en 20m3 pour le PC secouriste</li></ul><div>Pause 20m3 !</div><ul><li><u><b>Nettoyer les tables encore sales</b></u></li><li>Charger les&nbsp;<b>30 tables 1 place</b>&nbsp;dans le 20m3</li><li>Fermer le PC secouriste</li><li>Aller devant GI (utiliser la clef pompier avec beaucoup d''attention, elle est très gentille)</li><li>Trouver Nathalie Follet au secrétariat de la direction</li><li>Remettre les tables dans la salle où on les a prises</li><li>Remercier</li><li>Rentrer au QG orga</li><li>Rendre tout le matos et les clefs prises</li></ul><div>Pignole !<br>On peut mourir en paix, les gens pourront aller en cours !</div><p></p>', NULL, 0, 'QG Orga', 3, 'non'),
(73, 21, 338, NULL, 'Rangement des chaises', '<p>Bonsoir !</p><div><ul><li>Rendez-vous au QG orga</li><li>Retrouver Cetelem (Alexis) et Bradley le 20m3 de l''ambiance</li><li>Charger 10 éponges, 10 torchons, 4 sceaux et du produit qui nettoie</li><li>Demande la <b>clef du PC secouriste, une clef pompier</b> aux humains</li><li>Aller en 20m3 au PC secouriste</li><li>Charger les chaises dans Bradley</li><li>Rapprocher les tables de la porte</li><li>Nettoyer tout le matos</li><li>Aller au dépôt AIP</li><li>Décharger tout le matos de nettoyage</li><li>Aider les autres à nettoyer les chaises restantes</li><li>Ramener la clef du PC secouriste aux humains</li><li>Retourner au dépôt AIP</li><li><b>Frotter les chaises et tout le matos</b>, il faut qu''on se voit dedans !</li></ul><div><br></div>Gros bibis :)<br><div><br></div></div><p></p>', NULL, 0, 'QG Orgras', 3, 'non'),
(74, 21, 338, NULL, 'Tâche sans nom', 'sdh', NULL, 0, 'QG Orgras', -1, 'non'),
(75, 206, 334, NULL, 'Réception courses METRO', '<p></p><ul><li>Rends-toi au QG de l''ambiance (le QG orga)</li><li>Attends patiemment, que les orgas reviennent avec Josh (le 11m3) rempli de courses</li><li>Propose-leur à boire, ils l''ont bien mérité</li><li>A présent, il faut vider Josh (avec tes deux mains !). N''y va pas trop fort, le contenu est parfois fragile</li><li>Pose tout dans le QG orga, tout en suivant les consignes de l''orga bouffe qui te dira où empiler chaque produit (car ils n''iront pas tous au même endroit)</li><li>Mets au frais ce qui a besoin d''être conservé au frais</li></ul><div>En cas de problème, tu peux appeler Mamie Caro (06 79 12 17 05) ou Doc-X (07 77 89 97 97)</div> <p></p>', NULL, 0, 'Local 24h', -1, 'non'),
(76, 223, 341, NULL, 'Rapatriement congélo tente & moquette + installation', '<p></p><div>Ta mission (que tu acceptes) : ramener la moquette de la cave, le congélo et la tente 4*8 au bar bouffe de l''ambiance !</div><div>(pense à prendre des gants si tu en as !)</div><ul><li>Rejoins Mamie Caro (<a href="tel:06 79 12 17 05">06 79 12 17 05</a>) et Doc-X (<a href="tel:07 77 89 97 97">07 77 89 97 97</a>) au QG Orga (à la Rotonde).</li><li>Prends les clefs du 20m3 et de la cave.</li><li>Va chercher le congélo et la tente situés à la cave avec Bradley, le 20m3 de l''ambiance, et fourre Bradley de moquette pour combler les espaces vides</li><li>Dépose le tout sur le stand bouffe, à l''endroit indiqué sur le plan qu''aura l''orga bouffe qui t''accompagnera.</li><li>Maintenant, il faut installer la moquette (mais ne t''inquiète pas, on est plusieurs et ça devrait aller vite).</li><li>Ne pas monter la tente ! sinon le camion frigo ne passera plus...</li><li>Appelez la loooooog (Nico : 0632033374) pour qu''ils branchent les frigos (qui seront déjà sur place) et le congel.&nbsp;</li><li>Ramener les clefs du 20m3 et de la cave au QG orga.</li><li>Apéro !</li></ul><p></p>', '- Le seul congélateur qu''on a', 0, 'QG Orga (Rotonde)', 3, 'non'),
(77, 223, 334, NULL, 'Courses de frais BA', '<p></p><ul><li>Rendez-vous au local des 24h et attendre Mamie Caro (06 79 12 17 05)</li><li>Prendre le chèque (ne pas le perdre !) et la liste des courses dans le casier bouffe</li><li>Partir à 1 seule voiture (ce sera suffisant)</li><li>Aller à Auchan Caluire :<br>10 chemin Petit<br>69300 CALUIRE et Cuire</li><li>Faire les courses</li><li>Revenir sur le campus et livrer la bouffe artiste à la MDE, en salle Hibiscus</li></ul><p></p>', NULL, 0, 'Bar bouffe', -1, 'raf'),
(78, 213, 332, NULL, 'Rangement des Jeux en Bois (Samedi)', '<p>Aller sur la pelouse des Humas, devant GCU, à l''intersection des deux routes, où se trouve les jeux en bois.</p><p>Ramène au dépôt AIP:</p><p></p><ul><li>4 tables&nbsp;<br></li><li>2 chaises<br></li><li>9 jeux en bois<br></li><li>les notices des jeux en bois (2 exemplaires)</li></ul><p></p><div><br></div><div>Les regrouper ensemble, en veillant à ne pas les mélanger avec le matériel d''autres animations, pour que ce soit plus facile à ré-installer demain matin.</div><div><br></div><div>N''hésite pas à appeler Romain en cas de problème : 06 36 94 28 11</div>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(79, 21, 324, NULL, 'Conducteur - Ramener Josh', '<p>RDV au QG orga</p><p>Demande les clefs de Josh et un talkie aux humains</p><p>Le conduire tendrement jusqu''à l''Astrée.</p><p>Se garer et noter le nombre de km au compteur et l''envoyer par sms à Cetelem</p><p>Monter à l''étage et aller dans le bureau de GAELIS. Trouver Gaetan -&nbsp;06 50 68 29 02 - le président de Gaelis</p><p>Lui donner les clefs de Josh et lui dire qu''il était quand même cool et que tu es triste de le quitter</p><p>Dire au revoir à Josh.</p><p>Rentrer tristement au QG et annoncer au talkie que ça y est, Josh n''est plus à nous !</p>', NULL, 0, 'QG Orgras', 3, 'non'),
(80, 14, 342, NULL, 'Réunion Eau Dirpat', '<P>Va à la dirpat faire le point avec les plombiers pour l''installation.</P>', NULL, 0, 'ZC', 3, 'non'),
(81, 14, 342, NULL, 'Vérification mise en eau bar', '<p>Va sur la ZC, vérifie que les bars sont branchés à l''eau et que tout est bon pour la mise en marche des tireuses en fin de journée</p>', NULL, 0, 'ZC', 3, 'non'),
(82, 14, 342, NULL, 'Vérification mise en place eau anims', '<P>Va sur la ZC et vérifie que toutes les arrivés d''eau sont en place</P>', NULL, 0, 'ZC', 3, 'non'),
(83, 14, 342, NULL, 'Brancher ciné plein air', '<P>Récupère au dépôt AIP&nbsp;<B>le&nbsp;tuyau&nbsp;d''arrosage du ciné plein air<BR></B>Récupère à l''emplacement de la ferme <B>le&nbsp;tuyau&nbsp;d''arrosage<BR></B>Récupère dans la back line une <B>rallonge de 50m</B></P>\r\n<P>-&gt; Emmène tout ça à l''emplacement du ciné plein air&nbsp;</P>\r\n<P>Prépare l''installation des tuyaux pour l''arrivée du presta et de l''elec. <BR>Quand le presta arrive, montre lui tout les tuyaux pour qu''il se débrouille avec et&nbsp;les points de branchement élec au presta.&nbsp;</P>\r\n<DIV><BR></DIV>', NULL, 0, 'ZC', 3, 'non'),
(84, 14, 343, NULL, 'Vérification Transfo', '<p>Rejoindre les électriciens de la Dirpat devant la direction</p><div>Faire le tour de tous les transfos avec philty.</div><div><br></div><div>Récupérer le numéro de l''électricien qui sera d''astreinte le week-end et son numéro de turne (petit coquin !) et oublie pas de lui donner un bracelet orga.</div><p></p>', 'bracelet orga', 0, 'Devant la direction', 3, 'non'),
(85, 14, 343, NULL, 'Déchargement Matos Elec', '<p>Appelle Nico au talkie ou au 06 32 03 33 74 et retrouve le.</p><div>Attendez que le camion du matos élec arrive, et déchargez le sous la cabane de la back line.&nbsp;</div><div><br></div>', NULL, 0, 'Entre GMC et GCU', 3, 'non'),
(86, 194, 336, NULL, 'Faire le point avec l''AS JUDO en soirée', '<p>Aller voir les deux sites de toilettes sèches et voir si tout va bien!</p><div><br></div><div>Demander de l''aide si besoin au QG orga avec le talkie.</div><p></p>', NULL, 0, 'Deux sites de toilettes sèches', -1, 'non'),
(87, 194, 336, NULL, 'One, two, tri (exté)', '<p>Récupère un kit propreté devant l''AIP (gants, sacs de 3 couleurs et plan) et faire le tour des triangles de barrières devant l''entrée de la ZC. Récupère les sacs poubelles, met en des nouveaux et ramène les remplis devant le dépôt AIP, derrière les caisses.</p><div>Jette les sacs noirs dans la benne RDS, vide le verre dans les silos et met les plastiques dans un sac jaune.</div><div><br></div><div>Une fois tout ça terminé, vois avec le resp (George : 06 45 29 97 20) si c''est tout bon. Laisse le kit devant le dépôt AIP.</div><div><br></div><div>Normalement tu as finis ta tâche avant la fin du créneau donc retourne profiter des concerts!!</div><p></p>', 'Kit de propreté x1', 0, 'Creux AIP, derrière les caisses', 3, 'non'),
(88, 194, 336, NULL, 'One, two, tri (ZC)', '<p>Récupère un kit propreté devant l''AIP (gants, sacs de 3 couleurs et plan) et faire le tour des triangles de barrières dans la ZC. Récupère les sacs poubelles, met en des nouveaux et ramène les remplis dans le creux AIP, derrière les caisses.</p><div>Jette les sacs noirs dans la benne RDS et met les plastiques dans un sac jaune.</div><div><br></div><div>Une fois tout ça terminé, vois avec le resp (Nico : 06 45 29 97 20) si c''est tout bon. Laisse le kit dans le creux AIP.</div><div><br></div><div>Normalement tu as finis ta tâche avant la fin du créneau donc retourne profiter des concerts!!</div>', 'Kit de propreté x1', 0, 'Creux AIP, derrière les caisses', 3, 'non'),
(89, 219, 336, NULL, 'C''est du propre !', 'Récupère un kit de propreté (sacs, gants, plan) au QG Orga.<div><br></div><div>Fais le tour des triangles de barrières. Change les sacs et ramène les remplis au dépôt le plus proche (creux GCU ou creux AIP, derrière les caisses). N''hésite pas à ramasser les déchets environnants et ceux que tu pourras croiser sur ton chemin !</div><p>Jette les sacs&nbsp;noirs dans la benne RDS, vide le verre dans les silos et met les plastiques dans un sac jaune.</p><p>Une fois tout ça terminé, vois avec la resp (Marie - 06 61 23 21 55) si c''est bon et rapporte le kit au QG orga.</p><div>Normalement tu as finis ta tâche avant la fin du créneau donc retourne profiter des anims!!&nbsp;</div>', 'Kit de propreté x1', 0, 'QG Orga', 3, 'non'),
(90, 194, 344, NULL, 'Accueil de Caux Loc', '<p>Accueil les cabines de toilettes sèches et explique au gars comment les placer :</p><div>-au sud de la ZC, entre piscine et direction : 5 cabines + 1 PMR</div><div>-au nord de la ZC, rond point manège : 5 cabines</div><div><br></div><div>Remercie le et dis lui à lundi!</div><p></p>', NULL, 0, 'Moitié entre piscine et direction - Moitié rond point manège', 0, 'non'),
(91, 194, 344, NULL, 'Voir avec l''AS Judo si tout va bien', '<p>Aller sur la zone de toilettes derrière la piscine. Si il n''y a personne aller sur la deuxième zone, près de l''entrée.</p><p>Voir avec les orgas de l''AS Judo si tout va bien.</p><div>Demande de l''aide au QG Orga si besoin avec ton talkie.&nbsp;</div><div><br></div><div>Les encourager et encore les remercier pour tout le boulot qui font!</div><p></p>', NULL, 0, 'Moitié entre piscine et direction - Moitié rond point manège', 3, 'non'),
(92, 194, 344, NULL, 'Départ des toilettes', '<p>Etre présent quand Caux Loc vient chercher ses cabines et éventuellement l''aider.</p><div><br></div><div>Le remercier et lui dire au revoir et à l''année prochaine!</div><p></p>', NULL, 0, 'Moitié entre piscine et direction - Moitié rond point manège', 0, 'non'),
(93, 194, 336, NULL, 'Rangement des poubelles Dirpat', '<p></p><ol><li><b>(For RESP</b> : se munir du plan poubelle qui est toujours dans ton sac !)</li><li>Retrouver le resp'' devant le creux GCU (entre les bâtiments Freyssinet, Eiffel et Coulomb)<br></li><li>Récupérer toutes les poubelles à roulette jaunes et bleues et les amener au croisement entre la rue des arts et la rue des sports (c''est vers le rond point à coté du gymnase de la piscine)&nbsp;</li><li>Allez voir au local qu''est-ce qu''ils sont beaux les gens fatigués</li></ol><p></p><p></p>', NULL, 0, 'Creux GCU', 3, 'non'),
(94, 206, 341, NULL, 'Matos GR', '<p></p><ul><li>Rends-toi au local des 24h<br></li><li>Récupère dans le casier bouffe la liste du matériel à aller chercher au Grand Resto</li><li>Rends-toi à l''arrière du Grand Resto avec la liste, et adresse-toi à un magasinier</li><li>Prends tout ce qu''il te donne (d''ailleurs, si tu peux avoir un caddie avec toi, ce serait cool, car il y a moultes choses à récupérer !!!). Vérifie que les quantités de matériel que l''on te donne sont conformes à celles indiquées sur le papier. Si ce n''est pas le cas, vérifie que le magasinier ne s''est pas trompé, et le cas échéant, rectifie les quantités sur le papier.</li><li>Pose le tout dans le local de Graine d''Images prévu à cet effet (les clés seront au local des 24h). Surtout, mets-bien tout au même endroit, car l''orga bouffe triera le matos le soir même.</li></ul><div>En cas de problème, préviens Doc-X (<a href="tel:07 77 89 97 97">07 77 89 97 97</a>).</div><p></p>', NULL, 0, 'Bar bouffe', 3, 'non'),
(95, 219, 336, NULL, 'GRAND nettoyage', '<p>Après le feu d''artifice, tous les orgas se rendent au QG pour le grand nettoyage final.\r\n</p><p>\r\nDonner aux 6 resp de zones&nbsp; (Marie, Jeanne, Kamil, Constant, Fred et Georges) le plan du campus et répartir les kits de propreté et les talkies entre les 6 teams de la mort!</p><p>Marie (06 61 23 21 55) supervise les 6 équipes. Et tout le monde s''y met !<br></p><p>\r\nA la fin, tout le monde rentre au QG Orga pour finir le déménagement !</p>', 'Kits de propreté (gants, sacs poubelles..)\r\n1 lampe frontale /personne', 0, 'QG Orga', 3, 'non'),
(96, 14, 343, NULL, 'Gardiennage Matos Elec', '<p>Rends toi près de la grande scène</p><div>Si tu es le premier créneau de la nuit, retrouve la log qui te fera un briefing sur ta mission.&nbsp;</div><div><br></div><div>Sinon, fais toi briefer par ceux d''avant (c''est maintenant qu''il faut les réveiller)</div><div><br></div><div>Retrouve les orgas qui sont affectés au gardiennage de la grande scène. Tu vas passer 3h de la nuit avec eux, sois heureux ! Mais attention, ils gardent férocement leur territoire !&nbsp;</div><div><br></div><div>Fais des rondes pour surveiller le matériel élec, sois méfiant, discret, et attaque au moindre doute.&nbsp;</div><div><br></div><div><b>Zone à surveiller par le gardiennage élec :</b></div><div>- tout l''elec et le matos situés autour du bâtiment GCU</div><div>- le matos situé dans le creux GCU (la zone à l''ouest de GCU, entre le batiment GCU et le bâtiment coulomb)</div><div>- le matos situé devant l''AIP</div><div>- le matos situé entre l''AIP et la direction</div><div><br></div><div>Sois patient.&nbsp;</div><div><br></div><div>Joue au cartes avec ton co-gardiennage.</div><div><br></div><div>Va faire peur aux orgas en gardiennage grande scène.&nbsp;</div><div><br></div><div>Attends que les orgas du créneau suivant viennent te remplacer et briefe les.&nbsp;</div>', NULL, 0, 'Grande Scène', -1, 'non'),
(97, 14, 343, NULL, 'Installation Elec', '<p>Tu vas travailler avec Philippe et Gilles, les électriciens des 24 heures, au montage de l''installation électrique.</p><div>Ne t''inquiètes pas, ce n''est pas difficile et encore moins dangereux !</div><div><br></div><div>Rends toi sur la pelouse des humas, près de la cabane en bois derrière la grande scène.</div><div><br></div><div>Si tu trouve Philippe ou Gilles, suis leurs instructions. Si tu ne trouves pas, demande Nico au talkie, ou si il n''y a pas de talkie dans le coin, au <a href="tel:06 32 03 33 74">06 32 03 33 74</a>. Il te dira où retrouver Philippe ou Gilles</div><div><br></div><div>Quand tu as finis ton créneau, tu peux aller au local 24h (ou au qg orga à partir de jeudi aprem) demander du travail à l''orga humain. Sinon, tu peux aller en cours, ou te reposer, mais n''est nettement moins conseillé.&nbsp;</div><div><br></div>', NULL, 0, 'ZC', 3, 'non');
INSERT INTO `Tache` (`id`, `responsable_id`, `groupetache_id`, `importid`, `nom`, `consignes`, `materielSupplementaire`, `permisNecessaire`, `lieu`, `statut`, `commentaireLog`) VALUES
(98, 14, 343, NULL, 'Montage éclairage ZC', '<p>Rejoins Nico dans la cabane en bois derrière la grande scène, s''il n''est pas là appelle le au talkie ou au 06 32 03 33 74.</p><p>Si il répond pas c''est qu''il est encore dans la cave attends un petit peu avant de réessayer</p><div>Suis ses instructions pour le montage de l''éclairage de la zone concerts.&nbsp;</div><div><br></div><div>À la fin ramenez les clés de la voiture au local</div>', NULL, 0, 'Cabane derrière la scène', 3, 'non'),
(99, 14, 343, NULL, 'Montage éclairage Bar', '<p>Va à coté de GCU et appelle Nico au talkie ou au 06 32 03 33 74.&nbsp;</p><div><br></div><div>Aide le pour monter les guirlandes d''éclairage sur les bars.&nbsp;</div><div>(<b>Pour info</b>:Les guirlandes se trouvent dans la cabane en bois de la grande scène)</div>', NULL, 0, 'GCU', 3, 'non'),
(100, 14, 343, NULL, 'Verification blocs phares + éclairage', '<p>Fais le tour de tous les blocs phares, vérifie qu''ils sont bien branchés. S''ils ne sont pas branchés, pas d''ouverture de la ZC, retard des concerts, baisse des bénéfices, année en négatif, prison pour Clément. </p><div>Idem pour les projos, branche les et vérifie qu''ils marchent</div><p></p>', NULL, 0, 'ZC', 3, 'non'),
(101, 14, 343, NULL, 'Chargement matos élec', '<p>Va dans la cabane derrière la grande scène et retrouve Nico. Si il n''est pas là, appelle le au 06 32 03 33 74.&nbsp;</p><div><br></div><div>Aide le à charger le matériel électrique dans le semi-remorque de Audio technique.&nbsp;</div><div>Tu peux retourner en cours ou aller travailler, mais c''est pas très conseillé donc va au local des 24h il y aura surement pleins de choses à faire &nbsp;;)</div>', NULL, 0, 'Cabane en Bois derrière la grande Scène', 3, 'non'),
(102, 14, 343, NULL, 'Démontage élec', '<p><b>Pour les créneaux entre dimanche 23h et lundi 3h :</b>Appelle Nico au talkie ou au 06 32 03 33 74.</p>\r\n<p>Allez rejoindre Philippe l''électricien pour l''aider à démonter le matos électrique</p>\r\n<div><b>Pour les créneaux à partir de lundi 9h&nbsp;</b>: retrouve Philty sous la cabane en bois (derrière la grande scène) si tu ne le trouves pas appelle Nico au 06 32 03 33 74</div>', NULL, 0, 'ZC', 3, 'non'),
(103, 14, 343, NULL, 'Ramener Projos et guirlande de la cave', '<p>Rends toi au local des 24h (RDC Bat D), retrouve Nico (06 32 03 33 74)</p><div>Pensez à prendre :</div><div><ul><li>une voiture</li><li>la clé de la cave</li></ul></div><div>Va avec lui à la cave des 24h récupérer <b>l''éclairage</b>&nbsp;<b>(quartz classique sac plastique jaune + 1 noir + tous les néons qui trainent à la cave)</b>&nbsp;sans oublier les pieds de <b>projos (cartons music store)&nbsp;</b>et la <b>guirlande des bars (sac poubelle noire)</b></div><div><br></div><div>Ramène la clé de la cave au Local</div><div><br></div><div><div>Emmenez la guirlande des bars dans la cabane en bois derrière la scène et commencez l''installation des projos. On sera aidé à partir de 9h par deux orgas en plus ;)</div></div><div><br></div>', NULL, 0, 'Local des 24H', 3, 'non'),
(104, 14, 343, NULL, 'Démontage Guirlande bars Nord + éclairage ZC Nord', '<p>Retrouve Nico au niveau de la petite scène, s''il n''est pas là, appelle le au 06 32 03 33 74.</p><div>Aide le à défaire les guirlandes et l''éclairage des bars Cetiat + Manège + Piscine</div><div>Emmener tout ça dans la cabane en bois derrière la scène.</div><p></p>', NULL, 0, 'Petite scène', 3, 'non'),
(105, 14, 343, NULL, 'Démontage Guirlands bars + éclairage ZC', '<p>Retrouve Nico au QG orga, s''il n''est pas là appelle le au talkie ou au 06 32 03 33 74.&nbsp;</p><div>Si il n''est pas réveillé, demande à la maman de le réveiller avec douceur et tendresse.&nbsp;<br>Allez démonter les guirlandes des bars et l''éclairage de la zone concert.&nbsp;<br>Mettez tout dans la cabane en bois<br></div>', NULL, 0, 'QG Orga', 3, 'non'),
(106, 14, 343, NULL, 'Ramener Projos + Elec à la cave', '<p>Rejoins Nico au local des 24H (RDC bat D), s''il n''est pas là, appelle le au talkie ou au 06 32 03 33 74.</p><div>Pensez à prendre:</div><div><ul><li>une voiture</li><li>une clé pompier</li><li>la clé de la cave</li></ul><div><br></div><div>Ramener tout le matos elec (projos, pieds de projos, rallonges...) qui sera sous la cabane derrière la scène à la cave</div></div><div><br></div><div>Rends les clés aux zumains qui seront au local !</div><p></p>', NULL, 0, 'Local 24H Bâtiment D', 3, 'non'),
(107, 12, 346, NULL, 'Flyage Tête d''or', '<p>Viens au local (de l''ambiance) &nbsp;récupérer ton co-flyage, une grosse pile de flyers (environ 200 chacun) et une dose de charisme.</p><div>Dirige-toi vers l''arrêt de tram.&nbsp;</div><div>Prends le tram jusqu''à la Part-Dieu.</div><div>Flye jusqu''à ce que tu n''aies plus de flyers.&nbsp;</div><div>Reviens au local avec le sentiment d''avoir participé au non-déficit des 24h.&nbsp;</div><div><br></div><div>I believe I can flye !&nbsp;<span style="background-color: rgb(249, 249, 249); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 21px;">♫</span></div><p></p>', NULL, 0, 'Local', 3, 'non'),
(108, 12, 346, NULL, 'Flyage Charpennes', '<p>Viens au local (de l''ambiance) &nbsp;récupérer ton co-flyage, une grosse pile de flyers (environ 200 chacun) et une dose de charisme. Tu peux aussi prendre ton onesie !</p><div>Dirige-toi vers l''arrêt de tram.&nbsp;</div><div>Prends le tram jusqu''à Charpennes.</div><div>Flye jusqu''à ce que tu n''aies plus de flyers.&nbsp;</div><div>Reviens au local avec le sentiment d''avoir participé au non-déficit des 24h.&nbsp;</div><div><br></div><div>I believe I can flye !&nbsp;<span style="background-color: rgb(249, 249, 249); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 21px;">♫</span></div>', NULL, 0, 'Local', 3, 'non'),
(109, 14, 347, NULL, 'Plan tables Grillon Thélème', '<div>Mission Grillon Olivier Round 1:<br></div><p></p>Armé de ton pistolet à silicone <b>laisse toi guider</b> par la douce odeur des frite du <b>Grillon</b><div><br></div><div><br></div><div><b>Retrouve Mr. Gracia</b> le resp Thélème<br></div><div><b>Dis lui bonjour</b>, et que les frites sont bonnes mais que les pizzas sont toujours trop petites et aussi la pizza du pêcheur faudrait vraiment qu''ils laissent tomber parce que c''est ignoble.<br><br><b>Fais le plan de table</b> de l''Olivier et du grillon avec lui, ou prend des photos ça marche aussi ! Et surtout rappelle lui que vendredi aprem tu viendras récupérer les clés (vois ci-dessous) Et les rendre lundi matin :)</div><div><br><br></div><div><u>Pour info</u>, les clefs sont récupérées un peu plus tard dans l''aprem au gardiennage (mais si Mr. Gracia est pas trop pète cul ça serait cool qu''il nous les passe tout de suite comme ça on a pas besoin d''aller au gardiennage)</div><div>Elles seront rendus le lundi matin lors de l''état des lieux<br><p></p></div>', NULL, 0, 'MdE', 3, 'non (raf)'),
(110, 28, 348, NULL, 'Récupérer les clés au SIUAPS', '<p></p><ul><li>Rends toi au SIUAPS (batiment de l''université derrière les terrains de tennis)<br></li><li>Va voir les secrétaires</li><li>Demande les clés</li><li>Patiente le temps qu''elles racontent leur vie/ récupèrent les clés<br></li><li>Prends les clés, remercie les et tire toi</li><li>Retourne au bocal et vérifie avec la log que toutes les clés sont bien présentes (contrat dans le casier sport)</li></ul><p></p>', NULL, 0, 'Gymnase Lyon 1', 3, 'non'),
(111, 28, 348, NULL, 'Rendre les clés au SIUAPS', '<p></p><ul><li>Demander les clés à l''humain au local des 24 heures/la log (<span style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">06 01 33 50 87 ou&nbsp;</span><span style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">06 21 39 17 69 Hugo et Dina)</span></li><li>Vérifier avec le contrat qu''elles sont toutes bien là</li><li>Aller au SIUAPS (batiment de l''université derrière les terrains de foot)&nbsp;pour les rendre</li><li>S''il en manque, bluffe (sors en une de ta poche), tu es dans la merde!</li></ul><p></p>', NULL, 0, 'Local des 24 heures', 3, 'non'),
(112, 28, 348, NULL, 'Vérifier que les clés du SIUAPS sont les bonnes', '<p></p><ul><li>Récupère la liste des salles louées au SIUAPS (casier sport) et le trousseau de clefs (que tu viens d''aller chercher chez le siuaps)</li><li>Enfourches ta monture à 2 roues et fais le tour de toutes les salles pour vérifier que toutes les clefs sont bien dans le trousseau</li><li>Attention&nbsp;particulièrement&nbsp;à l''accès intérieur de la piscine et des salles de danses du gymnase Colette Besson</li><li>Retourne au QG orga à la rotonde et va rendre les clés à l''humain</li></ul><p></p>', NULL, 0, 'Local des 24 heures', 3, 'non'),
(113, 14, 347, NULL, 'Clés Grillon + Olivier', '<p><b>Passe-partout</b>: Ta mission est de rentrer dans l''acceuil et de récupérer les clés de l''olivier et du grillon en le moins de temps possible !<br></p><p><b>Nicolas</b> (<u>invaincu à fort boyard</u> depuis 24 éditions) : C''est bon je suis au taquet !</p><p><b>Pass-partout</b>: Attention je vais ouvrir la porte et déclencher le sablier, tu n''auras que 15 minutes pour trouver la clef et ressortir en vie sinon tu fera perdre toute ton équipe</p><p>Père Fouras : Va retrouver le père Fouras dans son antre de la MDE. Ouvre le grillon et l''olivier et referme-les ! C''est parfait aucun problème tu as la clef !</p><p><b>Toute l''équipe des grognasse qui le supporte : </b>Vas-y Nico cours ! là à gauche non à droite , oue t''es trop fort, t''es le plus beau ! c''est bon elle est là ! elle est devant toi ! prends la !! Oueeeee ! ok maintenant c''est pas fini, il te reste quelques secondes pour la rapporter à passe-muraille (<b>Dina </b>: Ça me brise le coeur ce nom...) qui siège au QG de l''ambiance, fait vite !!!</p><p><b>Nicolas :</b>&nbsp;Yes !! je l''ai remise à temps</p><p><b>Pass-partout : </b>&nbsp;Bravo ! je n''ai jamais vu qqun d''aussi agile et rapide que toi ! Tu peux boire un red Bull pour toute l’énergie que tu as dépensé !</p><p><br></p>', NULL, 0, 'Accueil INSA', 3, 'non'),
(114, 222, 349, NULL, 'Accueillir Hand', '<p><b style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14.44444465637207px; line-height: 20px; background-color: rgb(255, 255, 255);">Prestataire :&nbsp;</b><span style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14.44444465637207px; line-height: 20px; background-color: rgb(255, 255, 255);"><b>Lara Brouillet - 0642745215</b><br><br>--------</span><span style="background-color: rgb(255, 255, 255);"><font color="#333333" face="Helvetica Neue, Helvetica, Arial, sans-serif"><span style="font-size: 14.44444465637207px; line-height: 20px;">------------</span></font></span></p><ul><li style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14.44444465637207px; line-height: 20px;"><span style="font-size: 14.44444465637207px;">Retrouver Lara au Gymnase C</span></li><li><span style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14.44444465637207px; line-height: 20px;">Vérifier que tout va bien,que les équipes vont bien venir, etc.</span></li><li><span style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14.44444465637207px; line-height: 20px;">Lui souhaiter un bon match</span></li><li><span style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14.44444465637207px; line-height: 20px;">Repartir en chantant</span><br></li></ul><p></p><p><span style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14.44444465637207px; line-height: 20px; background-color: rgb(255, 255, 255);"><br></span></p>', NULL, 0, 'Gymnase C', 3, 'non'),
(115, 28, 349, NULL, 'Dire au revoir au hand et fermer le gymnase C', '<p></p><ul><li>Aller récupérer les clés du gymnase C au QG orga</li><li>Aller au gymnase C<br></li><li>Voir si le match de gala s''est bien déroulé<br></li><li>Leur demander de partir le plus vite possible<br></li><li>Leur souhaiter un bon BBQ</li><li>Fermer le gymnase en vérifiant que personne n''est sur les gradins<br></li><li>Aller rendre les clés au QG orga<br></li></ul><p></p>', NULL, 0, 'QG orga', 3, 'non'),
(116, 14, 347, NULL, 'Clés Graines d''Images', '<div>Demande à Léo s''il n''a pas déjà fait la tâche</div><p></p>if (tu te trouves au local)<div>{ &nbsp; &nbsp; tant mieux ça te fera moins à marcher gros sac !</div><div>} else {</div><div>&nbsp; &nbsp; &nbsp; fait chier</div><div>}</div><div><b><u>allerAuLocalDe(Graines d''Images)</u></b>;</div><div>if (ya qqun ici ?) {</div><div>&nbsp; &nbsp; &nbsp;systeme.out.println("vous pouvez me passer les clées du local siouplé !");</div><div>&nbsp; &nbsp; &nbsp;<b><u>prendreLesCles(du local de GI);</u></b></div><div>} else {&nbsp;</div><div>&nbsp; &nbsp; <b><u>Hugues au 06 28 94 83 71, se fera une joie de répondre à toutes vos questions</u></b></div><div>&nbsp; &nbsp; Attendre(qu''il arrive);</div><div>&nbsp; &nbsp; prendreLesCles(du local de GI);</div><div>}</div><div><b><u>donnerLesCles(à l''humain)</u></b></div><div>allerManger(du paté);</div><div><br></div><div><p></p></div>', NULL, 0, 'Graines d''mages', 3, 'non'),
(117, 215, 350, NULL, 'Ouvrir Piscine et accueillir Water Polo', '<p><b style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14.44444465637207px; line-height: 20px; background-color: rgb(255, 255, 255);">&nbsp;</b><span style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14.44444465637207px; line-height: 20px; background-color: rgb(255, 255, 255);"><b>Alexandre Ballu - 0604181562</b><br><br></span></p><ul><li>Aller récupérer les clés de la piscine au QG orga<br></li><li>Aller ouvrir la Piscine et les vestiaires, retrouver Alexandre, lui demander si tout va bien<br></li><li>Vérifier que le maître nageur est bien arrivé<br></li><li>Aller rendre les clés au QG orga<br></li></ul><p></p><p></p>', NULL, 0, 'QG orga', 3, 'non'),
(118, 28, 350, NULL, 'Au revoir Waterpolo et fermer piscine', '<p><span style="background-color: rgb(255, 255, 255);"><b style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14.44444465637207px; line-height: 20px;">Alexandre Ballu - 0604181562</b><br><br></span></p><ul><li style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14.44444465637207px; line-height: 20px;">Aller récupérer les clés de la piscine au QG orga<br></li><li style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14.44444465637207px; line-height: 20px;">Aller à la piscine, voir avec Alexandre si tout s''est bien passé<br></li><li style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14.44444465637207px; line-height: 20px;">Remercier le maître nageur</li><li>Remercier les équipes, à l''année prochaine</li><li>Leur demander de bien remballer tout leur matos<br></li><li>Vérifier qu''il n''y a plus personne dans les vestiaires</li><li>Bien fermer toute la piscine et les vestiaires</li><li>Aller rendre les clés au QG orga<br><br><br><p><b>/!\\ Attention /!\\</b><br></p><p>Si une des pédales arrive avant la fin du match/ avant que tout le monde soit parti, ne pas fermer la piscine, ils en auront besoin. Aller remettre les clés au QG orga.</p></li></ul><p></p>', NULL, 0, 'Piscine INSA', 3, 'non'),
(119, 14, 347, NULL, 'Retour clés Grillon + Olivier', '<p></p><div>Attends que la maman vienne te réveiller en douceur...</div><div>Ça y est c''est l''heure du petit dej de l''ambiance !</div><div>Voilà la recette pour faire des pancakes de l''ambiance (en 1 heure c''est torché !) :</div><div>-----------</div><div><span style="color: rgb(244, 115, 33); font-weight: bold; background-color: rgb(255, 255, 255); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 19px;">Ingrédients (pour 4 personnes) :</span></div><div><p class="m_content_recette_ingredients" style="font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 19px; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);">- 250 g de farine<br>- 30 g de&nbsp;<a class="mrm_al" href="http://www.marmiton.org/Magazine/Tendances-Gourmandes_le-gout-des-sucres_1.aspx" style="color: rgb(87, 87, 87); text-decoration: none; line-height: 16px; border-bottom-width: 1px; border-bottom-style: dotted; border-bottom-color: rgb(140, 140, 140);">sucre</a><br>- 2 œufs<br>- 1 sachet de levure traditionnelle<br>- 65 g de&nbsp;<a class="mrm_al" href="http://www.marmiton.org/Magazine/Diaporamiam_pur-beurre-c-est-meilleur_1.aspx" style="color: rgb(87, 87, 87); text-decoration: none; line-height: 16px; border-bottom-width: 1px; border-bottom-style: dotted; border-bottom-color: rgb(140, 140, 140);">beurre</a><br>- 1 pincée de&nbsp;<a class="mrm_al" href="http://www.marmiton.org/Magazine/Plein-D-Epices_sel_1.aspx" style="color: rgb(87, 87, 87); text-decoration: none; line-height: 16px; border-bottom-width: 1px; border-bottom-style: dotted; border-bottom-color: rgb(140, 140, 140);">sel</a><br>- 30 cl de lait<br></p><div class="m_content_recette_todo" style="margin: 0px; padding: 20px 0px 0px; font-size: 13px; line-height: 19px; font-family: Arial, Helvetica, sans-serif; color: rgb(51, 51, 51); border-top-style: solid; border-top-width: 2px; border-top-color: rgb(242, 239, 232); background-color: rgb(255, 255, 255);"><h4 style="margin: 0px; padding: 0px; font-family: ''Trebuchet MS'', Verdana, Arial, Helvetica, sans-serif;">Préparation de la recette :</h4><br>Prévoir 1 h de repos.<br>Mettez la farine, la levure et le&nbsp;<a class="mrm_al" href="http://www.marmiton.org/Magazine/Tendances-Gourmandes_le-gout-des-sucres_1.aspx" style="color: rgb(87, 87, 87); text-decoration: none; border-bottom-width: 1px; border-bottom-style: dotted; border-bottom-color: rgb(140, 140, 140);">sucre</a>&nbsp;dans un saladier. Rajoutez ensuite les œufs entiers et mélangez.<br>Ajoutez ensuite le&nbsp;<a class="mrm_al" href="http://www.marmiton.org/Magazine/Diaporamiam_pur-beurre-c-est-meilleur_1.aspx" style="color: rgb(87, 87, 87); text-decoration: none; border-bottom-width: 1px; border-bottom-style: dotted; border-bottom-color: rgb(140, 140, 140);">beurre</a>&nbsp;que vous aurez préalablement fait fondre, puis délayez progressivement le mélange avec le lait afin d''éviter les grumeaux.<br>Laissez reposer au minimum 1h au réfrigérateur.<br>Faire cuire comme des&nbsp;<a class="mrm_al" href="http://www.marmiton.org/Recettes/Selection_chandeleur.aspx" style="color: rgb(87, 87, 87); text-decoration: none; border-bottom-width: 1px; border-bottom-style: dotted; border-bottom-color: rgb(140, 140, 140);">crêpes</a>, mais en les faisant plus petites.</div></div><div>----------</div><div>Ça y est c''est prêt à déguster !</div><div>Une fois bien rassasié tu peux commencer ta journée</div><div>Ta première mission consiste à <b><u>récupérer les clés du Grillon et de l''Olivier au QG de l''ambiance</u></b> (surtout à 6 heures de mat..)</div><div><br></div><div>Franchi la porte du QG et demande les clés à l''humain. R<b><u>end toi à la MdE retrouver Mr. Gracia, le resp Thélème.</u></b></div><div>Installe toi à table et attends qu''il t''apporte le café, un chocolat chaud et des tartines au nutella.</div><div>Si le service n''a pas été déplorable tu peux lui <b><u>rendre lui les clefs du grillon, et vérifier avec lui que tout est ok (plan de salle)</u></b></div><div><b><u>Remercie le</u></b> et retourne te coucher.</div><div><br></div><div><br></div><p></p>', NULL, 0, 'QG humains', 3, 'non'),
(120, 14, 347, NULL, 'Vérif Grillon + Olivier', '<p><u>Mission Grillon Olivier Round 2:</u></p><p>Nicolas vous attend impatiemment au grillon ! Retrouve-le, et il te fera pleins poutou poutou !&nbsp;</p><p>Ta mission si tu l''acceptes (et même si tu l''acceptes pas...) consiste à vérifier ensemble que les plans des tables sont respectés, que c''est tout propre et fermer le grillon et olivier.<br></p><p>Pour ça:&nbsp;<br></p><ul><li>Aller récupérer les clefs de l''olivier et du grillon auprès de zumains &lt;3<br></li><li>Vérifier le plan de table (qui sera dans le sac de nico)</li><li>Vérifier que toutes les portes du RdC soient fermées<br></li><li>Fermer l''olivier et le grillon<br></li><li>Fermer la porte automatique et les deux portes à coté</li><li>Sortir par le premier étage<br></li><li>Ramener les clés aux zumains<br></li></ul><p></p><p>Si tout est bon, s''en aller vers de nouvelles aventures !!</p>', NULL, 0, 'MdE', 3, 'non'),
(121, 14, 347, NULL, 'Clés Hibiscus', '<p></p><ul><li>Va au BdE</li><li>Trouve quelqu''un du bureau du BdE</li><li>Dis que tu viens pour l''état des lieux d''Hibiscus</li><li>Fait l''état des lieux</li><li>Récupère l''accès</li><li>Dis merci à la personne</li></ul><p></p>', NULL, 0, 'MdE', 3, 'non'),
(122, 14, 347, NULL, 'Clés Salle de chouille', '<div>Bonjour Alexis, c''est Nicolas du passé qui te parle, je t''ai refourgué cette tache parce que&nbsp;<strike>ça&nbsp;me faisait chier d''y aller </strike>&nbsp;j''avais autre chose prévu au même moment.</div><div>Ta mission si tu l''accepte consiste à:</div><div><br></div><div><b>P</b>rendre un balai et une balayette</div><div><b>A</b>ller au BdE avec ton super fenwick !</div><div><b>U</b>tiliser le mégaphone dans le hall pour appeler qqun du bureau du BdE</div><div><b>V</b>a lui dire que tu es la pour faire l''état des lieux</div><div><b>E</b>mmène le en bas et faire l''état des lieux</div><div><br></div><div><b>C</b>hopper les clés de la salle</div><div><b>O</b>straciser la salle avec le balais et le déo</div><div><b>N</b>icher au bocal</div><div><br></div><div>Voilà si tu lis ce texte, c''est que tu as réussi avec succès toutes les étapes de cette fiche, tu peux maintenant regarder le message personnalisé qui est caché dans le texte !</div><div><p></p></div>', 'déodorant (salle de chouille)', 0, 'Bocal', 3, 'non'),
(123, 14, 347, NULL, 'Clés Wallace et Grommit', '<p></p><ul><li>Aller voir quelqu''un du bureau du BdE</li><li>Faire l''état des lieux de Wallace et Gromit</li><li>Récupérer les clés</li><li>Retourner faire la cuisine avec le troll :)</li></ul><p></p>', NULL, 0, 'MdE', 3, 'non'),
(124, 14, 347, NULL, 'Clés Insatiable', '<p></p>À vos marques ! prêt ! partez !<br>Tu as quinze minutes pour :<br><ul><li>Prendre des lunettes de soleil pour avoir la classe !<br></li><li>Aller au local de l''Insatiable</li><li>Retrouver Roman ou une autre personne de l''insatiable (si il est pas là : Roman au 06 16 90 32 68 se fera un plaisir de répondre à toutes vos questions)<br></li><li>Faire un état des lieux</li><li>Récupère les clés</li><li>Dis merci !<br></li><li>Va voir les zumains de l''ambiance, donne leur la clé et va manger du pâté au bocal<br></li></ul>', NULL, 0, 'Insatiable', 3, 'non'),
(125, 14, 347, NULL, 'Retour clés Graines d''Images', '<div>C''est ton père qui te parle ! (c''est moi la papa !)</div><p></p>Au bocal pour <b><u>prendre le clés de GI</u></b>, tu te rendras !<div>Du monde dans le <b><u>local de Graines d''Images</u></b>, tu retrouveras !</div><div>Huges au 06 28 94 83 71, tu appelleras !</div><div>Les <b><u>clés tu les rendras</u></b> !</div><div>Au local tu te retrouveras !</div><div><br><p></p></div>', NULL, 0, 'Bocal', 3, 'non'),
(126, 14, 347, NULL, 'Retour clés Wallace et Gromit', '<p></p><ul><li>Récupérer les clés de Wallace et Gromit auprès du troll</li><li>Faire l''état des lieux des 2 salles</li><li>Rendre les clés</li><li>Dire merci au BdE</li></ul><p></p>', NULL, 0, 'MdE', 3, 'non'),
(127, 12, 346, NULL, 'Flyage Bellecour', '<p>Viens au local (de l''ambiance) &nbsp;récupérer ton co-flyage, une grosse pile de flyers (environ 200 chacun) et une dose de charisme. Tu peux prendre ton onesie !</p><div>Dirige-toi vers l''arrêt de tram.&nbsp;</div><div>Prends le tram puis le métro jusqu''à Bellecour</div><div>Flye jusqu''à ce que tu n''aies plus de flyers.&nbsp;</div><div>Reviens au local avec le sentiment d''avoir participé au non-déficit des 24h.&nbsp;</div><div><br></div><div>I believe I can flye !&nbsp;<span style="background-color: rgb(249, 249, 249); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 21px;">♫</span></div>', NULL, 0, 'Local', 3, 'non'),
(128, 14, 347, NULL, 'Retour clés Hibiscus', '<p></p><ul><li>Récupérer les clés d''Hibiscus auprès du troll</li><li>Nettoyer la salle</li><li>Faire l''état des lieux de la salle</li><li>Rendre les clés</li><li>Rentrer</li></ul><p></p>', NULL, 0, 'MdE', 3, 'non'),
(129, 14, 347, NULL, 'Retour clés Salle de chouille', '<p><b>Va voir</b> les zumains d''amour<b> au local</b> et demande leur<b> les clés de la salle de chouille</b></p><p><b>Prends ton vélo</b>, ta trottinette, ton poney ou ton pousse-pousse et <b>va au BdE</b></p><p>Utilise le mégaphone (de l''ambiance)&nbsp;dans le hall pour<b> trouver qqun du bureau</b>&nbsp;et emmène le<b> faire l''état des lieux</b>, <b>donne lui la clé</b>, et&nbsp;<b>dis merci</b>&nbsp;puis rentre au local voir s''il reste du pâté de la manif.</p><p></p>', NULL, 0, 'Bocal', 3, 'non'),
(130, 14, 347, NULL, 'Retour clés Insatiable', '<p></p>Alors, va au bocal, et <b>prend les clés de l''insatiable</b> qui seront jalousement gardées par les zumains (qui seront peut-être plus trop de l''ambiance à ce moment là) (si si, on sera de l''ambiance !!). Puis <b>prends ton plus beau vélo</b> (qui n''existera surement plus à l''heure où j’écris ses lignes car tu te l''auras fait voler sur les 24..) et <b>va au local de l''insatiable</b><br><br><ul><li><b>Retrouve une personne</b> de l''insatiable (tel Roman 06 16 90 32 68)</li><li><b>Fais l''état des lieux</b></li><li><b>Dis merci</b></li><li><b>Rend les clés</b></li></ul><p><b>Rentre au local</b> (ça y est tu as perdu 15 minutes de ta vie !)<br></p><p></p>', NULL, 0, 'Bocal', 3, 'non'),
(131, 28, 351, NULL, 'Installer le matos pour le Mur d''escalade', '<p></p><div><b>---------------Le samedi matin-----------------------</b></div><ul><li>Se rendre au dépôt barrière situé sur le parking en face du grillon&nbsp;</li><li>Récupérer 20 barrières au dépôt barrière juste à côté et les poser au niveau de l''anim, derrière la rotonde</li><li>Aller chercher &nbsp;au dépôt Humas et les déposer à côté de l''anim:</li></ul>1 tente 6x3 (au dépôt AIP)<br><span style="line-height: 20px;">2 Table 2 places</span><br><span style="line-height: 20px;">4 Chaises</span><br><span style="line-height: 20px;">3 Bancs&nbsp;</span><div><span style="line-height: 20px;"><br></span></div><div><b>---------------Le dimanche matin-----------------------</b></div><div><b><br></b></div><div><ul><li>Se rendre au dépôt Humas et prendre le matos pour le déposer à côté de l''anim derrière la rotonde:</li></ul>1 tente 6x3 (au dépôt AIP)<br><span style="line-height: 20px;">2 Table 2 places</span><br><span style="line-height: 20px;">4 Chaises</span><br><span style="line-height: 20px;">3 Bancs&nbsp;</span><b><br></b><div><span style="line-height: 20px;"><br></span></div><div>Si tu t''es perdu, appelle le resp&nbsp;<b>Guerric&nbsp;</b>au&nbsp;<b>0604476430</b></div><p></p></div>', NULL, 0, 'Pelouse Rotonde', 3, 'non'),
(132, 12, 346, NULL, 'Flyage Confluence', '<p>Viens au local (de l''ambiance) &nbsp;récupérer ton co-flyage, une grosse pile de flyers (environ 200 chacun) et une dose de charisme. Tu peux prendre ton onesie !</p><div>Dirige-toi vers l''arrêt de tram.&nbsp;</div><div>Prends le tram jusqu''à Confluence.</div><div>Flye jusqu''à ce que tu n''aies plus de flyers.&nbsp;</div><div>Reviens au local avec le sentiment d''avoir participé au non-déficit des 24h.&nbsp;</div><div><br></div><div>I believe I can flye !&nbsp;<span style="background-color: rgb(249, 249, 249); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 21px;">♫</span></div>', NULL, 0, 'Local', 3, 'non'),
(133, 28, 351, NULL, 'Accueillir le mur d''escalade', '<ul><li>Accueillir le mec d''attractions 2000</li><li>Installer le mur avec lui</li><li>Voir avec le presta pour les premières consignes de sécurité</li></ul><p><b>---------------------<br>Pour Guerric,&nbsp;</b><b style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">Attractions 2000 - 0609410756<br>Un rouleau de rubalise</b></p>', NULL, 0, 'Pelouse Rotonde', 3, 'raf'),
(134, 28, 351, NULL, 'Ranger le matériel pour le mur d''escalade', '<p></p><div><br style="line-height: 20px;"><b><span style="line-height: 20px;">---------------Le samedi Soir------------------</span><br></b></div><ul><li>Se rendre à l''animation mur d''escalade situé à côté de la Rotonde</li><li>Fermer avec des barrières, la remorque du mur d''escalade</li><li>Ramener au dépôt Humas tous le matos qui est sur l''anim:</li></ul><span style="line-height: 20px;">2 Table 2 places</span><br><span style="line-height: 20px;">4 Chaises</span><br><span style="line-height: 20px;">3 Bancs&nbsp;</span><div><span style="line-height: 20px;"><br></span></div><div><span style="line-height: 20px;">Ranger la tente au dépôt AIP<br><br><b>---------------Le dimanche Soir------------------</b><br></span><div><span style="line-height: 20px;"><br></span></div><div><ul><li>Se rendre à l''animation mur d''escalade situé à côté de la Rotonde</li><li>Ramener les barrières au dépot en face du grillon</li><li>Ramener au dépôt Humas tous le matos qui est sur l''anim:</li></ul><span style="line-height: 20px;">2 Table 2 places</span><br><span style="line-height: 20px;">4 Chaises</span><br><span style="line-height: 20px;">3 Bancs&nbsp;</span></div><div><span style="line-height: 20px;"><br></span></div><div><span style="line-height: 20px;">Ranger la tente au dépôt AIP<br></span><div><span style="line-height: 20px;"><br></span></div><div>Si tu t''es perdu, appelle le resp&nbsp;<b>Guerric&nbsp;</b>au&nbsp;<b>0604476430</b></div> </div><p></p></div>', NULL, 0, 'Pelouse Rotonde', 3, 'non'),
(135, 28, 351, NULL, 'Accueillir BE M''ROC', '<p></p><ul><li>Pose toi sur le mur d''escalade et attends le BE de M''Roc<br></li><li>Aide le à poser son matos, à s''installer<br></li><li>Vérifie que tout va bien et souhaite lui bonne journée<br><br>Lui donner le num du PC sécu : 0472437070</li></ul><p></p>', NULL, 0, 'Pelouse Rotonde', 3, 'non'),
(136, 40, 352, NULL, 'Pignole Power!', '<p>Pendant les&nbsp;<b>24 Heures de l''INSA</b>, il ne se passe pas grand chose. Du coup, on attend que ça se passe en se pignolant de manière moins ostentatoire que l''équipe concerts ou que la sécu...</p>', 'Beaucoup de bonne humeur et de charisme!\r\nAh et des gros bibis aussi :)', 0, 'GCU', 3, 'non'),
(137, 40, 352, NULL, 'Aller acheter de la semoule', '<p>Même s''il est fortement déconseillé de manger du couscous pendant cette semaine où le pâté est roi, on va faire un tour en ville pour acheter de la semoule! Il n''y a pas de raison qu''on ne se gave pas!<br></p><p>Prévenir ma shab&nbsp;<b>Soraya</b>&nbsp;une&nbsp;demi-heure avant d''arriver :&nbsp;04 72 83 86 30</p>', NULL, 1, 'GCU', 2, 'non'),
(138, 40, 352, NULL, 'Ramener la couscoussière à ma shab!', '<p>Se rendre à Saint-Genis-Laval pour restituer les couscoussières , à priori on en aura eu pour notre compte !<br></p><p>Attention, elle en a besoin pour 8h45 précises (sous peine de se faire fister avec du gravier)! Cimer la copine!</p>', 'De la bonne humeur!', 0, 'GCU', 3, 'non'),
(139, 21, 335, NULL, 'Réception de matériel', '<p></p><ul><li>Vas au&nbsp;dépôt&nbsp;AIP, batiment GMC derrière la bibliothèque Marie Curie (c''est marqué AIP en gros au dessus de la porte). Ca risque d''être barrièré mais cherche bien. Si tu ne trouves pas où c''est, regarde sur le plan. :)<br></li><li>Attends l''arrivée de Cetelem qui vas te briefer. S''il n''arrive pas, appelle le (numéro plus bas)</li><li>Ne pars surtout pas de ton poste même si tu ne fais rien, le boulot arrive.</li><li>Ton poste : Aider à décharger les 20m3 qui arrivent et ranger correctement le dépôt.</li><li>Attends l''arrivée d''un 20m3 (Cetelem devrait être dedans)</li><li>demande un marqueur et un rouleau de scotch marron à Cetelem</li><li>Aide à décharger le matos</li><li>Essaie de ranger au mieux le matos</li><li>Marque sur chaque matos AIP avec un bout de scotch et le marqueur</li><li>Vérifie que le matos est bien scotché de la bonne couleur (voir avec Cetelem)</li><li>Attends que Cetelem revienne, s''il y a encore du matos, aide le à décharger à nouveau</li><li>Quand le créneau est fini, appelle Cetelem&nbsp;</li><li>Ne pars pas si le dépôt n''est pas fermé !</li></ul><div>Appeler Cetelem en cas de soucis ou s''il n''arrive pas : 06 80 52 08 62</div><p></p>', NULL, 0, 'Dépôt AIP', 3, 'non'),
(140, 40, 352, NULL, 'Aller remercier ma shab!', '<p>Maintenant qu''on a passé un bon week-end à se goinfrer de couscous, il est grand temps d''aller remercier ma grande copine!</p><p>Attention, elle ne sera dispo qu''à 8h45! (oui je sais elle fait tout à cette heure-là!)</p>', NULL, 1, 'GCU', 3, 'non'),
(141, 40, 352, NULL, 'Aller au cocktail de presse', '<p></p><div>Arrête la pignole où que tu sois!<br></div><div><br></div><div>Rends toi présentable (pas de boue si possible) et diminue le volume de ton talkie .</div><div><br></div><div>Dirige toi vers la MdE où se déroule le cocktail de presse, même si c''est vraiment au dessus de tes forces.</div><div><br></div><div>Une fois arrivé(e), paye ton charisme (ou tes seins ça marche aussi).</div><div><br></div><div>Fais la bise à Eric parce que c''est vraiment ton meilleur pote depuis qu''il a vu comment les courses ça allait être la folie.</div><div><br></div><div>Fais la bise à Carole parce que c''est ta meilleure pote depuis qu''elle veut le corps de Clemziz.</div><div><br></div><div>Serre les pinces des autres dans le doute même si tu les connais pas.&nbsp;</div><div><br></div><div>Rappelle à Bastien que c''est nous les kings sur notre manif et qu''il n''est qu''un soft moins.</div><div><br></div><div>Déguste les petits plats du troll parce que ça fait zizir!</div><div><br></div><div>Attends le départ de la course.</div><div><br></div><div>Une fois que la course est lancée, retourne vaquer à tes occupations avec toujours autant de charisme.</div><div><br></div><p></p>', 'Beaucoup de charisme et de bonne humeur :)\r\nEt la super bouffe du Troll ! <3', 0, 'MdE', 3, 'non'),
(142, 21, 335, NULL, 'Fermeture dépôt AIP', '<p></p><ul><li>Rendez-vous au dépôt AIP<br></li><li>Trouve ceux qui sont à ton poste avant et prend la relève (ils ont un T-shirt orange et un talkie !)</li><li>Récupère le talkie</li><li>Tu dois être placé à coté de l''entrée de la zone orga (extérieur du dépôt)</li><li>Ton rôle : Ne laisser passer que les orgas (T-shirt + bracelet) dans le dépôt. En cas de problème, préviens la sécu au talkie. ("dépôt AIP pour sécu")</li><li>Si tu te pignole sévère, tu peux ranger le dépôt.</li><li><b>Ne pas partir tant que personne n''est venu fermer le dépôt</b></li><li>Si personne ne vient fermer le dépôt, prévenir Cetelem</li><li>Donne ton talkie à l''orga qui vient fermer le dépôt (fait gaffe à qui tu donnes le talkie quand même ..)</li></ul>En cas de problème, appelle Cetelem au 06 80 52 08 62 ou au talkie<div><br></div><div>Si le talkie fait bip bip c''est qu''il a plus de batterie, faut prévenir le QG pour que la maman te ramène une nouvelle batterie :) !</div><p></p>', NULL, 0, 'Dépôt AIP', 3, 'non'),
(143, 21, 335, NULL, 'Surveiller le matos AIP', '<p></p><ul><li>Rendez-vous au dépôt AIP<br></li><li>Trouve ceux qui sont à ton poste avant et prend la relève (ils ont un T-shirt orange et un talkie !)</li><li>Récupère le talkie</li><li>Ton rôle : vérifier que personne d''autre que des orgas ne prenne le matos</li><li>S''il n''y a pas de matos et/ou pas d''orgas, appelle Cetelem (06 80 52 08 62) il te dira quoi faire</li><li>Si tu te pignole sévère, tu peux ranger/laver le dépôt, manger du saucisson ou taper la discute aux gens qui passent</li></ul><p></p>', 'De la patience, moult batterie sur ton portable', 0, 'Dépôt AIP', 3, 'non');
INSERT INTO `Tache` (`id`, `responsable_id`, `groupetache_id`, `importid`, `nom`, `consignes`, `materielSupplementaire`, `permisNecessaire`, `lieu`, `statut`, `commentaireLog`) VALUES
(144, 21, 335, NULL, 'Gardiennage dépôt humas', '<p></p><ul><li>Rendez-vous au dépôt humas (voir plan)<br></li><li>Trouve ceux qui sont à ton poste avant et prend la relève (ils ont un T-shirt orange et un talkie !)</li><li>Récupère le talkie</li><li>Ton rôle : Ne laisser passer que les orgas (T-shirt + bracelet) dans les humas. En cas de problème, préviens la sécu au talkie. ("dépôt humas pour sécu").</li><li><b>Aucun festivalier ne doit entrer dans le bâtiment des humas !<br></b></li><li>Si tu te pignoles sévère, tu peux ranger le dépôt, manger du saucisson ou chanter patrick sebastien au talkie de l''ambiance</li></ul><div>Si le talkie fait bip bip c''est qu''il a plus de batterie, faut prévenir le QG pour que la maman t''amène une nouvelle batterie !</div><div><br></div><div>En cas de problème, appelle Cetelem au 06 80 52 08 62 ou au talkie<div><br></div></div><div><b>Si la relève n''arrive pas ne surtout pas quitter son poste et demander l''humain au talkie :)</b></div><div><b><br></b></div><div><b>Pour t''occuper tu peux aussi chanter Hey Ho de Tragédie, voici les paroles :&nbsp;</b></div><div><i><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">Ho ho ho ho ho</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">Ho ho ho ho ho</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">Ho ho ho ho</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">