en bas de chez toi je t''appelle et tu n''réponds pas</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">Je sais que t''es là, mais tu n''entends pas</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">Qu''en bas de chez toi je t''appelle</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">Est-ce que tu m''entends?</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">Est-ce que tu me sens?</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">Un geste suffira s''il te plait réponds-moi</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">Est-ce que tu m''aperçois?</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">Car en bas de chez toi je fais les cents pas</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">Est-ce que tu me vois?</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">Dis-le moi (ahhhhhhhhh)</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">[Refrain:]</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">La seule chose que j''attends,</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">C''est juste que tu descendes</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">Trop longtemps que j''attends</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">J''commence à perdre patience</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">J''ai appris que tu aimais ça</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">Faire languir tous les mecs comme moi</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">Et celui qui s''acharnera</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">Ce sera lui que tu choisiras</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">[Refrain:]</span><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><br style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);"><span style="font-family: Verdana, Geneva; font-size: 12px; line-height: 18px; background-color: rgb(234, 255, 255);">Ho ho ho ho ho ho ho</span></i><b><br></b></div><p></p>', NULL, 0, 'Dépôt AIP', 3, 'non'),
(145, 21, 335, NULL, 'Fermeture dépôt Humas', '<p></p><ul><li>Rendez-vous au dépôt Humas<br></li><li>Trouve ceux qui sont à ton poste avant et prend la relève (ils ont un T-shirt orange et un talkie !)</li><li>Récupère le talkie</li><li>Ton rôle : Ne laisser passer que les orgas (T-shirt + bracelet) dans les humas. En cas de problème, préviens la sécu au talkie. ("dépôt humas pour sécu").</li><li><b>Aucun festivalier ne doit entrer dans le bâtiment des humas</b></li><li>Si tu te pignole sévère, tu peux ranger le dépôt, manger du saucisson ou chanter patrick sebastien au talkie de l''ambiance</li><li><b>Ne pas partir tant que personne n''est venu fermer le dépôt</b></li><li>Si personne ne vient fermer le dépôt, prévenir Cetelem</li><li>Donner le talkie à l''orga qui vient fermer le dépôt (fait gaffe à qui tu le donnes quand même ..)</li></ul>En cas de problème, appelle Cetelem au 06 80 52 08 62 ou au talkie<div><br></div><div>Si le talkie fait bip bip c''est qu''il a plus de batterie, faut prévenir le QG pour que la maman te ramène une nouvelle batterie :) !</div><p></p>', NULL, 0, 'Dépôt Humas', 3, 'non'),
(146, 21, 335, NULL, 'Vider le dépôt Humas', '<p></p><ul><li>Rendez-vous QG orga<br></li><li>Trouver Cetelem et Brandon (le 20m3)<br></li><li>Récupérer la clef du dépôt Humas<br></li><li>Garer le 20m3 derrière le QG orga<br></li><li>Ouvrir le dépôt Humas<br></li><li>Charge tout le matos dans le 20m3 (sauf les grilles d''exposition)<br></li><li>Fermer le dépôt Humas<br></li><li>Aller au dépôt AIP, décharger tout le matos<br></li><li>Charger les grilles d''exposition, les emmener au dépôt humas<br></li><li>Fermer le dépôt Humas et rendre les clefs du 20m3 et du dépôt aux humains.<br></li></ul><p></p>', NULL, 0, 'QG Orga', 3, 'non'),
(147, 197, 353, NULL, 'Aller accueillir CInébus', '<p>Attendre les 2 personnes de Cinébus au niveau de l''entrée principale de l''INSA.<br>Leur dire bonjour !<br>Leur montrer l''emplacement de la camionnette et de l''écran : c''est à côté de la piscine de l''INSA, sur la pelouse !</p>', NULL, 0, 'Entrée principale de l''INSA', 3, 'non'),
(148, 197, 353, NULL, 'Installation cinéma', '<p>Appelle Nicolas au 0632033374 pour qu''il vienne brancher l''installation électrique pour Cinébus.&nbsp;</p><div>Retrouve Nicolas et Cinébus à l''emplacement du cinéma plein air, c''est à dire à côté de la piscine de l''INSA.&nbsp;</div><p>La projection se fait sur écran gonflable lesté par des ballasts d’eau pour la stabilité. Montre à Cinébus l''arrivée d''eau, elle devrait être à moins de 5m de l''emplacement (il s''agit de deux tuyaux d''arrosage arrivant de deux points d''eau différents). Si tu ne la trouves pas, rappelle Nicolas au 0632033374. Si Cinébus râle, dis-leur qu''on n''a pas accès aux bouches incendies, et qu''ils avaient accepté ce compromis il y a deux ans !</p><p>Assure toi que les 2 personnes de Cinébus auront de quoi manger (normalement ils ont deux tickets bouffe).<br></p><p>Aider les personnes de Cinébus à monter l''écran.</p>', NULL, 0, 'A coté de la piscine INSA', 3, 'non'),
(149, 197, 353, NULL, 'Projection du court métrage', '<p>Appelle la Mouette (<span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">06.98.92.44.13 Cédric Boscher</span>) pour leur dire de venir sur le lieu de la projection pour qu''ils préparent le court métrage.</p><p>Le lieu de la projection est à côté de la piscine de l''INSA, sur la pelouse (normalement il y a déjà des barrières etc).</p><p>Vérifier que la personne en charge des courts métrages (<span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">Cédric BOSCHER</span>&nbsp;de la Mouette) lance la projection du/des court(s) métrage(s) à l''aide <b>de leur propre ordinateur portable</b> (dôté d''un HDMI) et du vidéo projecteur numérique de Cinébus, avec leur aide, à 21h40.</p><div><br></div>', NULL, 0, 'A coté de la piscine INSA', 2, 'non'),
(150, 197, 353, NULL, 'Projection du film', '<p></p><ul><li>Rends toi près de la piscine INSA, à l''emplacement du cinéma plein air.</li><li>Assure toi que les personnes du Cinébus lancent bien le film à 23h</li><li>Aide-les en cas de soucis</li></ul><p></p>', NULL, 0, 'A coté de la piscine INSA', 3, 'non'),
(151, 197, 353, NULL, 'Gérer les embrouilles', '<p>Naviguer entre les bars et la camionnette de Cinébus pour s''assurer que tout va bien.</p>\r\n<div>Si il y a des problèmes, essayer de les gérer ou chercher un responsable.</div>\r\n<div><br></div>\r\n<div>Appelle Tiffany au 0699769011 s''il y a un soucis !!!</div>', NULL, 0, 'A coté de la piscine INSA', 3, 'non'),
(152, 21, 335, NULL, 'Ouverture dépôt Humas', '<p></p><ul><li>Rendez-vous au QG orga<br></li><li>Attrape les clés du dépôt humas et un talkie vers les humains<br></li><li>Va ouvrir le dépôt humas (déverrouille les 2 côtés du hall des humas)<br></li><li>Attend l''orga qui est censé faire du gardiennage ici<br></li><li>Donne-lui le talkie.</li><li>Ne pars pas tant qu''il n''est pas arrivé !<br></li><li>Rend la clef du dépôt aux humains<br></li></ul><p></p><p></p>', NULL, 0, 'QG Orga', 3, 'non'),
(153, 21, 335, NULL, 'Ouverture dépôt AIP', '<p></p><ul><li>Rendez-vous au QG orga<br></li><li>Demande les clés du dépôt AIP et un talkie aux humains de l''ambiance<br></li><li>Va ouvrir le dépôt AIP (ouvre la porte du bâtiment GMC avec écrit "AIP" dessus)<br></li><li>Attend l''orga qui est censé faire du gardiennage ici<br></li><li>Donne-lui le talkie</li><li>Ne pars pas tant qu''il n''est pas arrivé !<br></li><li>Rend la clef du dépôt aux humains de l''ambiance ! &lt;3</li><li>Fais des gros bibis aux humains.</li></ul><p></p>', NULL, 0, 'QG Orga', 3, 'non'),
(154, 21, 335, NULL, 'Filtrer l''entrée du dépôt AIP', '<p></p><ul><li>Rendez-vous au dépôt AIP<br></li><li>Si c''est fermé, ne pars pas, quelqu''un arrive ! (si c''est toujours fermé à 8h15 appelle Cetelem : 06 80 52 08 62)</li><li>Trouve l''orga qui a ouvert le dépôt AIP&nbsp;</li><li>Récupère le talkie qu''il a amené</li><li>Tu dois être placé à coté de l''entrée de la zone orga (à l''extérieur du dépôt)</li><li>Ton rôle : Ne laisser passer que les orgas (T-shirt + bracelet) dans le dépôt. En cas de problème, préviens la sécu au talkie. ("dépôt AIP pour sécu")</li><li>Si tu te pignoles sévère, tu peux ranger le dépôt.</li><li>Attendre que la relève arrive</li></ul><div>Si le talkie fait bip bip c''est qu''il a plus de batterie, faut prévenir le QG pour que la maman t''amène une nouvelle batterie !</div><div><br></div><div>En cas de problème, appelle Cetelem ou au talkie ("dépôt AIP pour Cetelem" ou "dépôt AIP pour QG")</div><div><b>Si la relève n''arrive pas ne surtout pas quitter son poste et demander l''humain au talkie :)</b></div><p></p>', NULL, 0, 'Dépôt AIP', 3, 'raf'),
(155, 21, 335, NULL, 'Filtrer l''entrée du dépôt Humas', '<p></p><ul><li>Rendez-vous au dépôt Humas<br></li><li>Si le bâtiment des humas est fermé, attend l''orga qui vient l''ouvrir (si à 8h15 ce n''es tpas ouvert, appelle Alexis 06 80 52 08 62)</li><li>Récupère le talkie amené par l''orga qui a ouvert le dépôt</li><li>Ton rôle : Ne laisser passer que les orgas (T-shirt + bracelet) dans les humas. En cas de problème, préviens la sécu au talkie. ("dépôt humas pour sécu").</li><li><b>Aucun festivalier ne doit entrer dans le bâtiment des humas</b></li><li>Si tu te pignole sévère, tu peux ranger le dépôt, manger du saucisson ou chanter patrick sebastien au talkie de l''ambiance</li><li>Ne pars pas tant que tu n''as pas eut de relève !</li></ul><br>Si le talkie fait bip bip c''est qu''il a plus de batterie, faut prévenir le QG pour que la maman t''amène une nouvelle batterie !<div><br>En cas de problème, appelle Cetelem au 06 80 52 08 62 ou au talkie<br><br><b>Si la relève n''arrive pas ne surtout pas quitter son poste et demander l''humain au talkie :)</b><br><div><br></div> </div><p></p>', NULL, 0, 'Dépôt Humas', 3, 'raf'),
(156, 21, 335, NULL, 'Fermer le dépôt Humas', '<p></p><ul><li>RDV au QG orga<br></li><li>Demander la clef des dépôts humas et AIP aux humains<br></li><li>Retrouver les 2 orgas en poste dans le hall des humas<br></li><li>Fermer le hall des humas des 2 côtés<br></li><li>Récupérer le talkie aux orgas<br></li><li>Retrouver les 2 orgas en poste devant le dépôt AIP<br></li><li>Fermer le hall<br></li><li>Récupérer le talkie aux orgas</li><li>Rendre les talkies et les clefs aux humains<br></li></ul><p></p>', NULL, 0, 'Dépôt AIP', 3, 'non'),
(157, 21, 354, NULL, 'Trier le matériel', '<p>RDV au local des 24 Heures</p><div><ul><li>Trouve Cetelem<br></li><li>Demande lui les listes de matériel des différents dépôts (AIP, Humas, QG orga, Courses)<br></li><li>Prendre ton courage à deux mains<br></li><li>Faire de la place dans le local (virer toute la merde dans la grande salle)<br></li><li>Trier le matos en 4 gros tas<br></li><li>Suis les consignes de Cetelem pour le rangement :)</li></ul><br></div><div>@La team cockail de presse : Allez voir cetelem et lui dire ce qu''il y a dans le kit histoire des 24. Posez ce matériel la dans le tas "humas". Bibis !</div><div>&nbsp;</div><div><br></div><p></p>', NULL, 0, 'Local des 24H', 3, 'non'),
(158, 21, 354, NULL, 'Rangement du local', '<p>RDV au QG orga</p><div>Demander la clef du local des 24 Heures aux humains</div><div>Prendre son courage à 2 mains</div><div>Aller au local des 24</div><div>Ranger au mieux le local pour préparer l''arrivée du matos le lendemain.</div><div><br></div><div>En gros il faut essayer de vider la grande salle et la salle OP.</div><div>Je paie mon champagne si je reçois une photo du local rangé aussi bien le dimanche soir &lt;3</div><div><br></div><div>Bibis !</div><div><br></div><div><div><br></div></div><p></p>', NULL, 0, 'QG Orga', 3, 'non'),
(159, 197, 355, NULL, 'Accueil Gospel', '<p>Va chercher les clés de René Char au QG orga</p>\r\n<p>Va dans la salle René Char (Rotonde)</p>\r\n<p>Appelle Gospel COLORS (A<b style="LINE-HEIGHT: 20px; BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: ''Helvetica Neue'', Helvetica, Arial, sans-serif; COLOR: rgb(51,51,51); FONT-SIZE: 14px">ndomalala Ratovelomanana - 0624997929) </b><span style="LINE-HEIGHT: 20px; BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: ''Helvetica Neue'', Helvetica, Arial, sans-serif; COLOR: rgb(51,51,51); FONT-SIZE: 14px">s''il ne sont pas déjà là, retrouve-les et amène-les en René Char (n''oublie pas de bien fermer la salle si tu dois aller les chercher).</span></p>\r\n<p>Aide le Gospel à installer leur matériel (aka rien).<br></p><p>Ramène les clés au QG orga</p>', NULL, 0, 'QG orga', 3, 'non'),
(160, 197, 355, NULL, 'Fermer René Char', '<p>Va chercher les clés de René Char au QG Orga.</p>\r\n<p>Rend toi en René Char (c''est à la Rotonde)</p>\r\n<p>Remercie le groupe Gospel Colors !</p>\r\n<p>Une fois que tout est fini et qu''ils sont partis, referme René Char et va rendre des clés au QG orga</p>\r\n<p><br></p>', NULL, 0, 'QG Orga', 3, 'non'),
(161, 197, 355, NULL, 'Gérer le concert Gospel', '<p></p><ul><li>Rend toi à la Rotonde</li><li>Présente toi à Gospel Colors</li><li>Dis leur que tu es là pour être prêt à intervenir en cas de problème quelconque, il ne faut pas que quiconque perturbe le concert !&nbsp;</li><li>Demande leur aussi si tu peux donner un coup de main.</li><li>En cas d''embrouille, contacte Tiffany 06 99 76 90 11<br></li><li>Profite du concert !</li></ul><p></p><p><br></p>', NULL, 0, 'Salle René Char - Rotonde', 3, 'non'),
(162, 197, 356, NULL, 'Ouverture salle de chouille !', '<p>Récupère les clés de la salle de chouille au QG orga.</p>\r\n<p>La salle de chouille se trouve derrière la k-fêt, il faut prendre l''escalier louche qui descend.</p>\r\n<p>Vérifie qu''il y a bien 4 table et deux chaises (appelle Tiffany au 0699769011 si il y a un problème)</p>\r\n<p>Retrouve les personnes de Graine d''Images devant la salle de chouille (Appelle le 0628948371)</p>\r\n<p>Leur ouvrir la salle.</p>\r\n<p>Assure toi qu''ils ont tout le matériel nécessaire à leur installation, qu''il n''y a pas de&nbsp;dégâts&nbsp;dans la salle, que ça sent bon... ouvrir les fenêtres&nbsp;si besoin (va voler un Febreze dans les toilettes sinon...).</p>\r\n<p>Ramène les clés de la salle de chouille au QG orga.</p>', NULL, 0, 'Salle de séminaire aka salle de chouille S.S. MDE', 3, 'non'),
(163, 197, 356, NULL, 'Nettoyage et installation de la salle de chouille', '<p></p>\r\n<ol>\r\n<li>Retrouver tes co-taches au local des 24h (rdc bat. D)</li>\r\n<li>Prendre les clés de la salle de chouille et celles de la cave au local<br></li>\r\n<li>Prendre le matos&nbsp;nécessaire&nbsp;au nettoyage de la salle au local (rappelle toi où tu as tout pris, faut que tu remettes au même endroit au retour), c''est à dire : balai, balai brosse, seau, serpillère, produit, pelle &amp; balayette, torchon, éponge.</li>\r\n<li>Prendre aussi pas mal de bouts de carton,des lampes de poche et du scotch marron au local</li>\r\n<li>Aller à la salle de chouille (c''est derrière la k fêt, l''escalier louche qui descend)</li>\r\n<li>Ouvrir et entrer</li>\r\n<li>Ouvrir les fenêtres (dégager les odeurs...)</li>\r\n<li><b><u>Dégager tout le bordel (pas à nous) stocké à l''intérieur (dans les coins, les toilettes, l''escalier au fond)</u></b></li>\r\n<li>Nettoyer : passer un coup de balai, ramasser&nbsp;avec&nbsp;la pelle, remplir un seau d''eau, passer un coup de balai brosse avec&nbsp;serpillère&nbsp;mouillée... &nbsp;bref, tout ce que tu sais si bien faire&nbsp;</li>\r\n<li>Pendant que certains nettoient, il faut que deux personnes aillent à la cave récupérer des bouts de moquette sombre, et les ramènent à la salle de chouille (il en faut assez pour pouvoir faire un rectangle de moquette dans la salle de chouille, etc. Il y aura marqué "Light Painting" dessus). N''oubliez pas de refermer la porte de la cave à clé en revenant.</li>\r\n<li>Bien isoler toutes les fenêtres avec du noir (moquette, carton : il ne faut pas que la lumière du jour puisse rentrer)</li>\r\n<li>Mettre de la moquette sur le sol (la scotcher)</li>\r\n<li>Prévoir un bout de moquette pour cacher le signe "issue de secours"&nbsp;</li>\r\n<li>Sortir</li>\r\n<li><b><u>Nettoyer les escaliers qui permettent l''accès à la salle de chouille c''est dégueu</u></b>&nbsp;</li>\r\n<li>Fermer salle à clé</li>\r\n<li>Rendre clé au local et ranger le matos au bon endroit.</li></ol>\r\n<p></p>', 'Carton, moquette sombre, drap sombre, Febreze', 0, 'Local des 24h', 3, 'non'),
(164, 197, 356, NULL, 'Daijoubu desuka ? Everything''s alright ?', '<p>Rentrer dans la salle de chouille (derrière la k fet, c''est l''escalier louche qui descend) !</p><div>Demander aux orga présents et au photographe si tout va bien, s''il n''ont besoin de rien !</div><div><br></div><div>Sortir de la salle de chouille !</div>', NULL, 0, 'Salle de séminaire aka salle de chouille S.S. MDE', 3, 'non'),
(165, 197, 356, NULL, 'Fermeture de la salle de chouille', '<p>Prendre les clé de la salle de chouille au QG orga</p><div>Aller à la salle de chouille (c''est derrière la k fet, c''est l''escalier louche qui descend)</div><div><br></div><div>Rejoindre le photographe et s''assurer qu''il reprenne bien son matos perso, qu''il n''y a personne dans la salle</div><div><br></div><div>Fermer la salle</div><div><br></div><div>Rendre les clé de la salle de chouille au QG orga</div><div><br></div>', NULL, 0, 'Salle de séminaire aka salle de chouille S.S. MDE', 3, 'non'),
(166, 197, 356, NULL, 'Rangement salle de chouille', '<p>Prendre les clé de la salle chouille au local des 24h, situé au pied du bâtiment D. N''oublie pas de prendre éponges, seau d''eau, serpillère, produit, balai et pelle, et aussi toute ta bonne humeur pour nettoyer.</p><div>Va à la salle de chouille (située derrière la k fet, c''est l''escalier louche qui descend)</div><div><br></div><div>Enlève toute la moquette et les cartons et jette les dans une benne, décroche les draps et plie les, laisse les dans un coin de la salle de chouille.</div><div><br></div><div>Nettoie la salle de chouille (coup d''éponge sur les tables, passer le balai et la serpillère, aérer la pièce...) N''oublie pas de nettoyer aussi l''escalier !</div><div><br></div><div>Femer la salle à clé (bien refermer les fenêtres)</div><div><br></div><div><br></div><div>Rendre les clés et le matériel de nettoyage au local</div>', NULL, 0, 'Local 24h', 3, 'non'),
(167, 197, 356, NULL, 'Light painting - Orga accueil', '<p>Rends toi à la salle de chouille (derrire la k fet, c''est l''escalier louche qui descend)</p><div>Demande au photographe en quoi tu peux être utile, mais en gros ton boulot c''est de t''occuper des gens qui arrivent (tu jongles entre le haut de l''escalier et le bas pour accueillir et diriger les gens, les faire attendre si besoin)</div><div><br></div><div>On ne part pas tant que la relève n''est pas arrivée, c''est important pour assurer le bon déroulement du festival !</div>', NULL, 0, 'Salle de séminaire aka salle de chouille S.S. MDE', 3, 'non'),
(168, 197, 357, NULL, 'Accueillir les assos', '<p></p><ul><li>Retrouve l''AJIL vers le stade (là où se tient habituellement le feu d''artifice !)</li><li>Appelle les si tu ne les trouves pas :&nbsp;<span style="color: rgb(51, 51, 51); font-family: Helvetica, Arial, ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 13px; line-height: 17.940000534057617px; white-space: pre-wrap; background-color: rgb(255, 255, 255);"> 06 15 44 33 68 Félix Détrez</span></li><li>Montre leur l''emplacement du spectacle (sur le terrain stabilisé)</li><li>Vérifie que les extincteurs sont bien sur place (le dispositif de sécurité du feu d''artifice est déjà là, donc les extincteurs aussi)</li><li>Donne les aux artistes (on sait jamais...)<br></li><li>Dis leur de faire gaffe aux explosifs du feu d''artifice,<b>&nbsp;il faut bien qu''ils se mettent près des barrières</b></li></ul><p></p>', NULL, 1, 'A  l&#039;endroit du feu d&#039;artifice', 3, 'non'),
(169, 197, 357, NULL, 'Remercier les assos', '<p></p><ul><li>Va voir l''AJIL à la fin de leur spectacle</li><li>Remercie les de leur participation</li><li>Et puis c''est tout ..</li></ul><p></p>', NULL, 0, 'A  l&amp;#039;endroit du feu d&amp;#039;artifice', -1, 'non'),
(170, 212, 358, NULL, 'Accueil presta', '<p style="background-color: rgb(255, 255, 255);">- attendre qu''ils appellent</p><div style="background-color: rgb(255, 255, 255);">- leur montrer où est le point d''eau (bâtiment des humas)</div><div style="background-color: rgb(255, 255, 255);">- Appeler nico au talkie pour qu''il branche le tuyeau d''arrosage si ce n''est pas déjà fait</div><div style="background-color: rgb(255, 255, 255);">- répondre à leur question</div><div style="background-color: rgb(255, 255, 255);">- leur donner leur 3 tickets bouffe</div><div style="background-color: rgb(255, 255, 255);">- leur dire que des softs vont venir les aider à 9h</div><p></p>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(171, 212, 358, NULL, 'installation ferme', '<p>- Rejoindre la presta de la Ferme sur la pelouse des Humas devant l''entrée du bâtiment des Humas (si elle n''est pas encore la, attends-là juste devant le bâtiment des Humas)<br></p>\r\n<p>- Se faire&nbsp;briefer&nbsp;par la presta pour l''installation (baignoire pour les besoins en eau)<br></p>\r\n<div>- Installer (faire ce qu''elle te demande)</div>\r\n<div><br></div>\r\n<div>- Appeler Constant en cas de problème majeur : 06 82 82 41 26</div>\r\n<div><br></div>\r\n<div>- Et même à 9h on met de la bonne humeur :) parce que c''est quand même plus rigolo #TBE&nbsp;</div>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(172, 212, 358, NULL, 'Animation ferme', '<p>- Rejoindre la presta de la Ferme sur la pelouse des Humas devant l''entrée du bâtiment des Humas</p><p>- Se faire briefer par la prestataire ou l''orga précédent si la presta est occupée (balade)</p><p>- Veiller à l''approvisionnement en eau des animaux (bassine à remplir : robinet le long du&nbsp;bâtiment&nbsp;adjacent)</p><div>- Surveiller pendant que la presta fait la balade avec l''âne (attention que les enfants se fassent pas bouffer par exemple...)</div><div><br></div><div>-Faire des gazouillis avec les animaux</div><div><br></div><div>-Ne pas râler parce que ça sent le bouc (parce que de toute façon y a des boucs) #TBE</div><div><br></div><div>- Ne pas partir avant l''arrivée de la relève</div><div><br>- Appeler Constant en cas de problème majeur : 06 82 82 41 26</div>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(173, 212, 358, NULL, 'Rangement ferme', '<p>- Aller à la Ferme sur la pelouse des Humas devant l''entrée du bâtiment des Humas</p><div>- Aider la prestataire à ranger<br>- Ramener la grande table et les chaises au kit Plaisirs au dépot Humas&nbsp;</div><div><br></div><div>- Si elle te fait comprendre qu''elle a pas forcément besoin de toi, retourne au QG de l''ambiance et va voir l''humain pour aider autre part :)</div><div><br>- Appeler Constant en cas de problème majeur : 06 82 82 41 26</div>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(174, 212, 358, NULL, 'check check checki check', '<p>-Allez voir si tout se passe bien avec la ferme et la ballade à poney devant le bâtiment des Humas (c''est là où ça sent l''animal)</p><div>- La remplacer si elle veut aller manger ou aller lui chercher à manger</div><div><br></div><div>- Vérifier que tout se passe bien</div><div><br></div><div>- Faire des sourires à tout le monde</div><p></p>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(175, 212, 359, NULL, 'Installation balade à poneys', '<P>- Va chercher 10 vaubans dans le dépôt derrière la kfet</P>\r\n<DIV><BR>\r\n<DIV>- Récupère une chaise et une table au dépôt des Humas et de la rubalise au QG de l''ambiance</DIV></DIV>\r\n<DIV><BR></DIV>\r\n<DIV>- Va chercher la tente 3*3 au dépôt des Humas</DIV>\r\n<DIV><BR></DIV>\r\n<DIV>- Amène tout ça sur la pelouse des Humas devant le bâtiment des Humas un peu sur la droite du chemin. Demande à Constant si tu sais pas où installer (trouve le il sera pas très loin un peu en stress ou sinon appelle-le. Si quelqu''un gueule très fort pour rien cherche pas, c''est lui ;) &nbsp;)</DIV>\r\n<DIV><BR></DIV>\r\n<DIV>- Si besoin demande au soft qui s''occupe d''installer la ferme de t''aider si il a rien à faire</DIV>\r\n<DIV><BR></DIV>\r\n<DIV>- Installe la table et les chaises sous la tente</DIV>\r\n<DIV><BR></DIV>\r\n<DIV>- Demande à la presta de la ferme ce qu''il faut faire des vaubans. Si il en reste sert t''en pour faire une file d''attente pour la balade à poneys</DIV>\r\n<DIV><BR></DIV>\r\n<DIV>- En cas de problème majeur appelle Constant : 06 82 82 41 26</DIV>\r\n<DIV><BR></DIV>\r\n<P></P>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(176, 212, 359, NULL, 'Animation balade à poneys', '<p>- Ton rôle est de faire en sorte que tout se passe bien ^^</p><div><br></div><div>- Fait en sorte que les gens fassent la queue et se doublent pas mutuellement.&nbsp;</div><div><br></div><div>- Dis bien aux parents que c''est eux qui doivent accompagner le poney avec leur enfant. Ne laisse pas monter un enfant si un adulte n''est pas là pour l''accompagner!!!!!</div><div><br></div><div>- S''il y a du monde, limite le nombre de tours à 2.&nbsp;</div><div><br></div><div>- Fais gaffe aux poneys!! il faut pas les casser</div><div><br></div><div>- Fais tout ça dans la bonne humeur même si y a des parents relous ;)</div><div><br></div><div>- Si la presta te dit de fermer la balade, ferme le stand le temps que les poneys se reposent. Reste jusqu''à la fin de ton créneau. Occupe-toi des poneys ou aide à animer la ferme</div><div><br></div><div>- Et surtout tu t''en vas pas si la relève est pas arrivée!!!&nbsp;</div><div><br></div><div>- En cas de problème majeur appelle Constant : 06 82 82 41 26</div><p></p>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(177, 212, 359, NULL, 'Rangement balade à poneys', '<p>- ramène tout le matériel (table, chaise, tente 3*3) au dépôt AIP</p><div><br></div><div>- Et les vaubans va les mettre dans le dépôt derrière la kfet. Ne laisse pas la rubalise par terre aussi!!</div><div><br></div><div>- Aide à ranger la ferme quand tu as fini s''ils en ont besoin, sinon va proposer ton aide à l''humain ;) #TBE</div><div><br></div><div>- En cas de problème majeur appelle Constant : 06 82 82 41 26</div><p></p>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(178, 220, 360, NULL, 'Accueillir le beach volley', '<p><b> </b><b>Guillaume Deffrennes - 06 66 26 84 08</b></p><p>-Aller chercher au QG orga 3 sifflets, 6 médailles et 1 coupe<br> </p><p>-Aller au terrain de beach volley<br></p><p>-Accueillir les joueurs, leur donner le matériel</p><p>-Vérifier qu''ils ont tout ce qu''il faut et leur souhaiter une bonne animation</p><p>-Leur fournir le numéro du PC sécu (en cas d''accident) : <span style="font-family:arial,sans-serif;font-size:13px">04 72 43 70 70 ou&nbsp;</span><span style="font-family:Arial,sans-serif;font-size:11pt">04 72 43 60 00</span></p>', NULL, 0, 'QG Orga', 3, 'non'),
(179, 220, 360, NULL, 'Dire au revoir au beach volley', '<p> -Aller au terrain de beach volley</p><p>-Demander à Guillaume si tout s''est bien passé, le remercier</p><p>-Récupérer les 3 sifflets<br></p><p>-Vérifier qu''il ne reste rien sur le terrain</p><p>-"A l''année prochaine!"</p><p>-Ramener les sifflets au QG orga<br></p>', NULL, 0, 'Terrain de beach volley', 3, 'non'),
(180, 220, 360, NULL, 'fff', '<p>fff</p>', NULL, 0, 'Terrain de beach volley', -1, 'non'),
(181, 222, 362, NULL, 'Accueillir le club de tir à l''arc', '<p>Il suffit juste d''aller montrer ses fesses au club de tir à l''arc derrière la piscine (à prendre au sens figuré pour certaines personnes)&nbsp;</p><div>Autrement dit, on les accueille, et on leur demande si tout se passe bien.</div><div><br></div><div>A oui, on leur donne les numéros suivants aussi :</div><div><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">04 72 43 70 70 et&nbsp;</span><span style="color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 11pt; background-color: rgb(255, 255, 255);">04 72 43 60 00</span><br></div><div><span style="color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 11pt; background-color: rgb(255, 255, 255);"><br></span></div><div><span style="color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 11pt; background-color: rgb(255, 255, 255);">Ce sont les numéros du PC Sécu.</span></div><p></p>', 'Ses fesses', 0, 'Derrière la piscine', 3, 'non'),
(182, 54, 363, NULL, 'Accueil INSA et ASVEL', '<p><b style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">Pierre Durant - 0668038261</b><br></p><p>Accueillir&nbsp;les équipes INSA et ASVEL : bonjour, indiquer les vestiaires...</p><p>Vérifier que la table de marques (et les chaises) sont en place</p><p>Verifier qu''ils ont bien leur feuille de marque (j''en aurais quand même une dans mon sac au cas ou)</p><p>Vérifier que le chrono est en place et fonctionne</p><p>Vérifier&nbsp;que la sono et le micro marchent ( apportés par K Le son)</p><p>Renseigner Pierre Durant sur les consignes de sécurité : Numero :<span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">04 72 43 70 70 ou&nbsp;</span><span style="color: rgb(34, 34, 34); background-color: rgb(255, 255, 255); font-family: Arial, sans-serif; font-size: 11pt;">04 72 43 60 00</span></p>', NULL, 0, 'Gymnase C', -1, 'non'),
(183, 54, 363, NULL, 'Nettoyer sol gymnase C', '<p>Numéro Kamil Bennani : 06 21 20 43 50</p><div><br></div><div>-Aller au QG orga&nbsp;</div><div>-récupérer le grand balais (style swiffer) avec la serpillière + sceau d''eau avec un produit pour néttoyer le sol.</div><div>-tout ramener au gymnase C&nbsp;</div><div>-bien laver le sol pour que les joueurs ne glissent pas</div><div>-tout rendre au QG orga</div><div><br></div><div><br></div><div><br></div><p></p>', 'Gant pour le ménage', 0, 'Gymnase C', -1, 'non'),
(184, 54, 363, NULL, 'Installation match gala', '<p><b>Orga : Kamil Bennani : 0621204350</b></p><div><b><br></b></div><div>- RDV au Dépôt AIP</div><div>- Aller chercher 2 tables 2 places + 4 chaises du dépot AIP</div><div>- Les ramener au Gymnase C&nbsp;</div><div>- vérifier que K-Le-Son a bien mis les enceintes + micro &nbsp;etc ...</div><div><br></div>', NULL, 0, 'Gymnase C', -1, 'non'),
(185, 54, 363, NULL, 'Remercier équipes + collation', '<p><b>Kamil Bennani : 0621204350</b></p><p><b>- Aller au QG Orga&nbsp;</b></p><p>- &nbsp;Pour le soft : &nbsp;ramener &nbsp;le kit ''bouffe buffet gala basket'' &nbsp;qui est dans la salle à coté du &nbsp;QG orga et ne pas oublier de ramener un couteau (demander aux humains pour avoir l''accès<br></p><p>- Ramener le tout au gymnase C</p><p>- Remercier les équipes&nbsp;</p><p>- Leur dire qu''ils ont bien joué&nbsp;</p><p>- Installer le buffet : se servir des tables déja présentes au gymnase</p><p>- Préparer, servir qq verres</p><p>-C''est bon</p>', NULL, 0, 'Gymnase C', -1, 'non'),
(186, 54, 363, NULL, 'Nettoyer et fermer le gymnase C', '<div>-RDV devant le Gymnase C&nbsp;<br></div><div><div><br></div><div>-Jeter les Dechets</div><div><p>-Nettoyer les tables</p><p>-Nettoyer la zone&nbsp;</p><p>-Vérifier qu''il n''y a plus personne (CRIER !!)</p><p>-Ramener les (hypothétiques) restes au QG Orga</p><p><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">-Ramener les 2&nbsp;</span><span style="color: rgb(34, 34, 34); background-color: rgb(255, 255, 255);">&nbsp;table 2 places + 4 chaises du dépot AIP</span><br></p><p>-Fermer le Gymnase C<br></p><p>-Ramener les clés au QG Orga&nbsp;</p></div></div>', NULL, 0, 'Gymnase C', 3, 'non'),
(187, 222, 363, NULL, 'Gérer le match de Basket', '<p>Comme je ne pourrais pas rester pendant 1h30 au gymnase, Tu as la chance, l''honneur, le privilège de pouvoir te pignoler pendant 1h30 pour vérifier que tout se passe bien pendant le match :<br></p><p></p><ul><li>Venir au gymnase C (celui de la piscine)</li><li>Normalement je (Cedric) serai là et j''aurais vérifié la sono, micro etc .. je t''aiderais à te mettre en place</li><li>préparer un petit discours de 30 secondes à lancer avant le match du genre "Bonjour et bienvenu à tous pour ce match palpitant entre ... (énoncer les palmarès) etc .." &nbsp;</li><li>s''occuper de la musique avant le match et pendant les temps morts, c''est à dire avoir une playlist de Rap US prête sur ton smartphone et mettre pause/play. (Si tu n''as pas de smartphone préviens moi je te laisserais le mien)&nbsp;</li><li>Gérer la musique des pompoms girls uniquement pendant la mi-temps ( je verrais avec elles directement je te dirais quoi faire sur place)</li><li>Remercier les spéctateurs et équipes à la fin du match</li><li>Rendre le matos à K-le-son si ils viennent le chercher&nbsp;</li><li>Attendre que je revienne avant de partir&nbsp;</li></ul><div><b style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">Prestataire :&nbsp;</b><b style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">Pierre Durant - 0668038261</b><br></div><p></p>', NULL, 0, 'Gymnase C', -1, 'non'),
(188, 23, 364, NULL, 'Striptease Bural', '<p>Stoppe la pignole où que tu sois!</p><div>Rends toi dans la zone sécurisée à gauche de la grande scène (n''oublie pas le fen pour faire une entrée charismatique et originale ;) )</div><div><br></div><div>Fais un câlin de l''ambiance à tes co-bural parce que tu les aimes d''amour.</div><div><br></div><div>Révèle le mot à caser dans le discours au principal concerné.</div><div><br></div><div>Fous-toi de sa gueule parce qu''il va vraiment se taper la honte devant plein de gens :p (dont sa soeur Camille)</div><div><br></div><div>Rappelle discrètement au président de lancer un joyeux anniversaire de l''ambiance pour Cetelem &lt;3</div><div><br></div><div>Respire à fond et monte sur scène ce n''est qu''un mauvais moment à passer :)</div><div><br></div><div><br><div><br></div><div><br></div></div><p></p>', NULL, 0, 'Grande scène!', 3, 'non'),
(189, 221, 365, NULL, 'Départ course natation', '<p>Tu prends ton camelbak (pour avoir un sifflet :p), tu te bouges jusqu''à la piscine.</p><div>Tu vérifies par talkie que tu es bien synchro avec les autres courses.</div><div>A 14h00 pétantes tu&nbsp;siffles le départ de la course.<br></div><div><br></div><div>Tu&nbsp;gères avec INSAquatic pour&nbsp;être&nbsp;sûr qu''ils gardent les feuilles de comptages à 18h00 pendant la transition.</div>', 'camelbak', 0, 'Gymnase C - Piscine', 3, 'non'),
(190, 221, 365, NULL, 'Ouvrir la piscine', '<p>Aller&nbsp;récupérer&nbsp;les clés de la piscine au QG orga. En profiter pour prendre les Feuilles de Comptage.</p><div>Aller à la piscine et l''ouvrir pour que tout le monde puisse aller se changer.</div><div>Ramener les clés au QG orga.<br><br></div><div>Donner les feuilles de comptage à INSAquatic.</div>', 'Clef de la piscine', 0, 'Gymnase C - Piscine', 3, 'non'),
(191, 221, 365, NULL, 'Récupérer les distances piscine', '<p>-A 18h45 récupérer les feuilles de distance&nbsp;auprès&nbsp;des personnes d''INSAquatic.</p><p>-Amener ces feuilles au chrono et rentrer les données dans le&nbsp;système de comptage du chrono.</p><p>-Rentrer au village coureur et prendre le PC</p><p>-Rentre les longueurs sur un fichier excel pour pas avoir l''air con !</p>', NULL, 0, 'Gymnase C - Piscine', 3, 'non'),
(192, 221, 365, NULL, 'Compter les longueurs', '<p>Rends-toi à la piscine à l''heure pour être bien briefé.<br></p><div>Récupère les feuilles de comptages&nbsp;auprès&nbsp;d''INSAquatic.</div><div>Compte avec attention <i>le nombre d''allers-retours</i> des nageurs, c''est le seul moyen qu''on ait pour connaitre les distances parcourues par les nageurs.<br><br>Have fun !<br></div>', 'Feuille de comptage', 0, 'Gymnase C - Piscine', 3, 'non'),
(193, 221, 365, NULL, 'Préparer les feuilles de comptages', '<p></p><div>Ramène-toi au bocal.<br><br></div><div>Choisis les lignes d''eau de chaque \r\ncoureur et équipe et prépare les feuilles de comptages pour que ce soit\r\n clair pour tous les softs (sauf les débiles...).<br><br>Donne les feuilles de comptages aux z''umains.<br></div><p></p>', 'Feuilles de comptage', 0, 'Gymnase C - Piscine', 3, 'non');
INSERT INTO `Tache` (`id`, `responsable_id`, `groupetache_id`, `importid`, `nom`, `consignes`, `materielSupplementaire`, `permisNecessaire`, `lieu`, `statut`, `commentaireLog`) VALUES
(194, 222, 362, NULL, 'Transport de barrière', '<p>Rendez vous au QG orga et récupérer 20m de la rubalise.&nbsp;</p><p>Se rendre ensuite au dépôt barrières, entre la kfet et les humas.&nbsp;<br></p><div>On prend 8 vaubans et on les emmène derrière la piscine pour l''installation.&nbsp;</div><div>Il est possible d''avoir à effectuer 2 aller-retours, en fonction des conditions physiques de chacun.</div><div>Des lunettes de soleil sont conseillées pour faire plus BG pendant le transport du matos. &nbsp;</div><div><br></div><div><p>Ensuite, bien évidemment, il faudra installer les vaubans et les rubalises pour assurer un bon déroulement de l''animation, histoire que personne ne se retrouve avec une flèche dans les fesses.</p><div>On s''organisera en fonction des préférences de notre prestataire.</div></div><div><br></div><div>(pour s''organiser, je conseille 1 orga sur place qui accueillera le prestataire et mettra en place le stand, et 2 qui feront les aller-retours avec les barrières)</div><p></p>', NULL, 0, 'Dépot AIP', 3, 'raf'),
(195, 212, 367, NULL, 'installation chateau samedi', '<p></p><div>- Aller chercher 7 barrières vaubans au dépôt barrières (derrière la kfet)</div><div><br>- Récupérer du scotch et des ciseaux au QG de l''ambiance (orga) et de la rubalise<br></div><div><br></div><div>- Récupérer la bâche au dépôt AIP</div><div><br></div><div>- Rends-toi sur les humas à l''endroit où est prévue l''animation (entre GCU et AIP). La structure sera normalement déjà montée<br></div><div><br></div><div>- Mettre 3 barrières autour de la soufflerie du jeu gonflable et mets en place une file d''attente avec les autres barrières et la rubalise&nbsp;<br></div><div><br></div><div>- Mettre la bâche devant le château&nbsp;</div><div><br></div><div><br></div>- Vérifier que tout est bien en place pour la journée<div><br></div><div>- Commence à tenir l''animation en attendant que la relève arrive à 10h</div><div><br></div><div>- Ramène le scotch et la rubalise au QG de l''ambiance une fois que la relève est arrivée<br><div><br></div><div>En cas de&nbsp;problème&nbsp;contacter Constant: 06 82 82 41 26</div><p></p></div>', NULL, 0, 'Pelouse des Humas', 3, 'raf'),
(196, 222, 362, NULL, 'Installer le matos', '<p>Ici, c''est simple, il faut juste installer les vaubans et les rubalises pour assurer un bon déroulement de l''animation, histoire que personne ne se retrouve avec une flèche dans les fesses.</p><div>On s''organisera en fonction des préférences de notre prestataire.</div><p></p>', NULL, 0, 'Derrière la piscine', -1, 'non'),
(197, 222, 362, NULL, 'Dire au revoir au club de tir à l''arc', '<p>Rend toi au stand de tir a l''arc derrière la piscine.</p><p>Bah heu là, il faut faire acte de présence un peu, demander si tout s''est bien passé, et/ou s''il y avait des commentaires à faire concernant le déroulement de l''animation.</p><div>On peut peut-être inviter la prestataire à aller boire un coup si son physique et son mental plaisent à l''orga qui s''occupe de ça. (Elle a des boobs ? Elle est bonne ? Tampon ou serviette ?)</div><p></p>', NULL, 0, 'Derrière la piscine', 3, 'non'),
(198, 215, 368, NULL, 'Accueillir le Krav Maga', '<p><b style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">&nbsp;</b><b style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">Patrick Long - 0618760366 et&nbsp;</b><span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;">Julien Grand - 06 18 00 27 04</span></p><div><b style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);"><br></b></div><div><div><font color="#333333" face="Helvetica Neue, Helvetica, Arial, sans-serif"><span style="font-size: 14px; line-height: 20px;"><b>Le SAMEDI</b></span></font></div><div><ul><li><font color="#333333" face="Helvetica Neue, Helvetica, Arial, sans-serif"><span style="font-size: 14px; line-height: 20px;">Appeler le prestataire pour savoir où il est</span></font></li><li><font color="#333333" face="Helvetica Neue, Helvetica, Arial, sans-serif"><span style="font-size: 14px; line-height: 20px;">L''amener sur l''un des terrains de tennis Colette Besson</span></font></li><li><font color="#333333" face="Helvetica Neue, Helvetica, Arial, sans-serif"><span style="font-size: 14px; line-height: 20px;">Vérifier que tout va bien</span></font></li></ul><div><font color="#333333" face="Helvetica Neue, Helvetica, Arial, sans-serif"><span style="font-size: 14px; line-height: 20px;"><b>Le DIMANCHE</b></span></font></div></div><div><ul><li><font color="#333333" face="Helvetica Neue, Helvetica, Arial, sans-serif"><span style="font-size: 14px; line-height: 20px;">Vérifier que le presta est bien sur son terrain de tennis&nbsp;</span></font></li><li><font color="#333333" face="Helvetica Neue, Helvetica, Arial, sans-serif"><span style="font-size: 14px; line-height: 20px;">Vérifier que tout va bien</span></font></li></ul><div>Leur fournir le numéro du&nbsp;<b>PC sécu</b>&nbsp;(num en cas d''accident) :<span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">04 72 43 70 70 ou&nbsp;</span><span style="color: rgb(34, 34, 34); background-color: rgb(255, 255, 255); font-family: Arial, sans-serif; font-size: 11pt;">04 72 43 60 00</span><font color="#333333" face="Helvetica Neue, Helvetica, Arial, sans-serif"><span style="font-size: 14.44444465637207px; line-height: 20px;"><br></span></font></div></div></div><p></p>', NULL, 0, 'terrain de tennis Colette Besson', 3, 'non'),
(199, 212, 367, NULL, 'installation chateau dimanche', '<P></P>\r\n<DIV>- Récupère la structure du chateau à l''AIP<U><BR></U>- Aller chercher 7 barrières vaubans au dépôt barrières (derrière la kfet)</DIV>\r\n<DIV>-Récupérer la bâche au dépôt AIP et la rallonge<BR>- Récupérer du scotch, de la rubalise et des ciseaux au QG de l''ambiance et bien sûr le kit du jeu&nbsp;<U><B>CHATEAU course hippique</B></U></DIV>\r\n<DIV>- Rends-toi sur les humas à l''endroit où est prévue l''animation (entre GCU et AIP)</DIV>\r\n<DIV>- Monter le jeu gonflable en suivant la notice&nbsp; (brancher la soufflerie avec la rallonge)</DIV>\r\n<DIV>- Mettre 3 barrières autour de la soufflerie du jeu gonflable et mets en place une file d''attente avec les autres barrières et la rubalise</DIV>\r\n<DIV>- Mettre la bâche devant le chateau</DIV>- Vérifier que tout est bien en place pour la journée\r\n<DIV>- Et maintenant t''attends les gentils amis qui viennent te remplacer à 10h ;)</DIV>\r\n<DIV>- Ramène le scotch et la rubalise au QG de l''ambiance une fois que la relève est arrivée<BR>\r\n<DIV><BR></DIV>\r\n<DIV>En cas de&nbsp;problème&nbsp;contacter Constant 06 82 82 41 26</DIV>\r\n<P></P></DIV>', NULL, 0, 'Pelouse des Humas', 3, 'non (raf)'),
(200, 222, 362, NULL, 'Ramener le matos au dépôt', '<p>Après avoir dit au revoir au club, il faut maintenant tout nettoyer!! Par nettoyer, je veux dire ramener toutes les barrières au dépôt barrière qui est derrière la K-Fet.</p><div>Encore une fois, il nous faut des muscles et de la bonne humeur. N''oubliez pas les lunettes de soleil pour avoir la classe du BG que vous avez toujours eu envie d''être!</div><div><br></div><div>(Pour mieux s''organise, je conseille qu''un orga reste sur place pendant que les deux autres font les aller-retours)</div><p></p>', NULL, 0, 'Derrière la piscine', 3, 'raf'),
(201, 212, 367, NULL, 'rangement chateau', '<p>Démontage de la structure du Chateau Cheval</p>\r\n<p>- Rends toi sur la pelouse des Humas au niveau du château cheval entre GCU et le bar AIP</p>\r\n<p>-Récupérer tous les petits éléments (sardines, soufflerie ...) et vérifier sur la liste du matos que vous n''avez rien oublié que le gentil orga t''apportera :)</p>\r\n<p>- Attends que Constant vienne t''aider à dégonfler la structure. Il est sur les Humas en train de dégonfler les autres animations. T''inquiète pas il arrive ;)</p>\r\n<p>- Ramène la rallonge à l''AIP&nbsp;<br></p>\r\n<p>-Ramener les 7 barrières Vauban au dépôt barrières (derrière la kfet)</p>\r\n<p>-Ramener le kit des petits éléments au dépôt AIP et déplacer correctement (pour que ceux qui devront la remonter le lendemain n''ait pas trop de mal) la structure gonflable du château dans l''AIP</p>\r\n<p>En cas de problème : Constant 06 82 82 41 26</p>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(202, 215, 368, NULL, 'Au revoir Krav Maga', '<p></p><li>Se rendre au terrain de tennis Colette Besson</li><li>&nbsp;Aller voir si tout se passe bien<br></li><li>Remercier les intervenants</li><li>Dire à demain ou à l''année prochaine</li><p></p>', NULL, 0, 'terrain de tennis Colette Besson', 3, 'non'),
(203, 212, 367, NULL, 'rangement chateau dimanche', '<p>Démontage de la structure du Chateau Cheval</p><p>- Rends toi sur la pelouse des Humas au niveau du château cheval<br></p><p>-Récupérer un caddie si possible pour le transport&nbsp;</p><p>- Dégonfler la structure. Laisser la rallonge sur place<br></p><p>-Récupérer tous les petits éléments (sardines, soufflerie ...) et vérifier sur la liste du matos que vous n''avez rien oublié.&nbsp;</p><p>-Ramener les 7 barrières Vauban au dépôt barrières (derrière la kfet)</p><p>-Ramener le kit des petits éléments au dépôt AIP et déplacer correctement (pour ne pas énerver le presta qui viendra le récupérer le lendemain) la structure gonflable du château derrière la grande scène sur la pelouse des humas sans qu''elle gène.<br></p><p><br></p>En cas de problème : Constant 06 82 82 41 26', NULL, 0, 'Pelouse des Humas', -1, 'non'),
(204, 222, 369, NULL, 'Accueil presta', '<p>On va sur la pelouse des humas pour aller accueillir le club de Kung Fu.</p><div><br></div><div>Numéros du PC Sécu :</div><div><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">04 72 43 70 70 et&nbsp;</span><span style="color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 11pt; background-color: rgb(255, 255, 255);">04 72 43 60 00.</span><br></div><div><br><div><br></div></div><p></p>', NULL, 0, 'Pelouse des humas', -1, 'non'),
(205, 215, 370, NULL, 'Amener le matos', '<p></p><ul><li>Rends toi au dépôt Humas (bâtiment des humanités)<br></li><li>Récupérer <b>une table 2 places</b>, <b>4 chaises</b> et un rouleau de scotch <b>orange</b> (pour marquage au sol), au dépôt Humas<br></li><li>Les amener au terrain de<b> tennis Colette Besson</b>, sur un terrain libre (terrains de tennis entre les bâtiments E et H, derrière la K-fêt (tu devrais savoir où c''est ça))</li><li>Laisser tout ça là, et attend bien gentillement que l''équipe d''escrime arrive!<br></li><li>Repart joyeusement vers de nouvelles aventures!</li></ul><div>=&gt; &nbsp;S''il y a le moindre problème, n''hésite pas à appeler la resp'' Sandra au <b>06.32.56.35.45</b></div><p></p>', 'Des gros bras et de la bonne humeur', 0, 'terrain de tennis Colette Besson', 3, 'raf'),
(206, 212, 367, NULL, 'accueil attraction 2000', '<p></p><ul><li>Accueillir&nbsp;Attraction 2000</li><li>Lui indiquer les emplacements pour les différentes installations (Chateau gonflable devant l''AIP, le toboggan à côté, le baby-foot devant GMC, les joutes devant GMC, les sumos devant GCU)</li><li>Après livraison lui donner le chèque de paiement<br></li><li>Regarder comment il monte le château cheval pour pouvoir le déplacer le soir et savoir le remonter le lendemain<br></li><li>Rester sur la pelouse des humas en cas de problème et pour aider le presta.</li></ul><p></p>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(207, 212, 367, NULL, 'checki check les animations gonflables', '<p>- Faire régulièrement le tour des anims gonflables pour voir que tout se passe bien ( s''assurer qu''aucune structure est déchirée ou dégonflée,&nbsp; que les softs gèrent le monde qu''il y a.....).</p><p>- Gérer les soucis s''il y en a, sinon faire savoir aux meilleurs humains du monde que tu les adores et que tu es disponible pour d''autres tâches (à part la poubelle bien sur ! )</p>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(208, 32, 371, NULL, 'Installer l''anim pour la coupe de robotique', '<p>-Va au QG orga <br></p>\r\n<p>-Retrouve Rani qui va récupérer les clés de l''amphi Seguin (07 50 40 06 74)<br></p>-Va chercher 30 chaises et 15 tables au dépôt AIP (faire des allers retours of course : s''aider du caddie s''il y en a un de dispo au dépôt AIP )<br><br>-Amène les dans l''amphi Seguin (laisse les tables dans le hall, par contre les chaises vont dans l''amphi : vers le tableau)<br>-Pense à bien fermer l''amphi Seguin!!<br>-Reprends les clés de l''amphi avec toi et ramène les au QG orga<br>-C''est bon, tu peux maitenant kiffer la vibe', 'Clés de l''amphi Seguin', 0, 'QG Orga', 3, 'non'),
(209, 212, 367, NULL, 'gérer le château', '<p></p><div>Se rendre sur le stand Château course hippique (humas&nbsp;devant&nbsp;GCU)<br><br></div><div><div><b>Public autorisé</b>&nbsp;: De 2 à 12 ans.<br><br></div><div><b>Capacité max</b>&nbsp;: 12 enfants.<br><br></div><div>Essayez de respecter ces consignes (surtout la capacité parce l''âge c''est pas toujours facile de savoir ^^)car si y a un problème, on est dans la merde si on respecte pas ces deux critères.</div><div><br></div><div>Obligez les&nbsp;mômes&nbsp;à enlever leur&nbsp;chaussures&nbsp;avant de monter sur le château.<br></div><div>Laisser les enfants batifoler, faire des saltos et roulades en tout genre une dizaine de minutes.</div><div>Selon l''attente, adaptez la durée...</div><div>Jetez un coup d’œil si des enfants vraiment en bas âges participent, histoire qu''ils ne se prennent pas un ado de 12ans sur la gueule. Vous pouvez toujours regrouper tous les très jeunes enfants ensemble.</div><div>Canalisez bien les gens en formant une file d''attente avec les barrières. Soyez attentif à ce que la file d''attente soit bien faite et qu''il n''y ait personne qui passe devant d''autres!</div></div><div><br></div><div><b>IMPORTANT</b>: Ne Jamais Laisser l''Anim Toute Seule<br><br></div>En cas de&nbsp;problème: Constant 06 82 82 41 26<p></p>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(210, 215, 370, NULL, 'Ramener le matos au dépôt', '<p></p><ul><li>Se rendre aux terrains de tennis du gymnase Colette Besson (situé entre les bâtiments E et H et juste derrière la Kfet)</li><li>Attendre\r\n la fin de l''animation "Initiation escrime"</li><li>Enlève bien le scotch du terrain</li><li>Récupère la table 2 \r\nplaces, &nbsp;les 4 chaises, le rouleau de scotch s''il en reste, et le sac poubelle.<br></li><li>Jette le sac poubelle dans une benne RDS et amène le matos au dépôt Humas (bâtiment des Humanités) et les laisser là bas.</li><li>C''est fini pour cette tâche tu peux repartir, toujours dans la bonne humeur !!</li></ul><div>S''il y a le moindre problème, appelle le resp'' Sandra au 0632563545</div><p></p>', 'De la boonne humeur', 0, 'terrain de tennis Colette Besson', 3, 'raf'),
(211, 32, 371, NULL, 'Fermer l''anim pour la coupe de robotique', '<p>-Rends toi au QG Orga</p>\r\n<p>- Retrouve Rani (07 50 40 06 74) qui aura récupéré les clés de l''amphi Seguin<br></p>\r\n<p>- Prends du matériel de ménage (balais,pelle,serpillère,seau,éponge,produit)<br>-Va à l''amphi Seguin, présente toi au ClubElek<br>-Aide les à ranger<br>-Ramène les 35 chaises et les 15 tables au dépôt AIP (s''aider du caddie pour les chaises s''il y en a un de dispo au dépôt AIP)<br>-Fais le ménage dans l''amphi (ça devrait pas être trop sale)</p>\r\n<p>-Ferme bien l''amphi Seguin à clé ! Vérifie également que toutes les autres entrées soient fermées<br>-Si c''est ok, récupère le matériel de ménage et ramène le tout au QG Orga</p>', 'Clés de l''amphi Seguin', 0, 'Amphi Seguin', 3, 'non'),
(212, 222, 369, NULL, 'Acueil presta + transport de matos', '<P>On accueille le prestataire sur la pelouse des humas, en face du bâtiment des humas.</P>\r\n<P>On va aller prendre un vauban au dépôt barrière entre la k-fet et le bâtiment des humas, et l''emmener sur la pelouse des humas juste en face de l''entrée principale du bâtiment des humas.</P>\r\n<P>Numéros du PC Sécu :<BR></P>\r\n<DIV><SPAN style="BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: arial, sans-serif; COLOR: rgb(34,34,34); FONT-SIZE: 13px">04 72 43 70 70 et&nbsp;</SPAN><SPAN style="BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: Arial, sans-serif; COLOR: rgb(34,34,34); FONT-SIZE: 11pt">04 72 43 60 00.</SPAN><BR></DIV>\r\n<P>&nbsp;</P>\r\n<P>&nbsp;</P>', NULL, 0, 'Dépôt des humas', 3, 'non'),
(213, 212, 373, NULL, 'installation toboggan samedi', '<p></p><div>- Aller chercher 7 barrières vaubans au dépôt barrières (derrière la kfet)<br></div><div>- Rends-toi sur les humas à l''endroit où est prévue l''animation (entre GCU&nbsp;et AIP)</div><br><div>- Récupérer du scotch, de la rubalise et des ciseaux au QG de l''ambiance (orga). La structure sera normalement déjà montée</div><div>- Mettre 3 barrières autour de la soufflerie du jeu gonflable et mets en place une file d''attente avec les autres barrières et la rubalise</div>- Vérifier que tout est bien en place pour la journée<div>- Ne pars pas tout de suite!! Attends les amis qui viennent te remplacer à 10h ;)<br>- Ramène le scotch et la rubalise au QG de l''ambiance une fois que la relève est arrivée<br><div><br></div><div>En cas de problème : &nbsp;Constant 06 82 82 41 26</div><p></p></div>', NULL, 0, 'Pelouse des Humas', 3, 'raf'),
(214, 215, 370, NULL, 'Dire au revoir Escrime', '<p><b style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14.44444465637207px; line-height: 20px; background-color: rgb(255, 255, 255);">&nbsp;resp''&nbsp;</b><b style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">Patrizia Peller - 0788253208</b></p><div><ul><li><font color="#333333" face="Helvetica Neue, Helvetica, Arial, sans-serif"><span style="font-size: 14.44444465637207px; line-height: 20px;">Remercier l''équipe escrime d''être venu.</span></font></li><li><font color="#333333" face="Helvetica Neue, Helvetica, Arial, sans-serif"><span style="font-size: 14.44444465637207px; line-height: 20px;">Demander si tout s''est bien passé.</span></font></li><li><font color="#333333" face="Helvetica Neue, Helvetica, Arial, sans-serif"><span style="font-size: 14.44444465637207px; line-height: 20px;">Vérifier que des softs sont là pour aller ranger le matos</span></font></li></ul></div>', NULL, 0, 'terrain de tennis Colette Besson', 3, 'non'),
(215, 215, 370, NULL, 'Accueillir Escrime', '<p><b style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14.44444465637207px; line-height: 20px; background-color: rgb(255, 255, 255);">resp anim Escrime :&nbsp;</b><b style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">Patrizia Peller- 0788253208</b></p><div><ul><li><font color="#333333" face="Helvetica Neue, Helvetica, Arial, sans-serif"><span style="font-size: 14.44444465637207px; line-height: 20px;">Aller accueillir l''équipe escrime (terrain de tennis Colette Besson)</span></font></li><li><font color="#333333" face="Helvetica Neue, Helvetica, Arial, sans-serif"><span style="font-size: 14.44444465637207px; line-height: 20px;">Vérifier que le matos est bien sur place (une table 2 place et 4 chaise et un rouleau de scotch)</span></font></li></ul><div><font color="#333333" face="Helvetica Neue, Helvetica, Arial, sans-serif"><span style="font-size: 14px; line-height: 20px;"><br></span></font></div><ul><li><font color="#333333" face="Helvetica Neue, Helvetica, Arial, sans-serif"><span style="font-size: 14.44444465637207px; line-height: 20px;"><span style="color: rgb(0, 0, 0); font-family: ''Times New Roman''; font-size: medium; line-height: normal;">Leur fournir le numéro du&nbsp;</span><b style="color: rgb(0, 0, 0); font-family: ''Times New Roman''; font-size: medium; line-height: normal;">PC sécu</b><span style="color: rgb(0, 0, 0); font-family: ''Times New Roman''; font-size: medium; line-height: normal;">&nbsp;(num en cas d''accident) :&nbsp;</span></span></font><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">04 72 43 70 70 ou&nbsp;</span><span style="color: rgb(34, 34, 34); background-color: rgb(255, 255, 255); font-family: Arial, sans-serif; font-size: 11pt;">04 72 43 60 00</span></li></ul></div>', NULL, 0, 'terrain de tennis Colette Besson', 3, 'non'),
(216, 222, 369, NULL, 'Dire au revoir au club de Kung Fu+ transport de matos', '<p>Ici, on se renseigne sur le déroulement de la prestation, et on leur demande s''il y a des remarques à faire.</p><p>Ah oui, et ramène la vauban au dépôt barrière, entre les humas et la kfet.</p>', NULL, 0, 'Pelouse des humas', 3, 'non'),
(217, 222, 369, NULL, 'Ramener le matos', '<p>Rend toi sur le stand kung fu sur les humas.</p><p>Ramène la vauban au dépôt barrière, entre les humas et la kfet.</p>', NULL, 0, 'Pelouse des humas', -1, 'non'),
(218, 212, 373, NULL, 'installation toboggan dimanche', '<p></p><div>- Récupère un caddie au dépôt AIP pour récupérer la structure du <b><u>toboggan de la mer&nbsp;</u></b>derrière la grande scène et la rapporter à l''endroit de l''animation (entre GCU et AIP)<u><br></u>- Aller chercher 7 barrières vaubans au dépôt barrières (derrière la kfet)<br>- Récupérer du scotch et des ciseaux et de la rubalise au QG de l''ambiance (orga)</div><div>- Rends-toi sur les humas à l''endroit où est prévue l''animation (entre GCU et AIP)</div><div>- Monter le jeu gonflable en suivant la notice&nbsp; (brancher la soufflerie avec la rallonge présente sur place)</div><div>- Mettre 3 barrières autour de la soufflerie du jeu gonflable et mets en place une file d''attente avec les autres barrières et la rubalise que tu n''auras pas oublié de récupérer au QG de l''ambiance</div>- Vérifier que tout est bien en place pour la journée<br><div>- Attendre 10h que la relève arrive. Ne laisse pas l''animation sans surveillance!!</div><div>-Ramène le scotch et la rubalise au QG de l''ambiance (orga)<div><br><div><br></div><div>En cas de&nbsp;problème&nbsp;contacter Constant 06 82 82 41 26</div><div><br></div><p></p></div></div>', NULL, 0, 'Pelouse des Humas', 3, 'non (raf)'),
(219, 222, 374, NULL, 'Accueillir les rugbyman', '<p>On va récupérer du scotch un sac poubelle de 50 L au QG Orga, dans la rotonde, et on va sur le terrain de rugby pour les accueillir.</p><p>Pour la poubelle, prend un scotch et scotch le sac poubelle sur le bord du terrain.</p><p>Pense a ramener le scotch au qg orga une fois la tache finie</p><div><br></div><div>Numéros du PC Sécu :</div><div><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">04 72 43 70 70 et&nbsp;</span><span style="color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 11pt; background-color: rgb(255, 255, 255);">04 72 43 60 00</span><br></div><p></p>', NULL, 0, 'QG Orga', 3, 'non'),
(220, 215, 377, NULL, 'Accueil Capoeira', '<P><U>Resp</U> :&nbsp;<B style="LINE-HEIGHT: 20px; BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: ''Helvetica Neue'', Helvetica, Arial, sans-serif; COLOR: rgb(51,51,51); FONT-SIZE: 14px">Toinho SAMPAIO - 06 84 34 41 58</B><BR style="LINE-HEIGHT: 20px; BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: ''Helvetica Neue'', Helvetica, Arial, sans-serif; COLOR: rgb(51,51,51); FONT-SIZE: 14px"><BR></P>\r\n<DIV>\r\n<UL>\r\n<LI>Se rendre sur la pelouse des Humas.<BR></LI>\r\n<LI>Appeler Toinho pour lui demander où il est, les retrouver</LI>\r\n<LI>Les accueillir</LI>\r\n<LI>Indique leur l''emplacement de l''animation: sur la partie de pelouse, à gauche du chemin vers la Rotonde</LI>\r\n<LI>Leur demander s''ils ont besoin d''aide, les aider en cas de besoin</LI></UL>=&gt; Leur fournir le numéro du&nbsp;<B>PC sécu</B>&nbsp;(num en cas d''accident) :&nbsp;<SPAN style="BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: arial, sans-serif; COLOR: rgb(34,34,34); FONT-SIZE: 13px">&nbsp;</SPAN><B><SPAN style="BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: arial, sans-serif; COLOR: rgb(34,34,34); FONT-SIZE: 13px">04 72 43 70 70 ou&nbsp;</SPAN><SPAN style="BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: Arial, sans-serif; COLOR: rgb(34,34,34); FONT-SIZE: 11pt">04 72 43 60 00</SPAN></B><BR></DIV>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(221, 215, 377, NULL, 'Au revoir Capoeira', '<p><u>Resp: <b>T</b></u><b style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">oinho SAMPAIO - 0684344158</b></p><ul><li>Aller voir l''animation Capoeira, sur la pelouse des Humas.<br></li><li>Leur demander si tout s''est bien passé.<br></li><li>Les remercier, et à l''année prochaine.<br></li></ul>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(222, 222, 374, NULL, 'Dire au revoir au rugby man', '<p>On va juste voir les rugbymans sur le terrain de rugby, leur demander si tout s''est bien passé, s''ils ont des remarques à faire, etc..</p><p>On oublie pas de récupérer la poubelle, et d''aller la jeter dans une benne RDS</p>', NULL, 0, 'Terrain de Rugby', 3, 'non'),
(223, 215, 378, NULL, 'Accueillir l''Ultimate', '<p><u>Resp</u>:&nbsp;<span style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);"><b>SARDA François-Xavier</b> -<b> 0626976570</b></span></p><div><ul><li>Aller chercher les clés du terrain de Rugby au QG orga</li><li><font color="#333333" face="Helvetica Neue, Helvetica, Arial, sans-serif"><span style="font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">Se rendre sur le terrain de Rugby</span></font></li><li><font color="#333333" face="Helvetica Neue, Helvetica, Arial, sans-serif"><span style="font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">Accueillir l''asso d''ultimate, dire bonjour, etc</span></font></li><li><font color="#333333" face="Helvetica Neue, Helvetica, Arial, sans-serif"><span style="font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">Demander s''ils ont besoin d''aide pour la mise en place, les aider au besoin</span></font></li><li><font color="#333333" face="Helvetica Neue, Helvetica, Arial, sans-serif"><span style="font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">Leur souhaiter une bonne journée</span></font></li><li><font color="#333333" face="Helvetica Neue, Helvetica, Arial, sans-serif"><span style="font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">Aller rendre les clés au QG orga</span></font></li></ul></div><div>Leur fournir le numéro du&nbsp;<b>PC sécu</b>&nbsp;(num en cas d''accident) :&nbsp;<b><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">04 72 43 70 70 ou&nbsp;</span><span style="color: rgb(34, 34, 34); background-color: rgb(255, 255, 255); font-family: Arial, sans-serif; font-size: 11pt;">04 72 43 60 00</span></b><br></div><p></p>', NULL, 0, 'Terrain de rugby', 3, 'non'),
(224, 215, 378, NULL, 'Au revoir Ultimate', '<p></p><div><u>resp</u>:&nbsp;<b style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">SARDA François-Xavier - 0626976570</b></div><div><br></div><div><ul><li>Aller au terrain de rugby, aller voir l''équipe d''Ultimate</li><li>Leur demander si tout s''est bien passé</li><li>Les remercier</li><li>A l''année prochaine</li></ul></div><p></p>', NULL, 0, 'Terrain de rugby', -1, 'non'),
(225, 220, 381, NULL, 'Accueillir le judo', '<p><b> </b><b>Valentin Kerspern - 06 60 21 11 91</b></p><p>-Aller à l''emplacement du judo sur la pelouse devant le bâtiment des Humas<br>-Accueillir les judokas, vérifier qu''ils ont tout ce qu''il faut<br>-Leur souhaiter de réussir leur animation</p><p>-Leur fournir le numéro du PC sécu (en cas d''accident) : <span style="font-family:arial,sans-serif;font-size:13px">04 72 43 70 70 ou&nbsp;</span><span style="font-family:Arial,sans-serif;font-size:11pt">04 72 43 60 00</span></p><p><span style="font-family:Arial,sans-serif;font-size:11pt">-Evite de les contrarier, a moins que tu sois maso! Leurs prises sont imparables!<br></span></p>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(226, 221, 365, NULL, 'Garder les vélos', '<p>Coucou,</p><div>Tu vas avoir la mission de garder les vélos des&nbsp;triathlètes, arrive bien à l''heure : RDV gymnase C à la piscine.<br><br></div><div>Fais-toi briefer par le resp (David).<br></div><div>Récupère les vélos des triathlètes et garde-les en sécurité (on sait jamais ce qui peut arriver) pendant toute la course. Ne pars pas avant que la relève n''arrive :)<br><br>Have fun !<br></div>', NULL, 0, 'Gymnase C - Piscine', 3, 'non'),
(227, 220, 381, NULL, 'Dire au revoir au judo', '<p>-Aller à l''emplacement du judo sur la pelouse des humas<br>-Les remercier, leur demander si ça s''est bien passé...</p><p>-"A l''année prochaine!"<br></p><p><br></p><p>-Si ils sont pas contents, pars en courant!<br></p>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(228, 221, 382, NULL, 'Transition Natation-vélo + fermer piscine', 'Aller chercher les clés de la piscine au QG orga et s''y rendre.<div><br></div><div>À la piscine vers 17h20, annoncer aux coureurs que le défi natation touche à sa fin.<br><br>Expliquer aux coureurs que les triathlètes en équipent doivent sortir par la porte située&nbsp;<i>sur le côté</i>&nbsp;du bassin pour effectuer un relai.<br><br>Expliquer aux triathlètes solo qu''ils peuvent prendre une douche aux vestiaires, puis sortir par la porte principale, passer par le souterrain pour retrouver leurs vélos.</div><div><br></div><div>Puis :<br><ul><li>Briefer&nbsp;les softs qui&nbsp;débarquent pour&nbsp;éviter&nbsp;qu''il y ait du monde sur la route.</li><li>Prévenir le village coureur et la voiture auto-école que les triathlètes vont&nbsp;bientôt&nbsp;arriver sur le circuit vélo.</li><li>Siffler la fin de la course à 18h pile.<br></li><li>Aider les&nbsp;triathlètes&nbsp;à&nbsp;récupérer&nbsp;leur vélos et aider les retardataires à trouver leur chemin.</li></ul><p>Après tout ça :</p><ul><li>Refaire un tour de la piscine</li><li>Vérifier que la piscine est vide</li><li>Vérifier que les vestiaires sont vides (hommes et femmes)</li><li>Vérifier que personne ne se trouve ni dans les escaliers, ni dans le gymnase.</li><li>Vérifier que le vestiaire dans lequel ont été stockés les vélos est vide.<br></li><li>Regarder quelles portes sont encore ouvertes, et les fermer.</li></ul><div>Ramener les clefs au QG orga</div></div>', 'Sifflet\r\nSigna : Relai cyclistes (équipes) --->\r\nAccès vélos (solo) <--- x2', 0, 'Gymnase C et circuit vélo', 3, 'non'),
(229, 220, 383, NULL, 'Installer les tables de tennis de table', '<p>-Aller au QG orga récupérer les clés du gymnase C et du sous-sol<br></p><p>-Ouvrir le gymnase et remonter 8 tables de tennis de table du sous-sol(du coté de la station velov, passer par la rampe derrière)<br></p><p>-Les installer dans un coin du gymnase</p><p>-Retourner fermer le sous-sol</p><p>-Retourner au QG orga poser les clés</p><p>-En cas de problème appeler le resp Etienne au 07 87 05 06 04</p><p><span style="font-family:Arial,sans-serif;font-size:11pt"><br></span></p>', NULL, 0, 'Gymnase C', 3, 'non'),
(230, 220, 383, NULL, 'Ranger les tables de tennis de table', '<P>-Aller au QG orga récupérer les clés du gymnase C et du sous-sol<BR></P>\r\n<P>-Aller au gymnase C&nbsp;<BR>-Ranger les 8 tables de tennis de table dans le sous sol(du coté de la station vélov, passer par la rampe)<BR></P>\r\n<P>-Fermer le sous-sol et la salle principale du gymnase (laisser la porte extérieure ouverte)<BR></P>\r\n<P>-Retourner au QG orga poser les clés</P>\r\n<P>-En cas de problème, appeler le resp Etienne au 07 87 05 06 04</P>', NULL, 0, 'Gymnase C', 3, 'non'),
(231, 221, 382, NULL, 'Transition Vélo-CAP', '<p>-Prévenir les cyclistes que les triathlètes vont&nbsp;bientôt&nbsp;passer à l''épreuve de course à pied à l''aide de la sono qui roxxe du poney.</p>\r\n<p>-&nbsp;Prévenir&nbsp;au micro la voiture auto-école pour qu''ils passent le message.</p>\r\n<p>-A 7h50, avertir les triathlètes qu''il ne leur reste que deux tours à vélos.</p>\r\n<p>-Donner les informations :</p>\r\n<ul>\r\n<li><span style="WHITE-SPACE: pre" class="Apple-tab-span">	</span>Ils doivent&nbsp;s’arrêter&nbsp;après la ligne d''arrivée</li>\r\n<li><span style="WHITE-SPACE: pre" class="Apple-tab-span">	Continuer </span>à pied après l''arche</li></ul>\r\n<p>-A 7h55, informer les triathlètes qu''il ne leur reste plus qu''un tour sur le circuit vélo.</p>\r\n<p>-Vérifier que la transition s''effectue correctement.<br></p>\r\n<p>-Les vélos des triathlètes seront&nbsp;entreposés au village coureurs pendant la course à pieds.</p>', 'Le micro de la sono', 0, 'Circuit vélo', 3, 'non'),
(232, 221, 382, NULL, 'Garder le chemin libre', '<p>Viens à la piscine et sois bien à l''heure, sinon les&nbsp;triathlètes&nbsp;seront partis avant que tu arrives.</p><p>Va te faire&nbsp;briefer&nbsp;par le resp (David) dans la piscine, qui va te montrer ce que tu dois faire. Il va falloir vous assurer que personne ne passe par la route des&nbsp;triathlètes&nbsp;pendant 10 minutes :</p><p>"VOUS NE PASSEREZ PAS !"<br></p><div><br></div><div>Merci :)</div><div><br></div>', NULL, 0, 'Gymnase C et circuit vélo', 3, 'non'),
(233, 16, 384, NULL, 'PS1 : Installation', '<p></p><ol><li>Rendez vous au QG Orga.<br></li><li>Retrouve ton co-orga.<br></li><li>Demande à l''Humain de vous donner des gilets jaunes et un talkie.<br></li><li>Rends toi au PS1 (Sur le boulevard Laurent Bonnevay près de CPE).</li><li>Prends les quelques barrière sur place de sorte à ne laisser passer que les voitures qui souhaitent sortir du campus.</li><li>Demande la sécu et préviens au talkie que tu es bien à poste<br></li></ol><p></p><p>Ta mission :&nbsp;Assurer la sécurité du festival et des courses en ne laissant passer aucun véhicule excepté&nbsp;:</p><p></p><ul><li>Les véhicules des secours (Pompiers, Police, etc..)<br></li><li>Les véhicules muni d''un passe sécu POUR LE PS1</li><li>Les coureurs AVANT le samedi matin 10h dont la liste te sera fournie</li></ul><div>Un exemple de pass sécu et l''autorisation de fermeture du campus sont disponible sur place.<br></div><div><br></div><div><div>En cas de problème / de doute demande le responsable sécurité au Talkie.&nbsp;N''hésite pas à prévenir de tout comportement anormaux. Si le talkie bip demande qu''on t''amène une batterie.<br>Si le talkie ne passe pas téléphone au 06.59.90.44.19 ou au 06.76.99.09.64<br>En cas d''urgence appel directement le PC sécu : 04.72.43.70.70</div><div>Reste bien à l''écoute de ce qui est dit au talkie cela te concerne peut être.</div></div><div><br></div><div><b><u>IMPORTANT :</u></b></div><div><ul><li><b><u>NE TE MET PAS EN DANGER (si le mec est un peu aigri laisse le&nbsp;tâter&nbsp;de la vauban et écarte toi)</u></b><br></li><li><b><u>NE QUITTE PAS TON POSTE TANT QUE LES SUIVANTS NE SONT PAS ARRIVES</u></b><br></li></ul><div><b><u><br></u></b></div></div><div>En cadeau voici les paroles de Petit Poney &nbsp;:</div><p></p><p style="font-size: 11px; line-height: 15px; padding: 5px 0px; margin: 5px 0px; color: rgb(51, 51, 0); font-family: Verdana; text-align: justify;">[Refrain]<br>Petit poney, petit poney, tu es tout gris et tout petit, petit poney, petit poney.<br>Petit poney, petit poney, tu es tout gris et tout petit, petit poney, petit poney.</p><div><p style="font-size: 11px; line-height: 15px; padding: 5px 0px; margin: 5px 0px; color: rgb(51, 51, 0); font-family: Verdana; text-align: justify;">Petit poney, petit poney, tu gambades dans les prés sans te soucier du temps qui passe, petit poney, petit poney<br>La nuit qui tombe sur le pré c''est aussi ça la vie qui passe, petit poney, petit poney.</p><p style="font-size: 11px; line-height: 15px; padding: 5px 0px; margin: 5px 0px; color: rgb(51, 51, 0); font-family: Verdana; text-align: justify;">[Refrain]</p><p style="font-size: 11px; line-height: 15px; padding: 5px 0px; margin: 5px 0px; color: rgb(51, 51, 0); font-family: Verdana; text-align: justify;">Tu gambades dans les prés sans te soucier du temps qui passe, petit poney, petit poney<br>La nuit qui tombe sur le pré c''est aussi ça la vie qui passe, petit poney, petit poney</p><p style="font-size: 11px; line-height: 15px; padding: 5px 0px; margin: 5px 0px; color: rgb(51, 51, 0); font-family: Verdana; text-align: justify;">[Refrain] (x3)</p><p style="font-size: 11px; line-height: 15px; padding: 5px 0px; margin: 5px 0px; color: rgb(51, 51, 0); font-family: Verdana; text-align: justify;">Tu gambades dans les prés sans te soucier du temps qui passe, petit poney, petit poney<br>La nuit qui tombe sur le pré c''est aussi ça la vie qui passe, petit poney, petit poney</p><p style="font-size: 11px; line-height: 15px; padding: 5px 0px; margin: 5px 0px; color: rgb(51, 51, 0); font-family: Verdana; text-align: justify;">[Refrain]</p><p style="font-size: 11px; line-height: 15px; padding: 5px 0px; margin: 5px 0px; color: rgb(51, 51, 0); font-family: Verdana; text-align: justify;">Tu gambades dans les prés sans te soucier du temps qui passe, petit poney, petit poney<br>Et puis un jour un loup arrive avec 3 feuilles de salades il va manger le quadrupède.</p><p style="font-size: 11px; line-height: 15px; padding: 5px 0px; margin: 5px 0px; color: rgb(51, 51, 0); font-family: Verdana; text-align: justify;">[Refrain] (x2)</p></div>', 'De la bonne humeur\r\nUne cuillère de patience\r\nDu charisme', 0, 'PS1', 3, 'raf'),
(234, 28, 385, NULL, 'Installer la Slack Line', '<p></p><ul><li>Retrouver le resp Guerric au QG orga (<span style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">0604476430)</span></li><li><span style="background-color: rgb(255, 255, 255); color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;">Aller chercher au dépôt humas 2 rouleaux de moquettes, la slack-line et les matelas de gym&nbsp;</span><span style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">et les déposer sur l''animation</span><br></li><li><span style="background-color: rgb(255, 255, 255); color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;">Si besoin, aller chercher des matelas dans la salle dodo dans la rotonde et les déposer sur l''animation</span></li><li><span style="background-color: rgb(255, 255, 255);"><font color="#333333" face="Helvetica Neue, Helvetica, Arial, sans-serif"><span style="font-size: 14px; line-height: 20px;">Installer le tout (une&nbsp;épaisseur&nbsp;de moquette, des matelas, une épaisseur de moquette) et la slack line</span></font></span></li><li><span style="background-color: rgb(255, 255, 255); color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;">Repartir en chantant&nbsp;</span><br></li></ul><p></p>', NULL, 0, 'Pelouse Rotonde', 3, 'non'),
(235, 28, 385, NULL, 'Ranger la Slack Line', '<p></p><ul><li>Rends toi à la pelouse derrière la rotonde, là où il y a le mur d''escalade et retrouve le resp Guerric (0604476430)<br></li><li>Démonte la slack et ramène la au dépôt humas avec les 2 rouleaux de moquettes et la signa<br></li><li>Ramène les 5 matelas au QG orga salle dodo<br></li><li>Bravo, tu as gagné une pause de 5 minutes sur les canapés du QG</li></ul><div><br><div><br></div></div><p></p>', NULL, 0, 'Pelouse Rotonde', 3, 'non'),
(236, 16, 384, NULL, 'PS1 : Point Sécu', '<ol><li>Rends toi au PS1&nbsp;&nbsp;(Bd Laurent Bonnevay côté CPE)&nbsp;</li><li>Récupère le gilet jaune et le talkie de l''équipe précédente</li><li>Demande l''Humain au talkie et préviens que tu es bien en poste</li></ol><div>Ta mission : Assurer la sécurité du festival et des courses en ne laissant entrer aucun véhicule excepté :<br></div><p></p><ul><li>Les véhicules des secours (Pompiers, Police, etc..)<br></li><li>Les véhicules munis d''un pass sécu <u>pour le PS1</u></li><li>Les coureurs AVANT le samedi matin 10h dont la liste te sera fournie</li></ul><div>Un exemple de pass sécu et l''autorisation de fermeture du campus sont disponibles sur place.<br><br></div><div>En cas de problème / de doute demande le responsable sécurité au Talkie.&nbsp;N''hésite pas à prévenir de tout comportement anormaux.<br>Si le talkie bip demande qu''on t''amène une batterie.<br>Si le talkie ne passe pas téléphone au 06.59.90.44.19 ou au 06.76.99.09.64<br>En cas d''urgence appel directement le PC sécu : 04.72.43.70.70</div><div>Reste bien à l''écoute de ce qui est dit au talkie cela te concerne peut être.</div><div><br></div><div><b><u>IMPORTANT :</u></b></div><div><ul><li><b><u>NE TE MET PAS EN DANGER (si le mec est un peu aigri laisse le&nbsp;tâter&nbsp;de la vauban et écarte toi)</u></b><br></li><li><b><u>NE QUITTE PAS TON POSTE TANT QUE LES SUIVANTS NE SONT PAS ARRIVES</u></b><br></li></ul><div><b><u><br></u></b></div></div><div>En cadeau voici les paroles de Petit Poney &nbsp;:</div><p></p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">[Refrain]<br>Petit poney, petit poney, tu es tout gris et tout petit, petit poney, petit poney.<br>Petit poney, petit poney, tu es tout gris et tout petit, petit poney, petit poney.</p><div><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">Petit poney, petit poney, tu gambades dans les prés sans te soucier du temps qui passe, petit poney, petit poney<br>La nuit qui tombe sur le pré c''est aussi ça la vie qui passe, petit poney, petit poney.</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">[Refrain]</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">Tu gambades dans les prés sans te soucier du temps qui passe, petit poney, petit poney<br>La nuit qui tombe sur le pré c''est aussi ça la vie qui passe, petit poney, petit poney</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">[Refrain] (x3)</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">Tu gambades dans les prés sans te soucier du temps qui passe, petit poney, petit poney<br>La nuit qui tombe sur le pré c''est aussi ça la vie qui passe, petit poney, petit poney</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">[Refrain]</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">Tu gambades dans les prés sans te soucier du temps qui passe, petit poney, petit poney<br>Et puis un jour un loup arrive avec 3 feuilles de salades il va manger le quadrupède.</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">[Refrain] (x2)</p></div>', 'De la bonne humeur\r\nUne cuillère de patience\r\nDu charisme', 0, 'Campus', 3, 'non (raf)'),
(237, 16, 384, NULL, 'PS1 : Désintallation', '<ol><li>Rends toi au PS1&nbsp;&nbsp;(Bd Laurent Bonnevay côté CPE)&nbsp;</li><li>Récupère le gilet jaune et le talkie de l''équipe précédente</li><li>Demande l''humain au talkie et préviens que tu est bien en poste.</li></ol><div>Ta mission : Assurer la sécurité du festival et des courses en ne laissant passer aucun véhicule excepté :<br></div><p></p><ul><li>Les véhicules des secours (Pompiers, Police, etc..)<br></li><li>Les véhicules muni d''un passe sécu POUR LE PS1</li></ul><div>Un exemple de pass sécu et l''autorisation de fermeture du campus sont disponible sur place.<br></div><div><br></div>En cas de problème / de doute demande le responsable sécurité au Talkie.&nbsp;N''hésite pas à prévenir de tout comportement anormaux. Si le talkie bip demande qu''on t''amène une batterie.<br>Si le talkie ne passe pas téléphone au 06.59.90.44.19 ou au 06.76.99.09.64<div>En cas d''urgence appel directement le PC sécu : 04.72.43.70.70</div><div>Reste bien à l''écoute de ce qui est dit au talkie cela te concerne peut être.</div><div><br></div><div>A la fin de ta tache Dimanche à miniut:</div><div><ol><li>Préviens au talkie que tu va partir</li><li>Ouvre le passage en poussant les barrières sur la coté de la route.&nbsp;<br></li><li>Rentre au QG.<br></li><li>Dépose ton talkie et les gilets<br></li></ol></div><div><br></div><div><b><u>IMPORTANT :</u></b></div><div><ul><li><b><u>NE TE MET PAS EN DANGER (si le mec est un peu aigri laisse le&nbsp;tâter&nbsp;de la vauban et écarte toi)</u></b></li></ul><div><b><u><br></u></b></div></div><div>En cadeau voici les paroles de Petit Poney &nbsp;:</div><p></p><p style="font-size: 11px; line-height: 15px; padding: 5px 0px; margin: 5px 0px; color: rgb(51, 51, 0); font-family: Verdana; text-align: justify;">[Refrain]<br>Petit poney, petit poney, tu es tout gris et tout petit, petit poney, petit poney.<br>Petit poney, petit poney, tu es tout gris et tout petit, petit poney, petit poney.</p><div><p style="font-size: 11px; line-height: 15px; padding: 5px 0px; margin: 5px 0px; color: rgb(51, 51, 0); font-family: Verdana; text-align: justify;">Petit poney, petit poney, tu gambades dans les prés sans te soucier du temps qui passe, petit poney, petit poney<br>La nuit qui tombe sur le pré c''est aussi ça la vie qui passe, petit poney, petit poney.</p><p style="font-size: 11px; line-height: 15px; padding: 5px 0px; margin: 5px 0px; color: rgb(51, 51, 0); font-family: Verdana; text-align: justify;">[Refrain]</p><p style="font-size: 11px; line-height: 15px; padding: 5px 0px; margin: 5px 0px; color: rgb(51, 51, 0); font-family: Verdana; text-align: justify;">Tu gambades dans les prés sans te soucier du temps qui passe, petit poney, petit poney<br>La nuit qui tombe sur le pré c''est aussi ça la vie qui passe, petit poney, petit poney</p><p style="font-size: 11px; line-height: 15px; padding: 5px 0px; margin: 5px 0px; color: rgb(51, 51, 0); font-family: Verdana; text-align: justify;">[Refrain] (x3)</p><p style="font-size: 11px; line-height: 15px; padding: 5px 0px; margin: 5px 0px; color: rgb(51, 51, 0); font-family: Verdana; text-align: justify;">Tu gambades dans les prés sans te soucier du temps qui passe, petit poney, petit poney<br>La nuit qui tombe sur le pré c''est aussi ça la vie qui passe, petit poney, petit poney</p><p style="font-size: 11px; line-height: 15px; padding: 5px 0px; margin: 5px 0px; color: rgb(51, 51, 0); font-family: Verdana; text-align: justify;">[Refrain]</p><p style="font-size: 11px; line-height: 15px; padding: 5px 0px; margin: 5px 0px; color: rgb(51, 51, 0); font-family: Verdana; text-align: justify;">Tu gambades dans les prés sans te soucier du temps qui passe, petit poney, petit poney<br>Et puis un jour un loup arrive avec 3 feuilles de salades il va manger le quadrupède.</p><p style="font-size: 11px; line-height: 15px; padding: 5px 0px; margin: 5px 0px; color: rgb(51, 51, 0); font-family: Verdana; text-align: justify;">[Refrain] (x2)</p></div>', 'De la bonne humeur\r\nUne cuillère de patience\r\nDu charisme', 0, 'Campus', 3, 'non (raf)');
INSERT INTO `Tache` (`id`, `responsable_id`, `groupetache_id`, `importid`, `nom`, `consignes`, `materielSupplementaire`, `permisNecessaire`, `lieu`, `statut`, `commentaireLog`) VALUES
(238, 16, 387, NULL, 'Barrièrage Zone Nord', '<p>Rejoins le Poulpe et Cheval sur le rond point au nord de la piscine.<br></p><p>Il faut leur filer un coup de main pour le barrièrage en suivant le marquage au sol.<br></p><p>On va se répartir en équipe :</p><ul><li>Equipe 1 : Mise en place des plots sur les marques au sol.</li></ul><ul><li>Equipe 2 : Mise en place des Héras et des vaubans en suivant les plots.</li></ul><ul><li>Equipe 3 : Mise en place des colliers (bien les serrer depuis l’intérieur du barrièrage.)</li></ul>N''oublie pas ta bonne humeur et une paire de gants si tu en as. Et surtout : plus vite on avance et plus vite ce sera fini !<br><div><br></div><div><br></div><p><br></p>', 'Du charisme\r\nDes bras musclés\r\nDe la bonne humeur\r\nDes conducteurs de fen (autres que Cheval)', 0, 'ZC Nord', 3, 'non'),
(239, 16, 384, NULL, 'Tour briefing des Points Sécu', '<p>RDV au QG Orga<br><br>Récupère si besoin des fiches briefings, des gilets, ou une photocopie de l''arrêté de fermeture du campus.<br>Prend des bouteilles d''eau<br><br>Prends un voiture<br>Rentre dans la voiture avec ton pote<br>Va faire le tour des points sécu :&nbsp;<br></p><ul><li>Remettez les barrières dans le bon sens<br></li><li>Briefe les orga sur place</li><li>Donne de l''eau<br></li><li>Fait leur un bizou</li></ul><div>Rentre au QG</div><div></div><p></p>', 'Des bizoux (x100)\r\n150g de farine de blé noir\r\nTa bite\r\nTon coutal', 1, 'QG Orga', 3, 'raf'),
(240, 228, 388, NULL, 'Ouverture Olivier', '<p>-Va au QG orga</p><p>- Récupère les clefs de l''olivier (<span style="background-color: rgb(255, 255, 255);">Si la porte de RdC de la MdE est fermée, a</span><span style="background-color: rgb(255, 255, 255);">ppelle le troll au&nbsp;</span><a href="tel:0661411517" value="+33661411517" target="_blank" style="color: rgb(17, 85, 204); background-color: rgb(255, 255, 255);">0661411517</a><span style="background-color: rgb(255, 255, 255);">&nbsp;pour qu''il vienne l’ouvrir depuis l''étage)</span></p><p>-Ouvre l''olivier pour les anims qui attendent</p><p>- Dis bien à chaque asso s''ils sont à l''olivier ou au grillon<br></p><p>-Aide les éventuellement à installer leurs anims<br>-Ramène les clés au QG orga<br></p><p><br></p>', 'Clés de l''olivier', 0, 'Olivier', 3, 'raf'),
(241, 228, 388, NULL, 'Tour des Anims Olivier', '<p>Faire le tour des anims à l''olivier </p>', NULL, 0, 'Olivier', 3, 'non'),
(242, 16, 389, NULL, 'Permanence sécu', '<ul><li>Aller au QG Sécu</li><li>Brancher le video proj</li><li>Lancer "Les Tontons Flingueurs" parce qu''il faut bien que quelqu''un les regarde pendant la manif</li><li>Gueuler de temps en temps au talkie pour faire chier le monde</li><li>Si quelqu''un t''appelle répondre : "C''est noté on s''en occupe" même si t''as pas compris et que tu t''en occupes pas du tout.<br></li></ul><p></p>', NULL, 0, 'QG Sécu', 3, 'non'),
(243, 48, 391, NULL, 'Accueillir les intervenants', '<p>Accueillir les intervenants de la LCVR</p><div><br></div><div>Les amener jusqu''à l''emplacement de la voiture tonneau, devant l''accueil, sur la pelouse freyssinet.</div><div><br></div><div>Les aider à monter le stand s''ils ont besoin.</div><div><br></div><div>Expliquer le déroulement de la journée et leur souhaiter une bonne journée après leur avoir donné le numéro du resp (Lapinette 06 83 94 25 97).<br></div><p></p>', NULL, 0, 'Devant le bar bouffe pour l''elec', 3, 'non'),
(244, 194, 391, NULL, 'Chercher les barrières et les chaises', '<p>Rends toi au dépôt de barrières entre les humas et la kfet et ramène les 26 vaubans devant l''accueil, là où sera le stand de la voiture tonneau, sur la pelouse freyssinet.</p><div><br></div><div>Bien sûr fais le en plusieurs voyages!</div><div><br></div><div>Va chercher 2 chaises pour les intervenants au dépôt AIP et ramène les au même endroit.</div><div><br></div><div>Tu peux retourner au QG Orga voir si quelqu''un a besoin de toi!</div><p></p>', NULL, 0, 'Devant le bar bouffe', 3, 'non'),
(245, 212, 373, NULL, 'rangement toboggan', '<p>Démontage de la structure du toboggan de la mer</p><p>- Rends toi sur la pelouse des Humas au niveau du toboggan de la mer entre GCU et l''AIP</p><p>- Dégonfle la structure.&nbsp;<br></p><p>-Récupère tous les petits éléments (sardines, soufflerie ...) et vérifie sur la liste du matos que vous n''avez rien oublié.&nbsp;</p><p>-Ramène les 7 barrières vaubans au dépôt barrières (derrière la kfet)</p><p>-Ramène le kit des petits éléments au QG de l''ambiance et déplace correctement (pour que ceux qui devront la remonter le lendemain n''ait pas trop de mal) la structure gonflable du toboggan derrière la grande scène sur la pelouse des humas sans qu''elle gène.<br></p><p>-Ramène la rallonge au &nbsp;dépôt AIP&nbsp;</p><p>- Maintenant occupe toi du chateau gonflable. Même principe: ranger les vaubans, récupérer les petits éléments et vérifier la liste du matos, ramener la rallonge</p><p>- Ramène la structure au dépôt AIP par contre et pas derrière la scène</p><p>En cas de problème : Constant 06 82 82 41 26</p><div><br></div>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(246, 194, 391, NULL, 'Ramener les barrières et les chaises', '<p>Va chercher les barrières sur le stand de la voiture tonneau, devant l''accueil, sur la pelouse&nbsp;</p><div>Freyssinet et ramène les au dépôt de... barrières, entre la kfet et les humas.</div><div><br></div><div>Ramener les chaises au dépôt AIP dans la joie et la bonne humeur!</div><div><br></div><div>Remercier les intervenants pour leur intervention!</div><div><br></div><div>Retourne au QG Orga voir si on a besoin de toi!</div><div><br></div><div><br></div><div><br></div><p></p>', 'Des muscles', 0, 'Devant le bar bouffe', 3, 'non'),
(247, 212, 373, NULL, 'rangement toboggan dimanche', '<p>Démontage de la structure du toboggan de la mer</p><p>- Rends toi sur la pelouse des Humas au niveau du toboggan entre GCU et l''AIP</p><p>- Attends que l''orga hard vienne dégonfler la structure<br></p><p>- Ramène la rallonge à l''AIP</p><p>- Ramène le compresseur au dépôt AIP</p><p>-Récupérer tous les petits éléments (sardines, soufflerie ...) et vérifier sur la liste du matos que vous n''avez rien oublié.&nbsp;</p><p>-Ramener les 7 barrières Vaubans au dépôt barrières (derrière la kfet)</p><p>-Ramener le kit des petits éléments au dépôt AIP et déplacer correctement (pour ne pas énerver le presta qui viendra le récupérer le lendemain) la structure gonflable du toboggan derrière la grande scène sur la pelouse des humas sans qu''elle gène.<br></p><p><br></p>En cas de problème : Constant 06 82 82 41 26', NULL, 0, 'Pelouse des Humas', -1, 'non'),
(248, 212, 373, NULL, 'gérer le toboggan de la mer', '<p></p><div>Se rendre sur le stand toboggan de la mer (humas&nbsp;devant&nbsp;GCU)<br><br></div><div><div><b>Public autorisé</b>&nbsp;: De 3 à 12 ans.<br></div><div><br></div><div>Essayez de respecter ces consignes (surtout la capacité parce l''âge c''est pas toujours facile de savoir ^^) car si y a un problème, on est dans la merde si on respecte pas ces deux critères:</div><div><br></div><div>Obligez les&nbsp;mômes&nbsp;à enlever leur&nbsp;chaussures&nbsp;avant de monter sur le toboggan.<br></div><div><br></div><div>Ne pas laisser plus de 8 personnes en même temps sur le toboggan!!!!!!!</div><div><br></div><div>Laisser les enfants batifoler, faire des gazoullis en tout genre. Faîtes les faire 3 descentes.</div><div><br></div><div>Selon l''attente, adaptez le nombre de descentes...</div><div><br></div><div>Jetez un coup d’œil si des enfants vraiment en bas âges participent, histoire qu''ils ne se prennent pas un ado de 12 ans sur la gueule.</div><div>Attention à ce que les gens descendent pas en même temps pour pas qu''ils se rentrent dans la gueule.</div><div>Canalisez bien les gens en formant une file d''attente avec les barrières. Soyez attentif à ce que la file d''attente soit bien faite et qu''il n''y ait personne qui passe devant d''autres!</div></div><div><br></div><div><b>IMPORTANT</b>: Ne Jamais Laisser l''Anim Toute Seule<br><br></div>En cas de&nbsp;problème: Constant 06 82 82 41 26<p></p>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(249, 212, 373, NULL, 'Tâche sans nom', 'juste', NULL, 0, 'Pelouse des Humas', -1, 'non'),
(250, 212, 392, NULL, 'installation baby-foot samedi', '<div>- Aller chercher 3 vaubans au dépôt barrières (derrière la kfet)<br>- Récupérer du scotch, de la rubalise et des ciseaux au QG de l''ambiance (orga)</div><div>- Rends-toi sur les humas (devant GMC) au niveau de l''anim&nbsp;<b style="text-decoration: underline;">BABY FOOT</b>&nbsp;(qui sera déjà montée)<br></div><div>- Mettre 3 barrières autour de la soufflerie du jeu gonflable&nbsp;</div><div>- Vérifier que tout est bien en place pour la journée<br></div><p>- Attends la relève de 10h qui commencera à animer le stand. Te barre pas si ils sont pas arrivés.</p><p>- Ramène le scotch et la rubalise au QG de l''ambiance<br></p><div>En cas de problème : Constant 06 82 82 41 26</div>', NULL, 0, 'Pelouse des Humas', 3, 'raf'),
(251, 212, 392, NULL, 'installation baby-foot dimanche', '<div><br></div><div>-Aller chercher 3 vaubans au dépot barrière (derrière la kfet)<br>-Récupérer du scotch, de la rubalise et des ciseaux au QG de l''ambiance (orga) et bien sûr le plus important le kit du jeu&nbsp;<u><b>BABY FOOT</b></u>au dépôt AIP<br></div><div>- Rends-toi sur les humas à l''endroit où est prévue l''animation (Vers GMC)</div><div>- Monter le jeu gonflable en suivant la notice qui sera avec le compresseur (brancher la soufflerie avec la rallonge à récupérer au dépôt AIP)</div><div>- Mettre 3 barrières autour de la soufflerie du jeu gonflable&nbsp;</div>- Vérifier que tout est bien en place pour la journée et attends que la relève arrive à 10h<div>-Ramène le scotch et la rubalise au QG de l''ambiance<br><p></p><p>En cas de problème : Constant 06 82 82 41 26</p>&nbsp;</div>', NULL, 0, 'Pelouse des Humas', 3, 'non (raf)'),
(252, 212, 392, NULL, 'rangement baby-foot samedi', '<p>Rangement du Baby Foot Humain<br><br></p><p>Rends toi sur la pelouse des humas devant GMC</p><div><div>- Dégonfle la structure et laisse la à son emplacement sans prendre trop de place&nbsp;</div><div>- Ramène le compresseur et la rallonge au dépôt AIP<br>-Récupère tous les petits éléments (sardines ...) et vérifier sur la liste du matos que vous n''avez rien oublié.&nbsp;<u><br></u>- Ramène au dépôt AIP le kit des petits éléments. Vérifier que vous n’avez rien oublié.<br></div><div>- Ramène les 3 barrières vaubans au dépôt barrières (derrière la kfet).<br></div><div><br><br>en cas de problème : Constant 06 82 82 41 26<br></div></div><div><br></div>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(253, 212, 392, NULL, 'rangement baby-foot dimanche', '<p>Rangement du Baby Foot Humain<br>Rends toi sur la pelouse des humas devant GMC<br></p>- Dégonfle la structure en suivant scrupuleusement (de manière scrupuleuse) la notice&nbsp;<div>- Ramène le compresseur et la rallonge au dépôt AIP<br><div><div>- Ramène les 3 barrières vaubans au dépôt barrières (derrière la kfet).<br></div>-Ramène la structure derrière la scène en en prenant bien soin pour pas que le presta se fâche tout rouge le lendemain matin.<br><br>en cas de problème : Constant 06 82 82 41 26</div></div>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(254, 212, 392, NULL, 'gérer le baby-foot', '<p>Se rendre sur la pelouse des Humas au niveau de l''animation Babyfoot humain (devant GMC).</p><div><br>Match au temps : Environ 10min. Adapter le temps de jeu en fonction de l''attente qu''il y a.<br>Canalisez bien les gens dans la file d''attente entre les barrières. Soyez attentif à ce que la file d''attente soit bien&nbsp;faite et qu''il n''y ait personne qui passe devant d''autres!<br><br>IMPORTANT: Ne Jamais Laisser L''Anim Toute Seule<br><div>En cas de&nbsp;problème: Constant 06 82 82 41 26</div></div><p></p>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(255, 212, 393, NULL, 'installation joutes samedi', '<p></p><div>- Aller chercher 7 vaubans au dépot barrières (derrière la kfet)<br>- Récupérer du scotch et des ciseaux et de la rubalise au QG de l''ambiance (orga)</div><div>- Rends-toi sur les humas au niveau de l''anim&nbsp;<b style="text-decoration: underline;">JOUTES MOUVANTES</b>&nbsp;(qui sera déjà montée) : entre GMC et GI<br></div><div>- Mettre 3 barrières autour de la soufflerie du jeu gonflable et mets en place une file d''attente avec les autres barrières et la rubalise&nbsp;</div><div>- Verifier que tout est bien en place pour la journée<br></div><div>- Attendre les potes qui arrivent à 10h. Ne pas laisser la structure toute seule, la pauvre :''(<br><div>- Ramène la rubalise et le scotch au QG de l''ambiance</div><div><br>En cas de problème : Constant 06 82 82 41 26</div> </div><p></p>', NULL, 0, 'Pelouse des Humas', 3, 'raf'),
(256, 31, 394, NULL, 'Barrièrage Circuit', '<p>Mais le barrièrage c''est quoi &nbsp;??</p><div><br></div><div>Ah Ah!</div><div><br></div><div>Le barrièrage c''est de la ferraille à trimbaler et à emboîter habilement &nbsp;tout ça dans la joie et la bonne humeur!</div><div><br></div><div>Pour cette tache qui t''incombe tu dois :</div><div><span class="Apple-tab-span" style="white-space:pre">	</span>- Te rendre&nbsp;au QG orga (la rotonde). Tu y retrouvera Ron (si il est pas là demande au gentil&nbsp;humain ou il est ;) ).&nbsp;</div><div><span class="Apple-tab-span" style="white-space:pre">	</span>- Aller chercher un 20 m^3<br></div><div><span class="Apple-tab-span" style="white-space:pre">	</span>-Commencer la fermeture du circuit suivant un ordre bien précis</div><div><br></div><div><div>20h-20h30 : Sud Ouest</div><div>20h30-21h : Nord Ouest</div><div>21h-21h30 : Bat F (Virage Niels Bohr)</div><div>21h30-22h : N-Est<br></div><div>22h-22h30 : Avenue des arts des Arts<br>22h30-23h : Bat H</div></div><div><br></div><div><ul><li>Poser des flyers "Stationnement Gênant" sur les véhicules gênants. Noter les&nbsp;véhicules&nbsp;gênants</li><li>Faire un tour de verif à la toute fin</li><li>Se faire déposer au QG Orga à la fin de ton&nbsp;créneau et rendre les clés du camion<br></li></ul></div><div><u>petit + pour ton créneau :</u></div><div><br></div><div>Prend des gants pour pas trop te pourrir les mains ! Ron en aura peut être mais pas pour tout le monde !</div><p></p>', 'La joie, des bras et la bonne humeur', 1, 'QG orga', 3, 'non'),
(257, 212, 393, NULL, 'installation joutes dimanche', '<p></p><div>- Aller chercher 7 vaubans au dépot barrières (derrière la kfet),&nbsp;<br>- Récupérer du scotch, de la rubalise et des ciseaux au QG de l''ambiance et bien sûr le plus important le kit du jeu les&nbsp;<u><b>JOUTES MOUVANTES&nbsp;</b></u>dans le&nbsp;dépôt&nbsp;AIP</div><div>- Rends-toi sur les humas à l''endroit où est prévu l''animation (vers GMC)</div><div>- Monter le jeu gonflable en suivant la notice (brancher la soufflerie avec la rallonge que tu seras allé chercher au dépôt AIP)<br></div><div>- Mettre 3 barrières autour de la soufflerie du jeu gonflable et mets en place une file d''attente avec les autres barrières et la rubalise</div><div>- Verifier que tout est bien en place pour la journée</div><div>- Attendre l''arrivée des gentils personnes qui viendront prendre votre place à 10h. Ne pas laisser l''animation sans surveillance</div><div>- Ramener le scotch et la rubalise au QG de l''ambiance</div><div><br>En cas de problème : Constant 06 82 82 41 26</div><p></p>', '#ambiance <3\r\n(tu m''aimes là nan ? ^^)', 0, 'Pelouse des Humas', 3, 'non (raf)'),
(258, 212, 393, NULL, 'rangement joutes samedi', '<p>Rends toi sur la pelouse des humas vers GI<br></p><div><div><br></div><div>-Attends que l''orga vienne dégonfler la structure et &nbsp;laisse à son emplacement sans prendre trop de place.&nbsp;Récupérer&nbsp;tous les petits éléments (sardines ...) et vérifier sur la liste du matos que vous n''avez rien oublié.&nbsp;</div><div>- Ramener la rallonge à l''AIP et le compresseur aussi<br>- Ramener au dépôt AIP le kit des petits éléments. Vérifier que vous n’avez rien oublié.</div><div>- Ramener les 7 barrières vaubans au dépôt barrières (derrière la kfet).<br></div><div>- Trouve le reste des softs qui démontent les animations gonflables sur la pelouse des Humas pour qu''ils viennent t''aider à porter la structure derrière la scène&nbsp;</div><div><br><br>en cas de problème : Constant 06 82 82 41 26</div></div>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(259, 212, 393, NULL, 'rangement joutes dimanche', '<p>Rends toi sur la pelouse des humas vers GMC et trouve les joutes (normalement on les a pas cachées)<br></p><br>- ranger l''anim en vérifiant que vous n''avez rien oublié.&nbsp;<div>- ramener le compresseur et la rallonge à l''AIP<br><div>- un orga tout mignon viendra dégonfler la structure (il a beaucoup de souffle)<br><div>- Ramener les 7 barrières vaubans au dépôt barrières (derrière la kfet)<br></div><div>- Une fois que c''est fait (et seulement après) il va falloir la déplacer. Trouve le reste des softs qui rangent les autres anims gonflables sur la pelouse des Humas pour qu''ils t''aident à porter la structure derrière la grande scène</div><br>en cas de problème : Constant 06 82 82 41 26</div></div>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(260, 212, 393, NULL, 'gérer les joutes', '<p>-Te rendre sur la pelouse des humas pour prendre ton poste à l''anim des joutes : vers GMC<br></p><p>-Obliger les&nbsp;gens à enlever leurs chaussures&nbsp;avant de monter sur les joutes</p><p>-Faire monter 2 personnes à la fois sur l''anim<br></p><div>-Faire un match en 3 points gagnants (quand le mec tombe = 1pt). Adapter le temps de jeu en fonction du monde dans la queue</div><div><br></div><div>IMPORTANT: Ne Jamais Laisser L''Anim Toute Seule<br><br></div><div>En cas de&nbsp;problème: Constant 06 82 82 41 26</div>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(261, 220, 395, NULL, 'Accueillir le sandball et les installer', '<p><b>Jean-Baptiste Frigo - 06 79 58 01 20</b></p><p>(-Aller au QG orga récupérer les clés du gymnase C)<br></p><p>-Aller au dépôt AIP récupérer un caddie</p><p>-Aller au gymnase C prendre 4 cages gonflables et 2 ballons de sandball (1ere porte à gauche dans le gymnase)<br></p><p>-Aller au terrain de beach volley derrière le Premier Cycle<br>-Accueillir les joueurs et les aider à installer le terrain<br>-Vérifier qu''ils ont tout ce qu''il faut, et leur souhaiter une bonne animation<br>-Leur fournir le numéro du PC sécu (en cas d''accident) : <span style="font-family:arial,sans-serif;font-size:13px">04 72 43 70 70 ou&nbsp;</span><span style="font-family:Arial,sans-serif;font-size:11pt">04 72 43 60 00</span><br></p><p><span style="font-family:Arial,sans-serif;font-size:11pt">-Ramener le caddie au dépot AIP</span></p><p><span style="font-family:Arial,sans-serif;font-size:11pt">(-Ramener les clés au QG orga)<br></span></p>', NULL, 0, 'Terrain de beach volley', 3, 'non'),
(262, 220, 395, NULL, 'Dire au revoir au sandball et ranger', '<p>-Aller au dépot AIP prendre un caddie</p><p>-Aller au terrain de beach volley derrière le Premier Cycle<br>-Remercier les joueurs, leur demander si tout s''est bien passé...<br>-Les aider à ranger&nbsp;</p><p>-"A l''année prochaine!"</p><p>-Ramener les 4 cages et les 2 ballons au dépôt AIP avec le caddie</p>', NULL, 0, 'Terrain de beach volley', 3, 'non'),
(263, 210, 396, NULL, 'Installer l''animation de magie', '<p></p><ul><li>Rends toi au dépôt des Humas et récupère 1 nappe tissus</li></ul><ul><li>Emmène-la à l''Olivier (bâtiment MDE)</li><li>Installe 2 chaises derrière une table et mets la nappe sur la table.&nbsp;</li><li>Retrouve Magic Pic (Paul Caillau 06 59 51 04 16) devant l''Olivier.</li><li>Remercie-les de tenir ce stand ! et aide les à s''installer si besoin.</li></ul><ul><li>Tu es libre :)</li></ul><div>En cas d''embrouilles, contacte Morgane 06 70 11 59 48</div><p></p>', '1 nappe en tissus', 0, 'Dépôt des Humas', 3, 'non'),
(264, 54, 397, NULL, 'Accueil INSA et ASVEL', '<p><b style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">Pierre Durand - 0668038261</b><br></p><p>Aller au Gymnase B</p><p>-Vérifier que tout va bien</p><p>-renseigner Pierre Durand sur la Sécurité : Numero :&nbsp;<span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">&nbsp;04 72 43 70 70 ou&nbsp;</span><span style="color: rgb(34, 34, 34); background-color: rgb(255, 255, 255); font-family: Arial, sans-serif; font-size: 11pt;">04 72 43 60 00</span></p><p><br></p>', NULL, 0, 'Gymnase B', 3, 'non'),
(265, 54, 397, NULL, 'Au revoir anciens', '<p></p><div>-Aller au gymnase B</div><div><br></div><div>-dire au revoir aux équipes</div><div><br></div><div>-les remercier&nbsp;</div><div><br></div><div>(Mr durant s''occupe de fermer , il a les clés)</div><p></p>', NULL, 0, 'Gymnase B', 3, 'non'),
(266, 21, 324, NULL, 'Tâche sans nom', 'bite', NULL, 0, 'QG Orgras', -1, 'non'),
(267, 194, 398, NULL, 'Installer le stand Avenir Santé et RuptureS', '<p>-Se rendre près de l''entrée, à l''intérieur</p><p>-Aller chercher la tente, les tables et chaises au dépôt AIP.</p><p>-Les installer sur le lieu du stand.</p><p>-Rendre compte au responsable, et aller à sa prochaine tâche (ou aller au QG orga si on n''a rien à faire).<br></p>', 'Multiprise à installer et raccorder', 0, 'Entrée, à l''intérieur', 3, 'non'),
(268, 213, 332, NULL, 'Installation des Jeux en Bois', '<p>Va au dépôt AIP, tu y trouveras:</p><p>-4 tables (format deux personnes)</p><p>-2 chaises<br></p><p>-Les 9 jeux en bois, ainsi qu''une notice explicative de leur fonctionnement</p><p>-------------------------------------------------------------------</p><p>Va sur la pelouse des Humas à l''intersection entre les 2 routes devant le département GCU.<br></p><div>Installe les jeux en bois (laisse libre cours à ton imagination, mais veille à ce que le matériel ne puisse pas s’abîmer au cours de la journée :) )</div><div>Attends la relève de 10h, ne pars pas avant qu''ils arrivent.&nbsp;<br></div><div>-------------------------------------------------------------------</div><div><u>Informations supplémentaires:</u></div><div>-Ne laisse jamais le matériel sans surveillance (il faut toujours quelqu''un avec celui-ci)<br></div><div>-Numéro de Romain si nécessaire: 06 36 94 28 11</div>', NULL, 0, 'Dépôt AIP', 3, 'non'),
(269, 194, 398, NULL, 'Démonter le stand Avenir Santé et Ruptures', '<p>-Se rendre près de la sortie, à l''intérieur, au stand prévention<br></p><p>-Prendre la tente, les tables et chaises, et les déposer au dépôt AIP.</p>-Rendre compte au responsable (George : 06 45 29 97 20) , et aller à sa prochaine tâche (ou aller au QG orga si on n''a rien à faire).', NULL, 0, 'Entrée, à l''intérieur', 3, 'non'),
(270, 213, 332, NULL, 'Rangement des Jeux en Bois (Dimanche)', '<p>- Retrouver l''animation "jeux en bois" sur la pelouse des Humas, à l''intersection des deux routes devant GCU.</p><p>- Rassembler les jeux.<br></p><div>- Ranger les 4 tables et les 2 chaises au dépot AIP.</div><div><br></div><div>- Rassembler les jeux en bois dans le dépôt AIP. Ne pas oublier les règles des jeux (en 2 exemplaires) avec ceux-ci.</div><div><br></div><div>- Expliquer à Constant où les jeux sont.</div><div><br></div><div><br></div><div>-----------------</div><div>- Appeler Romain en cas de souci : 06 36 94 28 11<br></div>', NULL, 0, 'Pelouse des Humas, devant GCU', 3, 'non'),
(271, 213, 332, NULL, 'Accueil du Prestataire (Jeux en Bois / Samedi)', '<p></p><div>-------- Trucs à prévoir avant ---------</div><div>-Chèque de caution de 500€</div><div><br></div><div>-------- Avec le prestataire -----------</div>- Attendre l''appel du presta (arrivée prévue à 9h, numéro: 06 43 42 10 51)<div><div>- Faire signer le bon de livraison à Clément (l''appeler au talkie)</div><div>- Donner le chèque de caution<br><div>- Récupérer et garder avec soi les notices des jeux en bois.</div><div>- Lui donner le numéro de Constant pour lundi matin : 06.82.82.41.26</div><div>- Mettre les jeux au dépôt AIP. Lorsque les soft arrivent à 9h30, leur indiquer l''emplacement des jeux et leur donner les notices.</div><div><br></div></div><div><br></div><div><br></div> </div><p></p>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(272, 22, 399, NULL, 'Pose signa permanente', '<p></p><ul><li>Aller au QG Orga (à la Rotonde)</li></ul><ul><li>Retrouver le reste de ton équipe et l''Orga Signa SGM (0648255118) qui vous briefera, formera deux binômes, et vous remettra le descriptif signa permanente.</li><li>Récupérer les panneaux/banderoles/affiche listés dans le descriptif, ainsi que masse colsons, clous, scotch....</li><li>Aller planter et coller et scotcher et attacher la signa comme décrite sur le descriptif que le resp'' signa t''as préparé avec amour. En cas de problème, contacter le responsable.&nbsp;<br></li><li>Appelez SGM lorsque vous avez fini (0648255118). Faire un rapide débrief.</li></ul><div><u>Remarque Pignole:</u> Il est 17h30, la ZC ouvre à 20h00 pour le début des concerts. Il n''y a plus une minute à perdre, allez prendre l''apéro !</div><div><br></div><div><i>"Un alcoolique, c''est quelqu''un que vous n''aimez pas et qui boit autant que vous"</i></div><div><br></div><p></p>', NULL, 0, 'QG orga', 3, 'non'),
(273, 213, 332, NULL, 'Installation des Jeux en Bois (Dimanche / Resp)', '<p></p><div>- Retrouver les softs au dépôt AIP</div><div><div>- Briefer pour l''installation en donnant un plan (et en montrant des photos prises la veille éventuellement)</div></div><div>- Aider à installer<br><br></div><p></p>', NULL, 0, 'Dépôt AIP', -1, 'non'),
(274, 213, 332, NULL, 'Remise des Jeux en Bois (Lundi)', '<p>- Va au dépôt AIP, où les softs ont rassemblé les jeux en bois ainsi que les règles des jeux hier soir. (envoie un SMS à Romain si ce n''est pas évident, je suis en cours mais je peux te répondre)</p><p>- Attends le prestataire (il est censé arriver vers 9h00). (son numéro : 06 43 42 10 51)</p><div><div>- Rendre les règles des jeux (2 exemplaires) au prestataire (les jeux aussi, évidemment)</div></div><div><br></div><div>- Récupère le chèque de caution.</div><div><br></div><div>- Remercie le d''être venu, dis lui au revoir, et à l''année prochaine potentiellement.</div><div><br></div><div>- Ramène le chèque de caution à Fatna.</div>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(275, 213, 332, NULL, 'Checker si tout va bien sur les Jeux en Bois', '<p>- Checker si tout se passe bien sur toutes les anims</p>', NULL, 0, 'Pelouse des Humas', -1, 'non'),
(276, 213, 332, NULL, 'Animation des Jeux en Bois', '<p>Tout d''abord, retrouve les orgas qui s''occupaient de l''animation avant toi : l''animation se trouve sur la pelouse des Humas, à l''intersection entre les deux routes devant le département GCU.</p><p>Va les voir, et récupère les notices des jeux (sur lesquelles il faudra veiller soigneusement!). N''hésite pas à leur demander des conseils pour assurer ton créneau, ils seront ravis de t''aider.</p><p>Lis les notices des jeux, pour pouvoir ensuite les expliquer aux participants.</p><p>-----------------------</p><p>Ta mission pendant ces deux heures est de gérer les 9 jeux en bois en faisant participer les enfants.</p><p>Il faudra non seulement leur expliquer les règles, mais aussi veiller à ce qu''ils respectent le matériel et les autres joueurs, tout ça dans une bonne ambiance. :)</p><div>-----------------------</div><div><br></div><div>Une fois ton créneau fini, attends la relève, transmet leur les notices des jeux et n''hésite pas à les aider à prendre leurs marques. Ne pars pas avant que la relève arrive!</div><div><br></div><div>-----------------------</div><div><br></div><div>-Après 14h30, c''est l''association RAPP qui anime les jeux en bois en même temps que leur kermesse, vois avec eux comment tu peux les aider. :)</div><div><br></div><div>Attention!</div><div>-Ne jamais laisser les jeux en bois sans surveillance.</div><div>-Ne pas perdre les règles du jeu.</div><div><br></div><div>En cas de problème, n''hésite pas à appeler Romain au 06 36 94 28 11.&nbsp;</div><div>Bon courage. :)</div>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(277, 213, 332, NULL, 'Rangement des Jeux en Bois (Dimanche / Resp)', '<p>-Aider les Softs à ranger</p><div><br></div><div>-Veiller à rassembler les jeux en bois ensemble avec les règles des jeux (2 exemplaires), pour que le lendemain ce soit plus facile de rendre son matériel au prestataire.</div><p></p>', NULL, 0, 'Pelouse des Humas', -1, 'non'),
(278, 213, 400, NULL, 'Installation BEST', '<p>-Aller au dépôt AIP.</p><p>-Installer 3 tables deux places, 6 chaises et une grille d''exposition sur la pelouse des Humas juste devant le bar AIP. Pour la grille d''exposition, la poser contre le bar AIP.<br></p><p>-Attendre BEST (ne pas partir tant qu''ils ne sont pas arrivés).<br></p><p>-Les aider, si besoin, à installer.</p><div>-----------</div><div>Si BEST est en retard, les contacter au 06 02 29 16 78</div><p></p>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(279, 213, 400, NULL, 'Rangement BEST', '<p>-Retrouve BEST sur la pelouse des Humas, devant la scène, près sur bar AIP.</p><p>-Aide BEST à ranger, et ramène le matériel au dépôt AIP (3 tables deux places et 6 chaises, ainsi qu''une grille d''exposition)</p><p>En cas de souci, n''hésite pas à appeler Romain au 06.36.94.28.11</p>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(280, 22, 399, NULL, 'Gérer la pose de Signa Permanente', '<p></p><div><u>Résumé:</u><br></div>Superviser les softs qui taffent sur la pose de la signa permanente (FT n°279).<div><u><br></u></div><div><u>Descriptif:</u><br><div><ul><li>Pense à ne pas aller en TP d''ELP.&nbsp;<br></li><li>Vérifier que tu possède deux exemplaires du descriptif de la signa permanente sur toi.</li><li>Retrouver tes 3 orgas au QG orga, et demande les clés du 11m3 à l''humain.</li><li>Former deux binômes (tu fais parti d''un des deux), et remettre à chacun un exemplaire du descriptif signa permanente.</li><li>Briefer chacun des deux binômes, et vérifier qu''ils emportent le bon matériel avant de les quitter.</li><li>Effectue ta tâche avec force et robustesse.</li><li>Rends les clés du 11m3 à l''humain à la fin de la tâche</li></ul><span class="Apple-tab-span" style="white-space:pre">	</span><u>Binôme n°1:</u>&nbsp;1 Soft et 1 Hard</div><div><ul><li>Récupérer les affiches/banderoles/panneaux légers et simples à mettre en place, au QG orga, ainsi que masse colsons, clous, scotch...</li><li>Se munir d''un caddie pour tout transporter.</li></ul></div><div><span class="Apple-tab-span" style="white-space: pre;">	</span><u>Binôme n°2:</u>&nbsp;Toi (resp signa) et 1 Soft</div><div><ul><li>Enfourche ton 7m3 avec ton soft, et va installer la signa permanente lourde.</li></ul><div><u>Remarque Pignole:</u>&nbsp;Si tu croises un orgas qui déprime, paye ton fromage.</div></div><div><br></div><div><i>"On ne peut pas acheter le bonheur, mais on peut acheter du fromage, et c''est presque pareil"</i></div><div><br></div></div><p></p>', NULL, 0, 'Tout partout', 3, 'non'),
(281, 13, 401, NULL, 'Tâche sans nom', 'nlknlm', NULL, 0, 'Bars', -1, 'non'),
(282, 26, 402, NULL, 'Dépôt du matos au Village Coureurs', '<p>-&gt; Retrouve Sacha (Païu) au QG orga (il faut qu''il ait la liste du matos à récupérer !!)</p><p><br></p><p>-&gt; Prends les clés du Village Coureur, de la cave, du local des 24h, du club Rock, de l''Insatiable<b>&nbsp;</b>et du 20m3 auprès de l''humain</p><p><br></p><p>-&gt; Va à la cave (en bas du bâtiment E) et récupère le tas de moquette pour les pédales, les matelas et l''arche 24 (Essaie d''amener la moquette assez vite à Collette Besson, comme ça les orgas peuvent commencer à la poser !)<br></p><p><br></p><p>-&gt; Va au local du club rock (en bas du bâtiment F)<b>,&nbsp;</b>récupère et charge le 20m3 avec le matos pour les pédales</p><p><br></p><p>-&gt; Va au dépôt humas et récupère les chaises</p><p><br></p><p>-&gt; Va au local des 24H de l''INSA (en bas du bâtiment D) et récupère toute la bouffe et le matos Pédales</p><p><br></p><p>-&gt; Va au local de l''Insatiable (en bas du bâtiment H) et récupère les canapés, les tables, l''arche TdR, les bancs ainsi que la signalétique pour le Village Coureurs</p><p><br></p><p>-&gt; Conduis jusqu''au Village Coureurs</p><p><br></p><p>-&gt; Dépose tout dans le gymnase Colette Besson ( dans un couloir ou un vestiaire, et surtout ENLEVE TES CHAUSSURES avant de marcher sur le parquet, stp ^^ )</p><p><br></p><p>-&gt; Ramène le 20m3 et toutes les clés au QG orga<br></p>', 'Confort :\r\n3 canapés // 10 matelas // Rouleaux PQ //\r\n\r\nBouffe :\r\nBouffe // Micro-onde // Marmite // Couvercle marmite // Plaque Elec // Bouilloire // Louche // Perco // Bols en plastique // Cuillères en plastique // Couteaux (à saucisson) //\r\n\r\nSon :\r\nMicro // Enceintes // Ampli // Vidéo-Projecteur\r\n\r\nElec & co :\r\nRallonge 2*20 // 3 multiprises // 2 grands frigos // 1 diable // Sacs poubelle 200L //\r\n\r\nClés de Colette besson // Clés de la cave // Clés du QG pédale // \r\n\r\n2 bombes rose pédale // tables de kiné // Signa\r\n\r\nVillage Challenge : \r\n4 tentes // 2 barbecue // 12 banc', 0, 'QG orga', 3, 'non'),
(283, 26, 402, NULL, 'Installation du Village Coureurs', '<P>-&gt; Retrouve un orga Pédale (La Barre) au QG Orga pour te faire briefer</P>\r\n<P>-&gt; Récupère les clefs du gymnase Collette Besson auprès de l''humain</P>\r\n<P>-&gt; Va au Village Coureurs (Gymnase Collette Besson) avec l''orga Pédale</P>\r\n<P>-&gt; Récupère le matos que les orgas amènent et met le dans le gymnase</P>\r\n<P>-&gt; Installe la moquette sur les zones de passage (avec le plan, c''est plus pratique)&nbsp;</P>\r\n<P>-&gt; Installe la signalétique<B>&nbsp;(</B>si elle n''est pas au Village Coureurs, va la chercher&nbsp;au QG Pédales (prévoir les CLEFS) )</P>\r\n<P>-&gt; Pense à laisser une place pour les kinés (salle Est)</P>\r\n<P>-&gt; Fais un coin cuisine (salle Ouest)</P>\r\n<P>-&gt; Fais un coin repos</P>\r\n<P>-&gt; Ouvre les douches, les toilettes et vérifie la propreté</P>\r\n<P>-&gt; Vérifie que K-le-son a bien fait son boulot : teste le micro, les enceintes et le raccordement au PC</P>\r\n<DIV>-&gt; Ferme le gymnase en partant et rends les clefs à l''humain<BR></DIV>', 'Tes bras musclés \r\nLe plan du Village Coureurs', 0, 'Gymnase Colette Besson', 3, 'non'),
(284, 26, 402, NULL, 'Tenir le Village Coureurs', '<p>-&gt; Retrouve l''orge pédale (La Barre) au gymnase Colette Besson</p><p>-&gt; Réponds aux questions des coureurs</p><p>-&gt; Occupe-toi du ravitaillement pour les coureurs fatigués</p><p>-&gt; Récupère les résultats du chrono à chaque début d''heure et affiche-les au tableau<br></p><p>-&gt; Fais des tours de vélo pour voir si le circuit est sale, de temps en temps</p><p></p><p>-&gt; Empêche les gens (et les rôtis) de rentrer dans les WC, douches, village coureurs et salle de repos</p><p>-&gt; Dis aux coureurs d''enlever leurs chaussures (celles de vélo avec les cales dessous) et de marcher sur la moquette (ATTENTION A NE PAS ABIMER LE PARQUET DU GYMNASE !!!!!)</p><p>Pour le Village Challenge :</p><p>-&gt; Va voir aussi au village challenge si tout se passe bien, et fais du ravitaillement</p><p>-&gt; Garde ton portable/talkie bien allumé</p><div>-&gt; Quand une entreprise arrive, va l''accueillir</div><div><br></div><div>-&gt; Montre-lui les différents villages</div><div><br></div><div>-&gt; Et bien sur, sois bien enthousiaste !</div>', NULL, 0, 'Gymnase Colette Besson', 3, 'non'),
(285, 26, 402, NULL, 'Ranger le Village Coureurs', '<p>-&gt; Prends les clés du Village Coureur, de la cave, du local des 24h, du club Rock, de l''Insatiable<b>&nbsp;</b>et du 20m3 auprès de l''humain. Prends aussi la liste du matériel. :)</p><p>-&gt; Retrouve l''orga pédale au Village Coureurs (vérifie qu''il a la liste du matos)<br></p><p>-&gt; Vide le village Coureurs de ses occupants en leur disant que le Village va fermer (gentiment, parce qu''on aime les coureurs)<br></p><p>-&gt; Enlève tout les équipements (tables, canapés, matelas...) ATTENTION AU PARQUET !!<br></p><p>-&gt; Retire la moquette<br></p><p>-&gt; Charge le matos dans le 20m3 et ramène tout :<br></p><p><u>Au local du club rock</u> : 2 grands frigos, 2 canapés, 2 barbecues ;<br></p><p><u>Au local de l''Insatiable </u>: 2 canapés (ceux qui appartiennent à l''Insatiable, pas les nôtres, attention !)</p><p><u>Au dépôt AIP</u> : 16 tables (2 places), 4 chaises, 12 bancs ; (Mettre les bancs dans la benne de Villeurbanne)</p><p><u>A la cave </u>: la moquette et les 10 matelas ;</p><p><u>Au local des 24H de l''INSA</u> (en bas du bâtiment D) : tout le reste !<br></p><p>-&gt; Ferme le Village Coureurs quand il a bien fini d''être nettoyé<br></p><p>-&gt; Ramène le 20m3 et toutes les clés au QG orga<br></p>', 'Les clés de colette besson ( douches, vestiaires, ...)\r\nDes bras\r\nDe la bonne humeur', 1, 'Gymnase Colette Besson', 3, 'non'),
(286, 228, 388, NULL, 'Nettoyer l''Olivier', '<p>-Rends toi au QG de l''ambiance récupérer deux éponges, un balai et une pelle</p><p>-Rends toi à l''Olivier et attends que la resp des anims arrive (Jennifer)<br>-Demande lui où se trouve le chariot de nettoyage<br>-Nettoie à fond l''olivier</p><p>- Pense à récupérer les affiches des anims qui ont été oubliées et ramène au QG de l''ambiance, l''olivier doit être nickel!</p><p>-Range le chariot<br></p><p>-Ramène les éponges au QG de l''ambiance</p><p>En cas de problème appelle Jennifer : 06 42 97 07 50</p>', 'Kit de nettoyage de l''Olivier (sur place)', 0, 'Olivier', 3, 'non (raf)'),
(287, 228, 388, NULL, 'Fermer les Anims + Olivier', '<p><u><b>La samedi soir Uniquement:</b></u></p><p>-Rends-toi au QG de l''ambiance pour récupérer les clés de l''olivier</p><p>-Va à l''olivier et présente toi aux resps anims (Jennifer) &nbsp;<br></p><p>-Aide les à ranger les anims et à remettre les tables en place<br></p><p>-Ferme l''olivier quand tout le monde est parti</p><p><u>Important: Il faut vérifier que toutes les portes et fenetres de l''olivier qui donne sur&nbsp;l’extérieur&nbsp;soient&nbsp;verrouillées&nbsp;!</u></p><p>-Ramène les clés au QG de l''ambiance !!!</p><p><u style="font-weight: bold;">Pour info: </u>Le samedi la MdE est fermée par l''orga qui s''occupe de fermer le grillon de 18h à 18h15</p><p><u><b>Le dimanche soir Uniquement :</b></u></p><p>-Va à l''olivier et présente toi aux resps anims&nbsp;<br></p><p>-Aide les à ranger les anims et à remettre les tables en place</p><p><b><u>Pour info</u>:</b> Le dimanche Nico ferme le grillon, l''olivier et la MdE avec Simon et Jennifer de 19h45 à 20h15</p>', 'Clés de l''olivier', 0, 'Olivier', 3, 'non (raf)'),
(288, 31, 404, NULL, 'Presentation projet diere', '<p>Salut bon gmc, tu es encore dans ta manif charismatique !!! Mais bon les cours ont repris ...</p><div>Tu dois aller presenter le truc qui t''as peté le cul toute l''année.</div><div>Alors met toi un peut de vaseline, arme toi de courage et essaye de ne pas t''endormir pendant que tes potes parlent, promis après ça tu pourras retourner taper sur du layer !&nbsp;</div><p></p>', 'De la vaseline et un pincée de courage, 5 lunettes de soleil, 5 fen, 1 ordi et 5 mégaphone pour qu''on nous entende bien !', 0, 'Amphi seguin', -1, 'non'),
(289, 14, 347, NULL, 'Clés Humas', '<p></p><div>A vos marques ! prêt ! partez !</div><div>Cours jusqu''au Humas&nbsp;</div><div>utilise le mégaphone de l''ambiance depuis le halle pour appeler le responsable des humas</div><div>demande lui gentiment de te passer les clés des salles:&nbsp;<u>020</u> <u>021</u> <u>salle des profs</u>&nbsp;<u>Agora</u> <u>Salle de Théâtre</u>&nbsp;<u>René Char</u></div><div>Va faire l''état des lieux de chacunes des salles (c''et toi qui est salle !)</div><div>Si c''est tout bon, prends les clés et ramène les aux zumains de l''ambiance, n''oublie pas de faire un saut sur le matela-jump de l''ambiance qui sera dans l''agora ! (ah en fait non je suis un rôti, le matela-jump des humains ne sera pas encore installé donc tu pourras quand même essayer mais ça va faire plus mal)&nbsp;</div><div><u><br></u></div><div><br></div><div><b>Pour info</b>: les salles 020 021 salle des profs seront utilisées de&nbsp;vendredi\r\n23 mai à 18h au lundi 26 mai à 7h30</div><div>La salle René\r\nChar de la Rotonde, du vendredi 23 mai 18h au lundi 26 mai 8h\r\nmaximum.</div><div>La Salle\r\n	Théâtre de la Rotonde, du vendredi 23 mai 18h au lundi 26 mai 8h.<br>L''Agora\r\n	de la rotonde, du jeudi 22 mai 12h au lundi 26 mai 16h&nbsp;<br></div><p></p>', NULL, 0, 'Bât des Humas', 3, 'non'),
(290, 21, 406, NULL, 'Conducteur - Récupération petit matos DirPat', '<p></p><ul><li>RDV au local des 24<br></li><li>Retrouve Cetelem<br></li><li>Demande lui la liste "petit matos dirpat"<br></li><li>Demande la clef de deux voitures (à grands coffres !) aux humains<br></li><li>Aller à la dirpat<br></li><li>Dire bonjour<br></li><li>Récupérer tout le petit matos qui est sur la liste<br></li><li>Attendre que le gros Cetelem aille chercher les clés à la DirPat<br></li><li>Remercier<br></li><li>Rentrer au local<br></li><li>Mettre un bout de scotch orange sur chaque truc (Cetelem te donnera du scotch élec)<br></li><li>Rendre les clés de voiture aux humains<br></li><li>Ranger la liste du matos dans le casier log<br></li><li>Manger du saucisson<br></li></ul><p></p>', NULL, 1, 'Local des 24H', 3, 'non'),
(291, 228, 407, NULL, 'Installation', '<p>-Aller chercher 3 vaubans au dépôt barrière derrière les humas</p><p>- Aller chercher 4 tables (taille 2 pers), 6 chaises et un parasol au&nbsp;dépôt&nbsp;AIP&nbsp;</p><p>- Aller sur la pelouse des Humas à l''intersection entre les 2 routes devant GCU &nbsp;(à côté des jeux en bois)</p><div>- Indiquer aux orgas de l''asso RAPP (si besoin, Numéro de Paul Caillou de RAPP : 06 59 51 04 16) que vous avez ramené tout le matos et qu''ils peuvent commencer à installer puis animer&nbsp;</div><div><br></div><div>- Appeler Jennifer en cas de problèmes : 06 42 97 07 50</div><div><br></div><div><br></div><div><br></div><div><br></div>', '1 parasol, 3 vaubans', 0, 'Pelouse GCU', 3, 'raf'),
(292, 228, 407, NULL, 'Rangement', '<p>- Aller sur la pelouse des Humas à l''intersection entre les 2 routes devant GCU &nbsp;(à côté des jeux en bois)</p><p>- Ramener 4 tables (taille 2 pers), 6 chaises, et un parasol au&nbsp;dépôt&nbsp;AIP&nbsp;<br></p><p>- Ramener 3 vaubans au dépôt barrières aux humas</p><p>- Appeler Jennifer en cas de problème : 06 42 97 07 50</p>', '3 vaubans, 1 parasol', 0, 'Pelouse GCU', 3, 'raf'),
(293, 212, 408, NULL, 'Installation du Samedi des Sumos', '<p>Récupérer,du scotch et des ciseaux et de la rubalise au QG de l''ambiance (orga)<br></p><p>Aller chercher 8 vaubans au dépôt barrières (derrière la kfet)<br></p><p>Rends-toi sur la pelouse GCU (devant GCU) au niveau de l''anim&nbsp;<b style="text-decoration: underline;">SUMOS</b>&nbsp;(qui sera déjà montée)</p><div><div>Mettre les barrières et la rubalise tout autour du tapis du jeu</div><div>Verifier que tout est bien en place pour la journée</div><div><br></div><div>Attends les prochains jusqu''à 10h. Ne laisse pas l''animation seule, elle se sentirait seule ;) Essaie les costumes au pire si tu t''ennuies</div><div><br></div><div>Ramène le scotch et la rubalise au QG de l''ambiance<br></div><div><br></div><div>En cas de problème : Constant : 06 82 82 41 26</div></div>', 'Kit SUMOS', 0, 'Pelouse des Humas', 3, 'raf'),
(294, 212, 408, NULL, 'Installation du Dimanche des Sumos', '<div>- Aller chercher 8 vaubans au dépot barrières (vers les humas voir sur le plan)<br>- Récupérer du scotch et des ciseaux et de la rubalise au QG de l''ambiance (orga) et bien sûr le plus important le kit du jeu les&nbsp;<u><b>SUMOS&nbsp;</b></u>au dépôt AIP</div><div>- Rends-toi sur la pelouse GCU à l''endroit où est prévue l''animation = devant GCU</div><div>- Monter le jeu (enfin il y a surtout le tapis à mettre)</div><div>- Mettre les barrières et la rubalise &nbsp;tout autour du tapis</div><div>- Vérifier que tout est bien en place pour la journée<br></div><div>- Ne t''en vas pas en courant!! attends la relève jusqu''à 10h. Essaie les costumes si tu t''ennuies ;)<br><p></p><p>- Ramener le scotch et la rubalise au QG de l''ambiance<br></p><p>En cas de problème : Constant 06 82 82 41 26</p></div>', 'Kit SUMOS', 0, 'AIP', 3, 'raf'),
(295, 212, 409, NULL, 'Tâche sans nom', 'ergafc', NULL, 0, 'Pelouse des Humas', -1, 'non'),
(296, 212, 408, NULL, 'Gérer les Sumos', '<p><span style="text-align: justify;"><u>Règles suggérées</u>&nbsp;: 3 à 5 min par groupe</span><br><br><span style="text-align: justify;"><u>But</u>&nbsp;: faire sortir l''adversaire du tapis, ou le renverser</span><br><br><span style="text-align: justify;">Match en 2 ou 3 points gagnants</span></p><div><div><br></div>Rend toi sur l''anim qui se trouve sur la pelouse juste devant GCU. Oblige les&nbsp;gens à enlever leurs chaussures&nbsp;avant de monter sur le tapis. Aide les à mettre le costume de sumos si besoin.&nbsp;<span style="text-align: justify;">Sois attentif à ce que la file d''attente soit bien faite et qu''il n''y ait personne qui passe devant d''autres!</span>&nbsp;<br><br><u>IMPORTANT</u>: Ne Jamais Laisser L''Anim Toute Seule<br><div>En cas de&nbsp;problème: Constant : 06 82 82 41 26<br></div></div><div><br></div>', 'Amène ton plus beau sourire et ta bonne humeur !', 0, 'Pelouse des Humas', 3, 'raf'),
(297, 14, 347, NULL, 'Retour clés Humas', '<p></p><ul><li>Trouver les zumains, prendre les clés des salles&nbsp;<u>020</u>&nbsp;<u>021</u>&nbsp;<u>salle des profs</u>&nbsp;<u>Agora</u>&nbsp;<u>Salle de Théatre</u>&nbsp;<u>René Char</u>&nbsp;</li><li>Aller voir M le responsable des Humas<br></li><li>Faire l''état des lieux et lui rendre les clés<br></li><li>Lui dire merci<br></li></ul><p></p>', NULL, 0, 'Bocal', 3, 'non'),
(298, 212, 408, NULL, 'Fermeture et rangement des Sumos du Samedi', '<p></p><div>Rangement des sumos<br><br>Rends toi sur la pelouse GCU</div><div><br></div><div>- Plie le jeu correctement<br>- Ramene au dépôt AIP les sumos + tapis de jeu. Vérifie que vous n’avez rien oublié.<br></div><div>- Ramene les 8 barrières vaubans au dépôt barrières (derrière la kfet)<br><br></div><div>en cas de problème : Constant : 06 82 82 41 26</div><p></p>', 'Kit Sumos\r\nDe la bonne humeur !', 0, 'Pelouse des Humas', 3, 'raf'),
(299, 212, 408, NULL, 'Fermeture et rangement des Sumos du Dimanche', '<p>Rangement des sumos<br><br>Rends toi sur la pelouse GCU<br><br></p><p>- Ramène le tapis et les costumes derrière la grande scène avec le reste des animations gonflables</p><p>- Ramène les vaubans au dépôt derrière la kfet. Ne laisse pas traîner la rubalise par terre, c''est pas bien (et le développement durable dans tout ça!!!!)&nbsp;<span class="Apple-tab-span" style="white-space:pre">	</span></p><br>en cas de problème : Constant&nbsp;06 82 82 41 26', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(300, 206, 410, NULL, 'Caisses stand accueil', '<p></p><ul><li>Aller sur le stand accueil</li><li>Représenter l''association de façon charismatique</li><li>Garder la caisse (et ne pas la quitter des yeux !!!)</li><li>Renseigner les gens sur le festival en général, répondre le plus précisément possible à leurs questions&nbsp;</li><li>Indiquer aux éventuels curieux où se trouvent les stands, spectacles et autres animations proposées en journée grâce au plan du site et au programme</li><li>Récupérer les objets trouvés que te ramènent les festivaliers pour éventuellement les rendre à leur propriétaires (s''ils se manifestent)</li><li>Vendre (enfin essayer) les supers tee shirts souvenirs de cette quarantième édition de l''ambiance!</li><li><u><b>Pour la journée du samedi</b></u> : il est également possible de vendre des pass 1 nuit pour samedi. C''est 15 euros (tarif unique) et les billets te seront transmis en même temps que les caisses<br></li><li>Mettre beaucoup d''ambiance</li></ul><div>Si tu arrives le premier* sur le stand : attends l''arrivée de la caisse.</div><div>Si tu es dernier sur le stand** : attends que la trez vienne chercher la caisse avant de partir</div><div><br></div><div><b><u>Surtout, ne quitte pas ton poste tant que la relève n''est pas arrivée !</u></b></div><div><br></div><div><i>*20h le vendredi, 10h les samedi et dimanche matin</i><br></div><div><i>**4h les vendredi et samedi soir, 22h le dimanche</i><i><br></i></div><p></p>', '- kit accueil\r\n-kit t-shirt', 0, 'Devant GCU, à l&#039;angle des bars', 3, 'non'),
(301, 206, 410, NULL, 'Tâche sans nom', 'k', NULL, 0, 'Devant GCU, à l&amp;#039;angle des bars', -1, 'non'),
(302, 28, 348, NULL, 'dfs', 'esgdgsd', NULL, 0, 'Gymnase Lyon 1', -1, 'non');
INSERT INTO `Tache` (`id`, `responsable_id`, `groupetache_id`, `importid`, `nom`, `consignes`, `materielSupplementaire`, `permisNecessaire`, `lieu`, `statut`, `commentaireLog`) VALUES
(303, 220, 381, NULL, 'Amener les tatamis sur les Humas', '<p>-Aller au dépôt AIP<br>-Mettre un max de tatamis dans un caddie et les amener à l''emplacement du judo sur la pelouse devant le bâtiment des Humas<br>-Continuer jusqu''à qu''il y ait les 12 tatamis(ou jusqu''à que mort s''en suive!)</p><p>-Ramener le caddie au dépot AIP<br></p><p>-En cas de problème, appeler le resp Etienne au 07 87 05 06 04</p>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(304, 220, 381, NULL, 'Ranger les tatamis', '<p>-Aller au dépot AIP récupérer un caddie<br>-Aller à l''emplacement du judo sur les Humas avec le caddie<br>-Le remplir de tatamis et les ramener au dépot AIP</p><p>-Continuer jusqu''à ce que les 12 tatamis soient rangés(ou jusqu''à que mort s''en suive!)</p><p>-Laisser le caddie au dépôt AIP<br></p><p>-En cas de problème, appeler Etienne au 07 87 05 06 04</p>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(305, 14, 347, NULL, 'Clés GMC', '<p>Salut !</p><div>ta mission consiste à récupérer les clés de la salle A302 de GMC.&nbsp;</div><div>Pour cela utilise ton tricycle pour <b><u>te rendre au bâtiment GMC</u></b>, la bas tu <b><u>trouveras le Mr. de GMC</u></b>&nbsp;qui t''attendra avec impatience dans son bureau. Invite la à te payer le café puis <b><u>emmène le faire l''état des lieux</u></b>.</div><div><b><u>Récupère les clés</u></b> et <b><u>emmène les à l''humain</u></b> et va vers de nouvelles aventures !</div><div><br></div><p></p>', 'un tricycle', 0, 'GMC', 3, 'non'),
(306, 14, 347, NULL, 'Retour clé GMC', '<p>On va la faire courte mais efficace !</p><div>-Trouver les zumains</div><div>- Récupérer les clés de GMC</div><div>-Aller en GMC</div><div>-Trouver le Mr de GMC</div><div>-Lui donner les clés</div><div>-Se casser</div><p></p>', NULL, 0, 'Local', 3, 'non'),
(307, 22, 411, NULL, 'Collage Trajet A', '<p><span class="Apple-tab-span" style="white-space:pre">	</span>Bonsoir !</p><p><span class="Apple-tab-span" style="white-space:pre">	</span>Tu as la tête dans le cul ? C''est normal, il est 6h00 du matin. Tu dois déjà haïr l''Humain pour t''avoir affecter à un créneau aussi tôt, mais détrompe toi: le collage, il n''y a rien de mieux pour commencer ta journée. Pour le petit déjeuner, bois un grand verre d''huile d''arachide, et c''est parti pour le collage de l''ambiance.</p><div><ul><li>Rends toi au local des 24H de l''INSA. Essaye de ne pas porter de vêtements salissant. Au pire, on pourra te prêter un T-Shirt pour te protéger.<br></li><li>Trouve ton conducteur pour le collage du trajet A.</li><li>Récupère un sceau, un vieux balais, et un paquet d''affiches, et le <b>plan du trajet A dans le casier "com"</b>.</li><li>Prépare un sceau de colle. Pour cela, suis le tutoriel placardé dans les toilettes. Le badge est accroché à l''entrée du local</li><li>Mettez les affiches et le balais dans le coffre de la voiture. Gardez le sceau avec vous à l''avant de la voiture, et essayez de ne pas (trop) en renverser partout pendant le trajet.</li><li>S''arrêter à chaque point de collage, recouvrir les panneaux de nos affiches. N''hésitez pas à e mettre plusieurs par panneaux: plus on rachète de terrain, plus on est chez nous, et on aime ça.</li><li>Revenir au local, et déposer le materiel. N''oubliez pas de bien replacer le plan du trajet A dans le casier "com".</li></ul></div><div><br></div><div><br></div><div><br></div><p></p>', NULL, 0, 'Local des 24H', 3, 'non'),
(308, 22, 411, NULL, 'Collage Trajet A - Conducteur', '<p>Bonsoir !</p><p><span class="Apple-tab-span" style="white-space: pre;">	</span>Tu as la tête dans le cul ? C''est normal, il est 6h00 du matin. Tu dois déjà haïr l''Humain pour t''avoir affecter à un créneau aussi tôt, mais détrompe toi: le collage, il n''y a rien de mieux pour commencer ta journée.&nbsp;Pour le petit déjeuner, bois un grand verre d''huile d''arachide, et c''est parti pour le collage de l''ambiance.</p><div><ul><li>Rends toi au local des 24H de l''INSA. Essaye de ne pas porter de vêtements salissant. Au pire, on pourra te prêter un T-Shirt pour te protéger.</li><li>Récupérer les clés d''une voiture. Vérifier que la voiture est bien protégée(surtout dans le coffre et au niveau du siège passager).</li><li>Trouve ton accompagnateur pour le collage du trajet A.</li><li>Récupérez un sceau, un vieux balais, et un paquet d''affiches, et le&nbsp;<b>plan du trajet A dans le casier "com"</b>.</li><li>Préparez un sceau de colle. Pour cela, suis le tutoriel placardé dans les toilettes. Le badge est accroché à l''entrée du local</li><li>Mettez les affiches et le balais dans le coffre de la voiture. Si l''accompagnateur renverse de la colle pendant le trajet, ne pas hésiter à lui rentrer sa merde.</li><li>S''arrêter à chaque point de collage, recouvrir les panneaux de nos affiches. N''hésitez pas à e mettre plusieurs par panneaux: plus on rachète de terrain, plus on est chez nous, et on aime ça.</li><li>Revenir au local, et déposer le matériel et les clés de voiture. N''oubliez pas de bien replacer le plan du trajet A dans le casier "com".</li></ul></div>', 'Moult Affiches', 1, 'Local des 24H', 3, 'non'),
(309, 14, 347, NULL, 'Clés FIE', '<p>Ta mission:</p><div>Aller récupérer les clés de FIE pour le QG de l''ambiance</div><div>Pour ca, il faut trouver qqun de FIE, je te conseille Baudy. Pour le trouver, c''est simple appelle Clara au talkie et rejoins la, Baudy sera autour (ou dans) elle.</div><div>Une fois les clés en main, fait l''état des lieux.</div><div>Enfin tu peux aller donner les clés aux zumains (pratique, ils seront juste à coté de la salle !)</div><div><br></div><p></p>', 'une capote pour Clara et Baudy', 0, 'FIE', -1, 'non'),
(310, 14, 347, NULL, 'Retour clés FIE', '<p>Appelle Baudy (06 37 49 18 39) pour qu''il récupère les clés du au local de FIE, donne lui la clé après avoir fait l''état des lieux.&nbsp;</p><p>Retourne faire l''humain, plein de choses passionnantes t''attendent</p><p><br></p><p></p>', NULL, 0, 'Local', -1, 'non'),
(311, 14, 347, NULL, 'Clés Coulomb', '<p>Va au bâtiment Coulomb</p><div><br></div><p></p>', NULL, 0, 'Coulomb', -1, 'non'),
(312, 14, 347, NULL, 'Retour clés Coulomb', '<p>va voir les humains</p>', NULL, 0, 'ZC', -1, 'non'),
(313, 14, 335, NULL, 'Rangement locaux Assos', '<div>Ta mission consiste à remettre les locaux des assos dans l''état ou on les a trouvés. Si tu t''appliques, on pourra encore les utiliser l''an prochain !&nbsp;</div><div><br></div>Rends toi au local des 24 heures, et retrouve ton co-tache.&nbsp;<div><br></div><div>Récupère les clefs du Club Rock et de graines d''images.&nbsp;</div><div><br></div><div>Prends de quoi faire le ménage : balai, balayette, pelle, serpillère, seau, produit pour le sol.</div><div><br></div><div>Rends toi dans les locaux d''assos, fais un peu de rangement, imagine toi que l''asso va bientôt récupérer son local, il ne faut donc pas qu''il y ait de choses qui traient au milieu du passage, pas de déchets qui trainent etc...&nbsp;</div><div><br></div><div>Passe un coup de balai. Si c''est très sale, passe la serpillère, sans inonder le local, sinon ça met 4h à sécher, et puis l''eau, ça fait rouiller.&nbsp;</div><div><br></div><div>Une fois que tu as fait le tour de tous les locaux, retournes au local, remet les clefs à leur place, et range le matos de ménage ou tu l''as pris.&nbsp;</div><div><br></div><div>Ta tache est finie, tu peux aller te reposer ou bien trouver quelqu''un qui aura surement quelque chose pour t''occuper !&nbsp;</div><div><br></div><div><br></div><div><br></div><div>&nbsp;</div>', NULL, 0, 'Dépôt AIP', -1, 'non'),
(314, 14, 347, NULL, 'Rangement locaux Assos', '<p></p><div>Ta mission consiste à remettre les locaux des assos dans l''état ou on les a trouvés. Si tu t''appliques, on pourra encore les utiliser l''an prochain !&nbsp;</div><div><br></div>Rends toi au local des 24 heures, et retrouve ton co-tache.&nbsp;<div><br></div><div>Récupère les clefs du Club Rock, de graines d''images et un diable.</div><div><br></div><div>Prends de quoi faire le ménage : balai, balayette, pelle, serpillère, seau, produit pour le sol.</div><div><br></div><div>Rends toi dans les locaux d''assos, fais un peu de rangement, imagine toi que l''asso va bientôt récupérer son local, il ne faut donc pas qu''il y ait de choses qui traient au milieu du passage, pas de déchets qui trainent etc...&nbsp;</div><div><br></div><div>pense à récupérer le frigo vert de boards of mangroove (à ramener au local)</div><div><br></div><div>Passe un coup de balai. Si c''est très sale, passe la serpillère, sans inonder le local, sinon ça met 4h à sécher, et puis l''eau, ça fait rouiller.&nbsp;</div><div><br></div><div>Une fois que tu as fait le tour de tous les locaux, retournes au local, remet les clefs à leur place, et range le matos de ménage ou tu l''as pris.&nbsp;</div><div><br></div><div>Ta tache est finie, tu peux aller te reposer ou bien trouver quelqu''un qui aura surement quelque chose pour t''occuper !&nbsp;</div><div><br></div><div><br></div><div><br></div><div>&nbsp;</div><p></p>', NULL, 0, 'Local 24H Bâtiment D', 3, 'non'),
(315, 206, 412, NULL, 'Retour matos GR', '<p></p><ul><li>Rends-toi au local des 24 heures (RdC bât D) et retrouves-y Doc-X (07 77 89 97 97) ou Mamie Caro (06 79 12 17 05), l''un des deux resp'' bouffe</li><li>Prends un ou deux chariots, et mets-y tout le matériel du Grand Restaurant à rendre (prends-en soin, le GR nous prête ça gratuitement et on aimerait que ce soit encore le cas pour l''an prochain ;) )</li><li>Prends aussi les bidons d''huiles usagées</li><li>Récupère la fiche de "Prêt de matériel" dans le casier bouffe, et vérifie que rien ne manque (dans le cas contraire, fais-en part à un &nbsp;resp'' bouffe<br></li><li>Rends-toi derrière le GR avec le matériel, dans la zone de livraison, et adresse toi à un magasinier pour qu''il récupère le matériel</li><li>Fais-lui signer le papier</li><li>Jette l''huile usagée dans le container prévu à cet effet</li></ul><p></p>', NULL, 0, 'Local 24h', 3, 'non'),
(316, 12, 346, NULL, 'Tâche sans nom', 'caca', NULL, 0, 'Partout', -1, 'non'),
(317, 12, 346, NULL, 'Flyage Hôtel de Ville', '<p>Viens au local (de l''ambiance) &nbsp;récupérer ton co-flyage, une grosse pile de flyers (environ 200 chacun) et une dose de charisme.</p><div>Dirige-toi vers l''arrêt de tram.&nbsp;</div><div>Prends le tram/métro jusqu''à Hôtel de Ville (correspondance métro A à Charpennes, direction Perrache).</div><div>Flye jusqu''à ce que tu n''aies plus de flyers.&nbsp;</div><div>Reviens au local avec le sentiment d''avoir participé au non-déficit des 24h.&nbsp;</div><div><br></div><div>I believe I can flye !&nbsp;<span style="background-color: rgb(249, 249, 249); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 21px;">♫</span></div>', NULL, 0, 'Local des 24H', 3, 'non'),
(318, 227, 327, NULL, 'Rangement Village Challenge', '<P>Retrouver PA au village coureur (gymnase Collette Besson)</P>\r\n<DIV>L''aider à plier le campement du village Challenge<BR></DIV>\r\n<DIV><BR></DIV>\r\n<DIV>Aller chercher des caddies au dépôt humas</DIV>\r\n<DIV><BR></DIV>\r\n<DIV>Ramener les tables, BBQs et tentes</DIV>\r\n<DIV><BR></DIV>\r\n<DIV>Nettoyer le campement : faites en sorte qu''on ne voit pas que les 24h ne soit pas passés</DIV>\r\n<DIV>- enlever la signa<BR></DIV>\r\n<DIV>- les banderoles des entreprises</DIV>\r\n<DIV>- les poubelles</DIV>\r\n<DIV>- aider les entreprises si besoin</DIV>\r\n<DIV>- commencer à regrouper les barrières qui délimitent le village !</DIV>\r\n<DIV><BR></DIV>\r\n<P></P>', NULL, 0, 'Pelouse au nord de colette besson', 3, 'non'),
(319, 227, 327, NULL, 'Tenir le village Challenge', '<p>Allez voir de temps en temps s''ils ont besoin de quelques choses, faire la discussion, demander si la course se passe bien, sucer des grosses queues ou faire de gros cunies !! Faire en sorte qu''il kiffe sa mére la pute et qu''ils reviennent l''année prochaine</p>', NULL, 0, 'Pelouse au nord de colette besson', -1, 'non'),
(320, 227, 327, NULL, 'Installation des banderoles des entreprises', '<p>Aller au QG pédales (L''insatiable bat.H)</p><div><br></div><div>Récupérer les banderoles des entreprises et le kit banderole</div><div><br></div><div>Prendre 20 colsons, 1 scotch, 1 cutter et de la ficelle ( au QG pédales) et tout mettre dans un sac</div><div><br></div><div>Mettre en place les banderoles avec un orga Hard sur le départ des courses et/ou à d''autres endroits de la courses suivant le nombre et la demande des entreprises</div><div><br></div><div>Ramener le matos au QG</div><p></p>', 'Kit attaches + banderoles', 0, 'Pelouse au nord de colette besson', -1, 'non'),
(321, 227, 327, NULL, 'Accueillir Entreprises', '<p>Garder son portable/talkie bien allumé</p><div>Quand une entreprise arrive aller l''accueillir</div><div><br></div><div>Lui montrer les différents villages</div><div><br></div><div>Et bien sur bien faire le lèche cul !</div><p></p>', NULL, 0, 'Pelouse au nord de colette besson', -1, 'non'),
(322, 21, 354, NULL, 'Ranger le local', '<p>RDV au local des 24H</p><div>Retrouve Cetelem</div><div>Aide-le à ranger le local</div><div>Faire le maximum de place possible dans la grande salle !</div><div>Se pignoler en attendant l''arrivée des gros qui viennent trier</div><p></p>', NULL, 0, 'Local des 24H', 3, 'non'),
(323, 197, 413, NULL, 'Installer l''atelier d''initiation + la scène ouverte', '<p>L''AJIL s''occupe de l''atelier d''initation et la scène ouverte. Le président s''appelle Félix Détrez, appelle le (<span style="background-color: rgb(247, 247, 247); color: rgb(62, 69, 76); font-family: Helvetica, Arial, ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 12px; line-height: 15.359999656677246px; white-space: pre-wrap;">06 15 44 33 68</span>) et donne lui rendez vous sur les humas.</p><div><br><div>Montre-leur leur emplacement : à droite de l''entrée des humas, puis va chercher un banc et 2 tables deux places au dépôt des humas, et ramène les.</div><div><br></div><div>Si tout se passe bien, il devrait y avoir une prise pour qu''il puisse brancher leur musique. S''il n''y en a pas, aller râler sur Nico ou Alexis.</div><div><br></div><div><br></div></div><p></p>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(324, 21, 415, NULL, 'Récupération Matos des Assos 2ème partie', '<p></p><ul><li>RDV au local des 24 Heures (RdC bât D)<br></li><li>Retrouve Cetelem (Alexis - 06 80 52 08 62)<br></li><li>Demander les clés d''un 20m3 et du club rock aux humains<br></li><li>Prendre 10 feuilles de brouillon, 1 marqueur et du scotch<br></li><li>@Cetelem : Ne pas oublier la liste d''affectation des frigos et des canaps</li><li>Prendre 1 diable s''il y en a 1</li><li>Appeler Adrien Maccario : 06 13 09 37 20 pour lui dire que tu vas bientôt passer en TC récupérer le matos.<br></li><li>Appeler Etienne Lorteau de l''ABIL - 06 33 51 35 13 - et aller chercher le frigo de biosciences, le mettre dans le 20m3</li><li>Aller au Cluji et récupérer 1 frigo, le charger dans le 20m3</li><li>Aller à Biosciences, récupérer le matos et le charger dans le 20m3 <u>(2 canaps et 1 frigo)</u></li><li>Aller en TC récupérer le matos et le charger dans le 20m3 <u>(4 canaps, 2 fauteuils,1 frigo, 1 poubelle et 1 plaque élec)</u></li><li>Aller au Club Rock déposer les canaps et le frigo.</li><li><b>Laisser un passage et de la place de libre pour un cours de danse</b>&nbsp;ou ne pas faire trop de bruits s''ils sont là !</li><li>Marquer le matos comme sur la liste de Cetelem</li><li>Rentrer au local</li><li>Rendre les clés du 20m3, les clés de TC et les clés du club rock aux humains de l''ambiance</li></ul><p></p>', NULL, 0, 'Local des 24H', 3, 'non'),
(325, 16, 414, NULL, 'Aller aux Bahamas', '<p></p><ol><li>Se regrouper au QG Pédales</li><li>Aller cherhcer le Palmier du Karna<br></li><li>Prendre Félindra</li><li>Prendre Cochonou</li><li>Ammener un sac de sport</li><li>Aller récupérer plein de limonade</li><li>Prendre le T1 jusqu''à Part Dieu</li><li>Prendre le Rhone Express jusqu''à l''aéroport</li><li>Prendre un billet pour les Bahamas</li><li>Débarquer</li><li>Rendre les bouteilles frelatées au guichet le plus proche (demander à Jerem il connait l''adresse)</li><li>Rester là bas 200ans : elever des tortues pour aller chercher des noix de Cocos dans<strike> les bites</strike>&nbsp; les palmiers.</li></ol><p></p>', 'Un cactus\r\nFelindra\r\nCochonou', 0, 'Loin', -1, 'non'),
(326, 227, 416, NULL, 'Installation Podium', '<p></p><ul><li>Rejoins PA au village coureur : gymnase Colette Besson</li><li>Là-bas, récupère le podium (demande à un hard où il est si besoin)<br></li><li>Va installer le podium sur la scène du patio MdE<br></li><li>Récupère le carton des médailles, lots et coupes au local de l''Insatiable (au RdC du bâtiment H)<br></li><li>Amène le tout à côté du podium, vérifie que tout est propre et présentable et ne laisse rien sans surveillance</li><li>Ensuite assure toi que la sono de la scène MdE est bien installée et que les micros fonctionnent ("Test - Testistest - Testitestoune")</li><li>Va ensuite chercher 5 tables, un rouleau de nappe en papier et une tente 3*3 au dépôt Humas</li><li>Place deux des tables sur la scène MdE et les trois autres devant, recouvre-les avec la nappe en papier<br></li><li>Va ensuite chercher des bouteilles d''eau et du ravito au village coureurs - tu en répartiras sur les tables</li><li>Assure-toi maintenant que tout soit bien rangé et aide PA à trier les lots coureurs</li></ul><p></p>', NULL, 0, 'Village Coureurs', 3, 'non'),
(327, 227, 416, NULL, 'Remise des prix', '<p></p><ul><li>Accueillir correctement les différentes invités qui viendront se présenter</li><li>Organiser les discours et remerciements<br></li><li>PENSER&nbsp;A  REMERCIER TOUT LE MONDE : les coureurs, INSA, Villeurbanne, le CVA, les Bikers, Weleda, Terre de Running, les  Challenges Entreprise, les orgas, les spectateurs.<br></li><li>Donner les kms des vainqueurs -&nbsp; leur remettre les prix<br></li><li>Faire des blagues!</li><li>S’assurer qu''il y ait toujours du ravito sur les tables</li><li>A la fin, discuter avec les vainqueurs, les gens sympas, les Challenge Entreprise<br></li></ul><p></p>', NULL, 0, 'Scène de la MDE', 3, 'non'),
(328, 227, 416, NULL, 'Rangement podium', '<p></p><ul><li>Rejoindre PA devant la scène MdE , il te dira quoi faire</li><li>Récupérer le podium (sur la scène de la MdE) et le ranger dans le gymnase Colette Besson</li><li>Récupérer les médailles et coupes restantes et les ramener au local de l''Insatiable (RdC du H)</li><li>Nettoyer les 5 tables au niveau du patio (aller chercher un sac poubelle et une éponge au QG Orga si besoin)</li><li>Ramener les tables et la tente 3*3 (situé sur la scène) au dépôt Humas</li><li>S''il restait du ravito sur les tables, tout ramener au village coureur dans le gymnase Colette Besson</li></ul><p></p>', NULL, 0, 'Village Coureurs', 3, 'non'),
(329, 221, 416, NULL, 'Remise des prix natation', '<p>Récompenser les participants du défi natation</p><p>Faire patienter les nageurs qui attende la remise des prix en leur&nbsp;proposant&nbsp;à boire et&nbsp;compagnie.</p><p>Bien leur&nbsp;préciser&nbsp;que la remise des prix se fait au village vers 18h30 19h00</p><p>Attendre&nbsp;le resp qui arrive avec les&nbsp;résultats&nbsp;de la course<br></p><p><span class="Apple-tab-span" style="white-space: pre;">	</span>Penser à remercier les sponsors et pisc''insa&nbsp;</p><p><span class="Apple-tab-span" style="white-space: pre;">	</span>Donner le kilométrage des vainqueurs</p><p><span class="Apple-tab-span" style="white-space: pre;">	</span>Distribuer les lots</p>', 'La bouffe du village pour faire du bluff', 0, 'Village Coureurs', 3, 'non'),
(330, 221, 416, NULL, 'Installer podium natation', '<p>Se rejoindre au Village Coureurs.<br></p><p>Y poser une table du Village Coureurs dehors pour faire office de goûter.</p><p>Poser sur la table de quoi manger et boire pour faire un&nbsp;goûter&nbsp;pour les compteurs et pour les participants.</p><p></p><p>Aller chercher le podium au local Insatiable et le transporter jusqu''au Village Coureurs, l''y installer.<br></p>', 'Podium, coupes, médailles\r\nBouffe du village', 0, 'Village Coureurs', 3, 'non'),
(331, 197, 413, NULL, 'Ranger l''atelier d''initatiation et la scène ouverte', '<p>Rend toi sur la pelouse des humas, va voir l''animation (des gens qui jonglent !).</p><div>Attends qu''ils aient tout fini.</div><div><br></div><div>Aide les à ranger puis va remettre le banc et les 2 tables deux places au dépot des humas (puisque tu n''es malheureusement pas Superman, tu ne pourras pas tout porter en même temps. Demande au gens de l''AJIL de rester surveiller le matos le temps que tu le ramènes, histoire qu''on ne se fasse pas voler un banc ou une table !)</div><div><br></div><p></p>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(332, 21, 415, NULL, 'Récupération Matos BDE et pool Conducteur', '<p></p><ul><li>Aller au local des 24</li><li>Rassembler les troupes et 3 voitures <u>vides</u>&nbsp;</li><li>Récupérer un rouleau de scotch élec noir</li><li>Aller au BDE</li><li>Retrouver Cetelem qui doit être en train de faire l''état des lieux du matos</li><li>Récupérer le matos&nbsp;prêté par le pool des clubs et le BDE</li><li>Scotcher tout le matos avec du scotch elec noir&nbsp;</li><li>Tout descendre devant la MdE à un endroit accessible en voiture</li><li>Charger tout dans les voitures</li><li>Aller au bâtiment D</li><li>Décharger le matos au local des 24h, dans Exit ou dans Graines d''Image (voir avec Cetelem)</li><li>Rendre les clés des voitures (et l''argent)</li></ul><p></p>', NULL, 1, 'Local des 24H', 3, 'non'),
(333, 197, 413, NULL, 'Daijoubu desuka ? Tout se passe bien ?', '<p>Rend toi sur les humas et vérifie que l''atelier de jonglage etc se passent bien.</p>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(334, 21, 415, NULL, '14H - Etat des lieux Matos BDE et Pool', '<ul style="MARGIN-RIGHT: 0px" dir="ltr">\r\n<li>Aller au local</li>\r\n<li>Récupérer du scotch elec noir et la liste du matos prêter par le Bde et le pool des clubs</li>\r\n<li><b><u>Récupérer les chèques de caution</u></b></li>\r\n<li>Aller au BdE</li>\r\n<li>Retrouver Cedric</li>\r\n<li>Faire l''état des lieux du matos du Pool et du BdE</li>\r\n<li>Retrouver ceux qui doivent charger avec toi qui doivent venir en voiture à 16h30</li>\r\n<li>Charger le matos dans les voitures</li>\r\n<li>Repartir avec eux</li></ul>\r\n<p></p>', NULL, 0, 'Local des 24H', 3, 'non'),
(335, 21, 415, NULL, 'Petit Matos Forum', '<p></p><ul><li>Aller au local des 24 Heures</li><li>Récupérer la liste "Matos Forum" (appelle Cetelem 06 80 52 08 62 pour savoir où elle est)</li><li>Aller au forum</li><li>Récupérer le petit matos (tout sauf canap/multiprises et rallonges)</li><li>Le ramener au local</li><li>Mettre dans un coin tout le matos avec une feuille "FORUM" dessus. (Avec une feuille de brouillon et un marqueur)</li><li>Sur chaque truc pris, mettre du scotch elec vert et jaune (important)</li><li>Dire merci au forum</li></ul><p></p>', NULL, 0, 'Local des 24H', -1, 'raf'),
(336, 21, 415, NULL, 'Rendu Matos Forum', '<p></p><ul><li>Aller au local des 24H</li><li>Retrouve Cetelem (Alexis - 06 80 52 08 62)</li><li>Récupérer la liste "Matos Forum" (Demande la à Cetelem)</li><li>Prendre le matos (normalement tout le matériel appartenant au forum a un morceau de scotch elec jaune et vert)</li><li>Enlever les morceaux de scotch</li><li>Ramener ce matos au Forum</li><li>Dire merci</li><li>Rentrer au local</li></ul><p></p>', NULL, 0, 'Local des 24H', 3, 'non'),
(337, 22, 411, NULL, 'Collage trajet B', '<p><span class="Apple-tab-span" style="white-space:pre">	</span>Bonsoir !</p><p><span class="Apple-tab-span" style="white-space: pre;">	</span>Tu as la tête dans le cul ? C''est normal, il est 6h00 du matin (et tout va bien). Tu dois déjà haïr l''Humain pour t''avoir affecter à un créneau aussi tôt, mais détrompe toi: le collage, il n''y a rien de mieux pour commencer ta journée.&nbsp;Pour le petit déjeuner, bois un grand verre d''huile d''arachide, et c''est parti pour le collage de l''ambiance.</p><div><ul><li>Rends toi au local des 24H de l''INSA. Essaye de ne pas porter de vêtements salissant. Au pire, on pourra te prêter un T-Shirt pour te protéger.</li><li>Récupérer les clés d''une voiture. Vérifier que la voiture est bien protégée(surtout dans le coffre et au niveau du siège passager).</li><li>Trouve ton accompagnateur pour le collage du trajet B.</li><li>Récupérez un sceau, un vieux balais, et un paquet d''affiches, et le&nbsp;<b>plan du trajet B dans le casier "com"</b>.</li><li>Préparez un sceau de colle. Pour cela, suis le tutoriel placardé dans les toilettes. Le badge est accroché à l''entrée du local</li><li>Mettez les affiches et le balais dans le coffre de la voiture. Si l''accompagnateur renverse de la colle pendant le trajet, ne pas hésiter à lui rentrer sa merde.</li><li>S''arrêter à chaque point de collage, recouvrir les panneaux de nos affiches. N''hésitez pas à e mettre plusieurs par panneaux: plus on rachète de terrain, plus on est chez nous, et on aime ça.</li><li>Si vous ne trouvez pas un emplacement de collage, laissez tomber, entourez le sur le plan, et vous le signalerez à la com'' pour qu''il le modifie (ou le supprime). Si le point de collage n''est pas exactement au bon endroit sur le plan, idem, annotez le plan.</li><li>Revenir au local, et déposer le matériel et les clés de voiture. N''oubliez pas de&nbsp;<b>bien replacer le plan du trajet B ans le casier "com"</b>.</li></ul><div><span class="Apple-tab-span" style="white-space:pre">	</span>Si tout va bien, tu devrais être à l''heure pour aller en cours. Sinon, tant pis, retourne te coucher.</div></div>', NULL, 0, 'Tu vois Lyon ? Tu vois Villeurbanne ? Bah c&amp;amp;amp;#039;est là', 3, 'non'),
