tout va bien, tu devrais être à l''heure pour aller en cours. Sinon, tant pis, retourne te coucher.</div></div>', NULL, 1, 'Tu vois Lyon ? Tu vois Villeurbanne ? Bah c&amp;amp;amp;amp;#039;est là', 3, 'non'),
