(342, 22, 411, NULL, 'Collage Trajet D - Conducteur', '<p><span class="Apple-tab-span" style="white-space: pre;">	</span>Bonsoir !</p><p><span class="Apple-tab-span" style="white-space: pre;">	</span>Tu as la tête dans le cul ? C''est normal, il est 6h00 du matin (et tout va bien). Tu dois déjà haïr l''Humain pour t''avoir affecter à un créneau aussi tôt, mais détrompe toi: le collage, il n''y a rien de mieux pour commencer ta journée.&nbsp;Pour le petit déjeuner, bois un grand verre d''huile d''arachide, et c''est parti pour le collage de l''ambiance.</p><div><ul><li>Rends toi au local des 24H de l''INSA. Essaye de ne pas porter de vêtements salissant. Au pire, on pourra te prêter un T-Shirt pour te protéger.</li><li>Récupérer les clés d''une voiture. Vérifier que la voiture est bien protégée(surtout dans le coffre et au niveau du siège passager).</li><li>Trouve ton accompagnateur pour le collage du trajet D.</li><li>Récupérez un seau, un vieux balais, et un paquet d''affiches, et le&nbsp;<b>plan du trajet D dans le casier "com"</b>.</li><li>Préparez un seau de colle. Pour cela, suis le tutoriel placardé dans les toilettes. Le badge est accroché à l''entrée du local</li><li>Mettez les affiches et le balais dans le coffre de la voiture. Si l''accompagnateur renverse de la colle pendant le trajet, ne pas hésiter à lui rentrer sa merde.</li><li>S''arrêter à chaque point de collage, recouvrir les panneaux de nos affiches. N''hésitez pas à e mettre plusieurs par panneaux: plus on rachète de terrain, plus on est chez nous, et on aime ça.</li><li>Si vous ne trouvez pas un emplacement de collage, laissez tomber, entourez le sur le plan, et vous le signalerez à la com'' pour qu''il le modifie (ou le supprime). Si le point de collage n''est pas exactement au bon endroit sur le plan, idem, annotez le plan.</li><li>Revenir au local, et déposer le matériel et les clés de voiture. N''oubliez pas de&nbsp;<b>bien replacer le plan du trajet D ans le casier "com"</b>.</li></ul><div><span class="Apple-tab-span" style="white-space: pre;">	</span>Si tout va bien, tu devrais être à l''heure pour aller en cours. Sinon, tant pis, retourne te coucher.</div></div><div><br></div>', NULL, 1, 'Tu vois Lyon ? Tu vois Villeurbanne ? Bah c&amp;amp;amp;amp;amp;amp;amp;amp;#039;est là', 3, 'non'),
(343, 22, 411, NULL, 'Collage Trajet E', '<p><span class="Apple-tab-span" style="white-space: pre;">	</span>Bonsoir !</p><p><span class="Apple-tab-span" style="white-space: pre;">	</span>Tu as la tête dans le cul ? C''est normal, il est 6h00 du matin (et tout va bien). Tu dois déjà haïr l''Humain pour t''avoir affecter à un créneau aussi tôt, mais détrompe toi: le collage, il n''y a rien de mieux pour commencer ta journée.&nbsp;Pour le petit déjeuner, bois un grand verre d''huile d''arachide, et c''est parti pour le collage de l''ambiance.</p><div><ul><li>Rends toi au local des 24H de l''INSA. Essaye de ne pas porter de vêtements salissant. Au pire, on pourra te prêter un T-Shirt pour te protéger.</li><li>Récupérer les clés d''une voiture. Vérifier que la voiture est bien protégée(surtout dans le coffre et au niveau du siège passager).</li><li>Trouve ton accompagnateur pour le collage du trajet E.</li><li>Récupérez un seau, un vieux balais, et un paquet d''affiches, et le&nbsp;<b>plan du trajet E dans le casier "com"</b>.</li><li>Préparez un seau de colle. Pour cela, suis le tutoriel placardé dans les toilettes. Le badge est accroché à l''entrée du local</li><li>Mettez les affiches et le balais dans le coffre de la voiture. Garde le seau de colle à tes pieds, évite d''en renverser tout partout dans la voiture.</li><li>S''arrêter à chaque point de collage, recouvrir les panneaux de nos affiches. N''hésitez pas à e mettre plusieurs par panneaux: plus on rachète de terrain, plus on est chez nous, et on aime ça.</li><li>Si vous ne trouvez pas un emplacement de collage, laissez tomber, entourez le sur le plan, et vous le signalerez à la com'' pour qu''il le modifie (ou le supprime). Si le point de collage n''est pas exactement au bon endroit sur le plan, idem, annotez le plan.</li><li>Revenir au local, et déposer le matériel et les clés de voiture. N''oubliez pas de&nbsp;<b>bien replacer le plan du trajet E ans le casier "com"</b>.</li></ul><div><span class="Apple-tab-span" style="white-space: pre;">	</span>Si tout va bien, tu devrais être à l''heure pour aller en cours. Sinon, tant pis, retourne te coucher.</div></div><div><br></div>', NULL, 0, 'Tu vois Lyon ? Tu vois Villeurbanne ? Bah c&amp;amp;amp;amp;amp;amp;amp;amp;amp;#039;est là', 3, 'non'),
