ab-span" style="white-space: pre;">	</span>Si tout va bien, tu devrais être à l''heure pour aller en cours. Sinon, tant pis, retourne te coucher.</div></div><div><br></div>', NULL, 1, 'Tu vois Lyon ? Tu vois Villeurbanne ? Bah c&amp;amp;amp;amp;amp;amp;amp;amp;amp;amp;#039;est là', 3, 'non'),
(345, 16, 384, NULL, 'PS2 : Installation', '<ol><li>Rendez vous au QG Orga.<br></li><li>Retrouve ton co-orga.<br></li><li>Demande à l''Humain de vous donner des gilets jaunes et un talkie.<br></li><li>Rends toi au PS2 (Sur le boulevard Laurent Bonnevay au Nord-Est du campus).</li><li>Prends les quelques barrière sur place de sorte à ne laisser passer que les voitures qui souhaitent sortir du campus.</li><li>Demande l''humain et préviens au talkie que tu es bien à poste<br></li></ol><p></p><p>Ta mission :&nbsp;Assurer la sécurité du festival et des courses en ne laissant passer aucun véhicule excepté&nbsp;:</p><p></p><ul><li>Les véhicules des secours (Pompiers, Police, etc..)<br></li><li>Les véhicules muni d''un passe sécu <u>pour le PS2</u></li><li>Le personnel de STAFF Sécurité sur présentation de lcarte professionelle</li><li>Le personnel TCL</li><li>Les secouristes de la Croix Rouge</li></ul>Un exemple de pass sécu et l''autorisation de fermeture du campus sont disponible sur place.<br><div><br></div><div><div>En cas de problème / de doute demande le responsable sécurité au Talkie.&nbsp;N''hésite pas à prévenir de tout comportement anormaux. Si le talkie bip demande qu''on t''amène une batterie.<br>Si le talkie ne passe pas téléphone au 06.59.90.44.19 ou au 06.76.99.09.64<br>En cas d''urgence appel directement le PC sécu : 04.72.43.70.70</div><div>Reste bien à l''écoute de ce qui est dit au talkie cela te concerne peut être.</div></div><div><br></div><div><b><u>IMPORTANT :</u></b></div><div><ul><li><b><u>NE TE MET PAS EN DANGER (si le mec est un peu aigri laisse le&nbsp;tâter&nbsp;de la vauban et écarte toi)</u></b><br></li><li><b><u>NE QUITTE PAS TON POSTE TANT QUE LES SUIVANTS NE SONT PAS ARRIVES</u></b><br></li></ul><div><b><u><br></u></b></div></div><div>En cadeau voici les paroles de Petit Poney &nbsp;:</div><p></p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">[Refrain]<br>Petit poney, petit poney, tu es tout gris et tout petit, petit poney, petit poney.<br>Petit poney, petit poney, tu es tout gris et tout petit, petit poney, petit poney.</p><div><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">Petit poney, petit poney, tu gambades dans les prés sans te soucier du temps qui passe, petit poney, petit poney<br>La nuit qui tombe sur le pré c''est aussi ça la vie qui passe, petit poney, petit poney.</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">[Refrain]</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">Tu gambades dans les prés sans te soucier du temps qui passe, petit poney, petit poney<br>La nuit qui tombe sur le pré c''est aussi ça la vie qui passe, petit poney, petit poney</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">[Refrain] (x3)</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">Tu gambades dans les prés sans te soucier du temps qui passe, petit poney, petit poney<br>La nuit qui tombe sur le pré c''est aussi ça la vie qui passe, petit poney, petit poney</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">[Refrain]</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">Tu gambades dans les prés sans te soucier du temps qui passe, petit poney, petit poney<br>Et puis un jour un loup arrive avec 3 feuilles de salades il va manger le quadrupède.</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">[Refrain] (x2)</p></div>', NULL, 0, 'Campus', 3, 'raf');
INSERT INTO `Tache` (`id`, `responsable_id`, `groupetache_id`, `importid`, `nom`, `consignes`, `materielSupplementaire`, `permisNecessaire`, `lieu`, `statut`, `commentaireLog`) VALUES
(346, 16, 384, NULL, 'PS2 : Point sécu', '<ol><li>Rends toi au PS2 &nbsp;(Bd Laurent Bonnevay au Nord Est du campus)&nbsp;</li><li>Récupère le gilet jaune et le talkie de l''équipe précédente</li><li>Demande&nbsp;l''Humain&nbsp;au talkie et préviens que tu es bien en poste</li></ol><div>Ta mission : Assurer la sécurité du festival et des courses en ne laissant entrer aucun véhicule excepté :<br></div><p></p><ul><li>Les véhicules des secours (Pompiers, Police, etc..)<br></li><li>Les véhicules muni d''un pass sécu&nbsp;<u>pour le PS2</u></li><li>Le personnel TCL</li><li>Le personnel de STAFF Sécurité sur présentation de sa carte professionelle</li><li>Les secouristes de la Croix Rouge</li></ul><div>Un exemple de pass sécu et l''autorisation de fermeture du campus sont disponibles sur place.<br><br></div><div>En cas de problème / de doute demande le responsable sécurité au Talkie.&nbsp;N''hésite pas à prévenir de tout comportement anormaux. Si le talkie bip demande qu''on t''amène une batterie.<br>Si le talkie ne passe pas téléphone au 06.59.90.44.19 ou au 06.76.99.09.64<br>En cas d''urgence appel directement le PC sécu : 04.72.43.70.70</div><div>Reste bien à l''écoute de ce qui est dit au talkie cela te concerne peut être.</div><div><br></div><div><b><u>IMPORTANT :</u></b></div><div><ul><li><b><u>NE TE MET PAS EN DANGER (si le mec est un peu aigri laisse le&nbsp;tâter&nbsp;de la vauban et écarte toi)</u></b><br></li><li><b><u>NE QUITTE PAS TON POSTE TANT QUE LES SUIVANTS NE SONT PAS ARRIVES</u></b><br></li></ul><div><b><u>En bonus : paroles de Micko Black "ma bite":</u></b></div></div><div><b><u><br></u></b></div><div>Né en&nbsp;<span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">85</span><br><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Enfant d''Afrique à Kinshasa</span><br><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Papa me circoncit</span><br><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Je n''avais pas besoin de djellaba</span><br><br>Car il fait chaud, très chaud là-bas<br>Donc je marchais,&nbsp;<span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">nu dans les rues</span><br><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Voici j''arrive en France</span><br>Je vois des gens qui s''embrassent<br><br><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">A la télé, ça me dépasse</span><br><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Pour la première fois, ma bite me parle</span><br>"Bienvenue chez&nbsp;<span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">les pétasses</span>" (Oh yeah)<br><br><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Je redescends en maternelle</span><br>Je rencontre la plus belle<br>D''origine marocaine<br><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Je me dis : faut qu''je la ken</span><br><br><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Comme dans le film que j''ai vu qu''hier</span><br>Je l''aime aussi, elle m''aime aussi<br><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Mais soudainement ses copines aussi</span><br><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">A la récréation derrière sous les buissons</span><br><br><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">On s''est frotti, on s''est frotta</span><br>Et tralali, et tralala (ooh - oh yeah)<br><br>Voici les années passent<br><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Je rencontre la jument</span><br><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">J''ai 10 ans, elle en a 13</span><br>Elle est plu(s) âgée que moi<br><br><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Elle veut goûter au chocolat</span><br><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Au choco-qui ? Au choco-moi !</span><br>Au choco-quoi ? Au chocolat !<br><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Mais pourquoi ? Je ne sais pas</span><br><br>[Refrain]<br><br><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Ma bite, ma bite, ma bite, ma bite</span><br><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Oh</span><br><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Ma bite, ma bite, ma bite, ma bite</span><br><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Oh</span><br style="color: rgb(255, 255, 255); font-family: sans-serif; font-size: 17px; line-height: 26.399999618530273px; background-color: rgb(22, 22, 22);"></div><div><br></div>', NULL, 0, 'Campus', 3, 'non (raf)'),
(347, 222, 417, NULL, 'Installation du mini golf', '<P></P>\r\n<DIV>\r\n<UL>\r\n<LI>Rends toi aux dépôt AIP et attends Cedric<BR></LI>\r\n<LI>Récupère les pistes de golf, le sac avec les accessoires et le sac avec les clubs et les balles.<BR></LI>\r\n<LI>Va les déposer sur le terrain stabilisé (terrain de foot en sable) à côté du möllky<BR></LI>\r\n<LI>Placer les &nbsp;parcours bien à plat<BR></LI>\r\n<LI>Poser les accessoires (pont...) sur les parcours<BR></LI>\r\n<LI>placer les sacs sous les parcours (on en a besoin en fin de journée!)</LI>\r\n<LI>Tester les parcours.<BR></LI>\r\n<LI>Attendre en jouant au golf&nbsp;que le soft qui a le prochain créneau arrive</LI></UL></DIV>\r\n<DIV>S''il y a le moindre problème, appelle le resp Cédric</DIV>\r\n<P></P>', 'Du charisme\r\nles pistes de golf, le sac avec les accessoires et le sac avec les clubs et les balles', 0, 'Terrain Stabilisé', 3, 'non (raf)'),
(348, 222, 417, NULL, 'Ramener le minigolf au dépôt AIP', '<p></p><div><ul><li>Rends toi le terrain de foot sable (aka terrain stabilisé, aka terrain d''athlé aka ce que tu veux).<br></li><li>Appelle l''autre orga qui doit t''aider s''il n''est pas encore là, tu ne pourras pas tout transporter tout seul!!</li><li>Fermer l''animation (au revoir tout le monde!!)</li><li>Récupère les pistes de golf, le sac(placés sous les parcours) avec les accessoires et le sac avec les clubs et les balles (3 clubs et 3 balles).&nbsp;</li><li>Va les déposer aux dépôts AIP en groupant le tout.<br></li><li>Va manger du pâté au QG car c''est bientôt l''heure du dîner!</li></ul></div><div>S''il y a le moindre problème, appelle le resp Cédric</div><p></p>', NULL, 0, 'Terrain Stabilisé', 3, 'non'),
(349, 222, 417, NULL, 'Gérer le minigolf', '<p>RDV sur le terrain stabilisé au nord de la ZC.</p><p>Alors ta mission c''est de gérer le minigolf, c''est assez simple et tu vas passer un créneau tranquille<br></p><div>Le plus important c''est la sécurité, on ne le&nbsp;répétera&nbsp;jamais assez, surtout quand il y a des clubs de golf.<br>Les gens qui passent peuvent faire les 2 pistes, les unes après les autres sauf s''il y a vraiment trop de monde qui attend, en ce cas c''est une piste par personne fin bref c''est à toi de gérer :)</div><div>Vérifier que les sacs (qui servent à transporter les accessoires) sont bien sous les parcours (on en a besoin en fin de journée!)<br><br><b>/!\\Obligatoire/!\\</b></div><div><ul><li>Une personne seulement par parcours! c''est primordial. Les autres attendent derrière à (au moins) 1m50<br></li><li>Les seuls personnes qui ont un club dans les mains sont celles qui jouent et l''orga (et personne d''autre!)<br></li><li>Personne autour du parcours, il risquerait de se prendre une balle (ou un club) perdue.<br></li><li>Si quelqu''un joue dangereusement/envoie la balle 20 mètres plus loin, l''avertir gentiment, lui faire comprendre ce qui ne va pas. S''il s''en fout et continue de faire de la merde, le virer, la sécu avant tout!<br></li><li>Kiffe ta life d''orga<br></li><li>Joue toi même au minigolf s''il y a personne (et essaye de battre mon meilleur score ;) )</li></ul></div><div><br></div><div>Numéro du&nbsp;<b>PC sécu</b>&nbsp;(num en cas d''accident) :&nbsp;<b><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">04 72 43 70 70 ou&nbsp;</span><span style="color: rgb(34, 34, 34); background-color: rgb(255, 255, 255); font-family: Arial, sans-serif; font-size: 11pt;">04 72 43 60 00</span></b><br></div><div><br></div><div>S''il y a le moindre problème, appelle le resp Cédric</div>', NULL, 0, 'Terrain Stabilisé  (terrain de foot en sable) à côté du möllky', 3, 'non'),
(350, 26, 402, NULL, 'Nettoyer le Village Coureurs', '<p>-&gt; Prends le kit nettoyage au QG orga<br></p><p><br></p><p>-&gt; Retrouve La Barre au Village Coureurs (Gymnase Colette Besson)</p><p><br><br>-&gt; Nettoie le Village Coureurs</p><p><br>-&gt; Vérifie que tout est OK dans le village</p><p><br>-&gt; Vérifie que les orgas qui rangent le matos ferment bien le Village Coureurs à la fin</p><div><br></div>', '2 kits de nettoyage <3 (serpillière, seau, balais, éponge, produit de nettoyage,...)', 0, 'Gymnase Colette Besson', 3, 'non'),
(351, 215, 418, NULL, 'Accueillir Les Gones', '<p><u>Resp:</u>&nbsp;<b style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">Joris CHOROT - 0628204065</b></p><div><br></div><div><ul><li>Se rendre sur la pelouse des humas</li><li>Accueillir l''asso, dire bonjour, leur indiquer l''emplacement de leur animation</li><li>Leur demander s''ils ont besoin d''aide, les aider en cas de besoin</li></ul>Leur fournir le numéro du&nbsp;<b>PC sécu</b>&nbsp;(num en cas d''accident) :&nbsp;<span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">&nbsp;</span><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);"><b>04 72 43 70 70&nbsp;</b>ou<b>&nbsp;</b></span><span style="font-weight: bold; color: rgb(34, 34, 34); background-color: rgb(255, 255, 255); font-family: Arial, sans-serif; font-size: 11pt;">04 72 43 60 00</span><br></div><p></p>', NULL, 0, 'Pelouse des Humas', -1, 'non'),
(352, 26, 402, NULL, 'Récupérer/rendre les ordis pour le Village Coureurs', '<p>-&gt; Va au QG Orga et demande les 2 ordis et le vidéo-projecteur à l''humain</p><p><br></p><p>-&gt; Amène les au Village Coureurs</p><p><br></p><p>-&gt; Installe l''écran, le projecteur et vérifie que tout marche bien</p><p><br></p><p>Au rangement du Village Coureurs :</p><p>-&gt; Ramène les 2 ordis et le vidéo-projecteur à l''humain</p>', NULL, 0, 'Gymnase Colette Besson', 3, 'non'),
(353, 215, 418, NULL, 'Changement Gones + Au revoir Ultimate', '<p>Resp Gones Foot US :<b style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">Joris CHOROT - 0628204065</b></p><div><ul><li>Se rendre sur la pelouse des Humanités</li><li>Aller dire à l''asso'' de ranger leur matos initiation</li><li>Leur demander s''ils ont besoin d''aide</li><li>Leur dire de se rendre au terrain de Rugby lorqu''ils auront finit</li></ul></div><div><ul><li>Se rendre sur le terrain de Rugby</li><li>Demander à l''ultimate si tout s''est bien passé</li><li>Leur dire merci d''être venny, au revoir et à l''année prochaine</li></ul><div><br></div></div><div><ul><li>Accueillir l''asso Gones US au terrain de rugby pour le match, appeler si besoin.</li></ul></div><div><br></div><div><br></div><p></p>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(354, 213, 331, NULL, 'Sodomie Cactus', '<p>Se rendre en QG Orga munie d''un cactus<br><br>Demander à Dina de te rentrer la merde</p>', 'Un cactus', 0, 'terrain athlétisme', -1, 'non'),
(355, 225, 419, NULL, 'Tâche sans nom', 'fsvcwdw', NULL, 0, 'Parking Eiffel', -1, 'non'),
(356, 220, 383, NULL, 'Accueillir le TTIC', '<p><b style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">&nbsp;</b><b style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">Pierre Auguste - 0606451174</b><br></p><p>-Aller au gymnase C<br></p><p>-Accueillir les joueurs, vérifier qu''ils ont tout ce qu''il faut<br>-Leur souhaiter une bonne animation</p><p>-Leur fournir le numéro du PC sécu (en cas d''accident) :&nbsp;<span style="font-family: arial, sans-serif; font-size: 13px;">04 72 43 70 70 ou&nbsp;</span><span style="font-family: Arial, sans-serif; font-size: 11pt;">04 72 43 60 00</span></p>', NULL, 0, 'Gymnase C', 3, 'non'),
(357, 215, 418, NULL, 'Au revoir Foot US', '<p></p><ul><li>Aller chercher les clés du terrain de Rugby au QG orga</li><li>Se rendre au terrain de Rugby</li><li>Remercier les intervenants, leur demander si tout s''est bien passé</li><li>à l''année prochaine</li><li>Fermer à clé le terrain</li><li>Ramener la cle au QG</li></ul><p></p>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(358, 220, 383, NULL, 'Dire au revoir au TTIC', '<p>-Aller au gymnase C</p><div>-Demander aux joueurs si tout s''est bien passé, les remercier</div><div>-"A l''année prochaine!"</div><p></p>', NULL, 0, 'Gymnase C', 3, 'non'),
(359, 21, 335, NULL, 'Fermer le dépôt AIP', '<p>Bonsoir !<br></p><ul><li>Va au QG orga<br></li><li>Demande la clef du dépôt AIP et de la salle A302 aux humains<br></li><li>Va au dépôt AIP<br></li><li>Trouve l''orga qui fait du gardiennage<br></li><li>Dit lui que sa tâche est finie<br></li><li>Demande lui s''il y a eut des problèmes qu''il n''a pas annoncé au talkie ou a Cetelem (Alexis)<br></li><li>Si oui, appeler Cetelem (06 80 52 08 62) et écoute ce qu''il te dit de faire</li><li>Quand tu as fini,<br></li><li>Fermer la salle A302 puis le dépôt AIP<br></li><li>Rentrer au QG avec la clef et le talkie<br></li><li>Rendre la clef et le talkie aux humains<br></li><li>Se pignoler<br></li><li>Manger des super sandwich<br></li><li>être gras<br></li><li>C''est l''ambiance au QG<br></li></ul><div>Le vendredi soir, tu n''as personne à relever, vérifie juste qu''il n''y ai personne dans le dépôt ;)</div><div><br></div><p></p>', NULL, 0, 'QG Orga', 3, 'non'),
(360, 21, 354, NULL, 'Ramener le matos de la cave', '<p>Va au local des 24 H (RdC bât D)</p><div>Trouve Cetelem (Alexis)</div><div>Récupère les clefs d''un 20m3, une clef pompier et les clefs de la cave du E</div><div>Prend la liste "matos cave"</div><div>Va à la cave du E en 20m3</div><div>Charge le matos dans le 20m3</div><div>Reviens au local</div><div>Décharge tout le matos</div><div>Trie ce que tu viens de décharger en fonction de l''endroit d''où il va (prend les listes "dépôt AIP" "dépôt Humas" ... dans le casier log)</div><div>Rend les clefs du 20m3 et de la cave aux humains</div><div>Range la liste dans le casier log &lt;3</div><p></p>', NULL, 0, 'Local des 24H', 3, 'non'),
(361, 32, 420, NULL, 'Installation caisses', '<p>- Retrouve Clara (06 31 41 42 82) au niveau de l''entrée du festival (devant l''AIP)</p><p>- Va chercher les 10 tables, 2 multiprises et 2 rallonges 10 m, une tente 3*3 et une tente 6*3 au dépôt AIP et ramène les au niveau des caisses à l''entrée du festival&nbsp;</p><p>-Monte les tentes<br></p><p><br></p><p><br></p>', NULL, 0, 'Devant l''AIP', 3, 'non'),
(362, 16, 384, NULL, 'PS2 : Désinstallation', '<ol><li>Rends toi au PS2&nbsp;&nbsp;(Bd Laurent Bonnevay au Nord Est du campus)&nbsp;</li><li>Récupère le gilet jaune et le talkie de l''équipe précédente</li><li>Demande l''humain au talkie et préviens que tu est bien en poste.</li></ol><div>Ta mission : Assurer la sécurité du festival et des courses en ne laissant passer aucun véhicule excepté :<br></div><p></p><ul><li>Les véhicules des secours (Pompiers, Police, etc..)<br></li><li>Les véhicules muni d''un passe sécu <u>pour le PS2</u></li><li>Le personnel de STAFF Sécurité sur présentation de lcarte professionelle</li><li>Le personnel TCL</li><li>Les secouristes de la Croix Rouge</li></ul><div>Un exemple de pass sécu et l''autorisation de fermeture du campus sont disponible sur place.<br></div><div><br></div>En cas de problème / de doute demande le responsable sécurité au Talkie.&nbsp;N''hésite pas à prévenir de tout comportement anormaux. Si le talkie bip demande qu''on t''amène une batterie.<br>Si le talkie ne passe pas téléphone au 06.59.90.44.19 ou au 06.76.99.09.64<div>En cas d''urgence appel directement le PC sécu : 04.72.43.70.70</div><div>Reste bien à l''écoute de ce qui est dit au talkie cela te concerne peut être.</div><div><br></div><div>A la fin de ta tache Dimanche à minuit:</div><div><ol><li>Préviens au talkie que tu va partir</li><li>Ouvre le passage en poussant les barrières sur la coté de la route.&nbsp;<br></li><li>Rentre au QG.<br></li><li>Dépose ton talkie et les gilets<br></li></ol></div><div><br></div><div><b><u>IMPORTANT :</u></b></div><div><ul><li><b><u>NE TE MET PAS EN DANGER (si le mec est un peu aigri laisse le&nbsp;tâter&nbsp;de la vauban et écarte toi)</u></b></li></ul><div><b><u><br></u></b></div></div><div><u>En cadeau voici les paroles de ma bite by Micko Black &nbsp;:</u></div><p></p><p style="margin: 5px 0px; padding: 5px 0px;"><span style="text-align: left;">Né en&nbsp;</span><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">85</span><br style="text-align: left;"><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Enfant d''Afrique à Kinshasa</span><br style="text-align: left;"><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Papa me circoncit</span><br style="text-align: left;"><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Je n''avais pas besoin de djellaba</span><br style="text-align: left;"><br style="text-align: left;"><span style="text-align: left;">Car il fait chaud, très chaud là-bas</span><br style="text-align: left;"><span style="text-align: left;">Donc je marchais,&nbsp;</span><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">nu dans les rues</span><br style="text-align: left;"><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Voici j''arrive en France</span><br>Je vois des gens qui s''embrassent<br style="text-align: left;"><br style="text-align: left;"><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">A la télé, ça me dépasse</span><br style="text-align: left;"><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Pour la première fois, ma bite me parle</span><br style="text-align: left;"><span style="text-align: left;">"Bienvenue chez&nbsp;</span><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">les pétasses</span><span style="text-align: left;">" (Oh yeah)</span><br style="text-align: left;"><br style="text-align: left;"><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Je redescends en maternelle</span><br>Je rencontre la plus belle<br>D''origine marocaine<br style="text-align: left;"><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Je me dis : faut qu''je la ken</span><br style="text-align: left;"><br style="text-align: left;"><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Comme dans le film que j''ai vu qu''hier</span><br>Je l''aime aussi, elle m''aime aussi<br style="text-align: left;"><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Mais soudainement ses copines aussi</span><br style="text-align: left;"><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">A la récréation derrière sous les buissons</span><br style="text-align: left;"><br style="text-align: left;"><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">On s''est frotti, on s''est frotta</span><br>Et tralali, et tralala (ooh - oh yeah)<br style="text-align: left;"><br style="text-align: left;"><span style="text-align: left;">Voici les années passent</span><br style="text-align: left;"><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Je rencontre la jument</span><br style="text-align: left;"><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">J''ai 10 ans, elle en a 13</span><br>Elle est plu(s) âgée que moi<br style="text-align: left;"><br style="text-align: left;"><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Elle veut goûter au chocolat</span><br style="text-align: left;"><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Au choco-qui ? Au choco-moi !</span><br>Au choco-quoi ? Au chocolat !<br style="text-align: left;"><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Mais pourquoi ? Je ne sais pas</span><br style="text-align: left;"><br style="text-align: left;"><span style="text-align: left;">[Refrain]</span><br style="text-align: left;"><br style="text-align: left;"><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Ma bite, ma bite, ma bite, ma bite</span><br>Oh<br>Ma bite, ma bite, ma bite, ma bite<br>Oh<br style="text-align: left;"></p><div><br></div>', NULL, 0, 'Campus', 3, 'non (raf)'),
(363, 16, 384, NULL, 'PS3 : Installation', '&nbsp;<ol><li>Rendez vous au QG Orga.<br></li><li>Retrouve ton co-orga.<br></li><li>Demande à l''Humain de vous donner des gilets jaunes et un talkie.<br></li><li>Rends toi au PS3&nbsp;&nbsp;(Au Sud Est du campus près du batîment B)&nbsp;</li><li>Prends les quelques barrière sur place de sorte à ne laisser passer que les voitures qui souhaitent sortir du campus.</li><li>Demande la sécu et préviens au talkie que tu es bien à poste<br></li></ol><p></p><p>Ta mission :&nbsp;Assurer la sécurité du festival et des courses en ne laissant passer aucun véhicule excepté&nbsp;:</p><p></p><ul><li>Les véhicules des secours (Pompiers, Police, etc..)<br></li><li>Les véhicules muni d''un passe sécu <u>pour le PS3</u></li></ul>Un exemple de pass sécu et l''autorisation de fermeture du campus sont disponible sur place.<br><div><br></div><div><div>En cas de problème / de doute demande le responsable sécurité au Talkie.&nbsp;N''hésite pas à prévenir de tout comportement anormaux. Si le talkie bip demande qu''on t''amène une batterie.<br>Si le talkie ne passe pas téléphone au 06.59.90.44.19 ou au 06.76.99.09.64<br>En cas d''urgence appel directement le PC sécu : 04.72.43.70.70</div><div>Reste bien à l''écoute de ce qui est dit au talkie cela te concerne peut être.</div></div><div><br></div><div><b><u>IMPORTANT :</u></b></div><div><ul><li><b><u>NE TE MET PAS EN DANGER (si le mec est un peu aigri laisse le&nbsp;tâter&nbsp;de la vauban et écarte toi)</u></b><br></li><li><b><u>NE QUITTE PAS TON POSTE TANT QUE LES SUIVANTS NE SONT PAS ARRIVES</u></b><br></li></ul><div><b><u><br></u></b></div></div><div>En cadeau voici les paroles de Petit Poney &nbsp;:</div><p></p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">[Refrain]<br>Petit poney, petit poney, tu es tout gris et tout petit, petit poney, petit poney.<br>Petit poney, petit poney, tu es tout gris et tout petit, petit poney, petit poney.</p><div><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">Petit poney, petit poney, tu gambades dans les prés sans te soucier du temps qui passe, petit poney, petit poney<br>La nuit qui tombe sur le pré c''est aussi ça la vie qui passe, petit poney, petit poney.</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">[Refrain]</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">Tu gambades dans les prés sans te soucier du temps qui passe, petit poney, petit poney<br>La nuit qui tombe sur le pré c''est aussi ça la vie qui passe, petit poney, petit poney</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">[Refrain] (x3)</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">Tu gambades dans les prés sans te soucier du temps qui passe, petit poney, petit poney<br>La nuit qui tombe sur le pré c''est aussi ça la vie qui passe, petit poney, petit poney</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">[Refrain]</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">Tu gambades dans les prés sans te soucier du temps qui passe, petit poney, petit poney<br>Et puis un jour un loup arrive avec 3 feuilles de salades il va manger le quadrupède.</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">[Refrain] (x2)</p></div>', NULL, 0, 'Campus', 3, 'non'),
(364, 16, 384, NULL, 'PS3 : Désinstallation', '<ol><li>Rends toi au PS3&nbsp;&nbsp;(Au Sud Est du campus près du batîment B)&nbsp;</li><li>Récupère le gilet jaune et le talkie de l''équipe précédente</li><li>Demande l''humain au talkie et préviens que tu est bien en poste.</li></ol><div>Ta mission : Assurer la sécurité du festival et des courses en ne laissant passer aucun véhicule excepté :<br></div><p></p><ul><li>Les véhicules des secours (Pompiers, Police, etc..)<br></li><li>Les véhicules muni d''un passe sécu <u>pour le PS3</u></li></ul><div>Un exemple de pass sécu et l''autorisation de fermeture du campus sont disponible sur place.<br></div><div><br></div>En cas de problème / de doute demande le responsable sécurité au Talkie.&nbsp;N''hésite pas à prévenir de tout comportement anormaux. Si le talkie bip demande qu''on t''amène une batterie.<br>Si le talkie ne passe pas téléphone au 06.59.90.44.19 ou au 06.76.99.09.64<div>En cas d''urgence appel directement le PC sécu : 04.72.43.70.70</div><div>Reste bien à l''écoute de ce qui est dit au talkie cela te concerne peut être.</div><div><br></div><div>A la fin de ta tache Dimanche à minuit:</div><div><ol><li>Préviens au talkie que tu va partir</li><li>Ouvre le passage en poussant les barrières sur la coté de la route.&nbsp;<br></li><li>Rentre au QG.<br></li><li>Dépose ton talkie et les gilets<br></li></ol></div><div><br></div><div><b><u>IMPORTANT :</u></b></div><div><ul><li><b><u>NE TE MET PAS EN DANGER (si le mec est un peu aigri laisse le&nbsp;tâter&nbsp;de la vauban et écarte toi)</u></b></li></ul><div><b><u><br></u></b></div></div><div>En cadeau voici les paroles de Petit Poney &nbsp;:</div><p></p><p style="margin: 0px 0px 1em; padding: 0px;">A la radio il y a poussin (x2)<br style="margin: 0px; padding: 0px;">Et le poussin Piou (x6)<br class="clear" style="margin: 0px; padding: 0px; clear: both;"></p><p style="margin: 0px 0px 1em; padding: 0px;">A la radio il y a une poule (x2)<br style="margin: 0px; padding: 0p