(365, 16, 384, NULL, 'PS3 : Point Sécu', '<ol><li>Rends toi au PS3&nbsp;&nbsp;(Au Sud Est du campus près du batiment B)&nbsp;</li><li>Récupère le gilet jaune et le talkie de l''équipe précédente</li><li>Demande&nbsp;l''Humain&nbsp;au talkie et préviens que tu es bien en poste</li></ol><div>Ta mission : Assurer la sécurité du festival et des courses en ne laissant entrer aucun véhicule excepté :<br></div><p></p><ul><li>Les véhicules des secours (Pompiers, Police, etc..)<br></li><li>Les véhicules munis d''un pass sécu&nbsp;<u>pour le PS3</u></li></ul><div>Un exemple de pass sécu et l''autorisation de fermeture du campus sont disponibles sur place.<br><br></div><div>En cas de problème / de doute demande le responsable sécurité au Talkie.&nbsp;N''hésite pas à prévenir de tout comportement anormaux. Si le talkie bip demande qu''on t''amène une batterie.<br>Si le talkie ne passe pas téléphone au 06.59.90.44.19 ou au 06.76.99.09.64<br>En cas d''urgence appel directement le PC sécu : 04.72.43.70.70</div><div>Reste bien à l''écoute de ce qui est dit au talkie cela te concerne peut être.</div><div><br></div><div><b><u>IMPORTANT :</u></b></div><div><ul><li><b><u>NE TE MET PAS EN DANGER (si le mec est un peu aigri laisse le&nbsp;tâter&nbsp;de la vauban et écarte toi)</u></b><br></li><li><b><u>NE QUITTE PAS TON POSTE TANT QUE LES SUIVANTS NE SONT PAS ARRIVES</u></b><br></li></ul><div><b><u><br></u></b></div></div><div>En cadeau voici les paroles de Petit Poney &nbsp;:</div><p></p><p style="margin: 0px 0px 1em; padding: 0px;">A la radio il y a poussin (x2)<br style="margin: 0px; padding: 0px;">Et le poussin Piou (x6)<br class="clear" style="margin: 0px; padding: 0px; clear: both;"></p><p style="margin: 0px 0px 1em; padding: 0px;">A la radio il y a une poule (x2)<br style="margin: 0px; padding: 0px;">La poule cot cot&nbsp;<br style="margin: 0px; padding: 0px;">Et le poussin piou (x5)<br class="clear" style="margin: 0px; padding: 0px; clear: both;"></p><p style="margin: 0px 0px 1em