 Glou glou<br style="margin: 0px; padding: 0px;">Et le coq cocorico&nbsp;<br style="margin: 0px; padding: 0px;">La poule cot cot&nbsp;<br style="margin: 0px; padding: 0px;">Et le poussin piou (x5)<br class="clear" style="margin: 0px; padding: 0px; clear: both;"></p><p style="margin: 0px 0px 1em; padding: 0px;">A la radio il y a un taureau (x2)<br style="margin: 0px; padding: 0px;">Et le taureau Muu<br style="margin: 0px; padding: 0px;">La vache Meuh<br style="margin: 0px; padding: 0px;">L''agneau Mêê<br style="margin: 0px; padding: 0px;">La chèvre bêê<br style="margin: 0px; padding: 0px;">Et le chien Ouaf Ouaf<br style="margin: 0px; padding: 0px;">Et le chat Miaou<br style="margin: 0px; padding: 0px;">Et le pigeon Roucoule<br style="margin: 0px; padding: 0px;">Et la dinde Glou glou<br style="margin: 0px; padding: 0px;">Et le coq cocorico&nbsp;<br style="margin: 0px; padding: 0px;">La poule cot cot&nbsp;<br style="margin: 0px; padding: 0px;">Et le poussin piou (x4)<br class="clear" style="margin: 0px; padding: 0px; clear: both;"></p><p style="margin: 0px 0px 1em; padding: 0px;">A la radio il y a un tracteur (x2)<br style="margin: 0px; padding: 0px;">Et le tracteur Bruum<br style="margin: 0px; padding: 0px;">Le tracteur Bruum<br class="clear" style="margin: 0px; padding: 0px; clear: both;"></p><p style="margin: 0px 0px 1em; padding: 0px;">Le tracteur Bruum<br style="margin: 0px; padding: 0px;">Et le poussin.. (crouic)<br style="margin: 0px; padding: 0px;">Oh oh !&nbsp;<br class="clear" style="margin: 0px; padding: 0px; clear: both;"></p><div><strong style="margin: 0px; padding: 0px;"><br></strong></div>', NULL, 0, 'Campus', 3, 'non (raf)'),
(366, 21, 338, NULL, 'Aller chercher les tables GMD et le matos de la cave du PC', '<p></p><ul><li>RDV au QG orga<br></li><li>Retrouve Cetelem</li><li>Demander les clefs de Bradley le 20m3 et une clef pompier aux humains</li><li>Monter dans Bradley et c''est parti pour le PC !</li><li>Aller garer le 20m3 derrière les travées du PC, devant GMD grâce à la clef pompier</li><li>Aller voir monsieur Fabrice Ville (l''unique !) ou Claude Courtois</li><li>Dis lui que tu es des 24 et que tu viens chercher les tables (parce que c''est cool)</li><li>Charger les tables dans le 20m3 (correctement, il y en a moult autres à mettre dedans)</li><li>Marquer toutes les tables avec un scotch elec blanc (cetelem te donnera le rouleau)</li><li>Dire merci</li><li>Reculer le 20m3 jusque devant la 1ère travée</li><li>Aller à la dirpat chercher les clefs de la cave PC (bien demander celles de derrière sinon c''est masse la merde)</li><li>Charger dans l''ordre :</li></ul><u>- 35 grandes tables<br>- toutes les tables 2 places de la cave (moultimoultimoultimultimoult)</u><div><u>- 30 chaises</u><br><ul><li>Marquer tout le matos d''un scotch elec orange (cetelem te donnera le rouleau)</li><li>Sortir du chemin, refermer la barrière pompier</li><li>Rendre les clefs à la dirpat et dire merci</li><li>Aller devant l''AIP et se garer le plus près possible des caisses</li><li>Décharger toutes les chaises et <u>33 tables 2 places</u> dans l''AIP</li><li>Charger 16 bancs de Villeurbanne dans le 20m3 (ils sont dans la benne de Villeurbanne devant l''AIP)</li><li>Attendre les orgas suivant pour la tâche qui arrive.</li></ul><p></p></div>', NULL, 0, 'QG Orgras', 3, 'non (raf)'),
(367, 223, 337, NULL, 'Livraison Pomona', '<p></p><ul><li>Rends-toi au bar bouffe de l''ambiance et demande Mamie Caro (06 79 12 17 05).</li><li>Aide-la à réceptionner les produits Pomona et les stocker dans les camions frigo. Remplis aussi à fond les congélos de frites (mets-en beaucoup, y''a d''la profondeur)</li></ul><p></p>', NULL, 0, 'Bar bouffe', -1, 'non'),
(368, 206, 337, NULL, 'Livraison camion frigo GR', '<p>A compléter</p>', NULL, 0, 'Bar bouffe', -1, 'non'),
(369, 223, 334, NULL, 'Conducteur - Pain GR', '<p>Aller chercher le pain que nous donne le Grand Restaurant (il y en a pour le QG orga à répartir et pour la bouffe artiste).</p><p>Prends Brandon le 20m3 au QG orga à la Rotonde (récupère les clés auprès de l''humain) et rends toi à l''arrière du Grand Resto. Demande aux magasiniers le pain qu''ils ont pour toi. S''il y a un problème, contacte Léo (07 77 89 97 97) ou Caro (06 79 12 17 05).</p><p>Va à la MdE pour la bouffe artiste (s''adresser au Troll au 1er étage par l''escalier de derrière au&nbsp;<span style="line-height: 20px; background-color: rgb(255, 255, 255); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); font-size: 14px;">06 61 41 15 17&nbsp;</span>pour qu''il t''ouvre !)</p><p>Puis va au QG pour donner le reste !! ATTENTION : au QG, bien faire le tri entre les destinataires des baguettes et mettre une feuille entre les tas de baguettes pour ne pas les mélanger.&nbsp;</p><p>Vendredi (671 Baguettes) :&nbsp;</p><ul><li><b>à la MDE</b>&nbsp;pour la bouffe artistes :&nbsp;<b>36</b>&nbsp;baguettes&nbsp;</li><li><b>au QG</b>&nbsp;:&nbsp;<b>120</b>&nbsp;baguettes pour la bouffe Orga /&nbsp;<b>0</b>&nbsp;baguette pour les courses /&nbsp;<b>15</b>&nbsp;baguettes pour la sécu</li><li><b>au QG bien à part</b>&nbsp;pour le stand bouffe :&nbsp;<b>500</b>&nbsp;baguettes</li></ul><p>Samedi (1267 Baguettes + <u>les quelques litres de lait que le GR nous donne</u>) :&nbsp;</p><div><ul><li><b>à la MDE</b>&nbsp;pour la bouffe artistes :&nbsp;<b>72</b>&nbsp;baguettes&nbsp;</li><li><b>au QG</b>&nbsp;:&nbsp;<b>220</b>&nbsp;baguettes pour la bouffe Orga (<b><u>et les quelques litres de lait que tu récupéreras</u></b>) /&nbsp;<b>60</b>&nbsp;baguettes pour les courses /&nbsp;<b>15</b>&nbsp;baguettes pour la sécu</li><li><b>au QG bien à part</b>&nbsp;pour le stand bouffe :&nbsp;<b>900</b>&nbsp;baguettes</li></ul><div><p>Dimanche (1005 Baguettes) :&nbsp;</p><ul><li><b>à la MDE</b>&nbsp;pour la bouffe artistes :&nbsp;<b>50</b>&nbsp;baguettes&nbsp;</li><li><b>au QG</b>&nbsp;:&nbsp;<b>240</b>&nbsp;baguettes pour la bouffe Orga /&nbsp;<b>150</b>&nbsp;croissants et&nbsp;<b>200</b>&nbsp;pains au chocolat pour les courses /&nbsp;<b>15</b>&nbsp;baguettes pour la sécu</li><li><b>au QG bien à part</b>&nbsp;pour le stand bouffe :&nbsp;<b>700</b>&nbsp;baguettes</li><li>Attention ! Tu ne peux pas aller jusqu''à la Rotonde avec ton camion. Va jusqu''au dépot AIP (il faudra en demander les clés avant, en même temps que le 20m3), récupère des caddies, mets le pain dedans et va jusqu''au QG. :)</li></ul></div></div><p>Et n''oublie pas de rendre les clés de Brandon à l''humain avant de partir !<br></p><p>(si tu ne peux pas aller à la Bouffe Artistes, laisse tout au QG orga mais demande bien à ce que la Bouffe Artistes soit prévenue que son pain est au QG!!)</p>', NULL, 0, 'QG Orga', 3, 'non (raf)'),
(370, 21, 421, NULL, 'Emmener le matériel des courses', '<p>Local -&gt; club rock</p>', NULL, 0, 'Local des 24H', -1, 'non'),
(371, 21, 335, NULL, 'Rangement des dépôts', '<p></p><div>Retrouve ton co-log !</div><div>Jouer à chassoba</div><div>Envoyer celui qui perd au QG orga</div><div>Ramener la clef des dépôt AIP et humas ainsi que de la bouffe pour le vainqueur au dépôt AIP</div><div>Manger</div><div>Faire le point sur la journée : ce qui est allé, ce qui a été en retard, ...</div><div><br></div><div>Ranger le dépôt AIP si c''est la merde&nbsp;</div><div>Prendre la liste du matos AIP dans ton sac et regarder vite fait qu''il ne manque rien</div><div>ça sert à rien de perdre 2h à tout ranger extrêmement bien, demain ce sera la merde</div><div><br></div><div>Fermer le dépôt AIP</div><div>aller au dépôt Humas,</div><div>Faire la même chose qu''à l''AIP</div><p></p>', NULL, 0, 'Dépôt AIP', 3, 'non'),
(372, 45, 307, NULL, 'Tâche sans nom', 'blank', NULL, 0, 'Grande scène', -1, 'non'),
(373, 9, 422, NULL, 'Discours Podium MdE', '<P></P>\r\n<UL>\r\n<LI>Se retrouver au niveau de la scène MdE</LI>\r\n<LI>Etre bien habillé - autrement dit s''enlever la boue des cheveux et prendre des vêtements corrects<BR></LI>\r\n<LI>Accueillir les invités comme il se doit (à grands coups de langue sur le visage et sur leur ****(**) // Les présidents des groupes régionaux de l''AIDIL arriveront les premiers vers 12h45, ils seront 25, il faudra s''assurer qu''ils aient bien à manger car ils partiront vers 14h</LI>\r\n<LI>Décompresser en allant chercher auprès du Troll à la Ba (1er étage de la MdE) quelques plateaux d''amuse-bouches s''il n''y en a plus en bas</LI>\r\n<LI>Manger et préparer les micros jusqu''à environ 13h30</LI>\r\n<LI>Aller chercher quelques bouteilles d''eau à la BA ou au QG Orga pour les prestateurs oraux de la scène</LI>\r\n<LI>13h30-14h00 :<BR>o Mot du Président des 24H de l’INSA : présentation du festival et des nouveautés de<BR>cette 40ème édition<BR>o Mot d’anciens organisateurs<BR>o Mot de M. Le maire de Villeurbanne selon sa disponibilité<BR>o Mot du Directeur de l’INSA de Lyon<BR>o Conclusion du Président des 24H de l’INSA<BR>o Lancement de la course cycliste de 24 Heures (coupage du ruban) et tour d’honneur<BR>avec les coureurs.<BR></LI>\r\n<LI>Fini de casser des culs on peut faire un tour d''honneur avec MauMau si on en a envie</LI></UL>\r\n<P></P>', 'Force - Coconut - Fougère', 0, 'Podium MDE', 3, 'non');
INSERT INTO `Tache` (`id`, `responsable_id`, `groupetache_id`, `importid`, `nom`, `consignes`, `materielSupplementaire`, `permisNecessaire`, `lieu`, `statut`, `commentaireLog`) VALUES
(374, 9, 422, NULL, 'Installation podium MdE', '<P><SPAN style="FONT-SIZE: 13.5pt">*Rejoins l''Anguille au dépôt humas (appelle-moi si je ne suis pas là au 07.86.39.70.45)</SPAN></P>\r\n<P><SPAN style="FONT-SIZE: 13.5pt">* Va chercher une tente 3*3, une tente 2*3, 4 tables et 20 chaises au dépôt Humas</SPAN></P>\r\n<P><SPAN style="FONT-SIZE: 13.5pt">* Emmène tout ça au niveau du patio MdE</SPAN></P>\r\n<P><SPAN style="FONT-SIZE: 13.5pt">* Monte la tente 3*3 sur le podium MdE et met une table dessous</SPAN></P>\r\n<P><SPAN style="FONT-SIZE: 13.5pt"></SPAN><SPAN style="FONT-SIZE: 13.5pt">* Il y aura une sono, c''est l''heure de tester que tout fonctionne, notamment les micros ("Test - Testitest - Testitestoune")<BR></SPAN></P><SPAN style="FONT-SIZE: 18px">* Installe les chaises face au podium, met-en place les autres tables et place au dessus la tente 2*3, ensuite, monte à l''étage de la MdE et demande au Troll de te donner des plateaux de bouffe à descendre sur les tables<BR><BR>* Va ensuite récupérer la signalétique (4 panneaux A3 plastifiés) et va les installer avec du fil de fer là où on te l''indiquera (abords de la MdE)<BR><BR></SPAN><SPAN style="FONT-SIZE: 13.5pt"></SPAN><SPAN style="FONT-SIZE: 13.5pt">* En cas d''intempéries, attend les directives de L''Anguille</SPAN><SPAN style="FONT-SIZE: 13.5pt"><BR></SPAN><SPAN style="FONT-SIZE: 13.5pt"></SPAN><SPAN style="FONT-SIZE: 13.5pt"><BR></SPAN><SPAN style="FONT-SIZE: 13.5pt">* Il y aura probablement un peu de déco, si besoin, installe là</SPAN> \r\n<DIV><FONT size=4><BR></FONT></DIV>\r\n<DIV><SPAN style="FONT-SIZE: 18px">* Si de la bouffe est en place fait attention à ce que les badaux n''y touchent pas</SPAN><FONT size=4><BR></FONT>\r\n<DIV>\r\n<P><SPAN style="FONT-SIZE: 13.5pt"><BR></SPAN></P>\r\n<P><SPAN style="FONT-SIZE: 13.5pt">Merci bien, gros bisous :-)*</SPAN></P></DIV></DIV>', 'Charisme - Volupté - Finesse', 0, 'Dépôt Humas', 3, 'non'),
(375, 14, 347, NULL, 'Clés Club Rock', '<p></p><ul><li>Vérifie que tu as bien un chèque de caution de 400E à l''ordre de "Club Rock INSA"<br></li><li>Va au club Rock et retrouve Sylvain Taif (tel : &nbsp;06 59 94 00 96)<br></li><li>Fait l''état des lieux<br></li><li>Donne le chèque et récupère la clé<br></li><li>Rentre à la maison !<br></li></ul><p></p>', 'Chèque de 400E à l''ordre de "Club Rock INSA"', 0, 'Club Rock', 3, 'non'),
(376, 14, 347, NULL, 'Retour clés Club Rock', '<p></p><ul><li>Va au local<br></li><li>Récupère la clé du club Rock auprès des zumains d''amour<br></li><li>Va au club Rock et retrouve Sylvain Taif (tel : 06 59 94 00 96)<br></li><li>Donne lui les clés et récupère le chèque de caution<br></li></ul><p></p>', NULL, 0, 'Local', 3, 'non'),
(377, 31, 423, NULL, 'Valider les inscriptions', '<p>Prendre dans le casier pédales le courrier des coureurs arrivé<br><br>Aller\r\n sur un ordi (amener plutot le tien) et enregistrer toutes les nouvelles \r\ninscriptions à valider depuis la partie admin du site d''inscription. \r\n(valider paiement, carte étudiante, certificat).</p>Ranger les documents dans le classeur de la bonne course.<br><br>Ouvrir la boîte courses et répondre aux questions des coureurs.', 'Pochettes plastiques\r\nClasseur Courses\r\nStylo', 0, 'Bocal', 3, 'non'),
(378, 9, 422, NULL, 'Installation Salon de Lecture / BA', '<p></p>\r\n<ul>\r\n<li>Salut à toi ! Commence donc par appeler l''Anguille au 07.86.39.70.45 pour le prévenir de ton arrivée à la MdE</li></ul>\r\n<ul>\r\n<li>Va ensuite au dépôt Humas et ramène 4 tables (2 places), un rouleau de nappe en papier, 5 grilles d''exposition, 3 chaises, le pack "Histoire des 24H", 1 multiprise (4prises), 2 rallonges de 3 mètres dans le salon de lecture à l''étage de la MdE</li></ul>\r\n<ul>\r\n<li>Maintenant, va au QG Orga et demande aux humains de te donner un vidéoproj et un ordinateur qui t''attendront là-bas, profite-en pour prendre quelques sacs poubelles et de quoi nettoyer - tout çà ira aussi au salon de lecture<br></li></ul>\r\n<ul>\r\n<li>Va ensuite trouver le Troll qui sera sûrement aussi à l''étage de la MdE<br></li></ul>\r\n<ul>\r\n<li>Dis lui que tu es là pour installer la déco pour le cocktail de presse et installer la nourriture</li></ul>\r\n<ul>\r\n<li>Une sono aura été installée par K-le-son, teste-la</li></ul>\r\n<ul>\r\n<li>Maintenant tu vas devoir apporter des plateaux de délicieuses gâteries MAIS PAS TOUCHE, si tu es sage je te laisserais peut-être y goûter ensuite !</li></ul>\r\n<ul>\r\n<li>Toute la déco et la nourriture doivent être prêt pour 13h45</li></ul>\r\n<ul>\r\n<li>Je (l''Anguille) ferais aussi appel à toi pour m''aider à descendre de la nourriture dans le patio et faire le service pendant les discours de lancement de la course</li></ul>\r\n<ul>\r\n<li>Je serais dans le patio, au moindre problème appelle-moi, et si jamais je ne réponds descends me chercher en bas (tu me reconnaîtras facilement je dispose d''une aura charismatique hors-du-commun)</li></ul>\r\n<ul>\r\n<li>Un peu avant 14h, il faudra que tu ouvres la porte du pilier et que tu prépares la transition vers le salon de lecture</li></ul>\r\n<ul>\r\n<li>Je compte tellement sur toi &lt;3<br></li></ul>\r\n<p></p>', 'Hardiesse - Bonne Humeur - Souplesse', 0, 'Patio MdE / MdE', 3, 'raf'),
(379, 14, 424, NULL, 'Balade Matinale', '<p>Fais le tour du campus et vérifie que tout va bien</p><p>Si jamais c''est déjà la merde, aller se recoucher :)</p>', NULL, 0, 'ZC', 3, 'non'),
(380, 9, 422, NULL, 'Cocktail a.k.a. Du Lourd', '<ul>\r\n<li>"C''est l''heure du graillon!" "On fait péter le champagne!"</li></ul>\r\n<ul>\r\n<li>Retrouve moi (L''Anguille) au niveau de la MdE ==&gt; préviens moi de ton arrivée au 07.86.39.70.45 si tu ne me vois pas</li></ul>\r\n<ul>\r\n<li>Pour cette tâche tu devras être bien vêtu - met donc de côté ton T-shirt Orga orange flashy et sors la chemise ou <strike>tes seins</strike> ton plus bel appareil (PS: je ne parle clairement pas de cet appareil - donc range çà tout de suite !!!)</li></ul>\r\n<ul>\r\n<li>Monte au salon de lecture où seront normalement déclinés de délicieux mets sur des tables bien dressées et décorées</li></ul>\r\n<ul>\r\n<li>Clairement tu n''es pas là pour bouffer - mais plutôt pour faire le service et faire bonne impression auprès de la Direction, de la Mairie et des gens qui seront présents</li></ul>\r\n<ul>\r\n<li>Assure toi alors que tout le monde est servi</li></ul>\r\n<ul>\r\n<li>Si besoin, va chercher plus de nourriture ou de crémant à la Bouffe Artiste de l''autre côté de la MdE à l''étage</li></ul>\r\n<ul>\r\n<li>Fais tourner le stand "Histoire des 24H" - Alice et Daphnéné t''expliqueront</li></ul>\r\n<ul>\r\n<li>A partir de 14h10 on redescendra pour démonter ce qu''on aura mis sur le podium (ranger la tente 3*3m, la tente 2*3m au dépôt humas ainsi que les 4 tables et les 20 chaises) - pour la sono du podium, on débranche le tout et on la rangera au QG Orga // Il faudra en permanence que quelqu''un guette le matos du podium et essaie de ranger au maximum et de finir de rapatrier les brebis (ou membre de la Direction) égarées<br></li></ul>\r\n<ul>\r\n<li>Mets les déchets à la poubelle avant qu''il ne s''accumule</li></ul>\r\n<ul>\r\n<li>Après le départ du dernier invité (vers 15h je pense), ramène les restes au QG Orga ou à la BA selon ce qu''on te dira</li></ul>\r\n<ul>\r\n<li>Ramène au QG Orga l''ordinateur et le vidéoproj</li></ul>\r\n<ul>\r\n<li>Au QG Orga, récupère de quoi nettoyer (éponge, produits...) s''il n''y en pas au salon de lecture</li></ul>\r\n<ul>\r\n<li>Nettoie et range</li></ul>\r\n<ul>\r\n<li>Ramène au dépôt humas 4 tables (2 places), un rouleau de nappe en papier, 5 grilles d''exposition, 3 chaises, le pack "Histoire des 24H", 1 multiprise (4prises), 2 rallonges de 3 mètres // Assure-toi que Caleçon vienne bien ranger les enceintes</li></ul>\r\n<ul>\r\n<li>C''est tout.<br></li></ul>\r\n<p>Si tous ces point sont bien remplis, je t''inviterais à t''enjailler avec nous !!!<br></p>', 'Feutrine - Honneur - Charisme\r\n+ des fringues classes / swag / hype', 0, 'Patio MdE / MdE', 3, 'non (raf)'),
(381, 14, 424, NULL, 'Gérer tous les problèmes', '<p>Ecouter ton talkie et gérer tous les problèmes logistiques</p><p>Chanter "Jaune", "Rouge", Francky Vincent, Le connemara, L''aventurier etc etc</p><p>Pine d''Ours, couille d''éléphant, peau de chacal et pomme d''enfant&nbsp;</p><p>J''ai rencontré ce matin devant la haie de mon champ _&nbsp;Une troupe de marins, d''ouvriers, de paysans<br style="margin: 0px; padding: 0px; list-style-type: none;">Où allez-vous camarades avec vos fusils chargés _&nbsp;Nous tendrons des embuscades viens rejoindre notre armée<br style="margin: 0px; padding: 0px; list-style-type: none;">La voilà la Blanche Hermine vive la mouette et l''ajonc _&nbsp;La voilà la Blanche Hermine vive Fougères et Clisson<br style="margin: 0px; padding: 0px; list-style-type: none;"><br>51, je t´aime _&nbsp;J´en boirai des tonneaux [et des tonneaux] _&nbsp;A me rouler par terre, dans tous les caniveaux<br><br>Et si tu m´abandonne, _&nbsp;Alors je m´empoisonne _&nbsp;Avec une bonbonne, _&nbsp;D´un bon Ricard bien jaune<br><br>51, je t´aime _&nbsp;J´en boirai des tonneaux [et des tonneaux] _&nbsp;A me rouler par terre, dans tous les caniveaux<br><br>Nono va au Brésil, _&nbsp;Pour danser la Samba, _&nbsp;Il va de ville en ville, _&nbsp;Répendre le SIDA<br></p>', NULL, 0, 'ZC', 3, 'non'),
(382, 14, 424, NULL, 'Ami du soir, bonsoir !', '<p></p><ul><li>Retrouve ton co log</li><li>Fait un tour de tous les problèmes qu''il y a eu pendant la journée</li><li><span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;">Objectif :&nbsp;<br></span><span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;">boire du pastis&nbsp;<br></span><span style="background-color: rgb(255, 255, 255);"><font color="#222222" face="arial, sans-serif" size="2">manger les crêpes qui seront faites avec amour par les mamans, les croque monsieur de l''ambiance et n''oublie pas </font><u style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;">le&nbsp;</u><font color="#222222" face="arial, sans-serif" size="2"><u>pâté</u></font><br></span><span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;">parler du passé&nbsp;<br></span><span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;">parler du présent<br></span><span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;">parler du futur&nbsp;<br></span><span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;">boire du pastis&nbsp;<br></span><span style="background-color: rgb(255, 255, 255);"><font color="#222222" face="arial, sans-serif" size="2">manger du fromage et du saucisson et </font><u style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;">du&nbsp;</u><font color="#222222" face="arial, sans-serif" size="2"><u>pâté</u></font><br></span><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">parler des projets accomplis de l''orga&nbsp;Log</span><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">&nbsp;<br></span><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">parler des projets en cours de l''orga&nbsp;Log</span><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">&nbsp;<br></span><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">parler des projets prévus par l''orga&nbsp;Log</span><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">&nbsp;<br></span><span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;">boire du pastis&nbsp;<br></span><span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;">manger du fromage et du saucisson</span></li><li>Dès que c''est fini, go au dodo</li></ul><p></p>', NULL, 0, 'ZC', 3, 'non'),
(383, 9, 425, NULL, 'Installation Vendredi', '<p></p><ul><li>RdV au QG Orga pour récupérer les clés de la salle de l''espace VIP, prend au passage un kit entretien (sacs poubelles, éponges etc...) et des ciseaux et du scotch si tu n''en as pas (tu ramèneras ce que tu as pris à la fin de la tâche)<br></li></ul><ul><li>Va récupérer au dépôt Humas: une tente 3*2, 2 multiprises 4 prises, des plateaux de type "Beurk", 1 nappe en papier puis passe à l''étage de la MdE prendre de la bouffe et du crémant</li></ul><ul><li>Amène tout çà à l''espace VIP au RdC au milieu du Bât.Coulomb et dispose la bouffe et le petit matos à l''intérieur, met la nappe sur les tables et pose un peu de déco s''il y en a<br></li></ul><ul><li>Monte la tente devant la porte</li></ul><ul><li>Ramener les clés au QG Orga<br></li></ul><ul><li>C''est parfait, bisoux<br></li></ul><ul></ul><p></p>', 'Barbe - Chèvre - Artic Monkeys', 0, 'QG Orga', 3, 'non'),
(384, 40, 352, NULL, 'Préparation du couscous', '<p>Avant de pouvoir manger le couscous, il va falloir le préparer! Appelle Fatna au talkie ou sur son téléphone (06 06 90 95 92), pour qu''elle te montre une recette dont elle seule a le secret! :)</p>', 'De la bonne humeur et du charisme :) \r\n( grosse dédi Alexis <3 )', 0, 'GCU', 3, 'non'),
(385, 9, 425, NULL, 'Installation Samedi', '<p></p><ul><li>RdV au QG Orga pour récupérer les clés de la salle de l''espace VIP, \r\nprend au passage un kit entretien (sacs poubelles, éponges etc...) et \r\ndes ciseaux et du scotch si tu n''en as pas (tu ramèneras ce que tu as pris à la fin \r\nde la tâche)</li></ul><ul><li>Va\r\n récupérer au dépôt Humas: une tente 2*3 et une nappe (si besoin) puis passe à l''étage de la \r\nMdE prendre de la bouffe et du crémant</li></ul><ul><li>Amène tout çà à \r\nl''espace VIP au RdC au milieu du Bât.Coulomb et dispose la bouffe à l''intérieur et pose un peu de\r\n déco s''il y en a<br></li></ul><ul><li>Monte la tente devant la porte</li></ul><ul><li>Ramène les clés au QG Orga<br></li></ul>C''est parfait, bisoux<p></p>', 'Bonheur - Robustesse - Hardiesse', 0, 'QG Orga', 3, 'non'),
(386, 9, 425, NULL, 'Fermer l''espace VIP', '<P></P>\r\n<UL>\r\n<LI>RdV à l''espace VIP (le Bat Coulomb c''est celui entre GCU et les Humas) puis direction le QG Orga pour récupérer les clés de la salle de l''espace VIP, prend au passage un kit entretien (sacs poubelles, éponges etc...) et des ciseaux si tu n''en as pas (tu ramèneras ce que tu as pris à la fin de la tâche)</LI></UL>\r\n<UL>\r\n<LI>Viens m''aider à ranger l''espace VIP - nettoyage des tables, vidage des poubelles et finissage des bières au menu<BR></LI></UL>\r\n<UL>\r\n<LI>Plie la tente 3*3 et ramène là au dépôt Humas<BR></LI></UL>\r\n<UL>\r\n<LI>Ferme la salle à double-tour<BR></LI></UL>\r\n<UL>\r\n<LI>Ramène les clés au QG Orga<BR></LI></UL>C''est parfait, bisoux\r\n<P></P>', 'Fermeté - Prospérité - Extase', 0, 'Salle du milieu au RdC de Coulomb', 3, 'non'),
(387, 9, 422, NULL, 'Installation de la sono', '<P></P>\r\n<UL>\r\n<LI>Wesh grosse Daph''</LI></UL>\r\n<UL>\r\n<LI>Va chercher la sono au QG Orga (2 enceintes + table de mixage + 2 micros) puis passe au dépôt Humas pécho une rallonge de moultimètres (10-20m)</LI></UL>\r\n<UL>\r\n<LI>Va l''installer avec moi-même sur le podium de la MdE</LI></UL>\r\n<UL>\r\n<LI>Branche là et testitestoune-la</LI></UL>\r\n<UL>\r\n<LI>Chante une chanson pour être vraiment sûr</LI></UL>\r\n<UL>\r\n<LI>On invite Micko Black et Alain34 pour être vraiment vraiment sûr que la sono retransmette bien les voix des gens</LI></UL>\r\n<UL>\r\n<LI>Si y a un problème on appelle la grosse Carlita (06.32.03.33.74) parce que la log c''est la branlette</LI></UL>\r\n<UL>\r\n<LI>"1-2 1-2 est-ce que vous m''entendez ? A -AA -B -Test-Test-" "...." (là on teste notre silence bien près du micro pour voir si ca retransmet bien le silence, car c''est important)<BR></LI></UL>\r\n<P></P>', 'Foutre - Ferveur - Fakir', 0, 'QG Orga', 3, 'non'),
(388, 9, 416, NULL, 'Installation de la sono', '<p></p><ul><li>Haha tu as cru que c''était fini hier ? Hé bah non !<br></li></ul><ul><li>Va chercher la sono au QG Orga (2 enceintes + table de mixage + 2 micros) + une rallonge de moultimètres (10-20m)</li></ul><ul><li>Va l''installer avec moi-même sur le podium de la MdE</li></ul><ul><li>Branche là et testitestoune-la</li></ul><ul><li>Chante une chanson pour être vraiment sûr</li></ul><ul><li>On invite Micko Black et Alain34 pour être vraiment vraiment sûr que la sono retransmette bien les voix des gens</li></ul><ul><li>Si y a un problème on appelle la grosse Carlita (0632033374) parce que la log c''est la branlette</li></ul><ul><li>"1-2\r\n 1-2 est-ce que vous m''entendez ? A -AA -B -Test-Test-" "...." (là on \r\nteste notre silence bien près du micro pour voir si ca retransmet bien \r\nle silence, car c''est important) </li></ul><p></p>', 'Travestissement - Adresse - Jugement', 0, 'Patio MdE', 3, 'non'),
(389, 214, 410, NULL, 'Installation du stand accueil', '<p>Rejoins Alice au stand accueil, devant GCU. <br></p><p>Va chercher le matos du stand accueil au dépôt AIP. Prends :&nbsp;</p><div>- 2 chaises</div><div>- 2 grilles d''exposition</div><div>- 1 tente 3x3</div><div>- le kit accueil et le kit tee shirt (au même endroit normalement!)</div><div>Si tu ne trouves pas un truc, appelle Cetelem - 06 80 52 08 62</div><div><br></div><div>Amène tout ça à l''angle des bars, devant GCU pour installer le stand!&nbsp;</div><div><br></div><div>Mets les t-shirt et les programmes en exposition sur le stand.&nbsp;<br><br></div><div>Attends les orga qui viennent tenir le stand (ne pars pas avant leur arrivée!!)&nbsp;</div><p></p>', '- kit accueil\r\n- kit t-shirt', 0, 'Devant GCU, à l''angle des bars', 3, 'non'),
(390, 9, 427, NULL, 'Pignole 1', '<p></p><ul><li>Photographes (Accueillir et donner les bracelets &nbsp;LMW, SoonNight, MxL, EN... + aller voir La Mouette et Graines d''Image)</li></ul><ul><li>Si mon NoteBook est toujours en vie le ramener, sinon laisser tomber et faire de la MAJ Facebook sur mon téléphone</li></ul><ul><li>Partenaires si besoin</li></ul><ul><li>Dernières vérif <strike>RB</strike>/PL/Virgin</li></ul><ul><li>Checker PLV en général sur les bars</li></ul><ul><li><strike>Facing RB - rester derrière Mazimann et son manager</strike>&nbsp;Si je croise Mazimann, rester en bons termes</li></ul><ul><li>Si AMARIS vanter les T-shirts orgas (ouahou le orange c''est trop fashion - vraiment novateur !!!)</li></ul><ul><li>Voir pour l''histoire entre GI et LWM // Aftermovie ?</li></ul><ul><li>Se toucher</li></ul><ul><li>Se retoucher parce que se toucher c''est vraiment bien</li></ul><ul><li>Vérifier que la log me met bien tous mes canaps dans l''espace VIP entre 18 et 19</li></ul><ul><li>Penser à faire des post Facebook</li></ul><ul><li>Glander</li></ul><ul><li>Faire caca</li></ul><p></p>', 'Bite - Couteau - Charisme', 0, 'Dans ta chatte', 3, 'raf'),
(391, 9, 427, NULL, 'Pignole 2', '<p></p><ul><li>Finir d''installer l''espace VIP</li></ul><ul><li>Si j''ai réussi à avoir des gens de la presse électro essayer de discuter avec eux et de racheter un max de terrain</li></ul><ul><li>Se toucher</li></ul><ul><li>Aller se toucher derrière les bars</li></ul><ul><li>Boire de la bière</li></ul><ul><li>A l''entrée des gens dans la zone revérifier que RedBull est bien dehors des bars ou alors en train de discuter avec moi</li></ul><ul><li>Gérer les invitations et s''il y a des gens des autres INSA gérer l''accueil</li></ul><ul><li>Aller voir les représentants étudiants quand ils arrivent</li></ul><ul><li>Si rien à faire rester à proximité de l''espace VIP et aller aider au bar<br></li></ul><p></p>', 'Truffade de morue - Ourang-outan - Grosse Chamelle dans une petite chatte borgne et boîteuse', 0, 'Dans ta chatte', 3, 'non'),
(392, 9, 427, NULL, 'Pignole 3', '<p></p><ul><li>Faire du social</li><li>Essayer de pécho une meuf bonne<br></li><li>Se rabattre sur une meuf saoule</li><li>Parler au talkie</li><li>Si y a du monde faire du social et être gentil</li><li>Se la racler</li><li>Parler au chap''s devant l''espace</li><li>Checker les photographes</li><li>Guetter</li><li>Boire et me concentrer sur mon avenir</li><li>En fin de soirée commencer à ranger</li><li>Si vraiment personne, fermer plus tôt l''espace VIP et aller au bar</li></ul><p></p>', 'Prudence - Chasteté - Crémant', 0, 'Dans ta chatte', 3, 'non'),
(393, 9, 427, NULL, 'Pignole 4', '<p></p><ul><li>Arriver tranquille dans la place (Sisi Ouaiouai)</li><li>S''enjailler</li><li>Faire un bilan avec les potographes et les partenaires de toutes sortes</li><li>Boire et fumer</li><li>S''enjailler</li><li>Se toucher en narguant Louis si je le croise et qu''il essaie de porter des fûts malgré l''épuisement</li><li>Jouer avec une écocup</li><li>Social Club<br></li></ul><p></p>', 'Pute - Pute - Puputte', 0, 'Dans ta chatte', 3, 'non'),
(394, 23, 364, NULL, 'Thanks everyone!', '<p>Du coup cette année le nom de la tâche est en anglais parce que le président est trop bilingue ( se prononce bi-ling).</p><div>Cours au terrain d''athlétisme où le feu d''artifesse va bientôt être tiré!&nbsp;</div><div><br></div><div>Rejoins les autres orgas, soft ou hard pas de différences, de toute façon on est tous des enculés! :p</div><div><br></div><div>Raconte leur les petites anecdotes qui se sont déroulées pendant la manif, des points sécu de l''ambiance aux éventuelles choppes improbables (si si je te jure ça arrive même aux meilleurs orgas).</div><div><br></div><div>Le feu d''artifice commence! Admire le avec tous les gens qui ont fait de cette édition une édition de folie ultra charismatique qui restera dans les annales de l''ambiance!</div><div><br></div><div>Essaie de ne pas verser de larmichettes devant ce spectacle de toute beauté. Si tu en verses t''es un peu une tafiole mais on t''aime quand même &lt;3</div><div><br></div><div>Une fois fini, attends le discours ultra charismatique du prez (si sa bouche n''est pas déjà occupée si tu vois ce que je veux dire ^^)</div><div><br></div><div>Rejoins tes camarades pour la traditionnelle photo de famille et fais des gros bibis à tout le monde &lt;3</div><div><br></div><div>Puis.. c''est parti pour une dernière nuit de folie. Tu t''es éclaté pendant tout le week-end ? Maintenant il faut mettre la main à la pâte pour que demain on ait l''impression qu''il s''est rien passé sur le campus..! (hein ? un festival ? où ça ?)<br></div><div><br></div><div>Dans tous les cas, on te remercie pour ton aide précieuse et on t''attend l''année prochaine pour la 41e édition! :)</div><div><br></div><div><br></div><p></p>', NULL, 0, 'Grande scène!', 3, 'non'),
(395, 28, 428, NULL, 'Barriérage Point Sécu', '<p>Se rendre au QG Retrouver Guerric (0604476430)<br><br>Prendre les clefs d''un 20m3<br><br>Aller au dépôt Eiffel et charger le 20m3 avec 64 vaubans&nbsp;<br><br>Faire le tour des points sécu et y déposer 2 triangles reliés par 2 vaubans (ne pas oublier les PS 7 et 8 ake PS Manu et PS Valls)<br><br>Laisser le passage ouvert<br><br>Rentrer au local<br><br>Rendre les clefs à l''humain</p>', NULL, 0, 'Local des 24 Heures', 3, 'non'),
(396, 214, 410, NULL, 'Désinstallation du stand accueil', '<p>-Rends toi au stand accueil et appelle l''orga hard responsable pour qu''il t''amène les clés du dépôt AIP (Alice : <a href="tel:06.79.27.29.50">06.79.27.29.50</a>)<br><br>-En attendant l''orga, range les flyers, les affiches et les programmes dans les cartons. Tu emmèneras le tout au QG orga</p><p>-Nettoie un peu derrière toi : &nbsp;la zone de l''espace accueil doit être propre après notre départ! Pas de restes de flyers, de scotch par terre. Pareil pour les tables et chaises qui doivent être nickel (si besoin, emprunte une éponge aux bars qui seront à côté!!)</p><div>-Ramène tout le matos dans le hall du dépôt AIP (la table, les chaises, les grilles d''exposition, la tente)</div><div><br></div><div>-Rends la clé de l''AIP au QG orga</div><div><br></div><div>-C''est fini ! Mais tu peux demander au QG orga si on a encore besoin de toi ou pas !&nbsp;<br><br><br></div><p></p>', NULL, 0, 'Devant GCU, à l''angle des bars', 0, 'non'),
(397, 28, 428, NULL, 'Débarriérage Point Sécu', '<p>\r\n</p><ul>\r\n<li>Rdv au QG orga après le feu d''artifice<br></li>\r\n<li>Prendre les clés du 20m3 (pour Guerric) et monter dedans (le 20m3)<br></li>\r\n<li>Faire le tour des points sécus, récupérer les barrières et les mettre dans le 20m3<br></li>\r\n<li>Se rendre au Dépot eiffel et déposer les barrières dans la benne<br></li>\r\n<li>Aller rendre le 20m3 et les clés&nbsp;<br></li>\r\n<li>Bonne soirée et merci!<br></li></ul>\r\n<p></p>', 'Des gants, du charisme', 2, 'Campus', 3, 'raf'),
(398, 31, 429, NULL, 'Aller chercher les canisses', '<p>Se rendre au local des 24h (Rdc batiment D) pour y retrouver Ron/Guerric. N''hésite pas à demander autour de toi où il se trouve.<br></p><div>Prendre les clefs d''un 20m3 et d''une voiture<br><br>Appeler les ateliers pour leur dire qu''on arrive <a href="tel:(06.75.92.62.18">(06.75.92.62.18</a> ou <a href="tel:04 72 33 38 89">04 72 33 38 89</a>)<br>&nbsp;<br>Conduire jusqu''aux Ateliers Frappaz ( 16 Rue Docteur Frappaz, 69100 Villeurbanne )<br><br>Charger les 110 canisses dans le 20m3 (Bien rangé ça passe)<br></div><div><br></div><div>Signer un papier<br><br>Rentrer sur le campus<br><br>Déposer la moitié des canisses au sud de la zone concert (contre l''AIP)<br></div><div><br></div><div>Déposer l''autre moitié des canisses au nord de la zone concert (derrière le bâtiment GCU)</div><div><br></div><div>Se faire déposer au QG Orga à la fin de ton&nbsp;créneau<br><br>Rendre les clefs à l''Humain<br><br>PS : Pense à prendre des gants et un pull à manches longues ! Les canisses ça peut être coupant.</div>', NULL, 2, 'QG Orga', 3, 'non (raf)'),
(399, 31, 429, NULL, 'Aller rendre les canisses', '<p>Au QG Orga pour y retrouver Ron N''hésite pas à demander autour de toi où il se trouve.<br></p><div>Prendre les clefs d''un 20m3 et d''une voiture<br><br>Charger les 110 canisses dans le 20m3 (Bien rangé ça passe)<br><br>Appeler les ateliers pour leur dire qu''on arrive <a href="tel:(06.75.92.62.18">(06.75.92.62.18</a> ou <a href="tel:04 72 33 38 89">04 72 33 38 89</a>)<br>&nbsp;<br>Conduire jusqu''aux Ateliers Frappaz ( 16 Rue Docteur Frappaz, 69100 Villeurbanne )<br></div><div><br></div><div>Signer un papier<br><br>Rentrer sur le campus<br></div><div><br></div><div>Se faire déposer au QG Orga à la fin de ton&nbsp;créneau<br><br>Rendre les clefs à l''Humain<br><br>PS : Pense à prendre des gants et un pull à manches longues ! Les canisses ça peut être coupant.<br></div><div><br></div>', NULL, 2, 'Villeurbanne City Beach', 3, 'non (raf)'),
(400, 28, 430, NULL, 'Ouvrir travée verte', '<p>Se rendre au QG orga pour y retrouver Guerric. N''hésite pas à demander autour de toi où il se trouve.<br>Vous allez ensemble passer la Zone Concert et la travée verte en mode journée.&nbsp;Prendre une clef de 19 avec vous.</p>\r\n<ul>\r\n<li>enlever les Heras entre la Rotonde et la MdE, le Grillon et Eiffel</li>\r\n<li>débloquer la voie pompier entre les Humas et GEN</li>\r\n<li>ouvrir franchement (enlever 3-4 Heras) la voie du capitaine Ponce(au niveau de la rue de la Physique quoi, dans la travée verte devant Jules Verne</li>\r\n<li>même chose entre Saint Exupéry et Léonard de Vinci, en bas de la rue des Humanités</li>\r\n<li>ouvrir le couloir reliant la ZC et la travée verte devant Coulomb</li>\r\n<li>installer les barrières derrière la régie</li>\r\n<li>ouvrir les issues de secours Sud et Nord de la ZC</li>\r\n<li>Normalement cela a été super rapide, profites-en pour regarder si les barrièrages des régies est ok.</li></ul>\r\n<p></p>\r\n<p>Ranger les Héras le long des autres, les laisser attachées dans l''idéal</p>', 'Des clés de 19, des gants, du charimse (rix)', 0, 'QG Orga', 3, 'raf'),
(401, 28, 430, NULL, 'Fermer la Travée Verte', '<p>Se rendre au QG orga pour y retrouver Guerric. N''hésite pas à demander autour de toi où il se trouve ou à l''appeler.<br><br>Prendre une clef de 19 et se rendre à chaque point de la travée verte pour fermer l''accès :</p>\r\n<p>- Grillon</p>\r\n<p>- Rotonde - KFet<br><br>- Rotonde - Huma</p>\r\n<p>-Humas - GEN</p>\r\n<p>- Gaston Berger<br><br>- SAGE<br><br>Plus on fait vite, plus tu pourras manger de pâté au QG donc faisons ça vite et bien :)</p>', NULL, 0, 'QG Orga', 3, 'non'),
(402, 28, 430, NULL, 'Installation travée verte', '<p>Se rendre au QG orga pour y retrouver Guerric. N''hésite pas à demander autour de toi où il se trouve ou appelle le<br><br>Prendre le sac de colliers de sécurité.<br><br>Aller chercher les plots et des héras et vaubans dans les rack de la travée verte<br><br>Porter les Héras,plots et colliers jusqu''aux endroits à fermer.</p>\r\n<p>- Grillon</p>\r\n<p>- Rotonde - KFet<br><br>- Rotonde - Huma</p>\r\n<p>-Humas - GEN</p>- Gaston Berger<br><br>- SAGE<br><br>Laisser ouvert. Ranger les Héras le long des autres, les laisser attachées dans l''idéal', 'Gants\r\nClé de 19 mm\r\nCharisme en boîte', 0, 'Travée verte', 3, 'raf'),
(403, 28, 430, NULL, 'Désinstallation travée verte', '<P>Rend toi au QG orga et retrouves y Guerric</P>\r\n<P>L''objectif, c''est de virer toutes les barrières qui bloquent les accès sur les humas et les ranger dans les racks.</P>\r\n<P>Ne pas oublier de mettre les plots sur les palettes et de rassembler les vaubans</P>\r\n<DIV>Rassemble les vaubans en un seul endroit. (Utiliser un fen pourrait être cool!)<BR><BR>Les coins à débarriérer<BR>\r\n<P>&nbsp;Grillon</P>\r\n<P>- Rotonde - KFet<BR><BR>- Rotonde - Huma</P>\r\n<P>-Humas - GEN</P>- Gaston Berger<BR><BR>- SAGE<BR></DIV>\r\n<P></P>', 'clé de 19 mm\r\ncharisme\r\nDes gants', 0, 'QG Orga', 3, 'non'),
(404, 28, 431, NULL, 'Réceptionner Barrières TMF', '<p>Attendre l''appel de TMF<br></p><p>Appeler un fen au talkie</p><p>Aller les chercher à INSA Einstein. Les guider jusqu''au point de dépôt piscine.<br><br>Décharger au fen les 260 Héras (8 ou 9 de 30 normalement), les plots, les colliers.<br><br>Signer un papier</p>', 'Un fen en état de marche\r\nUn stylo', 0, 'Campus', 3, 'raf'),
(405, 28, 431, NULL, 'Rendez les barrières!! (TMF)', '<p><b>Avant que TMF n''arrive:</b><br></p><ul><li>Vérifier que ya bien toutes les héras, les plots, les colliers et les jambes de forces (50)<br></li><li>&nbsp;(les compter par la méthode des carrés barrés. Si tu as 52 carrés barrés, c''est bon, sinon apprend à compter)&nbsp;<br></li><li>Les rassembler sur la pelouse devant la piscine<br></li></ul><p></p><p>------------------------------</p><p></p><ul><li>Attendre l''appel de TMF<br></li><li>Appeler un fen au talkie<br></li><li>Aller les chercher à INSA Einstein. Les guider jusqu''au point de dépôt piscine.</li><li>Charger au fen les 260 héras, les plots, les colliers.</li><li>Signer un papier<br></li></ul><p></p><br>"Rendez les barrières!!!!"', NULL, 0, 'Campus', 3, 'non'),
(406, 21, 421, NULL, 'Conducteur Installation matos VIP', '<p></p><ul><li>Va au QG orga<br></li><li>Retrouve tes co-tâches<br></li><li>Demande aux humains :</li>-la clef de brandon le 20m3</ul><ul>-la clef du local du club rock<br>-la clef de l''espace VIP (et&nbsp;<b>l''emplacement de l''espace VIP (bâtiment Coulomb) sur le plan)</b><br><li>Aller au club rock (rdc bât H) avec Brandon. Si tu n''as aucune idée de comment y aller, demande aux humains (cf plan) et AU PIRE appelle Cetelem (06 80 52 08 62).<br></li><li>Récupérer 4 canapés marqués "VIP" et le petit frigo "VIP"</li><li>Fermer le club rock<br></li><li>Charger tout ça dans Brandon le 20m3<br></li><li>Aller derrière le BDE et se garer au plus près de la pelouse des humas<br></li><li>Ouvrir la salle de l''espace VIP, porte extérieure du bâtiment Coulomb (Tu ne sais pas où c''est ? bizuth ! tu es bon pour un aller-retour au QG ! c''était écrit en gras !)<br></li><li>Décharger le matériel<br></li><li>Ranger les tables et les chaises de la salle dans un coin (empiler les chaises correctement, mettre les tables les unes sur les autres contre un mur)<br></li><li><u><b>Noter le nombre de tables et de chaises dans un coin du tableau</b></u>&nbsp;avec écrit "ne pas effacer SVP"&nbsp;<br></li><li>Envoyer la même info par SMS à Cetelem au 06 80 52 08 62<br></li><li>Aller au QG orga (fermer la salle si tout le monde sort)<br></li><li>Demander les 4 tables basses notées "VIP" et les ramener les tables basses dans l''espace VIP</li><li>L''anguille mettra les canapés, tables basses et frigos en place joliment :)<br></li><li>Fermer la salle<br></li><li>Aller garer Brandon un peu mieux que ça<br></li><li>Rendre toutes les clefs aux humains et se pignoler</li>Merci !</ul><p></p>', NULL, 1, 'QG Orga', 3, 'non'),
(407, 21, 421, NULL, 'Installation matos VIP', '<p></p><ul><li>Va au QG orga<br></li><li>Retrouve tes co-tâches<br></li><li>Demande aux humains :</li>-la clef de brandon le 20m3<br>-la clef du local du club rock<br>-la clef de l''espace VIP (et&nbsp;<b>l''emplacement de l''espace VIP (bâtiment Coulomb) sur le plan)</b><br><li>Aller au club rock (rdc bât H) avec Brandon. Si tu n''as aucune idée de comment y aller, demande aux humains (cf plan) et AU PIRE appelle Cetelem (06 80 52 08 62).<br></li><li>Récupérer 4 canapés marqués "VIP" et le petit frigo "VIP"</li><li>Fermer le club rock<br></li><li>Charger tout ça dans Brandon le 20m3<br></li><li>Aller derrière le BDE et se garer au plus près de la pelouse des humas<br></li><li>Ouvrir la salle de l''espace VIP, porte extérieure du bâtiment Coulomb (Tu ne sais pas où c''est ? bizuth ! tu es bon pour un aller-retour au QG ! c''était écrit en gras !)<br></li><li>Décharger le matériel<br></li><li>Ranger les tables et les chaises de la salle dans un coin (empiler les chaises correctement, mettre les tables les unes sur les autres contre un mur)<br></li><li><u><b>Noter le nombre de tables et de chaises dans un coin du tableau</b></u>&nbsp;avec écrit "ne pas effacer SVP"&nbsp;<br></li><li>Envoyer la même info par SMS à Cetelem au 06 80 52 08 62<br></li><li>Aller au QG orga (fermer la salle si tout le monde sort)<br></li><li>Demander les 4 tables basses notées "VIP" et les ramener les tables basses dans l''espace VIP</li><li>L''anguille mettra les canapés, tables basses et frigos en place joliment :)<br></li><li>Fermer la salle<br></li><li>Aller garer Brandon un peu mieux que ça<br></li><li>Rendre toutes les clefs aux humains et se pignoler</li>Merci !</ul><p></p>', NULL, 0, 'QG Orga', 3, 'non'),
(408, 21, 421, NULL, 'Conducteur Désinstallation matos VIP', '<p></p><ul><li>Va au QG orga<br></li><li>Retrouve tes co-tâches<br></li><li>Demande aux humains :<br></li></ul><div>-de la bonne humeur (c''est important)</div><div>-la clef de brandon le 20m3</div><div>-la clef du local du club rock</div><div>-Comment aller au club rock</div><div>-La clef de l''espace VIP (salle du bas de coulomb)</div><div><b>-l''emplacement de l''espace VIP sur le plan</b></div><div><ul><li>Prendre Bradley</li><li>Aller derrière le BDE et se garer au plus près de la pelouse des humas</li><li>Récupérer les canapés, les tables basses et le frigo</li><li>Charger le matos dans le 20m3</li><li>Fermer la salle à clef</li><li>Aller au club rock (rdc bât H) avec Brandon. Si tu n''as aucune idée de comment y aller, retourne demander aux humains (cf plan) et AU PIRE appelle Cetelem (06 80 52 08 62).</li><li>Décharger tout le matos dans le club rock</li><li>Fermer le club rock</li><li>Aller garer Brandon</li><li>Rendre toutes les clefs aux humains</li><li>Se pignoler</li></ul><div>Merci !</div></div><p></p>', NULL, 1, 'QG Orga', 3, 'non'),
(409, 21, 421, NULL, 'Désinstallation matos VIP', '<p></p><ul><li>Va au QG orga<br></li><li>Retrouve tes co-tâches<br></li><li>Demande aux humains :<br></li></ul><div>-de la bonne humeur (c''est important)</div><div>-la clef de brandon le 20m3</div><div>-la clef du local du club rock</div><div>-Comment aller au club rock</div><div>-La clef de l''espace VIP (salle du bas de coulomb)</div><div><b>-l''emplacement de l''espace VIP sur le plan</b></div><div><ul><li>Prendre Bradley et</li><li>Aller derrière le BDE et se garer au plus près de la pelouse des humas</li><li>Récupérer 4 canapés</li><li>les tables basses</li><li>le petit frigo</li><li>Fermer la salle à clef</li><li>Charger tout ça dans le 20m3</li><li>Aller au club rock (rdc bât H) avec Brandon. Si tu n''as aucune idée de comment y aller, retourne demander aux humains (cf plan) et AU PIRE appelle Cetelem (06 80 52 08 62).</li><li>Décharger tout le matos dans le club rock</li><li>Fermer le club rock</li><li>Aller garer Brandon</li><li>Rendre toutes les clefs aux humains</li><li>Se pignoler</li></ul><div>Merci !</div></div><p></p>', NULL, 0, 'QG Orga', 3, 'non'),
(410, 14, 347, NULL, 'Clés Cave H', '<p>Rejoint le régis du H (Daniel 06 86 04 52 10).</p><div>Récupère les clefs de la cave.&nbsp;</div><div><br></div><div>Rappelle lui quand tu vas lui ramener. Dis lui merci</div><div><br></div><div>Amène les aux zumains<br></div>', NULL, 0, 'Bat H', -1, 'non'),
(411, 211, 410, NULL, 'Préparer Kit accueil', '<p>-Prendre les flyers et les programmes restants au local</p><div>-Prendre aussi le plan A2 de la manif</div><div><br>-Prendre des affiches jours et affiches nuits</div><div><br></div><div>- Prend du scotch et de la pâte à fixe</div><div><br></div><div>-Mettre le tout dans des cartons, et écrire "kit accueil" sur les cartons</div><div><br></div><div>-Emmener le tout au QG orga</div><div><br></div><div>-&gt; Mettre le carton "kit accueil" et le carton "kit t-shirt" au même endroit au QG orga .</div><p></p>', 'carton(s)', 0, 'Local des 24h', 3, 'non'),
(412, 14, 347, NULL, 'Retour clés Cave H', '<p>Prends la clé de la cave du Bâtiment H</p><div>Va la donner à régisseur du H (Daniel 06 86 04 52 10).</div><p></p>', NULL, 0, 'Local', -1, 'non'),
(413, 211, 410, NULL, 'Préparer Kit t-shirt', '<p>-Prendre tous les t-shirt au local et les mettre dans des cartons</p><div><div>-Ecrire "Kit t-shirt" sur les cartons</div><div><br></div><div>-Emmener les cartons au QG orga, les stocker avec le(s) carton(s) "kit accueil"&nbsp;</div></div><p></p>', 'carton(s)', 0, 'Local des 24h', 3, 'non'),
(414, 214, 432, NULL, 'Distribuer les programmes aux résidences', '<p>Rendez-vous au local des 24h (rdc du bâtiment D) pour retrouver tes co-taches.<br><br>Répartissez-vous en 3 équipes.<br>Trouvez les cartons de programmes (demandez à un hard)<br>Allez mettre les programmes dans les boites aux lettres des résidences INSA !<br><br></p><p>Une équipe au PC : &nbsp;résidences A, B, J, G&nbsp;</p><p>Une équipe K-fet : résidences E, F, H, I, poses en aussi quelques uns à la kfêt au passage :)&nbsp;</p><p>Une équipe Beurk : résidences C, D, Magellan</p>', '-programmes de la manif''', 0, 'Local des 24h', 3, 'non (raf)'),
(415, 214, 434, NULL, 'Com'' Lyon1 (Turbulence)', '<p>Aller au local pour récupérer :</p><div>- 2 ou 3 affiches nuit</div><div>- 1 ou 2 affiches jour</div><div>- une bonne centaine de flyers&nbsp;</div><div><br></div><div>Aller au local de l''asso Turbulence Lyon 1 (bâtiment déambulatoire).<br>Leur donner les affiches et les flyers.&nbsp;<br></div><div>Les briefer sur les préventes :&nbsp;</div><div>Ils doivent relever :</div><div><span class="Apple-tab-span" style="white-space:pre">	</span>- les coordonnées des gens : nom, prénom, adresse mail</div><div><span class="Apple-tab-span" style="white-space:pre">	</span>- le type de pass : 1 soir (lequel ?) / 2 soirs &nbsp;</div><div><span class="Apple-tab-span" style="white-space:pre">	</span>- règlement en espèce ou en chèque</div><div><span class="Apple-tab-span" style="white-space:pre">	</span>- ordre des chèques : Club des 24 heures de l''INSA&nbsp;</div><div><span class="Apple-tab-span" style="white-space:pre">	</span>- rappeler les tarifs : 10€ un soir, 16€ les deux</div><div><br></div><div>Leur demander gentiment de partager nos statuts facebook et de nous faire de la pub via les différents réseaux (facebook, mailing fac, ...)&nbsp;</div><div><br></div><div>Demander à laisser des flyers au RU et au bâtiment Astrée (vers la résidence F)</div><p></p>', '- 3 Affiches nuit  (petit format)\r\n- 2 Affiches jour  (petit format)\r\n- Flyers (~150)', 0, 'Local des 24h', -1, 'non'),
(416, 226, 434, NULL, 'Com'' BDE MINT Lyon 3', '<p>Aller au local pour récupérer :</p><div>- &nbsp;3 affiches nuit</div><div>- &nbsp;2 affiches jour</div><div>- environ 200 flyers&nbsp;</div><div><br></div><div>Aller à Lyon 3 (Manufacture des Tabacs)<br>Leur donner les affiches et les flyers : Point Culture et BDE Mint</div><div><br></div><div>( et dans le périmètre, distribuer des flyers dans les commerces alentours, notamment les restaurants où les étudiants vont souvent le midi : Ninkasi, l''Epicerie, le Kaffe Berlin)</div><div><br></div>', '- 3 affiches nuits\r\n- 2  affiches jours \r\n- ~200 flyers', 0, 'Local des 24h', -1, 'non'),
(417, 210, 396, NULL, 'Accueillir l''asso', '<p></p><ul><li>Retrouve Magic Pic (Paul Caillau 0659510416) devant la salle René Char, à la Rotonde.<br></li><li>Vérifie que tout est en place et aide-les à s''installer si besoin.&nbsp;</li><li>Remercie-les de tenir ce stand !</li><li>Dis-leur qu''un concert de Gospel commencera dans cette salle à 18h et qu''un soft viendra donc les aider à ranger.</li><li>Tu es libre :)</li></ul><div><br></div><p></p>', NULL, 0, 'Salle René Char', -1, 'non'),
(418, 214, 434, NULL, 'Com'' FédéKto', '<p>Récupérer 2 affiches nuit et 2 affiches jour au local, et une centaine de flyers.&nbsp;</p><div>Se rendre à l''Université Catholique de Lyon&nbsp;</div><div>(site de Bellecour : 25, rue du Plat, 69288)&nbsp;</div><div><br></div><div>Leur demander gentiment si ils peuvent mettre nos affiches dans leur fac.&nbsp;</div><div>Leur demander gentiment de faire de la com pour nous auprès des étudiants (via facebook, ou réseau interne à la fac,...)</div><div><br></div><div>Leur proposer de faire des préventes.<br>S''ils acceptent, les briefer sur les préventes :&nbsp;</div><div><div>Ils doivent relever :</div><div><span class="Apple-tab-span" style="white-space: pre;">	</span>- les coordonnées des gens : nom, prénom, adresse mail (on peut leur envoyer l''excel qu''on a <span class="Apple-tab-span" style="white-space:pre">	</span>pour nos préventes)</div><div><span class="Apple-tab-span" style="white-space: pre;">	</span>- le type de pass : 1 soir (lequel ?) / 2 soirs &nbsp;</div><div><span class="Apple-tab-span" style="white-space: pre;">	</span>- règlement en espèce ou en chèque</div><div><span class="Apple-tab-span" style="white-space: pre;">	</span>- ordre des chèques : Club des 24 heures de l''INSA&nbsp;</div><div><span class="Apple-tab-span" style="white-space: pre;">	</span>- rappeler les tarifs : 10€ un soir, 16€ les deux</div></div><p></p>', '-  2 affiches nuit\r\n-  2 affiches jour \r\n- ~100 flyers', 0, 'Local des 24h', -1, 'non'),
(419, 214, 434, NULL, 'Com'' Lyon-Est Rockefeller', '<p>Récupérer 2 affiches nuit et 2 affiches jour au local, et une centaine de flyers.&nbsp;</p><div>Se rendre à Rockefeller.</div><div><br></div><div>Leur demander gentiment si ils peuvent mettre nos affiches dans leur fac.&nbsp;</div><div>Leur demander gentiment de faire de la com pour nous auprès des étudiants (via facebook, ou réseau interne à la fac,...)</div><div><br></div><div>Leur proposer de faire des préventes.<br>S''ils acceptent, les briefer sur les préventes :&nbsp;</div><div><div>Ils doivent relever :</div><div><span class="Apple-tab-span" style="white-space: pre;">	</span>- les coordonnées des gens : nom, prénom, adresse mail (on peut leur envoyer l''excel qu''on a<span class="Apple-tab-span" style="white-space: pre;">	</span>pour nos préventes)</div><div><span class="Apple-tab-span" style="white-space: pre;">	</span>- le type de pass : 1 soir (lequel ?) / 2 soirs &nbsp;</div><div><span class="Apple-tab-span" style="white-space: pre;">	</span>- règlement en espèce ou en chèque</div><div><span class="Apple-tab-span" style="white-space: pre;">	</span>- ordre des chèques : Club des 24 heures de l''INSA&nbsp;</div><div><span class="Apple-tab-span" style="white-space: pre;">	</span>- rappeler les tarifs : 10€ un soir, 16€ les deux</div></div>', '- 2 affiches jour\r\n- 2 affiches nuit\r\n- ~100 flyers', 0, 'Local des 24h', -1, 'non'),
(420, 210, 396, NULL, 'Ranger stand magie', '<p></p><ul><li>Rends toi à l''Olivier</li><li>Demande aux magiciens si tout s''est bien passé et explique que tu viens pour ranger.</li><li>Si des gens sont présents, explique-leur que l''animation est terminée</li><li>Remercie Magic Pic pour avoir tenu ce stand de magie ! Dis-leur "à l''année prochaine" !&nbsp;</li><li>Range la table et les chaises.</li></ul><ul><li>Ramène la nappe au dépôt Humas.</li><li>Tu es libre :)</li></ul><p></p>', NULL, 0, 'L''Olivier', 3, 'non'),
(421, 210, 435, NULL, 'Installation de la moquette', '<p></p><ul><li>Au QG orga, repère sur le plan des anims l''emplacement de l''animation Salon Urbain</li><li>Rends toi au dépôt des Humas</li><li>Récupère le kit Salon Urbain (moquette + 1 table 2places + 3 chaises)</li><li>Emmène-le sur le lieu de l''anim.</li></ul><ul><li>Installe la moquette sur l''herbe (cale-la avec la table et les chaises)</li><li>Attends que l''asso La Locomotive arrive avec les meubles et aide-les à s''installer.</li><li>Pendant l''installation, veille à ce que la moquette reste en place.</li></ul><div><ul><li>Une fois l''installation des meubles terminée, et s''ils n''ont plus besoin de rien, tu es libre !</li></ul><div>En cas d''embrouilles, contacte Morgane: 06 70 11 59 48</div></div><p></p>', 'Tes petits bras et ta bonne humeur.', 0, 'QG orga', -1, 'non'),
(422, 210, 435, NULL, 'Accueil de l''asso et installation des meubles', '<p></p>\r\n<ul>\r\n<li>Au QG orga, repère sur le plan des anims l''emplacement de l''animation Salon Urbain</li>\r\n<li>Rends toi au dépôt des Humas</li>\r\n<li>Récupère le kit Salon Urbain (moquette + 1 table 2places + 3 chaises)</li>\r\n<li>Emmène-le sur le lieu de l''anim.</li>\r\n<li>Installe la moquette sur l''herbe (cale-la avec la table et les chaises)</li></ul>\r\n<ul>\r\n<li>A 13h, deux d''entre vous se rendent Rue de la Physique et retrouvent La Locomotive (Camille 0683214254). Aidez-les à porter les meubles jusqu''à l''emplacement de l''animation. Plusieurs aller-retours seront nécessaires.&nbsp;<br>NE PAS LAISSER LA MOQUETTE ET LES MEUBLES SANS SURVEILLANCE !</li>\r\n<li>Pendant l''installation, veille à ce que la moquette reste en place.</li></ul>\r\n<ul>\r\n<li>Une fois les meubles installés, et si La Locomotive n''a plus besoin de rien, tu es libre :)</li></ul>\r\n<div>En cas d''embrouilles, contacte Jeanne 06 70 11 59 48</div>\r\n<p></p>', '1 téléphone', 0, 'QG orga', 3, 'non (raf)'),
(423, 210, 435, NULL, 'Tout va bien ?', '<p></p><ul><li>Prends ton appareil photo</li><li>Rends toi à l''animation de l''asso la Locomotive, le "Salon Urbain".</li><li>Demande leur si tout va bien, et tape la discute.&nbsp;</li><li>Remercie-les d''être là !</li><li>Fais quelques photos, et éclipse toi !</li></ul><div>En cas d''embrouilles, contacte Morgane 06 70 11 59 48</div><p></p>', NULL, 0, 'Pelouse des humas', 3, 'non'),
(424, 210, 435, NULL, 'Ranger et déménager', '<p></p><ul><li>Prends une éponge et un seau avec de l''eau au QG orga.</li></ul><ul><li>Rends toi sur l''animation Salon Urbain (parvis des humas)</li><li>Dis "j''adore ce que vous faites" pour engager la conversation, puis explique que tu viens pour les aider à ranger parce que la zone ferme à 18h.</li><li>Aide-les à ranger la peinture.</li><li>Nettoie la table 2places et les 3 chaises qui nous appartiennent (si besoin).&nbsp;</li><li>Aide-les à porter les meubles jusqu''à leur véhicule (plusieurs aller-retours nécessaires)</li></ul>NE PAS LAISSER LES MEUBLES SANS SURVEILLANCE !<br><ul><li>Lorsque les meubles sont rangés, remercie-les d''être venus !</li><li>Retourne sur le lieu de l''animation, Ramène la table, les chaises et la moquette au dépôt Humas.</li><li>Vérifie que rien n''a été oublié sur le stand. Tu es libre :)</li></ul><div>En cas d''embrouille, contacte Morgane 06 70 11 59 48</div><p></p>', 'Tes petits bras et ta bonne humeur.', 0, 'QG orga', 3, 'raf');
INSERT INTO `Tache` (`id`, `responsable_id`, `groupetache_id`, `importid`, `nom`, `consignes`, `materielSupplementaire`, `permisNecessaire`, `lieu`, `statut`, `commentaireLog`) VALUES
(425, 210, 435, NULL, 'Ranger notre matos', '<p></p><ul><li>Prends une éponge et un seau avec de l''eau au QG orga.</li><li>Rends toi sur le Salon Urbain (parvis des Humas)</li><li>Explique que tu viens les aider à ranger parce que la zone ferme à 18h.</li></ul><ul><li>Nettoie la table 2places et les 3 chaises qui nous appartiennent (si besoin).&nbsp;</li><li>Ramène ça au dépôt Humas</li><li>Si besoin, aide les gens de La Locomotive à porter les meubles jusqu''à leur véhicule</li><li>MAIS SURTOUT, roule la moquette et ramène-la au dépôt Humas.</li></ul><ul><li>Retourne sur le lieu de l''animation pour vérifier que rien n''a été oublié.</li><li>Tu es libre :)</li></ul><div>En cas d''embrouilles, contacte Morgane 06 70 11 59 48</div><div></div><p></p>', 'Tes petits bras et ta bonne humeur.', 0, 'QG orga', -1, 'non'),
(426, 194, 398, NULL, 'Acceuillir Avenir Santé et RuptureS', '<p>-Aller à l''entrée principale, où tu dois retrouver Avenir Santé. Si ils ne sont pas là, les appeler au <b>06 77 95 10 52</b>.</p>\r\n<p>-Idem avec RuptureS. Si ils ne sont pas là, les appeler au&nbsp;<b>04 78 39 34 89</b>.</p>\r\n<p>-Les emmener sur leur stand, à la sortie de la ZC, leur expliquer le déroulement de la soirée.<br><br>-Les aider à s''installer (ordi, flyers, ...)<br><br>-Leur donner ton numéro perso, dire que tu es dispo pour eux en permanence.<br><br>-Aller faire autre chose, mais rester dispo et repasser de temps en temps.<br></p>', NULL, 0, 'Entrée, à l''intérieur', 3, 'non'),
(427, 194, 398, NULL, 'Départ de Avenir Santé et RuptureS', '<p>-Aller voir Avenir Santé et RuptureS<br><br>-Leur demander si tout s''est bien passé.<br><br>-Les aider à ranger.<br><br>-Les accompagner jusqu''à leur véhicule si tu as le temps.<br><br>-Leur souhaiter une bonne nuit et leur dire "à demain" si on est vendredi ou "à l''année prochaine" si on est samedi.<br></p>', NULL, 0, 'Entrée, à l''intérieur', 3, 'non'),
(428, 194, 436, NULL, 'Acceuillir Ruptures', '<p>-Aller à l''entrée principale, où tu dois retrouver RuptureS. Si ils ne sont pas là, les appeler au <b>04 78 39 34 89</b>.<br><br>-Les emmener sur leur stand, leur expliquer le déroulement de la soirée.<br><br>-Les aider à s''installer (ordi, flyers, ...)<br><br>-Leur donner ton numéro perso, dire que tu es dispo pour eux en permanence.<br><br>-Aller faire autre chose, mais rester dispo et repasser de temps en temps.</p>', NULL, 0, 'Entrée de la ZC', -1, 'non'),
(429, 194, 436, NULL, 'Départ de RuptureS', '<p>-Aller voir RuptureS<br><br>-Leur demander si tout s''est bien passé.<br><br>-Les aider à ranger.<br><br>-Les accompagner jusqu''à leur véhicule si tu as le temps.<br><br>-Leur souhaiter une bonne nuit et leur dire "à l''année prochaine".</p>', NULL, 0, 'Entrée de la ZC', -1, 'non'),
(430, 214, 346, NULL, 'Flyage école Jean Jaurès', '<p>Viens au local (de l''ambiance) &nbsp;récupérer ton co-flyage, une grosse pile de flyers (environ 200 chacun) et une dose de charisme.</p><div>Rejoins l''école primaire Jean Jaurès ( 1 Place Jules-Ferry, 69300 Caluire) : pour ça, pends le bus C1 à la cité internationale et descends à Cuire. Rejoins l''école (à 50m).</div><div><br></div><div>Arrive bien à l''heure de la sortie de l''école (voire en avance), et distribue les flyers aux parents, avec le sourire.&nbsp;</div><div>Flye jusqu''à ce que tu n''aies plus de flyers.&nbsp;</div><div>Reviens au local avec le sentiment d''avoir participé au non-déficit des 24h.&nbsp;</div><div><br></div><div>I believe I can flye !&nbsp;<span style="background-color: rgb(249, 249, 249); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 21px;">♫</span></div>', '- flyers journées', 0, 'Local des 24h', -1, 'non'),
(431, 214, 346, NULL, 'Flyage Rue de la République', '<p>Viens au local (de l''ambiance) &nbsp;récupérer ton co-flyage, une grosse pile de flyers (environ 200 chacun) et une dose de charisme. Tu peux prendre ton onesie !</p><div>Dirige-toi vers l''arrêt de tram.&nbsp;</div><div>Prends le tram jusqu''à Charpennes, puis le Métro A jusqu''à Cordeliers.</div><div>Rejoins la Rue de la République (tu peux aller devant le Pathé).</div><div>Flye jusqu''à ce que tu n''aies plus de flyers.&nbsp;</div><div>Reviens au local avec le sentiment d''avoir participé au non-déficit des 24h.&nbsp;</div><div><br></div><div>I believe I can flye !&nbsp;<span style="background-color: rgb(249, 249, 249); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 21px;">♫</span></div>', '- flyers', 0, 'Local des 24h', 3, 'non'),
(432, 214, 346, NULL, 'Ecole primaire Antoine Rémond', '<p>Viens au local (de l''ambiance) &nbsp;récupérer ton co-flyage, une grosse pile de flyers (environ 200 chacun) et une dose de charisme.</p><div>Rejoins l''école primaire Antoine Rémond (58 Rue Bellecombe, 69006) : pour ça, prends le T1 jusqu''à Collège Bellecombe.</div><div><br></div><div>Arrive bien à l''heure de la sortie de l''école (voire en avance), et distribue les flyers aux parents, avec le sourire.&nbsp;</div><div>Flye jusqu''à ce que tu n''aies plus de flyers.&nbsp;</div><div>Reviens au local avec le sentiment d''avoir participé au non-déficit des 24h.&nbsp;</div><div><br></div><div>I believe I can flye !&nbsp;<span style="background-color: rgb(249, 249, 249); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 21px;">♫</span></div>', '- flyers journées', 0, 'Partout', 3, 'non'),
(433, 214, 346, NULL, 'Ecole primaire Descartes', '<p>Viens au local (de l''ambiance) &nbsp;récupérer ton co-flyage, une grosse pile de flyers (environ 200 chacun) et une dose de charisme.</p><div>Rejoins l''école primaire Descartes (14, rue Descartes, Villeurbanne). C''est à 15 minutes du campus à pieds.&nbsp;</div><div><br></div><div>Arrive bien à l''heure de la sortie de l''école (voire en avance), et distribue les flyers aux parents, avec le sourire.&nbsp;</div><div>Flye jusqu''à ce que tu n''aies plus de flyers.&nbsp;</div><div>Reviens au local avec le sentiment d''avoir participé au non-déficit des 24h.&nbsp;</div><div><br></div><div>I believe I can flye !&nbsp;<span style="background-color: rgb(249, 249, 249); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 21px;">♫</span></div>', '- flyers journées', 0, 'Local des 24h', 3, 'non'),
(434, 214, 346, NULL, 'Ecole primaire Croix Luizet', '<p>Viens au local (de l''ambiance) &nbsp;récupérer ton co-flyage, une grosse pile de flyers (environ 200 chacun) et une dose de charisme.</p><div>Rejoins l''école primaire Croix Luizet &nbsp;(14 Rue Louis Armand, Villeurbanne).</div><div><br></div><div>Arrive bien à l''heure de la sortie de l''école (voire en avance), et distribue les flyers aux parents, avec le sourire.&nbsp;</div><div>Flye jusqu''à ce que tu n''aies plus de flyers.&nbsp;</div><div>Reviens au local avec le sentiment d''avoir participé au non-déficit des 24h.&nbsp;</div><div><br></div><div>I believe I can flye !&nbsp;<span style="background-color: rgb(249, 249, 249); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 21px;">♫</span></div>', '- flyers journées', 0, 'Local des 24h', 3, 'non'),
(435, 214, 346, NULL, 'Ecole primaire Louis Armand', '<p>Viens au local (de l''ambiance) &nbsp;récupérer ton co-flyage, une grosse pile de flyers (environ 200 chacun) et une dose de charisme.</p><div>Rejoins l''école primaire Louis Armand ( 3 allée du Lys Orangé, Villeurbanne)</div><div><br></div><div>Arrive bien à l''heure de la sortie de l''école (voire en avance), et distribue les flyers aux parents, avec le sourire.&nbsp;</div><div>Flye jusqu''à ce que tu n''aies plus de flyers.&nbsp;</div><div>Reviens au local avec le sentiment d''avoir participé au non-déficit des 24h.&nbsp;</div><div><br></div><div>I believe I can flye !&nbsp;<span style="background-color: rgb(249, 249, 249); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 21px;">♫</span></div>', '- flyers journées', 0, 'Local des 24h', 3, 'non'),
(436, 197, 438, NULL, 'Installer le stand maquillage', '<p></p>\r\n<div>\r\n<ul>\r\n<li>Au QG orga, retrouve ton co-tâche, et repère sur le plan des anims le stand maquillage (à côté du Street Art/Salon Urbain de la Locomotive !)</li>\r\n<li>Rend toi au dépôt des humas et récupère une table 2 places et 5 chaises (fais plusieurs aller/retours pour les amener à l''emplacement prévu).<br></li>\r\n<li>ATTENTION : ne laissez jamais le matos sans surveillance ! Il faut que toi ou ton co-tache restiez surveiller le matos pendant que l''autre fait les allers/retours</li>\r\n<li>Installe les tables et chaises pour les maquilleuses à l''emplacement de l''animation</li>\r\n<li>Attends que les arpét et/ou les gens de l''asso les Lézart arrivent.</li>\r\n<li>Demande si tout est bon, et ensuite tu es libre ! :)</li></ul></div>\r\n<p></p>', NULL, 0, 'QG orga', 3, 'non'),
(437, 197, 438, NULL, 'Ranger le stand maquillage', '<p></p>\r\n<ul>\r\n<li>Retrouve ton co-tache et prends une éponge et un seau d''eau au QG orga</li>\r\n<li>Rends toi sur le stand maquillage (à côté du Salon Urbain/Street art)</li>\r\n<li>Explique aux orgas présents que tu viens pour ranger donc il faut qu''ils finissent...</li>\r\n<li>Si des gens sont encore présents pour se faire colorier la figure, demande leur d''annoncer la fin de l''anim et commence le rangement</li>\r\n<li>Nettoie les tables et chaises si besoin</li>\r\n<li>Ramène&nbsp;la tables et 5 chaises au dépôt Humas (ATTENTION, il ne faut jamais laisser le matos sans surveillance, alors il faut que toi ou ton co-tache restiez pendant que l''autre fait les allers/retours !!!)</li>\r\n<li>Vérifie bien que tu as rien laissé sur le stand sur la pelouse et ramène le matos que tu as emprunté au QG orga</li></ul>\r\n<div><br></div>\r\n<p></p>', NULL, 0, 'QG Orga', 3, 'non'),
(438, 197, 438, NULL, 'Maquille les enfants !', '<p></p>\r\n<ul>\r\n<li>Rends toi près du Salon Urbain/Street Art, là où se trouvent les Lezarts et aux peintureux.</li>\r\n<li>Demande leur ce que tu peux faire pour les aider (maquiller les gosses, chercher du matos, nettoyer...)</li>\r\n<li>Aide les du mieux que tu peux avec le sourire parce qu''il n''y qu''en souriant que les bonnes choses peuvent t''arriver ! !</li>\r\n<li>Continue à t''amuser jusqu''à la&nbsp;relève&nbsp;! :)</li></ul>\r\n<p></p>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(439, 197, 438, NULL, 'Tout va bien ?', '<p><br></p>\r\n<p>Rends-toi sur le stand maquillage près du Salon Urbain/Street Art, et vérifie que tout se passe bien.</p>\r\n<p><br></p>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(440, 197, 439, NULL, 'Surveiller la porte de l''ambiance', '<p>&nbsp;Rend toi à l''entrée principale de la&nbsp;Rotonde.<br><br>Présente toi comme la relève de la surveillance de porte.</p>\r\n<p>Ton rôle est simple : après 18h, la zone est fermée. Ton rôle est de rediriger les spectateurs sortants vers l''arrêt de tram de la doua, pour ne pas qu''ils aillent n''importe où sur le campus.</p>\r\n<p>Reste en place jusqu''à la relève, ne pars surtout pas avant (la sécu passe en premier !). Tu peux laisser passer les <span style="BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: arial, sans-serif; COLOR: rgb(34,34,34); FONT-SIZE: 13px">TTistes (ils ont accès aux loges et aux "accès privilégiés" et seront facilement identifiables grâce au T-shirt orga noir avec logo des 14h et le bagde orga 14h).&nbsp;</span><br></p>\r\n<p><span style="BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: arial, sans-serif; COLOR: rgb(34,34,34); FONT-SIZE: 13px">Au moindre problème, appelle le&nbsp;</span><span style="LINE-HEIGHT: 20px; BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: ''Helvetica Neue'', Helvetica, Arial, sans-serif; COLOR: rgb(51,51,51); FONT-SIZE: 14px">0699908668 (resp'' 14h d''impro)</span></p>\r\n<p>Si tu es le dernier, vérifie bien que la TTI se charge de fermer la Rotonde.</p>', 'Ta bonne humeur !', 1, 'Rotonde', -1, 'non'),
(441, 206, 318, NULL, 'Service au bar bouffe', '<p>Cher orga, toutes mes félicitations !&nbsp;</p><div>Tu as été choisi pour nourrir les ventres affamés des festivaliers (soûls ?). Les 24 heures de l''INSA, c''est 500 kilos de saucisses et 750kg de frites à écouler en un weekend. On compte sur ton charisme pour vendre tout ça ! :)<div><ul><li>Arme-toi de courage, et rejoins Mamie Caro (06 79 12 17 05) et Doc-X (07 77 89 97 97). Surtout, n''arrive pas en retard ! Tu dois en effet prendre le relais d''orgas qui seront eux aussi attendus ailleurs...</li><li>Fais-toi briefer ! ATTENTION, brief important pour le fonctionnement du bar spécifique.</li></ul><div>Au stand bouffe, plusieurs missions pourront t''être confiées. Je te conseille de lire tout ce qui suit pour ne pas être perdu quand tu arriveras.</div></div></div><div><br></div><div><b><u>Serveur bar (ton resp attitré : Léo)</u></b></div><div>Ta mission consiste simplement à prendre la commande du client, lui prendre ses sous, envoyer la commande en cuisine et la récupérer pour la donner au client (auprès des pivots en général). Voici comment se déroule une commande type :</div><div><ul><li>prends la commande du client. Attention : mémorise bien son visage pour ne pas refiler la commande à un autre rôti ;</li><li>maintenant, prends-lui son argent ;</li><li>va voir la caisse, dis lui ta commande et donne lui les sous ; (il refait le compte pour vérifier)</li><li>il/elle encaisse les sous et te rend la monnaie ;</li><li>tu donnes la commande au pivot (c''est le gaillard derrière qui s''active avec les frites, les sandwichs et les sauces)</li><li>tu patientes, et le pivot finit par te filer ta commande</li><li>tu donnes au client ce qu''il a demandé, en n''oubliant pas de lui rendre sa monnaie</li></ul><div><u><b>Pivot (ta resp attitré : Caro)</b></u></div></div><div>En tant que pivot, tu dois simplement écouter la commande du serveur, la préparer et la donner au serveur. Facile, non ? (tu vas surtout faire relai entre le Karna, les sauces et la caisse)</div><div><br></div><div><p dir="ltr" style="margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline;"><u><b>Tireur&nbsp;</b></u></span><u><b>(ta resp attitré : Caro)</b></u></p><ul style="margin-top: 0pt; margin-bottom: 0pt;"><li dir="ltr" style="list-style-type: disc; vertical-align: baseline;"><p dir="ltr" style="margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline;">Tu tires les bières en fonction de ce que les serveurs te disent ! En soirée, les bières ne sont servis qu''avec une commande de bouffe.</span></p></li><li dir="ltr" style="list-style-type: disc; vertical-align: baseline;">Pour les sirops, on fait les radins, c’est 1cm et pas plus :p. Dernier point, c’est pas open bar, ton resp orga bar te le rappellera.</li><li dir="ltr" style="list-style-type: disc; vertical-align: baseline;">Pour tout problème et tout changement de futs,<b> tu demandes à Caro ! Elle est là pour ça.</b></li></ul></div><div><br></div><div>Dans tous les cas, si tu rencontres un problème pendant ton créneau, adresse-toi à un resp'' bouffe, il est là pour t''aider ! ;)</div><div>Etre souriant, joyeux, drôle avec les festivaliers. Si quelqu’un est complètement ivre et veut une bière, tu vas voir les orgas bouffe, il est ton principal interlocuteur et doit savoir tout sur tout. Pour les sirops dans la bière, on fait les radins, c’est 1cm et pas plus :p. Dernier point, c’est pas open bar, ton resp orga bar te le rappellera.</div><div><br></div><div>Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”."Frites are Kings of 24Heures"</div><p></p>', NULL, 0, 'Bar bouffe', 3, 'non'),
(442, 210, 435, NULL, 'Aide au Salon Urbain', '<p></p><ul><li>Rends toi sur la pelouse des Humas, au "Salon Urbain" de La Locomotive.</li><li>Présente toi et demande leur ce que tu peux faire pour les aider.</li><li>Fais du mieux que tu peux et amuse toi ! :)</li><li>Continue à t''amuser jusqu''à la relève !</li></ul><div>En cas d''embrouilles, contacte Morgane 06 70 11 59 48</div><p></p>', 'Ramène ton charisme et ta patience !', 0, 'Pelouse des humas', 3, 'raf'),
(443, 210, 440, NULL, 'Installation de la tente Street Art', '<p></p><ul><li>Retrouve Morgane au dépôt des Humas (06 70 11 59 48)</li><li>Rends toi sur la pelouse des Humas, à l''emplacement de l''anim Street Art.&nbsp;</li><li>Monte la tente. La diagonale doit être en direction de l''arbre (parvis)</li><li>Tu es libre :)</li></ul><p></p>', 'Tes petits bras.', 0, 'Dépôt des Humas', -1, 'raf'),
(444, 19, 441, NULL, 'Barman Bar Cétiat', '<span id="docs-internal-guid-b6a3566c-5c4e-6f00-8590-8b830e56e04f"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecter aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">En arrivant au Bar, présente toi au Resp Orga Bar (crie “Resp Orga Bar si tu le trouve pas”). Il va te briefer et t’assigner à un des postes suivants : Tireur - Serveur - Pivot. Tu pourras changer après une heure si tu le souhaite ;).</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Serveur :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu prends la commande des gens</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu encaisse l’argent et rends la monnaie</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Et finalement tu leur donne à boiiiiire</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">S’ils payent par CB appel le caissier spécial CB</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu danse et mets l’ambiance</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Apprends bien les prix</span></p></li></ul><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Pivot :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu fais le lien entre les serveurs et les tireures</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu dispose sur la tables les différentes bières et tu dis au tireur ce qu’il faut</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu danse et mets l’ambiance</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tireur :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu tires les bières en fonction de ce que le pivot te dit</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Si tu as de l’avance (champion !) prépare les bières les plus demandé en avance</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Ton role = moins de mousse possible !</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu danse et mets l’ambiance</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Diverses infos :</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Dans tous les cas être souriant, joyeux, drôle avec les festivaliers. S’il y a quelqu’un completement ivre qui veux une bière tu vas voir les resp orga bar, il est ton principale interlocuteur et doit savoir tout sur tout. Pour les sirops, on fait les radins, c’est 1cm et pas plus :p. Dernier point, c’est pas open bar, ton resp orga bar te le rappellera.</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"><br></span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">------------Si ton créneau couvre la fermeture tu devras assurer le nettoyage : pas de soucis, vous êtes beaucoup ça va aller vite --------------------------------------------- </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></p><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span></span>', NULL, 0, 'En face du Cetiat/Petite Scène', 3, 'non'),
(445, 210, 440, NULL, 'Accueil et installation du Street Art', '<UL>\r\n<LI>Au QG orga, récupère un cutter, un rouleau de scotch et 2 sacs poubelle.</LI>\r\n<LI>Repère l''emplacement de l''animation Street Art et mémorise-le !</LI>\r\n<LI>Va au dépôt Humas et récupère le kit Street Art (1 table 2places + 2 poteaux).</LI>\r\n<LI>A 13h30, tu dois être sur le parvis des Humas pour retrouver La Locomotive (Camille 0683214254)</LI>\r\n<LI>Montre leur l''emplacement de leur animation: un film cellophane (le futur mur de tags) va être tendu entre les poteaux et les grands arbres près du parvis. Et entre les grands arbres.</LI>\r\n<LI>Aide-les à s''installer.&nbsp;</LI>\r\n<LI>Dis-leur que la relève soft devrait arriver à 14h, souhaite-leur une bonne après-midi et éclipse-toi.&nbsp;</LI>\r\n<LI>Ramène le cutter et le scotch au QG orga.&nbsp;</LI>\r\n<LI>Tu es libre :)</LI></UL>\r\n<DIV>En cas d''embrouilles, contacte Morgane: 06 70 11 59 48</DIV>\r\n<P></P>', 'Ton charisme et ta bonne humeur :)', 0, 'QG orga', 3, 'raf'),
(446, 19, 441, NULL, 'Resp Bar Cétiat', '<span id="docs-internal-guid-98caa997-5c58-c818-5f2d-8e0c4e411570"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecter aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as déjà assisté au briefing et à la formation donc tu dois être bien au courant de comment ça va se passer. Amènes ta fiche avec toi pour avoir toutes les infos qu’il te faut.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu es le contact privilégié des Orgas Bars (les charismatiques Choppy et Bruce Louis), d’où ton talkie, tu dois travailler main dans la main avec le Resp Orga Bar pour la bonne gestion du bar.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tes missions :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Chercher un talkie en début de créneau au QG orga</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Annoncer aux orgas bars Choppy et Bruce Louis au talkie que tu es là</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Approvisionner en gobelet le bar. Pense à en prendre avant l’ouverture pour tenir un bon moment.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Approvisionner en soft, et veiller à ce que les frigos soit bien comme il faut (Facing de Red Bull notamment.)</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Appeler le rativo arrrrrgent si les caisses sont vides (plus de pièces de 50ct par exemple) ou pleine à craquer. Le resp orga bar te préviendra si c’est le cas.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Gérer la sécurité des bars (personne passe derrière les bars) !</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Approvisionner en bière. Quand un fût est vide, change le avec un en stock, annonce au talkie que tu as besoin d’un fût, écoute la réponse des Orgas Bars, et rends toi au creux GCU. C’est toi qui percute les fûts et les change. Percute le premier fût avant l’ouverture du bar pour être tranquille à l’ouverture. </span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Superviser le bar en général, si tu te pignole aide à servir ou tirer.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Aider au rangement après la fermeture </span><span style="white-space: pre-wrap;"> (le samedi il faudra ramener les tables et les chaises de ton bars au dépôt AIP).</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Contacts : Bruce Louis 07 86 85 59 21 / Choppy </span><span style="font-size: 13px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">&nbsp;</span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">06 67 12 02 16</span></span>', NULL, 0, 'En face du Cetiat/Petite Scène', 3, 'non'),
(447, 21, 406, NULL, 'Conducteur Rendu petit matos dirpat', '<p></p><ul><li>Se rendre au local des 24 heures</li><li>Prendre deux voitures</li><li>Récupérer toutes les clefs de la dirpat (voir liste dans le casier log)</li><li>Charger le matériel Dirpat trié préalablement par la log (matos avec scotch elec orange)</li><li>Aller à la Dirpat voir Maud.</li><li>Tu la trouves pas ? C''est normal, elle est en vacances ! Va voir le magasin à la place.</li><li>Rendre le matos et les clefs</li><li>Remercier</li><li>Retourner au local</li><li>Rendre la clé des voitures</li></ul><p></p>', NULL, 1, 'Local des 24H', 3, 'non'),
(448, 21, 415, NULL, 'Aller chercher les tentes du club Elek', '<p>BLABLABLA</p>', NULL, 0, 'Local des 24H', -1, 'non'),
(449, 21, 415, NULL, 'Conducteur 20m3 - Rendre les tentes du club Elek', '<p>RDV au local des 24</p><p>Retrouve tes co-tâches, les 7 tentes du club elek et un 20m3 ou des voitures si les 20m3 sont pris</p><p>Appeler Léonard - 06 85 21 11 47 - et lui dire que tu arrives au club elek (bâtiment SGM)</p><p>Lui rendre ses 7 tentes 2*3 et lui faire des gros bibis</p>', NULL, 0, 'Local des 24H', 3, 'non'),
(450, 13, 442, NULL, 'Barman Bar AIP', '&nbsp;<b style="font-weight: normal;"><p id="docs-internal-guid-a908aa7f-6006-6169-809b-8187cc241827" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;" dir="ltr"><span style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; background-color: transparent;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;" dir="ltr"><span style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; background-color: transparent;">Tu as le privilège d’être affecté aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; background-color: transparent;"></span><p style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;" dir="ltr"><span style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; background-color: transparent;">En arrivant au Bar, présente toi au Resp Orga Bar (crie “Resp Orga Bar” si tu le trouve pas). Il va te briefer et t’assigner à un des postes suivants : Tireur - Serveur - Pivot. Tu pourras changer après une heure si tu le souhaite ;).</span></p><br><span style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; background-color: transparent;"></span><p style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;" dir="ltr"><span style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; background-color: transparent;">Serveur :</span></p><ul style="margin-top: 0pt; margin-bottom: 0pt;"><li style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; list-style-type: disc; background-color: transparent;" dir="ltr"><p style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;" dir="ltr"><span style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; background-color: transparent;">Tu prends la commande des gens</span></p></li><li style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; list-style-type: disc; background-color: transparent;" dir="ltr"><p style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;" dir="ltr"><span style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; background-color: transparent;">Tu encaisses l’argent et rends la monnaie</span></p></li><li style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; list-style-type: disc; background-color: transparent;" dir="ltr"><p style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;" dir="ltr"><span style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; background-color: transparent;">Et finalement tu leur donnes à boiiiiire</span></p></li><li style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; list-style-type: disc; background-color: transparent;" dir="ltr"><p style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;" dir="ltr"><span style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; background-color: transparent;">S’ils payent par CB, appelle le caissier spécial CB</span></p></li><li style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; list-style-type: disc; background-color: transparent;" dir="ltr"><p style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;" dir="ltr"><span style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; background-color: transparent;">Tu danses et mets l’ambiance</span></p></li><li style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; list-style-type: disc; background-color: transparent;" dir="ltr"><p style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;" dir="ltr"><span style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; background-color: transparent;">Apprends bien les prix</span></p></li></ul><p style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;" dir="ltr"><span style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; background-color: transparent;">Pivot :</span></p><ul style="margin-top: 0pt; margin-bottom: 0pt;"><li style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; list-style-type: disc; background-color: transparent;" dir="ltr"><p style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;" dir="ltr"><span style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; background-color: transparent;">Tu fais le lien entre les serveurs et les tireurs</span></p></li><li style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; list-style-type: disc; background-color: transparent;" dir="ltr"><p style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;" dir="ltr"><span style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; background-color: transparent;">Tu disposes sur la tables les différentes bières et tu dis au tireur ce qu’il faut</span></p></li><li style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; list-style-type: disc; background-color: transparent;" dir="ltr"><p style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;" dir="ltr"><span style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; background-color: transparent;">Tu danses et mets l’ambiance</span></p></li></ul><br><span style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; background-color: transparent;"></span><p style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;" dir="ltr"><span style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; background-color: transparent;">Tireur :</span></p><ul style="margin-top: 0pt; margin-bottom: 0pt;"><li style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; list-style-type: disc; background-color: transparent;" dir="ltr"><p style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;" dir="ltr"><span style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; background-color: transparent;">Tu tires les bières en fonction de ce que le pivot te dit</span></p></li><li style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; list-style-type: disc; background-color: transparent;" dir="ltr"><p style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;" dir="ltr"><span style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; background-color: transparent;">Si tu as de l’avance (champion !) prépare les bières les plus demandées en avance</span></p></li><li style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; list-style-type: disc; background-color: transparent;" dir="ltr"><p style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;" dir="ltr"><span style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; background-color: transparent;">Ton rôle = moins de mousse possible !</span></p></li><li style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; list-style-type: disc; background-color: transparent;" dir="ltr"><p style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;" dir="ltr"><span style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; background-color: transparent;">Tu danse et mets l’ambiance</span></p></li></ul><br><span style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; background-color: transparent;"></span><p style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;" dir="ltr"><span style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; background-color: transparent;">Diverses infos :</span></p><p style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;" dir="ltr"><span style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; background-color: transparent;">Dans tous les cas être souriant, joyeux, drôle avec les festivaliers. Si quelqu’un est complètement ivre et veut une bière, tu vas voir les resp orga bar, il est ton principal interlocuteur et doit savoir tout sur tout. Pour les sirops, on fait les radins, c’est 1cm et pas plus :p. Dernier point, c’est pas open bar, ton resp orga bar te le rappellera.</span></p><div><b style="font-weight: normal;"><br></b></div><div><span style="font-family: Arial; font-size: 15px; line-height: 17.25px; white-space: pre-wrap;">------------Si ton créneau couvre la fermeture tu devras assurer le nettoyage : pas de soucis, vous êtes beaucoup ça va aller vite --------------------------------------------- </span><b style="font-weight: normal;"><br></b></div><br><span style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; background-color: transparent;"></span><span style="color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; vertical-align: baseline; background-color: transparent;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span><br></b>', NULL, 0, 'Devant l''AIP', 3, 'non'),
(451, 210, 440, NULL, 'Tout va bien ?', '<p></p><ul><li>Prends ton appareil photo</li><li>Rends toi sur l''emplacement de l''animation Street Art de La Locomotive.</li><li>Présente-toi aux grapheurs et dis-leur qu''on aimerait bien qu''ils reviennent l''an prochain !</li><li>Demande-leur s''ils n''ont besoin de rien et tape la discute pour t''assurer qu''ils kiffent le festoche.</li><li>Fais quelques photos.</li><li>Cours faire d''autres tâches, t''es déjà en retard ! :)</li></ul><p></p>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(452, 210, 440, NULL, 'Aide sur le stand Street Art', '<p></p><ul><li>Rends-toi sur l''emplacement du Street Art, vers le parvis des Humas.</li><li>Présente-toi et propose ton aide.</li><li>Fais du mieux que tu peux et amuse toi !</li><li>Continue de t''amuser jusqu''à la relève ! :)</li></ul><div>En cas d''embrouilles, appelle Morgane: 06 70 11 59 48</div><p></p>', 'Ton charisme et ta bonne humeur.', 0, 'Pelouse des Humas', 3, 'raf'),
(453, 210, 440, NULL, 'Range le stand Street Art', '<p></p>\r\n<ul>\r\n<li>Au QG orga, récupère 1 scotch et 1 cutter.</li>\r\n<li>Rends-toi sur la pelouse des Humas, à l''emplacement du Street Art (tu peux pas les louper !)</li></ul>\r\n<ul>\r\n<li>Explique que tu viens les aider à ranger parce que la zone ferme à 18h.</li>\r\n<li>S''il reste des festivaliers, explique-leur que l''animation est terminée.</li>\r\n<li>Aide à enlever le mur de graphs accroché aux piliers (celui entre les arbres reste jusqu''à dimanche. Tu peux utiliser du scotch pour être sûr qu''il tienne)</li>\r\n<li>Remercie La Locomotive et les grapheurs d''être venus !&nbsp;</li></ul>\r\n<ul>\r\n<li>Ramène la table, les poteaux et les murs de graphs qui restent, au dépôt des Humas. Jette le(s) sac poubelle.<br></li>\r\n<li>Vérifie que tu n''as rien oublié sur le stand. Tu es libre :)</li></ul>\r\n<div></div>\r\n<div>En cas d''embrouilles, contacte Morgane: 06 70 11 59 48</div>\r\n<div><br></div>\r\n<p></p>', NULL, 0, 'QG orga', 3, 'raf'),
(454, 210, 440, NULL, 'Démonter la tente Street Art', '<p></p><ul><li>Rends toi sur l''emplacement du Street Art.</li><li>Démonte la tente.</li><li>Ramène tout au dépôt des Humas.</li><li>Tu es libre :)</li></ul><div>En cas d''embrouilles, contacte Morgane: 06 70 11 59 48</div><p></p>', 'Tes petits bras.', 0, 'Pelouse des Humas', -1, 'non');
INSERT INTO `Tache` (`id`, `responsable_id`, `groupetache_id`, `importid`, `nom`, `consignes`, `materielSupplementaire`, `permisNecessaire`, `lieu`, `statut`, `commentaireLog`) VALUES
(455, 21, 415, NULL, 'Rangement du matos ASTUS, cave et cave PC', '<p></p><ul><li>RDV au QG orga<br></li><li>Retrouve Cetelem (Alexis - 06 80 52 08 62)<br></li><li>Demander les clés d''un 20m3, une clef pompier, de la semaine asiatique et du club rock aux humains</li><li>@Cetelem : Ne pas oublier la liste d''affectation des frigos et des canaps</li><li>Prendre 1 diable s''il y en a 1, 2 s''il y en a 2 ...<br></li><li>Aller au club rock</li><li>Appeler l''ASTUS (sûrement Adrien - 06 13 09 37 20)</li><li>Récupérer le frigo, les 3 canaps et les 2 fauteuils de l''Astus, les frigos des 24, les 2 frigos de la semaine asiatique et le frigo de cook</li><li>Pause 20m3 !! Tout le monde dans les canaps (sauf 1 qui reste avec cetelem pour l''ambiance !)</li><li>Aller en TC et remettre le matos dans leur local</li><li>Aller à la DirPat, récupérer les clefs du fond de la cave PC et aller décharger les frigos au fond</li><li>Rendre les clefs de la cave à la DirPat</li><li>Aller au H et décharger les frigos de la semaine asiatique et de cook dans leur local, refermer la porte</li><li>Ramener le 20m3 au local</li><li>Rendre toutes les clés aux humains, manger et se pignoler !</li></ul><p></p>', NULL, 0, 'Local des 24H', 3, 'non'),
(456, 21, 415, NULL, 'Etat des lieux retour Matos BDE/Pool', '<p></p><ul><li>RDV au local des 24</li><li>Trouve tes co-tâche</li><li>Demande les clefs de Bradley le 20m3 aux humains de l''ambiance</li><li>Charger le matos du BDE et du pool des clubs trié par la log (tu sais, celui qui porte des chaises et l''autre qui branche des fils) dans Bradley</li><li>Aller se garer devant le BdE</li><li>Trouver Bastien ou <strike>Mansenss</strike>&nbsp;quelqu''un de compétent dans le BdE</li><li>Faire l''état des lieux retour du matos qu''on a emprunté pour le pool et le BdE</li><li>Récupérer tous les chèques de cautions (parce qu''on a rien cassé !)</li><li>Faire des gros bibis</li><li>Retourner se pignoler au local</li></ul><p></p><p></p>', NULL, 0, 'Local des 24H', 3, 'non'),
(457, 352, 445, NULL, 'Gestion Diverse BA Mardi 20', '<p>Gérer la bouffe artiste, cuisiner, faire du service, de la vaisselle, de la décoration, virer les orgas des 24h qui n''ont rien à faire en cuisine s''ils ne sont pas avec une tâche bouffe artiste sur leur planning à l''heure précise où ils sont là.</p>', NULL, 0, 'MdE', 3, 'non'),
(458, 352, 446, NULL, 'Cuisinier Mardi 20', '<p>Votre mission: cuisiner pour le prestigieux Restaurant des Artistes des 24h.</p><div><br></div><div>Sous la direction de l''amateur Chef Le Troll (pour vous, ce sera "Chef"), vous aurez l''opportunité d''apprendre des recettes et / ou perfectionner vos connaissances en cuisine.</div><div><br></div><div>Soyez bien motivés car il y a beaucoup de travail et comme dans toute cuisine qui se respecte, pas assez de personnel.</div><div><br></div><div>Rendez-vous à l''heure de ton créneau en salle hibiscus, à la MDE.</div><p></p>', NULL, 0, 'MdE', 3, 'non'),
(459, 352, 447, NULL, 'Serveur - Mardi 20', '<p></p><div>Votre mission: ''serveur'' pour le prestigieux Restaurant des Artistes des 24h.</div><div><br></div><div>Sous la direction de l''amateur Chef Le Troll (pour vous, ce sera "Chef"), vous aurez l''opportunité de faire le service de table auprès de nombreuses personnes de qualité.</div><div><br></div><div>Soyez bien motivés car il y a beaucoup de travail et comme dans tout restaurant qui se respecte, pas assez de personnel.</div><div><br></div><div>Rendez-vous à l''heure de ton créneau en salle hibiscus, à la MDE.</div><p></p>', NULL, 0, 'MdE', 3, 'non'),
(460, 352, 448, NULL, 'Vaisselle - Mardi 20', '<p>Votre mission: ''plongeur'' pour le prestigieux Restaurant des Artistes des 24h.</p><p>Sous la direction de l''amateur Chef Le Troll (pour vous, ce sera "Chef"), vous aurez l''opportunité de nettoyer les restes des repas auxquels auront assisté de nombreuses personnes de qualité.</p><p>L''eau, le savon et les assiettes sales sont fournies.</p><p>Soyez bien motivés car il y a beaucoup de travail et comme dans tout restaurant qui se respecte, pas assez de personnel.<br></p><p>Rendez-vous à l''heure de ton créneau en salle hibiscus, à la MDE.</p><div>Heureusement, pour l''aide que tu apporte, tu auras droit à une récompense en nourriture (bien meilleur que le pâté que pourront te donner les humains ou les mamans).<br></div><div><div><br></div><div><br></div></div><p></p>', NULL, 0, 'MdE', 3, 'non'),
(461, 45, 312, NULL, 'Accueil Déportivo', '<p></p><ul><li>Récupérer les bracelets sécu du groupe</li><li>Récupérer le chèque pour l''artiste auprès de Jérémie</li><li>Se tenir prêt à l''arrivée du groupe (téléphone chargé, allumé et pas en mode vibreur)</li><li>Leur remettre leurs bracelets sécu</li><li>Les emmener sur la zone concerts et les confier à Thomas pour qu''il les mette en relation avec les équipes techniques</li><li>Leur montrer leur loge et leur donner le code (vérifier avec eux qu''ils ne manquent de rien dans leur loge)</li><li>Leur montrer l''emplacement du restaurant artistes</li><li>Se tenir à leur disposition (téléphone chargé, etc.)</li></ul><u>Après le concert :</u><br><ul><li>Leur faire remplir les documents de la Sacem (ou récupérer leur version pré-remplie)</li><li>Leur remettre leur chèque</li></ul><u>Timing du groupe :</u><br><ul><li>Get-in : 18h00<br></li><li>Repas : 20h00<br></li><li>LineCheck : 21h15-22h00</li><li>Concert : 22h00-23h00</li></ul><div><u style="text-decoration: underline;">Logement :</u> Hôtel Ibis Budget Villeurbanne</div><div><br></div><u>Contacts :</u><br><ul><li>Mathilde Sirmel (Tour Manager) : 06 83 46 07 13<br></li><li>Yann Madec (Son) : 06 86 73 25 84<br></li><li>Snoise (Lumière) : 06 12 11 83 47<br></li></ul><p></p>', NULL, 0, 'Everywhere', 3, 'non'),
