(478, 19, 441, NULL, 'Resp Orga Bar Cétiat', '<span id="docs-internal-guid-46e2d6a5-5f38-1d99-b5fc-01100f09ce4f"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecter aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as déjà assisté au briefing et à la formation donc tu dois être bien au courant de comment ça va se passer. Amènes ta fiche avec toi pour avoir toutes les infos qu’il te faut.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu es l’interlocuteur privilégié des softs, soit souriant et gentil, apprends leur noms si possible. Ta mission est qu’ils fassent bien leur boulot.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tes missions :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Te présenter au resp Bar à ton arrivé pour qu’il l’annonce au talkie (rappelle le lui s’il oublie)</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Affecter les softs aux différentes taches : Pivot, tireur et serveur. Vérifie qu’il font bien les choses, et fait tourner s’il faut.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Briefer les softs pour qu’il tient bien leur rôle. Et rappelle les que c’est pas open bière (une de temps en temps ok mais pas moult). </span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Rappeler au softs qu’il faut bien apprendre le prix des bières.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Surveiller les softs : orga bouré (= orga viré). Appelle l’Orga Bar s’il y a un roti. Vérifie qu’il passe pas des conso gratuite.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Dire au resp Bars s’il manque des softs ou s’il y en a trop, il contactera l’humain.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Motiver tes troupes ! La réussite des bars passe par des orgas motivés et heureux de servir. S’il faut nourrit les ;)</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Le sirop c’est 1cm et pas plus</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Aider au rangement après la fermeture des bars.</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">En cas de besoin contact les Orga Bars, Choppy ou Bruce Louis, avec le talkie du resp Bar ou par téléphone (à éviter).</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Contact : Bruce Louis 07 86 85 59 21 / Choppy </span><span style="font-size: 13px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">&nbsp;</span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">06 67 12 02 16</span></p></span>', NULL, 0, 'En face du Cetiat/Petite Scène', 3, 'non'),
(479, 19, 441, NULL, 'Caissier Bar Cétiat', '<span id="docs-internal-guid-935c9397-5f49-2d0e-2005-94fc7d60693a"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecter aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Ta mission est de gérer la caisse du bar, voici le déroulement des taches :</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">En arrivant au Bar présente toi au Resp Orga Bar, c’est lui qui te briefera et te rappellera les consignes élémentaires.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Apprends aussi bien que tu peux les prix des différentes consos, ça va aller très vite et faudra pas faire d’erreur de calcul. Une fiche sera à ta disposition sur ta table.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Les serveurs vont venir vers toi pour te donner l’argent et c’est à toi de leur rendre la monnaie.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Si ta caisse commence à être bondée, ou s’il commence à plus y avoir de pièce de 50ct, don’t panic, appelle le Resp Orga Bar pour qu’il contact le ravito argent !</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; font-weight: bold; vertical-align: baseline; white-space: pre-wrap;">/!\\ La caisse ne doit jamais être laissée sans surveillance. Ne pars pas tant que la relève n’est pas arrivé, et n’arrive pas en retard à tes créneaux. Dans tous les cas se référer au Resp Orga Bar s’il y a un problème /!\\</span></p><br><span style="font-size: 15px; font-family: Arial; font-weight: bold; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage.</span></p><div><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"><br></span></div></span>', NULL, 0, 'En face du Cetiat/Petite Scène', 3, 'non'),
(480, 19, 441, NULL, 'Caissier TPE Bar Cétiat', '<span id="docs-internal-guid-5b7a7288-5f5a-3d7a-97f9-8b9f492a9e42"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecter aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu es responsable du payement par carte bancaire des festivaliers.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tes missions :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Te présenter au resp orga bar à ton arrivée</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Récupérer ton matos, vas voir le resp Orga bar si tu as des doutes sur son utilisation (il est censé te former).</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Encaisser les commandes qui se font par carte bancaire.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Garder toujours le TPE avec toi, seuls les Resps ou Orga Bars ont le droit de le prendre à part toi !</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tenir le TPE pendant le payement (les gens partent avec sinon...fail…).</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Donner le premier ticket au client et donner au caissier le deuxième.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Dire au resp Bar s’il y a un problème.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Servir normalement si tu te pignole ;)</span></p></li></ul><div><font face="Arial"><span style="font-size: 15px; line-height: 17.25px; white-space: pre-wrap;"><br></span></font></div><div><font face="Arial"><span style="font-size: 15px; line-height: 17.25px; white-space: pre-wrap;">Note : Si tu as créneau en Journée tu tiens en plus la caisse ! Le resp orga te briefera ;)</span></font></div><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></span>', NULL, 0, 'En face du Cetiat/Petite Scène', 3, 'non'),
(481, 54, 450, NULL, 'Accueil presta', '<p>-Aller au Gymnase C</p><div>-Dire bonjour au presta</div><div>-L''aider si nécessaire à mettre les filets&nbsp;</div><div>-Lui indiquer les consignes de sécurité : numero&nbsp;<span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.333333969116211px; background-color: rgb(255, 255, 255);"><a href="tel:04 72 43 70 70">04 72 43 70 70</a>&nbsp;ou&nbsp;</span><span style="color: rgb(34, 34, 34); background-color: rgb(255, 255, 255); font-family: Arial, sans-serif; font-size: 11pt;"><a href="tel:04 72 43 60 00">04 72 43 60 00</a></span></div><div><br></div><div><b style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14.666666984558105px; line-height: 20px; background-color: rgb(255, 255, 255);">Prestataire :&nbsp;</b><b style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14.666666984558105px; line-height: 20px; background-color: rgb(255, 255, 255);">charles capon -&nbsp;<a href="tel:0621596867">0621596867</a></b></div>', NULL, 0, 'Gymnase C', 3, 'non'),
(482, 19, 441, NULL, 'Rangement Bar Cétiat', '<span id="docs-internal-guid-81d12108-5f6f-702e-9d82-ffdf46f8692c"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Un grand bravo de la part des Orgas Bars ! Camille et Bruce Louis te félicite d’avoir tenu toute la soirée. Tu vas maintenant aider le Resp Bar à ranger le Bar pour qu’il soit niquel le lendemain</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Présente toi au resp bar</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">ensuite passe au qg orga récupérer la matériel nécessaire (éponge, seau, produit)</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">retrouve le Resp de bar qui va te dire ce qu''il faut faire</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">nettoie les bars et les tables</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">rassemble les déchets dans un sac poubelle et les mettre dans un coin le temps de les jeter dans la grande benne</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">aide le Resp bar dans le rangement</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">ramène le matos au qg une fois ta tache terminée</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, sans toi les bars seraient horrible le lendemain et le resp bar serait tout seul sinon ! Plus vite le travail est fait plus vite tu peux partir et manger du paté de volaille au QG.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></span>', NULL, 0, 'En face du Cetiat/Petite Scène', -1, 'non'),
(483, 54, 450, NULL, 'Bye presta', '<p></p><div>-Aller au Gymnase C<br></div><div>-Verifier que tout s''est bien passé&nbsp;</div><div>-L''aider à ranger le materiel</div><div>-Le remercier de sa venue</div><div><br></div><div><br></div><div><b style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">Prestataire :&nbsp;</b><b style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">charles capon - 0621596867</b></div><p></p>', NULL, 0, 'Gymnase C', 3, 'non'),
