FONT></LI></UL></DIV>', NULL, 0, 'terrain de tennis Colette Besson', 3, 'non');
INSERT INTO `Tache` (`id`, `responsable_id`, `groupetache_id`, `importid`, `nom`, `consignes`, `materielSupplementaire`, `permisNecessaire`, `lieu`, `statut`, `commentaireLog`) VALUES
(485, 19, 452, NULL, 'Rangement Bar Manège', '<span id="docs-internal-guid-81d12108-5f7d-7e83-8620-f7631c56e824"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Un grand bravo de la part des Orgas Bars ! Camille et Bruce Louis te félicite d’avoir tenu toute la soirée. Tu vas maintenant aider le Resp Bar à ranger le Bar pour qu’il soit niquel le lendemain</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Présente toi au resp bar</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">ensuite passe au qg orga récupérer la matériel nécessaire (éponge, seau, produit)</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">retrouve le Resp de bar qui va te dire ce qu''il faut faire</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">nettoie les bars et les tables</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">rassemble les déchets dans un sac poubelle et les mettre dans un coin le temps de les jeter dans la grande benne</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">aide le Resp bar dans le rangement</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">ramène le matos au qg une fois ta tache terminée</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, sans toi les bars seraient horrible le lendemain et le resp bar serait tout seul sinon ! Plus vite le travail est fait plus vite tu peux partir et manger du paté de volaille au QG.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></p><div><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"><br></span></div></span>', NULL, 0, 'En face de la station vélov Piscine', -1, 'non'),
(486, 54, 451, NULL, 'Amener le matos', 'Amener le matériel pour l''animation Street Hockey<br><ul><li>Se rendre au dépôt Humas<br></li><li>Aller récupérer 4 chaise au dépôt Humas</li><li>Se rendre aux terrains de tennis Colette Besson (situé entre les bâtiments E et H derrière la Kfet) et les déposer sur un terrain de tennis vide<br></li><li>Attendre que moi ou Malcolm ( le presta) arrive avant de laisser le matos</li><li>Repartir manger du pâté au QG orga !</li></ul><p>Si il y a le moindre souci, appelle le resp Kamil au 0621204350</p>', NULL, 0, 'terrain de tennis Colette Besson', 3, 'non'),
(487, 54, 451, NULL, 'Bye presta', '<p></p><ul><li>Aller voir le roller Hockey sur les terrains de tennis Colette Besson</li><li>Leur demander si tout s''est bien passé, les remercier, à l''année prochaine</li><li>Récupérer les 4 chaises et les rendre au dépôt Humas</li></ul><p></p>', NULL, 0, 'terrain de tennis Colette Besson', 3, 'non'),
(488, 19, 452, NULL, 'Caissier TPE Bar Manège', '<span id="docs-internal-guid-5b7a7288-5f90-96bf-87ef-be9536af5b89"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecter aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu es responsable du payement par carte bancaire des festivaliers.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tes missions :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Te présenter au resp orga bar à ton arrivée</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Récupérer ton matos, vas voir le resp Orga bar si tu as des doutes sur son utilisation (il est censé te former).</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Encaisser les commandes qui se font par carte bancaire.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Garder toujours le TPE avec toi, seuls les Resps ou Orga BarS ont le droit de le prendre à part toi !</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tenir le TPE pendant le payement (les gens partent avec sinon...fail…).</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Donner le premier ticket au client et donner au caissier le deuxième.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Dire au resp Bar s’il y a un problème.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Servir normalement si tu te pignole ;)</span></p></li></ul><div><font face="Arial"><span style="font-size: 15px; line-height: 17.25px; white-space: pre-wrap;"><br></span></font></div><div><font face="Arial"><span style="font-size: 15px; line-height: 17.25px; white-space: pre-wrap;">Ne pars pas tant que la relève n''est pas arrivée</span></font></div><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Note : Si tu as créneau en Journée tu tiens en plus la caisse ! Le resp orga te briefera ;)</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></p></span>', NULL, 0, 'En face de la station vélov Piscine', 3, 'non'),
(489, 19, 452, NULL, 'Barman Bar Manège', '<span id="docs-internal-guid-b6a3566c-5f92-fea9-5a22-5da0d9f2c1d7"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecter aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">En arrivant au Bar, présente toi au Resp Orga Bar (crie “Resp Orga Bar si tu le trouve pas”). Il va te briefer et t’assigner à un des postes suivants : Tireur - Serveur - Pivot. Tu pourras changer après une heure si tu le souhaite ;).</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Serveur :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu prends la commande des gens</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu encaisse l’argent et rends la monnaie</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Et finalement tu leur donne à boiiiiire</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">S’ils payent par CB appel le caissier spécial CB</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu danse et mets l’ambiance</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Apprends bien les prix</span></p></li></ul><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Pivot :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu fais le lien entre les serveurs et les tireurs</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu dispose sur la tables les différentes bières et tu dis au tireur ce qu’il faut</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu danse et mets l’ambiance</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tireur :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu tires les bières en fonction de ce que le pivot te dit</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Si tu as de l’avance (champion !) prépare les bières les plus demandées en avance</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Ton rôle = moins de mousse possible !</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu danse et mets l’ambiance</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Diverses infos :</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Dans tous les cas être souriant, joyeux, drôle avec les festivaliers. S’il y a quelqu’un complètement ivre qui veux une bière tu vas voir les resp orga bar, il est ton principale interlocuteur et doit savoir tout sur tout. Pour les sirops, on fait les radins, c’est 1cm et pas plus :p. Dernier point, c’est pas open bar, ton resp orga bar te le rappellera.</span></p><div><span><br></span></div><div><span style="font-family: Arial; font-size: 15px; line-height: 17.25px; white-space: pre-wrap;">------------Si ton créneau couvre la fermeture tu devras assurer le nettoyage : pas de soucis, vous êtes beaucoup ça va aller vite --------------------------------------------- </span><span><br></span></div><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></p></span>', NULL, 0, 'En face de la station vélov Piscine', 3, 'non'),
(490, 19, 452, NULL, 'Caissier Bar Manège', '<span id="docs-internal-guid-935c9397-5f96-77dd-0777-d7b38261e787"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecter aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Ta mission est de gérer la caisse du bar, voici le déroulement des taches :</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">En arrivant au Bar présente toi au Resp Orga Bar, c’est lui qui te briefera et te rappellera les consignes élémentaires.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Apprends aussi bien que tu peux les prix des différentes consos, ça va aller très vite et faudra pas faire d’erreur de calcul. Une fiche sera à ta disposition sur ta table.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Les serveurs vont venir vers toi pour te donner l’argent et c’est à toi de leur rendre la monnaie.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Si ta caisse commence à être bondée, ou s’il commence à plus y avoir de pièce de 50ct, don’t panic, appelle le Resp Orga Bar pour qu’il contact le ravito argent !</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; font-weight: bold; vertical-align: baseline; white-space: pre-wrap;">/!\\ La caisse ne doit jamais être laissée sans surveillance. Ne pars pas tant que la relève n’est pas arrivé, et n’arrive pas en retard à tes créneaux. Dans tous les cas se référer au Resp Orga Bar s’il y a un problème /!\\</span></p><br><span style="font-size: 15px; font-family: Arial; font-weight: bold; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></p></span>', NULL, 0, 'En face de la station vélov Piscine', 3, 'non'),
(491, 19, 452, NULL, 'Resp Bar Manège', '<span id="docs-internal-guid-98caa997-5f99-308c-ba3e-d57fda520c0d"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecter aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as déjà assisté au briefing et à la formation donc tu dois être bien au courant de comment ça va se passer. Amènes ta fiche avec toi pour avoir toutes les infos qu’il te faut.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu es le contact privilégié des Orgas Bars (les charismatiques Choppy et Bruce Louis), d’où ton talkie, tu dois travailler main dans la main avec le Resp Orga Bar pour la bonne gestion du bar.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tes missions :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Chercher un talkie en début de créneau au QG orga</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Annoncer aux orgas bars Choppy et Bruce Louis au talkie que tu es là</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Approvisionner en gobelet le bar. Pense à en prendre avant l’ouverture pour tenir un bon moment.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Approvisionner en soft, et veiller à ce que les frigos soit bien comme il faut (Facing de Red Bull notamment.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Appeler le rativo arrrrrgent si les caisses sont vides (plus de pièces de 50ct par exemple) ou pleine à craquer. Le resp orga bar te préviendra si c’est le cas.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Gérer la sécurité des bars (personne passe derrière les bars) !</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Approvisionner en bière. Quand un fût est vide, change le avec un en stock, annonce au talkie que tu as besoin d’un fût, écoute la réponse des Orgas Bars, et rends toi au creux GCU. C’est toi qui percute les fûts et les change. Percute le premier fût avant l’ouverture du bar pour être tranquille à l’ouverture. </span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Superviser le bar en général, si tu te pignole aide à servir ou tirer.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Aider au rangement après la fermeture </span><span style="white-space: pre-wrap;"> (le samedi il faudra ramener les tables et les chaises de ton bars au dépôt AIP).</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Contacts : Bruce Louis 07 86 85 59 21 / Choppy </span><span style="font-size: 13px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">&nbsp;</span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">06 67 12 02 16</span></p></span>', NULL, 0, 'En face de la station vélov Piscine', 3, 'non'),
(492, 19, 452, NULL, 'Resp Orga Bar Manège', '<span id="docs-internal-guid-46e2d6a5-5fa0-5cd5-ea0a-5fdd1adefeac"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecter aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as déjà assisté au briefing et à la formation donc tu dois être bien au courant de comment ça va se passer. Amènes ta fiche avec toi pour avoir toutes les infos qu’il te faut.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu es l’interlocuteur privilégié des softs, soit souriant et gentil, apprends leur noms si possible. Ta mission est qu’ils fassent bien leur boulot.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tes missions :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Te présenter au resp Bar à ton arrivé pour qu’il l’annonce au talkie (rappelle le lui s’il oublie)</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Affecter les softs aux différentes taches : Pivot, tireur et serveur. Vérifie qu’il font bien les choses, et fait tourner s’il faut.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Briefer les softs pour qu’il tient bien leur rôle. Et rappelle les que c’est pas open bière (une de temps en temps ok mais pas moult). </span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Rappeler au softs qu’il faut bien apprendre le prix des bières.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Surveiller les softs : orga bouré (= orga viré). Appelle l’Orga Bar s’il y a un roti. Vérifie qu’il passe pas des conso gratuite.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Dire au resp Bars s’il manque des softs ou s’il y en a trop, il contactera l’humain.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Motiver tes troupes ! La réussite des bars passe par des orgas motivés et heureux de servir. S’il faut nourrit les ;)</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Le sirop c’est 1cm et pas plus</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Aider au rangement après la fermeture des bars.</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">En cas de besoin contact les Orga Bars, Choppy ou Bruce Louis, avec le talkie du resp Bar ou par téléphone (à éviter).</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Contact : Bruce Louis 07 86 85 59 21 / Choppy </span><span style="font-size: 13px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">&nbsp;</span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">06 67 12 02 16</span></p></span>', NULL, 0, 'En face de la station vélov Piscine', 3, 'non'),
(493, 21, 453, NULL, 'Emmener le matériel des courses', '<p></p><ul><li>RDV au local des 24 Heures<br></li><li>Demander la clef de Bradley le 20m3 et la clef du club rock aux humains<br></li><li>Trouver la liste "matos pédales" dans le casier log</li><li>Vérifier que dans le tas pédales dans le local tout soit bon (qu''il n''y ai pas de matos en trop ou pas de truc qui manque)</li><li>Dans le cas contraire, voir avec Cetelem, il sait où c''est (don''t panic, ça va bien se passer)</li><li>Prendre une feuille de brouillon et écrire au marqueur "Pédalles" en gros (prendre la feuille avec toi, et oui, les 2 "l" sont importants, c''est pour les pédales quand même)</li><li>Charger Bradley avec le matos</li><li>Aller au club rock (rdc Bât H)</li><li>Décharger le matos dans le club rock</li><li>Tout mettre dans un coin</li><li>Placer la feuille "Pédalles" dessus bien en évidence</li><li>Fermer le club rock</li><li>Rentrer au local en 20m3</li><li>Rendre la clef de Bradley et la clef de la cave aux humains</li><li>Se pignoler</li><li>Boire des bières</li><li>Manger du saucisson</li></ul><p></p><p><br></p>', NULL, 0, 'Local des 24H', -1, 'non'),
(494, 21, 421, NULL, 'Déplacer les tables et chaises de l''espace VIP', '<ul><li>RDV au QG orga</li><li>Prendre la clef de l''espace VIP</li><li><br></li></ul>', NULL, 0, 'Local des 24H', -1, 'non'),
(495, 227, 455, NULL, 'Soupe à l''oignon', '<p>La log : Il nous faut</p><p>2 grandes plaques de cuissons ou (2 réchauds et 2 bouteilles de gaz)</p><p>2 marmites</p><p>2 couvercles</p><p>2 louches</p><p>De la Soupe à l''oignon !</p><p>Vaisselle pour distribution (bols et cuillères) en plastiques</p><p>Merki</p><p><br></p><p>Aller chercher tout le matos au village coureur qui est dans le \r\ngymnase colette besson entre les bâtiments E et H (demande à un orga \r\ncourse qui traine dans le coin)</p><p>Installer le stand (tables, poubelles, bols,&nbsp;cuillères, etc..) à coté du chrono</p><p>Installer les plaques à l''abri des intempéries et des coureurs</p><p>Faire chauffer la soupe et s''assurer qu''elle reste chaude</p><p>Servir la soupe aux coureurs entre 0h00 et 2h00</p><p>Faire en sorte qu''il en reste toujours <br></p><p>À partir de 2h, ranger tout le matos au village coureur.</p>', NULL, 0, 'Gymnase Colette Besson', 3, 'non'),
(496, 227, 455, NULL, 'Petit-déjeuner', '<p>Aller voir un orga pédale au village coureur qui est au gymnase Colette Besson (entre les batiments E et H) pour se faire briefer</p><p>Aller chercher tout le matos au village coureur:</p><p>2 plaques de cuisson ou (2 Rechauds 2 bouteilles de gaz)<br>Café, thé, chocolat, bouffe<br>Vaisselle de distribution<br></p><p>Préparer le petit dej'' sur le stand de ravitaillement</p><p>Annoncer au mégaphone le petit dej''</p><p>Servir\r\n le petit dej pour tout le monde en privilégiant les coureurs et veiller\r\n à ce qu''il y en ait assez pendant tout le petit dej'' (ne pas tout sortir\r\n d''un coup!)</p>', '2 plaques de cuisson ou (2 Rechauds 2 bouteilles de gaz)\r\nCafé, thé, chocolat, bouffe\r\nVaisselle de distribution', 0, 'Gymnase Colette Besson', 3, 'non'),
(497, 13, 442, NULL, 'Caissier bar AIP', '<span id="docs-internal-guid-935c9397-6013-483a-167e-4eeca861b1d2"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecté aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Ta mission est de gérer la caisse du bar, voici le déroulement des taches :</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">En arrivant au Bar présente toi au Resp Orga Bar, c’est lui qui te briefera et te rappellera les consignes élémentaires.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Apprends aussi bien que tu peux les prix des différentes consos, ça va aller très vite et il ne faudra pas faire d’erreur de calcul. Une fiche sera à ta disposition sur ta table.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Les serveurs vont venir vers toi pour te donner l’argent et c’est à toi de leur rendre la monnaie.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Si ta caisse commence à être bondée, ou s’il commence à plus y avoir de pièce de 50ct, don’t panic, appelle le Resp Orga Bar pour qu’il contacte le ravito argent !</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; font-weight: bold; vertical-align: baseline; white-space: pre-wrap;">/!\\ La caisse ne doit jamais être laissée sans surveillance. Ne pars pas tant que la relève n’est pas arrivé, et n’arrive pas en retard à tes créneaux. Dans tous les cas, se référer au Resp Orga Bar s’il y a un problème /!\\</span></p><br><span style="font-size: 15px; font-family: Arial; font-weight: bold; vertical-align: baseline; white-space: pre-wrap;"></span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></span>', NULL, 0, 'Devant l''AIP', 3, 'non'),
(498, 13, 442, NULL, 'Caissier TPE Bar AIP', '<span id="docs-internal-guid-5b7a7288-601b-b271-abca-3f6b4ae47159"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecté aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu es responsable du payement par carte bancaire des festivaliers.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tes missions :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Te présenter au resp orga bar à ton arrivée</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Récupérer ton matos, vas voir le resp Orga bar si tu as des doutes sur son utilisation (il est censé te former).</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Encaisser les commandes qui se font par carte bancaire.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Garder toujours le TPE avec toi, seuls les Resps ou Orga BarS ont le droit de le prendre à part toi !</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tenir le TPE pendant le payement (les gens partent avec sinon...fail…).</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Donner le premier ticket au client et donner au caissier le deuxième.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Prévenir le resp Bar s’il y a un problème.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Servir normalement si tu te pignoles ;)</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Note : Si tu as créneau en Journée tu tiens en plus la caisse ! Le resp orga te briefera ;)</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></span>', NULL, 0, 'Devant l''AIP', 3, 'non'),
(499, 13, 442, NULL, 'Rangement bar AIP', '<span id="docs-internal-guid-81d12108-6021-fbda-1d15-f1d551bcd067"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Un grand bravo de la part des Orgas Bars ! Choppy et Bruce Louis te félicite d’avoir tenu toute la soirée. Tu vas maintenant aider le Resp Bar à ranger le Bar pour qu’il soit niquel le lendemain</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Présente toi au resp bar</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">ensuite passe au qg orga récupérer la matériel nécessaire (éponge, seau, produit)</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">retrouve le Resp de bar qui va te dire ce qu''il faut faire</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">nettoie les bars et les tables</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">rassemble les déchets dans un sac poubelle et les mettre dans un coin le temps de les jeter dans la grande benne</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">aide le Resp bar dans le rangement</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">ramène le matos au qg une fois ta tache terminée</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, sans toi les bars seraient horribles le lendemain et le resp bar serait tout seul ! Plus vite le travail est fait plus vite tu peux partir et manger du pâté de volaille au QG.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></p><div><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"><br></span></div></span>', NULL, 0, 'Devant l'';AIP', -1, 'non');
INSERT INTO `Tache` (`id`, `responsable_id`, `groupetache_id`, `importid`, `nom`, `consignes`, `materielSupplementaire`, `permisNecessaire`, `lieu`, `statut`, `commentaireLog`) VALUES
(500, 13, 442, NULL, 'Resp bar AIP', '<span id="docs-internal-guid-98caa997-6027-8359-6da8-12b7c7f6ea6a"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size:15px;font-family:Arial;color:#000000;background-color:transparent;font-weight:normal;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size:15px;font-family:Arial;color:#000000;background-color:transparent;font-weight:normal;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;">Tu as le privilège d’être affecté aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><b style="font-weight:normal;" id="docs-internal-guid-98caa997-602a-861f-eb80-8bda0db54348"><br><span style="font-size:15px;font-family:Arial;color:#000000;background-color:transparent;font-weight:normal;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;"></span></b></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size:15px;font-family:Arial;color:#000000;background-color:transparent;font-weight:normal;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;">Tu as déjà assisté au briefing et à la formation donc tu dois être bien au courant de comment ça va se passer. Amène ta fiche avec toi pour avoir toutes les infos qu’il te faut.</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><b style="font-weight:normal;"><br><span style="font-size:15px;font-family:Arial;color:#000000;background-color:transparent;font-weight:normal;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;"></span></b></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size:15px;font-family:Arial;color:#000000;background-color:transparent;font-weight:normal;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;">Tu es le contact privilégié des Orgas Bars (les charismatiques Choppy et Bruce Louis), d’où ton talkie et tu dois travailler main dans la main avec le Resp Orga Bar pour la bonne gestion du bar.</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><b style="font-weight:normal;"><br><span style="font-size:15px;font-family:Arial;color:#000000;background-color:transparent;font-weight:normal;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;"></span></b></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size:15px;font-family:Arial;color:#000000;background-color:transparent;font-weight:normal;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;">Tes missions :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type:disc;font-size:15px;font-family:Arial;color:#000000;background-color:transparent;font-weight:normal;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size:15px;font-family:Arial;color:#000000;background-color:transparent;font-weight:normal;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;">Chercher un talkie en début de créneau au QG orga</span></p></li><li dir="ltr" style="list-style-type:disc;font-size:15px;font-family:Arial;color:#000000;background-color:transparent;font-weight:normal;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size:15px;font-family:Arial;color:#000000;background-color:transparent;font-weight:normal;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;">Annoncer aux orgas bars Choppy et Bruce Louis au talkie que tu es là</span></p></li><li dir="ltr" style="list-style-type:disc;font-size:15px;font-family:Arial;color:#000000;background-color:transparent;font-weight:normal;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size:15px;font-family:Arial;color:#000000;background-color:transparent;font-weight:normal;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;">Approvisionner en gobelet le bar. Pense à en prendre avant l’ouverture pour tenir un bon moment.</span></p></li><li dir="ltr" style="list-style-type:disc;font-size:15px;font-family:Arial;color:#000000;background-color:transparent;font-weight:normal;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size:15px;font-family:Arial;color:#000000;background-color:transparent;font-weight:normal;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;">Approvisionner en soft, et veiller à ce que les frigos soit bien comme il faut (Facing de Red Bull notamment).</span></p></li><li dir="ltr" style="list-style-type:disc;font-size:15px;font-family:Arial;color:#000000;background-color:transparent;font-weight:normal;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size:15px;font-family:Arial;color:#000000;background-color:transparent;font-weight:normal;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;">Appeler le ravito arrrrrgent si les caisses sont vides (plus de pièces de 50ct par exemple) ou pleines à craquer. Le resp orga bar te préviendra si c’est le cas.</span></p></li><li dir="ltr" style="list-style-type:disc;font-size:15px;font-family:Arial;color:#000000;background-color:transparent;font-weight:normal;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size:15px;font-family:Arial;color:#000000;background-color:transparent;font-weight:normal;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;">Gérer la sécurité des bars (personne passe derrière les bars) !</span></p></li><li dir="ltr" style="list-style-type:disc;font-size:15px;font-family:Arial;color:#000000;background-color:transparent;font-weight:normal;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size:15px;font-family:Arial;color:#000000;background-color:transparent;font-weight:normal;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;">Approvisionner en bière. Quand un fût est vide, change le avec un en stock, annonce au talkie que tu as besoin d’un fût, écoute la réponse des Orgas Bars, et rends toi au creux GCU. C’est toi qui percutes les fûts et les changes. Percute le premier fût avant l’ouverture du bar pour être tranquille à l’ouverture. </span></p></li><li dir="ltr" style="list-style-type:disc;font-size:15px;font-family:Arial;color:#000000;background-color:transparent;font-weight:normal;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size:15px;font-family:Arial;color:#000000;background-color:transparent;font-weight:normal;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;">Superviser le bar en général, si tu te pignoles, aide à servir ou tirer.</span></p></li><li dir="ltr" style="list-style-type:disc;font-size:15px;font-family:Arial;color:#000000;background-color:transparent;font-weight:normal;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size:15px;font-family:Arial;color:#000000;background-color:transparent;font-weight:normal;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;">Ranger après la fermeture (le dimanche il faudra ramener les tables et les chaises de ton bars au dépôt AIP).</span></p></li></ul><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><b style="font-weight:normal;"><br><span style="font-size:15px;font-family:Arial;color:#000000;background-color:transparent;font-weight:normal;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;"></span></b></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size:15px;font-family:Arial;color:#000000;background-color:transparent;font-weight:normal;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Contacts : Bruce Louis 07 86 85 59 21 / Choppy </span><span style="font-size: 13px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">&nbsp;</span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">06 67 12 02 16</span><br></p></span>', NULL, 0, 'Devant l''AIP', 3, 'non'),
(501, 3, 449, NULL, 'Accueil Gospel', '<p>Blank</p><p>Tiff les récupère à 15h vers la rothonde pour te les confier. Le concert est prévu à 16h. &nbsp;</p><p>On peut leur mettre à dispo le piano de rené char ou c''est trop compliqué ? [jeanne]</p>', NULL, 0, 'Everywhere', -1, 'non'),
(502, 13, 442, NULL, 'Resp Orga Bar AIP', '<span id="docs-internal-guid-46e2d6a5-6030-a8d7-de22-55c1ae4310e2"><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecté aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as déjà assisté au briefing et à la formation donc tu dois être bien au courant de comment ça va se passer. Amène ta fiche avec toi pour avoir toutes les infos qu’il te faut.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu es l’interlocuteur privilégié des softs, soit souriant et gentil, apprends leur nom si possible. Ta mission est qu’ils fassent bien leur boulot.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tes missions :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Te présenter au resp Bar à ton arrivée pour qu’il l’annonce au talkie (rappelle le lui s’il oublie)</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Affecter les softs aux différentes taches : Pivot, tireur et serveur. Vérifie qu’il font bien les choses, et fait tourner s’il faut.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Briefer les softs pour qu’il tienne bien leur rôle. Et rappelle leur que c’est pas open bière (une de temps en temps ok mais pas moult). </span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Rappeler aux softs qu’il faut bien apprendre le prix des bières.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Surveiller les softs : orga bouré (= orga viré). Appelle l’Orga Bar s’il y a un rôti. Vérifie qu’il passe pas des consos gratuites.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Dire au resp Bar s’il manque des softs ou s’il y en a trop, il contactera l’humain.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Motiver tes troupes ! La réussite des bars passe par des orgas motivés et heureux de servir. S’il faut, nourris les ;)</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Le sirop c’est 1cm et pas plus</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Aider au rangement après la fermeture des bars.</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">En cas de besoin, contacte les Orga Bars, Choppy ou Bruce Louis, avec le talkie du resp Bar ou par téléphone (à éviter).</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Contact : Bruce Louis 07 86 85 59 21 / Choppy </span><span style="font-size: 13px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">&nbsp;</span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">06 67 12 02 16</span></span>', NULL, 0, 'Devant l&#039;AIP', 3, 'non'),
(503, 13, 456, NULL, 'Barman Bar Piscine', '<span id="docs-internal-guid-b6a3566c-6036-5224-8061-89bc4978073b"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecté aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">En arrivant au Bar, présente toi au Resp Orga Bar (crie “Resp Orga Bar” si tu le trouve pas). Il va te briefer et t’assigner à un des postes suivants : Tireur - Serveur - Pivot. Tu pourras changer après une heure si tu le souhaite ;).</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Serveur :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu prends la commande des gens</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu encaisses l’argent et rends la monnaie</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Et finalement tu leur donnes à boiiiiire</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">S’ils payent par CB, appelle le caissier spécial CB</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu danses et mets l’ambiance</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Apprends bien les prix</span></p></li></ul><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Pivot :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu fais le lien entre les serveurs et les tireurs</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu disposes sur la tables les différentes bières et tu dis au tireur ce qu’il faut</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu danses et mets l’ambiance</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tireur :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu tires les bières en fonction de ce que le pivot te dit</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Si tu as de l’avance (champion !) prépare les bières les plus demandées en avance</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Ton rôle = moins de mousse possible !</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu danse et mets l’ambiance</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Diverses infos :</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Dans tous les cas être souriant, joyeux, drôle avec les festivaliers. Si quelqu’un est complètement ivre et veut une bière, tu vas voir les resp orga bar, il est ton principal interlocuteur et doit savoir tout sur tout. Pour les sirops, on fait les radins, c’est 1cm et pas plus :p. Dernier point, c’est pas open bar, ton resp orga bar te le rappellera.</span></p><div><span><br></span></div><span style="font-family: Arial; font-size: 15px; line-height: 17.25px; white-space: pre-wrap;">------------Si ton créneau couvre la fermeture tu devras assurer le nettoyage : pas de soucis, vous êtes beaucoup ça va aller vite --------------------------------------------- </span><br></span><div><span><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span></span></div>', NULL, 0, 'En face de la Piscine', 3, 'non'),
(504, 13, 456, NULL, 'Caissier Bar Piscine', '<span id="docs-internal-guid-935c9397-6038-3f8e-f991-8104a5441915"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecté aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Ta mission est de gérer la caisse du bar, voici le déroulement des taches :</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">En arrivant au Bar présente toi au Resp Orga Bar, c’est lui qui te briefera et te rappellera les consignes élémentaires.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Apprends aussi bien que tu peux les prix des différentes consos, ça va aller très vite et il ne faudra pas faire d’erreur de calcul. Une fiche sera à ta disposition sur ta table.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Les serveurs vont venir vers toi pour te donner l’argent et c’est à toi de leur rendre la monnaie.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Si ta caisse commence à être bondée, ou s’il commence à plus y avoir de pièce de 50ct, don’t panic, appelle le Resp Orga Bar pour qu’il contacte le ravito argent !</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; font-weight: bold; vertical-align: baseline; white-space: pre-wrap;">/!\\ La caisse ne doit jamais être laissée sans surveillance. Ne pars pas tant que la relève n’est pas arrivé, et n’arrive pas en retard à tes créneaux. Dans tous les cas, se référer au Resp Orga Bar s’il y a un problème /!\\</span></p><br><span style="font-size: 15px; font-family: Arial; font-weight: bold; vertical-align: baseline; white-space: pre-wrap;"></span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></span>', NULL, 0, 'En face de la Piscine', 3, 'non'),
(505, 13, 456, NULL, 'Caissier TPE Bar Piscine', '<span id="docs-internal-guid-5b7a7288-603a-9373-815d-d8f22875c313"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecté aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu es responsable du payement par carte bancaire des festivaliers.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tes missions :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Te présenter au resp orga bar à ton arrivée</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Récupérer ton matos, vas voir le resp Orga bar si tu as des doutes sur son utilisation (il est censé te former).</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Encaisser les commandes qui se font par carte bancaire.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Garder toujours le TPE avec toi, seuls les Resps ou Orga BarS ont le droit de le prendre à part toi !</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tenir le TPE pendant le payement (les gens partent avec sinon...fail…).</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Donner le premier ticket au client et donner au caissier le deuxième.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Prévenir le resp Bar s’il y a un problème.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Servir normalement si tu te pignoles ;)</span></p></li></ul><div><font face="Arial"><span style="font-size: 15px; line-height: 17.25px; white-space: pre-wrap;"><br></span></font></div><div><font face="Arial"><span style="font-size: 15px; line-height: 17.25px; white-space: pre-wrap;"><b>NE PARS PAS TANT QUE LA RELEVE N''EST PAS ARRIVEE!!!!</b></span></font></div><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Note : Si tu as créneau en Journée tu tiens en plus la caisse ! Le resp orga te briefera ;)</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></span>', NULL, 0, 'En face de la Piscine', 3, 'non'),
(506, 13, 456, NULL, 'Rangement Bar Piscine', '<span id="docs-internal-guid-81d12108-603c-e65a-6272-1be886065bea"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Un grand bravo de la part des Orgas Bars ! Choppy et Bruce Louis te félicite d’avoir tenu toute la soirée. Tu vas maintenant aider le Resp Bar à ranger le Bar pour qu’il soit niquel le lendemain</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Présente toi au resp bar</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">ensuite passe au qg orga récupérer la matériel nécessaire (éponge, seau, produit)</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">retrouve le Resp de bar qui va te dire ce qu''il faut faire</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">nettoie les bars et les tables</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">rassemble les déchets dans un sac poubelle et les mettre dans un coin le temps de les jeter dans la grande benne</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">aide le Resp bar dans le rangement</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">ramène le matos au qg une fois ta tache terminée</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, sans toi les bars seraient horribles le lendemain et le resp bar serait tout seul ! Plus vite le travail est fait plus vite tu peux partir et manger du pâté de volaille au QG.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span></span>', NULL, 0, 'En face de la Piscine', -1, 'non'),
(507, 13, 456, NULL, 'Resp bar Piscine', '<span id="docs-internal-guid-98caa997-603e-b714-6a62-684b9b6f14c9"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecté aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as déjà assisté au briefing et à la formation donc tu dois être bien au courant de comment ça va se passer. Amène ta fiche avec toi pour avoir toutes les infos qu’il te faut.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu es le contact privilégié des Orgas Bars (les charismatiques Choppy et Bruce Louis), d’où ton talkie et tu dois travailler main dans la main avec le Resp Orga Bar pour la bonne gestion du bar.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tes missions :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Chercher un talkie en début de créneau </span><span style="white-space: pre-wrap;"> au QG orga</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Annoncer aux orgas bars Choppy et Bruce Louis au talkie que tu es là</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Approvisionner en gobelet le bar. Pense à en prendre avant l’ouverture pour tenir un bon moment.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Approvisionner en soft, et veiller à ce que les frigos soit bien comme il faut (Facing de Red Bull notamment).</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Appeler le ravito arrrrrgent si les caisses sont vides (plus de pièces de 50ct par exemple) ou pleines à craquer. Le resp orga bar te préviendra si c’est le cas.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Gérer la sécurité des bars (personne passe derrière les bars) !</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Approvisionner en bière. Quand un fût est vide, change le avec un en stock, annonce au talkie que tu as besoin d’un fût, écoute la réponse des Orgas Bars, et rends toi au creux GCU. C’est toi qui percutes les fûts et les changes. Percute le premier fût avant l’ouverture du bar pour être tranquille à l’ouverture. </span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Superviser le bar en général, si tu te pignoles, aide à servir ou tirer.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Ranger après la fermeture (le samedi,</span><span style="white-space: pre-wrap;"> il faudra ramener les tables et les chaises de ton bars au dépôt AIP).</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Contacts : Bruce Louis 07 86 85 59 21 / Choppy </span><span style="font-size: 13px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">&nbsp;</span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">06 67 12 02 16</span></span>', NULL, 0, 'En face de la Piscine', 3, 'non');
INSERT INTO `Tache` (`id`, `responsable_id`, `groupetache_id`, `importid`, `nom`, `consignes`, `materielSupplementaire`, `permisNecessaire`, `lieu`, `statut`, `commentaireLog`) VALUES
(508, 13, 456, NULL, 'Resp Orga Bar piscine', '<span id="docs-internal-guid-46e2d6a5-6040-6aa8-c2b9-067708aa6279"><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecté aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as déjà assisté au briefing et à la formation donc tu dois être bien au courant de comment ça va se passer. Amène ta fiche avec toi pour avoir toutes les infos qu’il te faut.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu es l’interlocuteur privilégié des softs, soit souriant et gentil, apprends leur nom si possible. Ta mission est qu’ils fassent bien leur boulot.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tes missions :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Te présenter au resp Bar à ton arrivée pour qu’il l’annonce au talkie (rappelle le lui s’il oublie)</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Affecter les softs aux différentes taches : Pivot, tireur et serveur. Vérifie qu’il font bien les choses, et fait tourner s’il faut.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Briefer les softs pour qu’il tienne bien leur rôle. Et rappelle leur que c’est pas open bière (une de temps en temps ok mais pas moult). </span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Rappeler aux softs qu’il faut bien apprendre le prix des bières.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Surveiller les softs : orga bouré (= orga viré). Appelle l’Orga Bar s’il y a un rôti. Vérifie qu’il passe pas des consos gratuites.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Dire au resp Bar s’il manque des softs ou s’il y en a trop, il contactera l’humain.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Motiver tes troupes ! La réussite des bars passe par des orgas motivés et heureux de servir. S’il faut, nourris les ;)</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Le sirop c’est 1cm et pas plus</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Aider au rangement après la fermeture des bars.</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">En cas de besoin, contacte les Orga Bars, Choppy ou Bruce Louis, avec le talkie du resp Bar ou par téléphone (à éviter).</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Contact : Bruce Louis 07 86 85 59 21 / Choppy </span><span style="font-size: 13px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">&nbsp;</span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">06 67 12 02 16</span></p><div><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"><br></span></div></span>', NULL, 0, 'En face de la Piscine', 3, 'non'),
(509, 209, 457, NULL, 'Ouvrir le grillon', '<p></p><ul><li>Va au QG Orga</li></ul><ul><li>Récupère les clés du Grillon</li><li>Si la porte de RdC de la MdE est fermée:<br>Appelle le troll au 0661411517 pour qu''il vienne l’ouvrir depuis l''étage</li></ul><ul><li>Ouvrir le grillon aux orgas du club BD pour qu''ils puissent s''installer.</li></ul><ul><li>Ramène les clés au QG Orga !</li></ul><p></p>', 'Clés du Grillon et de la MdE', 0, 'QG Orga', 3, 'non (raf)'),
(510, 3, 311, NULL, 'Préparer les chambres du Troll', '<p></p><ul><li>Récupérer les clés des chambres</li><li>Vérifier ce qu''il y a dans les chambres (draps, papier toilette...)</li><li>Faire un rapide état des lieux<br></li><li>Se procurer ce qu''il manque (papier toilette, serviette, savon, sac poubelle...)</li><li>Déposer ce qu''il manque dans la chambre<br></li><li>Faire le lit (si la motivation y est)<br></li><li>Déposer les clés au local</li></ul><p></p>', 'Papier toilette, serviettes, savons, sacs poubelle ?\r\nLes clés des chambres du Troll', 0, 'Résidences INSA', 3, 'non (raf)'),
(511, 223, 318, NULL, 'Tireur Bar Bouffe (de l''ambiance)', '<span id="docs-internal-guid-98caa997-6049-abe4-bfa8-55a0b9071086"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"><br></span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecté au Bar Bouffe ! Tu vas rester coller à la tireuse du bar Bouffe et tirer de la bonne bière bien fraîche avec des odeurs de saucisses et de frites, t''es content ! (c''est la tireuse de l''ambiance) </span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-family: Arial; font-size: 15px; white-space: pre-wrap; line-height: 1.15;"><br></span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-family: Arial; font-size: 15px; white-space: pre-wrap; line-height: 1.15;">Tes missions (que tu acceptes) :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Te présenter aux orgas bouffe Léo et Caro,</span></p></li><li><span style="font-family: Arial; font-size: 15px; line-height: 1.15; white-space: pre-wrap;">Te faire former à la tireuse par Caro</span></li><li><span style="font-family: Arial; font-size: 15px; line-height: 1.15; white-space: pre-wrap;">Tirer des bières - Tirer des bières - Tirer des bières. Selon l''heure et les éventuels rushs, tu tireras en continu (petit coquin) ou pas ! </span><br></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;">Quand il y a un problème : trop de mousse / fut à changer / limonade à la pomme à la place de la bière, etc. --&gt; Tu appelles Mamie Caro ! (même si tu sais faire)</p></li></ul><div><font face="Arial"><span style="line-height: 19.166667938232422px; white-space: pre-wrap;"><br></span></font></div><div><font face="Arial"><span style="line-height: 19.166667938232422px; white-space: pre-wrap;">Surtout, ne quitte pas ton poste tant que la relève n''est pas arrivé (bah oui, la bière, c''est quand même la base aux 24). :) </span></font></div><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></p><div><br></div><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="margin-top: 0pt; margin-bottom: 0pt;"><span style="line-height: 1.15; font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Contacts :&nbsp;</span><span style="line-height: 1.15; font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Caro 06 79 12 17 05 </span><span style="vertical-align: baseline; white-space: pre-wrap; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);"><font color="#333333" face="Helvetica Neue, Helvetica, Arial, sans-serif">/ Léo </font></span><span style="background-color: rgb(255, 255, 255); color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;">07 77 89 97 97 /&nbsp;</span><span style="line-height: 1.15; font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bruce Louis 07 86 85 59 21 / Choppy </span><span style="line-height: 1.15; font-size: 13px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">&nbsp;</span><span style="line-height: 1.15; font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">06 67 12 02 16</span></p></span>', NULL, 0, 'Bar bouffe', 3, 'non'),
(512, 32, 420, NULL, 'Désinstallation caisses', '<p>- Retrouve Clara (06 31 41 42 82) devant les entrées du festival<br></p><p>- Ramène&nbsp; les 10 tables, les 20 chaises, 2 multiprises et 2 rallonges 10 m qui sont&nbsp; dans les modules des caisses au dépôt AIP<br></p><p><br></p><p><br></p>', 'clés des Algeco', 0, 'Devant l&#039;AIP', 3, 'non'),
(513, 13, 318, NULL, 'Tireur bar bouffe', '<span id="docs-internal-guid-b6a3566c-6054-1e78-920f-5ac58c305e40"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecté aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">En arrivant au Bar, présente toi aux Orgas bouffe Caro et Léo. Ils vont te briefer et t’assigner à un des postes suivants : Tireur - Serveur - Pivot.</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"><br></span></p><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Serveur :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu prends la commande des gens</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu encaisses l’argent et rends la monnaie</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Et finalement tu leur donnes à boiiiiire</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">S’ils payent par CB, appelle le caissier spécial CB</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu danses et mets l’ambiance</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Apprends bien les prix</span></p></li></ul><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Pivot :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu fais le lien entre les serveurs et les tireurs</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu disposes sur la tables les différentes bières et tu dis au tireur ce qu’il faut</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu danses et mets l’ambiance</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tireur :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu tires les bières en fonction de ce que le pivot te dit</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Si tu as de l’avance (champion !) prépare les bières les plus demandées en avance</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Ton rôle = moins de mousse possible !</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu danse et mets l’ambiance</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Diverses infos :</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Dans tous les cas être souriant, joyeux, drôle avec les festivaliers. Si quelqu’un est complètement ivre et veut une bière, tu vas voir les orgas bouffe, il est ton principal interlocuteur et doit savoir tout sur tout. Pour les sirops, on fait les radins, c’est 1cm et pas plus :p. Dernier point, c’est pas open bar, ton resp orga bar te le rappellera.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></span>', NULL, 0, 'Bar bouffe', -1, 'non'),
(514, 3, 311, NULL, 'Préparer les chambres INSA', '<p></p><i>Le but de cette tâche est de préparer les chambres INSA pour qu''elles soient prêtes à accueillir prestataires et artistes.</i><br><ul><li>Aller au local des 24H (Rdc Bâtiment D) [jusqu''à jeudi 22 mai 15h]<br>OU<br>Aller au QG Orga (Agora) [à partir de jeudi 22 mai 15h]<br></li><li>Demander la fiche de répartition des chambres aux Orgas Humains (Hugo : 06 01 33 50 87 / Dina : 06 21 39 17 69)<br></li><li>Demander les clés des chambres à préparer aux Orgas Humains</li><li>Prendre les rouleaux de papier toilette</li><li>Prendre les serviettes de bain</li><li>Prendre les savons</li><li>Prendre les sacs poubelle</li><li>Faire deux équipes si l''effectif le permet : 1 Confiance et des Softs (et un caddie pour transporter le matériel)<br></li><li>Se rendre aux résidences où l''on a des chambres</li><li>Déposer dans toutes les chambres du papier toilette et un sac poubelle</li><li>Lorsque c''est indiqué sur la fiche de répartition :</li><ul><li>déposer serviettes et savons</li><li>faire les lits (les draps seront déjà dans les chambres)</li></ul><li>S''il est indiqué qu''il ne doit pas y avoir de literie dans la chambre, récupérer les draps qui sont sur les lits<br></li><li>S''assurer qu''il ne manque rien ou qu''il n''y a rien en trop dans les chambres</li><li>Fermer les chambres</li><li>Retourner au local des 24H // au QG Orga (en fonction des horaires donnés ci-dessus)<br></li><li>Restituer la fiche de répartition et toutes les clés aux Orgas Humains</li><li>Donner les draps en trop aux Orgas Humains pour qu''ils les gardent dans un endroit propre</li><li>Remettre les caddies où ils ont été pris<br></li></ul><p></p>', 'Fiche de répartition des chambres\r\nPapier toilette, serviettes, savons et sacs poubelle', 0, 'Résidences INSA', 3, 'non'),
(515, 209, 457, NULL, 'Rangement du Grillon', '<p></p><div><br></div><ul><li>Va chercher un kit de nettoyage (seau, savon, balais, sac plastique, serpillère) au QG orga<br></li><li>Nettoie le grillon</li><li>Ramène les 17 grilles d''expositions au dépôt humas<br></li><li>Remets TOUT le matos que tu as pris au QG orga</li></ul><div>Si tu as fini avant 20 heures, appelle Simon (06 31 52 99 56) pour qu''il vienne fermer le grillon<br></div><p></p>', '17 grilles d''expositions', 0, 'Grillon', 3, 'non'),
(516, 32, 420, NULL, 'Briefing caisses vendredi', '<p>Viens assister au briefing caisses</p>', NULL, 0, 'Devant l&amp;#039;AIP', -1, 'non'),
(517, 32, 420, NULL, 'Caissier entrées', '<p>- Rends-toi aux caisses au niveau de l''entrée du festival<br><br>-Le principe est simple : tu as une caisse, 1 TPE (terminal de paiement électronique), un tas de billets pré imprimés 1 nuit (15 euros) ou 2 nuits (25 euros), donc seulement deux tarifs différents.<br><br>-Encaisse les gens, donne leur un billet.<br><br>-Si tu as un problème avec un festivalier, renvoie le au point info (caisse n°9)</p><p>-Si tu as un très gros problème , appelle à l''aide Clara (06 31 41 42 82) ou aussi par talkie (il y en a un par module Algeco)<br><br>- Attends bien que la relève soit arrivée pour partir de ton poste (c''est important les caisses) et la briefer rapidement (comment ça se passe + fonctionnement TPE)<br></p><p>--&gt; NE LAISSE JAMAIS LES CAISSES SANS SURVEILLANCE!!! (même si tu as le dernier créneau de la soirée et que tu veux t''en aller ...)</p><p>-Si tu as le dernier créneau, aide à ranger les tentes dans le dépôt AIP<br><br>-Tu peux aller maintenant kiffer les concerts ! (ou faire un créneau poubelle)</p>', '1 caisse, 1 TPE, un tas de billets pré imprimés', 0, 'Devant l&amp;amp;#039;AIP', 3, 'non'),
(518, 13, 458, NULL, 'Barman Bar BDE', '<span id="docs-internal-guid-b6a3566c-6057-dfcb-ba4d-c42f2a92c0fa"><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecté aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">En arrivant au Bar, présente toi au Resp Orga Bar (crie “Resp Orga Bar” si tu le trouve pas). Il va te briefer et t’assigner à un des postes suivants : Tireur - Serveur - Pivot. Tu pourras changer après une heure si tu le souhaite ;).</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Serveur :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu prends la commande des gens</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu encaisses l’argent et rends la monnaie</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Et finalement tu leur donnes à boiiiiire</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">S’ils payent par CB, appelle le caissier spécial CB</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu danses et mets l’ambiance</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Apprends bien les prix</span></p></li></ul><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Pivot :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu fais le lien entre les serveurs et les tireurs</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu disposes sur la tables les différentes bières et tu dis au tireur ce qu’il faut</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu danses et mets l’ambiance</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tireur :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu tires les bières en fonction de ce que le pivot te dit</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Si tu as de l’avance (champion !) prépare les bières les plus demandées en avance</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Ton rôle = moins de mousse possible !</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu danse et mets l’ambiance</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Diverses infos :</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Dans tous les cas être souriant, joyeux, drôle avec les festivaliers. Si quelqu’un est complètement ivre et veut une bière, tu vas voir les resp orga bar, il est ton principal interlocuteur et doit savoir tout sur tout. Pour les sirops, on fait les radins, c’est 1cm et pas plus :p. Dernier point, c’est pas open bar, ton resp orga bar te le rappellera.</span></p><div><span><br></span></div><div><span style="font-family: Arial; font-size: 15px; line-height: 17.25px; white-space: pre-wrap;">------------Si ton créneau couvre la fermeture tu devras assurer le nettoyage : pas de soucis, vous êtes beaucoup ça va aller vite --------------------------------------------- </span><span><br></span></div><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></p><div><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"><br></span></div></span>', NULL, 0, 'Devant le creux GCU', 3, 'non'),
(519, 32, 420, NULL, 'Caissier entrées samedi', '<p>- Rends-toi aux caisses au niveau de l''entrée du festival<br><br>-Le \r\nprincipe est simple : tu as une caisse, 1 TPE (terminal de paiement \r\nélectronique), un tas de billets pré imprimés 1 nuit (15 euros) ou 2 \r\nnuits (25 euros), donc seulement deux tarifs différents.<br><br>-Encaisse les gens, donne leur un billet.<br></p><p>-Si tu as un problème avec un festivalier, renvoie le à la caisse info (caisse n°9)</p><p>-Si tu as un très gros problème appelle à l''aide Clara (06 31 41 42 82) ou aussi par talkie (il y en a un par module Algeco)<br><br>- Attends bien que la relève soit arrivée pour partir de ton poste (c''est important les caisses), et la briefer rapidement (comment ça se passe + fonctionnement du TPE)</p><p>--&gt; NE LAISSE JAMAIS LES CAISSES SANS SURVEILLANCE!!! (même si tu as \r\nle dernier créneau de la soirée et que tu veux t''en aller ...)<br><br>-Tu peux aller maintenant kiffer les concerts ! (ou faire un créneau poubelle)</p>', '1 caisse, 1 TPE, un tas de billets pré-imprimés', 0, 'Devant l&amp;amp;amp;#039;AIP', -1, 'non'),
(520, 209, 457, NULL, 'Fermer le Grillon et la MDE', '<p></p><ul><li>Va au QG orga&nbsp;<br></li><li>Récupère les clés du grillon.</li><li>Ferme le grillon et la MdE une fois que le club BD a fini son rangement</li><li>Ramène les clés au QG orga<br><br><u>Important : C''est à toi de fermer la MdE le vendredi et le samedi soir !</u><br>Il faut que tu :</li><li>vérifie qu''il n''y a personne à la MdE</li><li>vérifie que l''orga qui ferme l''olivier soit sorti de la MdE et qu''il ait bien fermé la porte de l''olivier ainsi que les portes de l''olivier qui donne sur l’extérieur</li><li>vérifie que toutes les portes et fenêtre du grillon qui donnent sur l’extérieur soient bien verrouillées</li><li>que la porte automatique de la MdE soient sur la position <u>off </u>&nbsp;que les portes sur les cotés de la porte automatique soient verrouillées</li><li>Maintenant que tous les accès du RdC sont bien fermés tu peux monter à l''étage et sortir par le balcon de la BA</li></ul><p></p>', 'Clés du Grillon', 0, 'QG Orga', 3, 'non (raf)'),
(521, 13, 458, NULL, 'Caissier bar BDE', '<span id="docs-internal-guid-935c9397-605a-b658-e072-bc2eca4e0217"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecté aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Ta mission est de gérer la caisse du bar, voici le déroulement des taches :</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">En arrivant au Bar présente toi au Resp Orga Bar, c’est lui qui te briefera et te rappellera les consignes élémentaires.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Apprends aussi bien que tu peux les prix des différentes consos, ça va aller très vite et il ne faudra pas faire d’erreur de calcul. Une fiche sera à ta disposition sur ta table.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Les serveurs vont venir vers toi pour te donner l’argent et c’est à toi de leur rendre la monnaie.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Si ta caisse commence à être bondée, ou s’il commence à plus y avoir de pièce de 50ct, don’t panic, appelle le Resp Orga Bar pour qu’il contacte le ravito argent !</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; font-weight: bold; vertical-align: baseline; white-space: pre-wrap;">/!\\ La caisse ne doit jamais être laissée sans surveillance. Ne pars pas tant que la relève n’est pas arrivé, et n’arrive pas en retard à tes créneaux. Dans tous les cas, se référer au Resp Orga Bar s’il y a un problème /!\\</span></p><br><span style="font-size: 15px; font-family: Arial; font-weight: bold; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></p><div><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"><br></span></div></span>', NULL, 0, 'Devant le creux GCU', 3, 'non'),
(522, 32, 459, NULL, 'Contrôle des accès vendredi', '<p>-Rends-toi au niveau des contrôles des accès (à droite des caisses si on arrive de l''extérieur)</p><p>-Scanne les billets des participants <br></p><p>-S''il y a un problème (le code barre ne passe pas, il présente son smartphone, il n''a pas de billet..) renvoie la personne au niveau de la caisse <br></p>', NULL, 0, 'Devant l&#039;AIP', -1, 'non'),
(523, 13, 458, NULL, 'Caissier TPE Bar BDE', '<span id="docs-internal-guid-5b7a7288-605d-ef96-d073-99375188f584"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecté aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu es responsable du payement par carte bancaire des festivaliers.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tes missions :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Te présenter au resp orga bar à ton arrivée</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Récupérer ton matos, vas voir le resp Orga bar si tu as des doutes sur son utilisation (il est censé te former).</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Encaisser les commandes qui se font par carte bancaire.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Garder toujours le TPE avec toi, seuls les Resps ou Orga BarS ont le droit de le prendre à part toi !</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tenir le TPE pendant le payement (les gens partent avec sinon...fail…).</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Donner le premier ticket au client et donner au caissier le deuxième.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Prévenir le resp Bar s’il y a un problème.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Servir normalement si tu te pignoles ;)</span></p></li></ul><div><font face="Arial"><span style="font-size: 15px; line-height: 17.25px; white-space: pre-wrap;"><br></span></font></div><div><font face="Arial"><span style="font-size: 15px; line-height: 17.25px; white-space: pre-wrap;"><b>NE PARS PAS TANT QUE LA RELEVE N''EST PAS ARRIVEE!!!</b></span></font></div><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Note : Si tu as créneau en Journée tu tiens en plus la caisse ! Le resp orga te briefera ;)</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></span>', NULL, 0, 'Devant le creux GCU', 3, 'non'),
(524, 209, 457, NULL, 'Amener les grilles', '<p></p><ul><li>Va au QG Orga</li><li>Récupère les clés de la MDE et du Grillon</li><li>Ouvrir le grillon aux orgas du club BD pour qu''ils puissent s''installer.</li><li>Rend-toi au QG Orga et rejoins un orga des anims culturelles</li><li>Récupère 20 grilles d''exposition</li><li>Amène-les au club BD Manga au grillon</li><li>Ramène les clés au QG Orga !</li></ul><p></p>', '20 grilles d''exposition+ Clés de la MDE et du grillon', 0, 'Dépôt Humas', 3, 'non (raf)'),
(525, 13, 458, NULL, 'Rangement bar BDE', '<span id="docs-internal-guid-81d12108-6060-5cee-ad43-3d283474773f"><br><span style="font-size: 15px; font-family: Arial; font-weight: bold; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Un grand bravo de la part des Orgas Bars ! Choppy et Bruce Louis te félicite d’avoir tenu toute la soirée. Tu vas maintenant aider le Resp Bar à ranger le Bar pour qu’il soit niquel le lendemain</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Présente toi au resp bar</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">ensuite passe au qg orga récupérer la matériel nécessaire (éponge, seau, produit)</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">retrouve le Resp de bar qui va te dire ce qu''il faut faire</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">nettoie les bars et les tables</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">rassemble les déchets dans un sac poubelle et les mettre dans un coin le temps de les jeter dans la grande benne</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">aide le Resp bar dans le rangement</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">ramène le matos au qg une fois ta tache terminée</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, sans toi les bars seraient horribles le lendemain et le resp bar serait tout seul ! Plus vite le travail est fait plus vite tu peux partir et manger du pâté de volaille au QG.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span></span>', NULL, 0, 'Devant le creux GCU', -1, 'non'),
(526, 32, 459, NULL, 'Briefing contrôle des accès vendredi', '<p>-Rends-toi au niveau des entrées&nbsp;</p><p>-Cherche Clara (06 31 41 42 82)</p><p>-Ecoute attentivement le briefing sur l''utilisation du matériel de contrôle d''accès (douchettes pour scanner les codes barre des billets)<br></p>', NULL, 0, 'Devant l&amp;#039;AIP', -1, 'non');
INSERT INTO `Tache` (`id`, `responsable_id`, `groupetache_id`, `importid`, `nom`, `consignes`, `materielSupplementaire`, `permisNecessaire`, `lieu`, `statut`, `commentaireLog`) VALUES
(527, 13, 458, NULL, 'Resp bar BDE', '<span id="docs-internal-guid-98caa997-6062-75d5-34f1-a0e8cf5eaaaf"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecté aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as déjà assisté au briefing et à la formation donc tu dois être bien au courant de comment ça va se passer. Amène ta fiche avec toi pour avoir toutes les infos qu’il te faut.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu es le contact privilégié des Orgas Bars (les charismatiques Choppy et Bruce Louis), d’où ton talkie et tu dois travailler main dans la main avec le Resp Orga Bar pour la bonne gestion du bar.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tes missions :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Chercher un talkie en début de créneau </span><span style="white-space: pre-wrap;"> au QG orga</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Annoncer aux orgas bars Choppy et Bruce Louis au talkie que tu es là</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Approvisionner en gobelet le bar. Pense à en prendre avant l’ouverture pour tenir un bon moment.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Approvisionner en soft, et veiller à ce que les frigos soit bien comme il faut (Facing de Red Bull notamment).</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Appeler le ravito arrrrrgent si les caisses sont vides (plus de pièces de 50ct par exemple) ou pleines à craquer. Le resp orga bar te préviendra si c’est le cas.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Gérer la sécurité des bars (personne passe derrière les bars) !</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Approvisionner en bière. Quand un fût est vide, change le avec un en stock, annonce au talkie que tu as besoin d’un fût, écoute la réponse des Orgas Bars, et rends toi au creux GCU. C’est toi qui percutes les fûts et les changes. Percute le premier fût avant l’ouverture du bar pour être tranquille à l’ouverture. </span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Superviser le bar en général, si tu te pignoles, aide à servir ou tirer.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Ranger après la fermeture </span><span style="white-space: pre-wrap;"> (le dimanche il faudra ramener les tables et les chaises de ton bars au dépôt AIP).</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Contacts : Bruce Louis 07 86 85 59 21 / Choppy </span><span style="font-size: 13px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">&nbsp;</span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">06 67 12 02 16</span></span>', NULL, 0, 'Devant le creux GCU', 3, 'non'),
(528, 13, 458, NULL, 'Resp Orga Bar BDE', '<SPAN id=docs-internal-guid-46e2d6a5-6064-2133-beef-d110e7dc4ce8>\r\n<P style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir=ltr><SPAN style="FONT-FAMILY: Arial; WHITE-SPACE: pre-wrap; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline">Bonjour et bienvenu(e) aux Bars !!!</SPAN></P>\r\n<P style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir=ltr><SPAN style="FONT-FAMILY: Arial; WHITE-SPACE: pre-wrap; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline">Tu as le privilège d’être affecté aux Bars ! Motive toi, le succès du bar dépend de toi ! </SPAN></P><BR><SPAN style="FONT-FAMILY: Arial; WHITE-SPACE: pre-wrap; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline"></SPAN>\r\n<P style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir=ltr><SPAN style="FONT-FAMILY: Arial; WHITE-SPACE: pre-wrap; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline">Tu as déjà assisté au briefing et à la formation donc tu dois être bien au courant de comment ça va se passer. Amène ta fiche avec toi pour avoir toutes les infos qu’il te faut.</SPAN></P><BR><SPAN style="FONT-FAMILY: Arial; WHITE-SPACE: pre-wrap; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline"></SPAN>\r\n<P style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir=ltr><SPAN style="FONT-FAMILY: Arial; WHITE-SPACE: pre-wrap; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline">Tu es l’interlocuteur privilégié des softs, soit souriant et gentil, apprends leur nom si possible. Ta mission est qu’ils fassent bien leur boulot.</SPAN></P><BR><SPAN style="FONT-FAMILY: Arial; WHITE-SPACE: pre-wrap; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline"></SPAN>\r\n<P style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir=ltr><SPAN style="FONT-FAMILY: Arial; WHITE-SPACE: pre-wrap; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline">Tes missions :</SPAN></P>\r\n<UL style="MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt">\r\n<LI style="LIST-STYLE-TYPE: disc; FONT-FAMILY: Arial; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline" dir=ltr>\r\n<P style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir=ltr><SPAN style="WHITE-SPACE: pre-wrap; VERTICAL-ALIGN: baseline">Te présenter au resp Bar à ton arrivée pour qu’il l’annonce au talkie (rappelle le lui s’il oublie)</SPAN></P></LI>\r\n<LI style="LIST-STYLE-TYPE: disc; FONT-FAMILY: Arial; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline" dir=ltr>\r\n<P style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir=ltr><SPAN style="WHITE-SPACE: pre-wrap; VERTICAL-ALIGN: baseline">Affecter les softs aux différentes taches : Pivot, tireur et serveur. Vérifie qu’il font bien les choses, et fait tourner s’il faut.</SPAN></P></LI>\r\n<LI style="LIST-STYLE-TYPE: disc; FONT-FAMILY: Arial; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline" dir=ltr>\r\n<P style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir=ltr><SPAN style="WHITE-SPACE: pre-wrap; VERTICAL-ALIGN: baseline">Briefer les softs pour qu’il tienne bien leur rôle. Et rappelle leur que c’est pas open bière (une de temps en temps ok mais pas moult). </SPAN></P></LI>\r\n<LI style="LIST-STYLE-TYPE: disc; FONT-FAMILY: Arial; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline" dir=ltr>\r\n<P style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir=ltr><SPAN style="WHITE-SPACE: pre-wrap; VERTICAL-ALIGN: baseline">Rappeler aux softs qu’il faut bien apprendre le prix des bières.</SPAN></P></LI>\r\n<LI style="LIST-STYLE-TYPE: disc; FONT-FAMILY: Arial; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline" dir=ltr>\r\n<P style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir=ltr><SPAN style="WHITE-SPACE: pre-wrap; VERTICAL-ALIGN: baseline">Surveiller les softs : orga bouré (= orga viré). Appelle l’Orga Bar s’il y a un rôti. Vérifie qu’il passe pas des consos gratuites.</SPAN></P></LI>\r\n<LI style="LIST-STYLE-TYPE: disc; FONT-FAMILY: Arial; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline" dir=ltr>\r\n<P style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir=ltr><SPAN style="WHITE-SPACE: pre-wrap; VERTICAL-ALIGN: baseline">Dire au resp Bar s’il manque des softs ou s’il y en a trop, il contactera l’humain.</SPAN></P></LI>\r\n<LI style="LIST-STYLE-TYPE: disc; FONT-FAMILY: Arial; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline" dir=ltr>\r\n<P style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir=ltr><SPAN style="WHITE-SPACE: pre-wrap; VERTICAL-ALIGN: baseline">Motiver tes troupes ! La réussite des bars passe par des orgas motivés et heureux de servir. S’il faut, nourris les ;)</SPAN></P></LI>\r\n<LI style="LIST-STYLE-TYPE: disc; FONT-FAMILY: Arial; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline" dir=ltr>\r\n<P style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir=ltr><SPAN style="WHITE-SPACE: pre-wrap; VERTICAL-ALIGN: baseline">Le sirop c’est 1cm et pas plus</SPAN></P></LI>\r\n<LI style="LIST-STYLE-TYPE: disc; FONT-FAMILY: Arial; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline" dir=ltr>\r\n<P style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir=ltr><SPAN style="WHITE-SPACE: pre-wrap; VERTICAL-ALIGN: baseline">Aider au rangement après la fermeture des bars.</SPAN></P></LI></UL><BR><SPAN style="FONT-FAMILY: Arial; WHITE-SPACE: pre-wrap; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline"></SPAN>\r\n<P style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir=ltr><SPAN style="FONT-FAMILY: Arial; WHITE-SPACE: pre-wrap; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline">En cas de besoin, contacte les Orga Bars, Choppy ou Bruce Louis, avec le talkie du resp Bar ou par téléphone (à éviter).</SPAN></P><BR><SPAN style="FONT-FAMILY: Arial; WHITE-SPACE: pre-wrap; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline"></SPAN>\r\n<P style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir=ltr><SPAN style="FONT-FAMILY: Arial; WHITE-SPACE: pre-wrap; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</SPAN></P><BR><SPAN style="FONT-FAMILY: Arial; WHITE-SPACE: pre-wrap; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline"></SPAN><SPAN style="FONT-FAMILY: Arial; WHITE-SPACE: pre-wrap; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline">Contact : Bruce Louis 07 86 85 59 21 / Choppy </SPAN><SPAN style="FONT-FAMILY: Arial; WHITE-SPACE: pre-wrap; FONT-SIZE: 13px; VERTICAL-ALIGN: baseline">&nbsp;</SPAN><SPAN style="FONT-FAMILY: Arial; WHITE-SPACE: pre-wrap; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline">06 67 12 02 16</SPAN></SPAN>', NULL, 0, 'Devant le creux GCU', 3, 'non'),
(529, 209, 457, NULL, 'Coucou les amis', '<p></p><ul><li>Prends ton appareil photo</li><li>Rends-toi au Grillon</li><li>Fais un petit coucou au gens du club BD manga et demande leur s''ils ne manquent de rien.</li><li>Tape la discute et mate vite fait les artistes (bluff sur le fait que tu t''intéresses à eux)</li><li>Prends quelques photos, et file ! :)</li></ul><p></p>', NULL, 0, 'Grillon', 3, 'non'),
(530, 209, 460, NULL, 'Accueillir Prisca', '<p></p>\r\n<div>Prisca &nbsp;:&nbsp;<b style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">0680965596</b></div><ul>\r\n<li>Attends l''appel de Prisca (vers 13h30)&nbsp;</li>\r\n<li>Accueille-la et aide-la à porter ses cerceaux.</li>\r\n<li>Indique lui l''emplacement du stand</li>\r\n<li>Montre lui le podium des humas</li>\r\n<li>Lui faire un bisou sur la joue et de lui souhaiter courage</li></ul>\r\n<p></p>', NULL, 0, 'Pelouse des Humas', 3, 'raf'),
(531, 209, 460, NULL, 'Installer l''animation', '<p></p>\r\n<ul>\r\n<li>Va au QG orga et repère sur le plan des anims sur la pelouse des humas l''emplacement de l''animation Hula-hoop<br></li>\r\n<li>Rends toi au dépôt des Humas</li>\r\n<li>Récupère le kit Hula-Hoop ( 1 table 2 places et 1 chaise)</li>\r\n<li>Emmène le sur le lieu de l''animation Hula-hoop (que tu as bien sûr mémorisé)<br></li>\r\n<li>Installe la chaise derrière la table</li></ul>\r\n<p></p>', NULL, 0, 'QG Orga', 3, 'non'),
(532, 13, 461, NULL, 'Formation tireuses et bonnes pratiques', '<p>Hey,&nbsp;</p><div>lors de cette session tu va apprendre comment bien tirer une bière, percuter un fut et comment faire pour que les tireuses ne soient pas (trop vite) cassées.</div><div><br></div><div>Tu auras même le droit de boire la bière que tu auras tiré ;)</div>', NULL, 0, 'Bars', -1, 'non'),
(533, 209, 460, NULL, 'Ranger le stand', '<p></p>\r\n<ul>\r\n<li>Retrouve Prisca et sa pote sur le stand Hula-Hoop sur la pelouse des Humas (pas loin du rhino)</li>\r\n<li>Attends la fin de l''anim'' (18h)</li>\r\n<li>Emmène tout le matos de l''anim'' (1 table et 1 chaise) au dépôt humas.</li><li>Aide Prisca à ramener les cerceaux dans sa voiture.</li></ul>\r\n<p></p>', 'Kit Hula-hoop (1 table, 1 chaises)', 0, 'Pelouse des Humas', 3, 'raf'),
(534, 25, 402, NULL, 'Récupérer matos TdR', '<p>Aller à Terre de Running Limonest pour récupérer leur foutre.</p><div><i>1682, Route nationale 6</i></div><div><i>69760 Limonest</i></div><div>Rentre la merde aux lyonnais qui savent pas conduire.</div><div>Ramène le foutre au local.</div><p></p>', 'GPS/GMaps sur ton téléphone.', 1, 'Local', 0, 'non'),
(535, 209, 460, NULL, 'L''heure du goûter', '<p></p><ul><li>Récupère les clés du QG culture (voir avec Aurélie),<br></li><li>Récupère la bouffe et les boissons prévues pour le hula hoop (1 quatre quart, 2 bouteilles d''eau+10 gobelets et 1 paquet de gâteaux)</li><li>Amène tout ça à prisca au stand hula-hoop sur la pelouse des humas</li></ul><p></p>', NULL, 0, 'Pelouse des Humas', -1, 'non'),
(536, 209, 460, NULL, 'Coucou toi', '<p></p>\r\n<ul>\r\n<li>Rends-toi sur le stand hula-hoop près de la rivière en cailloux des humas.</li>\r\n<li>Fait leur un petit coucou, demande leur s''ils n''ont besoin de rien.</li>\r\n<li>Tu es libre :)</li></ul><div>N''oublie bien sûr pas de mater le joli déhanché de ces artistes :)</div><div>&nbsp;</div>\r\n<p></p>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(537, 209, 462, NULL, 'Installer le jeu de dames', '<p></p><ul><li>Mémorise l''endroit du jeu de dames sur le plan des anims qui se trouve au QG orga.</li><li>Se rendre au dépôt Humas.</li></ul><ul><li>Récupérer le kit "Jeu de Dames" : 40 pions en plastique (20 noirs 20 blancs), une grande moquette décorée en damier et une fiche de règles sous pochette plastique, ainsi qu''un parasol.</li></ul><ul><li>Amener tout ce qu''il faut à l''endroit prévu ( plan au QG orga). Installer la moquette au sol (à plat), planter le parasol, mettre les pions en place (comme indiqué sur la fiche de règles). S''il y a du vent, caler les coins du damier avec des pierres. NE PAS LAISSER LE MATERIEL SANS SURVEILLANCE ! Attends les orgas du premier créneau de 10h.</li></ul><ul><li>C''est bon, tu peux aller te pignoler au QG !</li></ul><p></p>', NULL, 0, 'QG Orga', 3, 'non'),
(538, 209, 462, NULL, 'Animer le Jeu', '<ul><li>Se rendre près du jeu de dames, vers la rivière de pierre des Humas, près du passage entre GMC et GI.</li></ul><ul><li>Relever l''orga précédent, récupérer la fiche de règles, vérifier que tout le matériel est là. (40 pions &nbsp;et 1 moquette damier)</li><li>Lire les règles pour les connaître un peu.</li></ul><ul><li>Accueillir les visiteurs et les encourager à jouer, jouer contre les gens s''ils sont seuls ou arbitrer la partie s''ils sont deux. Faire tourner quand il y a du monde qui attend.</li></ul><ul><li>IMPORTANT : Attendre la relève pour partir !&nbsp;<br></li></ul><p>Si elle n''arrive pas, appelle Simon ( 06 31 52 99 56)<br></p>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(539, 25, 402, NULL, 'Ramener matos TdR', '<p>Aller à Terre de Running Limonest pour rendre leur foutre.</p><div><i>1682, Route nationale 6</i></div><div><i>69760 Limonest</i></div><div><i><br></i></div><div>Rentre la merde aux lyonnais qui savent pas conduire.</div><div>Ramène ton gras au local.</div>', 'GPS/GMaps sur ton téléphone.', 1, 'Local', 0, 'non'),
(540, 209, 462, NULL, 'Ranger le Jeu', '<p></p><ul><li>Se rendre&nbsp;près du jeu de dames sur la pelouse des Humas (vers la rivière de pierre, à côté du passage entre GMC et GI).</li></ul><ul><li>Vérifier que tout le matériel est bien présent : la moquette peinte, les 40 pions, la fiche de règles et le parasol.</li></ul><ul><li>Replier le parasol et le tapis de jeu correctement.</li></ul><ul><li>Ramener tout le matériel au dépôt Humas le samedi <b><u>et au dépôt&nbsp;AIP le dimanche</u></b> (Bien ranger tout le matériel au même endroit !)</li></ul><div>IMPORTANT : NE JAMAIS LAISSER LE MATÉRIEL SANS SURVEILLANCE</div><p></p>', '1 Kit Jeu de dames (moquette peinte, 40 pions plastique, fiche de règles, parasol)', 0, 'Pelouse des Humas', 3, 'raf'),
(541, 209, 462, NULL, 'Contrôle de Soft', '<p></p><ul><li>Va voir le soft qui est sur le jeu de dames,</li><li>Regarde s''il y a encore tout le matos de présent</li><li>S''il te manque un truc, appelle Simon au 06 31 52 99 56</li><li>Sinon, fais un gros bibi au soft présent (clairement, c''est lui qui a la place la plus charismatique !) et laisse-le à son triste sort.</li></ul><p></p>', NULL, 0, 'Pelouse des Humas', -1, 'non'),
(542, 21, 463, NULL, 'Aller chercher le matos tchèque', '<p>Aller au local des 24</p><div>Demander la clef d''une voiture aux humains</div><div>Prendre la bannière 24H qui sera dans Exit</div><div>Aller à l''aéroport St Ex</div><div>Agiter la bannière et attendre le matos</div><div>Tu devrais le trouver assez facilement, il fait pas mal de bruit</div><div>Ramener le matos au local et le déposer dans la log, il servira pendant la manif !</div><div>Rendre les clefs aux humains de l''ambiance</div><p></p>', NULL, 1, 'Aéroport St Ex', -1, 'non'),
(543, 209, 464, NULL, 'Ouvrir l''amphi Lespinasse', '<p></p>\r\n<ul>\r\n<li>Récupérer les clés de l''amphi Lespinasse au QG orga.</li></ul>\r\n<ul>\r\n<li>Retrouver les personnes du Ciné club devant l''amphi.</li></ul>\r\n<ul>\r\n<li>Leur ouvrir l''amphi.</li></ul>\r\n<ul>\r\n<li>S''assurer qu''ils ont tout le matériel nécessaire à leur installation.</li></ul>\r\n<ul>\r\n<li>Ramener les clés de l''amphi au QG orga.</li></ul>\r\n<div><br></div>\r\n<div>personne du cinéclub à contacter en cas de soucis :</div>\r\n<div>\r\n<div style="BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: arial, sans-serif; COLOR: rgb(34,34,34); FONT-SIZE: 13px">\r\n<div>Cédric DANIEL<br></div>Trésorier Ciné-Club<br></div><span style="BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: arial, sans-serif; COLOR: rgb(34,34,34); FONT-SIZE: 13px">Tel: 06.66.60.79.44</span></div>\r\n<p></p>', 'Clés de l''amphi Lespinasse', 0, 'Amphi Lespinasse', 3, 'raf'),
(544, 209, 464, NULL, 'Fermer l''amphi Lespinasse', '<p>Récupérer les clés de l''amphi Lespinasse &amp; kit ménage au QG orga.</p>\r\n<p>Retrouver les personnes du Ciné club dans l''amphi.</p>S''assurer qu''ils ont bien repris tout leur matériel.<br><br>Vérifier que l''amphi n''est pas sale et nettoyer si besoin<br>Fermer l''amphi.<div>(<u>Important</u>&nbsp;il faut vérifier que toutes les protes et fenêtres soient bien verrouillées !)</div><div><br>\r\n<p>Ramener les clés de l''amphi au QG orga.</p></div>', 'Clés de l''amphi Lespinasse', 0, 'Amphi Lespinasse', 3, 'non'),
(545, 209, 464, NULL, 'Y sont pas morts ?', '<p></p>\r\n<ul>\r\n<li>Se rendre &nbsp;à l''amphi Lespinasse.<br></li>\r\n<li>S''assurer que tout va bien, qu''ils n''ont besoin de rien.&nbsp;</li>\r\n<li>Parler avec le responsable cinéclub présent à ce moment là. (ne pas trop faire de bruit un film est projeté!)<br></li>\r\n<li>Sortir de l''amphi.<br></li></ul>\r\n<p></p>', NULL, 0, 'Amphi Lespinasse', 3, 'non'),
(546, 22, 399, NULL, 'Pose Signa Soirée Vendredi', '<p></p><div><span class="Apple-tab-span" style="white-space:pre">	</span>La festival commence bientôt, et ton rôle est de poser toute la signalétique spécifique aux concerts du vendredi soir.</div><ul><li>Se rendre au QG orga, et y retrouver le resp signalétique (SGM: 06 48 25 51 18).</li><li>Demander les clés du 11m3.</li><li>Récupère masse clous/colsons/scotch.</li><li>Ecouter les instructions et prendre descriptif "Signalétique Concerts Vendredi Soir" qui montre où poser quoi.</li><li>Prendre la signa concert spécifiée sur le descriptif, notamment celle des caisses et de l''entrée qui devrait prendre pas mal de temps. Tout mettre dans le 11m3.</li><li>La mettre soigneusement en place avec ton resp adoré. Il n''est pas méchant, et aura certainement à manger sur lui si jamais tu as faim.</li><li>Revenir au QG, déposer le descriptif et le reste du matos emprunté.</li><li>Rendre les clés du 11m3.</li></ul><div><u>Remarque pignole:</u>&nbsp;Il est déjà 19h30, cours chez toi, mange un coup et prends l''apéro ! Les concerts débutent dans 30 minutes !!!</div><div><br></div><div><i>Qu''est ce que c''est que ce style de bouffer des petits machins tout secs et trois gallons de flottes par jour ? (...) Si la jeunesse se met à croire à ses conneries, on se dirige tout droit vers une génération de dépressif. Le gras, c''est la vie"</i></div><p></p>', NULL, 0, 'QG Orga', 3, 'non'),
(547, 206, 341, NULL, 'Installation Bar Akafrites', '<p>Cher orga, tu vas maintenant aider à<b> installer le stand</b> le pluuuuuuuuuus charismatique de tout le festival : le stand restauration, plus communément appelé "<b>Bar Bouffe</b>"! (ou "Bar Akafrites")</p><p>Prends des gants et des bonnes chaussures, ça peut servir, on va trimballer du lourd !&nbsp;</p><div><div>Rends toi <b>devant le Bâtiment GCU</b> et retrouve Mamie Caro (06 79 12 17 05) ou Doc-X (07 77 89 97 97)</div><div>Ils vont t''indiquer quel est le matos à installer et tout ce qu''il faut mettre en place.&nbsp;</div><div>Pour te donner un ordre d''idée, il va falloir :monter une grande tente, installer de la moquette, installer les friteuses, des tables, des chaises, des frigos, des congélos, du matos de cuisine, coller des affiches et j''en passe !</div></div><p></p>', NULL, 0, 'Bar bouffe', 3, 'non'),
(548, 22, 399, NULL, 'Vérification Signa Concerts Vendredi Soir', '<p><span class="Apple-tab-span" style="white-space:pre">	</span>La signa concert vient d''être mise ! Normalement, tout doit être en place... mais rien n''est moins sûr. Fait le tour de la ZC pour vérifier que tout est à poste!<br></p><ul><li>Vérifie qu''il te reste masse foutre de bricolage (colsons, clous, scotch, pince, grue....)</li><li>Vérifie que tout est bien en place dans les zones concerts, surtout les trucs importants genre les banderoles Scène Nord et les affiches avec la prog à l''entrée.<br>Pour cela, suit le descriptif zone concert (qui se trouvera soit au QG, soit sur toi étant donné que tu as posé la signa concerts en fin d''après midi). Bricole et fais les modifications nécessaires.</li></ul><div><u>Remarque Pignole:</u>&nbsp;Si jamais tu croise un orga déprimée en route, paye ton saucisson, et rappelle lui que:</div><div><span class="Apple-tab-span" style="white-space:pre">		</span><i>"La joie de vivre et le jambon, il n''y a pas trente-six recettes du bonheur !"</i></div><div><br></div><div><strike>Si il est basané, qu''il aille se faire foutre.</strike>&nbsp;<b>Connard !</b></div><p></p>', NULL, 0, 'Tout partout', 3, 'non'),
(549, 12, 466, NULL, 'Etre casse couille avec les Fistages', '<p>Péter les couilles des gens touuuuuuus les jours pour qu''ils fassent leurs fiches tâches.</p>', NULL, 0, 'QG', 3, 'non'),
(550, 45, 307, NULL, 'La cabane au fond du jardin', '<p>Le chalet backline arrive !</p><div>Vas voir le gentil monsieur et place tout ça avec lui. Monte une petite zone de chantier autour de son bordel.</div><div>&nbsp;Il va monter le chalet tout seul comme un grand, il faut juste être pas trop loin pour répondre à ses questions si besoin et lui fournir eau et nourriture.</div><div><br></div><div><strike>C''est la première tâche de la 40ème </strike>&nbsp;<b>Tu brises le coeur de la com !!</b></div><p></p>', NULL, 0, 'Grande scène', 3, 'non'),
(551, 12, 466, NULL, 'Distribuer la bonne humeur !', '<p>Distribuer la bonne humeur</p>', NULL, 0, 'QG', 3, 'non'),
(552, 45, 308, NULL, 'Livraison Manitoutous', '<p><strike>Après la première tâche de la 40ème voici la seconde !</strike> &nbsp;&nbsp; <b>Tu brises toujours le coeur de la com !!</b></p><p>Toujours autant de charisme !</p><div><br></div><div>Les deux manitous de la 40ème arrivent et avec eux leur lot de charisme ! Va voir le monsieur qui les livre, prend les clés sauvagement et vas-t-en aux commandes de ces petits bolides pour aller les garer vers la backline en klaxonnant à fond avec le gyrophare et les feux à fond, les pales en l''air en gueulant "on est chez nous !"</div><p></p>', 'Big KassDedi à Alexis ! Kiss Love love coeur coeur sex drugs & rock''n roll ! Pisse pisse', 0, 'ZC', 3, 'non'),
(553, 28, 467, NULL, 'Marquage de la ZC', '<p></p><ul><li>Se retrouver au bocal<br></li><li>Prendre les bombes, la ficelle (casier barrières), les mettre et les plans de zones</li><li>Aller faire des dessins de bites partout sur le campus<br></li></ul><p></p>', '5 Bombes Fluo temporaires\r\nLes clés de la cave\r\nDe la ficelle spéciale', 0, 'Local des 24 heures', 3, 'non'),
(554, 45, 468, NULL, 'Formation manitous', '<p>Viens apprendre à conduire un manitou !</p><div>Ca c''est du charisme !</div><div><br></div><div>En plus tu as des formateurs d''exception...</div><p></p>', NULL, 2, 'ZC', 3, 'non'),
(555, 22, 399, NULL, 'Vérification Signa Permanente Soirée', '<p></p><div><span class="Apple-tab-span" style="white-space:pre">	</span>Moi du futur, je te salue&nbsp;! Bon, cette tâche n''est pas la plus palpitante. Tu vas te balader (pi-pi-pi-pignole !) et vérifier que tout va bien. Comme bien évidemment tout n''ira pas bien et que ça sera trop la merde, chaque problème identifié et réparé ce soir sera un problème en moins demain matin.</div><ul><li>Si tu as déjà ton foutre de bricolage (colsons, clous, scotch, grue...) et les descriptifs signa des toutes les zones, pas la peine de repasser au QG. Sinon, va récupérer le matériel susnommé.</li><li>La signa permanente a été mise jeudi après midi, du coup des trucs ont pu tomber, bouger, ou être voler... Tu dois checker que tout est là où il faut comme ça demain matin tu auras pas à courir partout si il manque quelque chose.</li><li>Vérifie que le festivalier peut s''y retrouver, et que les directions indiquées par tes panneaux sont <strike>plus ou moins</strike> claires.</li><li>Si quelque chose ne va pas, répare le à grand coup de... colsons ou de clous. Le principal, c''est que ça tienne.</li><li>Une fois que tu es sur à 100% que tout es bon, rapport auprès de l''orga signa (SGM: 06 48 25 51 18) si ce n''est pas toi. Sinon, pas besoin de te faire ton propre rapport.</li></ul><div><u>Remarque Pignole</u>: Si tu as fini, tu peux désormais aller voir les concerts et/ou boire une bière. Si la prog ne te plais pas, tu peux d''ors et déjà te plaindre au&nbsp;<span style="background-color: rgb(255, 255, 255); color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;">07 86 85 59 21.</span>&nbsp;Passe un coup au QG de l''ambiance et essaye de goûter un met préparé par les mamans.</div><div><br></div><div><i>"Mais il y a rien a développer ! C''est de la merde, c''est de la merde, c''est tout ! Moi on me sert ça dans une auberge, le tavernier, il s''prend une quiche dans sa tête"</i></div><div><br></div><p></p>', NULL, 0, 'Tout partout', 3, 'non'),
(556, 16, 387, NULL, 'Barrièrage Zone Sud', '<p>Rejoins le Poulpe, Cheval et Guerric devant la piscine.<br></p><p>Il faut leur filer un coup de main pour le barrièrage en suivant le marquage au sol.<br></p><p>On va se répartir en 2 équipe :</p><ul><li>Equipe Poulpe : Barrièrage de la "Zone Tampon", espace détente et Rue de la physique.</li><li>Equipe Cheval : Barrièrage de la Zone des caisses et voie du capitaine Pons.<br></li></ul>N''oublie pas ta bonne humeur et une paire de gants si tu en as. Et surtout : plus vite on avance et plus vite ce sera fini !<br><br><div><br></div><p></p>', 'Du charisme\r\nDe la bonne humeur', 0, 'ZC', 3, 'raf'),
(557, 16, 387, NULL, 'Tâche sans nom', 's t', NULL, 0, 'ZC', -1, 'non'),
(558, 16, 387, NULL, 'Canissage', '<p>Retrouve l''équipe de canissage sur la Zone Concert.<br><br>Il faut mettre en place les canisses sur toutes les barrières de chantier qui donne vers l''extérieur de la zone.<br><br>Pour cela il faut aller chercher les rouleaux de canisses, les mettre en place pendant que quelqu''un d''autre les attache au fil de fer.<br><br>On va se répartir en deux équipe :<br></p><p>Equipe Poulpe : Zone nord</p><p>Equipe Cheval : Zone Sud<br><br>Les premiers qui finissent ont gagné !<br></p><p><br></p><p><br></p><p>ATTENTION :<br>Met des gants pour manipuler les canisses.<br></p>', NULL, 0, 'ZC', 3, 'non'),
(559, 16, 387, NULL, 'Modifier le barrièrage des entrées', 'Rendez vous devant les caisses à 10h00.<br><br>Modifier le barrièrage. Prendre des photos<br><p>Enclencher toutes les vaubans dans les files. Laisser les héras prévues avec STAFF non verrouillées.</p><p>(@Paul : Se concerter en amont avec Laurent, Romaric et Clara pour débriefer rapidement sur les entrées. Se mettre d''accord sur la manière de modifier les caisses pour gagner en efficacité.)</p>', 'Du charisme\r\nDes bras\r\n1 appareil photo', 0, 'Caisses', 3, 'non'),
(560, 16, 469, NULL, 'Décanissage Zone Nord', '<p>Retrouver le Poulpe sur le rond point au Nord de la piscine</p><ul><li>Enlever toutes les canisses des Héras au Nord Est de la zone jusqu''aux chiottes.</li><li>Bien enlever les fils de fer des canisses.</li><li>Ranger les canisses dans un endroit safe</li></ul><br>ATTENTION :<br>Met des gants pour manipuler les canisses.<p><br></p>', NULL, 0, 'Rond-point nord de la piscine', 3, 'non'),
(561, 16, 469, NULL, 'Barrièrage Provisoire', '<p>Retrouver le Poulpe sur le rond point au Nord de la piscine</p><ul><li>Enlever toutes les Héras au Nord Est de la zone</li><li>Refaire\r\n un barrièrage le long (Ouest) de la rue de la piscine pour créer une \r\nzone où les orgas pourront tomber la petite scène et les bars \r\ntranquillement.<br></li><li>Laisser un barrièrage autours des chiottes.</li></ul><p>PS: Plus c''est rapide moins c''est long ! (qui rentre en contradiction avec "Plus c''est long plus c''est bon" mais on s''en fout)<br></p><p><br></p>', NULL, 0, 'ZC', 3, 'non'),
(562, 28, 351, NULL, 'Au revoir le BE', '<p></p><ul><li>Aller voir le BE </li><li>Lui demander si tout s''est bien passé</li><li>Le remercier</li><li>A demain/L''année prochaine</li></ul><p></p>', NULL, 0, 'Pelouse Rotonde', 3, 'non'),
(563, 16, 389, NULL, 'Surveillance de la zone caisses', '<p>ROMARIC ET LAURENT :</p>\r\n<p>A 20h00 :</p>\r\n<p>Attendre le feu vert du QG pour ouvrir les entrées et les caisses<br></p>\r\n<p>S''occuper de la sécurité des caisses :</p>\r\n<p></p>\r\n<ul>\r\n<li>vérifier que les orgas / les chap''s sont bien en place</li>\r\n<li>vérifier que les AS guident correctement les gens</li>\r\n<li>réorganiser la gestion des points de contrôle si besoin</li>\r\n<li>surveiller l''affluence aux entrées. Si ça devient la merde, demander aux AS d''arrêter de faire entrer les gens quelques minutes.</li>\r\n<li>faire remonter des infos sur la situation au QG sécu</li>\r\n<li>faire évoluer le barrièrage selon les besoins</li></ul>\r\n<div><br></div>\r\n<div>A 2h00 :</div>\r\n<div>\r\n<ul>\r\n<li>fermer les entrées</li>\r\n<li>finir de faire passer les gens aux points de contrôle</li></ul></div>\r\n<p></p>', NULL, 0, 'QG Sécu', 3, 'non'),
(564, 16, 387, NULL, 'Vérouiller la Zone Concert', '<p>Se retrouver devant la Grande Scène.<br><br>Suivre les indications du Poulpe. Faire 2 équipes de 2.<br></p><p>Dès 18h15, commencer le vérouillage de la Zone Concert.<br><br>Dès 18h30, fermer les IS avec des colsons.<br><br>Demander aux gens présents de sortir par la sortie.<br></p>', 'Des colliers de héras\r\nDu charisme\r\nDes bras\r\nune clef de 19\r\ndes gants\r\nDeux plans de la ZC', 0, 'ZC', 3, 'non'),
(565, 16, 387, NULL, 'Vérifier l’étanchéité de la Zone', '<p>Se retrouver devant la Grande Scène<br><br>Faire le tour de la ZC<br><br>Vérifier que la zone est bien étanche. Que tout le barrièrage est en place<br></p><p>Vérifier qu''il n''y a pas de matos qui traine<br><br>Vérifier que les jambes de forces sont en place, que les héras sont attachées.<br><br>Vérifier l''installation des bars<br><br>Vérifier la configuration des caisses. Et que tout le monde est prêt.<br><br>En profiter pour péter un coup avant de monter au QG sécu (de l''ambiance)</p>', 'Clef de 19', 0, 'ZC', 3, 'non'),
(566, 22, 399, NULL, 'Pose Signa Journée Samedi', '<p>Boooonsoir ! Il est 6h00 du matin, ou du soir si tu n''as pas dormis.&nbsp;<br></p><ul><li>Rendez vous avec le resp signa (SGM: 06 48 25 51 18) au QG Orga.</li><li>Demander à l''humain les clés du 11m3, et récupérer le descriptif de la signa journée du samedi.</li><li>Prends masse colsons/scotch/clous/..., et ton 11m3</li><li>Mets dans le coffre du 11m3 toute la signa qu''il faut mettre (renseignée dans le descriptif).</li><li>N''oublies pas les blocs de bétons archi lourd pour faire tenir les plan. Ça te rappellera tes tâches de barrierage.</li><li>Enfourche ton 11m3 et roule jusqu''aux différents endroits où tu dois mettre la signa</li><li>Évite d''écraser les orgas et les SDF. En cas de collision, ne surtout pas prévenir le PC sécu, ramasser le corps et le mettre dans le coffre du 11m3. Annuler toutes les tâches suivantes et essayer de faire disparaître les corps.</li><li>Une fois que toute la signa est installée, retourne au QG.</li><li>Rends les clés à l''humain</li></ul><div><u>Remarque Pignole</u>: Il est tôt, il fait faim. Pour le petit déjeuner, boire un grand verre d''huile d''arachide.</div><div><i>"Ca y est, je vois trouble. C''est le manque de gras, ça me&nbsp;dessèche."</i></div><p></p>', NULL, 0, 'QG Orga', 3, 'non'),
(567, 16, 384, NULL, 'PS4 : Installation', '<ol><li>Rendez vous au QG Orga.<br></li><li>Retrouve ton co-orga.<br></li><li>Demande à l''Humain de vous donner des gilets jaunes et un talkie.<br></li><li>Rends toi au PS4 &nbsp;(A l''entrée principale INSA Einstein)&nbsp;</li><li>Prends les quelques barrières sur place de sorte à ne laisser passer que les voitures qui souhaitent sortir du campus.</li><li>Demande la sécu et préviens au talkie que tu es bien à poste<br></li></ol><p></p><p>Ta mission :&nbsp;Assurer la sécurité du festival et des courses en ne laissant passer aucun véhicule excepté&nbsp;:</p><p></p><ul><li>Les véhicules des secours (Pompiers, Police, etc..)<br></li><li>Les véhicules muni d''un pass sécu&nbsp;<u>pour le PS4<br>Le personnel TCL<br>Les secouristes de la Croix Rouge</u></li><li><u>Le personnel de STAFF sécurité (sur présentation de sa carte&nbsp;professionnelle)</u></li></ul>Un exemple de pass sécu et l''autorisation de fermeture du campus sont disponibles sur place.<br><div><br></div><div><div>En cas de problème / de doute demande le responsable sécurité au Talkie.&nbsp;N''hésite pas à prévenir de tout comportement anormaux. Si le talkie bip demande qu''on t''amène une batterie.<br>Si le talkie ne passe pas téléphone au 06.59.90.44.19 ou au 06.76.99.09.64<br>En cas d''urgence appelle directement le PC sécu : 04.72.43.70.70</div><div>Reste bien à l''écoute de ce qui est dit au talkie cela te concerne peut être.</div></div><div><br></div><div><b><u>IMPORTANT :</u></b></div><div><ul><li><b><u>NE TE MET PAS EN DANGER (si le mec est un peu aigri laisse le&nbsp;tâter&nbsp;de la vauban et écarte toi)</u></b><br></li><li><b><u>NE QUITTE PAS TON POSTE TANT QUE LES SUIVANTS NE SONT PAS ARRIVES</u></b><br></li></ul><div><b><u><br></u></b></div></div><div>En cadeau voici les paroles de Petit Poney &nbsp;:</div><p></p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">[Refrain]<br>Petit poney, petit poney, tu es tout gris et tout petit, petit poney, petit poney.<br>Petit poney, petit poney, tu es tout gris et tout petit, petit poney, petit poney.</p><div><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">Petit poney, petit poney, tu gambades dans les prés sans te soucier du temps qui passe, petit poney, petit poney<br>La nuit qui tombe sur le pré c''est aussi ça la vie qui passe, petit poney, petit poney.</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">[Refrain]</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">Tu gambades dans les prés sans te soucier du temps qui passe, petit poney, petit poney<br>La nuit qui tombe sur le pré c''est aussi ça la vie qui passe, petit poney, petit poney</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">[Refrain] (x3)</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">Tu gambades dans les prés sans te soucier du temps qui passe, petit poney, petit poney<br>La nuit qui tombe sur le pré c''est aussi ça la vie qui passe, petit poney, petit poney</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">[Refrain]</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">Tu gambades dans les prés sans te soucier du temps qui passe, petit poney, petit poney<br>Et puis un jour un loup arrive avec 3 feuilles de salades il va manger le quadrupède.</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">[Refrain] (x2)</p></div>', NULL, 0, 'Campus', 3, 'raf');
