(569, 16, 384, NULL, 'PS4 : Désinstallation', '<ol><li>Rends toi au PS4 &nbsp;(A l''entrée principale INSA Einstein)&nbsp;</li><li>Récupère le gilet jaune et le talkie de l''équipe précédente</li><li>Demande l''humain au talkie et préviens que tu es bien en poste.</li></ol><div>Ta mission : Assurer la sécurité du festival et des courses en ne laissant passer aucun véhicule excepté :<br></div><p></p><ul><li>Les véhicules des secours (Pompiers, Police, etc..)<br></li><li>Les véhicules munis d''un pass sécu&nbsp;<u>pour le PS4</u></li><li>Les secouristes de la Croix Rouge</li><li>Le personnel TCL</li><li>Le personnel de STAFF Sécurité (sur présentation de leur carte professionnelle)</li></ul><div>Un exemple de pass sécu et l''autorisation de fermeture du campus sont disponible sur place.<br></div><div><br></div>En cas de problème / de doute demande le responsable sécurité au Talkie.&nbsp;N''hésite pas à prévenir de tout comportement anormaux. Si le talkie bip demande qu''on t''amène une batterie.<br>Si le talkie ne passe pas téléphone au 06.59.90.44.19 ou au 06.76.99.09.64<div>En cas d''urgence appelle directement le PC sécu : 04.72.43.70.70</div><div>Reste bien à l''écoute de ce qui est dit au talkie cela te concerne peut être.</div><div><br></div><div>A la fin de ta tache Dimanche à minuit :</div><div><ol><li>Préviens au talkie que tu va partir</li><li>Ouvre le passage en poussant les barrières sur la coté de la route.&nbsp;<br></li><li>Rentre au QG.<br></li><li>Dépose ton talkie et les gilets<br></li></ol></div><div><br></div><div><b><u>IMPORTANT :</u></b></div><div><ul><li><b><u>NE TE MET PAS EN DANGER (si le mec est un peu aigri laisse le&nbsp;tâter&nbsp;de la vauban et écarte toi)</u></b></li></ul><div><b><u><br></u></b></div></div><div><div><u>En cadeau voici les paroles de Jaune by Alain34 &nbsp;:</u></div><p></p><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><br></p><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bo