(570, 22, 399, NULL, 'Pose Signa Croisement courses.', '<p></p><div><span class="Apple-tab-span" style="white-space:pre">	</span>Rendons service aux pédales, et essayons de préserver leur coureurs des vils festivaliers.&nbsp;</div><ul><li>Va au QG Orga, et demande les clés du 11m3 à l''humain. Récupère le descriptif Course si tu ne l''as pas sur toi.</li><li>Charge le 11m3 avec le materiel noté dans le descriptif.</li><li>Les festivaliers sont pas toujours très intelligents, surtout quand ils sont rôtis. Ta tâche consiste donc à baliser le parcours à des endroits stratégiques notés dans le descriptif courses, afin d''indiquer les points de passage adéquats.</li><li>Si tu as le temps, passe faire un coucou aux pédales. Fais comme si ils étaient tes amis.</li><li>Parcourt le parcours (c''est rigolo) courses à bord du 11m3 et mets les affiches là où il faut.</li><li>Une fois que tout est en place retourne au QG et rend les clé du 11m3.</li><li>&nbsp;Il est midi, prend un truc à manger(sandwich paté/chips/carottes rapées, c''est fameux).</li><li>Envole toi vers une autre tâche.</li></ul><div><u>Remarque Pignole:</u> Si tu passes au QG Pédale, organise un rush pignole avec ton co-pignole. Tu as 2 minutes. Pour gagner du temps, annonce ton arrivée au talky canal 3.</div><div><br></div><div><i>"La politique de l''autruche, c''est une politique qui court vite, et qui fait de gros œufs, c''est tout."</i></div><p></p>', NULL, 0, 'Tout partout', 3, 'non'),
(571, 16, 384, NULL, 'PS5 : Installation', '<ol><li>Rendez vous au QG Orga.<br></li><li>Retrouve ton co-orga.<br></li><li>Demande à l''Humain de vous donner des gilets jaunes et un talkie.<br></li><li>Rends toi au PS5 &nbsp;(Dans la rue du Double Mixte)&nbsp;</li><li>Prends les quelques barrières sur place de sorte à ne laisser passer que les voitures qui souhaitent sortir du campus.</li><li>Demande la sécu et préviens au talkie que tu es bien à poste<br></li></ol><p></p><p>Ta mission :&nbsp;Assurer la sécurité du festival et des courses en ne laissant passer aucun véhicule excepté&nbsp;:</p><p></p><ul><li>Les véhicules des secours (Pompiers, Police, etc..)<br></li><li>Les véhicules muni d''un pass sécu&nbsp;<u>pour le PS5</u></li></ul>Un exemple de pass sécu et l''autorisation de fermeture du campus sont disponible sur place.<br><div><br></div><div><div>En cas de problème / de doute demande le responsable sécurité au Talkie.&nbsp;N''hésite pas à prévenir de tout comportement anormaux. Si le talkie bip demande qu''on t''amène une batterie.<br>Si le talkie ne passe pas téléphone au 06.59.90.44.19 ou au 06.76.99.09.64<br>En cas d''urgence appel directement le PC sécu : 04.72.43.70.70</div><div>Reste bien à l''écoute de ce qui est dit au talkie cela te concerne peut être.</div></div><div><br></div><div><b><u>IMPORTANT :</u></b></div><div><ul><li><b><u>NE TE MET PAS EN DANGER (si le mec est un peu aigri laisse le&nbsp;tâter&nbsp;de la vauban et écarte toi)</u></b><br></li><li><b><u>NE QUITTE PAS TON POSTE TANT QUE LES SUIVANTS NE SONT PAS ARRIVES</u></b><br></li></ul><div><b><u><br></u></b></div></div><div>En cadeau voici les paroles de Petit Poney &nbsp;:</div><p></p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">[Refrain]<br>Petit poney, petit poney, tu es tout gris et tout petit, petit poney, petit poney.<br>Petit poney, petit poney, tu es tout gris et tout petit, petit poney, petit poney.</p><div><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">Petit poney, petit poney, tu gambades dans les prés sans te soucier du temps qui passe, petit poney, petit poney<br>La nuit qui tombe sur le pré c''est aussi ça la vie qui passe, petit poney, petit poney.</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">[Refrain]</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">Tu gambades dans les prés sans te soucier du temps qui passe, petit poney, petit poney<br>La nuit qui tombe sur le pré c''est aussi ça la vie qui passe, petit poney, petit poney</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">[Refrain] (x3)</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">Tu gambades dans les prés sans te soucier du temps qui passe, petit poney, petit poney<br>La nuit qui tombe sur le pré c''est aussi ça la vie qui passe, petit poney, petit poney</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">[Refrain]</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">Tu gambades dans les prés sans te soucier du temps qui passe, petit poney, petit poney<br>Et puis un jour un loup arrive avec 3 feuilles de salades il va manger le quadrupède.</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">[Refrain] (x2)</p></div>', NULL, 0, 'Campus', 3, 'raf'),
(572, 352, 445, NULL, 'Gestion Diverse BA Lundi 19', '<p>Au programme du lundi 19: Aller chercher les fours, le lave vaisselle et la plaque electrique en Ardèche, et ensuite faire des courses l''après-midi, et en soirée, préparer le repas du lendemain.</p><p><br></p><p><b>N''oublie pas de rendre les clés de Wallace avant d''aller faire les courses et d''aller faire l''état des lieux.</b></p>', NULL, 0, 'MdE', 3, 'non');
