; padding: 0px; list-style-type: none; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: normal; text-align: left; background-color: rgb(255, 255, 255);"><span style="color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: normal; text-align: left; background-color: rgb(255, 255, 255);">Quelle aventure !</span><br style="margin: 0px; padding: 0px; list-style-type: none; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: normal; text-align: left; background-color: rgb(255, 255, 255);"><span style="color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: normal; text-align: left; background-color: rgb(255, 255, 255);">Fruit de la passion</span><br style="margin: 0px; padding: 0px; list-style-type: none; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: normal; text-align: left; background-color: rgb(255, 255, 255);"><span style="color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: normal; text-align: left; background-color: rgb(255, 255, 255);">Ça me fait soupirer</span><br style="margin: 0px; padding: 0px; list-style-type: none; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: normal; text-align: left; background-color: rgb(255, 255, 255);"><span style="color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: normal; text-align: left; background-color: rgb(255, 255, 255);">Fruit de la passion...</span><br style="margin: 0px; padding: 0px; list-style-type: none; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: normal; text-align: left; background-color: rgb(255, 255, 255);"><span style="color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: normal; text-align: left; background-color: rgb(255, 255, 255);">{au Refrain}</span></p></div>', NULL, 0, 'Campus', 3, 'non (raf)'),
(575, 22, 399, NULL, 'Vérification Signa Croisement courses', '<p><span class="Apple-tab-span" style="white-space:pre">	</span>Tu vas vérifier que les croisements coureurs-festivaliers sont sûrs ! Un coureur qui rentre dans une fillette de 5 ans, c''est de la pédophilie, et ça nuit à l''image du festival.</p><ul><li>Si tu ne les a pas déjà, va au QG dans le bac signa ton foutre de bricolage (scotch, colsons, clous, mateau piqueur....), et ton descriptif courses. Prend aussi les pancartes "Attention courses" restantes.</li><li>Fais le tour du parcours, et vérifie qu''aucune pancarte n''est tombée et que rien n''a été volé. Rajoute de la signa si tu vois que c''est trop la merde à certains endroits.</li><li>Rentre au QG une fois que tu es sûr qu''il n''y aura pas d''accidents. Si il y en a quand même, la sécu gérera les nuisances engendrées, et tu nieras toute responsabilité.&nbsp;</li></ul><div><u>Point Pignole:</u>&nbsp;Si tu passes au QG pédales, troque la nourriture de ton sac contre quelques victuailles de leur ravitaillement. Une alimentation variée c''est important.</div><div><br></div><div><i>"Tout à l''heure, on a vu que le chapelet de saucisses n''était pas un objet redondant. Et pourtant, on a pu lui trouver une utilisation périmétrique en s''en servant comme un fouet."</i></div><p></p>', NULL, 0, 'QG Orga', 3, 'non'),
(576, 28, 387, NULL, 'Barrièrage ZC Arrière Scène', '<p>Se retrouver sur la pelouse des humas, au niveau de l''entrée du batiment GMC pour le barriérage du derrière de la scène (Backline-Scène).<br>Appelle Guerric si tu es perdu (0604476430)</p><p><br>L''objectif est de barriérer de l''entrée de GMC jusqu''au bâtiment Coulomb qu''on longera jusqu''au début des bars. Allez viens, ça va être bien!<br><br>N''oublie pas de ramener des gants, ça sera plus pratique pour porter de la barrière.</p>', 'Des gants, des muscles et de la bonne humeur\r\nLes plans de la ZC', 0, 'ZC', 3, 'non'),
(577, 23, 470, NULL, 'Accueil Socotec', '<p></p><ul><li>Appelle Hermione et demande lui si la structure scène est finie de monter et qu''elle tient debout (avec toutes les cales)</li><li>Appelle Nabil Malki au 06 24 93 09 19. Dis lui que la scène est terminée et qu''il peut ramener son boule</li><li>Lui rappeler de nous donner le PV avant de partir</li></ul><p></p>', NULL, 0, 'ZC', -1, 'non'),
(578, 19, 471, NULL, 'Barman Bar MDE', '<span id="docs-internal-guid-b6a3566c-61d9-4d7b-0d72-c90ead140df6"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecté aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">En arrivant au Bar, présente toi au Resp Orga Bar (crie “Resp Orga Bar” si tu le trouve pas). Il va te briefer et t’assigner à un des postes suivants : Tireur - Serveur - Pivot. Tu pourras changer après une heure si tu le souhaite ;).</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Serveur :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu prends la commande des gens</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu encaisses l’argent et rends la monnaie</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Et finalement tu leur donnes à boiiiiire</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">S’ils payent par CB, appelle le caissier spécial CB</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu danses et mets l’ambiance</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Apprends bien les prix</span></p></li></ul><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Pivot :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu fais le lien entre les serveurs et les tireurs</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu disposes sur la tables les différentes bières et tu dis au tireur ce qu’il faut</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu danses et mets l’ambiance</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tireur :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu tires les bières en fonction de ce que le pivot te dit</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Si tu as de l’avance (champion !) prépare les bières les plus demandées en avance</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Ton rôle = moins de mousse possible !</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu danse et mets l’ambiance</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Diverses infos :</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Dans tous les cas être souriant, joyeux, drôle avec les festivaliers. Si quelqu’un est complètement ivre et veut une bière, tu vas voir les resp orga bar, il est ton principal interlocuteur et doit savoir tout sur tout. Pour les sirops, on fait les radins, c’est 1cm et pas plus :p. Dernier point, c’est pas open bar, ton resp orga bar te le rappellera.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></span><p> </p>', NULL, 0, 'MDE', 3, 'non');
INSERT INTO `Tache` (`id`, `responsable_id`, `groupetache_id`, `importid`, `nom`, `consignes`, `materielSupplementaire`, `permisNecessaire`, `lieu`, `statut`, `commentaireLog`) VALUES
(579, 22, 399, NULL, 'Enlever Signa Journée Samedi', '<p></p><div>Fin de la première journée d''animations. Du coup, on débarrasse la zone de la signalétique qui ne sert plus</div><ul><li>Rendez vous au QG Orga (Rotonde). Retrouve le Resp Signa (SGM: 06 48 25 51 18).</li><li>Prendre 11m3 (demande les clés à l''humain).</li><li>Prendre du foutre de bricolage (pinces coupantes notamment) et le descriptif Signa Journée Samedi.</li><li>Aller sur la zone concert et mettre dans le coffre du 11m3 toute la signa y compris les héras pour les plans munis de ses plots en béton.</li><li>Essayer d''être malins: commencer par enlever la signa qui ne sert plus, et terminer par les plans.</li><li>Quand il reste plus de signa journée dans la zone concert ramènes tout au QG !</li><li>Ranger la signa dans le QG et rendre clés 11m3.</li><li>Si tu as finis en avance, commence à poser la signa concerts du soir !<br></li></ul><div><u>Remarque Pignole:</u>&nbsp;Il est 19h00 !!! Comme tu es au QG, profites-en pour déguster un succulent pâté de volaille sur son lit de pain, ainsi qu''une canette de Redbull millésime 2014.</div><div><br></div><div><i>"Des petits croutons tout vieux genre pour les lapins ? J''savais pas ce que c''était, dans le doute, j''les ai bouffé."</i><br></div><p></p>', NULL, 0, 'Tout partout', 3, 'non'),
(580, 23, 470, NULL, 'Départ Socotec', '<p></p><ul><li>Récupère le PV de la socotec quand Nabil Malki (06 24 93 09 19) a fini sa vérif (si il est déja parti c''est Hermione qui a le PV&nbsp;</li><li>Range le dans une pochette</li><li>Remercie le gars et note l''heure de départ</li><li>Scanne les doc et envoie les à PHJ (surtout ne l''appelle pas, sinon t''es foutu)&nbsp;</li></ul><p></p>', '1 pochette plastique de qualité supérieure', 0, 'ZC', 3, 'non (raf)'),
(581, 23, 470, NULL, 'Accueil STAFF', '<p></p><ul><li>Attends que JC te retrouve au QG sécu (06 98 16 40 50)&nbsp;</li><li>Montre lui la salle, donne lui les 3 clefs de chambre et le talkie</li><li>Allez faire un tour de la ZC</li></ul><p></p>', NULL, 0, 'ZC', 3, 'non'),
(582, 19, 471, NULL, 'Caissier TPE Bar MDE', '<span id="docs-internal-guid-5b7a7288-61db-6887-6805-f0522cea127d"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecté aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu es responsable du payement par carte bancaire des festivaliers.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tes missions :</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Te présenter au resp orga bar à ton arrivée</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Récupérer ton matos, vas voir le resp Orga bar si tu as des doutes sur son utilisation (il est censé te former).</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Encaisser les commandes qui se font par carte bancaire.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Garder toujours le TPE avec toi, seuls les Resps ou Orga BarS ont le droit de le prendre à part toi !</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tenir le TPE pendant le payement (les gens partent avec sinon...fail…).</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Donner le premier ticket au client et donner au caissier le deuxième.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Prévenir le resp Bar s’il y a un problème.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Servir normalement si tu te pignoles ;)</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Note :<b> Si tu as créneau en Journée</b> tu tiens en plus la caisse ! Le resp orga te briefera ;)</span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"><br></span></p><p dir="ltr" style="line-height:1.15;margin-top:0pt;margin-bottom:0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"><b>NE PARS PAS TANT QUE LA RELEVE N''EST PAS ARRIVEE!!!</b></span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></span>', NULL, 0, 'MDE', 3, 'non'),
(583, 19, 471, NULL, 'Resp Bar MDE', '<span id="docs-internal-guid-98caa997-61e9-7210-5364-631324e673d7">\r\n<p style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir="ltr"><span style="FONT-FAMILY: Arial; WHITE-SPACE: pre-wrap; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline">Bonjour et bienvenu(e) aux Bars !!!</span></p>\r\n<p style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir="ltr"><span style="FONT-FAMILY: Arial; WHITE-SPACE: pre-wrap; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline">Tu as le privilège d’être affecté aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="FONT-FAMILY: Arial; WHITE-SPACE: pre-wrap; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline"></span>\r\n<p style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir="ltr"><span style="FONT-FAMILY: Arial; WHITE-SPACE: pre-wrap; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline">Tu as déjà assisté au briefing et à la formation donc tu dois être bien au courant de comment ça va se passer. Amène ta fiche avec toi pour avoir toutes les infos qu’il te faut.</span></p>\r\n<div><span><br></span></div>\r\n<div><span>Récupères ton talkie en début de créneau (à l''orga précédent) ou au QG à 10h. Et ramène le à 18h.</span></div>\r\n<div><span>Ne pars pas tant que la relève n''est pas arrivée ;)</span></div><br><span style="FONT-FAMILY: Arial; WHITE-SPACE: pre-wrap; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline"></span>\r\n<p style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir="ltr"><span style="FONT-FAMILY: Arial; WHITE-SPACE: pre-wrap; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline">Tu es le contact privilégié des Orgas Bars (les charismatiques Choppy et Bruce Louis), d’où ton talkie.</span></p><br><span style="FONT-FAMILY: Arial; WHITE-SPACE: pre-wrap; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline"></span>\r\n<p style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir="ltr"><span style="FONT-FAMILY: Arial; WHITE-SPACE: pre-wrap; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline">Tes missions :</span></p>\r\n<ul style="MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt">\r\n<li style="LIST-STYLE-TYPE: disc; FONT-FAMILY: Arial; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline" dir="ltr">\r\n<p style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir="ltr"><span style="WHITE-SPACE: pre-wrap; VERTICAL-ALIGN: baseline">Chercher un talkie&nbsp;</span><span style="WHITE-SPACE: pre-wrap"> au QG orga si tu as le créneau d</span><span style="LINE-HEIGHT: 1.15; WHITE-SPACE: pre-wrap">''ouverture (10h), récupérer le talkie de celui que tu relèves pour les autres</span></p></li>\r\n<li style="LIST-STYLE-TYPE: disc; FONT-FAMILY: Arial; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline" dir="ltr">\r\n<p style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir="ltr"><span style="WHITE-SPACE: pre-wrap; VERTICAL-ALIGN: baseline">Annoncer aux orgas bars Choppy et Bruce Louis au talkie que tu es là</span></p></li>\r\n<li style="LIST-STYLE-TYPE: disc; FONT-FAMILY: Arial; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline" dir="ltr">\r\n<p style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir="ltr"><span style="WHITE-SPACE: pre-wrap; VERTICAL-ALIGN: baseline">Approvisionner en gobelet le bar. Pense à en prendre avant l’ouverture pour tenir un bon moment.</span></p></li>\r\n<li style="LIST-STYLE-TYPE: disc; FONT-FAMILY: Arial; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline" dir="ltr">\r\n<p style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir="ltr"><span style="WHITE-SPACE: pre-wrap; VERTICAL-ALIGN: baseline">Approvisionner en soft, et veiller à ce que les frigos soit bien comme il faut (Facing de Red Bull notamment).</span></p></li>\r\n<li style="LIST-STYLE-TYPE: disc; FONT-FAMILY: Arial; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline" dir="ltr">\r\n<p style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir="ltr"><span style="WHITE-SPACE: pre-wrap; VERTICAL-ALIGN: baseline">Appeler le ravito arrrrrgent si les caisses sont vides (plus de pièces de 50ct par exemple) ou pleines à craquer. Le resp orga bar te préviendra si c’est le cas.</span></p></li>\r\n<li style="LIST-STYLE-TYPE: disc; FONT-FAMILY: Arial; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline" dir="ltr">\r\n<p style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir="ltr"><span style="WHITE-SPACE: pre-wrap; VERTICAL-ALIGN: baseline">Gérer la sécurité des bars (personne passe derrière les bars) !</span></p></li>\r\n<li style="LIST-STYLE-TYPE: disc; FONT-FAMILY: Arial; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline" dir="ltr">\r\n<p style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir="ltr"><span style="WHITE-SPACE: pre-wrap; VERTICAL-ALIGN: baseline">Approvisionner en bière. Quand un fût est vide, change le avec un en stock, annonce au talkie que tu as besoin d’un fût, écoute la réponse des Orgas Bars, et rends toi au creux GCU. C’est toi qui percutes les fûts et les changes. Percute le premier fût avant l’ouverture du bar pour être tranquille à l’ouverture. </span></p></li>\r\n<li style="LIST-STYLE-TYPE: disc; FONT-FAMILY: Arial; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline" dir="ltr">\r\n<p style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir="ltr"><span style="WHITE-SPACE: pre-wrap; VERTICAL-ALIGN: baseline">Superviser le bar en général, si tu te pignoles, aide à servir ou tirer.</span></p></li>\r\n<li style="LIST-STYLE-TYPE: disc; FONT-FAMILY: Arial; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline" dir="ltr">\r\n<p style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir="ltr"><span style="WHITE-SPACE: pre-wrap; VERTICAL-ALIGN: baseline">Ranger avec une éponde un seau et du produit (qu''il faut prendre au QG) après la fermeture</span></p></li>\r\n<li style="LIST-STYLE-TYPE: disc; FONT-FAMILY: Arial; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline" dir="ltr">\r\n<p style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir="ltr"><span style="WHITE-SPACE: pre-wrap; VERTICAL-ALIGN: baseline">Ramener le talkie au QG orga</span></p></li></ul><br><span style="FONT-FAMILY: Arial; WHITE-SPACE: pre-wrap; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline"></span>\r\n<p style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir="ltr"><span style="FONT-FAMILY: Arial; WHITE-SPACE: pre-wrap; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline">En plus de cela, au bar MDE tu joue le role de resp orga : tu brief les softs sur leur role et vérifie qu''il le font bien.</span></p>\r\n<p style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir="ltr"><span style="FONT-FAMILY: Arial; WHITE-SPACE: pre-wrap; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline"><br></span></p>\r\n<p style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir="ltr"><span style="FONT-FAMILY: Arial; WHITE-SPACE: pre-wrap; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></p><br><span style="FONT-FAMILY: Arial; WHITE-SPACE: pre-wrap; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline"></span>\r\n<p style="LINE-HEIGHT: 1.15; MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" dir="ltr"><span style="FONT-FAMILY: Arial; WHITE-SPACE: pre-wrap; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline">Contacts : Bruce Louis 07 86 85 59 21 / Choppy </span><span style="FONT-FAMILY: Arial; WHITE-SPACE: pre-wrap; FONT-SIZE: 13px; VERTICAL-ALIGN: baseline">&nbsp;</span><span style="FONT-FAMILY: Arial; WHITE-SPACE: pre-wrap; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline">06 67 12 02 16</span></p>\r\n<div><span style="FONT-FAMILY: Arial; WHITE-SPACE: pre-wrap; FONT-SIZE: 15px; VERTICAL-ALIGN: baseline"><br></span></div></span>', NULL, 0, 'Rotonde', 3, 'non'),
(584, 22, 399, NULL, 'Pose Signa Soirée Samedi', '<p></p><div><div><span class="Apple-tab-span" style="white-space: pre;">	</span>Si tout s''est bien passé, la signa journée doit déjà être retirée. Il est maintenant l''heure de mettre en place celle spécifique aux concerts du samedi soir.</div><ul><li>Se rendre au QG orga, et y retrouver le resp signalétique (SGM: 06 48 25 51 18)</li><li>Récupère masse clous/colsons/scotch.</li><li>Ecouter les instructions et prendre descriptif "Signalétique Concerts Samedi Soir" qui montre où poser quoi.</li><li>Prendre la signa concert spécifiée sur le descriptif.</li><li>La mettre soigneusement en place. Si tu as faim, le resp signa a certainement à manger dans son sac.</li><li>Une fois que tout est mis en place, revenir au QG, déposer le descriptif et le reste du matos emprunté.</li></ul><div><u>Remarque Pignole:</u> Il est 19h00, tu es au QG, mange ! Une longue soirée t''attend.<br><br><i>"La chenille devient papillon, le cochon devient saucisson, c''est une grande loi de la nature"</i><br></div></div><p></p>', NULL, 0, 'Tout partout', 3, 'non'),
(585, 352, 448, NULL, 'Courses - Lundi 19', '<p>Accompagner le Troll et Bourgal en courses pour la Bouffe Artistes.</p><p><br></p><p>RDV à 14h devant la salle hibiscus à la MdE<br></p>', NULL, 0, 'MdE', 3, 'non'),
(586, 352, 445, NULL, 'Gestion Diverse BA Mercredi 21', '<p>S''occuper de la BA,Cuisiner, servir, laver, et scotcher les hards qui passent dans le coin.</p>', NULL, 0, 'MdE', 3, 'non'),
(587, 23, 470, NULL, 'Accueil Croix Rouge', '<p></p><ul><li>Aller au Qg Orga récupérer les clefs du PC secouristes et un talkie</li><li>Aller retrouver la Croix Rouge au PS2 (numéro du resp à venir)</li><li>Les emmener au PC secouristes</li><li>Ouvrir, les laisser s''installer</li><li>Laisser le talkie et les clefs</li></ul><p></p>', 'De la bonne humeur en quantité suffisante', 0, 'ZC', -1, 'non'),
(588, 194, 472, NULL, 'Acceuillir Auto Ecole Patrick', '<p>-Accueillir les intervenants de l''auto école. Ils devraient appeler le resp (George) dès leur arrivée.<br></p><div>-Les amener jusqu''à l''emplacement du simulateur, dans l''Olivier (MdE).<br></div><div><br></div><div>-Les aider à monter le stand s''ils ont besoin.</div><div><br></div><div>-Expliquer le déroulement de la journée et leur souhaiter une bonne journée après leur avoir donné le numéro du resp.</div>', NULL, 0, 'L''Olivier, MDE', 3, 'non'),
(589, 352, 446, NULL, 'Cuisinier Mercredi 21', '<p>Votre mission: cuisiner pour le prestigieux Restaurant des Artistes des 24h.</p><div><br></div><div>Sous la direction de l''amateur Chef Le Troll (pour vous, ce sera "Chef"), vous aurez l''opportunité d''apprendre des recettes et / ou perfectionner vos connaissances en cuisine.</div><div><br></div><div>Soyez bien motivés car il y a beaucoup de travail et comme dans toute cuisine qui se respecte, pas assez de personnel.</div><div><br></div><div>Rendez-vous à l''heure de ton créneau en salle hibiscus, à la MDE.<br></div>', NULL, 0, 'MdE', 3, 'non'),
(590, 194, 472, NULL, 'Départ Auto Ecole Patrick', '<p>-Aller voir l''auto école Patrick dans l''olivier (MdE).<br><br>-Leur demander si tout s''est bien passé, les remercier.<br><br>-Les aider à ranger.<br><br>-Les accompagner jusqu''à leur véhicule si tu as le temps.<br><br>-Leur souhaiter un bon dimanche et leur dire "à l''année prochaine".</p>', NULL, 0, 'L''Olivier, MDE', 3, 'non'),
(591, 352, 447, NULL, 'Serveur - Mercredi 21', '<p></p><div>Votre mission: ''serveur'' pour le prestigieux Restaurant des Artistes des 24h.</div><div><br></div><div>Sous la direction de l''amateur Chef Le Troll (pour vous, ce sera "Chef"), vous aurez l''opportunité de faire le service de table auprès de nombreuses personnes de qualité.</div><div><br></div><div>Soyez bien motivés car il y a beaucoup de travail et comme dans tout restaurant qui se respecte, pas assez de personnel.</div><div><br></div><div>Rendez-vous à l''heure de ton créneau en salle hibiscus, à la MDE.</div><p></p>', NULL, 0, 'MdE', 3, 'non'),
(592, 352, 448, NULL, 'Vaisselle - Mercredi 21', '<p>Votre mission: ''plongeur'' pour le prestigieux Restaurant des Artistes des 24h.</p><p>Sous la direction de l''amateur Chef Le Troll (pour vous, ce sera "Chef"), vous aurez l''opportunité de nettoyer les restes des repas auxquels auront assisté de nombreuses personnes de qualité.</p><p>L''eau, le savon et les assiettes sales sont fournies.</p><p>Soyez bien motivés car il y a beaucoup de travail et comme dans tout restaurant qui se respecte, pas assez de personnel.<br></p><p>Rendez-vous à l''heure de ton créneau en salle hibiscus, à la MDE.</p><p></p><div></div><p></p><div style="color: rgb(0, 0, 0); font-family: ''Times New Roman''; font-size: medium; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;">Heureusement, pour l''aide que tu apporte, tu auras droit à une récompense en nourriture (bien meilleur que le pâté que pourront te donner les humains ou les mamans).<br></div>', NULL, 0, 'MdE', 3, 'non'),
(593, 19, 461, NULL, 'Décharger livraison Bières', '<p>Les fûts et les tireuses arriiiivent !</p><div><br></div><div>Vous devez aider à décharger la livraison de Dagier (un semi remorque plein).</div><div><br></div><div>Mettez dans le camion frigo 20m3 et le 11m3, le plus de fûts possible.</div><div><br></div><div>Mettez le reste dans le creux GCU</div><div><br></div><div>Mettez les softs dans un petit camion frigo.</div><div><br></div><div><br></div><p></p>', '2 petits camions frigo et le gros camion frigo de 20m3', 0, 'Creux GCU', 3, 'non'),
(594, 23, 323, NULL, 'Etat des lieux récupération QG', '<p></p><ul><li>Retrouve Alain Brouet dans son bureau en GCU (06 50 20 02 69)</li><li>Fais l''état des lieux des salles avec lui (toutes les salles du 1er et toutes les salles du 2eme), en vérifiant bien que chaque salle a un code différent qui marche.&nbsp;</li><li>Récupère la clef :</li><ul><li>de la porte du couloir</li><li>de la salle de réu</li></ul><li>Fais lui signer le papier état des lieux</li><li>Lui rappeler de se pointer le lundi à 7h30 pour l''état des lieu de retour</li></ul><br><p></p>', NULL, 0, '2eme étage GCU', 3, 'non'),
(595, 22, 399, NULL, 'Poser les Poster Frame', '<p><span class="Apple-tab-span" style="white-space:pre">	</span>Boooonsoir !</p><div><span class="Apple-tab-span" style="white-space:pre">	</span>Ta tâche consiste à finaliser la pose de signalétique pour les bars. Nous avons reçu les Poster Frame de RedBull dans la matinée,et nous avons 1h00 chrono pour les installer.</div><div><i><br></i></div><div><i>Pour le resp: Bien penser à emporter ton foutre de bricolage en cours le matin, tu ne repassera pas au QG pour gagner du temps.</i></div><div><ul><li>Rendez vous devant GCU. Retrouve le resp signa (SGM: 06 48 25 51 18). Si tu as un peu de retard, appelle le, il aura peut-être déjà commencé et sera quelque part sur les Humas.</li><li>Récupère les 16 Poster Frame au Creux GCU. Demander des colsons au resp.</li><li>Installer les Poster Frame aux bars de manière charismatique (bon espacement, bonne visibilité...).</li><li>Prendre du recul et voir quelle gueule ça a. Si c''est bien, tu peux être fier de toi.&nbsp;</li></ul><div><u>Remarque Pignole:</u> Si vous avez un petit creux, demander à manger à SGM. Il devrait avoir de quoi vous sustenter dans son sac.</div></div><div><br></div><div><i>"Je voudrais rassurer les peuples qui meurent de faim dans le monde: ici, on mange pour vous !"</i></div><p></p>', NULL, 0, 'Devant GCU', 3, 'non'),
(596, 23, 323, NULL, 'Etat des lieux rendu QG', '<p></p><ul><li>Va en GCU, ramasse les dernières merdes qui trainent</li><li>Retrouve Alain Brouet&nbsp;</li><li>Fais le tour des salles de GCU avec lui&nbsp;(toutes les salles du 1er et toutes les salles du 2eme)</li><li>Fais lui signer le papier d''état des lieux</li><li>Rends lui les clefs :</li><ul><li>de la salle de réu</li><li>du couloir</li></ul><li>Merci, et à l''année prochaine</li></ul><p></p>', NULL, 0, '2eme étage GCU', 3, 'non'),
(597, 19, 461, NULL, 'Rendez les camions !!!!!', '<p>Va au QG orga récupérer les clés des 2 camions frigos qu''il te faut (1 petit et 1 gros) plus le 20m3.</p><div>Ramenes les 3 au creux GCU pour les remplir avec la livraison de Dagier qui arrive à 12h30 ;)</div><p></p>', NULL, 1, 'QG Orga', 3, 'non'),
(598, 31, 473, NULL, 'Mise en Place Point de Passage Bâtiment f', '<p>A toi incombe l’honneur d''ouvrir le premier point de passage course,</p><div><br></div><div>Tout d''abord vas au QG orga et demande Ron (essaye de trouver ton binôme aussi), il sera probablement pas là mais demande au super Humain de l''appeler au talkie :)</div><div><br></div><div>Il va te filer ton équipement (un joli gilet jaune) ainsi que ta fiche de briefing.</div><div><br></div><div>Après quoi tu devra aller au point de passage du bâtiment F (au niveau du département TC) tu peux pas te perdre il y aura des panneaux :)</div><div><br></div><div>Quand tu seras en place appelle Ron pour confirmer que tu es bien arrivé si il ne t''as pas accompagné.</div><div><br></div><div>Ensuite prends un joli sourire et gère le flux des gens qui veulent traverser.</div><div>Fait bien attention aux cyclistes ils roulent très vite sur la rue des Arts !</div><div><br></div><div>Quand ton créneau est fini, attend ta relève, si elle ne vient pas, tout comme en cas de problèmes, préviens l''Humain ou le QG orga par téléphone ! Tu pourras trouver les numéros sur ta fiche briefing :)</div><div><br></div><div><u>petit + pour ton créneau :</u></div><div><br></div><div>Si il fait beau pense bien aux lunettes de soleil et à la crème solaire.</div><div>Si il pleut prend un kway &nbsp;ou un parapluie&nbsp;</div><div>Si t''as fini et que tu n''as rien a faire passe manger un morceau au QG orga, ça fera plaisir aux mamans :)</div><div>&nbsp;</div><p></p>', 'Ton charisme, ta bonne humeur et ta superbe Fiche de Briefing Point de passage', 0, 'QG orga', 3, 'non (raf)'),
(599, 19, 461, NULL, 'Amenez les camions frigos à leur poste', '<p>Superviser la fin du déchargement.</p><div><br></div><div>Amener les camions frigo plein à leur poste : un dans le creux pour les softs et un au bar AIP (fût).</div><p></p>', NULL, 1, 'Creux GCU', -1, 'non'),
(600, 19, 461, NULL, 'Installer les tireuses', '<p>Une fois toutes les tireuses dans le 20m3, il faut les placer sur les différents bars du festival.</p><div>Des palettes ont été placées pour que vous mettiez les tireuses dessus derrière chaque bar.</div><div><br></div><div>Pendant ce temps un orga va placer chaque camion frigo à l''endroit où ils doivent être. Une fois fini il aidera à installer les tireuses.</div><p></p>', NULL, 1, 'Creux GCU', 3, 'non'),
(601, 23, 474, NULL, 'Récupérer les clefs de la sécu', '<p></p><ul><li>Va au QG orga, et retrouve l''humain de l''ambiance!</li><li>Récupère les clefs pour la sécu dans le trousseau SIUAPS:</li><ul><li>Clefs su sous-sol 211 pour le PC secouristes</li><li>Clef main courant stabilisé (cadenas 160 219)</li></ul><li>Vas les mettre dans le kit QG sécu au bocal</li></ul><p></p>', NULL, 0, 'QG orga', 3, 'non'),
(602, 19, 461, NULL, 'Briefing Resps', '<P>Viens au Briefing Resp Bar et Resps Orga Bar ! On va t''apprendre comment se déroule le festival en soirée coté biiiiiiiiiières.</P>', NULL, 0, 'Amphi', 3, 'non'),
(603, 19, 461, NULL, 'Formation Tireuses', '<p>RDV devant une tireuse devant GCU.</p><p>On va te former à tirer une bière, percuter un fût, et à garder un tireuse en vie, tout en dégustant ce qui sort des fûts.</p>', 'Charisme', 0, 'Creux GCU', 3, 'non'),
(604, 23, 474, NULL, 'Rendre les clefs de la sécu', '<p></p><ul><li>Vas au bocal, trouve l''humain</li><li>Rends lui les clefs de la sécu :</li><ul><li>Clefs du sous-sol 211 pour le PC secouristes</li><li>Clef main courant stabilisé (cadenas 160 219)</li></ul><li>Demande lui un sandwich au paté, comme si t''en avais pas déjà assez mangé</li></ul><p></p>', NULL, 0, 'Bocal', 3, 'non'),
(605, 31, 475, NULL, 'Mise en Place Point de Passage Mde', '<p>A toi incombe l’honneur d''ouvrir le premier point de passage course,</p><div><br></div><div>Tout d''abord va au QG orga et demande Ron (essaye de trouver ton binôme aussi), il sera probablement pas là mais demande au super Humain de l''appeler au talkie :)</div><div><br></div><div>Il va te filer ton équipement (un joli gilet jaune) ainsi que ta fiche de briefing.</div><div><br></div><div>Après quoi tu devra aller au point de passage de la Mde (au niveau de l''olivier) tu peux pas te perdre il y aura des panneaux :)</div><div><br></div><div>Quand tu sera en place appel l''Humain&nbsp;pour confirmer que tu es bien arrivé si il ne t''as pas accompagné.</div><div><br></div><div>Ensuite prend un joli sourire et gère le flux des gens qui veulent traverser.</div><div>Fait bien attention au cyclistes ils roulent très vite sur la rue des Arts !</div><div><br></div><div>Quand ton créneau est fini, attend ta relève, si elle ne vient pas, tout comme en cas de problèmes, prévient&nbsp;l''Humain ou le QG orga&nbsp;par téléphone !</div><div>Tu pourra trouver les numéros sur ta fiche briefing.&nbsp;</div><div><br></div><div><u>petit + pour ton créneau :</u></div><div><br></div><div>Si il fait beau pense bien aux lunettes de soleil et à la crème solaire.</div><div>Si il pleut prend un kway &nbsp;ou un parapluie&nbsp;</div><div>Si t''as fini et que tu n''as rien a faire passe manger un morceau au QG orga, ça fera plaisir aux mamans :)</div>', 'Ton charisme, ta bonne humeur et ta super fiche briefing', 0, 'QG orga', 3, 'non'),
(606, 23, 476, NULL, 'Affichage résidences', '<p></p><ul><li>Va au local</li><li>Récupère :</li><ul><li>Les affiches avec les consignes de sécurité pour les résidences qui se trouvent dans le casier sécu&nbsp;</li><li>Du scotch</li><li>Un multipass pour les résidences au près de l''humain si tu peux</li><li>Un vélo</li></ul><li>Fais le tour des résidences, et vérifie que les affiches sont bien en place</li><li>Si ce n''est pas le cas, scotche en une à un endroit bien visible (sur la porte d''entrée, coté intérieur de la vitre, ou sur le(s) ascenceur(s)). T''inquiète pas, c''est pas de l''affichage sauvage, on a le droit</li><li>Va rendre le multipass et les affiches restantes ou tu les as prises</li><li>Vole vers de nouvelles aventures</li></ul><p></p>', NULL, 0, 'ZC', 3, 'non'),
(607, 31, 477, NULL, 'Mise en Place Point de Passage terrain de foot', '<p>A toi incombe l’honneur d''ouvrir le premier point de passage course,</p><div><br></div><div>Tout d''abord vas au QG orga et demande Ron (essaye de trouver ton binôme aussi), il sera probablement pas là mais demande au super Humain de l''appeler au talkie :)</div><div><br></div><div>Il va te filer ton équipement (un joli gilet jaune) ainsi que ta fiche de briefing.</div><div><br></div><div>Après quoi tu devra aller au point de passage du terrain de foot (au niveau du rond point au bout de la rue des arts) tu peux pas te perdre il y aura des panneaux :)</div><div><br></div><div>Quand tu sera en place appelle l''Humain&nbsp;pour confirmer que tu es bien arrivé si il ne t''a pas accompagné.</div><div><br></div><div>Ensuite prend un joli sourire et gère le flux des gens qui veulent traverser.</div><div>Fait bien attention aux cyclistes ils roulent très vite sur la rue des Arts !</div><div><br></div><div>Quand ton créneau est fini, attend ta relève, si elle ne vient pas, tout comme en cas de problèmes, prévient&nbsp;l''Humain ou le QG orga&nbsp;par téléphone !</div><div>Tu pourras trouver leurs numéros sur ta fiche briefing!</div><div><br></div><div><u>petit + pour ton créneau :</u></div><div><br></div><div>Si il fait beau pense bien aux lunettes de soleil et à la crème solaire.</div><div>Si il pleut prend un kway &nbsp;ou un parapluie&nbsp;</div><div>Si t''as fini et que tu n''as rien a faire passe manger un morceau au QG orga, ça fera plaisir aux mamans :)</div>', 'Ton charisme, Ta bonne humeur et ta super fiche briefing', 0, 'Terrain de foot synthétique', 3, 'non'),
(608, 31, 473, NULL, 'Point de passage Bâtiment F', '<p>Rend toi au Point de passage du Bâtiment F (au niveau du département TC)</p><p>Récupère le gilet jaune et la fiche briefing de ton prédécesseur.&nbsp;</p><div>Quand tu sera en place appel l''Humain pour confirmer que tu es bien arrivé.</div><div><br></div><div>Ensuite prend un jolie sourire et gère le flux des gens qui veulent traverser.</div><div>Fait bien attention au cyclistes ils roulent très vite sur la rue des Arts !</div><div><br></div><div>Quand ton créneaux est fini, attend ta relève, si elle ne vient pas, tout comme en cas de problèmes, préviens l''Humain ou le QG orga par téléphone ! Tu pourra trouver les numéros sur ta fiche briefing :)</div><div><br></div><div><u>petit + pour ton créneau :</u></div><div><br></div><div>Si il fait beau pense bien aux lunettes de soleil et à la crème solaire.</div><div>Si il pleut prend un kway &nbsp;ou un parapluie&nbsp;</div><div>Si il fait nuit prend de quoi ne pas attraper froid</div><div>Si t''as fini et que tu n''as rien a faire passe manger un morceau au QG orga, ça fera plaisir aux mamans :)</div><div><br></div><div>Si tu t''ennuies, tu peux aussi chanter Un Monde Parfait de Ilona Mitrecey, voici les paroles :&nbsp;</div><div><i><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">Ce matin j''imagine un dessin sans nuage</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">Avec quelques couleurs comme vient mon pinceau</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">Du bleu, du rouge je me sens sage comme une image</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">Avec quelques maisons et quelques animaux</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">Ce matin j''imagine un pays sans nuage,</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">Où tous les perroquets ne vivent plus en cage</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">Des jaunes, des verts, des blancs, je fais ce qui me plait</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">Car c''est comme ça que j''imagine un monde parfait...</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">{Refrain:}</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">Un oiseau, un enfant, une chèvre</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">Le bleu du ciel, un beau sourire du bout des lèvres</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">Un crocodile, une vache, du soleil</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">Et ce soir je m''endors au pays des merveilles</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">Un oiseau, un crayon, une chèvre</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">Le bleu du ciel, un peu de sucre, un peu de sel</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">Un crocodile, quelques fleurs, une abeille</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">Et ce soir je m''endors au pays des merveilles</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">Ce matin j''imagine un dessin sans étoile</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">De toute les couleurs un dessin sans contour</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">Quand ça m'' plait plus j''efface tout et je recommence</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">Avec d''autres maisons et d''autres animaux</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">Ce matin j''imagine un pays sans nuage,</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">Où tous les perroquets ne vivent plus en cage</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">Des jaunes, des verts, des blancs, je fais ce qui me plait</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">Car c''est comme ça que j''imagine un monde parfait...</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">{au Refrain}</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">(au Refrain et fin pour la version courte)</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">Ohhh c''est beau ça, ah ouai,</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">C''est comme ça que t''imagine un monde parfait</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">Ah avec un oiseau, un enfant, une chèvre,</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">Un crocodile, une vache, du soleil</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">Moi aussi ce soir je m''endors au pays des merveilles...</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">Ce matin j''imagine un dessin sans étoile</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">De toute les couleurs un dessin sans contour</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">Quand ça m'' plait plus j''efface tout et je recommence</span><br style="margin: 0px; padding: 0px; list-style-type: none; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);">Avec d''autres maisons et d''autres animaux</span></i><br></div>', 'Ton charisme, Ta Bonne Humeur et ta super fiche briefing', 0, 'département TC', 3, 'non (raf)'),
(609, 23, 476, NULL, 'Prendre des photos du campus', '<p></p><ul><li>Va au bocal, récupère un appareil photo (avec de la batterie, sinon ça sert à rien !)</li></ul><div><div>Faire le tour du campus en passant par les points chauds de l''an dernier.</div><div>=&gt; Albert einstein</div><div>=&gt; Avenue gaston berger</div><div>=&gt; Les amphis</div><div>=&gt; Les baies vitrées</div><div>=&gt; Plus généralement tout autour de la ZC.</div><div><br></div><div><br></div><div>Prendre des photos des tags existants et des endroits où on pourrait potentiellement en faire.</div><div>Les transférer sur le serveur dans le dossier&nbsp;<br></div><div>Bural -&gt; Asso -&gt; Assurances</div><div><br></div><div>Les zipper, les uploader sur FEX.</div><div><br></div><div>Envoyer le lien à collectivites69@maif.fr, maud.lamarie@insa-lyon.fr,&nbsp;martine-lois.guillot@insa-lyon.fr</div><div><br></div><div>Avec le message suivant :</div><div><br></div><div><i>Pour information, voici des photos des façades du campus prises antérieurement à la manifestation des 24 heures de l''INSA.</i></div><div><i>Très cordialement.</i></div></div><p></p>', NULL, 0, 'ZC', 3, 'non'),
(610, 22, 461, NULL, 'Signa des Bars', '<p>C''est l''heure d''habiller les bars pour les rendre charismatique. Il faut mettre la signa des bars avec l''Orga Signa et les Orga Bars ! Suis les intructions de l''orga signa .</p><ul><li>Rends toi devant le bâtiment GCU et retrouve le resp signalétique (SGM: 0648255118).</li><li>Ecoute attentivement son briefing</li><li>Vous avez l''intégralité du Jeudi après midi pour effectuer les tâches suivantes:</li></ul><div>-&gt; Récupérer les clés de la cave et d''une voiture (celle de SGM)</div>-&gt; Se rendre à la cave et y récupérer la signa des bars (y compris bar bouffe) et la banderole scène Nord. Ne pas oublier de prendre une ECHELLE (elle sera avec le matos réservé pour la signa) !<div>-&gt; Rendre les clés de la cave au QG orga<br><div>-&gt; Mettre en place la signa des bars au fur et à mesure qu''ils sont montés</div><div>-&gt; Mettre en place la banderole Scène Nord.</div><div>-&gt; Ranger la voiture</div></div>', NULL, 0, 'Devant GCU', 3, 'non'),
(611, 16, 387, NULL, 'Vérif barrièrage', '<p></p><ul><li>Trouve un véhicule (par ordre de charisme fen&gt;20m3&gt;Clio&gt;patins à roulette)</li><li>Fais le tour des alentours de la ZC</li><li>Récupérer le matos qui a été oublié pendant le barrièrage du soir</li><li>Ramène le tout au bocal ou en zone sécurisé</li><li>Va garer ton véhicule</li></ul><p></p>', NULL, 0, 'ZC', 3, 'non (raf)');
INSERT INTO `Tache` (`id`, `responsable_id`, `groupetache_id`, `importid`, `nom`, `consignes`, `materielSupplementaire`, `permisNecessaire`, `lieu`, `statut`, `commentaireLog`) VALUES
(612, 31, 475, NULL, 'point de passage Mde', '<p>Rend toi au Point de passage de la Mde (au niveau de l''Olivier)</p><p>Récupère le gilet jaune et la fiche briefing de ton prédécesseur.&nbsp;</p><div>Quand tu sera en place appel&nbsp;l''Humain&nbsp;pour confirmer que tu es bien arrivé.</div><div><br></div><div>Ensuite prend un joli sourire et gère le flux des gens qui veulent traverser.</div><div>Fait bien attention aux cyclistes ils roulent très vite sur la rue des Arts !</div><div><br></div><div>Quand ton créneau est fini, attend ta relève, si elle ne vient pas, tout comme en cas de problèmes, préviens l''Humain ou le QG orga par téléphone ! Tu pourra trouver leur numéros sur ta fiche briefing :)</div><div><br></div><div><u>petit + pour ton créneau :</u></div><div><br></div><div>Si il fait beau pense bien aux lunettes de soleil et à la crème solaire.</div><div>Si il pleut prend un kway &nbsp;ou un parapluie&nbsp;</div><div>Si il fait nuit prend de quoi ne pas attraper froid</div><div>Si t''as fini et que tu n''as rien a faire passe manger un morceau au QG orga, ça fera plaisir aux mamans :)</div><div><br></div><div>Si tu t''ennuies, peux également chanter 51 je t''aime :&nbsp;</div><div><span style="background-color: rgb(212, 174, 109); font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify;"><i>Dans la forêt d''Afrique</i></span></div><i><span style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);">Un Congolais chantait</span><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><span style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);">Pastis 51</span><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><span style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);">Boisson alcoolisée !</span><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><span style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);">refrain :&nbsp;</span><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><span style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);">51, je t''aime</span><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><span style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);">J''en boirais des tonneaux</span><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><span style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);">A me rouler par terre</span><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><span style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);">Dans tous les caniveaux !</span><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><span style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);">Et si tu m''abandonnes</span><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><span style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);">Alors je m''empoisonne</span><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><span style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);">Avec une bonbonne</span><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><span style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);">D''un Ricard bien jaune !</span><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><span style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);">refrain&nbsp;</span><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><span style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);">Nono va au Brésil</span><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><span style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);">Pour danser la samba</span><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><span style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);">Il va de ville en ville</span><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><span style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);">Pour apprendre le pas !</span><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><span style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);">refrain&nbsp;</span><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><span style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);">Je baise les grenouilles</span><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><span style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);">J''encule les crapauds</span><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><span style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);">Qui me lèchent les couilles&nbsp;</span><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><span style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);">Le soir au bord de l''eau !</span><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><span style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);">refrain&nbsp;</span><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><span style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);">Marseille est une ville</span><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><span style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);">Où règnent les champions</span><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><span style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);">Qui vont de ville en ville</span><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><span style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);">Pour se faire du pognon !</span><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><span style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);">refrain</span><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><span style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);">Paris est une ville</span><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><span style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);">Où règnent les PD,</span><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><span style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);">Qui vont de ville en ville</span><br style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);"><span style="font-family: ''Trebuchet MS'', Georgia, Verdana, Arial; font-size: 12px; text-align: justify; background-color: rgb(212, 174, 109);">Pour se faire enculer !</span></i>', 'Ton Charisme, Ta Bonne Humeur et ta super fiche briefing', 0, 'rue des arts', 3, 'non'),
(613, 31, 477, NULL, 'Point de passage terrain de foot', '<p>Rend toi au Point de passage du terrain de foot (au niveau du terrain de foot synthétique au bout de la rue des arts)</p><p>Récupère le gilet jaune et la fiche briefing de ton prédécesseur.&nbsp;</p><div>Quand tu seras en place appel&nbsp;l''Humain&nbsp;pour confirmer que tu es bien arrivé.</div><div><br></div><div>Ensuite prend un joli sourire et gère le flux des gens qui veulent traverser.</div><div>Fait bien attention aux cyclistes ils roulent très vite sur la rue des Arts !</div><div><br></div><div>Quand ton créneau est fini, attend ta relève, si elle ne vient pas, tout comme en cas de problèmes, prévient l''Humain ou le QG orga&nbsp;par téléphone !</div><div>Tu pourras trouver leurs numéros sur ta fiche briefing !</div><div><br></div><div><u>petit + pour ton créneau :</u></div><div><br></div><div>Si il fait beau pense bien aux lunettes de soleil et à la crème solaire.</div><div>Si il pleut prend un kway &nbsp;ou un parapluie&nbsp;</div><div>Si il fait nuit prend de quoi ne pas attraper froid</div><div>Si t''as fini et que tu n''as rien a faire passe manger un morceau au QG orga, ça fera plaisir aux mamans :)</div><div><br></div><div>Et si tu t''ennuies, tu peux aussi chanter What the Fox Say ? :&nbsp;</div><div><p class="verse" style="box-sizing: border-box; font-family: proxnov-reg, arial, sans-serif; line-height: 16px;"><i>Dog goes woof<br style="box-sizing: border-box;">Cat goes meow<br style="box-sizing: border-box;">Bird goes tweet<br style="box-sizing: border-box;">and mouse goes squeek</i></p><p class="verse" style="box-sizing: border-box; font-family: proxnov-reg, arial, sans-serif; line-height: 16px;"><i>Cow goes moo<br style="box-sizing: border-box;">Frog goes croak<br style="box-sizing: border-box;">and the elephant goes toot</i></p><p class="verse" style="box-sizing: border-box; font-family: proxnov-reg, arial, sans-serif; line-height: 16px;"><i>Ducks say quack<br style="box-sizing: border-box;">and fish go blub<br style="box-sizing: border-box;">and the seal goes ow ow ow ow ow</i></p><p class="verse" style="box-sizing: border-box; font-family: proxnov-reg, arial, sans-serif; line-height: 16px;"><i>But theres one sound<br style="box-sizing: border-box;">That no one knows<br style="box-sizing: border-box;">What does the fox say?</i></p><p class="verse" style="box-sizing: border-box; font-family: proxnov-reg, arial, sans-serif; line-height: 16px;"><i>Ring-ding-ding-ding-dingeringeding!<br style="box-sizing: border-box;">Gering-ding-ding-ding-dingeringeding!<br style="box-sizing: border-box;">Gering-ding-ding-ding-dingeringeding!<br style="box-sizing: border-box;">What the fox say?</i></p><p class="verse" style="box-sizing: border-box; font-family: proxnov-reg, arial, sans-serif; line-height: 16px;"><i>Wa-pa-pa-pa-pa-pa-pow!<br style="box-sizing: border-box;">Wa-pa-pa-pa-pa-pa-pow!<br style="box-sizing: border-box;">Wa-pa-pa-pa-pa-pa-pow!<br style="box-sizing: border-box;">What the fox say?</i></p><p class="verse" style="box-sizing: border-box; font-family: proxnov-reg, arial, sans-serif; line-height: 16px;"><i>Hatee-hatee-hatee-ho!<br style="box-sizing: border-box;">Hatee-hatee-hatee-ho!<br style="box-sizing: border-box;">Hatee-hatee-hatee-ho!<br style="box-sizing: border-box;">What the fox say?</i></p><p class="verse" style="box-sizing: border-box; font-family: proxnov-reg, arial, sans-serif; line-height: 16px;"><i>Joff-tchoff-tchoffo-tchoffo-tchoff!<br style="box-sizing: border-box;">Tchoff-tchoff-tchoffo-tchoffo-tchoff!<br style="box-sizing: border-box;">Joff-tchoff-tchoffo-tchoffo-tchoff!<br style="box-sizing: border-box;">What the fox say?</i></p><p class="verse" style="box-sizing: border-box; font-family: proxnov-reg, arial, sans-serif; line-height: 16px;"><i>Big blue eyes<br style="box-sizing: border-box;">Pointy nose<br style="box-sizing: border-box;">Chasing mice<br style="box-sizing: border-box;">and digging holes</i></p><p class="verse" style="box-sizing: border-box; font-family: proxnov-reg, arial, sans-serif; line-height: 16px;"><i>Tiny paws<br style="box-sizing: border-box;">Up the hill<br style="box-sizing: border-box;">Suddenly youre standing still</i></p><p class="verse" style="box-sizing: border-box; font-family: proxnov-reg, arial, sans-serif; line-height: 16px;"><i>Your fur is red<br style="box-sizing: border-box;">So beautiful<br style="box-sizing: border-box;">Like an angel in disguise</i></p><p class="verse" style="box-sizing: border-box; font-family: proxnov-reg, arial, sans-serif; line-height: 16px;"><i>But if you meet<br style="box-sizing: border-box;">a friendly horse<br style="box-sizing: border-box;">Will you communicate by<br style="box-sizing: border-box;">mo-o-o-o-orse?<br style="box-sizing: border-box;">mo-o-o-o-orse?<br style="box-sizing: border-box;">mo-o-o-o-orse?</i></p><p class="verse" style="box-sizing: border-box; font-family: proxnov-reg, arial, sans-serif; line-height: 16px;"><i>How will you speak to that<br style="box-sizing: border-box;">ho-o-o-o-orse?<br style="box-sizing: border-box;">ho-o-o-o-orse?<br style="box-sizing: border-box;">ho-o-o-o-orse?<br style="box-sizing: border-box;">What does the fox say?</i></p><p class="verse" style="box-sizing: border-box; font-family: proxnov-reg, arial, sans-serif; line-height: 16px;"><i>Jacha-chacha-chacha-chow!<br style="box-sizing: border-box;">Chacha-chacha-chacha-chow!<br style="box-sizing: border-box;">Chacha-chacha-chacha-chow!<br style="box-sizing: border-box;">What the fox say?</i></p><p class="verse" style="box-sizing: border-box; font-family: proxnov-reg, arial, sans-serif; line-height: 16px;"><i>Fraka-kaka-kaka-kaka-kow!<br style="box-sizing: border-box;">Fraka-kaka-kaka-kaka-kow!<br style="box-sizing: border-box;">Fraka-kaka-kaka-kaka-kow!<br style="box-sizing: border-box;">What the fox say?</i></p><p class="verse" style="box-sizing: border-box; font-family: proxnov-reg, arial, sans-serif; line-height: 16px;"><i>A-hee-ahee ha-hee!<br style="box-sizing: border-box;">A-hee-ahee ha-hee!<br style="box-sizing: border-box;">A-hee-ahee ha-hee!<br style="box-sizing: border-box;">What the fox say?</i></p><p class="verse" style="box-sizing: border-box; font-family: proxnov-reg, arial, sans-serif; line-height: 16px;"><i>A-oo-oo-oo-ooo!<br style="box-sizing: border-box;">Woo-oo-oo-ooo!<br style="box-sizing: border-box;">What does the fox say?</i></p><p class="verse" style="box-sizing: border-box; font-family: proxnov-reg, arial, sans-serif; line-height: 16px;"><i>The secret of the fox<br style="box-sizing: border-box;">Ancient mystery<br style="box-sizing: border-box;">Somewhere deep in the woods<br style="box-sizing: border-box;">I know youre hiding<br style="box-sizing: border-box;">What is your sound?<br style="box-sizing: border-box;">Will we ever know?<br style="box-sizing: border-box;">Will always be a mystery<br style="box-sizing: border-box;">What do you say?</i></p><p class="verse" style="box-sizing: border-box; font-family: proxnov-reg, arial, sans-serif; line-height: 16px;"><i>Youre my guardian angel<br style="box-sizing: border-box;">Hiding in the woods<br style="box-sizing: border-box;">What is your sound?</i></p><p class="verse" style="box-sizing: border-box; font-family: proxnov-reg, arial, sans-serif; line-height: 16px;"><i>(Fox Sings)<br style="box-sizing: border-box;">Wa-wa-way-do Wub-wid-bid-dum-way-do Wa-wa-way-do</i></p><p class="verse" style="box-sizing: border-box; font-family: proxnov-reg, arial, sans-serif; line-height: 16px;"><i>Will we ever know?</i></p><p class="verse" style="box-sizing: border-box; font-family: proxnov-reg, arial, sans-serif; line-height: 16px;"><i>(Fox Sings)<br style="box-sizing: border-box;">Bay-budabud-dum-bam</i></p><p class="verse" style="box-sizing: border-box; font-family: proxnov-reg, arial, sans-serif; line-height: 16px;"><i>I want to</i></p><p class="verse" style="box-sizing: border-box; font-family: proxnov-reg, arial, sans-serif; line-height: 16px;"><i>(Fox sings)<br style="box-sizing: border-box;">Mama-dum-day-do</i></p><p class="verse" style="box-sizing: border-box; font-family: proxnov-reg, arial, sans-serif; line-height: 16px;"><i>I want to<br style="box-sizing: border-box;">I want to know!</i></p><p class="verse" style="box-sizing: border-box; font-family: proxnov-reg, arial, sans-serif; line-height: 16px;"><i>(Fox sings)<br style="box-sizing: border-box;">Abay-ba-da bum-bum bay-do</i></p></div>', 'Ton Charisme, Ta Bonne Humeur et ta super fiche briefing', 0, 'Terrain de foot synthétique', 3, 'non'),
(614, 23, 476, NULL, 'Marquage PC secours', '<p></p><ul><li>Va au local récupérer une bombe tempo et les pochoirs poste de secours</li><li>Ne prend pas de la peinture permanente comme le Forum&nbsp;</li><li>Prends ton vélo et va faire le marquage depuis PS2, PS4 et PS5 jusqu''au parking Est Piscine</li><li>Une fois ton forfait accompli, rentre au local reposer ton bordel</li></ul><p></p>', 'Bombe tempo fluo\r\nPochoirs Pc secours', 0, 'ZC', 3, 'non (raf)'),
(615, 19, 461, NULL, 'Gérer les imprévus', '<p>1) Brancher les frigos</p>\r\n<p>2) Placer les tables poser par Alexis la veille</p>\r\n<p>3) Vu que Red Bull ne livrera pas de frigo ou quoique ce soit, tu as ce créneau de libre en sécurité pour gérer les imprévus et réceptionner les livraisons potentielles de dernière minute.</p>\r\n<div>Si tu as du temps, revoit tous les bars (frigos etc.), le creux (gobelets et boissons). Tu peux même commencer à remplir les frigos de softs plus tôt et prendre de l''avance.<br>\r\n<div><br></div>\r\n<div><br></div></div>\r\n<p></p>', NULL, 0, 'Creux GCU', 3, 'non'),
(616, 23, 476, NULL, 'Test son+image évac', '<p></p><ul><li>Va rejoindre Hermione ou Gilles à la régie</li><li>Teste le son et l''image d''évacuation</li></ul><p></p>', NULL, 0, 'ZC', 3, 'non'),
(617, 19, 461, NULL, 'Remplir frigo et placer fûts', '<p>Retrouve l''Orga Bar devant GCU en début de créneau.</p><div>Suis ses instructions, il faudra remplir les frigos des bars et placer les fûts à côté des tireuses. Si possible percuter les fûts (avec accord de l''orga) pour gagner du temps sur la tache d''après ! :D</div><div><br></div><div>C''est la dernière tache avant l''ouverture des bars, il faut donc que tout soit là (sauf chaises et gobelets qui arrivent à 19h) ! Merciiiii</div><p></p>', NULL, 0, 'Creux GCU', 3, 'non'),
(618, 19, 461, NULL, 'Réceptionner Gobelet', '<p>Appelle hermione au talkie pour qu''il débarque avec son fen!<br><br>Assure la livraison de gobelet et prépare les dans un coin du fond du creux GCU (à l''abri) pour que les Resp Bars puissent les prendre facilement Vendredi.</p>', NULL, 0, 'Creux GCU', 3, 'non'),
(619, 21, 338, NULL, 'Rendu des tables GMD et du matos de la cave du PC', '<p></p><ul><li>RDV au dépôt AIP</li><li>Trouve tes amis qui comme toi se sont motivés de grand matin pour venir filer un coup de main !</li></ul>--&gt; S''il fait beau :&nbsp;<br>-sors toutes les tables dehors<br>-Met à part celles avec un scotch "A302"<div><br></div><div>--&gt; S''il pleut, passe directement à la suite !</div><div><br></div><div>--&gt; Si tu ne sais pas : appelle Cetelem (06 80 52 08 62)<br><ul><li>Trouve le matériel de nettoyage laissé par des orgas dans le dépôt</li><li>Rempli le sceau d''eau chaude (toilettes plus loin dans le bâtiment GMC)<br></li><li>Récupère les éponges et les chiffons amenés par des super orgas trop gentils (et fais leur des gros bibis, c''est important)<br></li><li>Nettoie toutes <b><u>les tables 2 place</u></b><u><b>s</b></u> sales (les grandes dégueulasses que tu n''as jamais vu en cours tu les oublie !)</li><li>Si tu as besoin de produit et que ta bouteille est vide, va en chercher au QG<br></li><li>Pense bien à regarder les pieds des tables, celles des bars sont souvent sales à cet endroit là.</li><li>Cetelem a du arriver en 20m3 (si à 8h15-20 il n''est pas là, l''appeler)</li><li>Charger les tables dans le 20m3</li><li>Suive les instructions de Cetelem (visite de caveaux anciens, découverte de lieux insoupçonnés, rencontres hautes en émotions et en souvenir,...)&nbsp;</li><li>Rentrer au QG et se pignoler</li></ul><div><br><div><br></div><div><br></div></div></div><p></p>', NULL, 0, 'Dépôt AIP', 3, 'non'),
(620, 23, 476, NULL, 'Check PCO', '<p></p><ul><li>Va au poste de gardiennage récupérer les clefs de la salle de commissions</li><li>Va dire bonjour à Yvette au standard de l''INSA</li><li>Dans la salle des commissions, vérifie que les lignes de téléphone marchent bien :</li><li>7201 sur la prise D026<br>7202 sur la prise E026<br>7203 sur la prise D025<br>7204 sur la prise E025<br></li><li>Appelle le bocal en te faisant passer pour manu le trikke&nbsp;</li></ul><p></p>', NULL, 0, 'ZC', 3, 'non'),
(621, 19, 461, NULL, 'Validation des bars', '<p>Va valider que tout est en ordre pour l''ouverture des bars qui est dans quelques heures (signa, stock, rangement, etc.), percute les fûts si ce n''est pas encore fait !<br></p><p>Pour les chaises elles arrivent qu''à 18h45 à l''AIP (voir FT correspondante).</p><p></p>', NULL, 0, 'Creux GCU', 3, 'non'),
(622, 21, 338, NULL, 'Gestion rendu des tables GMD et du matos de la cave du PC', '<p>Bonsoir !</p><div>Cetelem du futur, ici Cetelem du passé. Ici, il est 02:07, chez toi il doit être approximativement 32:00 puisque tu n''as pas encore dormi ! Ne t''inquiète pas, ça n''arrive pas bientôt !</div><div><br></div><div>Tu vas gérer le rendu des tables PC/GMD.</div><div><ul><li>Après les chaises PC, va au dépôt AIP en 20m3<br></li><li>Retrouve les orgas qui attendent et aide les à nettoyer les tables<br></li><li>Vérifie que tu as toujours ton amie la clef pompier<br></li><li>Charge le matos dans le 20m3 :</li></ul>- Grandes tables dégueu,</div><div>- Tables 2p cave PC</div><div>- Chaises restantes<br><ul><li>Direction le PC !</li><li>Se garer devant GMD et aller voir ce bon vieux Fabrice Ville (ou Claude Courtois)</li><li>Écouter ses blagounettes d''homme frais et répondre "comme un lundi" parce que c''est important.</li><li>Ranger 25 tables 2p <u>propres</u> dans la cave de GMD</li><li>Dire merci et à l''année prochaine !</li></ul></div><div><ul><li>Reculer le 20m3 devant la 1ère travée</li><li>Aller chercher les clefs de la cave PC à la DirPat (ils ont intérêt à être ouvert ces salauds sinon je les fume !)</li><li>Prendre celles de derrière, c''est important</li><li>Ranger les tables 2p restantes juste à droite de l''entrée</li><li>Mettre les grandes tables plus loin</li><li>Refermer la cave</li><li>Refermer la barrière pompier</li><li>Rendre les clefs à la DirPat (faire coucou à Maud, Ah ba non, elle est en vacances .. pute)</li><li>Rentrer au QG</li><li>rendre les clefs de Bradley, la clef du PC secouriste et la clef pompier&nbsp;</li><li>S''endormir comme une grosse merde dans un canapé</li><li>Se faire réveiller par une alarme de type "AH AH AH HA HAH AH ! Alexis ! C''est l''heure de l''ambiance !" (merci Dina)</li></ul></div><p></p>', NULL, 0, 'Dépôt AIP', 3, 'non'),
(623, 19, 461, NULL, 'Réceptionner les frigos et la signa RB', '<p>Alexis, Choppy et Louis sont des amis !!</p><div><br></div><div>A trois on surveille la réception et le début de l''installation du matos RB (frigo, signa, etc.) mais aussi des frigos/glacière/solution de froid locale en générale</div><div><br></div><div>Appeler Alexis quand RB arrive, il passera vous voir pour surveiller mais il a autre chose à faire qu''attendre que ces connards déchargent =)</div><div><br></div><div>Bibis les rôtis !</div><p></p>', NULL, 0, 'Creux GCU', -1, 'non'),
(624, 19, 461, NULL, 'Installer TPE et caises', '<p>Aller chercher les TPE et caisses au QG, les ramener à chaque bar pour le début des choses sérieuse.</p><div>Prendre un caddie si nécessaire.</div><p></p>', NULL, 0, 'Creux GCU', -1, 'non'),
(625, 19, 461, NULL, 'Laver les écocups', '<p>Il faut laver les gobelets sales de la veille, mais pas de soucis tu ne vas pas laver les gobelets 1 à 1, il y a une machine pour cela.</p><p>(-Louis ou Choppy : aller chercher clé 20m3 au QG / voiture perso le mardi)</p><p><u>Pour le créneau de 9h :</u></p><p>-mettre les cartons de gobelets sales du creux GCU dans le 20m3</p><p>-aller au beurk et décharger les gobelets du 20m3</p><p>-monter les gobelets dans le resto</p><p>-être gentil avec tout le monde</p><p>-écouter le personnel</p><p>-laver les verres</p><p><u>Pour le créneau de 10h30 :</u></p><p>-venir à la laverie du Beurk</p><p>-prendre la relève du premier créneau</p><p>-remettre tout dans le 20m3 et les ranger dans le creux GCU</p><p>-prendre une pinte avec les gobelets maintenant propre !</p><p>(-Louis ou Choppy : aller reposer clé 20m3 au QG/voiture perso le mardi)<br></p>', NULL, 1, 'Creux GCU', 3, 'non'),
(626, 21, 421, NULL, 'Tâche sans nom', '444', NULL, 0, 'Local des 24H', -1, 'non'),
(627, 21, 478, NULL, 'Vérification rangement salles de cours', '<p></p><ul><li>Va au QG de l''ambiance<br></li><li>Mange, bois, mange, mange, bois, remange et rebois.<br></li><li>Demande aux humains les clés des salles plus bas</li><li>Fait le tour de ces salles et vérifie leur propreté, la mise en place des tables (que ce soit normal pour une salle de cours quoi) et surtout le nombre de tables/chaises (marqué au tableau normalement)</li></ul><div>En cas de soucis, appelle Cetelem (06 80 52 08 62)</div><div><br></div><div>Salles à vérifier (les noms à droite des salles étaient les resp des salles)</div><div>- espace VIP (salle du bas de Coulomb) -&gt; Guillaume (07 86 39 70 45)</div><div>- bâtiment humas, salle 020, 021 et salle des professeurs -&gt; Cetelem (06 80 52 08 62)</div><div>- rené char --&gt; Morgane (06 70 11 59 48)</div><div>- salle théâtre --&gt; idem (06 24 24 24 24)</div><div>- salle A302 (bât GMC, AIP) --&gt; Cetelem</div><div><br></div><div><ul><li>Rentre au QG et rend toutes les clefs aux humains</li><li>Fait un point écrit de tout ce qu''il manque sur une feuille</li><li>Trouve Cetelem (appel talkie) et donne lui</li></ul></div><div>Force et honneur !</div><div>Le gras c''est la vie !</div><div>Je beaucoup sur vous !</div><div><br></div><div><br></div><p></p>', NULL, 0, 'QG Orgras', 3, 'non'),
(628, 19, 461, NULL, 'Palettiser les bars', '<p>Rejoins l''orga Bar au Creux GCU.</p><p>A bord du 20m3 de l''ambiance (clés de la cave et du 20m3 à prendre au local des 24h auprès de l''humain) allez récupérer les palettes (une 30taine) de la cave et ramenez les au creux GCU.</p><div>Mettre les palettes où il faut derrière les 7 bars de la zone.</div><p></p>', 'moults palettes', 0, 'Creux GCU', 3, 'non'),
(629, 19, 461, NULL, 'Moquetter les Bars', '<p>Hey ! Tu vas aider les orgas bars à moquetter les bars !</p><p>Moquetter c''est habiller les bars avec de la moquette pour pas que les festivaliers voient la ferraille qu''il y a sous les bars :). Le rendu visuel final des bars dépend de toi, il faut faire de beaux bars pour inciter les gens à acheter à boire !</p><p>Rendez vous au creux GCU où l''orga te donnera ton matos !</p><p>Orga = Louis : 0786855921</p>', NULL, 0, 'Creux GCU', 3, 'non'),
(630, 32, 479, NULL, 'Contrôle des billets', '<p>RDV sur la zone des caisses aux entrées</p><p>Présente toi à Clara sur place qui va t''expliquer le fonctionnement.<br><br>Tu t''occupes du contrôle des billets d''entrée en collaboration avec un Chap''s sur un des six points de contrôle.<br></p><ol><li>La personne se présente avec un billet à la main<br></li><li>Le chaps scan le billet avec une douchette<br></li><li>Si c''est un Billet 1 soir laisse le passer</li><li>Si c''est un PASS 2 SOIRS :</li><li>Prends son billet et met le dans la boite</li><li>Attache lui au poignet un bracelet Pass 2 soirs</li><li>Informe la personne que ce sera son laissez passer pour la soirée du samedi</li></ol>Quelques points importants :<div><ul><li><b>Ne donne pas le bracelet</b>, c''est à toi de l''attacher<br></li><li>Serre le suffisamment pour qu''il ne puisse pas l''enlever (mais pas trop parce qu''après il voudra le changer et c''est pète-cul)</li><li>Garde les bracelet hors de portée et de vue des festivaliers</li><li>Ne te met pas en danger. Si quelqu''un devient agressif ou tente de forcer le passage des agents de sûreté sont là pour s''en occuper.</li></ul><div>En cas de soucis :</div><div><ul><li>Renvoie la personne sur le point accueil (près des caisses)</li><li>Un talkie se trouve sur les points de contrôle. Demande à quelqu''un d''appeler Clara.</li></ul></div><div><br></div><div>Le port du bracelet et <b>obligatoire </b>pour les pass 2 soirs (article 6.2) et fait partie du règlement intérieur auquel la personne à consenti en achetant son billet. Il est rappelé devant les arches d''entrée.</div></div><div><br>&nbsp;<br><p></p><p><br></p></div>', NULL, 0, 'Zone des caisses', 3, 'non'),
(631, 23, 480, NULL, 'Barrièrage du parking Humas', '<p></p><ul><li>Récupérer les feuilles d''interdiction de stationnement (casier sécu au local) et du scotch en rouleau</li><li>Récupérer les 4 vaubans au point de&nbsp;dépôt&nbsp;le plus proche du parking Humas, celui qui est à coté du rhino et ou il y a des places pépitos peintes en bleu&nbsp;(si tu ne le trouve pas, appelle Guerric au 06 04 47 64 30)<br></li><li>Barrière le Parking pour laisser sortir les éventuelles voitures restantes.&nbsp;<br></li><li>Si il n''y a plus de voitures, ferme le complètement !</li><li>Accrocher les feuilles d''interdiction de stationnement<br></li><li>Ramener tout le matos au local<br></li></ul><p></p>', 'Affiches interdiction de stationner', 0, 'Campus', 3, 'non (raf)'),
(632, 23, 480, NULL, 'Fermeture parking MDE/Kfet', '<p></p><ul><li>Récupére les feuilles d''interdiction de stationnement (casier sécu au local) et du scotch en rouleau</li><li>Récupére 2 vaubans qui traînent derrière la kfet<br></li><li>Barrière le Parking derrière la Kfet pour laisser sortir les éventuelles voitures restantes.&nbsp;</li><li>Accroche les feuilles d''interdiction de stationnement au barrière à l''aide de ton rouleau de scotch<br></li><li>Ramene tout le matos au local</li></ul><p></p>', 'Affiches interdiction de stationner', 0, 'Campus', 3, 'non (raf)'),
(633, 23, 480, NULL, 'Barrièrage parking Freyssinnet', '<p></p><ul><li>Rendez-vous au local des 24h de l''INSA au Bâtiment D pour retrouver ton co-tâche.</li><li>Récupérer dans le casier sécu</li><ul><li>les feuilles d''interdiction de stationnement<br></li><li>le papier "décision n°14/04/115" en A3 dans une pochette plastique</li><li>si tu ne le trouves pas appelle cheval au 06 76 99 09 64</li></ul><li>Récupère du scotch en rouleau</li><li>Récupérer des vaubans au point de&nbsp;dépôt&nbsp;le plus proche du parking Freyssinet, celui de la petite scène (si tu ne le trouve pas, appelle Guerric au 06 04 47 64 30)<br></li><li>Barrière le Parking pour laisser sortir les éventuelles voitures restantes. (laisse une ouverture de 1 vauban)<br></li><li>Accroche bien les vaubans entre elles</li><li>Si il n''y a plus de voitures, ferme le complètement ! On est chez nous !</li><li>Accrocher les feuilles d''interdiction de stationnement<br></li><li>Accroche le papier&nbsp;"décision n°14/04/115" bien en vue sur une des vaubans</li><li>Ramener tout le matos au local</li></ul><p></p>', NULL, 0, 'Local des 24 Heures', 3, 'non'),
(634, 23, 480, NULL, 'Flyage Parkings', '<p></p><ul><li>Va au local retrouver ton co-fly</li><li>Récupère des flyer "interdiction de stationner" dans le casier sécu Si tu ne les trouve pas, demande à quelqu''un au local ou appelle Paul (06 59 90 44 19) ou Clément (06 76 99 09 64)&nbsp;</li><li>Va poser des flyers sur les voitures qui sont sur les parkings</li><ul><li>Humas (celui qui est près du rhino et qui a des places peintes en bleu)</li><li>Derrière la kfet</li><li>Freyssinet (celui de la petite scène)&nbsp;</li><li>Derrière la piscine</li><li><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">Sur toute la rue entre le batiment direction et l''AIP (au niveau des entrées de la zone concerts</span><br></li></ul><li>Ramène les flyers (et ton co-fly) au local</li></ul><div>Remarque : tu peux flyer <u>tous</u> les types de véhicules ! (voiture/camion/moto/poney/chameau...)&nbsp;</div><p></p>', NULL, 0, 'Campus', 3, 'non'),
(635, 206, 341, NULL, 'Tâche sans nom', 'c', NULL, 0, 'Bar bouffe', -1, 'non'),
(636, 32, 420, NULL, 'Briefing caisses samedi', '<p>adszaz</p>', NULL, 0, 'Devant l&amp;amp;amp;amp;#039;AIP', -1, 'non'),
(637, 32, 420, NULL, 'Gérer caisses', '<p>- Ne pas oublier d''aller chercher les talkies au QG orga</p><p>-Réceptionner les&nbsp; chaises d''Alexis (vers 19 heures) + accueillir Edouard de Weezevent vendredi<br></p><p>-Briefer les premiers caissiers pour le TPE et refaire un petit topo (vers 19h40), leur dire qu''ils devront briefer les suivants<br></p><p>-Zone aux alentours des caisses et des contrôles d''accès pour s''assurer que tout se passe bien (pas trop vers les entrées le pelot de weezevent est là pour ça)</p><p>-Surtout zoner au point/caisse info parce que c''est là qu''il y aura des merdes<br></p><p>- oublie pas de ramener le stuuuuff à la fin</p><p>- Dina et Fatna je vous aime coeur coeur coeur (Merci, nous aussi on t''aime coeur coeur &lt;3)</p><p>- Pipi caca &lt;3<br></p><p>- Demander à un orga confiance d''aller chercher les clefs de l''AIP au QG Orga.</p><p>-Ramener les clefs à la fin une fois que tout est bien fermé!</p>', 'clés des Algecos', 0, 'Devant l''AIP', 3, 'non'),
(638, 32, 420, NULL, 'Gérer caisses samedi', '<p>- Zone aux alentours des caisses et des contrôles d''accès pour \r\ns''assurer que tout se passe bien (pas trop vers les entrées le pelot de \r\nweezevent est là pour ça)</p><p>-Surtout zoner au point/caisse info parce que c''est là qu''il y aura des merdes</p><p>- oublie pas de ramener le stuuuuff à la fin</p>- un peu la même chose qu''hier somme toute, à l''exception près qu''il faut apprendre de ses erreurs de la veille (Dina : cimer la grognasse !)', NULL, 0, 'Devant l''AIP', -1, 'non'),
(639, 32, 459, NULL, 'Briefing contrôle des accès samedi', '<p>-Rends- toi au niveau des entrées</p><p>-Cherche Clara (06 31 41 42 82)</p><p>-Ecoute attentivement le briefing concernant l''utilisation du matériel de contrôle d''accès (douchettes pour scanner les codes barres des billets)<br></p>', NULL, 0, 'Devant l&amp;amp;#039;AIP', -1, 'non'),
(640, 32, 459, NULL, 'Contrôle des accès samedi', '<p>sdsd</p>', NULL, 0, 'Devant l&amp;amp;amp;#039;AIP', -1, 'non'),
(641, 31, 473, NULL, 'Dernier point de passage bâtiment F', '<p>Rend toi au Point de passage du Bâtiment F (au niveau du département TC)</p><p>Récupère le gilet jaune et la fiche briefing de ton prédécesseur.&nbsp;</p><div>Quand tu sera en place appelle l''Humain pour confirmer que tu es bien arrivé.</div><div><br></div><div>Ensuite prend un joli sourire et gère le flux des gens qui veulent traverser.</div><div>Fais bien attention aux cyclistes ils roulent très vite sur l''avenue des Arts !</div><div><br></div><div>Quand ton créneau est fini, tu n''auras pas de relève, tu es le dernier orga point de passage ! Attend que Ron passe pour récupérer ton gilet jaune et ta fiche briefing.&nbsp;</div><div><br></div><div><u>petit + pour ton créneau :</u></div><div><br></div><div>Si il fait beau pense bien aux lunettes de soleil et à la crème solaire.</div><div>Si il pleut prend un kway &nbsp;ou un parapluie&nbsp;</div><div>Quand t''as fini et si tu n''as rien a faire, passe manger un morceau au QG orga, ça fera plaisir aux mamans :)</div><div><br></div>', 'Ton Charisme, Ta bonne humeur et ta super fiche briefing', 0, 'département TC', 3, 'non (raf)'),
(642, 31, 473, NULL, 'Opération Close All', '<p>Prends ton vélo, fait le tour des points de passage</p><div><br></div><div>Remet les barrières en place</div><div>Dis à tes orgas qu''ils ont fait du bon boulot</div><div>Récupère les fiches de briefing ainsi que leurs gilets jaunes</div><div>Ramène tout ça au village coureur</div><div>Va à la Mde annoncer la fin de la course.</div><div><br></div><p></p>', 'des jambes', 0, 'département TC', 3, 'non'),
(643, 31, 475, NULL, 'Dernier Point de passage Mde', '<p>Rend toi au Point de passage de la Mde (au niveau de l''olivier)</p><p>Récupère le gilet jaune et la fiche briefing de ton prédécesseur.&nbsp;</p><div>Quand tu sera en place appelle l''Humain&nbsp;pour confirmer que tu es bien arrivé.</div><div><br></div><div>Ensuite prend un joli sourire et gère le flux des gens qui veulent traverser.</div><div>Fait bien attention aux cyclistes ils roulent très vite sur la rue des Arts !</div><div><br></div><div>Quand ton créneau est fini, tu n''aura pas de relève, tu es le dernier orga point de passage ! Attend que Ron passe pour récupérer ton gilet jaune et ta fiche briefing.&nbsp;</div><div><br></div><div><u>petit + pour ton créneau :</u></div><div><br></div><div>Si il fait beau pense bien aux lunettes de soleil et à la crème solaire.</div><div>Si il pleut prend un kway &nbsp;ou un parapluie&nbsp;</div><div>Quand t''as fini et si tu n''as rien a faire, passe manger un morceau au QG orga, ça fera plaisir aux mamans :)</div><div><br></div>', 'Ton Charisme, Ta Bonne humeur et ta super fiche briefing', 0, 'rue des arts', 3, 'non'),
(644, 31, 477, NULL, 'Dernier Point de passage Terrain de foot', '<p>Rend toi au Point de passage du Terrain de foot (au niveau du terrain de foot synthétique au bout de la rue des arts )</p><p>Récupère le gilet jaune et la fiche briefing de ton prédécesseur.&nbsp;</p><div>Quand tu seras en place appel&nbsp;l''Humain&nbsp;pour confirmer que tu es bien arrivé.</div><div><br></div><div>Ensuite prend un joli sourire et gère le flux des gens qui veulent traverser.</div><div>Fait bien attention aux cyclistes ils roulent très vite sur la rue des Arts !</div><div><br></div><div>Quand ton créneau est fini, tu n''aura pas de relève, tu es le dernier orga point de passage ! Attend que Ron passe pour récupérer ton gilet jaune et ta fiche briefing.&nbsp;</div><div><br></div><div><u>petit + pour ton créneau :</u></div><div><br></div><div>Si il fait beau pense bien aux lunettes de soleil et à la crème solaire.</div><div>Si il pleut prend un kway &nbsp;ou un parapluie&nbsp;</div><div>Quand t''as fini et si tu n''as rien a faire, passe manger un morceau au QG orga, ça fera plaisir aux mamans :)</div><div><br></div>', 'Ton charisme, Ta bonne humeur et ta super fiche briefing', 0, 'Terrain de foot synthétique', 3, 'non'),
(645, 22, 399, NULL, 'Déplacer le matos Signa au QG', '<p>Booooonsoir !</p><div>Tu as de la chance, puisque tu vas pouvoir visiter la cave des 24H<i> (Amiante on t''aime, amiante on t''adore...)</i>, afin de transporter des tonnes de panneaux jusqu''aux Humas.</div><div><br></div><div><ul><li>Rends toi au QG Orga, retrouve le resp'' signa (SGM: 06 48 25 51 18).</li><li>Demander à l''humain les clés de la cave et du 11m3.</li><li>Enfourche ton 11m3, rends toi à la cave (sous-sol du bâtiment E).&nbsp;</li><li>Entre dans la cave, et remonte tout le matériel signa que tu trouves, pour le mettre dans le 11m3. Si tu as de la chance, tu pourras même gagner un cancer. Sinon, tu auras peut-être plus de chance lorsque tu iras tout redéposer dimanche soir !</li><li>Décharge tout dans un coin du QG Orga. Place une pancarte "Pas touche à ma signa, sinon sanction" au dessus.</li><li>Rends les clés du 11m3 et de la cave à l''humain.</li></ul><div><u>Remarque Pignole:</u> Tu es au QG, profites-en pour manger un bon sandwich au pâté, et remplir ton sac de victuailles, avant de t''envoler vers de nouvelles aventures !</div></div><div><br></div><div><i>"Ce pain là, il est cuit trop vite dans un four trop chaud: la montée n''a pas le temps de se faire et il y a trop d''air dans la mie. Donc c''est de la merde"</i></div><p></p>', '7m3', 0, 'Tout partout', 3, 'raf'),
(646, 219, 481, NULL, 'Installer Isostéo', '<p>-Prendre 1 table (2p) et 5 chaises au dépôt des humas</p><div>- Les installer dans le hall de la MdE</div><div><br></div><div>- Attendre les étudiants d''Isostéo et Marie (06 61 23 21 55)</div><p></p>', NULL, 0, 'Dépôt Humas', 3, 'non'),
(647, 19, 441, NULL, 'Tiffany fait la potiche au Bar', '<p>Bonsoir Tiffany,</p><div><br></div><div>A ta demande tu as une tache spéciale : tu vas faire de l''air au resps bars s''ils ont trop chaud ! Tu es Co-Resp Bar !!!</div><div><br></div><div>Bon courage !</div><p></p>', NULL, 0, 'En face du Cetiat/Petite Scène', -1, 'non'),
(648, 19, 461, NULL, 'Accueillir Red Bull', '<p>Guillaume tu dois accueillir les gars de Red Bull, poser les conditions rapidement et fermement.</p><div>Tu leur fait visiter les lieux pour qu''ils jugent nos installations.</div><div><br></div><div>Contact : Mazimann - 0637751188</div><p></p>', 'Beaucoup de patience et de charisme', 0, 'Creux GCU', -1, 'raf'),
(649, 19, 461, NULL, 'Tâche sacacans nom', '<p>coucou</p>', NULL, 0, 'Creux GCU', -1, 'non'),
(650, 19, 471, NULL, 'Mise en place du Bar MDE', '<p>Hello !</p>\r\n<div>Il faut installer le bar MDE ! Pour cela tu as du matos (2 chaises, 2 tables, à récupérer au dépot Humas, 4 vaubans au dépot derrière la KFet, 1 frigo à remplir au QG orga).</div>\r\n<div><br></div>\r\n<div>Vérifies aussi qu''il y a une caisse et un TPE pour 10h.</div><div><br></div><div>L''ouverture du bar est à 10h. L''équipe du bar arrivera et tu les brieferas sur ce que tu as fais.</div><div><br></div>\r\n<p></p>', '4 Vaubans', 0, 'Rotonde', 3, 'non'),
(651, 19, 461, NULL, 'Superviser le moquettage et la signa des Bars', '<p>Prend moult matos pour faire le moquettage et la signa des bars, tu vas faire que ça aujourd''hui !! Distribue les outils aux softs :)</p><div><br></div><div>Vérifie que les orgas font bien le moquettage, apprends leur, aide les. Pour la signa tu aide Erwan a mettre bien les paneaux où il faut et récupérer ceux qui sont stockés au creux GCU.</div><p></p>', NULL, 0, 'Creux GCU', 3, 'non'),
(652, 209, 482, NULL, 'Ranger les chaises', '<p></p>\r\n<ul>\r\n<li>Rends-toi sur la pelouse des Humas, et retrouve SalamAfrica (percussions africaines)</li>\r\n<li>S''ils sont toujours là, explique-leur que les animations sont terminées.</li>\r\n<li>Remercie-les d''être venus jouer !</li>\r\n<li>Range les 8 chaises au dépôt des Humas.</li>\r\n<li>Retourne à l''emplacement pour vérifier que rien n''a été oublié.</li><li>Attends bien que tout le matériel soit rangé pour pouvoir partir.</li>\r\n<li>Tu es libre :)</li></ul>\r\n<div>&nbsp;En cas d''embrouilles, contacte Simon 06 31 52 99 56</div>\r\n<p></p>', NULL, 0, 'pelouse des Humas', 3, 'non'),
(653, 19, 461, NULL, 'Superviser les Bars en soirées', '<p>La soirée commence !!!!!</p><div><br></div><div><u>Ouverture des bars :</u></div><div>Rends toi au bar où tu es affecté pour l''ouverture (AIP ou Cetiat) à 19h, vérifie que les resps gèrent. Puis rends toi aux autres bars dont tu gères l''ouverture. A un moment vers 21h, il faut amener 7 seaux, 7 éponges et 7 produits pour le nettoyage des bars (il faut ramener le matos à la fermeture !).</div><div>Vérifie que tout est la :&nbsp;</div><div><ul><li>gobelet</li><li>caisses et TPE</li><li>fûts et bouteilles</li><li>tireuses fonctionnelles</li><li>etc</li></ul><div><u>Déroulement de la soirée :</u></div></div><div>Un Orga fait le tour des bar pour vérifier que tout se passe bien pendant que l''autre assure l''appro en fut avec les Resps Bars au creux GCU.</div><div><br></div><div><u>Fermeture et rangement :</u></div><div>Vérifie que le soft et le resp bars font le rangement, aide les. Occupe toi du plus important comme les fûts. Cadenasse les frigos.</div><div>Ramène le matos de nettoyage au QG :)</div><div>Le dernier soir de chaque bar, il faut ramener tables et chaises dans l''AIP&nbsp;</div><div>Si tu as du temps compte les stock pour savoir si demain tu dois aller chercher quelque chose (= plus de sommeil si déjà fait).</div><div><br></div><div>Va dormir il est 5h30 putain !!</div><p></p>', NULL, 0, 'Creux GCU', 3, 'non');
INSERT INTO `Tache` (`id`, `responsable_id`, `groupetache_id`, `importid`, `nom`, `consignes`, `materielSupplementaire`, `permisNecessaire`, `lieu`, `statut`, `commentaireLog`) VALUES
(654, 209, 482, NULL, 'Accueillir l''asso et amener les chaises', '<p></p>\r\n<ul>\r\n<li>Au QG orga, repère sur la plan des animations l''emplacement des percussions africaines.</li>\r\n<li>Retrouve les percussionnistes de SalamAfrica sur le parvis des Humas (Arthur 06 84 42 83 58)</li>\r\n<li>Emmène-les à l''emplacement.</li>\r\n<li>Va chercher les 8 chaises au dépôt des Humas et amène-les sur l''emplacement.</li>\r\n<li>Demande s''ils n''ont besoin de rien, et tu es libre :)</li></ul>\r\n<div>En cas d''embrouilles, contacte Morgane 06 70 11 59 48</div>\r\n<p></p>', NULL, 0, 'QG Orga', 3, 'non'),
(655, 28, 469, NULL, 'Débarrièrage Zone Nord', '<p>Retrouver Guerric (0604476430) sur le rond point au Nord de la piscine</p>Tomber le maximum de barrieres<br><br>Ranger les Héras proprement dans les rack (les alterner gauche/droite)<br>Ranger les plots sur les bonnes palettes<br>Faire des packs de 10 vaubans (alternées aussi)<br><p><br></p>', NULL, 0, 'Rond-point Nord de la piscine', 3, 'non'),
(656, 22, 399, NULL, 'Vérification Signa Concerts Samedi Soir', '<p><span class="Apple-tab-span" style="white-space:pre">	</span>La signa\r\n concert vient d''être mise ! Normalement, tout doit être en place... \r\nmais rien n''est moins sûr. Fait le tour de la ZC pour vérifier que tout \r\nest à poste!<br></p><ul><li>Vérifie qu''il te reste masse foutre de bricolage (colsons, clous, scotch, pince, grue....), sinon va en rechercher au QG Orga !<br></li><li>Vérifie\r\n que tout est bien en place dans les zones concerts, surtout les trucs \r\nimportants genre les banderoles Scène Nord et les affiches avec la prog à\r\n l''entrée.<br>Pour cela, suit le descriptif zone concert (qui se \r\ntrouvera soit au QG, soit sur toi étant donné que tu as posé la signa \r\nconcerts en fin d''après midi). Bricole et fais les modifications \r\nnécessaires.</li></ul><div><u>Remarque Pignole:</u>&nbsp;Si jamais tu croise un orga déprimée en route, paye ton saucisson, et rappelle lui que:</div><div><span class="Apple-tab-span" style="white-space:pre">		</span><i>"La joie de vivre et le jambon, il n''y a pas trente-six recettes du bonheur !"</i></div><div><br></div><div><strike>Si il est basané, qu''il aille se faire foutre.</strike>&nbsp;<b>Connard !</b></div>', NULL, 0, 'Tout partout', 3, 'non'),
(657, 22, 399, NULL, 'Gestion Signa fin de Concert Vendredi', '<p>La fin des concerts approche !! Et ba devine quoi ! Tu vas pas y assister... enfin de très loin et séquentiellement... Mais c''est mieux que rien, tu pourrais être à un point sécu, et ça, c''est pas très funky.<br></p><p>Et\r\n oui tu vas devoir gérer la signa en fin de concert : vérifier que tout \r\nest la et que personne n''a volé ou est en train de voler tes super banderoles (typiquement \r\nbanderoles près des bars et celle "Scène Nord")</p><ul><li>Si tu n''en a plus, muni toi de moult matériel de bricolage (clous, colsons, pinces, grues... ), et récupère un descriptif signa Vendredi Soir<br></li><li>Dirige toi vers la Zone Concert<br></li><li>Fait un tour de la signa zone concert (cf. descriptif)</li><li>Vérifie que tout est bien en place<br></li><li>Si tu vois des anomalies utilise ton kit pour y remédier</li><li>Fais les démarches que tu juge utiles (tu es l''orga signa c''est pas pour rien !)</li><li>Une\r\n fois que tout le monde est parti, si tu as la foi ramène les trucs qui \r\nsont plus à jour (programmes à l''entrée par exemple) et range ton kit et\r\n ce que tu as récolté au QG</li></ul><br><u>Remarque Pignole:</u> Il est bientôt 4h voir 4h30 !! Soit tu files à ta prochaine tâche, soit tu vas dormir !! Rappelle toi que quand tu as écris cette fiche tâche, tu as beaucoup rigolé quand tu as vu les horraires. Tu t''es pris pour un bonhomme, mais la tu dois te haïr. Perdu.<br><br><i>"Les conneries c''est comme les impôts, tu finis toujours par les payer"</i><br><p></p>', NULL, 0, 'QG Orga', 3, 'non'),
(658, 22, 399, NULL, 'Gestion Signa fin de Concert Samedi', '<p>La fin des concerts approche !! Et ba devine quoi ! Tu vas pas y \r\nassister... enfin de très loin et séquentiellement... Mais c''est mieux \r\nque rien, tu pourrais être à un point sécu, et ça, c''est pas très funky.<br></p><p>Et\r\n oui tu vas devoir gérer la signa en fin de concert : vérifier que tout \r\nest la et que personne n''a volé ou est en train de voler tes super banderoles (typiquement \r\nbanderoles près des bars et celle "Scène Nord")</p><ul><li>Si tu n''en a \r\nplus, muni toi de moult matériel de bricolage (clous, colsons, pinces, \r\ngrues... ), et récupère un descriptif signa Samedi Soir<br></li><li>Dirige toi vers la Zone Concert<br></li><li>Fait un tour de la signa zone concert (cf. descriptif)</li><li>Vérifie que tout est bien en place<br></li><li>Si tu vois des anomalies utilise ton kit pour y remédier</li><li>Fais les démarches que tu juge utiles (tu es l''orga signa c''est pas pour rien !)</li><li>Une\r\n fois que tout le monde est parti, si tu as la foi ramène les trucs qui \r\nsont plus à jour (programmes à l''entrée par exemple) et range ton kit et\r\n ce que tu as récolté au QG</li></ul><br><u>Remarque Pignole:</u> Il est\r\n bientôt 4h voir 4h30 !! Soit tu peux aller dormir, soit tu files tout de suite à une autre tâche qui n''aura rien à voir avec la signa !!\r\n Rappelle toi que quand tu as écris cette fiche tâche, tu as beaucoup \r\nrigolé quand tu as vu les horaires. Tu t''es pris \r\npour un bonhomme, mais la tu dois te haïr. Perdu.<br><br><i>"Les conneries c''est comme les impôts, tu finis toujours par les payer"</i>', NULL, 0, 'Tout partout', 3, 'non'),
(659, 210, 484, NULL, 'Tout est rangé ?', '<ul>\r\n<li>Va sur la pelouse des humas et vérifie que les anims qui devraient être rangées, sont effectivement rangées !&nbsp;</li></ul>Liste des anims Q sur les humas:\r\n<ol>\r\n<li>cirque/jonglage</li>\r\n<li>hula-hoop&nbsp;</li>\r\n<li>maquillage&nbsp;</li>\r\n<li>salon urbain &nbsp;OU street art</li>\r\n<li>12H de danse (vérifier qu''on a bien rangé la sono !)</li>\r\n<li>jeu de dames&nbsp;</li>\r\n<li>Podium Mde (vérifier qu''on a bien rangé la sono !)</li>\r\n<li>Rivière du doute, débat dans l''herbe.</li>\r\n<li>Percussions africaines</li>\r\n<li>jeu de dames</li></ol>Si c''est pas le cas, ranges les anims dans le dépôt Humas et contacte Morgane au 06 70 11 59 48<br><ul><li>Vérifie que la salle René Char (rotonde) + salle de Chouille (escalier qui descend derrière la&nbsp;Kfet)&nbsp;+ le Grillon sont fermés.<br></li></ul>\r\n<div>Si c''est pas le cas, contacte Morgane au 06 70 11 59 48</div>\r\n<p><br></p>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(660, 22, 399, NULL, 'Pose Signa Journée Dimanche', '<p>Boooonsoir ! Il est 6h00 du matin, ou du soir si tu n''as pas dormis.&nbsp;<br></p><ul><li>Rendez vous avec le resp signa (SGM: 06 48 25 51 18) au QG Orga.</li><li>Demander à l''humain les clés du 11m3, et récupérer le descriptif de la signa journée du dimanche.</li><li>Prends masse colsons/scotch/clous, et ton 11m3</li><li>Mets dans le coffre du 11m3 toute la signa qu''il faut mettre (renseignée dans le descriptif).</li><li>N''oublies pas les blocs de bétons archi lourd pour faire tenir les plan. Ça te rappellera tes tâches de barrierage.</li><li>Enfourche ton 11m3 et roule jusqu''aux différents endroits où tu dois mettre la signa</li><li>Évite\r\n d''écraser les orgas et les SDF. En cas de collision, ne surtout pas \r\nprévenir le PC sécu, ramasser le corps et le mettre dans le coffre du 11m3. Annuler toutes les tâches suivantes et essayer de faire disparaître\r\n les corps.</li><li>Une fois que toute la signa est installée, retourne au QG.</li><li>Rends les clés à l''humain</li></ul><div><u>Remarque Pignole</u>: Il est tôt, il fait faim. Pour le petit déjeuner, boire un grand verre d''huile d''arachide.<br><br></div><div><i>"De l''hypolipidémie, J''ai plus de gras dans le sang. Je vais me mettre à peler et à perdre mes cheveux."</i></div>', NULL, 0, 'Tout partout', 3, 'non'),
(661, 32, 420, NULL, 'Gestion du point/caisse info vendredi', '<p>- Rends-toi au niveau des caisses de l''entrée <br>- Prends possession de ton poste (caisse n°9, deuxième module Algeco, fenêtre sur le côté), au pire demande à Clara (06 31 41 42 82)<br>-Ton job est de gérer les conflits : en gros, tous les gens qui ont des problèmes/demandes particulières aux caisses ou aux contrôles d''accès seront aiguillés vers toi :) <br>-Le plus gros consistera à entrer à la main les codes barres qui ne passeraient pas les contrôles d''accès à l''aide d''un scanner<br>- Si tu as le moindre problème, appelle Clara (tel ou talkie), elle sera par là !<br></p>', 'une douchette (scanner)', 0, 'Devant l&amp;amp;amp;amp;amp;amp;amp;#039;AIP', 3, 'non'),
(662, 32, 420, NULL, 'Gestion du point/caisse info samedi', '<p>- Rends-toi au niveau des caisses de l''entrée <br>- Prends possession de\r\n ton poste (caisse n°9, deuxième module Algeco, fenêtre sur le côté), au\r\n pire demande à Clara (06 31 41 42 82)<br>-Ton job est de gérer les \r\nconflits : en gros, tous les gens qui ont des problèmes/demandes \r\nparticulières aux caisses ou aux contrôles d''accès seront aiguillés vers\r\n toi :) <br>-Le plus gros consistera à entrer à la main les codes barres qui ne passeraient pas les contrôles d''accès à l''aide d''un scanner<br>- Si tu as le moindre problème, appelle Clara (tel ou talkie), elle sera par là ! </p>', 'Une douchette (scanner)', 0, 'Devant l&amp;amp;amp;amp;amp;amp;amp;amp;#039;AIP', 3, 'non'),
(663, 212, 485, NULL, 'accueil de l''asso', '<p>- Rends toi sur le parking à côté de l''olivier derrière le bâtiment coulomb (c''est celui entre GCU et le bâtiment des Humas)</p><p>- Dire bonjour aux mecs du drift trikes</p><div><br></div><div>- Vérifier qu''ils ont tout pour la sécurité (casque, pneu)</div><div><br></div><div>- Leur donnez les fiches de sécurité à afficher sur les vaubans</div><div><br></div><div><br></div><p></p>', NULL, 0, 'Parking Eiffel', 3, 'non'),
(664, 212, 485, NULL, 'installation drift trikes', '<p>- Va chercher 10 vaubans au dépôt derrière la kfet &nbsp;et du scotch et de la rubalise au QG de l''ambiance<br></p>\r\n<p>- Va chercher une table (2 places) et deux chaises au dépôt Humas</p>\r\n<div>- amène tout ca (en plusieurs voyages) sur le parking à côté de l''olivier, derrière le bâtiment coulomb<br></div>\r\n<div><br></div>\r\n<div>- Aide les mecs de l''asso à installer leur pneu&nbsp;</div>\r\n<div><br></div>\r\n<div>- Scotche les fiches de sécu sur les vaubans&nbsp;</div>\r\n<div><br></div>\r\n<div>En cas de problème : Constant 06 82 82 41 26</div>\r\n<div><br></div>\r\n<div><br></div>\r\n<p></p>', NULL, 0, 'Parking Eiffel', 3, 'non'),
(665, 212, 485, NULL, 'animation drift trikes', '<p>- Rends toi sur le parking à côté de l''olivier derrière le bâtiment coulomb</p><p>- Fais toi briefer par les mecs de l''asso</p><div><br></div><div>- Lis les règles de sécurité qui sont affichées sur les vaubans et renseigne les gens.&nbsp;<br><div><br></div><div>- Occupe toi de la file d''attente.</div></div><div><br></div><div>- Fais gaffe à ce que les curieux qui regardent ne pètent pas la rubalise ( ils ont le droit d''être là, ne les jarte pas mais si tu dois remettre de la rubalise toutes les 5 minutes ça va être chiant pour toi ;) )</div><div><br></div><div>- &nbsp;Fais attention à ce que personne ne rentre sur la zone pendant que quelqu''un est en train de déraper</div><div><br></div><div>- Attends que la relève arrive avant de partir.&nbsp;</div><div><br></div><div>- S''ils sont à court de batterie pour leur véhicule, reste avec eux pour renseigner les gens qui demandent des renseignements et pour pas que ce soit le bordel sur le stand</div><div><br></div><div>En cas de problème : Constant 06 82 82 41 26</div><p></p>', NULL, 0, 'Parking Eiffel', 3, 'non'),
(666, 352, 445, NULL, 'Gestion Diverse BA Jeudi 22', '<p>Ca fait 4 jours que la BA a commencé... il faut faire comme d''hab quoi.</p>', NULL, 0, 'MdE', 3, 'non'),
(667, 212, 485, NULL, 'rangement drift trikes', '<p>- Rends toi sur le parking à côté de l''olivier derrière le bâtiment coulomb</p>\r\n<p>- Ramène les vaubans au dépôt derrière la kfet</p>\r\n<p>- Ramène les pneus au même endroit que les vaubans</p>\r\n<p>- Ramène la table et les chaises au dépôt Humas</p>\r\n<div>- Ramasse la rubalise qui traîne par terre</div>\r\n<div><br></div>\r\n<div>- Récupère les fiches de consigne qui sont sur les vaubans et ramène les au QG de l''ambiance</div>\r\n<div><br></div>\r\n<div><br></div>\r\n<p></p>', NULL, 0, 'Parking Eiffel', 3, 'non'),
(668, 352, 445, NULL, 'Gestion Diverse BA Vendredi 23', '<p>Gestion de la BA</p>', NULL, 0, 'MdE', 3, 'non'),
(669, 352, 445, NULL, 'Gestion Diverse BA Samedi 24', '<p>Comme d''hab, gérer la BA : Cuisiner, Servir, Nettoyer...</p>', NULL, 0, 'MdE', 3, 'non'),
(670, 197, 486, NULL, 'Barrièrage ciné plein air', '<p>Se rendre sur à côté de la piscine pour y retrouver Tiffany &nbsp;(Numéro au dessus), elle vous dira quoi faire.</p><p>Appeler Ron : 06 70 45 68 23 pour qu''il vienne vous chercher avec son super 20m3<br><br>Aller chercher 65 vaubans .<br><br>Les mettre en place autour de l''écran et du matos,<br><br>Bien vérifier que les barrières sont enclenchées avant de partir</p><p>Pense à prendre des gants si tu en as c''est plus agréable ;)</p>', '20m3', 2, 'devant la piscine', 3, 'non (raf)'),
(671, 23, 487, NULL, 'Aller en partiel de CSM', '<p>Prends ton cartable, ta calculette et tes cours et vas passer ton partiel de CSM</p><div>Essaie de ne pas t''endormir et de rester au moins une heure.&nbsp;</div><div><br></div><div>Rendez-vous au rattrapage !&nbsp;</div><p></p>', 'Calculette\r\nCrédibilité\r\nStylo', 0, 'GMD', 3, 'raf'),
(672, 31, 486, NULL, 'Barrièrage Feu d''artifice', '<p>Viens transformer le Nord Est et l''Avenue des Art en Feu d''artifice :</p>\r\n<p>Retrouver Ron au QG orga, n''hésite pas à demander autour de toi où il se trouve.<br><br>Prendre les clefs d''un 20m3<br><br>Aller chercher les 61 barrières sur le N-Est&nbsp; du circuit des courses, plus les barrières au point de dépot N-Est.<br><br>Barrièrer le stade d''où sera tiré le feu d''artifice sur toute la longueur tel que ceci: Un carré de vauban, 3 vaubans, un carré, 3 vaubans, etc... (environ 142 vaubans)<br><br>Compléter avec les vaubans de l''avenue des arts.</p>\r\n<p><u>petit plus pour ton créneau</u></p>\r\n<p>Prend des gants pour pas te pourrir les mains, Ron en aura peut être mais surement pas pour tout le monde ...</p>\r\n<p><br>Aller rendre les clefs au QG</p>', 'Tes bras et ta bonne humeur', 0, 'QG orga', 3, 'non'),
(673, 352, 445, NULL, 'Gestion Diverse BA Dimanche 25', '<p>Idem autres jours</p>', NULL, 0, 'MdE', 3, 'non'),
(674, 352, 445, NULL, 'Gestion Diverse BA Lundi 26', '<p>Ce n''est pas fini... Grand retour des teckos à nourrir</p>', NULL, 0, 'MdE', 3, 'non'),
(675, 352, 445, NULL, 'Gestion Diverse BA Mardi 27', '<p>Derniers repas / Début rangement sérieux</p>', NULL, 0, 'MdE', 3, 'non'),
(676, 352, 445, NULL, 'Gestion Diverse BA Mercredi 28', '<p>Fin du rangement / Départ</p>', NULL, 0, 'MdE', 3, 'non'),
(677, 21, 338, NULL, 'Ramener les tables à l''AIP', 'Retrouve Cetelem au QG orga<div>Demande la clef de Bradley le 20m3</div>', NULL, 0, 'QG Orga', -1, 'non'),
(678, 45, 307, NULL, 'S''occuper entre ma tâche du matin et ma tâche du soir', '<p>Voilà voilà... tout est dit. Il fait beau il fait chaud et la journée passe tranquillement...</p><p>(Et sinon : suivi du montage structure avec Gilles, implantation des bars, de la PMR, des arches d''entrée, de la régie, de la petite scène, de la régie petite scène, mise en place d''un parking teckos + artistes, implantation des préloges petite scène, organisation de la cabane au fond du jardin, etc.)<br></p>', NULL, 0, 'Grande scène', 3, 'non'),
(679, 45, 307, NULL, 'Accueillir Concert Systèmes', '<p>Bon bah voilà, concert systèmes est censé arriver pendant la matinée. En parallèlle il faut encadrer le montage des bars. Quand CS est là, dire bonjour à tout le monde, se présenter à l''équipe et fournir des bras pour décharger tout le bordel.</p>', 'Casques de chantier', 0, 'Grande scène', 3, 'raf'),
(680, 45, 307, NULL, 'Finaliser le montage', '<p>Caler avec CS la fin du montage light et son.</p><p>Organiser le plateau</p><p>S''organiser avec le RP.</p><p>Gérer le montage des arches d''entrée.</p><p>Etc.<br></p><p></p>', NULL, 0, 'Devant la Grande scène', 3, 'non'),
(681, 45, 307, NULL, 'Montage light & son GS', '<p>Blank</p><p></p>', NULL, 0, 'Devant la grande scène', -1, 'non'),
(682, 45, 307, NULL, 'GPRGSTDMMTHLBA', '<p>Gestion des Problématiques Relatives à la Grande Scène et à Tout ce qui en Découle de Manière Musicale, Technique, Humaine et Logistique, et tout ça dans la Bonne Ambiance.</p><p>Voilà voilà, on fait la job quoi !</p>', NULL, 0, 'Grande scène', 3, 'non'),
(683, 13, 461, NULL, 'Installer les chaises', '<p></p><div>Rends-toi au Qg Orga pour retrouver tes co-tâches. <br><br>Récupère les chaises devant l''AIP, Alexis les amène en 20m3.</div><div>Installe\r\n les chaises derrières les bars. Il en faut 1 derrière chaque caisse de chaque bar. &nbsp;</div><div><br></div><div>Nombre de chaise par bar :</div><div>1/ bar sauf AIP et Cétiat où il y en a 2 = 8 chaises en tout à placer</div><div><br></div><div>S''il y a un soucis appelle un des orga Bars :</div><div><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bruce Louis 07 86 85 59 21 / Choppy </span><span style="font-size: 13px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">&nbsp;</span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">06 67 12 02 16</span><br></div><p></p>', NULL, 0, 'QG Orga', 3, 'non'),
(684, 14, 343, NULL, 'Contrôle Socotec', '<p>attendre l''appel du mec de la socotec (<a href="tel:06%2015%2059%2070%2021" value="+33615597021" target="_blank" style="color: rgb(17, 85, 204); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">06 15 59 70 21</a><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">&nbsp;Thierry Parrassin)</span></p><div>appelle les électriciens de la Dirpat s''ils ne sont pas encore là (<span style="background-color: rgb(255, 255, 255); font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap;">Accary Christophe </span><span style="background-color: rgb(255, 255, 255); font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap;">06 72 25 09 57)</span></div><div><br></div><div>Ta mission va être de faire le tour de tous les transfo electrique (avec le mec de la socotec et de la dirpat qui ont toutes les clés). Pense bien à noter toutes ses remarques pour philty après.</div><div>Une fois tout le tour fait, philty doit nous rejoindre pour faire cette fois le tour des installation électrique.</div><div><br></div><div>Une fois le contrôle terminé le mec va signer un papier, il faut le donner immédiatement à cheval qui l’enverra à la mairie de Villeurbanne dans l''aprem</div><p></p>', NULL, 0, 'Devant direction', 3, 'non'),
(685, 16, 384, NULL, 'PS6 : Installation', '<ol><li>&nbsp;Rendez vous au QG Orga.<br></li><li>Retrouve ton co-orga.<br></li><li>Demande à l''Humain de vous donner des gilets jaunes et un talkie.<br></li><li>Rends toi au PS6&nbsp; (A l''Ouest du campus sur le boulevard du 11 novembre)&nbsp;</li><li>Prends les quelques barrière sur place de sorte à ne laisser passer que les voitures qui souhaitent sortir du campus.</li><li>Demande l''humain et préviens au talkie que tu es bien à poste<br></li></ol><p>Ta mission :&nbsp;Assurer la sécurité du festival et des courses en ne laissant passer aucun véhicule excepté&nbsp;:</p><ul><li>Les véhicules des secours (Pompiers, Police, etc..)<br></li><li>Les véhicules muni d''un passe sécu&nbsp;<u>pour le PS6</u></li></ul>Un exemple de pass sécu et l''autorisation de fermeture du campus sont disponible sur place.<br><div><br></div><div><div>En\r\n cas de problème / de doute demande le responsable sécurité au \r\nTalkie.&nbsp;N''hésite pas à prévenir de tout comportement anormaux. Si le \r\ntalkie ne passe pas téléphone au 06.59.90.44.19.<br>En cas d''urgence appel directement le PC sécu : 04.72.43.70.70</div><div>Reste bien à l''écoute de ce qui est dit au talkie cela te concerne peut être.</div></div><div><br></div><div><b><u>IMPORTANT :</u></b></div><div><ul><li><b><u>NE TE MET PAS EN DANGER (si le mec est un peu aigri laisse le&nbsp;tâter&nbsp;de la vauban et écarte toi)</u></b><br></li><li><b><u>NE QUITTE PAS TON POSTE TANT QUE LES SUIVANTS NE SONT PAS ARRIVES</u></b><br></li></ul><div><b><u><br></u></b></div></div><div>En cadeau voici les paroles de Petit Poney &nbsp;:</div><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">[Refrain]<br>Petit poney, petit poney, tu es tout gris et tout petit, petit poney, petit poney.<br>Petit poney, petit poney, tu es tout gris et tout petit, petit poney, petit poney.</p><div><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">Petit poney, petit poney, tu gambades dans les prés sans te soucier du temps qui passe, petit poney, petit poney<br>La nuit qui tombe sur le pré c''est aussi ça la vie qui passe, petit poney, petit poney.</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">[Refrain]</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">Tu gambades dans les prés sans te soucier du temps qui passe, petit poney, petit poney<br>La nuit qui tombe sur le pré c''est aussi ça la vie qui passe, petit poney, petit poney</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">[Refrain] (x3)</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">Tu gambades dans les prés sans te soucier du temps qui passe, petit poney, petit poney<br>La nuit qui tombe sur le pré c''est aussi ça la vie qui passe, petit poney, petit poney</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">[Refrain]</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">Tu gambades dans les prés sans te soucier du temps qui passe, petit poney, petit poney<br>Et puis un jour un loup arrive avec 3 feuilles de salades il va manger le quadrupède.</p><p style="margin: 5px 0px; padding: 5px 0px; text-align: justify; color: rgb(51, 51, 0); line-height: 15px; font-family: Verdana; font-size: 11px;">[Refrain] (x2)</p></div>', 'Du charisme', 0, 'Campus', 3, 'raf'),
(686, 16, 384, NULL, 'PS6 : Point Sécu', '<ol><li>Rends toi au PS6&nbsp; (A l''ouest du campus sur le boulevard du 11 novembre)&nbsp;</li><li>Récupère le gilet jaune et le talkie de l''équipe précédente</li><li>Demande l''Humain&nbsp;et préviens que tu es bien en poste</li></ol><div>Ta mission : Assurer la sécurité du festival et des courses en ne laissant entrer aucun véhicule excepté :<br></div><ul><li>Les véhicules des secours (Pompiers, Police, etc..)<br></li><li>Les véhicules munis d''un pass sécu&nbsp;<u>pour le PS6</u></li></ul><div>Un exemple de pass sécu et l''autorisation de fermeture du campus sont disponibles sur place.<br><br></div><div>En\r\n cas de problème / de doute demande le responsable sécurité au \r\nTalkie.&nbsp;N''hésite pas à prévenir de tout comportement anormaux. Si le talkie bip demande qu''on t''amène une batterie.<br>Si le talkie ne passe pas téléphone au 06.59.90.44.19 ou au 06.76.99.09.64<br>En cas d''urgence appelle directement le PC sécu : 04.72.43.70.70</div><div>Reste bien à l''écoute de ce qui est dit au talkie cela te concerne peut être.</div><div><br></div><div><b><u>IMPORTANT :</u></b></div><div><ul><li><b><u>NE TE MET PAS EN DANGER (si le mec est un peu aigri laisse le&nbsp;tâter&nbsp;de la vauban et écarte toi)</u></b><br></li><li><b><u>NE QUITTE PAS TON POSTE TANT QUE LES SUIVANTS NE SONT PAS ARRIVES</u></b><br></li></ul><div><b><u><br></u></b></div></div><div>En cadeau voici les paroles de suce ma bite pour la saint valentin by Orelsan &nbsp;:</div><p style="margin: 5px 0px; padding: 5px 0px;"><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">J''laisse la lumière allumée, et j''garde mes chaussettes</span><br style="text-align: left;"><span style="text-align: left;">J''vais la limer jusqu''à c''qu''elle soit couchée et qu''elle voie des clochettes</span><br style="text-align: left;"><span style="text-align: left;">J''adore les p''tites coquines avec des couettes et des fossettes</span><br style="text-align: left;"><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">J''te rends misérable, tes copines vont t''appeler "Cosette"</span><br style="text-align: left;"><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">J''ai des positions inconnues pour que tu goûtes au vrai bonheur</span><br style="text-align: left;"><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Parce que j''me branle sur Canal +, et j''ai jamais eu l''décodeur</span><br style="text-align: left;"><span style="text-align: left;">Dès le lendemain matin, elles en redemandent, se mettent a trépigner</span><br style="text-align: left;"><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Mais ferme ta gueule, ou tu vas t''faire Marie-Trintigner</span><br style="text-align: left;"><span style="text-align: left;">J''te l''dis gentiment : j''suis pas là pour faire de sentiments</span><br style="text-align: left;"><span style="text-align: left;">J''suis là pour te mettre vingt-et-un centimètres</span><br style="text-align: left;"><span style="text-align: left;">Tu seras ma petite chienne et je serai ton gentil maître</span><br style="text-align: left;"><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">J''ai une main sur la chatte, une sur un sein, et j''deviens ambidextre</span><br style="text-align: left;"><span style="text-align: left;">J''t''prends en vitesse, en finesse, j''t''offre une pilule anti-stress</span><br style="text-align: left;"><span style="text-align: left;">Excuse-moi miss, laisse-moi dégrader tes p''tites fesses</span><br style="text-align: left;"><span style="text-align: left;">On fait notre business en toute discrétion : j''en parlerai pas</span><br style="text-align: left;"><span style="text-align: left;">J''te jure qu''on t''verra pas à la caméra</span><br style="text-align: left;"><span style="text-align: left;">J''te ferai l''coup d''la panne, et j''t''emmènerai dans les bois</span><br style="text-align: left;"><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Avant l''amour, je serai romantique et j''te mettrai des doigts</span><br style="text-align: left;"><span style="text-align: left;">J''bois, baise, jusqu''à c''que t''en sois mal en point</span><br style="text-align: left;"><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Je t''aime : suce ma bite pour la Saint-Valentin !</span><br style="text-align: left;"><br style="text-align: left;"><span style="text-align: left;">[Refrain x2]</span><br style="text-align: left;"><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">J''aime pas trop les 14 Février</span><br style="text-align: left;"><span style="text-align: left;">Tout l''temps seul à force de m''faire griller</span><br style="text-align: left;"><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">J''te tèj'' la veille, et j''te rebaise le lendemain</span><br style="text-align: left;"><span style="text-align: left;">Suce ma bite pour la Saint-Valentin</span><br></p>', 'Du charisme', 0, 'Campus', 3, 'non (raf)'),
(687, 16, 384, NULL, 'PS6 : Désinstallation', '<p></p><ol><li>Rends toi au PS6&nbsp; (A l''Ouest du campus sur le boulevard du 11 novembre)&nbsp;</li><li>Récupère le gilet jaune et le talkie de l''équipe précédente</li><li>Demande l''humain au talkie et préviens que tu es bien en poste.</li></ol><div>Ta mission : Assurer la sécurité du festival et des courses en ne laissant passer aucun véhicule excepté :<br></div><ul><li>Les véhicules des secours (Pompiers, Police, etc..)<br></li><li>Les véhicules munis d''un pass sécu&nbsp;<u>pour le PS6</u></li></ul><div>Un exemple de pass sécu et l''autorisation de fermeture du campus sont disponibles sur place.<br></div><div><br></div>En\r\n cas de problème / de doute demande le responsable sécurité au \r\nTalkie.&nbsp;N''hésite pas à prévenir de tout comportement anormaux. Si le talkie bip demande qu''on t''amène une batterie.<br>Si le talkie ne passe pas téléphone au 06.59.90.44.19 ou au 06.76.99.09.64<div>En cas d''urgence appelle directement le PC sécu : 04.72.43.70.70</div><div>Reste bien à l''écoute de ce qui est dit au talkie cela te concerne peut être.</div><div><br></div><div>A la fin de ta tache Dimanche à minuit:</div><div><ol><li>Préviens au talkie que tu va partir</li><li>Ouvre le passage en poussant les barrières sur la coté de la route.&nbsp;<br></li><li>Rentre au QG.<br></li><li>Dépose ton talkie et les gilets<br></li></ol></div><div><br></div><div><b><u>IMPORTANT :</u></b></div><div><ul><li><b><u>NE TE MET PAS EN DANGER (si le mec est un peu aigri laisse le&nbsp;tâter&nbsp;de la vauban et écarte toi)</u></b></li></ul><div><b><u><br></u></b></div></div><div><b><u>En bonus les paroles de suce ma bite pour la saint valentin by orelsan :&nbsp;</u></b></div><div><b><u><br></u></b></div><div><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">J''laisse la lumière allumée, et j''garde mes chaussettes</span><br>J''vais la limer jusqu''à c''qu''elle soit couchée et qu''elle voie des clochettes<br>J''adore les p''tites coquines avec des couettes et des fossettes<br><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">J''te rends misérable, tes copines vont t''appeler "Cosette"</span><br><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">J''ai des positions inconnues pour que tu goûtes au vrai bonheur</span><br><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Parce que j''me branle sur Canal +, et j''ai jamais eu l''décodeur</span><br>Dès le lendemain matin, elles en redemandent, se mettent a trépigner<br><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Mais ferme ta gueule, ou tu vas t''faire Marie-Trintigner</span><br>J''te l''dis gentiment : j''suis pas là pour faire de sentiments<br>J''suis là pour te mettre vingt-et-un centimètres<br>Tu seras ma petite chienne et je serai ton gentil maître<br><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">J''ai une main sur la chatte, une sur un sein, et j''deviens ambidextre</span><br>J''t''prends en vitesse, en finesse, j''t''offre une pilule anti-stress<br>Excuse-moi miss, laisse-moi dégrader tes p''tites fesses<br>On fait notre business en toute discrétion : j''en parlerai pas<br>J''te jure qu''on t''verra pas à la caméra<br>J''te ferai l''coup d''la panne, et j''t''emmènerai dans les bois<br><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Avant l''amour, je serai romantique et j''te mettrai des doigts</span><br>J''bois, baise, jusqu''à c''que t''en sois mal en point<br><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">Je t''aime : suce ma bite pour la Saint-Valentin !</span><br><br>[Refrain x2]<br><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">J''aime pas trop les 14 Février</span><br>Tout l''temps seul à force de m''faire griller<br><span style="-webkit-tap-highlight-color: rgb(255, 255, 255);">J''te tèj'' la veille, et j''te rebaise le lendemain</span><br>Suce ma bite pour la Saint-Valentin<br></div><p></p>', NULL, 0, 'Campus', 3, 'non'),
(688, 23, 364, NULL, 'Tâche sans nom', 'nn', NULL, 0, 'Grande scène!', -1, 'non'),
(689, 210, 488, NULL, 'Accueillir les assos', '<p></p><div><ul><li>Accueillir l''asso de danse qui va monter sur le podium des Humas.<br></li><li>A la fin du spectacle en cours, demander comment s''est passé la performance.</li><li>Aide l''asso qui va monter sur le podium à s''installer (sono)</li></ul>S''il y a un problème, appelle &nbsp;Morgane au 06 70 11 59 48<br><div><br></div><div>Planning :</div></div><div><table dir="ltr" style="table-layout:fixed;font-size:13px;font-family:arial,sans,sans-serif;border-collapse:collapse;border:1px solid #ccc" cellpadding="0" cellspacing="0" border="1"><colgroup><col width="94"><col width="132"><col width="36"><col width="120"><col width="120"></colgroup><tbody><tr style="height:17px;"><td style="padding: 0px 3px; background-color: rgb(0, 0, 0); font-size: 100%; font-weight: bold; vertical-align: bottom; overflow: hidden; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: rgb(0, 0, 0); direction: ltr; color: rgb(255, 255, 255); text-align: center;" rowspan="1" colspan="2">Samedi 24 mai 2014</td><td style="padding: 0px 3px; background-color: white; font-size: 100%; vertical-align: bottom; overflow: hidden;"></td><td style="padding: 0px 3px; background-color: rgb(0, 0, 0); font-size: 100%; font-weight: bold; vertical-align: bottom; overflow: hidden; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: rgb(0, 0, 0); direction: ltr; color: rgb(255, 255, 255); text-align: center;" rowspan="1" colspan="2">Dimanche 25 mai 2014</td></tr><tr style="height:17px;"><td style="padding: 0px 3px; background-color: rgb(207, 226, 243); font-size: 100%; vertical-align: bottom; overflow: hidden; direction: ltr; border-left-width: 1px; border-left-style: solid; border-left-color: rgb(0, 0, 0);">12h30 - 14h00</td><td style="padding: 0px 3px; background-color: white; font-size: 100%; vertical-align: bottom; overflow: hidden; border-right-width: 1px; border-right-style: solid; border-right-color: rgb(0,