d-color: rgb(207, 226, 243); font-size: 100%; vertical-align: bottom; overflow: hidden; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: rgb(0, 0, 0); direction: ltr; border-left-width: 1px; border-left-style: solid; border-left-color: rgb(0, 0, 0);">17h00 - 18h30</td><td style="padding: 0px 3px; background-color: white; font-size: 100%; vertical-align: bottom; overflow: hidden; border-right-width: 1px; border-right-style: solid; border-right-color: rgb(0, 0, 0); border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: rgb(0, 0, 0); direction: ltr;">Club Rock</td><td style="padding: 0px 3px; background-color: white; font-size: 100%; vertical-align: bottom; overflow: hidden; border-right-width: 1px; border-right-style: solid; border-right-color: rgb(0, 0, 0);"></td><td style="padding: 0px 3px; background-color: rgb(207, 226, 243); font-size: 100%; vertical-align: bottom; overflow: hidden; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: rgb(0, 0, 0); direction: ltr;">17h00 - 18h30</td><td style="padding: 0px 3px; background-color: white; font-size: 100%; vertical-align: bottom; overflow: hidden; border-right-width: 1px; border-right-style: solid; border-right-color: rgb(0, 0, 0); border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: rgb(0, 0, 0); direction: ltr;">Ragda</td></tr></tbody></table></div><p></p>', NULL, 0, 'Podium Humas', 3, 'non'),
(690, 45, 308, NULL, 'Installer la porte d''entrée des 24h', '<p>Et ouai mec !</p><div>Tu veux connaître les 5 p**ain de bonnes raisons pour aller voir Hermione (grand con vers la scène ou dans un manitou) au début de ta tâche ?</div><div><ul><li>5 : Il te donnera des chaussures de sécu</li><li>4 : Il te donnera des gants</li><li>3 : Il te donnera un casque de chantier</li><li>2 : Lui seul connaît le secret du montage des arches d''entrée des 24h</li><li>1 : Avec un peu de chance tu pourra bouffer au restaurant artistes</li></ul><div>Rendez-vous vers la grande scène des 24h. Demande Hermion (ou Thomas) et tout ira bien !</div></div>', NULL, 0, 'ZC', 3, 'non'),
(691, 45, 308, NULL, 'Dé-piliers de comptoir', '<p>Viens sur la ZC, trouve Hermione (le mec bizarre qui déteste tout le monde et qui conduit le manitou), il te donnera des chaussures de sécu (si tu n''en a pas), un casque de chantier (si tu n''en a pas), des gants (si tu n''en a pas) et il te prêtera du charisme (si tu n''en a pas).</p><div><br></div><div>Il t''expliquera tout ce qu''il attend de toi !</div><div><br></div><div>Le but de la journée est de démonter la structure de tous les bars des 24h, et ça c''était du charisme !</div>', NULL, 0, 'ZC', 3, 'non'),
(692, 45, 308, NULL, 'Désinstaller la porte d''entrée des 24', '<p>Et ouai mec !</p><div>Tu veux connaître les 5 p**ain de bonnes raisons pour aller voir Hermione (grand con vers la scène ou dans un manitou) au début de ta tâche ?</div><div><ul><li>5 : Il te donnera des chaussures de sécu</li><li>4 : Il te donnera des gants</li><li>3 : Il te donnera un casque de chantier</li><li>2 : Lui seul connaît le secret du démontage des arches d''entrée des 24h</li><li>1 : Avec un peu de chance tu pourra bouffer au restaurant artistes</li></ul></div>', NULL, 0, 'ZC', 3, 'non'),
(693, 45, 308, NULL, 'Reprise manitous', '<p>Les deux manitous de la 40ème repartent et avec eux leur lot de charisme ! Viens vers le livreur&nbsp;aux commandes de ces petits bolides pour aller les garer vers la camion en klaxonnant à fond avec le gyrophare et les feux à fond, les pales en l''air en gueulant "on est chez nous !".&nbsp;Va voir le monsieur qui les récupère, donnes-lui les clés sauvagement!"</p>', NULL, 0, 'ZC', -1, 'non'),
(694, 45, 308, NULL, 'Superviser le montage de la ZC', '<p>Monter les bars, monter la PMR, monter les arches, conduire le manitou, gérer les teckos, contrôler l''avancement de la scène, bouffer à la BA, s''assurer que les gardiennages sont en place, etc. </p><div><br></div><div>Bref. Etre le king (mais moins que les humains &lt;3)</div><p></p>', 'Casques de chantier', 0, 'ZC', 3, 'non'),
(695, 45, 308, NULL, 'Superviser le démontage de la ZC', '<p>Démonter les bars, démonter la PMR, démonter les arches, conduire le manitou, gérer les teckos, bouffer à la BA, s''assurer que les gardiennages sont en place, etc.</p><div><br></div><div>Bref. Etre le king (mais moins que les humains &lt;3)</div>', 'Casques de chantier', 0, 'ZC', 3, 'non'),
(696, 45, 308, NULL, 'Installer les crash barrières', '<p>RDV vers la grande scène.</p><div><br></div><div>Trouves Hermione (Responsable technique scènes qui traîne par là) qui te remettra tes équipements de sécurité et tes outils pour que tu ais l''air d''un con avec tes chaussures et tes gants mais que tu sois prêt à affronter tous les dangers qui s''offrent à toi.</div><div><br></div><div>Le but de l''opération est d''installer toutes les crash barrières des deux scènes pour empêcher les rotis d''être pénibles pendant la soirée et de monter sur scène.</div><p></p>', NULL, 0, 'Grande scène', 3, 'non'),
(697, 45, 308, NULL, 'Désinstaller les crash barrières', '<p>RDV vers la grande scène.</p><div><br></div><div>Trouves Hermione (Responsable technique scènes qui traîne par là) qui te remettra tes équipements de sécurité et tes outils pour que tu ais l''air d''un con avec tes chaussures et tes gants mais que tu sois prêt à affronter tous les dangers qui s''offrent à toi.</div><div><br></div><div>Le but de l''opération est de désinstaller toutes les crash barrières des deux scènes qui ont empêché les rotis d''être pénibles pendant la soirée et de monter sur scène.</div><div><br></div><div>Bonus si tu kiffes la boue !</div>', NULL, 0, 'ZC', 3, 'non'),
(698, 45, 307, NULL, 'Suivi montage light et son', '<p>Voir avec CS comment ça avance le montage.</p><div>Gérer un peu les teckos.</div><div>Donner un coup de main.</div><div>Cadrer la mouette quand ils viendront faire leur montage vidéo.</div><div>Donner son avis sur tout.</div><div>Etre chiant.</div><div>Etre pénible.</div><div>Etre pête-couilles.</div><div>Etre casse-cul.</div><p></p>', NULL, 0, 'Grande scène', 3, 'non'),
(699, 23, 476, NULL, 'Surveillance ZC', '<p></p><ul><li><span style="background-color: rgb(255, 255, 255); text-align: justify;">Prends une Red Bull</span></li><li><span style="background-color: rgb(255, 255, 255); text-align: justify;">Tu patrouilles sur la ZC (avec attention toute particulière à la grande scène) pour faire la chasse aux rôtis et/ou relous, si possible ailleurs que nos AS</span><br></li><li><span style="background-color: rgb(255, 255, 255); text-align: justify;">En cas de problèmes, hésites pas à appeler notre patrouille d''AS et/ou le gardiennage INSA</span></li><li><span style="background-color: rgb(255, 255, 255); text-align: justify;">Si jamais tu trouves une bonbonne de gaz, n''oublies pas "I love the smell of napalm in the morning"</span></li><li><span style="background-color: rgb(255, 255, 255); text-align: justify;">Les vendredi et samedi nuit, vas ouvrir les Heras sur la voie pompier du capitaine Ponce que la signa ne reste pas coincé avec son 6m3 et sa signalétique :)</span></li></ul><p></p>', NULL, 0, 'ZC', -1, 'non (raf)'),
(700, 14, 342, NULL, 'Brancher Ferme', '<P>Chercher un tuyau d''eau dans le dépot Humas</P>\r\n<DIV>Se brancher sur le bâtiment des humas (à coté de la loge du régisseur)</DIV>\r\n<DIV>Ammener l''autre bout du tuyau à la ferme</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<P></P>', NULL, 0, 'Humas', 3, 'non'),
(701, 226, 434, NULL, 'Comm'' Stage Mathilde', '<p>-Déposer une affiche jour et des flyers des les lieux communs d''Handicap International</p><div>-Déposer une affiche nuit et des flyers à Science Po (IEP) dont les locaux sont à côté d''H.I.</div><p></p>', '50 flyers pour mon stage\r\n50 flyers pour science po (entrée à côté d''handicap international)\r\n1 affiche jour\r\n1 affiche nuit', 0, 'Local des 24h', -1, 'non'),
(702, 214, 346, NULL, 'Flyage (petit) RU', '<P>Viens au local (de l''ambiance) &nbsp;récupérer ton co-flyage, une grosse pile de flyers (environ 200 chacun) et une dose de charisme.</P>\r\n<DIV>Va à l''entrée du RU Puvis de Chavannes (vers le quai 43).</DIV>\r\n<DIV>Flye jusqu''à ce que tu n''aies plus de flyers.&nbsp;</DIV>\r\n<DIV>Reviens au local avec le sentiment d''avoir participé au non-déficit des 24h.&nbsp;</DIV>\r\n<DIV><BR></DIV>\r\n<DIV>I believe I can flye !&nbsp;<SPAN style="LINE-HEIGHT: 21px; BACKGROUND-COLOR: rgb(249,249,249); FONT-FAMILY: ''Helvetica Neue'', Helvetica, Arial, sans-serif; FONT-SIZE: 14px">♫</SPAN></DIV>', '- moult flyers', 0, 'Local des 24h', 3, 'non'),
(703, 214, 346, NULL, 'Flyage (grand) RU', '<P>Viens au local (de l''ambiance) &nbsp;récupérer ton co-flyage, une grosse pile de flyers (environ 200 chacun) et une dose de charisme.</P>\r\n<DIV>Va au RU de Jussieu (vers la BMC).</DIV>\r\n<DIV>Flye jusqu''à ce que tu n''aies plus de flyers.&nbsp;</DIV>\r\n<DIV>Reviens au local avec le sentiment d''avoir participé au non-déficit des 24h.&nbsp;</DIV>\r\n<DIV><BR></DIV>\r\n<DIV>I believe I can flye !&nbsp;<SPAN style="LINE-HEIGHT: 21px; BACKGROUND-COLOR: rgb(249,249,249); FONT-FAMILY: ''Helvetica Neue'', Helvetica, Arial, sans-serif; FONT-SIZE: 14px">♫</SPAN></DIV>', '-moult flyers', 0, 'Local des 24h', 3, 'non'),
(704, 214, 346, NULL, 'com/flyage MJC', '<p>Viens au local (de l''ambiance) &nbsp;récupérer ton co-tâche, une grosse pile de flyers jour (environ 100 chacun), 2 affiches jours et une dose de charisme.</p><div>Rends toi à la MJC de Villeurbanne (46 Cours Docteur Jean Damidot).</div><div>Demande gentiment si tu peux poser deux affiches, et laisser des flyers à l''accueil.</div><div><br></div><div>S''il y a du monde, donne leur des flyers, fais de la pub :) &nbsp;</div><div>&nbsp;</div>', '-2 affiches jour\r\n- flyers journées', 0, 'Local des 24h', 3, 'non');
INSERT INTO `Tache` (`id`, `responsable_id`, `groupetache_id`, `importid`, `nom`, `consignes`, `materielSupplementaire`, `permisNecessaire`, `lieu`, `statut`, `commentaireLog`) VALUES
(705, 215, 489, NULL, 'Accueil des Gones pour les anims', '<p><u>Resp:</u>&nbsp;<b style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">Joris CHOROT - 06 28 20 40 65</b></p><div><ul><li>Recevoir leur appel ou bien appelle-les pour savoir où ils sont</li><li>Rend-toi sur la pelouse des Humas</li><li>Accueillir l''asso Gones de Lyon</li><li>&nbsp;Leur indiquer l''emplacement de l''animation d''initiation au foot US, sur le coin de pelouse à gauche de l''allé vers la Rotonde</li><li>Leur demander s''ils ont besoin d''aide, les aider en cas de besoin</li></ul>=&gt; Leur fournir le numéro du&nbsp;<b>PC sécu</b>&nbsp;(en cas d''accident) :&nbsp;<span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">&nbsp;</span><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);"><b>04 72 43 70 70&nbsp;</b>ou<b>&nbsp;</b></span><span style="font-weight: bold; color: rgb(34, 34, 34); background-color: rgb(255, 255, 255); font-family: Arial, sans-serif; font-size: 11pt;">04 72 43 60 00</span></div>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(706, 26, 402, NULL, 'Faire liste matos Village Coureurs', '<p>Faire la liste et la donner aux humains.</p><p>Local du club rock (en bas du bâtiment F)<b>&nbsp;:</b><br></p><p>- 2 grands frigos</p><p>- 2 canapés</p><p>Dépot Humas :</p><p>- &nbsp;6 chaises, 12 bancs&nbsp;</p><p>Local des 24H de l''INSA (en bas du bâtiment D) :<br></p><p>- Matos nettoyage (2 torchons, 1 balai, une pelle, 2 éponges)<br></p><p>- 2*20 rallonges, 3 multiprises</p><p>- Rouleaux de PQ, sacs poubelles 200L</p><p>- 3, 4 bombes roses pédales</p><p>- 2 barbecues&nbsp;<br></p><p>- 9 tentes de camping<br></p><p>- 1 balai de cantonier (gros balai pour brosser la route)<br></p><p>QG orga (le samedi matin !!!) :<br></p><p>- 2 ordis&nbsp;</p><p>- Vidéo-projecteur</p><p>Cave (en bas du bâtiment E) :<br></p><p>- Tas Pédales de moquette (marqué VC)</p><p>- 10 matelas (ou tous ceux qui restent dans la cave)<br></p><p>- Arche 24</p><p>- tente 6*12 et tente 3*3</p><p>Local de l''Insatiable (QG Pédales) :</p><p>- 2 canapés</p><p>- 16 tables (2 places) (ATTENTION, elles seront peut-être au QG Orga)</p><p>- 12 bancs</p><p>- Bouffe</p><p>- Matos bouffe (bouilloire, marmite, couvercle marmite, louche, perco, plaques électriques, micro-ondes, bols, cuillères, couteaux)</p><p>- Signalétique Village Coureurs et Challenge<br></p><p>- Arche TdR</p><p>Creux GCU</p><p>- Extincteur CO2 2kg pour le chrono</p>', NULL, 0, 'Gymnase Colette Besson', 3, 'non'),
(707, 14, 343, NULL, 'Installation tente gardiennage élec', '<p>Va au local des 24h et retrouve ton co-tache.</p><p>Récupérer une voiture et les clefs de la cave.</p><div>A la cave récupère un matelas et une 3*3 (sur les 2 qu''il est censé rester)</div><div><br></div><div>Ferme la cave, rends toi près de la future petite scène.</div><div><br></div><div>Monte la tente, installe le matelas. Ce lieu sera le refuge des gardiens de la petite scène qui&nbsp;apeurés,&nbsp;trouveront&nbsp;un peu de&nbsp;réconfort&nbsp;sous cette tente que tu installes. Alors rends la conviviale !&nbsp;</div><div><br></div><div>Une fois que c''est fini, tu peux retourner au local rendre les clefs de la cave et de la voiture.&nbsp;</div>', 'clés de la cave', 0, 'Local 24H Bâtiment D', 3, 'raf'),
(708, 14, 343, NULL, 'Cabler le transfo Jules Verne', '<p>Retrouve les électriciens de la Dirpat à la dirpat</p><p>Num Christophe Accary :<span style="font-family: arial, sans, sans-serif; font-size: 13px;">06 72 25 09 57</span></p><div>Demande à philty le câble 32AT de 15m prévu pour le transfo de Jules Verne<br><div>Emmener l’électricien avec toi jusqu''à l''angle entre Jules Verne et Léonard de Vinci</div><div>Demande leur d’ouvrir le transfo</div></div><div><br></div><div>Faire passer le câble entre le tranfo et le petit trou à l’extérieur puis remettre la prise une fois le cable passer à travers le mur.</div><div><br></div><div>Dis au revoir à l''électricien !</div><div><br></div><p></p>', NULL, 0, 'Dirpat', 3, 'non'),
(709, 221, 476, NULL, 'Fermer la piscine', '<p>Après la fin du défi natation :</p><ul><li>Aller chercher la clef de la piscine au QG orga<br></li><li>Refaire un tour de la piscine</li><li>Vérifier que la piscine est vide</li><li>Vérifier que les vestiaires sont vides (hommes et femmes)</li><li>Vérifier que personne ne se trouve ni dans les escaliers, ni dans le gymnase.</li><li>Vérifier que le vestiaire dans lequel sont stockés les vélos est vide.<br></li><li>Regarder quelles portes sont encore ouvertes, et les fermer.<br></li></ul>', 'Clef de la piscine', 0, 'ZC/Piscine', -1, 'non'),
(710, 16, 387, NULL, 'Finitions du barrièrage', '<p>Rejoins le Poulpe et Cheval devant grande scène<br></p><p>Il faut leur filer un coup de main pour finir le barrièrage et le canissage de la zone concert.<br><br>Tout les points suivants doivent être validés :</p><ul><li>Barrièrage des caisses terminé et caisses fermées<br></li><li>Issues de secours ''piétonnes'' fermées au colson</li><li>Voies pompiers ouvertes, avec les barrières prêtent à fermer (les colliers doivent se trouver sur les héras)<br></li><li>Canisses présents sur toutes les Héras donnant vers l''intérieur de la zone.</li><li>Sas de sortie prêt</li><li>Tout les Héras sont attachées ou ont une jambe de force</li><li>La jonction entre les vaubans et les crash est assurée</li><li>Les racks, les plots, les JdF, les colliers non utilisés sont rangés.<br></li></ul>', NULL, 0, 'ZC', 3, 'non'),
(711, 16, 387, NULL, 'Barrièrage Dimanche soir', '<p>Fermer l''accès vers la zone nord avec des vaubans<br><br>Laisser juste une barrière ouverte pour laisser un passage surveillé par un AS</p>', NULL, 0, 'ZC', 3, 'non'),
(712, 16, 469, NULL, 'Débarrièrage Zone Sud', '<p>Retrouve Guerric, Le Poulpe et Cheval devant la grande scène (ou ce qu''il en reste)<br></p>Il faut tomber toute les barrières qui restent sur la zone concert d''ici ce soir.<br><br>On se divise en deux équipes : une pour le décanissage et une pour le débarrièrage.<div><br></div><div><u>Pour le décanissage</u></div><div><ul><li>Bien enlever les fils de fer des canisses.</li><li>Les rouler et les scotcher (en haut et en bas)&nbsp;</li></ul><div><u>Pour le débarriérage</u></div></div><div><ul><li>Ranger les Héras proprement dans les rack (les alterner gauche/droite)</li><li>Ranger les plots sur les bonnes palettes</li><li>Faire des packs de 10 vaubans (alternées aussi)</li></ul><div>ATTENTION :<br>Met des gants pour manipuler les canisses (un pull est fortement conseillé aussi!)<br></div><div><br></div><p><br></p></div>', 'Des bras musclés\r\nUn cuillère à soupe de patience\r\nDe la bonne humeur\r\nUn soupçon de charisme', 0, 'Devant la grande scène', 3, 'non'),
(713, 22, 399, NULL, 'Vérification Signa Pédale', '<p>Il est midi, mais pas de pause goûté pour la signa. Tu dois désormais aller t''assurer que les pédales ont bien poser la signa autour du village coureur.</p><div><ul><li>Vérifie que tu as ton foutre de bricolage sur toi et les déscriptif de la signa course, et envole toi vers le QG pédales.</li><li>Demande aux pédales si ils ont eu des difficultés à installer leur signa. Fait semblant d''écouter leur réponse, et va vérifier toi même si tout est bien en place, visible et claire.</li><li>Pour résumer: en cas de problème, trouve une solution. (tu peux d''ors et déjà dire <i>cimer</i> à ton toi du passé pour les instructions ces instructions claires et précises).</li><li>Si tu as fini en avance (ce qui impliquerait que les pédales soient compétents), retourne au QG Orga, et signale à l''humain que tu es dispo jusqu''à 14h00.</li></ul><div><u>Remarque Pignole:</u>&nbsp;Pense à t''hydrater, c''est important.</div></div><div><br></div><div><i>"Si Joseph d''Arimathie a pas été trop con, vous pouvez être sûr que le Graal, c''est un bocal à anchoi".</i></div><p></p>', NULL, 0, 'Village Coureurs', 3, 'non'),
(714, 23, 476, NULL, 'Ramasser les cailloux', '<p></p><ul><li>Va au local des 24 retrouver tes co-tache.&nbsp;</li><li>Récupérez 1 caddie et une grosse poubelle noire&nbsp;</li><li>Mettez la poubelle dans le caddie</li><li>Foncez vers la zone concert de toute la force de vos roulettes tordues</li><li>Votre mission : ramasser les cailloux qui restent : devant la grande scène, devant tous les bars, sur la pelouse tout autour de GCU, devant la petite scène et sur le rond-point.&nbsp;</li><li>Quand la poubelles est remplie, allez la vider dans la rivère de cailloux entre GI et GEN</li></ul><div>Ca à l''air d''être une tache à la con, mais c''est essentiel : tous les cailloux qui restent sur la zone concerts c''est autant de projectiles potentiels !&nbsp;</div><p></p>', '1 grosse poubelle', 0, 'Local des 24h (bâtiment D)', 3, 'non'),
(715, 28, 469, NULL, 'Décanissage Gymnase, AIP-Scène', '<p>Retrouver Guerric (0604476430) au niveau du stand accueil (à côté du bar restauration).</p><ul><li>Enlever toutes les canisses des Héras le long du gymnase piscine.</li><li>Bien enlever les fils de fer des canisses.</li><li>Les rouler et les scotcher (en haut et en bas)&nbsp;</li><li>Ranger les canisses dans un endroit safe</li><li>Enlever aussi les canisses entre l''AIP et la scène et entre le bar KFET et la scène (si on en a mis à ce niveau.<br></li></ul><div>ATTENTION :<br>Met des gants pour manipuler les canisses et ramène un pull.</div><div><br></div><div>Note pour Guerric: Passer au mur vers 13 h pour vérifier que le BE est bien là.<br></div>', 'Un pull et des gants', 0, 'Stand Accueil', 3, 'non'),
(716, 21, 338, NULL, 'Livraison de tables', '<p></p><ul><li>Retrouve Cetelem au dépôt AIP<br></li><li>Si tu vois un camion 20m3 qui se déplace sur les bars et qui décharge des tables, va là-bas tu le trouveras.<br></li><li>Si tu ne le vois pas, demande autour de toi ou appelle le (06 80 52 08 62)</li><li>Une fois que tu l''as trouvé, suis-le et aide le à livrer les tables :</li></ul>- 7 2p + 2 grandes&nbsp;au bar AIP&nbsp;<div>- 5 2p + 1 grande au bar BDE</div><div>- 5&nbsp;2p + 1 grande&nbsp;au bar KFet</div><div>- 8 2p + 1 grande au stand bouffe (+ 2 grandes)</div><div>- 1 2p au stand acceuil</div><div>- 5 2p + 1 grande au bar piscine</div><div>- 5&nbsp;2p + 1 grande&nbsp;au bar manège</div><div>- 6&nbsp;2p + 1 grande&nbsp;au bar cetiat</div><div><br></div><div><ul><li>Aller ensuite au QG et voir avec Cetelem combien de tables laisser. Laisser également 4 bancs.<br></li><li>Demander les clefs de l''Insatiable<br></li><li>Aller à l''insatiable et livrer 16 grandes tables et 12 bancs.</li><li>Ranger le 20m3</li><li>Retourner au QG et rendre les clés du 20m3, de l''insatiable et la clef pompier</li></ul></div><div><div><div><br></div></div></div><p></p>', NULL, 0, 'dépôt AIP', 3, 'non'),
(717, 352, 446, NULL, 'Cuisinier Jeudi 22', '<p>Votre mission: cuisiner pour le prestigieux Restaurant des Artistes des 24h.</p><div><br></div><div>Sous la direction de l''amateur Chef Le Troll (pour vous, ce sera "Chef"), vous aurez l''opportunité d''apprendre des recettes et / ou perfectionner vos connaissances en cuisine.</div><div><br></div><div>Soyez bien motivés car il y a beaucoup de travail et comme dans toute cuisine qui se respecte, pas assez de personnel.</div><div><br></div><div>Rendez-vous à l''heure de ton créneau en salle hibiscus, à la MDE.<br></div><p></p>', NULL, 0, 'MdE', 3, 'non'),
(718, 221, 382, NULL, 'Annoncer la fin du défi natation', '<p>À la piscine, annoncer aux coureurs que le défi natation touche à sa fin.<br><br>Expliquer aux coureurs que les triathlètes en équipent doivent sortir par la porte située <i>sur le côté</i> du bassin pour effectuer un relai.<br><br>Expliquer aux triathlètes solo qu''ils peuvent prendre une douche aux vestiaires, puis sortir par la porte principale, passer par le souterrain pour retrouver leurs vélos.<br><br><br> </p>', 'Signa : Relai cyclistes (équipes) --->\r\nAccès vélos (solo) <--- x2', 0, 'Gymnase C et circuit vélo', -1, 'non'),
(719, 16, 490, NULL, 'Briefing Chaps', '<UL>\r\n<LI><SPAN style="TEXT-ALIGN: justify; BACKGROUND-COLOR: rgb(255,255,255)">Récupère le contrat + les plans + le support briefing</SPAN><BR></LI>\r\n<LI>Retrouve les chaps au local<BR></LI>\r\n<LI><SPAN style="TEXT-ALIGN: justify; BACKGROUND-COLOR: rgb(255,255,255)">Briefe les sur leurs missions, le déroulement des soirées (amphi lespinasse) en faisant le tour de chaque poste.</SPAN><BR></LI>\r\n<LI><SPAN style="TEXT-ALIGN: justify; BACKGROUND-COLOR: rgb(255,255,255)">Emmène les au CETIAT et sur la ZC pour voir sur place les points sensibles si t''as le temps</SPAN></LI>\r\n<LI><SPAN style="TEXT-ALIGN: justify; BACKGROUND-COLOR: rgb(255,255,255)">Distribue les bracelets aux gens présents et donne le restant&nbsp;à Thibault</SPAN></LI>\r\n<LI><SPAN style="TEXT-ALIGN: justify; BACKGROUND-COLOR: rgb(255,255,255)">Confie aussi les Tshirt et Kway à Thibault<BR></SPAN></LI></UL>\r\n<P></P>', NULL, 0, 'ZC', 3, 'non'),
(720, 23, 490, NULL, 'Briefing évac', '<p><span style="BACKGROUND-COLOR: rgb(255,255,255)">- Va à l''amphi Lespinasse (GI) (tu sais, celui des comptages !)</span><br style="BACKGROUND-COLOR: rgb(255,255,255)"><span style="BACKGROUND-COLOR: rgb(255,255,255)">- Ecoute les procédures en cas d''évacuation, comprends ton rôle</span><br style="BACKGROUND-COLOR: rgb(255,255,255)"><span style="BACKGROUND-COLOR: rgb(255,255,255)">- Pose des questions si t''as pas compris</span></p>\r\n<p></p>', NULL, 0, 'Amphi Lespinasse', 3, 'non'),
(721, 22, 399, NULL, 'Vérification Signa Permanente Journée', '<p><span class="Apple-tab-span" style="white-space:pre">	</span>Bon matin !</p><div><span class="Apple-tab-span" style="white-space:pre">	</span>Si ta tâche précédente s''est bien passée, tu as finit de poser toute la signa journée. Sinon, termine là avant de commencer celle là. En effet, si rien n''a été cassé/volé durant la nuit, tu n''aura pas grand chose à faire:</div><div><ul><li>Demande les clés du 11m3.</li><li>Munis toi du descriptif signa permanente et d''une quantité non négligeable de foutre de bricolage. (pince, colsons, etc...). Il doit y en avoir au QG Orga ou dans le 11m3.</li><li>Fais le tour des emplacements indiqués dans le descriptif.</li><li>Si quelque chose a été volé, trouve un substitut. Si quelque chose est cassé, répare. Si quelque chose est en bon état, surtout ne touche rien.</li><li>Si tu passes à côté d''animations déjà installée, vérifie qu''elles sont bien signalétiquées.</li><li>Quand tu as fini, retourne au QG orga, et rend les clés du 11m3.</li></ul><div><u>Remarque Pignole</u>: Quoiqu''il arrive, choisit toujours la solution la plus simple, la moins fatigante, et surtout, celle qui te permet de manger à la fin (surtout si c''est du fromage).</div><div><br></div><div><i>"C''est marrant les petits bouts de fromage par terre. C''est ça que vous appelez une fondue ?"</i></div><div><br></div><div><br></div><div><br></div><div><br></div></div><p></p>', NULL, 0, 'QG Orga', 3, 'non'),
