(737, 28, 491, NULL, 'Aller chercher Vaubans Grand Lyon (1)', '<p></p><div>Ne pas oublier les papiers pour les dépôts (casier barrières)</div>Aller au dépôt du Grand Lyon en voiture et&nbsp;être pour 7h30 à l''ouverture du dépôt<div><b>18 avenue de la République 69200 Vénissieux</b><br><div>Retrouver le conducteur du Semi</div><div>Charger le premier set de vaubans<br>Si c''est possible de cercler les barrières sur places pour accélérer le chargement, on le fait en laissant 2 orgas sur place avec la sangle, sinon retour pour tout le monde</div><div><br></div><div>Revenir sur le campus avec la voiture, gérer le déchargement des vaubans le long du terrain stabilisé pour les courses</div><div>--------------------<br>Et c''est reparti pour un tour!</div><p></p></div>', 'Le papier du dépôt du grand Lyon\r\nUne sangle', 2, 'Partout', 3, 'non'),
(738, 28, 491, NULL, 'Aller chercher Vaubans Grand Lyon (2)', '<p></p><div>Repartir du campus avec le semi, en voiture<br>Aller au dépôt du Grand Lyon</div><div><b>18 avenue de la République 69200 Vénissieux</b><br></div><div>Charger le deuxième set de vaubans<br><br></div><div>Si c''est possible de cercler les barrières sur places pour accélérer le chargement, on le fait en laissant 2 orgas sur place avec la sangle, sinon retour pour tout le monde<br></div><div><br></div><div>Revenir sur le campus, envoyer le chauffeur PL à la BA manger &nbsp;et gérer le déchargement des vaubans<br>au niveau du bâtiment F (pour le parcours courses).</div><div>--------------------<br>Et c''est reparti pour un tour! (après la bouffe)</div><p></p>', 'le papier du dépôt (qu''on a déjà du premier trajet)\r\nDes sangles', 0, 'Partout', 3, 'non'),
(739, 28, 491, NULL, 'Aller chercher Vaubans Lyon + Grand Lyon (3)', '<p></p><div>Ne pas oublier les papiers pour le dépôt de la ville de lyon (en plus de celui du Grand Lyon) (casier barrières)</div><div>-----------------</div><div>Une fois que le PL a finis de manger, départ en semi, direction le dépôt de la ville de Lyon (ouverture à 13h30)</div><div><b>44 boulevard Jean XXIII à Lyon 8ème</b><br>Charge le set de 200 vaubans</div><div>Dire merci et partir au dépôt du Grand Lyon</div><div><b>18 av République &nbsp;69200 Vénissieux</b><br></div><div>Bourrer le reste de la semi de vaubans du Grand Lyon</div><div>Revenir sur le campus, gérer le déchargement des vaubans sur la pelouse direction, au niveau de l''ancien bar sköll<br></div><div><br></div><div>--------------------<br>Et c''est reparti pour un (dernier) tour!</div><p></p>', 'Le papier des dépôts', 0, 'Partout', 3, 'non'),
(740, 28, 491, NULL, 'Aller chercher Vaubans Grand Lyon (4)', '<p>Repartir en voiture au dépôt du Grand Lyon et le semi (et son conducteur) de son côté&nbsp;</p><p><b>18 avenue de la République 69200 Vénissieux</b><br></p><div>Charger le dernier set de vaubans<br>Remercier le Grand Lyon</div><div>Retourner sur le campus</div><div>décharger les vaubans au niveau de Niels Bohr derrière le batiment H au dépôt barrières prévu (Ugo sait ou c''est!)</div><div>Remercier le chauffeur PL, à la semaine prochaine!</div><p></p>', 'Le papier des dépôts', 0, 'Partout', 3, 'non'),
