(745, 352, 448, NULL, 'Manutention - Dimanche 25', '<p></p>\r\n<div>Votre mission: ''décorateur'' pour le prestigieux Restaurant des Artistes des 24h.</div>\r\n<div><br></div>\r\n<div>Sous la direction de l''amateur Chef Le Troll (pour vous, ce sera "Chef"), vous aurez l''opportunité de ranger les lieux en vue des nombreux repas qui auront lieu pour des personnes de qualité.</div>\r\n<div><br></div>\r\n<div>Venez avec vos bras.</div>\r\n<div><br></div>\r\n<div>Soyez bien motivés car il y a beaucoup de travail et comme dans tout restaurant qui se respecte, pas assez de personnel.</div>\r\n<div><br></div>\r\n<div>Rendez-vous à l''heure de ton créneau en salle hibiscus, à la MDE.</div>\r\n<p></p>', NULL, 0, 'MdE', 3, 'non'),
(746, 54, 492, NULL, 'Mettre en place la file d''attente', '<p></p><div>Responsable : Kamil Bennani 0621204350</div><div><br></div><div><ul><li>On se retrouve &nbsp;au Parking des humas ( celui en face du grillon coté pelouse des humas)</li><li>Aller chercher les barrières depuis le dépot humas (x30)</li><li>Mettre en place la file d''attente pour le bagjump en veillant bien à laisser un passage au camion</li></ul></div><p></p>', NULL, 0, 'Parking Humas', 3, 'non'),
(747, 54, 492, NULL, 'bye presta bagjump', '<p></p><ul><li>Aller au parking humas</li><li>Lui dire que son animation était la meilleure</li><li>le remercier</li><li>l''aider à ranger si nécessaire</li></ul><p></p>', NULL, 0, 'Parking Humas', 3, 'non'),
(748, 54, 492, NULL, 'Permanence Bagjump', '<p></p><div>Responsable : Bennani Kamil 0621204350</div><div><br></div><div><ul><li>Arriver à l''heure svp car sinon certaines personnes auront des créneaux plus long</li><li>Aller au Parking Humas ( celui en face du grillon coté pelouse des humas )</li><li>Se mettre en place sur les chaises&nbsp;</li></ul><div>Votre rôle est de faire attention à ce que <b>toutes les personnes qui sautent signent une décharge</b> avant de sauter pour décharger le prestataire et nous aussi &nbsp;et aussi de gérer la sécurité de l''animation.</div></div><div><br></div><div>Pour éviter qu''une personne qui re-saute signe 2 fois la décharge le presta à un tampon qu''il mettra sur leur main . Donc si la personne a déjà la marque sur la main ce n''est pas la peine de lui faire signer une décharge .</div><p></p>', NULL, 0, 'Parking Humas', 3, 'non'),
(749, 352, 448, NULL, 'Receptionniste - Dimanche 25', '<p></p>\r\n<div>Votre mission: ''Receptionniste'' pour le prestigieux Restaurant des Artistes des 24h.</div>\r\n<div><br></div>\r\n<div>Sous la direction de l''amateur Chef Le Troll (pour vous, ce sera "Chef"), vous aurez l''opportunité d''accueillir les nombreuses personnes de qualité qui viennent au restaurant.</div>\r\n<div><br></div>\r\n<div>Soyez bien motivés car il y a beaucoup de travail et comme dans tout restaurant qui se respecte, pas assez de personnel.</div>\r\n<div><br></div>\r\n<div>Rendez-vous à l''heure de ton créneau en salle hibiscus, à la MDE.</div>\r\n<p></p>', NULL, 0, 'MdE', 3, 'non'),
(750, 352, 448, NULL, 'Vaisselle - Lundi 26', '<p></p><div>Votre mission: ''plongeur'' pour le prestigieux Restaurant des Artistes des 24h.</div><div><br></div><div>Sous la direction de l''amateur Chef Le Troll (pour vous, ce sera "Chef"), vous aurez l''opportunité de nettoyer les restes des repas auxquels auront assisté de nombreuses personnes de qualité.</div><div><br></div><div>L''eau, le savon et les assiettes sales sont fournies.</div><div><br></div><div>Soyez bien motivés car il y a beaucoup de travail et comme dans tout restaurant qui se respecte, pas assez de personnel.</div><div><br></div><div>Rendez-vous à l''heure de ton créneau en salle hibiscus, à la MDE.</div><div><br></div><div>Heureusement, pour l''aide que tu apporte, tu auras droit à une récompense en nourriture (bien meilleur que le pâté que pourront te donner les humains ou les mamans).</div><p></p>', NULL, 0, 'MdE', 3, 'non'),
(751, 352, 448, NULL, 'Vaisselle - Mardi 27', '<p></p><div>Votre mission: ''plongeur'' pour le prestigieux Restaurant des Artistes des 24h.</div><div><br></div><div>Sous la direction de l''amateur Chef Le Troll (pour vous, ce sera "Chef"), vous aurez l''opportunité de nettoyer les restes des repas auxquels auront assisté de nombreuses personnes de qualité.</div><div><br></div><div>L''eau, le savon et les assiettes sales sont fournies.</div><div><br></div><div>Soyez bien motivés car il y a beaucoup de travail et comme dans tout restaurant qui se respecte, pas assez de personnel.</div><div><br></div><div>Rendez-vous à l''heure de ton créneau en salle hibiscus, à la MDE.</div><div><br></div><div>Heureusement, pour l''aide que tu apporte, tu auras droit à une récompense en nourriture (bien meilleur que le pâté que pourront te donner les humains ou les mamans).</div><p></p>', NULL, 0, 'MdE', 3, 'non'),
(752, 352, 448, NULL, 'Manutention - Mardi 27', '<p></p><div>Votre mission: ''décorateur'' pour le prestigieux Restaurant des Artistes des 24h.</div><div><br></div><div>Sous la direction de l''amateur Chef Le Troll (pour vous, ce sera "Chef"), vous aurez l''opportunité de ranger les lieux en vue des nombreux repas qui auront lieu pour des personnes de qualité.</div><div><br></div><div>Venez avec vos bras.</div><div><br></div><div>Soyez bien motivés car il y a beaucoup de travail et comme dans tout restaurant qui se respecte, pas assez de personnel.</div><div><br></div><div>Rendez-vous à l''heure de ton créneau en salle hibiscus, à la MDE.</div><p></p>', NULL, 0, 'MdE', 3, 'non'),
(753, 352, 448, NULL, 'Vidage Matos BA', '<p>Parce que pour la 40e édition, il me fallait une 40e tâche...</p><div><br></div><div>Quelque part sur le créneau, j''arriverai de Paris en véhicule qu''il faudra décharger à la MdE.</div><div><br></div><div>Je ne sais pas à quelle heure encore on arrivera, cela dépends du temps de chargement, de l''heure du départ et des conditions de route... mais quelque part entre 16h et 18h... mais disons au plus tard 20h.</div><p></p>', NULL, 0, 'MdE', 3, 'non'),
(754, 28, 387, NULL, 'Barrièrage Journée', '<p>Retrouver ton responsable devant la grande scène<br><br>Mettre en place le barrièrage journée qui protège la grande scène et la régie.</p><p><br>Les vaubans sont disponibles à coté de l''AIP</p>', NULL, 0, 'ZC', 3, 'non'),
(755, 16, 493, NULL, 'Briefing Evacuation', '<p>dosqhgpoi</p>', NULL, 0, 'Ton cul', -1, 'non'),
(756, 16, 493, NULL, 'Briefing Extincteurs', '<p>cvlhsdgpi</p>', NULL, 0, 'Ton cul', -1, 'non'),
(757, 16, 490, NULL, 'Briefing Extincteurs', '<p>Rends toi au local des 24, et écoute attentivement la formation extincteurs</p>', NULL, 0, 'Local 24h', 0, 'non'),
(758, 45, 307, NULL, 'La cabane au fond du jardin s''en va...', '<p>Le chalet backline s''en va...</p><div>Vas voir le gentil monsieur et vois tout ça avec lui. Monte une petite zone de chantier autour de son bordel.</div><div>&nbsp;Il va démonter le chalet tout seul comme un grand, il faut juste être pas trop loin pour répondre à ses questions si besoin et lui fournir eau et nourriture.</div>', NULL, 0, 'Grande scène', 3, 'non'),
(759, 194, 336, NULL, 'Mise en place triangles', '<p></p><ol><li>Retrouver George au QG orga.</li><li>Récupérer 2 kits DéDé avec supports de signa <br></li><li>Récupérer 11 trio(s) de barrière sur les humas (appeler la Barrière si besoin)</li><li>Installer chaque triangle de barrière à un emplacement prévu (voir la carte)</li><li>Installer les supports de signa, un (ou plus) sac de chaque couleur de chaque coté du triangle, et les panneaux de tri qui vont bien.</li><li>Recommencer jusqu''à ce que tous les tri-angles soient en place !</li><li>Ramener les kits au QG.</li><li>Prendre un café bien mérité !</li></ol><p></p>', '2 kit dédé\r\n21 supports de signa', 0, 'QG orga', 3, 'non'),
(760, 45, 308, NULL, 'Rendu Manitoutous', '<p>Les manitous s''en vont. :(</p><div><br></div><div>Il faut etre dispo pour quand le mec t''appelle, le guider jusqu''aux fens et lui filer les clés pour qu''il charge tout ça.</div><div>Ya peut-être un papier à signer ou à récupérer...</div><p></p>', NULL, 0, 'ZC', 3, 'raf'),
(761, 48, 336, NULL, 'Préparation des kits DéDé', '<p></p><ol><li>Se rendre au local.</li><li>Récupérer le matos pour faire les kits dans la pile DD.</li><li>Préparer 15 kits contenant :</li></ol><ul><li>1 rouleau de sacs poubelle noirs</li><li>1 rouleau de sacs poubelle jaunes<br></li><li>1 rouleau de sacs poubelle verts<br></li><li>1 rouleau de scotch</li><li>1 paire de gants</li><li>1 carte des emplacements des poubelles</li></ul>Rajouter des affiches dans 2 kits :<div>5 affiches "carton/plastique", 5 affiches "verre", 5 affiches "tous déchets".</div><div><b>Bien distinguer les kits avec/sans affiches.</b></div><p></p>', '15 rouleaux sacs poubelle noirs\r\n15 rouleaux sacs poubelle jaunes\r\n15 rouleaux sacs poubelle verts\r\n15 paires de gants latex/caoutchouc\r\n15 cartes poubelles\r\n10 affiches "tout déchets"\r\n10 affiches "carton/plastique"\r\n10 affiches "verre"', 0, 'Local 24h', 3, 'non'),
(762, 45, 307, NULL, 'Récupérer les pratos du Toboggan', '<p>Yo yo yo !</p><div><br></div><div>Pour que les concerts se passent bien, on a besoin de praticables ciseaux. (Qu''est-ce que c''est donc, c''est pas bien grave, c''est comme des grosses tables renforcées de 2m*1m)</div><div><br></div><div>Du coup, va voir Hermione (resp grande scène, il traine toujours par là-bas et sinon demande à ce qu''on te mène à lui) il verra avec toi les derniers détails et si possible il viendra avec toi.</div><div><br></div><div>Le but c''est d''aller au Toboggan de Décines :</div><div><h1 class="cards-entity-title cards-strong cards-text-truncate-and-wrap" style="margin: 0px 0px 2px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; list-style: none; max-width: 100%; overflow: hidden; text-overflow: ellipsis;"><span jsl="$x 3;">Le Toboggan</span></h1><div class="cards-entity-address cards-strong" jsl="$x 5;" style="margin-bottom: 5px;"><div jsinstance="0" class="cards-text-truncate-and-wrap" jsl="$x 6;" style="max-width: 100%; vertical-align: top; overflow: hidden; text-overflow: ellipsis;"><span jsl="$x 7;">14 Avenue Jean Macé</span></div><div jsinstance="*1" class="cards-text-truncate-and-wrap" jsl="$x 6;" style="max-width: 100%; vertical-align: top; overflow: hidden; text-overflow: ellipsis;"><span jsl="$x 7;">69150 Décines-Charpieu</span></div><div jsinstance="*1" class="cards-text-truncate-and-wrap" jsl="$x 6;" style="max-width: 100%; vertical-align: top; overflow: hidden; text-overflow: ellipsis;"><span jsl="$x 7;">(il faut compter entre 20 et 30 minutes pour y aller)</span></div><div jsinstance="*1" class="cards-text-truncate-and-wrap" jsl="$x 6;" style="max-width: 100%; vertical-align: top; overflow: hidden; text-overflow: ellipsis;"><span jsl="$x 7;"><br></span></div><div jsinstance="*1" class="cards-text-truncate-and-wrap" jsl="$x 6;" style="max-width: 100%; vertical-align: top; overflow: hidden; text-overflow: ellipsis;">Rendez-vous là bas à 10h pétante, le contact là-bas c''est Philippe Maurot, le directeur technique du toboggan (06 33 90 72 78).</div><div jsinstance="*1" class="cards-text-truncate-and-wrap" jsl="$x 6;" style="max-width: 100%; vertical-align: top; overflow: hidden; text-overflow: ellipsis;"><br></div><div jsinstance="*1" class="cards-text-truncate-and-wrap" jsl="$x 6;" style="max-width: 100%; vertical-align: top; overflow: hidden; text-overflow: ellipsis;">Il faut récupérer 6 praticables ciseaux et 6 pinces de fixation (petits morceaux métalliques pour joindre les praticables entre eux). Attention aux pinces il ne faut surtout pas les perdre et il faut les remettre en main propre à Hermione (sauf si il est là et qu''il les prend lui-même). Si c''est possible de les charger sur une palette, il faut sauter sur l''occasion : c''est bien plus pratique pour nous si on a une palette pour pouvoir les bouger après. (Bien préciser qu''on leur ramenera la palette au cas où). On charge tout dans le 20m3 et on amène tout ça derrière la grande scène !</div><div jsinstance="*1" class="cards-text-truncate-and-wrap" jsl="$x 6;" style="max-width: 100%; vertical-align: top; overflow: hidden; text-overflow: ellipsis;"><br></div><div jsinstance="*1" class="cards-text-truncate-and-wrap" jsl="$x 6;" style="max-width: 100%; vertical-align: top; overflow: hidden; text-overflow: ellipsis;"><br></div><div jsinstance="*1" class="cards-text-truncate-and-wrap" jsl="$x 6;" style="max-width: 100%; vertical-align: top; overflow: hidden; text-overflow: ellipsis;">En cas de souci ou d''interrogation, n''hésites pas à appeler Hermione : 06.08.94.44.88</div></div></div><p></p>', NULL, 2, 'Grande scène', 3, 'non'),
(763, 45, 307, NULL, 'Rendre les pratos du Toboggan', '<p></p><div>Yo yo yo !</div><div><br></div><div>Pour que les concerts se passent bien, on a besoin de praticables ciseaux. (Qu''est-ce que c''est donc, c''est pas bien grave, c''est comme des grosses tables renforcées de 2m*1m)</div><div><br></div><div>Du coup, va voir Hermione (resp grande scène, il traine toujours par là-bas et sinon demande à ce qu''on te mène à lui) il verra avec toi les derniers détails et si possible il viendra avec toi.</div><div><br></div><div>Le but c''est de rendre les praticables au Toboggan de Décines :</div><div><h1 class="cards-entity-title cards-strong cards-text-truncate-and-wrap" style="margin: 0px 0px 2px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; list-style: none; max-width: 100%; overflow: hidden; text-overflow: ellipsis;"><span jsl="$x 3;">Le Toboggan</span></h1><div class="cards-entity-address cards-strong" jsl="$x 5;" style="margin-bottom: 5px;"><div jsinstance="0" class="cards-text-truncate-and-wrap" jsl="$x 6;" style="max-width: 100%; vertical-align: top; overflow: hidden; text-overflow: ellipsis;"><span jsl="$x 7;">14 Avenue Jean Macé</span></div><div jsinstance="*1" class="cards-text-truncate-and-wrap" jsl="$x 6;" style="max-width: 100%; vertical-align: top; overflow: hidden; text-overflow: ellipsis;"><span jsl="$x 7;">69150 Décines-Charpieu</span></div><div jsinstance="*1" class="cards-text-truncate-and-wrap" jsl="$x 6;" style="max-width: 100%; vertical-align: top; overflow: hidden; text-overflow: ellipsis;"><span jsl="$x 7;">(il faut compter entre 20 et 30 minutes pour y aller)</span></div><div jsinstance="*1" class="cards-text-truncate-and-wrap" jsl="$x 6;" style="max-width: 100%; vertical-align: top; overflow: hidden; text-overflow: ellipsis;"><span jsl="$x 7;"><br></span></div><div jsinstance="*1" class="cards-text-truncate-and-wrap" jsl="$x 6;" style="max-width: 100%; vertical-align: top; overflow: hidden; text-overflow: ellipsis;"><span jsl="$x 7;">Il faut récupérer auprès d''Hermione 6 praticables ciseaux et 6 pinces de fixation (petits morceaux métalliques pour joindre les praticables entre eux). Attention aux pinces il ne faut surtout pas les perdre et il faut les remettre en main propre au directeur technique. On charge tout dans le 20m3 et on amène tout ça au Toboggan !<br></span></div><div jsinstance="*1" class="cards-text-truncate-and-wrap" jsl="$x 6;" style="max-width: 100%; vertical-align: top; overflow: hidden; text-overflow: ellipsis;"><span jsl="$x 7;"><br></span></div><div jsinstance="*1" class="cards-text-truncate-and-wrap" jsl="$x 6;" style="max-width: 100%; vertical-align: top; overflow: hidden; text-overflow: ellipsis;">Rendez-vous là bas à 10h pétante, le contact là-bas c''est Philippe Maurot, le directeur technique du toboggan (06 33 90 72 78).</div><div jsinstance="*1" class="cards-text-truncate-and-wrap" jsl="$x 6;" style="max-width: 100%; vertical-align: top; overflow: hidden; text-overflow: ellipsis;"><br></div><div jsinstance="*1" class="cards-text-truncate-and-wrap" jsl="$x 6;" style="max-width: 100%; vertical-align: top; overflow: hidden; text-overflow: ellipsis;"><br></div><div jsinstance="*1" class="cards-text-truncate-and-wrap" jsl="$x 6;" style="max-width: 100%; vertical-align: top; overflow: hidden; text-overflow: ellipsis;"><br></div><div jsinstance="*1" class="cards-text-truncate-and-wrap" jsl="$x 6;" style="max-width: 100%; vertical-align: top; overflow: hidden; text-overflow: ellipsis;">En cas de souci ou d''interrogation, n''hésites pas à appeler Hermione : 06.08.94.44.88</div></div></div><p></p>', NULL, 0, 'Grande scène', 3, 'non');
INSERT INTO `Tache` (`id`, `responsable_id`, `groupetache_id`, `importid`, `nom`, `consignes`, `materielSupplementaire`, `permisNecessaire`, `lieu`, `statut`, `commentaireLog`) VALUES
(764, 45, 315, NULL, 'Garder vaillamment la petite scène, l''élec et les bars', '<p>Ici, c''est toi le king.</p><p>Une ombre qui bouge ? Un romano qui passe ? Une chauve-souris à l''oeil fourbe ?</p><p>Tu dois l''arrêter !</p><p>Ta mission (si toutefois tu l''accepte), est de prendre place sur la petite scène (ou dans les alentours si tu es le mercredi soir car la scène ne sera pas encore là) avec ton joyeux acolyte, d''avoir l''oeil vif et de patrouiller vaillamment pour garder la scène, tout le matériel stocké autour et les bars qui font le tour du bâtiment GCU avec ce qu''il y a derrière.</p><p>Un seul mot d''ordre : personne ne passe (à l''exception des orgas hard des 24, des techniciens qui viennent travailler le matin à partir de 7h au plus tôt, et de ton relais de gardiennage si il y en a sinon ta mission va être très très longue...)</p><p><br></p><p>Ton contact ? =&gt; Hermione, resp scène <a href="tel:(06.08.94.44.88">(06.08.94.44.88</a>)</p><p>Ton matériel ? =&gt; Ta bravoure et un talkie walkie</p><p><br></p><p>Je beaucoup sur vous.</p>', NULL, 0, 'Petite scène', 3, 'non (raf)'),
(765, 45, 307, NULL, 'Démontage Light & Son', '<p>Rends-toi sur la zone concert et trouve Hermione (c''est facile : c''est marqué "Hermione" sur son T-shirt, il a un talkie dans l''oreille, et tu n''a jamais vu quelqu''un dégager autant de charisme. Tu ne peux pas le louper). Il traîne toujours autour de la grande scène ou dans la zone concert. (Sinon certains l''appellent Thomas aussi il parait...)</p><div><br></div><div>Il te remettra tes EPI si besoin (gants, chaussures de sécu, casque) et te&nbsp;briefera sur ta mission.</div><div><br></div><div>Attention, tu travailles avec des&nbsp;professionnels, ne fais pas n''importe quoi, écoute leurs remarques si ils en ont, et en cas de soucis, n''hésite pas à demander à Thomas ou Gilles (régisseur général).</div>', NULL, 0, 'Grande scène', 3, 'non'),
(766, 45, 307, NULL, 'Backline scènes', '<p>Rends-toi sur la zone concert et trouve Thomas (c''est facile : c''est marqué "Hermione" sur son T-shirt, il a un talkie dans l''oreille, et tu n''a jamais vu quelqu''un dégager autant de charisme. Tu ne peux pas le louper). Il traîne toujours autour de la grande scène ou dans la zone concert. Il te briefera sur ce que tu as à faire.</p><div>Ta mission est d''aider les groupes pour s''installer sur scène avant le concert et aux interplateaux. C''est un poste clé car on te demander d''être à la fois efficace, attentif à ce qu''on te demande et précautionneux avec le matériel qu''on te confie.</div><div>Si tu as un doute sur quelque chose, renseigne-toi rapidement avant de faire quelque chose de travers.</div><div><br></div><div>Attention, tu travailles avec des&nbsp;professionnels, ne fais pas n''importe quoi, écoute leurs remarques si ils en ont, et en cas de soucis, n''hésite pas à demander à Thomas (resp grande scène), Jérémie (resp petite scène) ou à Gilles (régisseur général).</div>', NULL, 0, 'Grande scène', 3, 'non'),
(767, 219, 481, NULL, 'Désinstaller Isosteo', '<p> - Aller à la MdE</p><p>- Dire au revoir aux étudiants d''Isostéo</p><p>- Rapporter les 5 chaises + 1 table au dépôt des humas !</p>', NULL, 0, 'QG orga', 3, 'non'),
(768, 219, 494, NULL, 'Distribution des bouchons d''oreille', '&nbsp;<p>Va au qg orga récupérer des bouchons d''oreilles, et pose les sur les bars.</p>', NULL, 0, 'QG Orga', 3, 'non'),
(769, 21, 338, NULL, 'Rendre les tables en GI - Conducteur', '<p></p><ul><li>Rendez-vous au QG de l''ambiance !<br></li><li>Mange bien, réchauffe toi, fait toi masser !</li><li>Retrouve Brandon (le 20m3 de l''ambiance) et tes co-tâches<br></li><li>Prend de quoi nettoyer des tables et des chaises (1 seau, 3 éponges, 3 chiffons)</li><li>Demande&nbsp;<b>la clef du PC secouriste et une clef pompier</b></li><li>Attrape ton courage à deux mains et dit&nbsp;à bientôt aux mamans</li><li>Partir avec en 20m3 pour le PC secouriste</li></ul><div>Pause 20m3 !</div><ul><li><u><b>Nettoyer les tables encore sales</b></u></li><li>Charger les&nbsp;<b>30 tables 1 place</b>&nbsp;dans le 20m3</li><li>Fermer le PC secouriste</li><li>Aller devant GI (utiliser la clef pompier avec beaucoup d''attention, elle est très gentille)</li><li>Trouver Nathalie Follet au secrétariat de la direction</li><li>Remettre les tables dans la salle où on les a prises</li><li>Remercier</li><li>Rentrer au QG orga</li><li>Rendre tout le matos et les clefs prises</li></ul><div>Pignole !<br>On peut mourir en paix, les gens pourront aller en cours !</div><p></p>', NULL, 1, 'QG Orgras', 3, 'non'),
(770, 21, 335, NULL, 'Emmener les tables au dépôt humas', '<p></p><ul><li>RDV au QG orga<br></li><li>Retrouve ton co-tâche</li><li>Demande la clef du dépôt humas aux humains (s''ils ont le temps de t''accompagner c''est le top !)</li><li>Emmène 28 tables 2 places du QG orga au dépôt humas</li><li>Refermer le dépôt dès que tu le quitte :)</li><li>Aller voir les koncerts karismatik !</li></ul><p></p>', NULL, 0, 'QG Orga', 3, 'non'),
(771, 220, 395, NULL, 'Ramener le matos au Gymnase C', '<p>-Aller au dépot AIP récupérer le caddie avec les 4 cages et les 2 ballons<br>-Aller au gymnase C déposer les cages et les ballons (1ère porte à gauche en rentrant)<br>-Ramener le caddie à l''AIP<br></p>', NULL, 0, 'Terrain de beach volley', 3, 'non'),
(772, 197, 356, NULL, 'Récupérer tables et chaises pour le Light Painting', '<p>Retrouve ton co-tâche au QG orga.</p><p>Récupère les clés de la salle de chouille (la salle se situe derrière la k-fêt, c''est l''escalier louche qui descend), et avant d''y aller, passe au dépôt des humas.</p><p>Il faut récupérer 4 chaises, et 4 tables deux places, pour les mettre dans la salle de chouille. Vu que tu n''es pas Hulk, il va falloir faire plusieurs aller/retours entre le dépôt et la salle de chouille. Ne laisse jamais le matériel seul : fais bien attention de refermer la salle de chouille avant de repartir au dépot chercher le reste du matos.</p><p>Une fois que tout est là, dispose les tables et les chaises vers l''entrée afin de faire une espèce de "file d''attente", qui servira à réguler le flux des visiteurs.</p><p>C''est bon, tu peux partir !</p><p>N''oublie pas de bien refermer la salle de chouille, et de ramener les clés au QG orga.</p>', NULL, 0, 'QG Orga', 3, 'non'),
(773, 48, 336, NULL, 'Installation poubelles bars', '<p></p><ol><li>Se rendre au QG Orga pour retrouver Lapinette.</li><li>Récupérer 2 rouleaux de sacs poubelle noirs et jaunes et 2 rouleaux de scotch</li><li>Aller en zone bar. Accrocher un sac poubelle de chaque couleur régulièrement (tous les 2-3 mètres, il en faut mille).</li><li>Laisser les sacs poubelles restant à des resps de bar.&nbsp;</li><li>Prendre un café, garder le sourire et aller faire sa prochaine tâche.</li></ol><p></p>', '2 rouleaux de sacs poubelles noirs\r\n2 rouleaux de sacs poubelles jaunes', 0, 'QG Orga', 3, 'non'),
(774, 219, 336, NULL, 'Grand ménage matinal', '<p></p><ol><li>Retrouver le resp'' au QG.</li><li>Prendre un café/manger un bout.</li><li>Récupérer chacun un kit DéDé et quelques balais/râteau.</li><li>Récupérer un caddie au dépôt AIP.</li><li>Aller sur la ZC (Zone Concerts, aux humas) en portant le resp'' dans le caddie.</li><li>Nettoyer l''entrée de la ZC, pousser le bordel sur la route pour la balayeuse.<br>(elle passe vers 9h donc c''est le plus urgent)</li><li>Ramasser les déchets par terre, bien mettre dans les bons sacs. (Le tri, c''est cool.)</li><li>Faire le tour des poubelles. Mettre les sacs plein dans le caddie, et les remplacer par des nouveaux.</li><li>Aller nettoyer le reste, autant que possible (surtout les zones anims et le parcours course).</li><li>Jeter les sacs poubelles du caddie dans des bennes (sans se tromper de couleur!)</li><li>Ramener les kits DéDé au QG Orga</li><li>Prendre un café/manger un bout et enchaîner sur une belle journée !</li></ol><p></p>', '1 kit Dédé par personne', 0, 'QG Orga', 3, 'non'),
(775, 219, 336, NULL, 'Tâche sans nom', 'frfr', NULL, 0, 'Sur tout le campus', -1, 'non'),
(776, 219, 336, NULL, 'Installation des poubelles Dirpat', '<p></p><ol><li><b>For RESP</b> : récupère un plan poubelle (que tu as dans ton sac pendant toute la manif anyway)</li><li>Retrouver le resp'' devant le creux GCU (entre les bâtiments Freyssinet, Eiffel et Coulomb)</li><li>Placez les poubelles à roulettes où il faut comme il faut !</li><li>Allez boire un café en papotant de la prochaine tache à effectuer.</li></ol><div><br></div><p></p>', NULL, 0, 'Creux GCU', 3, 'non'),
(777, 28, 496, NULL, 'Rendez les Vaubans (1)', '<p>Se lever de bonne humeur, oublier la fatigue et avoir la bonne humeur (#bonneambiance)<br><br>Te bouger le cul sur la ZC (ou ce qu''il en reste) et récupérer un fen pour le chargement du semi.<br>Attendre que le semi Rollin arrive<br>Le guider vers le dépôt le long du terrain de foot.<br>Charger le semi<br>Aller rendre le tout au dépôt du Grand Lyon (ne pas oublier le papier du dépôt):<br><b>18 avenue de la République 69200 Vénissieux<br></b>Attendre qu''ils vident le semi<br>Repartir sur le campus</p>', 'des gants\r\nle papier des dépôts', 0, 'Lyon city beach!', 3, 'non'),
(778, 197, 353, NULL, 'Rangement cinéma plein air', '<p>Rend toi à l''emplacement du cinéma plein air à côté de la piscine de l''INSA, et aide Cinébus à ranger son matos !</p><div>Appelle Tiffany en cas de soucis : 0699769011</div><p></p>', NULL, 0, 'A coté de la piscine INSA', 3, 'non'),
(779, 31, 497, NULL, 'Opération Check circuit', '<p>Prendre un vélo / voiture au village coureur<br><br>Faire le tour du circuit vélo<br><br>Vérifier que tout est bien fermé et que les barrières sont enclenchées.</p><div>Vérifier qu''aucun véhicule / poubelle ou autre ne gène le passage<br><br>Réparer avant midi tout ce qui merde<br><br>Faire de même sur le circuit pied. Bien vérifier que la rubalise est en place.</div><p> </p>', NULL, 0, 'Circuit', 3, 'non'),
(780, 31, 498, NULL, 'Stationnement gênant merci', '<p>Aller au local des 24h (Rdc Batiment D)<br></p><p>Récupérer le kit "Stationnement Gênant Merci" dans l''armoire de la Salle Op''<br></p><p>Si pas assez de flys, demander à en réimprimer avant de partir.</p><p>Flyer tout ce qui se trouve sur le parcours du circuit course (tu pourra en trouver une photocopie dans un des casiers pédales au local des 24 heures)</p><p>Ramener le matériel au local et ranger le kit</p><p><b>Fly tout ce qui a des roues, les caisses, les motos, vélos, pépitos en&nbsp;fauteuil&nbsp;roulant, ..</b></p>', 'kit "stationnement gênant "', 0, 'Local des 24 Heures', 3, 'non'),
(781, 31, 499, NULL, 'Open up (circuit)', '<p>Retrouve Ron au QG orga.</p><div><br></div><div>Commence le débarrierage du circuit en les regroupant au maximum près de leur lieu de dépôt</div><div><br></div><div>Il faut que les voitures puissent passer sur le circuit</div><div><br></div><div>Petit plus pour ton créneau :</div><div><br></div><div>Des gants parce qu''à l''usure ça fait mal</div><div>De l''eau parce que c''est bien de boire</div><div>Ta joie et ta bonne humeur</div><div><br></div><div><br></div><div><br></div><p></p>', NULL, 0, 'QG Orga', 3, 'non'),
(782, 31, 499, NULL, 'Débarriérage en poney', '<p>Va voir la ferme</p><div>Shotgun leur un poney</div><div><br></div><div>Prend ton fervent destrier pour aller ramasser les barrieres.</div><div><br></div><div>Donne lui des pommes quand tu aura fini, ponneys loves apples</div><div><br></div><div>Présente lui sont papa (ak Cheval)</div><div><br></div><div>Finit de débarriérer et ramène le à sa maîtresse</div><div><br></div><div>&nbsp;&nbsp;</div><p></p>', 'une selle et un poney', 0, 'campus', -1, 'non'),
(783, 14, 342, NULL, 'Aider les plombiers', '<p>Va donner un coup de main au plombier pour installer les urinoirs</p>', NULL, 0, 'ZC', -1, 'non'),
(784, 220, 500, NULL, 'Accueillir les escrimeurs', '<p><b>Virgile Tavernier - 0613329062</b><br><br>-Aller à l''emplacement de l''escrime artistique sur la pelouse devant le batiment des humas<br>-Accueillir les escrimeurs, vérifier qu''ils ont tout ce qu''il faut<br>-Leur fournir le numéro du PC sécu (en cas d''accident) : <span style="font-family:arial,sans-serif;font-size:13px">04 72 43 70 70 ou&nbsp;</span><span style="font-family:Arial,sans-serif;font-size:11pt">04 72 43 60 00<br>-Leur souhaiter une bonne animation<br></span></p>', NULL, 0, 'Pelouse des Humas', -1, 'non'),
(785, 220, 500, NULL, 'Dire au revoir aux escrimeurs', '<p>-Aller à l''emplacement de l''escrime artistique sur la pelouse devant le batiment des humas<br>-Leur demander si ca s''est bien passé, s''ils pensent revenir l''année prochaine, les remercier<br><br></p>', NULL, 0, 'Pelouse des Humas', -1, 'non'),
(786, 220, 500, NULL, 'Installer l''escrime artistique', '<p>-Aller au dépôt barrière sur le parking en face du grillon</p><p>-Amener 12 barrières vauban&nbsp; sur l''emplacement de l''escrime artistique devant le bâtiment des humas</p><p>-Faire un carré d''environ 6x6m avec</p><p>-En cas de problème, appeler le resp Etienne au&nbsp; 07 87 05 06 04<br></p>', NULL, 0, 'Pelouse des Humas', -1, 'non'),
(787, 220, 500, NULL, 'Ranger l''escrime artistique', '<p>-Aller à l''emplacement de l''escrime artistique sur la pelouse devant le bâtiment des humas</p><p>-Ranger les 12 barrières vauban au dépôt barrières sur le parking en face du grillon</p><p>-En cas de problème, appeler le resp Etienne au&nbsp; 07 87 05 06 04<br></p>', NULL, 0, 'Pelouse des Humas', -1, 'non'),
(788, 21, 335, NULL, 'Marquer le matos A302', '<p></p><ul><li>RDV au QG orga<br></li><li>Demande 1 rouleau de scotch marron, 1 portion de pâté et 1 marqueur noir au QG</li><li>Va au dépôt AIP</li><li>Trouve la salle A302 (à droite en entrant dans le dépôt)</li><li>Compter le nombre de chaises et de tables.&nbsp;</li><li>Noter les 2 sur le tableau (avec ton plus beau "ne pas effacer SVP")</li><li>Envoyer un SMS à Cetelem (06 80 52 08 62) avec la même info</li><li>Met un morceau de scotch sur toutes les tables et écrit "A302" dessus.</li><li>Range les tables sur un côté de la salle</li><li>Met un morceau de scotch sur toutes les chaises et écrit "A302" dessus.</li><li>Range les chaises sur un côté de la salle</li><li>Mange le pâté</li><li>Ramène le matériel que tu as pris (scotch, marqueur) au QG orga</li><li>Jette la boîte de pâté</li><li>Pignole toi</li></ul><div><br></div><p></p>', 'Pâté', 0, 'QG Orga', 3, 'non (raf)'),
(789, 21, 335, NULL, 'Déplacer les grilles d''exposition et les tables', '<p></p><ul><li>RDV au QG de l''ambiance<br></li><li>Trouve tes co-tâche<br></li><li>Trouve les grilles d''exposition dans le QG (demander aux humains)</li><li>Motive plein de gens du QG</li><li>Transporte les grilles jusque dans le hall des humas</li><li>Range les toutes au même endroit pour laisser le plus de place possible au reste du matos</li><li>Trouve 20 tables 2 places dans le QG</li><li>Transporte les dans le hall des humas</li><li>Retourne voir les magnifiques canap du QG</li></ul><p></p><div><br></div><p></p>', NULL, 0, 'Dépôt Humas', 3, 'non'),
(790, 21, 406, NULL, 'Réception matos dirpat', '<p></p><ul><li>RDV devant la MDE (entre la rotonde et la MDE)</li><li>Attend le mec de la DirPat<br></li><li>Appelle Cetelem (Alexis, 06 80 52 08 62) si tu ne vois pas le mec<br></li><li>Décharge 30 grilles d''exposition et met les dans le hall de l''agora du côté de la MDE<br></li><li>Appelle Cetelem pour lui dire le nombre exact de grilles livrées<br></li><li>Laisser les grilles là et passer faire des gros bibis aux humains<br></li></ul><div><br></div><p></p>', NULL, 0, 'Local des 24H', 3, 'non'),
(791, 21, 415, NULL, 'Conducteur Rendu du matos BDE/Pool', '<p></p><ul><li>RDV au local des 24</li><li>Retrouve Cetelem (Alexis 06 80 52 08 62)</li><li>Demande les clefs de Bradley le 20m3 aux humains de l''ambiance</li><li>Charger le matos du BDE et du pool des clubs trié par la log (tu sais, celui qui porte des chaises et l''autre qui branche des fils) dans Bradley</li><li>Aller se garer devant le BdE</li><li>Décharger le matériel du 20m3 dans le premier étage de la MDE (bien en mettre partout pour bien montrer qu''on est chez nous) pendant que Cetelem trouve quelqu''un avec qui faire l''état des lieux</li><li>Quand tout le matos est déchargé,</li><li>Faire des gros bibis</li><li>Rentrer au local en 20m3</li><li>Rendre les clefs du 20m3 aux humains</li><li>Se pignoler au local</li></ul><p></p>', NULL, 1, 'Local des 24H', 3, 'non'),
(792, 21, 415, NULL, 'Rendu du matos BDE/Pool', '<p></p><ul><li>RDV au local des 24</li><li>Retrouve Cetelem (Alexis 06 80 52 08 62)</li><li>Demande les clefs de Bradley le 20m3 aux humains de l''ambiance</li><li>Charger le matos du BDE et du pool des clubs trié par la log (tu sais, celui qui porte des chaises et l''autre qui branche des fils) dans Bradley</li><li>Aller se garer devant le BdE</li><li>Décharger le matériel du 20m3 dans le premier étage de la MDE (bien en mettre partout pour bien montrer qu''on est chez nous) pendant que Cetelem trouve quelqu''un avec qui faire l''état des lieux</li><li>Quand tout le matos est déchargé,</li><li>Faire des gros bibis</li><li>Rentrer au local en 20m3</li><li>Rendre les clefs du 20m3 aux humains</li><li>Se pignoler au local</li></ul><p></p>', NULL, 0, 'Local des 24H', 3, 'non'),
(793, 21, 335, NULL, 'Tâche sans nom', 'sfsd', NULL, 0, 'Dépôt AIP', -1, 'non'),
(794, 3, 311, NULL, 'Nettoyer les chambres INSA', '<p><i>Le but de cette tâche est de remettre en état les chambres utilisées le vendredi pour qu''elles puissent être réutilisées la nuit du samedi au dimanche.</i> <i>Aucun artiste n''est hébergé à l''INSA la nuit du vendredi au samedi. Néanmoins, il est possible que les douches d''une ou deux chambres soient utilisées par des artistes le vendredi...</i><br></p><ul><li>Aller au QG Orga (Agora) et retrouver l''autre personne affectée à cette tâche</li><li>Appeler Jérémie (responsable de la tâche) au 06 45 52 58 66 et demander si la tâche a lieu d''être ou non</li><li>Si la tâche n''a pas lieu d''être, demander aux Orgas Humains s''il y a quelque chose à faire<br>OU<br></li><li>Si la tâche doit être effectuée :<br></li><ul><li>Noter les numéros des chambres qui doivent être nettoyées<br></li><li>Demander les clés des chambres aux Orgas Humains</li><li>Prendre 1 balai, 1 seau, 1 serpillère, 1 pelle/balayette, 1 éponges, 1 paire de gants et du produit nettoyant<br></li><li>Se rendre à la résidence où se trouvent les chambres</li><li>Plier les serviettes de bain qui trainent dans les chambres</li><li>Vérifier qu''il n''y a pas de gros poils de cul sur le savon s''il y a un savon dans les chambres<br></li><li>Faire le ménage de toutes les chambres (insister sur la salle de bain et les WC)<br></li><li>S''assurer que toutes les chambres sont bien propres et qu''elles sont prêtes à être aménagées (une autre équipe s''occupera de mettre en place le nécessaire pour la nuit de samedi à dimanche).</li><li>Prendre les serviettes sales<br></li><li>Fermer les chambres</li><li>Retourner au QG Orga<br></li><li>Restituer toutes les clés aux Orgas Humains</li><li>Remettre le matériel de nettoyage où il a été pris<br></li><li>Donner les serviettes sales aux Orgas Humains pour qu''ils les gardent dans un endroit propre</li></ul></ul><p></p>', '1 paire de gants pour le ménage', 0, 'Résidences INSA', 3, 'non'),
(795, 3, 311, NULL, 'Ajouter des matelas dans les chambres STAFF', '<p></p><ul><li>Récupérer les 3 matelas au local</li><li>Les déposer dans les chambres allouées à STAFF Sécurité sans être vu par un quelconque régisseur<br></li></ul><p><b>Si les clés des chambres de STAFF Sécurité n''ont pas pu être récupérées le jeudi, se débrouiller pour déposer les matelas dans les chambres le vendredi !</b><br></p><p></p>', '3 Matelas\r\nLes clés des 3 chambres', 0, 'Résidences INSA', 3, 'non'),
(796, 21, 501, NULL, 'Emmener le matériel des scènes', '<p></p><ul><li>RDV au local des 24H (RdC bâtiment D)<br></li><li>Retrouve Cetelem (Alexis - 06 80 52 08 62)</li><li>Demander les clef d''une voiture et de la cave aux humains</li><li>Récupérer les listes matos Préloges dans le casier log</li><li>Trouver le matos de la liste au local</li><li>Charger tout ça dans la voiture</li><li>Prendre aussi le frigo d''exit</li><li>Aller sur la zone concert</li><li>Trouver Hermione et lui demander où décharger le matériel</li><li>Aller à la cave chercher la 6*4 du karna et l''emmener à hermione</li><li>Ranger la voiture près du bocal</li><li>Rendre les clefs aux humains</li></ul><div></div><p></p>', NULL, 0, 'Local des 24H', 3, 'non'),
(797, 21, 501, NULL, 'Emmener le matériel des scènes', '<p></p><ul><li>RDV des 24H (RdC bâtiment D)<br></li><li>Retrouve Cetelem (Alexis - 06 80 52 08 62)</li><li>Demander les clef de 2 grandes voitures (genre la 4L du poulpe &lt;3), &nbsp;il faut pouvoir mettre 1 ou 2 tables dedans</li><li>Récupérer dans le local :</li></ul>- 2 rouleaux de rubalise<div>- 1 trousse de secours</div><div>- 6 sangles</div><div>- 3 grands balais</div><div>- 2 raclettes à eau</div><div>- 2 serpillères</div><div>- 2 sceaux</div><div>- du savon hydroalcoolique</div><div>- toutes les clés de 17 et 19 qu''il y a au local</div><div>- 3 jerrycan de 30 L</div><div>- 15 paires de gants</div><div>- 15 casques de chantier</div><div>- 6 marteaux</div><div>- 1 rouleau de sac poubelle noir</div><div><ul><li>Charger tout ça dans les voitures</li><li>Aller sur la zone concert</li><li>Trouver Hermione et lui demander où décharger le matériel</li><li>Vider les voitures</li><li>Aller à la DirPat, récupérer les clefs de la cave du PC</li><li>Récupérer 4 chaises et 2 tables 2 places (pas du fond)</li><li>Les mettre comme tu peux dans les voitures</li><li>Ramener tout ça à Hermione</li><li>Ranger les voitures près du bocal</li><li>Rendre les clefs aux humains</li></ul></div><p></p>', NULL, 0, 'Grande scène', -1, 'non'),
(798, 21, 354, NULL, 'Tri du matos post-manif', '<p></p><ul><li>RDV au local des 24 Heures (RDC bâtiment D)<br></li><li>Retrouve Cetelem (06 80 52 08 62)</li><li>Demande lui son code couleur pour le matos s''il n''est pas écrit au tableau</li><li>Range le matos en différents tas suivant la couleur du scotch qui est dessus (BDE et pool des clubs, forum, 24H, dirpat, ...)</li><li>Faire un tas cave dehors</li><li>Nettoie le matos qui est sale</li><li>Si quelquechose n''est pas marqué, c''est mal, demande à Cetelem où le mettre (il a déjà une réponse pour toi)</li><li>Quand tout est propre et ranger, trouver les clefs d''un 20m3 et de la cave (les humains seront entre le QG et le bocal)</li><li>Charger le 20m3 avec le matos qui va à la cave</li><li>Aller à la cave (bât E) et tout décharger</li><li>Ranger un minimum pour qu''on puisse encore passer</li><li>Retourner au local</li><li>Garer le 20m3</li><li>Rendre les clefs (camion+cave) aux humains</li><li>Tuer la personne qui a déranger ce que vous avez fait il y a 30 minutes</li><li>Mourir tranquillement dans un canapé</li></ul><p></p>', NULL, 0, 'Local des 24H', 3, 'non'),
(799, 21, 502, NULL, 'Transport de frigos', '<p></p><ul><li>RDV au local des 24 heures (rdc bâtiment D)<br></li><li>Retrouve Cetelem (06 80 52 08 62)<br></li><li>Trouver des diables au local<br></li><li>Demander les clés de la cave du E et du club rock aux humains<br></li><li>Aller à la cave<br></li><li>Sortir les frigos (il devrait y en avoir aux alentours de 4/5) Cetelem a la liste précise<br></li><li>Refermer la cave</li><li>Emmener les frigos au club rock (bât H, en face de la cave, à côté du karna)<br></li><li>Ramener les clés de la cave et les diables au local</li></ul><div><div><br></div></div><p></p>', 'Diable 2', 0, 'QG Orga', 3, 'non'),
(800, 21, 502, NULL, 'Livraison de frigos', '<p>QG -&gt; dirpat -&gt; cave PC -&gt; dirat -&gt; bars -&gt; QG</p>', NULL, 0, 'Local des 24H', -1, 'non'),
(801, 16, 503, NULL, 'Dépose des ext. V-16h00', '<p>Retrouve le Poulpe au QG orga. Prend des clefs d''une grande voiture au QG orga et monte dedans.<br><br>Embarque des extincteurs:<br>- C02 2kg : 2<br>- CO2 5kg : 5<br>- Eau : 13<br>- Poudre : 1<br></p>\r\n<p><br>Dépose les ext. permanents :<br></p>\r\n<ul>\r\n<li>Stand Accueil : 1 CO2 2kg; 1 Eau; 1 Poudre<br></li>\r\n<li>Grande Scène : 1CO2&nbsp; 5kg; 1 Eau</li>\r\n<li>Régie gde scène : 1CO2&nbsp; 5kg; 1 Eau<br></li>\r\n<li>Petite Scène : 1CO2&nbsp; 5kg</li>\r\n<li>Régie Petite Scène : 1CO2 2kg<br></li>\r\n<li>Toilettes Nord : 1 Eau<br></li>\r\n<li>Toilettes Sud : 1 Eau</li>\r\n<li>Stand Bouffe : 1 CO2 5kg<br></li>\r\n<li>Concession : 1 Eau</li>\r\n<li>Backline : 1 CO2 5kg; 1 Eau<br></li></ul>\r\n<p><br>Dépose les ext. ZC soirée :</p>\r\n<ul>\r\n<li>bar AIP : 1 Eau</li>\r\n<li>bar Kfet : 1 Eau</li>\r\n<li>bar Piscine : 1 Eau</li>\r\n<li>bar Cetiat : 1 Eau</li>\r\n<li>bar Manège : 1 Eau</li>\r\n<li>caisses : 1 Eau</li></ul>', NULL, 0, 'QG Orga', 3, 'non'),
(802, 16, 503, NULL, 'Déplacer les ext. S-8h00', '<p>Rendez vous au QG orga. Prend des clefs d''une grande voiture et monte dedans.</p><p><br>Récupérer les ext. ZC soirée :</p><ul><li>bar AIP : 1 Eau</li><li>bar Kfet : 1 Eau</li><li>bar Piscine : 1 Eau</li><li>bar Cetiat : 1 Eau</li><li>bar Manège : 1 Eau</li><li>caisses : 1 Eau</li></ul><p>Va chercher ce qu''il manque au creux GCU. Dépose ce que tu as en trop.<br></p><p>Déposer les ext. des anims<br></p><ul><li>Zone Travée Verte : 1 CO2 2kg<br></li><li>Bar MDE : 1 Eau<br></li><li>Scène MdE : 1 CO2 5kg<br></li><li>Fusées : 1 CO2 5 kg<br></li></ul><p><br></p>', NULL, 0, 'QG Orga', 3, 'non'),
(803, 16, 503, NULL, 'Déplacer les ext. S-18h00', '<p>Rendez vous au QG orga. Prend des clefs d''une grande voiture et monte dedans.</p><p>Récupère les ext. des anims<br></p><ul><li>Zone Travée Verte : 1 CO2 2kg<br></li><li>Bar MDE : 1 Eau<br></li><li>Scène MdE : 1 CO2 5kg<br></li><li>Fusées : 1 CO2 5 kg</li></ul><p>Rend toi au creux GCU. Embarque les ext. qui manquent. dépose ceux que tu as en trop<br></p><p><br>Dépose les ext. ZC soirée :</p><ul><li>bar AIP : 1 Eau</li><li>bar Kfet : 1 Eau</li><li>bar Piscine : 1 Eau</li><li>bar Cetiat : 1 Eau</li><li>bar Manège : 1 Eau</li><li>caisses : 1 Eau</li></ul>', NULL, 0, 'zc', 3, 'non'),
(804, 16, 503, NULL, 'Déplacer les ext. D-8h00', '<p>Rendez vous au QG orga. Prend des clefs d''une grande voiture et monte dedans.</p><p><br>Récupérer les ext. ZC soirée :</p><ul><li>bar AIP : 1 Eau</li><li>bar Kfet : 1 Eau</li><li>bar Piscine : 1 Eau</li><li>bar Cetiat : 1 Eau</li><li>bar Manège : 1 Eau</li><li>caisses : 1 Eau</li></ul><p>Va chercher ce qu''il manque au creux GCU. Dépose ce que tu as en trop.<br></p><p>Déposer les ext. des anims<br></p><ul><li>Zone Travée Verte : 1 CO2 2kg<br></li><li>Bar MDE : 1 Eau<br></li><li>Scène MdE : 1 CO2 5kg</li></ul>', NULL, 0, 'zc', 3, 'non'),
(805, 16, 503, NULL, 'Déplacer les ext. D-18h00', '<p>Va chercher les clefs du 11m3 et une clef pompier au QG Oga. Monte dans ton 11m3. Dirige ton vers le creux GCU</p><p>Récupère les extincteurs des anims<br></p><ul><li>Zone Travée Verte (animations) : 1 CO2 2kg<br></li><li>Bar MDE : 1 Eau<br></li><li>Scène MdE : 1 CO2 5kg</li><li>Concession : 1 Eau<br></li></ul><p>Rend toi au creux GCU. Embarque les ext. qui manquent. dépose ceux que tu as en trop<br></p><p><br>Dépose les ext. soirée du dimanche :</p><ul><li>Bar AIP : 1 Eau</li><li>Bar Kfet : 1 Eau</li><li>Feu d’artifice : 5 Eau</li><li>Cinéma Plein air : 1 CO2 5kg<br></li></ul>', NULL, 0, 'QG Orga', 3, 'non'),
(806, 16, 503, NULL, 'Ranger les ext. L-1h00', '<p>Retrouve le Poulpe au QG orga.</p><p>Récupère tout les extincteurs.<br></p><p>Ranger les ext. soirée du dimanche :</p><ul><li>Bar AIP : 1 Eau</li><li>Bar Kfet : 1 Eau</li><li>Feu d’artifice : 5 Eau</li><li>Cinéma Plein air : 1 CO2 2kg<br></li></ul><p>Ranger les ext. permanents :<br></p><ul><li>Stand Accueil : 1 CO2 2kg; 1 Eau; 1 Poudre<br></li><li>Grande Scène : 1CO2&nbsp; 5kg; 1 Eau</li><li>Régie gde scène : 1CO2&nbsp; 5kg; 1 Eau</li><li>Toilettes Sud : 1 Eau</li><li>Stand Bouffe : 1 CO2 5kg<br></li><li>Concession : 1 Eau</li><li>Backline : 1 CO2 5kg; 1 Eau<br></li></ul><p>Vérifier que tout les extincteurs sont rangés dans le creux GCU. A savoir :</p><ul><li>7 CO2 2kg<br></li><li>5 CO2 5kg<br></li><li>14 Eau&nbsp; <br></li><li>2 Poudre<br></li></ul>', NULL, 0, 'zc', 3, 'non'),
(807, 12, 504, NULL, 'Test voiture', '<p>bvdsgbdshre</p>', NULL, 1, 'Ici', -1, 'non'),
(808, 28, 496, NULL, 'Rendez les Vaubans (2)', '<p>En arrivant sur le campus, récupérer un fen pour le chargement du semi.</p><div>Guider le semi vers le dépôt du bâtiment F.<br>Charger le semi<br>Aller rendre le tout au dépôt du Grand Lyon (ne pas oublier le papier du dépôt):<br><b>18 avenue de la République 69200 Vénissieux<br></b>Attendre qu''ils vident le semi<br>Repartir sur le campus avec le semi</div><div>Le faire se poser le long de Niels Bohr, au niveau du dépôt de barrières<br>Envoyer le chauffeur BL à la bouffe artiste pendant que tu charge à nouveau le semi.</div><p></p>', 'le papier du dépôt', 0, 'Lyon city beach!', 3, 'non'),
(809, 28, 496, NULL, 'Rendez les Vaubans (3)', '<P></P>\r\n<UL>\r\n<LI>Quand le chauffeur a finis de manger, il revient vers le semi (RDV à 13h au semi)<BR></LI>\r\n<LI>Normalement il est tout chargé avec les barrières de la ZC, sangler le tout et repartir<BR></LI>\r\n<LI>Direction le dépôt de la ville de Lyon&nbsp;(ne pas oublier le papier du dépôt)&nbsp;: 44 boulevard Jean XXIII, Lyon 8ème<BR></LI>\r\n<LI>La bas, on décharge les vaubans de la ville de Lyon (200)&nbsp;<BR></LI>\r\n<LI>Puis on repart direction dépot du grand Lyon<BR></LI>\r\n<LI>Aller rendre le tout au dépôt du Grand Lyon (ne pas oublier le papier du dépôt):<B>18 avenue de la République 69200 Vénissieux</B></LI>\r\n<LI>Attendre qu''ils vident le semi<BR></LI>\r\n<LI>Repartir sur le campus avec le semi<BR></LI>\r\n<LI>Le faire se poser le long de Niels Bohr, au niveau du dépôt de barrières<BR></LI></UL>\r\n<P></P>\r\n<DIV><BR></DIV>', 'Les papiers du dépôt', 0, 'Lyon city beach!', 3, 'non'),
(810, 28, 387, NULL, 'Débarrierage Journée', '<p>Se réunir devant la grande scène<br><br>Retirer le barrièrage qui se trouve devant la régie en journée.<br><br>Ranger la vingtaine de vaubans derrière l''AIP<br></p>', NULL, 0, 'ZC', 3, 'non'),
(811, 21, 406, NULL, 'Récupération petit matos DirPat', '<p></p><ul><li>RDV au local des 24<br></li><li>Retrouve Cetelem<br></li><li>Demande lui la liste "petit matos dirpat"<br></li><li>Demande la clef de deux voitures (à grands coffres !) aux humains<br></li><li>Aller à la dirpat<br></li><li>Dire bonjour<br></li><li>Récupérer tout le petit matos qui est sur la liste<br></li><li>Attendre que le gros Cetelem aille chercher les clés à la DirPat<br></li><li>Remercier<br></li><li>Rentrer au local<br></li><li>Mettre un bout de scotch orange sur chaque truc (Cetelem te donnera du scotch élec)<br></li><li>Rendre les clés de voiture aux humains<br></li><li>Ranger la liste du matos dans le casier log<br></li><li>Manger du saucisson</li></ul><p></p>', NULL, 0, 'Local des 24H', 3, 'non'),
(812, 218, 466, NULL, 'Briefing Softs', '<p>Rends toi au local des 24 où tous les plannings imprimés des softs se trouvent.</p><div><br></div><div>Les récupérer tous et se rendre dans l''amphi XXXX où a lieu le briefing soft.</div><div><br></div><div>Et alors là tu vas payer ton charisme comme jamais!!!!</div><div><br></div><div>Vends du rêve pendant le briefing et ne pas bafouille pas.&nbsp;</div><div><br></div><div>L''étape la plus difficile : réussir le test du talkie.&nbsp;</div><div><br></div><div>Distribue les plannings à la fin du briefing et 1 planning=1 t-shirt orga!</div><div><br></div><div>Ramène les plannings et les t-shirts restants au local</div><div><br></div><div><br></div><p></p>', 'Du charisme!!!', 0, 'Local 24h', 3, 'non (raf)'),
(813, 197, 439, NULL, 'Surveiller la porte de l''ambiance', '<p>&nbsp;Rend toi à l''entrée principale de la&nbsp;Rotonde. Entre, et présente-toi comme étant l''orga 24 qui doit surveiller l''entrée artiste. Si personne ne peut t''aider, appelle Sophia Lescano au&nbsp;<span style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">0699908668, elle te montrera ton poste.</span><br><br>Présente toi comme la relève de la surveillance de porte.</p><p>Ton rôle est simple : Tu gardes<span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;">&nbsp;la porte entrée artiste pour éviter qu''un public perdu ne rentre dans la rotonde par là. En effet, elle peut parfois être ouverte car des joueurs peuvent aller fumer ou prendre l''air 5 minutes, ça évite qu''ils n''aient du mal à re-rentrer. Normalement, si les gens veulent vraiment sortir de la rotonde ils passent par l''entrée principale. Les gens que tu laisses rentrer par la porte entrée artiste doivent avoir leur badge.S''ils ne l''ont pas, renvoie les à l''entrée principale.&nbsp;</span></p><p><font color="#222222" face="arial, sans-serif" size="2"><span style="background-color: rgb(255, 255, 255);">De plus, </span></font>après 18h, la zone est fermée. Ton rôle est aussi de rediriger les spectateurs sortants vers l''arrêt de tram de la doua, pour ne pas qu''ils aillent n''importe où sur le campus.</p><p>Reste en place jusqu''à la relève, ne pars surtout pas avant (la sécu passe en premier !).<br></p><p><span style="background-color: rgb(255, 255, 255); font-family: arial, sans-serif; color: rgb(34, 34, 34); font-size: 13px;">Au moindre problème, appelle le&nbsp;</span><span style="line-height: 20px; background-color: rgb(255, 255, 255); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); font-size: 14px;">0699908668 (Sofia, resp'' 14h d''impro. Elle te briefera si tu n''as pas compris ton rôle)</span></p><p>Si tu es le dernier, vérifie bien que la TTI se charge de fermer la Rotonde.</p>', NULL, 0, 'Rotonde', 3, 'non'),
(814, 12, 466, NULL, 'Briefing Hard', '<p>Rend toi dans l''amphi xxx retrouver tous les orgas hard charismatiques de cette 40e edition des 24h de l''INSA!!!!</p><div><br></div><div>Tu vas maintenant être briefé sur le fonctionnement de la manif, les talkies et tout et tout!</div><div><br></div><div>Bien évidemment la présence est obligatoire, on prendra les présences!</div><div><br></div><div>Gros bibis</div><div><br></div><div>Signé l''Humain qui t''aime</div><p></p>', NULL, 0, 'QG', 3, 'non'),
(815, 31, 505, NULL, 'Tourne en rond', '<p>Bonsoir, il commence à se faire tard et il va falloir commencer à surveiller le superbe circuit des courses.</p>\r\n<div>Pour cela il faut :</div>\r\n<div>\r\n<ul>\r\n<li>&nbsp;récupérer une des clés de voiture balai au QG pédales (en journée un tour en vélo/vélo''v peut suffire, t''es une pédale après tout alors PEDALE!), 1 talkie, 1 gilet de sécurité et 1 balai (de cantonnier de préférence) pour le premier créneau</li>\r\n<li>Aller chercher la voiture sur le parking colette besson</li>\r\n<li>Fais ton petit tour, t''es pas obligé de tourner non stop pendant 1h ! tu fais juste 1 ou 2 tours tous les 15 / 20 min, fait gaffe au coureur qui bombardent et qui ne font pas attention à toi.</li>\r\n<li>Ramasse ce qui traîne et remet les barrières sur pied si certaine sont tombées "accidentellement".</li>\r\n<li>Prévient quand même le village coureurs si il y a un problème pour pouvoir faire une annonce aux coureurs</li>\r\n<li>Remet les clés de la voiture à ton successeur.<br></li></ul>\r\n<div>Pour le dernier créneau remet tout dans le QG pédale ( pense à récupérer les clés centralisées au village coureur surement )</div></div>\r\n<p></p>', NULL, 1, 'Campus', 3, 'non'),
(816, 31, 506, NULL, 'Kit obstacle', '<p>Imprimer le Plan des objets à marquer</p>\r\n<div>Mettre dans le kit:</div>\r\n<div>\r\n<ul>\r\n<li>Sacs poubelle</li>\r\n<li>Gants jetables</li>\r\n<li>Bombe fluo</li>\r\n<li>Plan des points à marquer</li></ul>\r\n<div>Mettre tout ça dans un sac poubelle et coller un truc dessus qui dit que c''est le Kit obsctacles</div></div>\r\n<p></p>', 'sacs poubelles, gants jetables, Bombe pédale, plan des point à marquer', 0, 'Bocal', 3, 'non'),
(817, 31, 506, NULL, 'Kit "Stationnement gênant"', '<P>-Tu te mets devant un PC<BR>-Tu réalises un fly pour les&nbsp;véhicules.</P>\r\n<P>- Eventuellement voir si on retrouve pas celle de la 39 pour gagner du temps.<BR>-Tu sauvegardes (dossier orga/barrière)<BR>-Tu imprimes 140 exemplaires (4 par feuille)</P>\r\n<P>-Mets un coup de massicot (attention aux doigts!)<BR>- Les mettre dans le kit<BR>- Mettre le plan des courses dans le kit pour que le soft puisse voir où est le circuit</P>', NULL, 0, 'Bocal', 3, 'non'),
(818, 31, 507, NULL, 'Identifier les obstacles', '<p>Va au bocal et imprime un plan des courses (voir en double)</p><div>Prend tes jambes ou un vélo et fait le parcours</div><div>Te perd pas pour pouvoir noter sur le plan dés que tu vois un obstacle.</div><div>Quand tu aura fini, va au local scan ton plan et met le sur le serveur pour garder une trace.</div><div><br></div><p></p>', NULL, 0, 'Campus', -1, 'non'),
(819, 31, 507, NULL, 'Repérer les obstacles', '<p>Aller au local des 24 heures</p><div><br></div><div>Prendre le Kit obstacle, vérifier qu''il y a bien les parcours AVEC les obstacles signalés dessus.</div><div><br></div><div>Aller faire un tour des parcours et "signal" les obstacles qui pourront poser problème.</div><div><br></div><div>Dépose le Kit au QG pédales (local de l''insatiable en bas du bâtiment H)</div><p></p>', 'Kit obstacles', 0, 'Campus', 3, 'non'),
(820, 31, 507, NULL, 'Vérif'' et  nettoyage du circuit', '<p>RDV au QG Pédales (Local de l''insatiable en bas du bâtiment H)</p><div><ul><li>récupérer deux vélo''v, deux balais, de la rubalise et le plan du parcours de la course</li></ul><div>Faire le tour du circuit des courses (vélo et course à pied)</div></div><div><ul><li>nettoyer les déchets (plus particulièrement le verre sur le circuit/ graviers dans les virages)</li><li>remettre les barrières /rubalise</li><li>Signaler tous gros problèmes à Ron (06 70 45 68 23)</li></ul><div>Une fois les deux circuits sécurisés, ramener les vélos au village coureur et les balais au QG pédales.</div></div><p></p>', 'Ta soeur pour que ça frotte ! :)', 0, 'Campus', 3, 'non'),
(821, 31, 508, NULL, 'Conducteur - Aller chercher les Vélo''v', 'Récupérer auprès des humains le contrat signé par Cheval. Assure toi que la chaine et le cadenas sont au local ou au village coureur.<br><br>Aller chercher une clé de 20m3 et prendre le 20m3.<br><br>Rejoindre le point de rendez-vous (INSA-Einstein) pour retrouver Cyclocity (Florian Racinet : 06 62 75 39 04) avec les 10 Vélo''v.<br><br>Récupérer les vélos et en ramener 8 au Village Coureurs. En laisser 2 au QG orga.<br><br>Rendre le 20m3 avec la clé.<br><p> </p>', 'Le contrat de prêt\r\nUne "attestation" d''assurance/garantie des Vélo''v\r\nDu muscle\r\nCadenas, chaîne\r\nClé de 20m3', 2, 'INSA-Einstein', 3, 'non'),
(822, 31, 509, NULL, 'Préparation Kit inscriptinos', '<p>Se rendre au local</p><div><br></div><div>Imprimer la fiche briefing (serveur pédales)</div><div><br></div><div>Faire le Kit avec:</div><div><br></div><div><ul><li>Ciseaux</li><li>Fiche birefing</li><li>Scotch</li><li>4 ou 5 affiches courses</li><li>Agrafeuse</li><li>Marqueur</li><li>Stylos</li><li>Feuilles blanches &amp; brouillons (prévoir large)</li></ul><div>Ranger le kit sur l''étagère pédale</div></div><p></p>', 'Stylos\r\nFeuilles blanches (brouillons)\r\nFiche briefing', 0, 'local des 24h', 3, 'non'),
(823, 31, 508, NULL, 'Restituer les Vélo''v', '<p>Aller chercher les 8 Vélo''v du Village Coureurs<br><br>Les remettre correctement (voyant vert etc.) sur une des bornes Vélo''v proches du campus (où il y a assez de places)</p><p>Faire de même avec les 2 vélos du QG orga.<br></p><p>Ramener la chaîne et le cadenas au QG orga.<br></p>', 'Les Vélo''v', 0, 'Village Coureurs', 3, 'non'),
(824, 31, 509, NULL, 'Tenir Stand inscription', '<p>Rendez-vous au Qg Orga pour retrouver tes co-tâches :&nbsp;</p><p>Récupérer au local de l''insatiable (Rdc H) :<br></p><ul><li>le kit stand inscription&nbsp; (avec FAQ)<br></li><li>les classeurs (x4) comprenant les dossiers des participants<br></li><li>le PC de Ron</li><li>les Tshirts coureurs</li><li>Prendre les cartons de sacs coureurs triathlon, pied, natation et vélo&nbsp;</li><li>Les mettre dans le caddies</li><li>Tout amener sur les stands des inscriptions sur le parking Colette Besson.</li></ul><p>Disposer deux tables et deux chaises du village coureur au village coureur</p><p>Scotcher la feuille "inscriptions courses" et des affiches sur les tables<br>(essaye de le faire de manière charismatique, histoire de donner aux gens l''envie de s''inscrire)</p><p>Vérifier les inscriptions et distribuer les sacs coureurs.</p><p>En cas de doute, demander aux orgas courses !<br></p><p>************************</p><p>Être adorable avec les coureurs (ils vont s''investir durant 24heures !)</p><p>Arrêter les inscriptions à partir de 12h<br></p><p>A la fin, nettoyer et remettre les 2 tables et les 2 chaises en place</p><p>Ramener le kit stand inscription et les classeurs au QG Pédales (= l''Insatiable)</p><div>Laisser le PC de Ron au village coureur</div>', 'Kit inscription\r\nSacs coureurs\r\nTshirts coureurs', 0, 'QG', 3, 'non'),
(825, 32, 511, NULL, 'Distribution bracelets Insaliens jeudi aprem', '<p>Le but est de donner en avance les bracelets correspondants aux pass 2 jours aux Insaliens pour limiter l''attente aux points de contrôle vendredi soir.<br><br>-Retrouve Clara au bocal (qui aura pas oublié de charger préalablement les fichiers dans la douchette..... inch''allah)<br><br>-Allez à l''entrée du festival avec la clé de l''Algeco, un carton de bracelets, une douchette Weezevent <br><br>- Attendez les insaliens #ambiance<br><br>-Une personne scanne les billets puis les GARDE et les met dans un carton<br><br>-L''autre personne est chargée d''attacher les bracelets aux insaliens (ne pas leur donner mais bien les attacher)<br><br>-Quand il n''y a plus personne vers 18 heures, revenir au local, ramener les billets et les bracelets restants, fermer l''Algeco<br></p>', 'bracelets festivalier, douchette weezevent, carton vide, clé de l''algeco', 0, 'Entrée festival', 3, 'non'),
(826, 209, 488, NULL, 'Mettre en place le paravent', '<p></p><ul><li>RdV au QG orga<br></li><li>Retrouve tes co-taches<br></li><li>Demande 15 colsons et un cutter</li><li>Va au dépôt humas et trouve la moquette étiquetée "12h de danse"<br></li><li>Emmène la près du podium qui est sur la pelouse des humas<br></li><li>Va chercher 3 barrières heras et 4 plots contre le bâtiment GMC derrière la scène (si tu meurs, va prendre un caddie dans le dépôt AIP pour les plots et ramène le après)<br></li><li>Emmène les à côté du podium<br></li><li>Derrière le podium, à côté des arbres, met en place les barrières et les plots en forme de "U"<br></li><li>Appelle Cetelem (au talkie ou au 06 80 52 08 62) et dit lui de venir voir s''il a le temps</li><li>Accroche la moquette sur les barrières grâce au colson et cutter</li><li>Au final : on ne doit plus voir l''intérieur du U (avec les arbres, ça doit former un paravent pour que les danseurs/ses puissent se changer à l''abris des regards)<br></li><li>Ramène le cutter et les colsons en trop au QG</li><li>Fait des gros bibis aux humains et montre leur ta bonne ambiance ! Tu auras un cadeau !</li></ul><p></p>', NULL, 0, 'QG Orga', 3, 'non'),
(827, 209, 488, NULL, 'Démonter le paravent', '<p>RDV au QG orga</p>\r\n<div>Retrouve tes co-tâches</div>\r\n<div>Demande une paire de ciseaux ou une pince coupante (pour les colsons) si tu n''en as pas sur toi</div>\r\n<div>Va sur le podium sur la pelouse des humas (là où il y avait de la danse)</div>\r\n<div>Enlève la moquette des barrières</div>\r\n<div>Emmène les barrières et les plots contre le bâtiment GMC derrière la scène</div>\r\n<div>Si la moquette est en bon état, la ramener au QG</div>\r\n<div>Sinon la jeter dans la benne derrière la K-fêt</div>\r\n<div>Ramener le matériel au QG</div>\r\n<div>Aller se pignoler devant le concert de jazz parce que charisme</div>\r\n<p></p>', NULL, 0, 'Podium Humas', 3, 'non'),
(828, 45, 468, NULL, '24opoly dans le chalet backline', '<p>Le chalet de la backline a été monté !</p><div><br></div><div>Du coup pour bien montrer à tout le monde qu''on est chez nous, on squate dedans et on fait un 24opoly all night long.</div><div>Allez viens ! Ca va être bien.</div><div><br></div><div>Je beaucoup sur vous luc...</div><p></p>', 'Du charisme, de la bière, du whyskey, de la vodka, de la tequilla, du rhum, du pisang, du get 27, du pastis, et tout autre alcool dégueu présent sur le 24opoly.', 0, 'Chalet backline', 3, 'non'),
(829, 45, 307, NULL, 'Conducteur - Livraison matos pour concert Pastorius', '<p>Va récupérer un 20m3 au QG orga et va vers la grande scène prendre tes instructions de Hermione (resp grande scène, demande aux gens si tu trouve pas).</p><div><br></div><div>Le but est de conduire le camion pour transporter le matériel des zikets pour leur concert du soir. Ils te diront quoi faire.</div><div><br></div><div>Youpi.</div><div><br></div><div><br></div><p></p>', NULL, 2, 'Grande scène', 3, 'non'),
(830, 14, 512, NULL, 'Emmener les étagères à la BA', '<p></p><ul><li>RDV à la MDE<br></li><li>Retrouve Nico<br></li><li>Appeler le Troll et voir comment ça se passe</li><li>Aller à la dirpat<br></li><li>Demander les clés de Doc INSA : "Coucou Maud ! Bouge ton cul et viens ouvrir Doc INSA ! Tu vas passer une bonne semaine !"<br></li><li>Aller à Doc INSA<br></li><li>Récupérer 4 étagères<br></li><li>Refermer Doc INSA<br></li><li>Emmener les étagères à l''étage de la MDE (le troll t''attend, tu es en retard mais t''as pas le choix)</li><li>Aller rendre les clefsde Doc INSA à la Dirpat<br></li><li>Rentrer au Local<br></li><li>Wheeeeeeeee ! La semaine a bien commencé !<br></li></ul><p></p>', NULL, 0, 'MDE', 3, 'non'),
(831, 21, 512, NULL, 'Conducteur Livraison matos BA', '<p></p><ul><li>RDV au local des 24 (RDC bât D)<br></li><li>Retrouve Cetelem (Alexis - 06 80 52 08 62)<br></li><li>Lui demander la liste du matos de la bouffe artiste</li><li>Demander la clef de deux voitures (à grand coffre) aux humains<br></li><li>Charger tout le matos dans les voitures<br></li><li>Aller à la MdE<br></li><li>Décharger le matos à l''étage chez le troll</li><li>Ramener les voitures au local et rendre les clefs</li></ul><div><p></p></div>', NULL, 1, 'Local des 24 Heures', 3, 'non'),
(832, 21, 512, NULL, 'Ramener les étagères', '<p></p><ul><li>RDV à l''étage de la MDE<br></li><li>Retrouve Cetelem (Alexis - 06 80 52 08 62)<br></li><li>Apporte lui de la bonne humeur, de l''énergie et surtout de l''ambiance !<br></li><li>Demande lui s''il a bien les clés de Doc INSA<br></li><li>Prend ton courage à 2 mains<br></li><li>Demande lui une paire de gants<br></li><li>Prend 2 étagères de doc INSA (trucs verts dégueux)<br></li><li>Les emmener à Doc INSA<br></li><li>Les "ranger"<br></li><li>retrourner à la MDE et recommencer avec les 2 autres étagères &lt;3</li><li>Va rendre les clefs de Doc INSA à la Dirpat<br></li><li>Rentre à ta maison<br></li></ul><p></p><div><br></div><p></p>', NULL, 0, 'MdE', 3, 'non'),
(833, 219, 481, NULL, 'Tâche sans nom', '<p>hjbgvgyv</p>', NULL, 0, 'QG orga', -1, 'non'),
(834, 48, 513, NULL, 'Installer SOS homophobie', '<p></p><ol><li> Retrouver ton copain orga au QG</li><li>Allez récupérer le matos pour le stand au dépôt AIP (2 tables, 5 chaises, 2 grilles d''exposition)</li><li>Apporter tout ça sur le lieu de l''anim (pelouse des humas)</li><li>Attendre que Lapinette (06 83 94 25 97) arrive avec SOS homophobie</li><li>Dire bonjour <br></li></ol><p></p>', NULL, 0, 'QG orga', 3, 'non'),
(835, 48, 513, NULL, 'Bye Bye SOS Homophobie', '<p></p><ol><li>Se rendre au stand (pelouse des humas devant le bar bouffe)</li><li>Y retrouver Lapinette (06 83 94 25 97)<br></li><li>Sourire aux gentils gens et leur demander comment ça c''est bien passé</li><li>Récupérer tout le matos du stand (2 tables, 5 chaises, 2 grilles d''expos)</li><li>Allez ranger tout ça dans le dépôt AIP</li><li>Dire au revoir <br></li></ol><p></p>', NULL, 0, 'Au stand de l''animation', 3, 'non'),
(836, 21, 512, NULL, 'Aller chercher les clés de Doc INSA', '<p>Aller à la Dirpat&nbsp;</p><div>Demander les clefs de Doc INSA (bla bla bla on fait attention, bla bla bla)</div><div>Aller à l''étage de la MDE retrouver les orgas qui t''aident à porter les étagères de la BA (le troll dans ton &lt;3)</div><p></p>', NULL, 0, 'MdE', 3, 'non'),
(837, 21, 512, NULL, 'Emmener le four à la BA', '<p></p><ul><li>RDV au QG orga<br></li><li>Demande le four aux mamans<br></li><li>Débranche le<br></li><li>Emmène le à l''étage de la MDE (si c''est fermé, appelle le troll au 06 61 41 15 17 ou au talkie depuis le QG)<br></li><li>Donne le au Troll (il sera con.tent)<br></li><li>Mange un morceau<br></li><li>Rentre vite au QG avant de finir menotté<br></li></ul><p></p><p></p>', NULL, 0, 'QG Orga', 3, 'non');
INSERT INTO `Tache` (`id`, `responsable_id`, `groupetache_id`, `importid`, `nom`, `consignes`, `materielSupplementaire`, `permisNecessaire`, `lieu`, `statut`, `commentaireLog`) VALUES
(838, 21, 512, NULL, 'Emmener l’agrafeuse murale à la BA', '<P>Appelle le Troll et dit lui d''aller chercher l''agrafeuse murale au QG</P>\r\n<P></P>', NULL, 0, 'MdE', 3, 'non'),
(839, 21, 512, NULL, 'Ramener l''agrafeuse au QG', '<p>Juste ramèner l''agraffeuse au QG orga<br></p><div>C''est tout, merci !</div><p></p>', NULL, 0, 'MdE', 3, 'non'),
(840, 21, 512, NULL, 'Emmener les frigos de la BA', '<p></p><ul><li>RDV au local des 24 Heures (rdc bat D)<br></li><li>Retrouver Cetelem (Alexis - 06 80 52 08 62)<br></li><li>Récupérer les 3 diables et les clefs de la cave du E vers les humains<br></li><li>Aller à la cave (rdc bât E)<br></li><li>Récupérer les 6 plus gros frigos<br></li><li>Fermer la cave<br></li><li>Les emmener à l''étage de la MDE&nbsp;<br></li><li>Essayer de trouver le Troll, sinon les poser là :)<br></li><li>Ramener les diables au local<br></li><li>Rendre les clefs de la cave aux humains<br></li></ul><p></p><div><div><br></div><div><br></div><div><br></div></div><p></p>', NULL, 0, 'MdE', 3, 'non'),
(841, 21, 512, NULL, 'sbdj', '<p>bibite</p>', NULL, 0, 'MdE', -1, 'non'),
(842, 21, 514, NULL, 'Putsh', '<p>Rendez-vous au QG secret (Nom de code Kremlin)</p><div>Retrouvez Vladimir le Vert et Kim-Jun-Oung le Jaune</div><div>Organisez la résistance</div><div>Renversez l''humain</div><div><div>Rendez le pouvoir !</div></div><div><br></div><div>Prévoyez le saucisson pour les résitants d''un certain QG plein de couscous</div><p></p>', 'Bayonettes 24', 0, 'QG secret', -1, 'non'),
(843, 14, 415, NULL, 'Récupération des 3*3 Caluire', '<p>Retrouve Nico (06 32 03 33 74) au local des 24 Heures (RdC batiment D)</p><p>Va voir les zumains et demande leur les clés de la plus grande voiture (genre celle de Fatna ou Ron)<br>Va à caluire et retrouve Monsieur Joseph Villard le responsable matos de la mairie (qui se trouve à cette adresse :&nbsp;<span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; line-height: 16.1200008392334px; background-color: rgb(255, 255, 255);">Place de l''Hôtel de ville, 69300 Caluire-et-Cuire</span>)</p><div>Prends les 2 tentes 3*3</div><div>Dépose les tentes 3*3 au local</div><div>Rends les clés aux zumains</div><div><br></div><p></p>', NULL, 0, 'Local des 24H', 3, 'non'),
(844, 21, 501, NULL, 'Livraison de tatamis', '<p></p><ul><li>RDV au QG orga<br></li><li>Retrouver Cetelem (Alexis - 06 80 52 08 62)<br></li><li>Demander la clé de Brandon le 20m3, une clé pompier et de la cave du E aux humains<br></li><li>Aller à la cave, se garer le plus près possible (clef pompier power !)<br></li><li>Récupérer 12 tatamis (yeah !)<br></li><li>Les charger dans Brandon<br></li><li>Refermer la cave<br></li><li>Aller au dépôt AIP<br></li><li>Décharger les tatamis dans un coin<br></li><li>Ranger Brandon et rendre les différentes clefs aux humains<br></li></ul><div><br></div><p></p>', NULL, 0, 'QG Orga', 3, 'non'),
(845, 21, 501, NULL, 'Mise en jambe', '<div>RDV au local des 24<br></div>', NULL, 0, 'Grande scène', -1, 'non'),
(846, 21, 415, NULL, 'Sortir les matelas de la cave de la SA', '<p>RDV au local des 24</p><div>Récupérer les clefs de la cave<br><div>Aller au E</div><div>Trouver le régisseur du E qu''on appellera ici Luc pour plus d''incompréhension (tu le trouves pas ? Appelle le !&nbsp;06 86 04 52 10)<br><div>Demander à Luc pour accéder à la cave de la semaine asiatique (on a perdu les clefs, on voudrait juste récupérer un truc dedans)<br></div><div>Descendre dans la cave, il y a une affiche rouge sur la porte de la SA</div><div>Ouvrir la porte</div><div>Sortir tous les matelas et les mettre bien dans la partie commune</div><div>Compter les matelas</div><div>Noter le nombre de matelas</div><div>Refermer la cave de la SA</div><div>Refermer la cave</div><div>Rendre les clefs à Luc</div><div>Retourner au local et ranger les clefs de la cave</div><div>Envoyer un sms/mail/pigeon voyageur à Cetelem pour lui dire combien on a de matelas</div></div></div><p></p>', NULL, 0, 'Local des 24H', 3, 'non'),
(847, 21, 415, NULL, 'Récupérer le lino au club rock', '<p>RDV au QG orga</p><div>Retrouve tes co-tâches<br><div>Demande les clés du club rock aux humains et prend du bon scotch</div><div>Aller au club rock (rdc bât H, à côté du karna)</div></div><div>Récupérer les 2 rouleaux de lino</div><div>Refermer le club rock</div><div>Emmener le lino sur le podium des humas (podium derrière la scène)</div><div>Mettre en place le lino sur le podium<br></div><div>Remettre le scotch et les clés au QG</div><p></p>', NULL, 0, 'QG Orga', 3, 'non'),
(848, 14, 415, NULL, 'Retour 3*3 Caluire', '<P>Va au local et demande aux zumains les clés de la plsu grosse voiture (genre celle de Fatna ou ron)</P>\r\n<DIV>Charge les deux tentes 3*3 de Caluire dans la voiture</DIV>\r\n<DIV><BR></DIV>\r\n<DIV>Va à cette adresse :&nbsp;<SPAN style="LINE-HEIGHT: 16.12px; BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: arial, sans-serif; COLOR: rgb(34,34,34); FONT-SIZE: 13px">Place de l''Hôtel de ville, 69300 Caluire-et-Cuire</SPAN></DIV>\r\n<DIV><BR></DIV>\r\n<DIV>Donne les tentes à Joseph Villard le responsable matos de la mairie.</DIV>\r\n<DIV>Rentre au QG et donne les clés aux zumains</DIV>\r\n<P></P>', NULL, 0, 'Local des 24H', 3, 'non'),
(849, 19, 515, NULL, 'Barman Bar K-Fêt', '<p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecter aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">En arrivant au Bar, présente toi au Resp (crie “Resp Orga Bar si tu le trouve pas”). Il va te briefer et t’assigner à un des postes suivants : Tireur - Serveur - Pivot. Tu pourras changer après une heure si tu le souhaite ;).</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Serveur :</span></p><ul style="margin-top: 0pt; margin-bottom: 0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu prends la commande des gens</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu encaisse l’argent et rends la monnaie</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Et finalement tu leur donne à boiiiiire</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">S’ils payent par CB appel le caissier spécial CB</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu danse et mets l’ambiance</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Apprends bien les prix</span></p></li></ul><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Pivot :</span></p><ul style="margin-top: 0pt; margin-bottom: 0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu fais le lien entre les serveurs et les tireures</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu dispose sur la tables les différentes bières et tu dis au tireur ce qu’il faut</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu danse et mets l’ambiance</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tireur :</span></p><ul style="margin-top: 0pt; margin-bottom: 0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu tires les bières en fonction de ce que le pivot te dit</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Si tu as de l’avance (champion !) prépare les bières les plus demandé en avance</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Ton role = moins de mousse possible !</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu danse et mets l’ambiance</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Diverses infos :</span></p><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Dans tous les cas être souriant, joyeux, drôle avec les festivaliers. S’il y a quelqu’un completement ivre qui veux une bière tu vas voir les resp orga bar, il est ton principale interlocuteur et doit savoir tout sur tout. Pour les sirops, on fait les radins, c’est 1cm et pas plus :p. Dernier point, c’est pas open bar, ton resp orga bar te le rappellera.</span></p><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"><br></span></p><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">------------Si ton créneau couvre la fermeture tu devras assurer le nettoyage : pas de soucis, vous êtes beaucoup ça va aller vite --------------------------------------------- </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, et pas de Pression (Live)</span></p>', NULL, 0, 'Devant le creux GCU', 3, 'non'),
(850, 19, 515, NULL, 'Caissier Bar K-Fêt', '<p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecter aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Ta mission est de gérer la caisse du bar, voici le déroulement des taches :</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><ul style="margin-top: 0pt; margin-bottom: 0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">En arrivant au Bar présente toi au Resp Orga Bar, c’est lui qui te briefera et te rappellera les consignes élémentaires.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Apprends aussi bien que tu peux les prix des différentes consos, ça va aller très vite et faudra pas faire d’erreur de calcul. Une fiche sera à ta disposition sur ta table.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Les serveurs vont venir vers toi pour te donner l’argent et c’est à toi de leur rendre la monnaie.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Si ta caisse commence à être bondée, ou s’il commence à plus y avoir de pièce de 50ct, don’t panic, appelle le Resp Orga Bar pour qu’il contact le ravito argent !</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; font-weight: bold; vertical-align: baseline; white-space: pre-wrap;">/!\\ La caisse ne doit jamais être laissée sans surveillance. Ne pars pas tant que la relève n’est pas arrivé, et n’arrive pas en retard à tes créneaux. Dans tous les cas se référer au Resp Orga Bar s’il y a un problème /!\\</span></p><br><span style="font-size: 15px; font-family: Arial; font-weight: bold; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage.</span></p>', NULL, 0, 'Devant le creux GCU', 3, 'non'),
(851, 19, 515, NULL, 'Caissier TPE Bar K-Fêt', '<p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecter aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu es responsable du payement par carte bancaire des festivaliers.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tes missions :</span></p><ul style="margin-top: 0pt; margin-bottom: 0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Te présenter au resp orga bar à ton arrivée</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Récupérer ton matos, vas voir le resp Orga bar si tu as des doutes sur son utilisation (il est censé te former).</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Encaisser les commandes qui se font par carte bancaire.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Garder toujours le TPE avec toi, seuls les Resps ou Orga Bars ont le droit de le prendre à part toi !</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tenir le TPE pendant le payement (les gens partent avec sinon...fail…).</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Donner le premier ticket au client et donner au caissier le deuxième.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Dire au resp Bar s’il y a un problème.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Servir normalement si tu te pignole ;)</span></p></li></ul><div><font face="Arial"><span style="font-size: 15px; line-height: 17.25px; white-space: pre-wrap;"><br></span></font></div><div><font face="Arial"><span style="font-size: 15px; line-height: 17.25px; white-space: pre-wrap;">Note : Si tu as créneau en Journée tu tiens en plus la caisse ! Le resp orga te briefera ;)</span></font></div><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span>', NULL, 0, 'Devant le creux GCU', 3, 'non'),
(852, 19, 515, NULL, 'Resp Bar K-Fêt', '<p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu aux Bars !!!</span></p><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecter aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as déjà assisté au briefing et à la formation donc tu dois être bien au courant de comment ça va se passer. Amènes ta fiche avec toi pour avoir toutes les infos qu’il te faut.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu es le contact privilégié des Orgas Bars (les charismatiques Choppy et Bruce Louis), d’où ton talkie, tu as aussi le rôle de Resp Orga Bar pour la bonne gestion du bar.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tes missions :</span></p><ul style="margin-top: 0pt; margin-bottom: 0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Chercher un talkie en début de créneau au QG orga</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Annoncer aux orgas bars Choppy et Bruce Louis au talkie que tu es là</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Approvisionner en gobelet le bar. Pense à en prendre avant l’ouverture pour tenir un bon moment.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Approvisionner en soft, et veiller à ce que les frigos soit bien comme il faut (Facing de Red Bull notamment.)</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Appeler le rativo arrrrrgent si les caisses sont vides (plus de pièces de 50ct par exemple) ou pleine à craquer. Le resp orga bar te préviendra si c’est le cas.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Gérer la sécurité des bars (personne passe derrière les bars) !</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Approvisionner en bière. Quand un fût est vide, change le avec un en stock, annonce au talkie que tu as besoin d’un fût, écoute la réponse des Orgas Bars, et rends toi au creux GCU. C’est toi qui percute les fûts et les change. Percute le premier fût avant l’ouverture du bar pour être tranquille à l’ouverture. </span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Superviser le bar en général, si tu te pignole aide à servir ou tirer.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Aider au rangement après la fermeture </span><span style="white-space: pre-wrap;"> (le samedi il faudra ramener les tables et les chaises de ton bars au dépôt AIP).</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="white-space: pre-wrap;">En tant que Resp Orga aussi, tu dois t''assurer que tout le monde fais son job, qu''il n''y a personne de ivre (orga bourré = orga viré) et que les barmans donnent pas de bières grauites au festivaliers</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live)</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Contacts : Bruce Louis 07 86 85 59 21 / Choppy </span><span style="font-size: 13px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">&nbsp;</span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">06 67 12 02 16</span>', NULL, 0, 'Devant le creux GCU', 3, 'non'),
(853, 14, 343, NULL, 'Installation éclairage Arches', '<p>Retrouve les zumains au local</p><div>Prends les clés d''une voiture et les clés de la cave<br>Va chercher dans la cave les projos qui sont destinés aux arches (ca sera écrit sur une feuille A4 dans un des sacs poubelles noirs)</div><div>Emmène les aux arches</div><div>Commence le montage des projos</div><div>Rends les clés de la voiture et de la cave aux humains au local</div><div><br></div><div><br></div><div><u>Pour info:</u>&nbsp;les arches seront montées debout à 20h donc il faut que tu ais fini avant</div><p></p>', NULL, 0, 'Bocal', 3, 'non'),
(854, 19, 461, NULL, 'Vérifier Tireuses', '<P>Vérifie que les tireuses sont bien branchées et remplies, fait le si ce n''est pas le cas. Vois avec Nicolas (0632033374) s''il y a quoique ce soit !</P>\r\n<DIV><BR></DIV>\r\n<P></P>', NULL, 0, 'Creux GCU', 3, 'non'),
(855, 19, 461, NULL, 'Remplir le Camion Frigo', '<p>RDV au creux GCU où est garé le camion frigo.</p><div>Prends le plus de softs possibles et stock les dans le camion frigo. Dès que tu as fini, rejoins les autres des Bars au moquettage/signa.</div><p></p>', NULL, 0, 'Creux GCU', 3, 'non'),
(856, 45, 468, NULL, 'Formation Layher', '<p>Tu es chaud comme la braise, tu vois la scène qui se monte tout doucement et tu n''a qu''une envie : mettre toi aussi la main à la pâte !</p><div>Seulement le montage des bars que tu attends avec impatience n''a lieu que demain mercredi...</div><div><br></div><div>Heureusement, pour être sacrément efficaces mercredi, on va s''échauffer le mardi soir !</div><div>Du coup enfile tes plus beaux gants, récupère ton plus joli marteau, enfile tes swaggyswag chaussures de sécu et viens sur la ZC !</div><div><br></div><div>On t''apprendra comment ça marche le layher et tous ensembles on va commencer à construire la rampe PMR et un bout du bar AIP !</div><div><br></div><div>Le métal c''est trop génial.</div><p></p>', NULL, 0, 'Grande scène', 3, 'non'),
(857, 218, 466, NULL, 'Demenagement du QG dans la Rotonde', '<p>Rendez vous au local des 24 pour le déménagement de l''ambiance.&nbsp;</p><div>Ta mission : tout déménager du local des 24 (RDC batiment D) à la rotonde (QG de l''ambiance)</div><div><br></div><div>Prendre le matos du tas "QG orga" <u>uniquement</u></div><div>Récupérer les 2 frigos du local</div><div>Charger le 20m3</div><div>Aller à la rotonde et décharger</div><div>Aller au local du karna (rdc bât F, en face de TC)</div><div>Prendre XX canapés, le frigo et les mettre dans le 20m3</div><div>Emmener le 20m3 à la rotonde et décharger le matos</div><div>Le frigo est juste là en stockage et n''est pas pour le QG :)</div><div><br></div><div>Un dernier aller retour à la cave aussi pour récupérer la moquette et les matelas.</div><div><br></div><div>Petit bonus : le frigo de la FIE est pour vous !</div><div><br></div><div>Bibis de l''ambiance !</div><p></p>', NULL, 0, 'Local 24h', 3, 'non'),
(858, 218, 466, NULL, 'Retour de l''ambiance à la maison', '<p>Rendez-vous au QG de l''ambiance pour le demenagement de l''ambiance. Et oui...retour à la maison!</p><div>La mission : dans la nuit noire, ramenez tout le matos du QG de la rotonde au local des 24 (RDC bat. D)</div><div><br></div><div>Pour info: les deux frigos du local sont à ramener au local, le frigo de la FIE est à remettre à la FIE</div><div><br></div><div>Aller au karna pour rendre les canaps et le frigo (marqué karna, il est soit au QG soit au dépôt humas)</div><div><br></div><div>Aller à la cave pour ramener les matelas et la moquette (ne la jetez pas &lt;3)<br><div><br></div></div><div>Mettre les matelas dans la cave de la Semaine Asiatique : appeler Cetelem si vous ne savez pas comment faire</div><p></p>', NULL, 0, 'QG Orga', 3, 'non'),
(859, 223, 334, NULL, 'Déchargement courses BA', '<p>Heyhey ! tu vas aider à décharger des voitures à la Bouffe Artiste à la MdE !&nbsp;</p><div>Rends-toi derrière la MdE près du petit escalier en ferraille qui monte à l''étage</div><div>Attends que les orgas qui font les courses rentrent de METRO (contacte Mamie Caro au 06 79 12 17 05) En attendant, tu peux toujours retrouver Léo à l''étage (07 77 89 97 97).</div><div><br></div><div>Montent les provisions à l''étage, et mets ce qui va au frais dans les frigos !&nbsp;</div><div><div><br></div></div><div>Suis les instructions du Troll (s''il est là) pour le rangement !</div><p></p>', NULL, 0, 'MDE (derrière)', 3, 'non'),
(860, 214, 346, NULL, 'Flyage Ninkasi Kao', '<p>Viens au local (de l''ambiance) &nbsp;récupérer ton co-flyage, une grosse pile de flyers (environ 200 chacun) et une dose de charisme.</p><p>L''horaire de début du créneau est 1h avant le début du concert, tu peux aussi vérifier les horaires ici :&nbsp;http://www.ninkasi.fr/fr/concert-musique/agenda.html?even_style=&amp;even_lieu=10&amp;even_artiste=&amp;even_genre=&amp;x=17&amp;y=15</p><div>Dirige-toi vers l''arrêt de tram.&nbsp;</div><div>Prends le tram T1 jusqu''à Gerland, et rends toi devant le Ninkasi Kao.&nbsp;</div><div><br></div><div>Ta mission : flyer à l''entrée jusqu''à ce que tu n''aies plus de flyers.&nbsp;</div><div>Reviens au local avec le sentiment d''avoir participé au non-déficit des 24h.&nbsp;</div><div><br></div><div>I believe I can flye !&nbsp;<span style="background-color: rgb(249, 249, 249); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 21px;">♫</span></div>', 'les oriflammes si il sont arrivés !', 0, 'Bocal', 3, 'non'),
(861, 214, 346, NULL, 'Flyage Transbordeur', '<p>Viens au local (de l''ambiance) &nbsp;récupérer ton co-flyage, une grosse pile de flyers (environ 200 chacun) et une dose de charisme.</p><p>L''horaire de début du créneau est 1h avant le début du concert, tu peux aussi vérifier les horaires ici :&nbsp;http://www.transbordeur.fr/agenda</p><div>Prends tes petites jambes (ou ton poney, ou ta bicyclette supersonique) et vas devant le transbordeur. Si tu ne sais pas ou c''est, Google maps est ton ami.&nbsp;</div><div><br></div><div>Ta mission : flyer à l''entrée jusqu''à ce que tu n''aies plus de flyers.&nbsp;</div><div>Reviens au local avec le sentiment d''avoir participé au non-déficit des 24h.&nbsp;</div><div><br></div><div>I believe I can flye !&nbsp;<span style="background-color: rgb(249, 249, 249); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 21px;">♫</span></div>', 'oriflammes si dispos !', 0, 'Bocal', 3, 'non'),
(862, 214, 346, NULL, 'Flyage Double Mixte', '<p>Viens au local (de l''ambiance) &nbsp;récupérer ton co-flyage, une grosse pile de flyers (environ 200 chacun) et une dose de charisme.</p><p>L''horaire de début du créneau est 1/2h avant le début de la soirée, tu peux aller voir devant le double mixte si il y a du monde. Si il n''y a encore personne, reviens plus tard !&nbsp;</p><div>Ta mission : flyer à l''entrée jusqu''à ce que tu n''aies plus de flyers.&nbsp;</div><div>Reviens au local avec le sentiment d''avoir participé au non-déficit des 24h.&nbsp;</div><div><br></div><div>I believe I can flye !&nbsp;<span style="background-color: rgb(249, 249, 249); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 21px;">♫</span></div>', NULL, 0, 'Bocal', 3, 'non'),
(863, 214, 346, NULL, 'Flyage Radiant Bellevue', '<p>Viens au local (de l''ambiance) &nbsp;récupérer ton co-flyage, une grosse pile de flyers (environ 200 chacun) et une dose de charisme.</p><p>L''horaire de début du créneau est 1h avant le début du concert, tu peux aussi vérifier les horaires ici : http://www.radiant-bellevue.fr/saison-2012-2013/calendrier/</p><div>Prends ta voiture supersonique (ou celle te ton co-fly) et rends toi au Radiant à Caluire. Si tu ne sais pas ou c''est, Google maps est ton ami.&nbsp;</div><div><br></div><div>Ta mission : Flyer à l''entrée jusqu''à ce que tu n''aies plus de flyers.&nbsp;</div><div>Reviens au local avec le sentiment d''avoir participé au non-déficit des 24h.&nbsp;</div><div><br></div><div>I believe I can flye !&nbsp;<span style="background-color: rgb(249, 249, 249); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 21px;">♫</span></div>', NULL, 1, 'Bocal', 3, 'non'),
(864, 12, 466, NULL, 'Maman de l''ambiance', '<p>Maman de l''ambiance !&nbsp;</p><div>Prépare des sandwichs, fais des ravitos, réveille les orgas et surtout, met l''ambiance au QG !!!</div><div><br></div><div>Pour les ravitos points sécu, prendre des batteries de talkie. Ne pas oublier d''aller voir les points courses en chantant sur la course et en appelant Manu le Trekke !</div><div><br></div><div>Le dimanche 25 mai, c''est la fête des mamans !!!!</div><p></p>', NULL, 0, 'QG', 3, 'non'),
(865, 21, 415, NULL, 'Aller chercher le matériel du BDE UFRAPS', '<p>RDV au QG orga</p><div>Retrouve l''Anguille (Guillaume -&nbsp;07 86 39 70 45)</div><div>Appelle Guillaume Gerbaldi ou Clément (BDE UFRAPS, l''Anguille a son numéro) pour lui dire que vous arrivez</div><div>Demande les clés de Brandon le 20m3</div><div>Conduis jusque devant le BDE UFRAPS, après l''arrêt de tram Université Lyon1, derrière le Tansbordeur.</div><div>Trouve Guillaume ou Clément</div><div>Charge le matériel qu''ils nous prêtent (2 frigos + 3 canap)</div><div>Remercie les</div><div>Pars vite, tu es déjà en retard !</div><div>Va te garer devant l''Astrée</div><div>Récupère le frigo de l''Agoraé</div><div>Dis merci à Gaelis &lt;3</div><div>Va déposer les frigos ???????</div><div>Va déposer les canapés dans les loges</div><div><br></div><p></p>', NULL, 0, 'Local des 24H', -1, 'non'),
(866, 21, 415, NULL, 'Conducteur Transport de matériel UFRAPS', '<p></p><p></p><ul><li>RDV au QG orga<br></li><li>Retrouve l''Anguille (Guillaume -&nbsp;07 86 39 70 45)</li><li>Appelle Guillaume Gerbaldi ou Clément (BDE UFRAPS, l''Anguille a son numéro) pour lui dire que vous arrivez</li><li>Demande les clés de Brandon le 20m3</li><li>Conduis jusque devant le BDE UFRAPS, après l''arrêt de tram Université Lyon1, derrière le Tansbordeur.</li></ul><p></p><ul><li>Trouve Guillaume ou Clément<br></li><li>Charge le matériel qu''ils nous prêtent (2 frigos + 3 canap)<br></li><li>Remercie les<br></li><li>Pars vite, tu es déjà en retard !<br></li><li>Va te garer devant l''Astrée<br></li><li>Récupère le frigo de l''Agoraé<br></li><li>Dis merci à Gaelis &lt;3<br></li><li>Va déposer les frigos ???????<br></li><li>Va déposer les canapés dans les loges</li></ul>', NULL, 0, 'Local des 24H', -1, 'non'),
(867, 21, 415, NULL, 'Récupération du matériel des assos - 1ère partie', '<ul>\r\n<li>RDV au local des 24 Heures (RdC bât D)<br></li>\r\n<li>Retrouve Cetelem (Alexis - 06 80 52 08 62)<br></li>\r\n<li>Demander les clés d''un 20m3, du bâtiment H et du club rock aux humains<br></li>\r\n<li>Prendre 10 feuilles de brouillon, 1 marqueur et du scotch<br></li>\r\n<li>@Cetelem : Ne pas oublier la liste d''affectation des frigos et des canaps</li>\r\n<li>Prendre 1 diable s''il y en a 1<br></li><li>Aller au club Elek en 20m3, trouver Léonard (0685211147) et récupérer 7 tentes</li>\r\n<li>Garer le 20m3 le plus près possible du local<br></li>\r\n<li>Récupérer les canaps du local<br></li>\r\n<li>Récupérer le frigo d''exit et&nbsp;<u><b>1 seul canap d''exit</b></u></li>\r\n<li>Déplacer le 20m3 le plus près possible du bâtiment C</li>\r\n<li>Aller voir Boards of Mangroove et récupérer 1 frigo</li>\r\n<li>Aller au bâtiment H et récupérer les frigos de la semaine asiatique et de cook</li>\r\n<li>Appeler Maxime de l''ADEGE - 06 51 41 43 04 et lui dire qu''on arrive. Récupérer son mégaphone</li>\r\n<li>Aller au club rock (rdc bât F, à côté du karna)<br></li>\r\n<li>Décharger tout le matos en laissant de la place pour que les danseurs puissent s’entraîner<br></li>\r\n<li>Marquer le matos comme sur la liste de Cetelem<br></li>\r\n<li>Ramener le 20m3 au local<br></li>\r\n<li>Rendre toutes les clés aux humains</li></ul>\r\n<p></p>', 'Feuilles *10', 0, 'Local des 24H', 3, 'non'),
(868, 21, 354, NULL, 'Rapatriment du matos au local', '<p></p><ul><li>Va au QG orga<br></li><li>Retrouve Cetelem (le petit homme vert mourant)<br></li><li>Récupérez les clefs d''un 20m3 vers les humains<br></li><li>Aller au dépôt AIP<br></li><li>Charger tout ce qui reste comme matos dans le 20m3<br></li><li>Cetelem te dira s''il y a des exceptions :)<br></li><li>Aller garer le 20m3 devant le local des 24H (bât D)<br></li><li>Décharger tout le foutre entre le local, exit et GI (Ne met pas trop le bordel, tu vas ranger après)<br></li><li>Ranger le matos jusqu''à 12h30<br></li><li>Mourir dans un canapé :)<br></li></ul><p></p>', NULL, 0, 'Local des 24H', 3, 'non'),
(869, 21, 415, NULL, 'Rendu Matos Assos 2ème partie', '<p>RDV au local des 24 Heures (RDC bât C)</p><p>Retrouve Cetelem, il doit dormir, hésite pas à le réveiller, c''est un sac à foutre</p><p>Demander les clefs d''un 20m3, du club rock et de la semainse asiatique aux humains</p><p>Aller au club rock et récupérer les frigos du cluji, de cook et de la semaine asiatique.</p><p>Aller au bâtiment H et déposer les frigos de la semaine asiatique et de cook dans le même local</p><p>Refermer le local et aller au bâtiment C.</p><p>Aller voir le cluji et leur ramener leur frigo</p><p>Dire merci et leur faire des gros bibis (ou pas si le mec fait peur)</p><p>Ranger le 20m3 et rendre toutes les clefs aux humains</p><p><br></p>', NULL, 0, 'Local des 24H', 3, 'non'),
(870, 23, 364, NULL, 'Comptage Matin', '<p>C''est l''heure de prendre son charisme et d''aller compter pour rapporter moult sioux à notre belle asso &lt;3</p>', '1 gilet jaune\r\n1 crayon à papier \r\n1 cahier de comptage\r\n1 planche', 0, 'Grande scène!', -1, 'non'),
(871, 23, 364, NULL, 'Comptage Aprem', '<p>C''est l''heure de prendre son charisme et d''aller compter pour rapporter moult sioux à notre belle asso &lt;3</p>', '1 gilet jaune\r\n1 crayon à papier \r\n1 cahier de comptage\r\n1 planche', 0, 'Grande scène!', -1, 'non'),
(872, 21, 421, NULL, 'Aller chercher les tables basses', '<p></p>\r\n<ul>\r\n<li>RDV au QG orga<br></li>\r\n<li>Retrouver Cetelem (Alexis - 06 80 52 08 62)<br></li>\r\n<li>Demander les clefs d''un 20m3 (Bradley de préférence, tu as déjà beaucoup conduis Brandon)<br></li>\r\n<li>Aller à la dirpat récupérer les clefs de la cave PC</li>\r\n<li>Aller récupérer les 4 tables basses restantes</li>\r\n<li>Refermer la cave et rendre la clef à la Dirpat</li>\r\n<li>Les emmener au QG orga<br></li>\r\n<li>Poser les dans un couloir</li>\r\n<li>Demander une feuille et noter "VIP" dessus, la poser sur les tables&nbsp;</li>\r\n<li>Rendre les clefs du 20m3</li></ul>\r\n<p></p>\r\n<div>\r\n<div><br></div></div>\r\n<p></p>', NULL, 0, 'Local des 24H', 3, 'non'),
(873, 3, 309, NULL, 'Installation de la régie', '<p></p><ul><li><br></li></ul><p></p>', NULL, 0, 'Petite scène', -1, 'non'),
(874, 3, 309, NULL, 'Suivi du montage son et lumière', '<p>Voir avec Concert Systèmes comment avance le montage et donner un coup de main.</p><p><u>Régie petite scène :</u></p><p></p><ul><li>1 tente 3x3 m<br></li><li>4 chaises<br></li><li>4 praticables (3 avec des pieds de 40 cm et 1 avec des pieds de 80 cm)<br></li><ul><li>Estrade de 3x2 m sous la tente (hauteur 40 cm)</li><li>Praticable pour les consoles (hauteur 80 cm)</li></ul></ul><p></p>', NULL, 0, 'Petite scène', 3, 'non'),
(875, 3, 309, NULL, 'Repérage implantations et TP cons concerts', '<p>Être là quand Gilles et l''équipe de Ertse arrivent.<br><br>Repérer l''implantation des bars, de la rampe PMR, des arches d''entrée, de la petite scène, de la régie petite scène et des pré-loges petite scène...<br><br>Faire un point avec Gilles sur l''avancement du montage.<br><br>Prendre l''apéro avec tous les teckos parce que bon, c''est un principe...</p>', NULL, 0, 'Petite scène', 3, 'non'),
(876, 223, 318, NULL, 'Nettoyage Bar Akafrites', '<p>Finis de nettoyer le bar pour le rendre opérationnel pour le lendemain !&nbsp;</p>\r\n<div>(fais-toi aider du Karna qui sera encore chaud patate !)</div>\r\n<p></p>', NULL, 0, 'Bar bouffe', 3, 'non'),
(877, 223, 318, NULL, 'Aller chercher les crêpières', '<p>Retrouve ton co-tache au bar bouffe, devant l''entrée du batiment GCU !&nbsp;</p><div>Retrouvez Mamie Caro, elle vous dira exactement où trouver les crêpières.</div><div>Si tout va bien, il faudra aller en chercher 2 au QG de l''ambiance, et 2 à la Bouffe Artiste (étage de la MdE).&nbsp;</div><div>Pour les crêpières de la Bouffe artiste, va à la MdE et monte par l''escalier en ferraille de derrière.</div><div>Appelle le Troll pour qu''il t''ouvre et adresse-toi à lui pour récupérer 2 crêpières :&nbsp;<span style="background-color: rgb(255, 255, 255); color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;">06 61 41 15 17</span></div><div>Tu peux lui rappeler qu''il retrouvera ces crêpières au QG dès le lundi matin.&nbsp;</div><div><br></div><div>Ramène les crêpières au stand bouffe, et demande à Caro où les poser.&nbsp;</div><p></p>', NULL, 0, 'Bar bouffe', 3, 'non'),
(878, 3, 309, NULL, 'GPRPSTDMMTHLJBH', '<p>Gestion des Problématiques Relatives à la Petite Scène et à Tout ce qui en Découle de Manière Musicale, Technique, Humaine et Logistique, et tout ça dans la Joie et la Bonne Humeur.<br><br>Enfin voilà, ça bosse quoi !</p>', NULL, 0, 'Petite scène', 3, 'non'),
(879, 223, 318, NULL, 'Rangement Bar Akafrites', '<p>C''est la fin du Bar Akafrites !&nbsp;</p><div>Il faut ranger maintenant... tu vas voir, c''est une tâche bon esprit. Tu vas travailler avec le Karna (alias des gens posés et sûrement un peu rôtis à cette heure-là...), et les resps Bouffe !</div><div>Retrouve Mamie Caro et Léo Doc-X au bar bouffe et suis leurs instructions !&nbsp;</div><div><br></div><div>Léo va récupérer les clés du local Graine d''Images au QG de l''ambiance<br></div><div>On nettoie et on range jusqu''à 00h30, puis Caro va récupérer Brandon, et on charge la matos pour évacuer un max de trucs !&nbsp;</div><div><br></div><div>- Finir de nettoyer TOUS LE MATOS.</div><div>- Rassembler tout le matos du Grand Restau (voir avec Léo pour le tri) --&gt; il va au local Graine d''Images.</div><div>- Rassembler le matos du Karna (voir avec Cécile pour le tri) --&gt; il va au Karna.</div><div>- Rassembler le matos Options (location), bien bien bien le nettoyer et le ranger pour qu''il ne gène pas le passage jusqu''en GCU --&gt; Il reste derrière le bar.</div><div>- Rassembler le matos 24h --&gt; Il va à l''AIP.</div><div>- Laver et plier la tente du Karna (la friture est ton amie !) --&gt; Elle va à la cave.</div><div>- Rouler la moquette et la jeter --&gt; Elle va dans la benne.</div><div>- Laver tout le sol devant GCU, faut que ça soit nickel pour les cours le lundi matin 8h !&nbsp;</div><div>- Le camion frigo reste où il est.</div><div>- Débrancher les frigos et le congel : les laisser OUVERTS (et vides) --&gt; Ils restent sur place.</div><div><br></div><div>Pour les restes de bouffe :&nbsp;</div><div>On ramène au Bocal 24h ! (vidage de futs)</div><div>S''il y en a moultes moultes moultes, voir avec Caro (Possibilité de Resto du Coeur le lundi matin, dans ce cas on en stocke une partie dans le camion frigo)</div><div><br></div><div><br></div><div><br></div><p></p>', NULL, 0, 'Bar bouffe', -1, 'non'),
(880, 206, 318, NULL, 'Tâche sans nom', 'jkbckljbs', NULL, 0, 'Bar bouffe', -1, 'non');
INSERT INTO `Tache` (`id`, `responsable_id`, `groupetache_id`, `importid`, `nom`, `consignes`, `materielSupplementaire`, `permisNecessaire`, `lieu`, `statut`, `commentaireLog`) VALUES
(881, 223, 412, NULL, 'Rangement Bar Akafrites', '<p>C''est la fin du Bar Akafrites !&nbsp;</p>\r\n<div><b>Il faut ranger</b> maintenant... tu vas voir, c''est une tâche bon esprit. Tu vas travailler avec le Karna (alias des gens posés et sûrement un peu rôtis à cette heure-là...), et les resps Bouffe !</div>\r\n<div><b>Retrouve Mamie Caro et Léo Doc-X</b> au bar bouffe et suis leurs instructions !&nbsp;</div>\r\n<div><br></div>\r\n<div>On nettoie et on range jusqu''à 00h30, puis Caro va récupérer Brandon, les clés du local Graine d''Images&nbsp;et les clés de la cave au QG, et on charge la matos pour évacuer un max de trucs !&nbsp;</div>\r\n<div><br></div>\r\n<div>- Finir de nettoyer TOUT LE MATOS.</div>\r\n<div>- Rassembler tout le matos du Grand Restau (voir avec Léo pour le tri) --&gt; il va au local Graine d''Images. ATTENTION : ne pas oublier d''y amener les bidons d''huiles usagée !</div>\r\n<div>- Ramener les crêpières au QG de l''ambiance.</div>\r\n<div>- Rassembler le matos du Karna (voir avec Cécile pour le tri) --&gt; il va au Karna.</div>\r\n<div>- Rassembler le matos Options (location), bien bien bien le nettoyer et le ranger pour qu''il ne gène pas le passage jusqu''en GCU --&gt; Il reste derrière le bar.</div>\r\n<div>- Rassembler le matos 24h --&gt; Il va à l''AIP.</div>\r\n<div>- Laver et plier la tente du Karna (la friture est ton amie !) --&gt; Elle va à la cave.</div>\r\n<div>- Rouler la moquette et la jeter --&gt; Elle va dans la benne dans le creux GCU.</div>\r\n<div>- Laver tout le sol devant GCU, faut que ça soit nickel pour les cours le lundi matin 8h !&nbsp;</div>\r\n<div>- Le camion frigo reste où il est.</div>\r\n<div>- Débrancher les frigos et le congel : les laisser OUVERTS (et vides) --&gt; Ils vont au creux GCU.</div>\r\n<div><br></div>\r\n<div>Pour les restes de bouffe :&nbsp;</div>\r\n<div>On ramène au Bocal 24h ! (vidage de futs)</div>\r\n<div>S''il y en a moultes moultes moultes, voir avec Caro (Possibilité de Resto du Coeur le lundi matin, dans ce cas on en stock une partie dans le camion frigo)</div>\r\n<div><br></div>', NULL, 0, 'Bar bouffe', 3, 'non'),
(882, 223, 412, NULL, 'Rapatriement Frigos et Congel', '<p>Retrouve Mamie Caro au bar bouffe ! Elle devrait arriver avec Brandon le 20m3 de l''ambiance...&nbsp;</p><div>Il va te falloir être fort (les congels et les frigos, c''est un peu lourd...) !&nbsp;</div><div>Il y a les frigos des bars (dont la bouffe), des loges et du QG sécu à récupérer (ils seront surtout au creux GCU)</div><div>Chargez le 20m3 avec les frigos et le congel. Allez à la cave, 2 à pied et 2 dans le camion (Caro aura les clés). Déchargez le congel dans la cave !&nbsp;</div><div>Allez au local du club rock : déchargez les frigos !&nbsp;</div><div><br></div><div>Voilà, c''est fini...&nbsp;</div><div><br></div><div>Pensez bien à rendre Brandon et ses clés au QG.</div><div><br></div><p></p>', 'Des bras costauds et un peu de courage...', 0, 'Bar bouffe (devant GCU)', 3, 'non'),
(883, 223, 412, NULL, 'Récupérer Brandon et les clés', '<p>Caro, va chercher les clés de la cave, les clés du club rock et Brandon au QG de l''ambiance !&nbsp;</p>\r\n<p>Prends aussi des diables !&nbsp;</p>', 'des diables', 2, 'QG', 3, 'non'),
(884, 3, 309, NULL, 'Suivi du démontage son et lumière', '<p>Voir avec Concert Systèmes comment avance le démontage et donner un coup de main.</p><p>Penser à démonter la régie.</p>', NULL, 0, 'Petite scène', 3, 'non'),
(885, 3, 309, NULL, 'Désinstallation de la régie', '<p>Blank</p>', NULL, 0, 'Petite scène', -1, 'non'),
(886, 3, 309, NULL, 'Départ de la petite scène de Villeurbanne', '<p>Être là lors du départ du camion scène de Villeurbanne.</p>', NULL, 0, 'Petite scène', 3, 'non'),
(887, 206, 337, NULL, 'Réceptionner le pain', 'cc', NULL, 0, 'Bar bouffe', -1, 'non'),
(888, 3, 310, NULL, 'Réapprovisionnement des loges artistes', '<p></p><div><ul><li>On a un de kit ménage directement dans les loges :)<br></li><li>Vider les loges des déchets qu''elles peuvent contenir et sortir les poubelles</li><li>Éventuellement nettoyer les frigos ou autre</li><li>Passer un coup de balai et serpillère si besoin et remettre en place de nouveaux sacs poubelle</li><li>Récupérer le catering des artistes</li><li>Répartir le catering dans les loges</li><li>Marquer\r\n sur les portes des loges les noms des artistes et le timing de la \r\nsoirée (si possible sous forme d''affichettes, sinon à la craie \r\ndégueulasse mais le plus propre possible)</li><li>Stocker les surplus de catering ou le mobilier restant dans un lieu qui reste à définir</li><li>Libérer le couloir et donner un petit coup de balai si nécessaire</li></ul></div><p></p>', NULL, 0, 'GCU', 3, 'non'),
(889, 3, 310, NULL, 'Rangement des loges artistes', '<p></p><ul><li>Se rendre aux loges artistes au premier étage de GCU (accès par le creux GCU entre les bâtiments Freyssinet et Coulomb)</li><li>Se mettre à la disposition des orgas hard sur place</li></ul><div>Effectuer les tâches suivantes (selon répartition de l''orga hard sur place) :</div><div><ul><li>Virer tous les déchets des loges artistes (poubelles, trucs qui trainent dans les loges et dans les frigos, etc.)</li><li>Sortir tout le mobilier des loges et le descendre dans le creux GCU en bas des escaliers</li><li>Déplacer les frigos dans le creux GCU (là où il y a les fûts)</li><li>Aller chercher le frigo des pré-loges petite scène et le déposer au même endroit</li><li>Chercher le reste du mobilier des pré-loges et le regrouper avec le mobilier des loges</li><li>Démonter la tente des pré-loges et la mettre avec le mobilier</li><li>Jeter la moquette des pré-loges à la benne<br></li><li>Récupérer les éventuels restes des caterings artistes et les confier aux orgas hard sur place</li><li>Nettoyer tout le premier étage de GCU (salles et couloir)<br></li><li>Remettre en place le mobilier de cours (tables, chaises, etc.) : <b>le premier étage ne sera plus utilisé, tout doit être nickel pour un état des lieux sortant</b></li><li>Déposer tout le matériel de nettoyage au deuxième étage (attention, l''Agent de Sécurité ne vous laissera pas forcément passer)<br></li><li>Aller chercher des caddies et/ou des diables au QG orga<br></li><li>Apporter les canapés et les fauteuils dans la cabane backline derrière la grande scène</li><li>Amener la tente au dépôt AIP (bâtiment Jacquard)<br></li><li>Emmener le petit mobilier et les restes de catering au QG orga</li><li>Rendre les caddies et les diables au QG orga<br></li></ul></div><p></p>', '2 Diables', 0, 'GCU', 3, 'non'),
(890, 19, 461, NULL, 'Constater les dégats', '<p>Réveille toi tranquillement !</p>\r\n<div>Bronze au soleil 5 min et vas constater les dégats de la veille.&nbsp;</div>\r\n<div><br></div>\r\n<div>On commence avec une petite promenade pour vérifier que les tables, frigos, palettes, et autres conneries n''ont pas été volés ou déplacés.</div>\r\n<div><br></div>\r\n<div>Ensuite, une fois un peu plus réveillé, compte les fûts vides, et voit s''il faut aller en chercher d''autres (si c''est le cas, sonne l''alarme, reveil ton co-orga et action action action !!!). Il faut que tout les fûts soient dans le creux GCU et pas derrière les bars (normalement ça été fait la veille !).</div>\r\n<div><br></div>\r\n<div>C''est l''heure de faire du rangement aussi. Range tout ce que tu juges utile, fait un tour des bars pour chequer la signa, etc. etc.</div>\r\n<p></p>', NULL, 0, 'Creux GCU', 3, 'non'),
(891, 19, 461, NULL, 'Rendez la moquette !!!', '<p>Prend les clé du 11m3.</p><div>Va à la cave des 24h et récupère la moquette qu''il te faut pour moquetter les bars ! Amènes la de la cave au creux GCU où les gens la prendrons au moment de moquetter les bars à 10h.</div><div><br></div><div>Profite en pour récupérer les 2 rampes à fûts, les compteuses à gobelets et les caisses rouges et bleues pour les gobelets. Stocke les au creux GCU.</div><div><br></div><div>Merciiiiii</div><p></p>', NULL, 0, 'Creux GCU', 3, 'non'),
(892, 19, 461, NULL, 'Mettre les bars aux lits', '<p>La zone ferme ses portes, les rotis rentrents chez eux, et les bars vont bientôt aller dormir ! Il faut donc ranger tout ce qui traine d''important derrière les bars :</p><div><div>1) Effectue les taches suivantes<br></div><div>- Ramener tous les fûts vides ou pleins dans le creux ou dans les camions frigos</div><div>- Ramener tous les softs dans le creux GCU ou dans le camion, frigo dédié<br></div></div><div>- Remplir les camions frigos en fûts pour qu''ils soient bien froids le lendemain soir !</div><div>- Ramener gobelets pour nétoyage et rangement</div><div>- Compter si possible les fûts restant pour débrief avec Thierry Dagier</div><div><br></div><div>2) aller dormir quand tout est fini :) !</div><div><br></div><div>PS1 : tu as demandé un caddie dans ta FT ;)</div><div>PS2 : Si c''est le dernier soir, rempli pas les camions frigos, il faut au contraire tout vider et ranger ! :)</div><div><br></div><p></p>', NULL, 0, 'Creux GCU', 3, 'non'),
(893, 19, 461, NULL, 'Validation BIS des bars', '<p>La zone ouvre dans 2h !!</p><div>Il faut vérifier que les frigos sont pleins (ce n''est pas le cas). Que les futs sont la (ce n''est pas le cas non plus). Tu as une heure pour voir tous les imprévus qui t''attendent pour attaquer efficacement et avec moults softs et confiances, les taches de 19h !</div><div><br></div><div>Au boulot !</div><p></p>', NULL, 0, 'Creux GCU', 3, 'non'),
(894, 19, 461, NULL, 'Chercher des fûts chez Dagier', '<p>Fais un tour des Bars !&nbsp;</p>\r\n<div>Comptes les fûts dans les camions, les softs, etc.</div>\r\n<div><br></div>\r\n<div>S''il manque des trucs (moins de 140 fûts...), prends les clés du 20m3 et approvisionne chez Dagier (<span style="LINE-HEIGHT: 16.12px; BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: arial, sans-serif; COLOR: rgb(34,34,34); FONT-SIZE: 13px">70 Rue Franklin, 69120 Vaulx-en-Velin).</span></div>\r\n<div><span style="LINE-HEIGHT: 16.12px; BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: arial, sans-serif; COLOR: rgb(34,34,34); FONT-SIZE: 13px"><br></span></div>\r\n<div><span style="LINE-HEIGHT: 16.12px; BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: arial, sans-serif; COLOR: rgb(34,34,34); FONT-SIZE: 13px">Bon courage, pck s''il manque quoi que ce soit tu es seul two pour tout réapprovisionner...</span></div>\r\n<p></p>', NULL, 0, 'Creux GCU', 3, 'non'),
(895, 19, 461, NULL, 'Superviser le démontage zone nord', '<p>Hermione et Jérémie vont démonter vos bars nords (Cétiat, Piscine, Manège) ! snif snif</p>\r\n<div>Vérifie que tout se passe bien :</div>\r\n<div>\r\n<ul>\r\n<li>tireuse protéger et en securité (hérassées ou déplacées)</li>\r\n<li>Frigos rangés au creux (fait le alone personne sera la pour t''aider...)</li>\r\n<li>softs et fûts ranger au creux</li>\r\n<li>signa récupérée et en sécurité</li>\r\n<li>compteuses en verre rangées</li>\r\n<li>etc etc</li></ul>\r\n<div>(Inventaire : les tireuses (16), la signa et la moquette, les frigos (3 ou plus), les tables (17), chaises (5), compteuse à gobelet (8), l''élec ...)</div><div><br></div><div>Hésite pas à demander de l''aide au QG pck tu seras surement surcharger.</div></div>\r\n<div><br></div>\r\n<div>Bon courage</div>\r\n<p></p>', '1 diable', 0, 'Creux GCU', 3, 'non'),
(896, 19, 519, NULL, 'Vidage de fûts', '<p>Eeeeeeeeeeeeeeeeeet c''eeeeeeeeeeeeest fini !!!!!!</p><div>Pour cloturer cette merveilleuse 40ème édition tout le monde est convié au traditionnel "barbecue"/vidage de fût/rotisserie des 24 Heures de l''INSA !!</div><div><br></div><div>Votre dur mission est de finir les 50 cartons de patés de volaile, remplir les constats de choppe, finir les dizaines de fûts de bières, et faire la fête jusqu''au lendemain (sans pour autant rester coincé dans les toilettes des 24h) !</div><div><br></div><div>Amenez charisme et bonne humeur !</div><div><br></div><div><br></div><p></p>', 'moult Charisme', 0, 'Creux GCU', 3, 'non'),
(897, 19, 461, NULL, 'Ranger tous les liquides !!', '<p>La manif est finie !!! ou pas</p><div>Les bars sont normalement tous fermés, fini ça tranquillement avec ton/ta co orga.</div><div><br></div><div>Ensuite prends le 20m3 et fait la tournée des bars : tous les liquides et les gobelets doivent être rangés dans le creux GCU, en securité et à l''abri pour un enlèvement tranquille et efficace par Dagier à 12h30 Lundi.</div><div><br></div><div>Taches :</div><div><ul><li>ramener les liquides (et gobelets) en 20m3 au creux</li><li>ranger tout sur palette</li></ul><div>Après fais une dernière ronde des bars (vérifie que les diables à fûts sont bien ranger !!). Et va dormir : demain tous les prestas récupèrent leurs affaires, et ce dès 12h30</div></div><p></p>', NULL, 0, 'Creux GCU', 3, 'non'),
(898, 19, 519, NULL, 'Chargement Dagier', '<p>Aide Dagier à mettre tous les fûts et les tireuses ainsi que les softs, dans leur semi remorque. Dépêche toi avec le fen pck les concerts en ont besoin à 14h30.</p><div><br></div><div><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Contact : Bruce Louis 07 86 85 59 21 / Choppy </span><span style="font-size: 13px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">&nbsp;</span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">06 67 12 02 16</span><br><div><br></div><div><br></div></div><p></p>', NULL, 0, 'Creux GCU', 3, 'non'),
(899, 21, 478, NULL, 'Vérification nombre de FT', '<p>Créer une nouvelle FT pour savoir combien de Ft ont été créée</p>', NULL, 0, 'Local des 24H', 3, 'non'),
(900, 9, 427, NULL, 'IceTeaaaaaaaa', '<p>IceTeaaaaaaaaaaaaa x 1200 !</p><p>Ramène l''ice Tea à la cave et emmènes en un peu au local!</p>', NULL, 2, 'Dans ta chatte', 3, 'non'),
(901, 16, 389, NULL, 'Philosopher sur le sens de la vie, de la mort et l''existence des bigorneaux', '<p>Prendre ton duvet<br>Aller jusqu''au matelas le plus proche</p><p>S''allonger</p><p>Ferme les yeux et philosopher sur le sens de la vie, de la mort et l''existence des bigorneaux</p>', NULL, 0, 'QG Sécu', 3, 'non'),
(902, 21, 415, NULL, 'Récupération du matos Karna', 'RDV au QG orga<div>Retrouve les humains et les mamans présents</div><div>Leur demander la clef du club rock</div><div>Aller au local du karna (bât H)</div><div>Récupérer&nbsp;</div>', NULL, 0, 'Local des 24H', -1, 'non'),
(903, 16, 389, NULL, 'Patrouille ZC', '<p>Avec ton talkie et tout ton matos rend toi sur la TV<br>Fait de la GMQ<br>Pense à te relayer avec ton copain qui prend la main courante au QG<br><br>Si tu t''ennuies :</p><div><ul><li>vérifie les extincteurs</li><li>vérifie le barrièrage</li><li>compte les cailloux</li></ul></div><p></p>', NULL, 0, 'QG Sécu', 3, 'non'),
(904, 21, 512, NULL, 'Ramener Frigos de la BA', '<p></p><ul><li>RDV au local des 24 Heures (RDC bât D)<br></li><li>Retrouve Cetelem<br></li><li>Récupère les diables</li><li>Prenez le frigo de la sall''op et les clefs de la cave du E<br></li><li>Va à la MDE et retrouve Le Troll, pose le frigo du local dans un coin<br></li><li>Prend tous les frigos sauf le plus grand et emmène les devant la cave du E</li><li>Referme la cave<br></li><li>Emmène le plus grand frigo au local des 24H et ramène les diables au local</li></ul><p></p>', NULL, 0, 'MdE', 3, 'non'),
(905, 14, 502, NULL, 'Retour des frigos à la cave', '<p>Aller chercher les clés de la cave et du GQ (si si wesh) et des diables.</p><div>Ramener les frigos qui sont au club rock à la cave</div><div>rendre les clés et les diables aux humains<br><div><br></div></div><p></p>', NULL, 0, 'Local des 24H', -1, 'non'),
(906, 16, 330, NULL, 'Protection du public', '<p>Rends toi sur le chemin entre les terrains de tennis et le terrain d''athlétisme.</p><p>Ta mission est de veiller à ce que personne ne rentre sur ce terrain par derrière pendant que le feu d''artifice est tiré.</p><p>En détail :</p><p>Retrouve ton coéquipier sur le chemin entre le terrain d''athlétisme et le terrain de rugby.&nbsp;</p><p>Empêche les personnes de s''installer sur terrain, et demande aux personnes qui veulent passer par ce chemin de faire le tour par le sud, en leur disant que c''est dangereux.</p><p>Ne te mets pas en danger, en cas de problème, appelle le responsable sur son portable. Signale-lui immédiatement &nbsp;les relous qui ne veulent pas dégager.</p><p>Profites du feu d''artifice, tu es aux premières loges! Et quand c''est fini rejoins-nous sur le terrain!</p><p>En cas de problème : Paul Coupé 06 59 90 44 19</p>', NULL, 0, 'terrain de football stabilisé', 3, 'non'),
(907, 16, 469, NULL, 'Ouvrir les Accès', '<p>Retrouver le Poulpe (06.59.90.44.19) devant la grande scène</p><ul><li>Il faut débarrièrer intelligemment et rapidement pour que tout les accès aux routes et aux bâtiments soient &nbsp;ouverts avant 8h00</li><li>Bien mettre les héras dans les racks<br></li><li>Ne pas perdre les colliers</li><li>Regrouper les plots bétons</li></ul>', 'Du charimse\r\nDes bras musclés\r\nclefs de 19', 0, 'ZC', 3, 'non'),
(908, 28, 521, NULL, 'Rappeler au Kendo d''aller au Gymnase B le 24/05', '<P>----Le samedi 17 mai---</P>Rends toi au gymnase Colette Besson dans les salles de danses.<BR>Va voir le gérant du kendo et rappelle lui que la semaine prochaine ils vont dans le gymnase B (à côté des bâtiments A et B).<BR>Leur dire de se garer à l''extérieur du campus. \r\n<DIV>&nbsp;</DIV>\r\n<DIV>----Le vendredi 23 mai-----<BR>\r\n<DIV>Rends toi au gymnase Colette Besson dans les salles de danses.<BR>Va voir le gérant du kendo et rappelle lui que demain &nbsp;matin ils vont dans le gymnase B (à côté des bâtiments A et B).<BR>Leur dire de se garer à l''extérieur du campus.<BR></DIV>\r\n<DIV><BR></DIV>\r\n<DIV><BR></DIV>\r\n<DIV><BR></DIV></DIV>\r\n<P></P>', NULL, 0, 'Colette Besson', 3, 'non'),
(909, 14, 406, NULL, 'Réunion Maud Dirpat', '<p>Aller à la dirpat</p><div>Faire une réunion auvec Maud Cavillon sur les bennes RDS</div><div><br></div><div>Pour info: Les bennes seront livrées le vendredi</div><p></p>', NULL, 0, 'Dirpat', 3, 'non'),
(910, 45, 522, NULL, 'Réapprovisionnement des pré-loges', '<p>Blank</p>', NULL, 0, 'Dans la baraque derrière la scène', -1, 'non'),
(911, 45, 522, NULL, 'Préparation des pré-loges', '<p>Yop yop yop !</p><p>On a besoin de toi pour installer les pré-loges (loge rapide juste derrière la scène où les artistes se posent avant de monter sur scène).</p><p><br></p><p>Récupère un 20m3 au QG local (et éventuellement les clés de la cave, ou du club rock ou de quelque endroit où le bordel sera stocké, mais à l''heure où j''écris ce texte on ne sait pas encore...), fais-toi briefer par Hermione (Resp Grande scène, il sera par là-bas, vers la scène). Le but est de récupérer 2 canaps, 1 fauteuil, 3 tables basses et quelques chaises pour installer un petit coin cosy et posé (#posey).</p><p>Ca va être bien bien bien !</p>', NULL, 2, 'Dans la baraque derrière la scène', -1, 'non'),
(912, 45, 522, NULL, 'Rangement des pré-loges', '<p>Allez ! C''est l''heure de ranger !</p><p>Il faut prendre un 20m3 (avec ses clés si possible sinon c''est moins utile ou beaucoup plus brutal) et les clés de la cave, ou du club rock, ou de je ne sais quel endroit où tout le bordel devra être stocké.</p><p>RDV derrière la grande scène pour récupérer tout le foutre des pré-loges (canaps, fauteuils, chaises, tables) le charger dans le 20m3 et remettre tout ça à sa place !</p><p><br></p><p>Merci les amis !</p>', NULL, 2, 'Dans la baraque derrière la scène', 3, 'non'),
(913, 3, 523, NULL, 'Réapprovisionnement des pré-loges', '<p>Temps masqué journée du samedi<br></p>', NULL, 0, 'Derrière la petite scène', -1, 'non'),
(914, 3, 523, NULL, 'Préparation des pré-loges', '<p></p><ul><li>Se rendre à l''emplacement de la petite scène (parking au nord de Freyssinet) pour retrouver Jérémie (06 45 52 58 66)</li><li>Aller chercher de la moquette, la tente 6x4 et la tente 3x3 dans le chalet backline</li><li>Monter les pré-loges</li></ul><p></p>', NULL, 0, 'Derrière la petite scène', 3, 'non'),
(915, 3, 523, NULL, 'Rangement des pré-loges', '<p>À voir avec Hermione et la Log : où stocker le matériel ?<br></p>', NULL, 0, 'Derrière la petite scène', -1, 'non'),
(916, 223, 341, NULL, 'Aller chercher les frigos !', '<p>Si tu es affecté à 21h saute directement à la deuxième partie (et RDV au creux GCU et non au QG) :)</p>\r\n<p>-------------------Partie 1 : Chercher --------------------</p>\r\n<p>Retrouve Mamie Caro au QG !&nbsp;</p>\r\n<p>Récupérez les clés du local du club rock et les diables.</p>\r\n<div>\r\n<div>Récupérez Bradley le 20m3 et allez en direction du club rock (RDC du F) récupérer tous les frigos marqués "creux GCU".</div></div>\r\n<div>&nbsp;</div>\r\n<div>Montez dans le camion (ou pas : des orgas seront à pied... mais vous en faites pas, c''est pas bien loin!) et laissez-vous chauf... euh, conduire ! dans la direction de la zone concert par Caro.&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>Déposez les frigos qui ne sont pas pour les BARS de manière à ce que ça ne gène pas les accès sécurité et l''accès aux bâtiments de cours ! Les autres restent dans le 20m3 pour la partie 2 de la tache</div>\r\n<div>&nbsp;</div>\r\n<div>Ramenez les clefs du club rock et les diables au QG, Louis récupère Bradley pour la suite de la tâche.</div>\r\n<div>-------------------Partie 2 : Placer--------------------</div>\r\n<div>Il faut maintenant placer les frigos derrières les bars sur les palettes prévues à cet effet. Avec le 20m3 passer derrière les bars, et décharger le bon nombre de frigos (voir avec les Orgas Bars : Camille et Louis).&nbsp;<br></div>\r\n<div>Ne pas brancher les frigos ! (attendre 24h !). Une fois la tache finie ramener les clés au QG&nbsp;</div>\r\n<div>-------------------------------------------------------</div>\r\n<div><br></div>\r\n<div>Contacts : Nico (<span style="LINE-HEIGHT: 20px; BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: ''Helvetica Neue'', Helvetica, Arial, sans-serif; COLOR: rgb(51,51,51); FONT-SIZE: 14px">06 32 03 33 74), Caro (</span><span style="LINE-HEIGHT: 20px; BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: ''Helvetica Neue'', Helvetica, Arial, sans-serif; COLOR: rgb(51,51,51); FONT-SIZE: 14px">0679121705</span><span style="LINE-HEIGHT: 20px; BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: ''Helvetica Neue'', Helvetica, Arial, sans-serif; COLOR: rgb(51,51,51); FONT-SIZE: 14px">), Camille (0667120216), Louis (0786855921)</span></div>\r\n<p></p>', 'Diables\r\nListe des frigos que Nico aura donnée à Caro', 0, 'QG (de l''ambiance)', 3, 'non'),
(917, 206, 337, NULL, 'Réception camion GR', '<p>Rends-toi sur le bar bouffe et attend l''appel du GR pour la livraison du camion frigo.</p><div>Dirige le camion sur le stand bouffe (se référer au plan que tu auras sur toi).</div><div>S''assurer que le camion est bien positionné et ouvert, le brancher sur le réseau élec (voir avec la log au talkie).</div><p></p>', NULL, 0, 'Bar bouffe', -1, 'non'),
(918, 223, 334, NULL, 'Déchargement Courses Bouffe', '<p>Rendez-vous au QG de l''ambiance ! Retrouve Mamie Caro (0679121705) et Léo et leur camion, et suis leurs instructions pour décharger les bonnes courses au bon endroit.</p><div>Au QG :<div>- les courses de l''humain (mettre tout ce qu''il y a de frais dans les frigos) dans la zone orga.</div><div>- les courses des courses (pédales!), de la sponso, etc. dans un espace dédié (voir avec Caro et Dina)</div><div>A la MdE :&nbsp;</div><div>- les courses pour la Bouffe Artistes à la MdE (à l''étage, contacter le Troll --&gt;&nbsp;<span style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">06 61 41 15 17)</span><div><br></div><div>Laisse le reste dans le camion frigo, il est pour nous (la boufffffeeee !!!) tout le week-end.</div></div></div><div>Laisse les clés de Josh, le 11m3 désormais sans ambiance au QG.</div><div>Quand vous avez fini avec le camion frigo, allez le garer dans le creux GCU et rendez les clés au QG.&nbsp;</div><p></p>', NULL, 0, 'QG de l''ambiance', 3, 'non'),
(919, 40, 352, NULL, 'Réception des TPE', '<p>Attendre au local Fabrice Brunet qui ramène les 20 TPE de l''ambiance.</p><div><br></div><div>Quand il est là fais lui un chèque de caution de 10K et un chèque pour la location.</div><div><br></div><div>Va les ranger à la cave avec la log de ton coeur &lt;3</div><p></p>', NULL, 0, 'Steeeeeeeeeeeeeerf', 3, 'non'),
(920, 223, 334, NULL, 'Rapatriement pain stand bouffe', '<p>Rends-toi au QG orga pour aller chercher le pain du stand bouffe de la journée.</p><div>Tu dois récupérer :</div><div>- 500 baguettes le vendredi</div><div>- 900 baguettes le samedi</div><div>- 700 baguettes le dimanche</div><div><br></div><div>Amène le pain sur le stand bouffe et pose-le dans la panière prévue à cet effet.</div><p></p>', NULL, 0, 'QG Orga', 3, 'non'),
(921, 14, 347, NULL, 'Clés Wallace prémanif', '<p></p><ul><li>Aller voir quelqu''un du bureau du BdE</li><li>Faire l''état des lieux de Wallace</li><li>Récupérer les clés</li><li>Retourner faire la cuisine &nbsp;:)<br>Pour info la salle est rendu le lendemain (lundi 19 mai vers 14h30) car on prends hibiscus à ce moment là</li></ul><p></p>', NULL, 0, 'MdE', 3, 'non'),
(922, 14, 347, NULL, 'Retour clés Wallace prémanif', '<p></p><ul><li>Récupérer les clés de Wallace</li><li>Faire l''état des lieux de la salle</li><li>Rendre les clés au BdE</li><li>Dire merci au BdE</li></ul><p></p>', NULL, 0, 'ZC', 3, 'non'),
(923, 223, 321, NULL, 'Tâche sans nom', 'mmkml', NULL, 0, 'Trottoir devant le nouveau bâtiment de la piscine', -1, 'non'),
(924, 223, 316, NULL, 'Accueillir les presta', '<p></p><div><b>Vérifie que tu as les pochettes des 2 concessions à accueillir !&nbsp;</b></div><div><b><br></b></div><div>Les concessions vont arriver entre 14h et 16h, mais tu seras sur le stand bouffe donc pas de problème, c''est juste pour que tu ais les infos nécessaires à l''accueil des concessions !&nbsp;</div><div><br></div><div><b>Prévenir la log au talkie de l''arrivée de la presta. Faire l''état des lieux.</b></div><div>Communiquer le numéro sécu : 04 72 43 70 70 ou &nbsp;04 72 43 60 00</div><div><br></div><div>Mme Pelli. son numéro : 04 90 25 00 62</div><div>Pour le branchement élec, appeler Nico au talkie pour qui vienne procéder au raccord électrique de la concession.</div><div><br></div><div>Jérôme Aillaud. Son numéro : 06 22 61 62 22</div><div>Pour le branchement élec, attendre que la log arrive et voir avec elle.</div><div><br></div><div><b>Récupérer le reste du montant de la location et le chèque de caution (si on ne l''a pas déjà).</b>&nbsp;</div><p></p>', NULL, 0, 'entre piscine et GCU', 3, 'non'),
(925, 206, 412, NULL, 'Tâche sans nom', 'k', NULL, 0, 'Bar bouffe', -1, 'non'),
(926, 23, 476, NULL, 'Réunion de chantier', '<p>Rends toi aux bungalows de chantier près du bâtiment F&nbsp;</p><div>Retrouve Benhamou et les autres gonzes</div><div>Allez faire un tour sur le chantier pour vous assurer :</div><div><ul><li>que aucun objet dangereux ne traine (pas de bites trop pointues)&nbsp;</li><li>que le chantier est correctement sécurisé (barrièrage, pas de clefs sur les pelleteuses)</li><li>que les accès pompier sont dégagés</li></ul><div>Récupérer un contact à joindre en cas d''urgence.&nbsp;</div></div><p></p>', NULL, 0, 'Bat F', 3, 'non'),
(927, 16, 387, NULL, 'Entraver les kebabs', '<p>Prends ton fenwick supersonique, va placer des blocs de béton aux emplacement des kebabs volants : devant insa einstein à gauche et à droite et juste après la station vélov.&nbsp;</p>', NULL, 0, 'ZC', 3, 'non'),
(928, 22, 399, NULL, 'Apporter la signa Bar Bouffe Dimanche Soir', '<p>Yo ! Il va falloir que tu amènes la signa du dimanche soir au bar bouffe (prix des crèpes, etc...).</p><div><ul><li>Où que tu sois, va récupérer la signa dimanche soir du bar bouffe (elle est au QG Orga, ou bien dans ton 11m3 si tu l''as déjà mise dedans).</li><li>Si tu n''avais pas le 11m3, demande les clés du 11m3.</li><li>Dépose ton carton de signa au bar bouffe, ils se débrouilleront pour l''installer (si tu es en avance sur tes tâches, tu peux même le faire :p).</li><li>Rends les clés du 11m3.</li></ul></div><p></p>', NULL, 0, 'QG Orga', 3, 'non'),
(929, 22, 399, NULL, 'Enlever Signa ZC et Bars', '<p>Les concerts sont d''hors et déjà terminé. Après deux soirées de folies, la plupart des bars ne servent plus et vont être démontés. Ta tâche consiste donc à retirer toute la signa des bars de bon matin afin de ne pas gêner le démontage.</p><p></p><ul><li>Retrouve le resp Signa au QG Orga (SGM: 0648255118) ! Demander les clés du 11m3.<br></li><li>Munis toi de foutre de bricolage (surtout de pince coupante, et si possible de gants).</li><li>Envole toi vers la ZC, et démonte méthodiquement la signa de tout les bars, et celle de la ZC qui ne servira plus (pour ne rien oublier, regarde les descriptifs signa).</li><li>Mettre toute la signa dans le coffre du 11m3, SAUF les poster frame que nous mettrons dans le creux GCU sur une palette (prévenir Louis au Talky quand on les dépose).</li><li>Déposer la signa au QG, et rendre les clés du 11m3.</li></ul><div><br></div><p></p><p><br></p>', NULL, 0, 'Tout partout', 3, 'non'),
(930, 22, 399, NULL, 'Enlever Signa Permanente', 'Bonsoir, la manif'' est quasiment terminée, et il est l''heure de ranger la signa !<p> </p><div><ul><li>Rends toi au GQ Orga, et retrouve SGM (06 48 25 51 18). Demander les clés du 11m3.</li><li>Récupérer du matos de bricolage (pince coupante et gants de manutention notamment).</li><li>Suivre le descriptif signa permanente, et &nbsp;retirer toute la signa du festival.</li><li>Charger la signa dans le 11m3.</li><li>Une fois que toute la signa a été retirée, la déposer au QG Orga.</li><li>Renre les clés du 11m3.</li></ul></div>', NULL, 0, 'QG Orga', 3, 'non'),
(931, 22, 399, NULL, 'Enlever Signa Dimanche Soir', '<p>Ca y est, le feu d''artifice est passé, le film du Dimanche soir est terminé... Il est grand temps de commencer à tout ranger ! Fort heureusement, la signa a bien bosser tout l''après midi, et il ne te reste plus que la signa des bars BDE et Bouffe à enlever, et quelques panneaux qui n''ont pu être enlever plus tôt.</p><p></p><ul><li>Retrouve le resp Signa (SGM: 06 48 25 51 18) au QG Orga, et munis toi de foutre de bricolage (pinces coupantes et gant de manutention). Demander les clés du 11m3.</li><li>Se rendre au bar BDE et au bar Bouffe, et désinstaller la signa restante.</li><li>Désinstaller toute la signa spécifique au dimanche soir.</li><li>Laisser la signa dans le coffre, elle prend pas trop de place, et devra être amenée à la cave sous peu.</li><li>Retourner au QG Orga déposer le matériel que tu as pu emprunté et les clés du 11m3.</li></ul><div>Remarque: si tu as finit plus tôt, tu peux d''hors et déjà commencer ta tâche suivante !</div><div><br></div><p></p>', NULL, 0, 'Tout partout', 3, 'non'),
(932, 22, 399, NULL, 'Vérification Fin de Signa', '<p>Si tu ne les as pas encore, passe prendre les clés du 11m3 au QG orga.</p><p>Armé de ton 11m3, de tous tes descriptifs et de ton foutre de bricolage, parcours l''intégralité du festival à la recherche du moindre oublie de signa: banderole, feuilles plastifiées, panneaux...</p><p>Une fois que tu es sûr de ne rien avoir oublier cours vers le QG Orga pour déposer les clés du 11m3 et récupérer tes soft afin d''accomplir les dernières tâches signa !</p>', NULL, 0, 'Tout partout', 3, 'non'),
(933, 22, 399, NULL, 'Ramener la signa du QG à la cave', '<p>Bonsoir ! Tout d''abord, félicitation. Il est 2h30, tu es encore debout.</p><p></p><ul><li>Passe au QG orga demander les clés du 11m3, et de la cave.</li><li>Récupère toute la signa déposée au QG Orga, et met la dans le 11m3.</li><li>Décharge tout à la cave.</li><li>Retourne au QG Orga et rends les clés du 11m3 et de la cave.</li></ul><p></p>', NULL, 0, 'QG Orga', 3, 'non'),
(934, 31, 524, NULL, 'annoncer la fin des courses', '<P>Aller au village coureur (gymnase colette besson)</P>\r\n<DIV>Récupérer et lire le briefing "fin des courses"</DIV>\r\n<DIV><BR></DIV>\r\n<DIV>Aller à la sono du parcours</DIV>\r\n<DIV>\r\n<UL>\r\n<LI>Prendre le micro de la sono &nbsp;et annoncer la fin des courses (heure d''arrêt, sprint)</LI>\r\n<LI>Une fois la liste des sprinteurs connue, reparler du sprint et annoncer les coureurs participants et leur indiquer la marche à suivre</LI></UL>\r\n<DIV>Envoie du charisme au micro, rappelle le déroulement de la course, les partenaires, tour d''honneur bref meuble...</DIV></DIV>', 'briefing fin des courses\r\nBonne prestation orale', 0, 'Campus', 3, 'non'),
(935, 31, 524, NULL, 'Récup classement', '<P>Aller au village coureur (gymnase colette besson)</P>\r\n<UL>\r\n<LI>Récupérer la clé usb au village coureur&nbsp;<BR></LI></UL>Aller retrouver la personne du chrono\r\n<UL>\r\n<LI>Récupérer les classements de toutes les catégories (version papier et usb)</LI>\r\n<LI>Les garder et les donner a Ron pour la remise des prix</LI></UL>', 'Clé USB', 0, 'Campus', 3, 'non'),
(936, 31, 524, NULL, 'Liste des sprinteur', '<P>Aller au village coureur<BR></P>\r\n<UL>\r\n<LI>Prendre 3 feuilles et un stylo</LI>\r\n<LI>Aller au panneau d''affichage</LI>\r\n<LI>Noter les 5 équipes en tête (équipe + solo,&nbsp; homme/femme mélangé) : faire 3 exemplaires<BR></LI>\r\n<LI>Ranger cette feuille au village coureur avec les lots</LI></UL>', 'feuilles + stylo', 0, 'Campus', 3, 'non'),
(937, 31, 524, NULL, 'animer le tour d''honneur', '<p>Passer au QG Pédales (local insatiable),&nbsp;<br></p><ul><li>récupérer le mégaphone,&nbsp;</li><li>Se rendre au niveau de l''arche de départ OU sur la scène MdE</li></ul><div><br></div><ul><li>Prendre le micro de la sono</li><li>Commenter la fin de la course,</li><li>Animer le tour d''honneur, commenter, chauffer la foule en délire avec le megaphone</li></ul>Retourner au QG Pédales:<br><ul><li>Déposer tout le matériel</li></ul><p></p>', '1 megaphone', 0, 'Campus', 3, 'non'),
(938, 31, 525, NULL, 'Installation arche départ', '<p>Aller au Village Coureur (Gymnase colette besson), récupérer les clés du QG pédales et 1 caddie.<br><br>Aller au QG Pédales (local insatiable au H)</p><ul><li>récupérer l''arche A2I et une rallonge<br></li><li>l''amener sur le circuit au niveau de la petite scène</li><li>gonfler l''arche grâce à une rallonge (il suffit de la brancher après l''avoir installé à l''endroit adéquat, et elle montera toute seule avec l''air c''est magiiique)&nbsp;<br></li><li>Bien fixer afin qu''elle bouge pas<br></li><li>Ramener l''emballage au QG pédale (l''insatiable)</li></ul><div>Ramener les clés du QG Pédales au Village Coureur</div>', 'Arche départ\r\n1 ralonge ( loonnnnngue)', 0, 'Campus', 3, 'non'),
(939, 31, 525, NULL, 'Ranger arche de départ', '<p></p><div><div>Aller au village coureur, récupérer les clés du QG Pédales<br><br>Aller au QG Pédales (local insatiable au H):<br><ul><li>Récupérer un caddie, une pince coupante et des ciseaux</li><li>récupérer l''emballage de l''arche</li></ul>Aller sur le circuit et Enlever banderoles :</div><ul><li>détacher les différentes banderoles</li><li>Les mettre dans un caddie</li><li>Ramener le tout (matos + banderoles) à l''insatiable</li></ul><div>Aller sur la ligne de départ, dégonfler et ranger l''arche</div></div><ul><li>Enlever les attaches de l''arche puis la débrancher<br></li><li>ranger l''arche dans son emballage<br></li><li>récupérer la rallonge</li></ul>Ramener le tout au QG pédale<p></p>', 'emballage de l''arche', 0, 'Campus', 3, 'non'),
(940, 31, 525, NULL, 'Installer arche TDR', '<p>Aller au Village Coureur (Gymnase colette besson), récupérer les clés du QG pédales et 1 caddie.<br><br>Aller au QG Pédales (local insatiable au H)</p><ul><li>récupérer l''arche terre de running et une rallonge<br></li><li>l''amener sur le boulevard Niels Bohr.<br></li><li>gonfler l''arche grâce à une rallonge (il suffit de la brancher après l''avoir installé à l''endroit adéquat, et elle montera toute seule avec l''air c''est magiiique)&nbsp;<br></li><li>Bien fixer afin qu''elle bouge pas<br></li></ul>Ramener l''emballage à l''insatiable<div>Ramener les clés du QG Pédales au Village Coureur<br></div><div><br></div>', '1 Rallonge\r\nArche TDR', 0, 'Campus', 3, 'non'),
(941, 31, 525, NULL, 'Ranger arche TDR', '<p></p><div>Aller au village coureur (Gymnase colette Besson), récupérer les clés du QG Pédales<br><br>Aller au QG Pédales (local insatiable au H):<br><ul><li>Récupérer un caddie, une pince coupante et des ciseaux</li><li>récupérer l''emballage de l''arche TDR</li></ul>Aller sur le boulevard Niels Bohr, dégonfler et ranger l''arche</div><ul><li>Enlever les attaches de l''arche puis la débrancher<br></li><li>ranger l''arche dans son emballage<br></li><li>récupérer la rallonge</li></ul>Ramener le tout au QG pédales<br> <div><br></div><p></p>', 'Emballage arche TDR', 0, 'Campus', 3, 'non'),
(942, 31, 526, NULL, 'Installer le QG pédale', '<p><sub>-Va au local et récupère les clef de l''insatiable et les clefs de la cave<br></sub></p><p><sub>-Va au local des 24, imprime le gdoc avec tous les trucs que tu dois mettre dans le qg (leur emplacemnt sera marqué), met tout dans ton beau caddie<br></sub></p><p><sub>-Va au local de l''insatiable&nbsp;<br></sub></p><p><sub>- mets tout dans le local de l''insatiable&nbsp;</sub></p>', NULL, 0, 'Local de l&#039;insatiable', 3, 'non'),
(943, 31, 526, NULL, 'ranger le QG pédale', '<p></p><div>Rend toi au local de l''insatiable (bas du batiment H)</div><div><br></div><div>Retrouve l''orga course qui est avec toi.</div><div><ul><li>Aller chercher les clés auprès de la pédale qui les as</li><li>Retourne au QG pédale&nbsp;</li><li>Enlève toutes les affaires qui appartienne aux pédales (ex coupe, lots coureurs...) et ramène les au bocal ou à la cave suivant la place</li><li><b>Nettoie bien le local pour que l''Insatiable soit content et nous le prête de nouveaux l''an prochain :)&nbsp;</b></li><li>ferme le QG pédale et ramène les clefs au qg orga</li></ul></div><p></p>', 'La bonne humeur :)', 1, 'Local de l&amp;#039;insatiable', 3, 'non'),
(944, 31, 527, NULL, 'préparer le départ', '<p></p><div>Aller au village coureur</div><div>Récupérer la clé du QG Pédales</div><div><br></div><div>Aller au QG Pédales (=local insatiable au H)</div><ul><li>Récupérer le matériel de départ au local de l''Insatiable : ciseaux (des jolis ciseaux de préférence), ruban rouge</li></ul>Se rendre sur la ligne de départ<br><ul><li>Mettre en place le ruban</li><li>Aider les coureurs à bien se positionner, empêcher les relous de se positionner n''importe comment : les pros devant, les loisirs derrière, suivi des coureurs pieds, et on termine avec les vélos folklos.</li></ul><p></p>', 'le ciseau classe de préférence c''est pour notre momo\r\nLe superbe ruban rouge des pédales', 0, 'Campus', 3, 'non'),
(945, 31, 527, NULL, 'poison pilote Vélo', '<p>Aller au Village coureur (Gymnase Colette Besson)<br></p><ul><li>Récupérer un vélo et faire un tour de circuit, pour s''assurer que tout est en place</li><li>Retourner au village coureur&nbsp;</li></ul>Rejoindre le départ des courses (devant la mde)<br><ul><li>Se mettre devant la ligne de départ</li><li>Faire le tour devant les coureurs pour leur montrer le chemin</li><li>A la fin du tour se mettre sur le coté et laisser les vélos &nbsp;partir</li></ul>Ramener le vélo à Colette Besson', NULL, 0, 'Campus', 3, 'non'),
(946, 31, 527, NULL, 'poison pilote CAP', '<p>Aller au Village coureur (Gymnase Colette Besson)</p><ul><li>Aller au village coureur et demander aux coureurs (tous) de se rendre au départ pour les tours de reconnaissance à 13h45</li><li>Récupérer un vélov et faire un tour de circuit CAP, pour s''assurer que tout est en place<br></li></ul>Rejoindre le départ des courses (devant la mde)<br><ul><li>Aiguiller les coureurs pendant le tour de reconnaissance,</li><li>Laisser les coureurs sur la ligne de départ en leur demandant de se placer derrière les vélos</li></ul>Ramener le vélov à Colette Besson', NULL, 0, 'Campus', 3, 'non'),
(947, 31, 527, NULL, 'Discours et départ', '<p></p><div>RDV sur la ligne de départ<br></div><div><ul><li>Annoncer au micro le départ<br></li><li>Parler du 24thlon et défi natation à la piscine</li><li>remercier officiels, sponsors, parler du règlement, du village coureurs, bref occuper le temps</li><li>Donner la parole au maire, au directeur, bref à qui est là</li><li>Donner les ciseaux au maire</li><li>Faire couper le ruban au maire</li><li>annoncer le départ au Télephone (bien se synchroniser avec la natation num de david : 06 23 32 97 04)<br></li><li>encourager les coureurs au micro</li></ul><br></div><p></p>', 'Du charisme sur la prestation orale', 0, 'Campus', 3, 'non'),
(948, 31, 528, NULL, 'Placer la signalétiK pédales', '<p>Aller au Village coureur (gymnase colette besson). Récupérer toute la signalétik pédales (c''est un kit normalement)</p><p>Prends un vélov ou une voiture balai pour t''aider</p><div>Aller mettre chaque élément à son emplacement (repérer sur un plan )&nbsp;<br></div><div><br><u>Liste non complète:</u><br></div><div>- &nbsp;12 villages coureurs -&gt; et &lt;-</div><div>- 2 douches homme/femme</div><div>- 2 sanitaires</div><div>- 1 stand kiné</div><div>- 1 kiné/repos</div><div>- 2 ravitos</div><div>- affiches point de passage course</div>', 'Toute la signalétik // clé voiture + plan siganlétique', 0, 'Gymnase Colette Besson', 3, 'non'),
(949, 206, 318, NULL, 'Gestion du bar bouffe', '<p>Fouetter les softs, booster le Karna, mettre la bonne ambiance ET la bonne humeur, rappeler à Cheval que son QG est pourri et sans ambiance, mettre la pression aux bars (double sens, à méditer), having fun.</p>', NULL, 0, 'Bar bouffe', 3, 'non'),
(950, 21, 502, NULL, 'Récupération frigo ADEGE', '<p>RDV au local des 24 Heures<br>Retrouve ton co-tâche</p><p>A midi :<br>Récupère le diable et pars direction GE<br>Appelle Maxime Busy (0624242442424244242422442422424424224)<br>Dis lui que tu viens chercher le frigo de l''ADEGE pour les 24<br>Récupère le frigo et ramène le au local<br>Nettoie le (il est vraiment dégueu)<br>Met le à sécher</p><p>Le soir :<br>Récupère le diable, récupère le frigo de l''ADEGE dans le local et les clefs de la cave<br>Emmène le à la cave&nbsp;<br>Repose le diable et les clefs à la cave =)</p>', NULL, 0, 'Local des 24H', -1, 'non'),
(951, 21, 502, NULL, 'Récupération frigo As de Pique', '<p>RDV au local des 24 Heures<br>Retrouve ton co-tâche<br>Récupère le diable, la clef de la cave et Caro et pars direction GI (tu as rendez-vous à 13h45)<br>Appelle Alex&nbsp;<span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;">0641675155</span></p><p>Dis lui que tu viens chercher le frigo de l''As de Pique pour les 24 de la part de Caro (Ctrl+K)<br>Récupère le frigo et emmène le à la cave<br>Referme la cave<br>Repose le diable et les clefs de la cave =)</p><p>Bibis !</p>', NULL, 0, 'Local des 24H', -1, 'non'),
(952, 32, 371, NULL, 'Ouverture amphi Seguin Club Elek', '<p>-Rends toi au QG orga pour récupérer les clés de l''amphi Seguin<br>-Vas à l''amphi Seguin ouvrir au Club Elek qui sera là avec son super robot, il faut leur dire qu''il est super<br>-Aide les gens du Club Elek&nbsp; à aménager l''intérieur de l''amphi comme ils le souhaitent (les tables et les chaises apportées la veille)<br>-Aide les à brancher tout leur matos<br>-Ramène les clés au QG orga<br>-Tu peux aller t''entrainer pour le gargantuflam''s!</p>', 'Clés de l''amphi Seguin', 0, 'Amphi Seguin', 3, 'non'),
(953, 28, 469, NULL, 'Débarriérage de la Zone Nord', '<p>Retrouver Guerric (0604476430) sur le rond point au Nord de la piscine</p>Tomber le maximum de barrieres<br><br>Ranger les Héras proprement dans les rack (les alterner gauche/droite)<br>Ranger les plots sur les bonnes palettes<br>Faire des packs de 10 vaubans (alternées aussi)<br> <div><br></div>', '1 fenwick, du charisme, et de la bonne humeur!', 0, 'ZC', 3, 'non'),
(954, 23, 389, NULL, 'Sécu volant journée', '<p>Prends un talkie, promènes toi sur la ZC, si tu repère des éventuels probèmes signales les au PC sécu. A surveiller en particulier :</p><div><ul><li>Bagjump</li><li>Circuit des courses</li><li>Jeux gonflables</li><li>Gymnase C</li><li>Bars</li></ul></div><p></p>', NULL, 0, 'ZC', 3, 'non'),
(955, 228, 529, NULL, 'Accueil de digital Campus', '<p>Retrouve le(s) presta(s) au PS2. Montre leur comment arriver jusqu''à l''olivier</p><div>Montre leur un coin dans l''olivier où ils peuvent se mettre</div><div><br></div><div>Donne leur les 2 tickets bouffe et la rallonge électrique que tu auras récupéré au QG de l''ambiance</div><div><br></div><div>Leur dire de ressortir la voiture du Campus tout de suite après. Parce qu''après y a les courses et la voiture sera bloquée.</div><div><br></div><div><br></div><div><br></div><div><br></div><p></p>', NULL, 0, 'L''Olivier, MDE', -1, 'non'),
(956, 228, 529, NULL, 'Dire au revoir à digital Campus', '<p>Voir si tout s''est bien passé</p><div>Les aider à évacuer l''imprimante de l''olivier.</div><div>Vérifier qu''ils ont rien laissé</div><div>Récupérer la rallonge et la ramener au QG de l''ambiance</div><div><br></div><div><br></div><p></p>', NULL, 0, 'L&amp;#039;Olivier, MDE', -1, 'non'),
(957, 28, 530, NULL, 'GMBSUCP', '<p>C''est la soirée, le soleil se couche sur la Doua, et la travée verte est fermée<br><br>Le job c''est de faire de la Gestion Merde Barriérage Si Un Colson Pète. Si une barrière tombe ou un autre problème du même type, que ce soit sur le parcours de la course, la ZC la travée verte, bref, n''importe où, c''est à toi d''aller réparer tout ça. Donc reste bien à l''écoute de ton talkie et quoi que tu fasses, soit près à partir aux Bahamas ou à l''autre bout du campus<br><br>Quand tu te fais chier, n''hésite pas aller aider les bars à servir ou autre TIG</p>', 'Beaucoup de charisme et de bonne humeur!', 0, 'ZC', 3, 'non'),
(958, 14, 343, NULL, 'Accueillir AvrilSono', '<p>Accueillir avril sono au niveau de la rotonde</p>\r\n<div>Lui montrer le local de la FIE où sera installé la sono</div>\r\n<div>Lui redonner nos numéros de téléphone en cas de problème</div>\r\n<div><br></div>\r\n<div>Tél 04 78 70 02 81<br></div>\r\n<p></p>', NULL, 0, 'Rotonde', 3, 'non'),
(959, 228, 529, NULL, 'Accueil de digital Campus le vendredi', '<p>Alors là ils t''apportent le totem pour la sharing box. C''est plutôt stylé et il faut que ce soit prêt pour le concert du soir.</p><div>Retrouve les au PS4 et amène les sur l''espace détente (le long du gymnase).&nbsp;</div><div>Amène la rallonge que tu auras récupéré au QG orga</div><div><br></div><div>(IMPROVISE PARCE QUE POUR LE MOMENT J''EN SAIS PAS PLUS QUE TOI)</div><p></p>', NULL, 0, 'L&amp;amp;#039;Olivier, MDE', -1, 'non'),
(960, 14, 343, NULL, 'Dire au revoir à avrilSono', '<p>S''assurer que le chèque pour avrilSono est bien dans le sac, aller les rejoindre au niveau de la rotonde, et leur donner le chèque.</p>\r\n<p>Leur dire au revoir et à l''année prochaine peut être</p>', NULL, 0, 'Rotonde', 3, 'non'),
(961, 214, 531, NULL, 'com'' Lyon1_Rockefeller', '<p>Viens au local (de l''ambiance) &nbsp;récupérer ton co-tâche, une grosse pile de flyers (environ 200), une affiche nuit A3, et une dose de charisme.</p><p>Rends toi sur le campus Rockefeller Lyon1 (métro jusqu''à Grange Blanche).&nbsp;</p><div>Ta mission : poser des flyers aux différentes assos sur ce campus : ACLE, AAEPL, AEOL, ADEMKEL. Laisses aussi des flyers au RU du campus.</div><div><br></div><div>Reviens au local avec le sentiment d''avoir participé au non-déficit des 24h.&nbsp;</div><div>I believe I can flye !&nbsp;<span style="background-color: rgb(249, 249, 249); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 21px;">♫</span></div>', '- 1 affiche nuit A3\r\n- flyers', 0, 'Local des 24h', -1, 'non'),
(962, 23, 468, NULL, 'Comptage de l''ambiance', '<p>Tu as l''immense honneur de participer au dernier comptage de l''année. Alors sois fier !&nbsp;</p><div>Avant de partir, n''oublie pas :</div><div><ul><li>Ton cahier de comptage</li><li>Un crayon a papier</li><li>Ton gilet jaune</li></ul><div>Vole à ton point de comptage dans ton tramway supersonique</div></div><div>Compte les vélos, et appliques toi sur les carrés barrés !&nbsp;</div><div><br></div><div>Pour le créneau du soir : ramene tout ton matos au QG orga dans la rotonde dans le carton comptage prévu à cet effet.</div><p></p>', NULL, 0, 'A ton point de comptage', 3, 'non'),
(963, 23, 468, NULL, 'Briefing comptage de l''ambiance', '<p>Rends toi à l''amphi Lespinasse, et écoute attentivement le brieifing, n''oublie pas ton matériel en partant !&nbsp;</p>', NULL, 0, 'Amphi Lespinasse', 3, 'non');
INSERT INTO `Tache` (`id`, `responsable_id`, `groupetache_id`, `importid`, `nom`, `consignes`, `materielSupplementaire`, `permisNecessaire`, `lieu`, `statut`, `commentaireLog`) VALUES
(964, 21, 354, NULL, 'Rangement du matos à la cave', '<p>RDV au local des 24</p><div>Retrouver Cetelem</div><div>Récupérer les clefs de la cave du E et du 20m3</div><div>Charger le 20m3 avec tout le matos qui va à la cave (Demande à Cetelem, au moment où il écrit ça, il n''en a aucune idée de quoi prendre !)</div><div>Aller à la cave du E</div><div>Ranger la cave pour qu''elle soit prête à accueillir ce qu''il y a dans ton camion</div><div>Décharger le camion et ranger tout en laissant de la place au fond pour la signa et un côté pour l''élec</div><div>Refermer la cave</div><div>Rentrer au local et rendre les clefs du local</div><p></p>', NULL, 0, 'Local des 24H', 3, 'non'),
(965, 21, 532, NULL, 'Nettoyer les tantes de l''asso', '<p><strike>Nico ! Cheval ! A la douche !</strike></p><div><u>RDV au local des 24 à 14 Heures</u></div><div>Trouver ton ami le sceau et tes amis les éponges</div><div>Récupérer les clefs de la cave du E</div><div>Remplir le sceau d''eau</div><div>Aller à la cave du E et sortir les tentes (sans renverser l''eau)</div><div>Laver les tentes et les regarder sécher</div><div>Faire une bataille d''eau</div><div>Les ranger dans la cave</div><div>Rentrer au local avec le matos que tu as pris</div><div>Ranger le matos dans le local</div><div>Aller voir Cetelem et lui dire merci pour cette super tâche !</div><p></p>', NULL, 0, 'Cave de l''ambiance', 3, 'non'),
(966, 19, 461, NULL, 'Rendre les gobelets à AGP', '<p>AGP arrive avec une semie remorque pour prendre les gobelets stockés dans la cave du PC.</p><div><br></div><div>- RDV local avec Louis et/ou Choppy</div><div>- Récupérer les clés de la cave du PC (entrée nord)</div><div>- Sortir les cartons avec AGP et les mettre dans la semie</div><div><br></div><div>Merciiii</div><p></p>', NULL, 0, 'Creux GCU', -1, 'non'),
(967, 19, 461, NULL, 'Rangement Bar AIP et MDE', '<p>C''est la dernière soirée du festival !</p><div>Présente toi à Bruce Louis l''Orga Bar : 0786855921, au creux GCU, il te guidera.</div><div><br></div><div>Seul le bar BDE va ouvrir... tu peux donc commencer à ranger le bar AIP :</div><div><ul><li>frigos</li><li>tireuses</li><li>compteuse à gobelets</li><li>signa</li><li>moquette</li><li>etc</li></ul><div>Il faut que tout soit parti (bar doit être nu ! hi...hi ...)</div></div><div>Mets tout le matos bar au creux, et la log (tables et chaises) à l''AIP.</div><div><br></div><div>30 dernières minutes ==&gt; Une fois que c''est fini, faire la même chose avec le Bar Mde (bcp bcp bcp plus court il y a qu''<u><b>un frigo à ramener au QG orga</b></u> et deux tables :D)</div><div><br></div><div>Merciii</div><p></p>', NULL, 0, 'Creux GCU', 3, 'non'),
(968, 19, 461, NULL, 'Rangement Bar K-Fêt', '<p>C''est la dernière soirée du festival !</p><div>Présente toi à Camille l''Orga Bar :&nbsp;<span style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">06 67 12 02 16</span>, au creux GCU, elle te guidera.</div><div><br></div><div>Seul le bar BDE va ouvrir... tu peux donc commencer à ranger le bar K-Fêt :</div><div><ul><li>frigos</li><li>tireuses</li><li>compteuse à gobelets</li><li>signa</li><li>moquette</li><li>etc</li></ul><div>Il faut que tout soit parti (bar doit être nu ! hi...hi ...)</div></div><div>Mets tout le matos bar au creux, et la log (tables et chaises) à l''AIP.</div>', NULL, 0, 'Creux GCU', 3, 'non'),
(969, 23, 468, NULL, 'Ramener matos comptage', '<p>Récupère une voiture au QG orga, et le matos du comptage de jeudi chez Alycosofreco.&nbsp;</p>', NULL, 0, 'Partout', 3, 'non'),
(970, 210, 440, NULL, 'Déco zone concert (graphs)', '<p></p>\r\n<ul>\r\n<li>Au QG, récupère un cutter et du scotch</li>\r\n<li>Rends toi au dépôt Humas pour chercher les rouleaux de graphs</li>\r\n<li>Accroche-les sur les barrières de la zone concert</li>\r\n<li>Ramène le scotch et cutter au QG orga</li>\r\n<li>Tu es libre :)</li></ul>\r\n<p></p>', NULL, 0, 'QG Orga', 3, 'non'),
(971, 9, 533, NULL, 'Flyage soirée étudiante', '<p>Viens au local (de l''ambiance) &nbsp;récupérer ton co-flyage, une grosse pile de flyers (environ 200 chacun) et une dose de charisme.</p><div>Dirige-toi vers l''arrêt de tram.&nbsp;</div><div>Prends le tram jusqu''à Charppennes et le métro A jusqu''à Hôtel de ville - va ensuite dans la rue du QG (22, rue Joseph Serlin).</div><div>Flye jusqu''à ce que tu n''aies plus de flyers, reste à proximité du QG il y a une soirée étudiante.&nbsp;</div><div>Reviens au local avec le sentiment d''avoir participé au non-déficit des 24h.&nbsp;</div><div><br></div><div>I believe I can flye !&nbsp;<span style="background-color: rgb(249, 249, 249); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 21px;">♫</span></div><p> </p>', 'Charisme - Poésie - Sourires', 0, 'Local des 24H', 3, 'non'),
(972, 9, 534, NULL, 'Installation', '<p>Salut à toi !</p>\r\n<div><br>\r\n<div>Appelle l''Anguille au 07.86.39.70.45 il te donnera des précisions sur comment effectuer ta tâche.<br></div>\r\n<div><br></div>\r\n<div>Va au QG Orga chercher un sac poubelle (50L) puis <u><b>au dépôt AIP</b></u> chercher une tente 3*3m (normalement marquée Paintball)</div>\r\n<div><br></div>\r\n<div>Ensuite, va sur les Humanités déposer cette tente côté bâtiment Humas à côté du parking où aura lieu le BagJump tout doit être installé à 10h.</div>\r\n<div><br></div>\r\n<div>Ne pars pas tant que le prestataire n''est pas là - une fois qu''il arrive aide le à ramener son matos et à l''installer si besoin.</div>\r\n<div><br></div>\r\n<div>En cas de problème ou s''il y a du retard - appelle impérativement au 07.86.39.70.45 .</div></div>\r\n<p></p>', 'Lunettes - Plumeau - Arbritude', 0, 'QG Orga', 3, 'non'),
(973, 9, 534, NULL, 'Désinstallation', '<p>Salut à toi !</p>\r\n<div>\r\n<div>Appelle l''Anguille au 07.86.39.70.45 il te donnera des précisions sur comment effectuer ta tâche et te rejoindra.</div>\r\n<div>&nbsp;</div>\r\n<div>On va ensuite sur les Humas au stand Direct Paintball (à côté du BagJump). On fera un débrief de la journée avec le responsable et on l''aidera à désinstaller et ranger. On remettra la tente 3*3 du stand <b><u>au dépôt AIP.</u></b></div>\r\n<div><br></div>\r\n<div>En cas de problème ou s''il y a du retard - appelle impérativement au 07.86.39.70.45 .</div></div>', 'Tulipe - Thon - Maïs', 0, 'Pelouse des Humas', 3, 'non'),
(974, 197, 535, NULL, 'Installer la tente', '<p></p><ul><li>Au QG orga, repère sur le plan l''emplacement de l''animation la Rivière du Doute</li><li>Rends-toi au dépôt humas et récupère la tente pour la Rivière du Doute&nbsp;</li><li>Rends-toi sur l''emplacement. Monte la tente.&nbsp;</li><li>Tu es libre :)</li></ul><p></p>', NULL, 0, 'QG orga', 3, 'non'),
(975, 197, 535, NULL, 'Installer l''anim', '<p></p><ul><li>Récupère le kit Rivière du Doute au dépôt (5 chaises, 1 table, rouleaux de tapisserie)</li><li>Rends-toi sur l''emplacement.</li><li>Tend les rouleaux de tapisserie entre les poteaux de manière à faire une toile (Jeanne t''expliquera)</li><li>Place les chaises sous la table.</li></ul><div>NE PAS LAISSER LE MATERIEL SANS SURVEILLANCE</div><ul><li>Accueille les prestas vers 13h30 (06 24 89 90 77)&nbsp;</li><li>Demande s''ils n''ont besoin de rien, puis tu es libre :)</li></ul><p></p>', NULL, 0, 'Dépôt Humas', 3, 'non'),
(976, 31, 469, NULL, 'Cercler les barrières', 'Retrouve Ron aka Thomas sur la ZC devant le bar bouffe<div><br></div><div>L''objectif est de cercler un maximum de vaubans, par pack de 10 pour celles de la ville de Lyon et par pack de moults (au moins 20) pour celles du Grand Lyon<br><br>----Pour Ron---<br>Récupère le cercleuses et les sangles qui sont dans ton sac<p> </p></div>', '2 cercleuses\r\n2 sangles', 0, 'ZC', 3, 'non'),
(977, 14, 512, NULL, 'Ramener la scie circulaire au QG orga', '<p>Va prendre la scie circulaire auprès du troll</p><div>Emmène la au QG orga</div><div>Donne la aux zumains</div><div>Ca y est c''est terminé !</div><p></p>', NULL, 0, 'MdE', 3, 'non'),
(978, 197, 535, NULL, 'Tout va bien ?', '<p></p><ul><li>Rend toi à l''emplacement de l''Esprits Critique (la rivière du doute)</li><li>Demande si tout va bien</li><li>S''ils n''ont besoin de rien, tu es libre :)</li></ul><p></p>', NULL, 0, 'Pelouse des Humas', 3, 'non'),
(979, 197, 535, NULL, 'Ranger l''anim', '<p></p><ul><li>Au QG orga, récupère un cutter</li><li>Rend toi sur le stand d''Esprits critiques (la rivière du doute)</li><li>Aide les à ranger: enlève la "toile", avec le cutter si besoin.</li><li>Pendant qu''ils sont encore là, range les tables et chaises au dépot humas. Jette la toile.</li><li>Remercie les d''être venus !</li><li>Démonte la tente, puis range-la au dépot Humas</li><li>Sur l''emplacement du stand, vérifie que rien n''a été oublié</li><li>Rapporte le cutter au QG orga</li><li>Tu es libre :)</li></ul><p></p>', NULL, 0, 'QG orga', 3, 'non'),
(980, 28, 536, NULL, 'Installer le matos', '<p>Rends toi devant le Dépôt AIP et attend tes co-tâches.<br>Vous allez vous occuper de ramener le matos pour le tournoi de Rugby touch<br><br>Dans le dépot AIP, il faudra prendre:</p><p></p><ul><li>Un caddie pour tout transporter plus facilement!</li><li>3 tentes 3x3<br></li><li>2 tables 2 places<br></li><li>4 chaises</li></ul><div>Et aller les déposer le long du terrain de foot sable (le beige) sur l''herbe, a côté du rond point au nord de la piscine.</div><div><br></div><div>------/!\\/!\\/!\\/!\\/!\\Bien ramener le Caddie au dépôt AIP après /!\\/!\\/!\\/!\\---------------------</div><div><br>(en cas de problème, appelle le resp Guerric au 0604476430)</div><p></p>', 'du charisme, de la bonne humeur', 0, 'Dépôt AIP', 3, 'non'),
(981, 28, 536, NULL, 'Ranger le matos', '<p>Rends toi au dépôt AIP pour prendre un caddie, ça te sera utile!</p><p>Rends toi sur l''herbe à côté du terrain de foot stabilisé (celui en sable).<br>Tu y verras normalement des tentes et des gens qui font du rugby.<br><br>Ton objectif est de ramener le matos au dépôt AIP avec tes co-tâches<br>Il faut donc que tu ramènes:</p><div><ul><li>3 tentes 3x3<br></li><li>2 tables 2 places<br></li><li>4 chaises</li></ul>...Au dépôt AIP<br>Et n''oublie pas de laisser le caddie là bas.</div><div><br></div><div><br>En cas de problème, appelle le resp Guerric au 0604476430</div><p></p>', 'du charisme et de la bonne humeur', 0, 'Terrain de foot synthétique', 3, 'non'),
(982, 28, 536, NULL, 'Au revoir rugby Touch', '<p><b style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">&nbsp;</b><b style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">Ronel Zenon - 0699182730<br></b><br>Aller voir Ronel sur le terrain stabilisé, lui dire que c''est fini pour aujourd''hui, le prévenir que des softs vont venir récupérer la tente et le matos et lui souhaiter une bonne soirée. A demain/A l''année prochaine!</p>', NULL, 0, 'Terrain de foot synthétique', 3, 'non'),
(983, 21, 537, NULL, 'Aller chercher des caddies', '<p>RDV au local des 24 Heures (rdc bât D)</p><div>Retrouve Cetelem (06 80 52 08 62)</div><div>Aller à la dirpat</div><div>Récupérer leurs caddies et les ramener au local des 24 Heures</div><div>S''il y en a au moins 7, tu peux rentrer chez toi</div><div>S''il y en a moins, trouve du courage et des jetons/pièces de 1€ et va chercher le bon nombre de caddie à carrefour market.</div><div>Ramène les au local</div><div>Merci =)</div><p></p>', NULL, 0, 'Local des 24H', 3, 'non'),
(984, 21, 537, NULL, 'sgfsd', 'dfsfsdsd', NULL, 0, 'Local des 24H', -1, 'non'),
(985, 23, 538, NULL, 'Accueillir les Algeco', '<p>Tu es sur la ZC, en train de vagabonder&nbsp;<br>quand à un moment, dans ton talkie tu entends<br>Les Algecos vont arriver, vite rends toi aux entrées<br>Munis de tes plans, supervise le déchargement!<br>Place les caisses à l''endroit indiqué et n''oublie pas de récupérer les clés!<br></p><div>Numéro du mec</div><div><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt; color: rgb(34, 34, 34); background-color: rgb(255, 255, 255); font-size: 11pt; font-family: Calibri, sans-serif;"><b><span lang="EN-US">Tony CAZORLA<u></u><u></u></span></b></p><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt; color: rgb(34, 34, 34); background-color: rgb(255, 255, 255); font-size: 11pt; font-family: Calibri, sans-serif;"><span lang="EN-US">E-mail :&nbsp;<a href="mailto:tony.cazorla@batiloc.fr" target="_blank" style="color: rgb(17, 85, 204);">tony.cazorla@batiloc.fr</a><u></u><u></u></span></p><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt; color: rgb(34, 34, 34); background-color: rgb(255, 255, 255); font-size: 11pt; font-family: Calibri, sans-serif;">Tél. :&nbsp;<a href="tel:04.78.04.17.12" value="+33478041712" target="_blank" style="color: rgb(17, 85, 204);">04.78.04.17.12</a></p></div><div><br></div><p></p>', 'un stylo (pour signer une possible décharge)', 0, 'Doua', 3, 'non'),
(986, 23, 538, NULL, 'Reprise Algecos', '<p>Entre 2 barrières, rends toi aux entrées, le mec qui viens chercher les algecos est arrivé.&nbsp;<br>(Normalement les barrières des caisses ont toutes été enlevée donc le mec peut passer avec son semi.)</p><div><br><div>Dis lui bonjour, vérifie que les algecos sont bien vides (sinon tu peux appeler Clara)<br></div></div><div>Laisse le charger les algecos sur son semi, Merci et au revoir!!<br><br>Retourne au barriérage avec la joie et la bonne humeur (#bonneambiance)</div><p></p>', 'un stylo', 0, 'Doua', 3, 'non'),
(987, 28, 536, NULL, 'Bonjour Rugby touch', '<p></p><ul><li>Aller voir Ronel a côté des terrains de foot, lui dire bonjour :)<br></li><li>Vérifier que tout va bien.&nbsp;<br></li><li>Lui rappeler les horaires du BBQ (12-14) et vérifier la présence de l''extincteur.<br></li><li>Lui souhaiter une bonne journée</li><li><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">Communiquer le numéro du PC S</span><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">écu à l''intervenant : 04 72 43 70 70</span><br></li></ul><p></p>', NULL, 0, 'Terrain de foot synthétique', 3, 'non'),
(988, 28, 469, NULL, 'Fin du débarriérage', '<P>C''est le lundi soir, il faut que toutes les barrières soient rangées, cerclées, triées et rassemblées avant d''aller se coucher</P>\r\n<DIV>\r\n<DIV>On va se diviser en plusieurs équipes:</DIV>\r\n<DIV><BR>Avec un conducteur de Fen</DIV>\r\n<DIV>Une équipe qui va faire le tour de la ZC pour ramener toutes les barrières aux points de dépôts et (Un sur la pelouse direction pour les vaubans de la ZC).</DIV>\r\n<DIV><BR></DIV>\r\n<DIV>Avec Ron aka Thomas Thoubillon</DIV>\r\n<DIV>Une équipe pour cercler les barrières du Grand Lyon le long du terrain Stabilisé (barrières des courses)</DIV>\r\n<DIV>Prendre les cercleuses et les sangles et tout sangler. Une fois que c''est terminé, aller aux autres points de dépôts des courses (Niels Bohr, Batiment F) et faire de même</DIV>\r\n<DIV><BR></DIV>\r\n<DIV>Avec l''autre conducteur de Fen.</DIV>\r\n<DIV>Une équipe va faire le tri entre barrières de Lyon, Grand Lyon et Dirpat et TMF (rpat!)</DIV>\r\n<DIV>Et rassembler tout le matos TMF sur la pelouse devant GCU avec tous les racks, les Jambes de Forces, les colliers et les plots de Héras.<BR></DIV>\r\n<DIV><BR></DIV>\r\n<DIV>Ne pas oublier les endroits où il peut rester des barrières:<BR>\r\n<UL>\r\n<LI>Bâtiment Direction<BR></LI>\r\n<LI>Amphi Berger et Seguin<BR></LI>\r\n<LI>Parcours Courses<BR></LI>\r\n<LI>Le rack de la travée Verte + plots +colliers+vaubans.<BR></LI>\r\n<LI>Derrière la BMC</LI>\r\n<LI>Derrière le Gymnase C</LI></UL></DIV>\r\n<DIV><BR></DIV></DIV>\r\n<P></P>', NULL, 0, 'ZC', 3, 'non'),
(989, 9, 539, NULL, 'Récupérer préventes BDE', '<p>Essayer de faire un truc loin - soit AMEUSO (Fac Médecine Lyon-Sud) - soit ACLE + AAEPL (Fac Médecine Lyon-Est)</p>', 'Magie - Baguette - Queue', 0, 'Partout', 3, 'non'),
(990, 9, 539, NULL, 'Gérer les préventes', '<p>Dévalidez les bonnes places avec les numéros de billet.</p>', 'Impartialité - Printemps - Gogo', 0, 'Partout', 3, 'non'),
(991, 9, 540, NULL, 'Installer signa de la zone concert', '<p>Va aider Erwan.</p>', 'Soutien - Hermès - Carpaccio', 0, 'Campus de La Doua', 3, 'non'),
(992, 21, 543, NULL, 'Sieste Log', '<p>Trouve un canap libre</p><div>Demande aux gens de ne pas te toucher</div><div>S''effondrer comme un gros sac</div><div>Attendre les orgas de la tâche suivante</div><p></p>', NULL, 0, 'QG Orgras', 3, 'non'),
(993, 21, 537, NULL, 'Aller chercher des palettes', '<p>Votre mission si vous l''acceptez,</p><div>Ramener XX* palettes au local des 24 !</div><div>Vous avez 2 heures et 1 caddie !</div><div>Bon courage !</div><div><br></div><div>*<i>Voir le nombre exact sur ta liste</i>&nbsp;</div><p></p>', NULL, 0, 'Local des 24H', -1, 'non'),
(994, 9, 540, NULL, 'Désinstaller signa de la zone concert', '<P>Va aider Erwan.</P>', 'Humeur - Hashtag - Haschisch', 0, 'Campus de La Doua', 3, 'non'),
(995, 9, 539, NULL, 'GMBDE', '<P>Gérer la merde des préventes BdE.</P>', 'Pédagogie - Tétrahydrocannabinol - Trivialité', 0, 'Partout', 0, 'non'),
(996, 19, 461, NULL, 'Vérifier et Brancher les frigos fraichement arrivés', 'Mamie Caro vient de déposer des frigos au creux GCU.<div><br></div><div>Il faut les prendre et les mettre derrière les bars, sur les palettes prévu a cet effet :)!</div><div><br></div><div>Retrouve les Orgas Bars au Creux à 21h, et avec eux place les frigos !</div><div><br></div><div>Merci</div>', NULL, 0, 'Creux GCU', -1, 'non'),
(997, 19, 461, NULL, 'Remplir Camions Frigos Fûts', '<p>1) Il faut remplir les camions frigos 20m3 et 11m3 de fûts ! Demande à Alexis (<span style="LINE-HEIGHT: 20px; BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: ''Helvetica Neue'', Helvetica, Arial, sans-serif; COLOR: rgb(51,51,51); FONT-SIZE: 14px">06 80 52 08 62)</span>&nbsp;les clés de ces camions.</p>\r\n<div>Mets le plus de fûts possible dans ces camions.</div>\r\n<div><br></div>\r\n<div>Une fois remplis amène le petit (11m3) à son emplacement (contre l’immeuble aip).</div>\r\n<div><br></div>\r\n<div>\r\n<div>2) Ensuite fais un tour des fûts, vérifie qu''ils sont où il faut comme il faut. Fais des ronde et gère tout ce qui a été livré aujourd''hui.</div>\r\n<div><br></div></div>\r\n<p></p>', NULL, 0, 'Creux GCU', 3, 'non'),
(998, 13, 461, NULL, 'Gobelets', '<p>Préparer la répartion des gobelets pour chacun des bars</p>\r\n<div>Ranger les stocks</div>\r\n<p></p>', NULL, 0, 'Creux GCU', 3, 'non'),
(999, 19, 461, NULL, 'Tâche sans nom', 'gfgfdg', NULL, 0, 'Creux GCU', -1, 'non'),
(1000, 28, 496, NULL, 'Rendez les Vaubans (4)', '<p>En arrivant sur le campus, récupérer un fen pour le chargement du semi.</p>\r\n<div>Guider le semi vers le dépôt Niels Bohr.<br>Charger le semi<br>Aller rendre le tout au dépôt du Grand Lyon (ne pas oublier le papier du dépôt):<b>(y aller en voiture)</b><br><b>18 avenue de la République 69200 Vénissieux<br></b>Attendre qu''ils vident le semi<br>Dire au revoir au chauffeur et au dépôt et rentrer en bagnole sur le campus</div>\r\n<div><br></div>\r\n<div>ATTENTION: Le dépôt ferme à 16h30 donc il faut partir le plus tôt possible du campus, avant 15h45 sinon ça ne sert à rien du tout!&nbsp;</div>', 'le papier des depots', 0, 'Lyon city beach!', 3, 'non'),
(1001, 194, 544, NULL, 'Tâche sans nom', 'frf', NULL, 0, 'Villeurbanne', -1, 'non'),
(1002, 31, 545, NULL, 'Accueil et installation chrono', '<p>RDV au village coureur (gymnase colette besson) et attendre un orga course<br></p>\r\n<ul>\r\n<li>Chercher une table double, deux chaises et la tente 3*3<br></li>\r\n<li>installer la tente</li></ul>Accueillir les personnes du Chronomètre<br>\r\n<ul>\r\n<li>Lui montrer où s''installer</li></ul>L''aider à monter l''arche du chrono.&nbsp;\r\n<div>\r\n<ul>\r\n<li>récupérer les rallonges nécessaires au QG Pédales.<br></li>\r\n<li>Clé du QG Pédales disponible au Village coureur.</li>\r\n<li>Se brancher au village coureur</li></ul></div>', 'Tente 3 *3\r\nMatériel du chrono (ordi, arche, ..)', 0, 'Village coureur', 3, 'non'),
(1003, 31, 545, NULL, 'Ranger chrono', '<P>Retrouver un orga courses &nbsp;au village coureur (=gymnaseColette Besson).</P>\r\n<P>Récupères de quoi nettoyer.</P>\r\n<UL>\r\n<LI>Aider la personne du chrono à ranger son matériel si besoin</LI>\r\n<LI>Nettoyer et ranger la table et les 2 chaises au village coureur</LI>\r\n<LI>Nettoyer, plier la tente et la ramener au village coureur</LI></UL>', 'tente 3*3', 0, 'Village Coureur', 3, 'non'),
(1004, 31, 545, NULL, 'amener les dossards', '<p>Prendre les dossards et la liste des puces</p><div>Prend ton vélo&nbsp;<div>Amener au chrono</div><div><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; line-height: 16px; background-color: rgb(255, 255, 255);">66 Rue Louis Becker, 69100 Villeurbanne</span></div></div>', NULL, 0, 'local des 24h', 3, 'non'),
(1005, 210, 546, NULL, 'Accueillir Paul Predki', '<p></p><div>Morgane (Jeanne):</div><ul><li>Au QG orga, récupérer les clefs du espace VIP, un sac poubelle et une éponge</li><li>Rends toi à l''espace VIP, au milieu du bâtiment&nbsp;Coulomb (RdC)</li><li>Vérifie que c''est pas trop le zouk. Sinon, jette ce qui traine et donne un coup d''éponge. Referme à clefs.</li><li>A 14h30, retrouve Paul Predki (06 70 57 23 34), sur le parvis des humas.</li><li>Installe-le dans l''espace VIP où il va pouvoir poser son matos&nbsp;</li><li>Referme à clefs et va repérer avec lui les endroits où il va pouvoir se promener en jouant.</li><li>Dis lui qu''à la fin de son spectacle, quelqu''un viendra le retrouver pour lui ouvrir l''espace VIP (pour qu''il puisse récupérer ses affaires)</li></ul><div>Confiance:</div><div><ul><li>Retrouve Morgane (06 70 11 59 48), récupère les clefs de l''espace VIP. Tu en es responsable.&nbsp;</li><li>Présente toi au musicien, c''est toi qui va reste à sa disposition jusqu''au début du concert.</li><li>Si le musicien veut retourner à l''espace VIP, ouvre lui la porte, et referme quand il en sort pour le spectacle (début prévu du spectacle 15h30)</li><li>Lorsque Paul Predki quitte l''espace VIP pour aller jouer, demande lui s''il n''a rien oublié.</li><li>Referme à clefs, souhaite lui un bon concert, et ramène les clefs au QG orga !</li></ul></div><p></p>', '1 sac poubelle', 0, 'QG orga', 3, 'non'),
(1006, 31, 545, NULL, 'récupérer les dossards', '<p>Prend ton vélo</p><p>Pédale vite!!!!!!!!</p><p>Aller&nbsp;récupérer&nbsp;les dossards chez le chrono</p><div><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; line-height: 16px; background-color: rgb(255, 255, 255);">66 Rue Louis Becker, 69100 Villeurbanne</span><br></div><div><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; line-height: 16px; background-color: rgb(255, 255, 255);">Remonte sur ton vélo</span></div><div><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; line-height: 16px; background-color: rgb(255, 255, 255);">Pédale vite!!!!!!!</span></div><div><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; line-height: 16px; background-color: rgb(255, 255, 255);">Les amener au village coureur</span></div>', NULL, 0, 'Campus', 3, 'non'),
(1007, 31, 547, NULL, 'préparation des sacs coureurs', '<p>-Va au QG pédale (local de l''insatiable, bat H) près du gymanase collette besson&nbsp;<br></p><p>- S''occuper dans l''ordre : Piscine, Pied, Triathlon, Vélo</p><p>- Sur la liste (donnée par l''orga hard présent), vous trouverez toutes les équipes de coureurs avec les coureurs qui composent l''équipe</p><p>- Il faut un sac "terre de running" par équipe pour chaque équipe</p><p>- Mettre dans ce sac : (le matériel sera préparé à l''avance)</p><p>* Feuilles briefing Piscine/Pied/Triathlon/Vélo</p><p>* Fly de pub (éventuellement)</p><p>*bon mcdo</p><p>- Fermer le sac puis coller sur le sac l''étiquette correspondant à l''équipe en les découpant au fur et à mesure (au même endroit sur chaque sac)&nbsp;</p><p>- Cocher l''équipe</p><p>- Donner le sac fermé à la personne qui s''occupe de les ranger</p><p>- Lorsque les sacs coureurs pour les coureurs Piscine sont finis, passer aux coureurs Pied puis Triathlon puis Vélo</p><p>-Si vous n''avez pas les listes des coureurs, demander les à l''orga hard présent</p><p>-Penser à prévenir la personne qui range les sacs lorsque vous changez de catégorie.</p>', 'Liste des coureurs piscine/pied/roller/triathlon/vélo\r\nSacs terre de running', 0, 'Gymnase Colette Besson', 3, 'non'),
(1008, 31, 547, NULL, 'récupérer contenu des sac coureurs', '<p>Trouver et rassembler les éléments suivants au local des 24 :&nbsp;</p><p>*Des sacs coureurs "terre de running"</p><p>*Tshirts coureurs</p><p>*Les fly de pub (éventuellement)</p><p>*des étiquettes ou des feuille découper avec du scotch&nbsp;</p><p>*Bon mcdo</p><p>*5 cartons vides</p><p>*Liste des coureurs&nbsp;Pied, Triathlon, Piscine, Roller, Vélo (avoir plusieurs listes). Bien imprimer en priorité Pied puis Triathlon puis Piscine puis Vélo. Bien séparer les courses en équipe, solitaire, loisir..<br></p><p>Prendre des stylos, une agrafeuse et des ciseaux.<br></p>Tout emmener au QG pédales avec le caddie', NULL, 0, 'local des 24h', 3, 'non'),
(1009, 31, 547, NULL, 'ranger les sacs coureurs', '<p>- Se retrouver au QG Pédale (local de l''insatiable)</p><p>- Prendre les cartons vides</p><p>- Utiliser un carton par catégorie et marquer la catégorie au marqueur dessus (Piscine/Pied/Triathlon/Vélo)</p><p>- Mettre au fur et à mesure les sacs coureurs dans le carton en les triant par ordre de numéro de dossard (regarder sur l''étiquette).</p><p>Un commence par les premiers numéros, l''autre par les derniers.</p><p>&nbsp;Attention bien mettre le sac coureur dans la bonne catégorie (Normalement l''ordre c''est : Piscine, Pied, Triathlon Vélo)</p>', 'Des cartons', 0, 'Gymnase Colette Besson', 3, 'non'),
(1010, 31, 547, NULL, 'apporter les sacs coureurs sur le stand inscription', '<p>- Se rendre au QG pédales&nbsp;</p><p>- Prendre les cartons de sacs coureurs triathlon, pied, natation et vélo&nbsp;<br></p><p>- Les mettre dans le caddies</p><p>- Les amener sur les stands des inscriptions sur le parking Colette Besson.</p>', NULL, 0, 'Gymnase Colette Besson', -1, 'non'),
(1011, 210, 548, NULL, 'Accueillir Arts dreams', '<p></p><div>Morgane (Jeanne):</div><ul><li>Au QG orga, récupérer les clefs du espace VIP, un sac poubelle et une éponge</li><li>Rends toi à l''espace VIP, au milieu du bâtiment&nbsp;Coulomb (RdC)</li><li>Vérifie que c''est pas trop le zouk. Sinon, jette ce qui traîne et donne un coup d''éponge. Referme à clefs.</li><li>A 15h, retrouve Arts Dreams (06 70 57 23 34), vers la BU Marie Curie. Aide les à décharger si besoin.</li><li>Installe-les dans l''espace VIP où ils vont pouvoir poser leur matos&nbsp;</li><li>Referme et emmènent les voir le podium MDE</li><li>Présente-leur la personne qui va prendre le relais. Redonne leur ton numéro, en cas de problème. Tu les retrouveras à 16h30.</li></ul><div><br></div><p></p>', '1 sac poubelle', 0, 'QG orga', 3, 'non'),
(1012, 21, 502, NULL, 'Rendre le frigo de l''ADEGE', '<p>RDV au local des 24 Heures (rdc bât C)</p><div>Retrouve Cetelem</div><div>Récupérer 1 diable, le mégaphone de l''ADEGE et les clés de la cave</div><div>Appeler Maxime Busy, président de l''ADEGE -&nbsp;06 51 41 43 04 et dit lui que tu pars à la cave, tu seras là 20 minutes plus tard devant GE</div><div>Aller à la cave, récupérer le frigo de l''ADEGE</div><div>Refermer la cave</div><div>Aller devant GE et retrouver Maxime</div><div>Rendez lui son frigo et son mégaphone</div><div>Retourner au local et trouver le frigo de Boards of Mangroove (attention il est caché, il est vert), rendre le frigo et dire merci !</div><div>Rentrer au local, ranger le diable et les clefs</div><div>Bibis !</div><p></p>', NULL, 0, 'Local des 24H', 3, 'non'),
(1013, 210, 415, NULL, 'Ramener le lino au club rock', '<p>RDV au QG orga</p><div>Retrouve Jeanne</div><div>Demander les clef du club rock aux humains</div><div>Aller sur la pelouse des humas et récupérer le lino (le rouler en rouleau)</div><div>L''emmener au club rock (rdc bât H, à côté du club rock)</div><div>Le ranger correctement derrière les radiateur (ou dans un endroit qui fera pas chier les gens qui dansent !)</div><div>Refermer le club rock et aller rendre les clefs au QG</div><p></p>', NULL, 0, 'Local des 24H', 3, 'non'),
(1014, 210, 546, NULL, 'Tâche sans nom', '<p>&nbsp;</p>', NULL, 0, 'Podium MDE', -1, 'non'),
(1015, 210, 546, NULL, 'Fin de concert', '<p></p><ul><li>Au QG orga, récupère les clefs de l''espace VIP (au milieu du bâtiment Coulomb, RdC)</li><li>Rends toi sur le podium MDE et retrouve le musicien Paul Predki. Si tu croises un accordéoniste sur ta route, c''est lui !!</li><li>Sois souriant et demande-lui comment s''est passé le concert.</li><li>Emmène-le à l''espace VIP pour qu''il récupère ses affaires.</li><li>Lorsqu''il a terminé, remercie-le d''être venu !</li><li>Referme à clefs, et rends les clefs au QG orga.</li></ul><p></p>', NULL, 0, 'QG orga', 3, 'non'),
(1016, 21, 537, NULL, 'Trier le matos de Villeurbanne', '<p></p><ul><li>RDV au dépôt AIP<br></li><li>Retrouve Cetelem<br></li><li>Trouver la benne de matos de Villeurbanne et regarder ce qu''il y a dedans<br></li><li>@Cetelem : vérifie sur ta liste qu''il ne manque pas trop de trucs<br></li><li>Sortir les grilles d''exposition et les ranger dans l''AIP<br></li><li>Noter tout le matos avec un morceau de scotch marron et un marqueur (sortis tout droit du sac de Cetelem)<br></li></ul><p></p>', NULL, 0, 'Local des 24H', 3, 'non'),
(1017, 210, 548, NULL, 'Récupérer les micros', '<p></p><ul><li>Va chercher la table de mixage et des micros chez les zikets&nbsp;</li></ul>1 musicien: micro oud + micro sur pied<div>2 comédiens: micros devant la scène&nbsp;<br><ul><li>Emmène tout ça au QG orga AVANT 13H30</li><li>Tu es libre :)</li></ul><p></p></div>', NULL, 0, 'QG orga', 3, 'non'),
(1018, 210, 548, NULL, 'Le gardien des clefs', '<p></p><ul><li>Retrouve Morgane (Jeanne) vers le podium MDE, elle sera avec les artistes.</li><li>Morgane aura les clefs de l''espace VIP (milieu du bâtiment Coulomb, RdC). Récupère-les, tu en es responsable jusqu''à 17h.</li><li>Présente toi aux artistes: tu seras avec eux jusqu''au concert. Si les artistes veulent retourner à l''espace VIP, va avec eux et ouvre leur la porte.</li><li>Propose leur à boire. Et en fonction de ce qu''ils veulent, va le chercher au QG orga.</li><li>S''ils ont besoin de qqch, résous le problème, ou appelle Morgane</li><li>Lorsqu''ils s''en vont pour aller sur scène, referme l''espace VIP à clefs. (Les balances sont à 16h30. Le spectacle est à 17h)</li><li>Retrouve Morgane vers le podium et demande ce que tu peux faire.&nbsp;</li><li>Lorsque les artistes montent sur scène, retourne rendre les clefs au QG orga.</li><li>Tu es libre :)</li></ul>En cas d''embrouille, appelle Morgane (Jeanne) au 06 70 11 59 48&nbsp;<br><p></p>', NULL, 0, 'Podium MDE', 3, 'non'),
(1019, 210, 548, NULL, 'Fin de spectacle', '<p></p><ul><li>Au QG orga, récupère les clefs de l''espace VIP</li><li>Rend-toi sur le podium MDE et retrouve les artistes d''Arts Dreams</li><li>Emmène-les à l''espace VIP pour qu''ils se changent et récupérent leur affaires</li><li>Quand ils ont fini, vérifie qu''ils n''ont rien oublié, puis referme la porte à clefs</li><li>Aide les à porter leur matériel jusqu''à leur voiture (si besoin)</li><li>Remercie-les d''être venus !&nbsp;</li><li>Tu es libre :)</li></ul><p></p>', NULL, 0, 'QG orga', 3, 'non'),
(1020, 210, 548, NULL, 'Installer le spectacle', '<p></p><ul><li>Récupère le kit "spectacle Djoha" au dépôt des humas (tissus noir + grilles + plots en béton)</li><li>Amène tout sur le podium MDE. Présente toi aux hard qui sont là.</li><li>Installe les grilles au fond de la scène et accroche le tissus dessus.</li><li>Tu es libre :)</li></ul><p></p>', NULL, 0, 'Dépôt des Humas', 3, 'non'),
(1021, 210, 548, NULL, 'Déinstaller le spectacle', '<p></p><ul><li>Rends toi sur le podium MDE. Le spectacle devrait être terminé.</li><li>Récupère le kit "Djoha" (herras, tissus noir, table, 2 chaises) et ramène tout au Dépot Humas</li></ul><div>NE PAS LAISSER LE MATERIEL SANS SURVEILLANCE (surtout la sono !)</div><ul><li>Si besoins, aide aussi les artistes à emmener leur matos jusqu''à leur voiture.</li><li>Vérifie sur le podium que rien n''a été oublié</li><li>Tu es libre :)</li></ul><p></p>', NULL, 0, 'Podium MDE', 3, 'non'),
(1022, 40, 352, NULL, 'Mettre en charge les TPE', '<p>Va au local récupérer les clés de la cave.</p><div><br></div><div>Va à la cave en voiture.</div><div><br></div><div>Récupère les 2 cartons de 20 TPE qui s''y trouve.</div><div><br></div><div>Retourne au local poser les clés de la cave et laisser charger les 20 TPE.</div><p></p>', NULL, 1, 'Steeeeeeeeeeeeeerf', 3, 'non'),
(1023, 21, 501, NULL, 'Aller chercher Josh et emmener les canapés et tables basses sur la scène', '<p>Retrouve Cetelem au local des 24 Heures (RdC bât C)</p><div>Aller à l''Astrée pour récupérer Josh</div><div>Gérer avec Gaetan 06 50 68 29 02&nbsp;pour le prêt de Josh - noter les km au compteur quand tu le prend</div><div>Aller au local et récupérer 3 canapés</div><div>Aller à la DirPat et récupérer les clefs de la cave PC</div><div>Charger 9 chaises, 2 tables 2 places (pas du fond), 1 canap, 1 fauteuil et 3 tables basses (pas trop dégueux c''est pour les artistes !)</div><div>S''il te reste de la place met-y 1 ou 2 fauteuils pour le QG (bonus !)</div><div>Refermer la cave, rendre les clefs et foncer voir Hermione sur la ZC</div><div>Lui déposer tout le matos dans son chalet backline</div><div>Aller garer Josh près du local et donner les clefs aux humains</div><div>Wouhou ! Tu as fait le premier tour de la manif dans Josh, le camion le plus charismatique des 24 !</div><p></p>', NULL, 0, 'Grande scène', 3, 'non'),
(1024, 14, 343, NULL, 'Ramener le foutre elec', '<p>Aller au local et prendre une caisse.</p><div>Ramener tout le foutre elec qui ne sera pas utilisé par les anims dans la cabane de l''ambiance.</div><div>La liste est dans ton sac</div><p></p>', NULL, 0, 'Bocal', 3, 'non'),
(1025, 32, 551, NULL, 'Imprimer les billets', '<p>Aller imprimer les 1000 places weezevent dans la bonne humeur!!!</p>', NULL, 0, 'local', 3, 'non'),
(1026, 32, 551, NULL, 'Tester matos weezevent', '<p>Tester routeur + douchettes&nbsp;</p>', 'Douchettes + routeur', 0, 'local', 3, 'non'),
(1027, 32, 420, NULL, 'Démontage tentes entrées', '<p>-Retrouve Clara aux entrées<br>-Replie les tentes aux entrées et dépose les au dépôt AIP<br> </p>', NULL, 0, 'Devant l&amp;amp;amp;amp;amp;amp;amp;amp;amp;#039;AIP', -1, 'non'),
(1028, 32, 420, NULL, 'Montage tentes entrées samedi soir', '<P>-Rends-toi aux caisses à l''entrée du festival et retrouve Clara (06 31 41 42 82)<BR>- Va chercher une tente 3*3 et une tente 6*3 au dépôt AIP<BR>-Monte les tentes au niveau des contrôles d''accès<BR></P>', NULL, 0, 'Devant l&amp;amp;amp;amp;amp;amp;amp;amp;amp;amp;#039;AIP', 3, 'non'),
(1029, 14, 347, NULL, 'Néttoyage FIE', '<p>Récupère la clé de la FIE auprès des zumains et le nécessaire de nettoyage</p><div>Sort tout le foutre à nous qui pourrait encore y être</div><div>Nettoie le local pour qu''on puisse le rendre</div><div><br></div><div>Ramene la cle au QG orga avec le matos de nettoyage</div><p></p>', NULL, 0, 'Rotonde', 3, 'non'),
(1030, 21, 501, NULL, 'Aller chercher le matériel des scènes à la cave', 'dqfd', NULL, 0, 'Grande scène', -1, 'non'),
(1031, 214, 531, NULL, 'Com'' FédéKto', '<p>Viens au local (de l''ambiance) &nbsp;récupérer ton co-tâche, une grosse pile de flyers (environ 200), une affiche nuit A3, et une dose de charisme.</p><p>Rends toi au campus de l''Université Catholique de Lyon (25, rue du plat, 69002 - métro Bellecour).</p><div>Déposer des flyers à FédéKto (permanence de 12h30 à 14h), et demander à mettre une affiche.&nbsp;</div><div><br></div><div>Reviens au local avec le sentiment d''avoir participé au non-déficit des 24h.&nbsp;</div><div>I believe I can flye !&nbsp;<span style="background-color: rgb(249, 249, 249); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 21px;">♫</span></div>', '-affiche nuit A3\r\n-flyers', 0, 'Local des 24h', -1, 'non'),
(1032, 214, 531, NULL, 'com'' ENSSIB', '<p>Viens au local (de l''ambiance) &nbsp;récupérer ton co-tâche, une grosse pile de flyers (environ 200), une affiche nuit A3, et une dose de charisme.</p><p>Rends toi à l''ENSSIB (c''est juste à côté!)</p><div>Déposes des flyers à l''Association des Etudiants (BDE), et demandes à mettre une affiche. Ils ont aussi un site internet, demander gentiment s''ils peuvent poster un petit article sur les 24.</div><div><br></div><div>Reviens au local avec le sentiment d''avoir participé au non-déficit des 24h.&nbsp;</div><div>I believe I can flye !&nbsp;<span style="background-color: rgb(249, 249, 249); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 21px;">♫</span></div>', '-une affiche nuit A3\r\n-flyers', 0, 'Lyon', -1, 'non'),
(1033, 214, 531, NULL, 'ECAM + Lazaristes (prépa)', '<p>Viens au local (de l''ambiance) &nbsp;récupérer ton co-tâche, une grosse pile de flyers (environ 200), 2 affiches nuit A3, et une dose de charisme.</p><p>Rends toi à l''ECAM (40, montée Saint Barthélémy- métro D Vieux-Lyon)</p><div>Déposer des flyers à l''asso AEIII Caramba (association des élèves ingénieurs), et demander à mettre une affiche.&nbsp;</div><div><br></div><div>Passes aussi à la prépa des Lazaristes pour poser quelques flyers et une affiche.</div><div><br></div><div>Reviens au local avec le sentiment d''avoir participé au non-déficit des 24h.&nbsp;</div><div>I believe I can flye !&nbsp;<span style="background-color: rgb(249, 249, 249); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 21px;">♫</span></div>', '-2 affiches nuit A3\r\n-flyers', 0, 'Local des 24h', -1, 'non'),
(1034, 14, 347, NULL, 'Rendre clés H', '<P>Aller chercher les clés auprès des humains</P>\r\n<DIV>Les rendre au régisseur du H</DIV>\r\n<P></P>', NULL, 0, 'ZC', 3, 'non'),
(1035, 45, 307, NULL, 'Suivi démontage light et son', '<p>Voir avec CS comment ça avance le démontage.</p><div>Gérer un peu les teckos.</div><div>Donner un coup de main.</div><div>Donner son avis sur tout.</div><div>Etre chiant.</div><div>Etre pénible.</div><div>Etre pête-couilles.</div><div>Etre casse-cul.</div>', NULL, 0, 'Grande scène', 3, 'non'),
(1036, 21, 537, NULL, 'Vérif A302', '<p>Aller dans la salle A302</p><div>Noter le nombre de table et de chaises dans ton portable, sur le tableau et sur une feuille le nombre de chaises et de tables qu''il y a dans la salle</div><p></p>', NULL, 0, 'Local des 24H', 3, 'non'),
(1037, 9, 553, NULL, 'Accueillir les accrédités', '<p> Salut à toi mon confiance !</p><p><br></p><p>Rend-toi au sortie de la Zone Concert. Une fois là-bas, place à toi à proximité des AS.</p><p>Si tu es affecté à 20h, je t''apporterais un listing de nom auquel il faudra faire très attention.</p><p>Si tu es affecté à 22h, téléphone moi au 07.86.39.70.45 pour me prévenir de ton arrive et récupère le listing auprès de la personne que tu viens relayer.</p><p>Au cours de ton créneau, tu recevras plusieurs personnes qui voudront passer dans la Zone. Demande-leur leur carte d''identité, vérifie qu''il a bien la meme gueule, le meme sexe, etc...</p><p>Ensuite, si tout cela correspond, laisse-le passer. Sinon, dis-lui qu''il n''apparaît pas dans le listing et qu''il peut rejoinder la queue des gueux. S''il insiste vraiment, appellee-moi de suite et j''aviserais (07.86.39.70.45). Au pire des cas: celui&nbsp;où je ne répondrais pas, trouve un orga avec un talkie et demande à me joindre.</p><p><br></p><p>Si tu étais affecté de 20 à 22 heures, attend ta relève avant de partir et donne-lui la liste.</p><p><br></p><p>Si tu étais affecté de 22 heures à minuit, appellee-moi pour que je vienne ré</p><p><br></p><p><br></p>', 'Froufrou - Krêpe - Swagg', 0, 'Sortie de la Zone Concert', 3, 'non'),
(1038, 21, 502, NULL, 'Rendre le frigo de l''As de Pique et de l''ABIL', '<P>Aller au local des 24 Heures</P>\r\n<DIV>Récupérer les clefs du club rock et un diable</DIV>\r\n<DIV>Appeler Alex (GI) 0641675155 et lui dire que tu vas bientôt arriver avec son frigo</DIV>\r\n<DIV>Appeler Etienne (ABIL) 06 33 51 35 13 et lui dire la même chose</DIV>\r\n<DIV>Aller au club rock et récupérer les frigos de l''as de pique et de l''ABIL</DIV>\r\n<DIV>Les emmener devant GI et retrouver Alex</DIV>\r\n<DIV>Lui rendre son frigo, lui dire merci et lui faire des gros bibis</DIV>\r\n<DIV>Aller devant biosciences et faire la même chose</DIV>\r\n<DIV>Rentrer au local, ranger les diables et rendre les clefs</DIV>\r\n<P></P>', NULL, 0, 'Local des 24H', 3, 'non'),
(1039, 210, 548, NULL, 'Récupérer Matos CGR', '<p>Aller chercher à la CGR et trouver Bastien&nbsp;<br><span style="BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: arial, sans-serif; COLOR: rgb(80,0,80); FONT-SIZE: 13px"><br>2 retours avec ampli et câblage</span></p>\r\n<div>\r\n<div style="BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: arial, sans-serif; COLOR: rgb(80,0,80); FONT-SIZE: 13px" class="im">et des câbles XLR 6 de 5m et 4 de 10m</div>\r\n<div style="BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: arial, sans-serif; COLOR: rgb(80,0,80); FONT-SIZE: 13px" class="im"><br></div>\r\n<div class="im">Donner un chèque de caution</div></div>\r\n<div class="im">Emmener tout ca au QG orga</div>\r\n<p></p>', NULL, 0, 'Podium MDE', 3, 'non'),
(1040, 210, 548, NULL, 'Rendre Matos CGR', '<p></p><ul><li>Aller au podium MdE, prendre le matos de la CGR (2 retours avec ampli et câblage + câbles XLR 6 de 5m et XLR 4 de 10m)<br></li><li>Trouver Bastien de la CGR au 14h d''impro (TTI) et lui ramener le matos<br></li><li>Récupérer le chèque de caution (RENDEZ L''ARGENT !)<br></li><li>Tu es libre :)<br></li></ul><p></p><div><div style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);"><div class="im" style="color: rgb(80, 0, 80);"><br></div><div class="im" style="color: rgb(80, 0, 80);"><br></div></div></div><p></p>', NULL, 0, 'Podium MDE', 3, 'non'),
(1041, 22, 399, NULL, 'Pose signa sécu entrée', '<p>C''est en cette douce et chaude matinée de Mai (si Dieu le veut), que l''on pose la signa sécu à l''entrée de la ZC. Bien du courage il te faudra pour accomplir cette quête. Voila un bref résumer des opérations:</p><p></p><ul><li>Aller au QG pour y retrouver tes preux compagnons.&nbsp;</li><li>Demande les clés du 11m3 et de la cave au maître des clés.&nbsp;</li><li>Munis toi de matériel de bricolage (pince, agrafeuse mural, scotch, colson... Dieu seul sait quelles péripéties se dresseront sur ton chemin)</li><li>Enfourche le 11m3 et chevaucher jusqu''à la cave.</li><li>Descend dans les méandre du bâtiment E afin d''en faire sortir la sainte signa sécu.</li><li>Repasse au QG déposer les clés de la cave. Dis au revoir aux autochtones, dis leur que lorsque tu reviendras, tu ne seras peut-être plus le même.</li><li>Envole toi ensuite à l''entrée de la ZC. &nbsp;</li><li>Ta mission consiste à mettre en place la sainte signa qui guidera la horde d''âmes&nbsp;<strike>esseulées</strike>&nbsp;alcoolisées à travers les différentes files d''attente pour les mener en Terre Promise. De nombreux problèmes parsèmeront la lourde tâche que tu dois accomplir, et tu devras rivaliser de force et d''ingéniosité pour en venir à bout.&nbsp;<br></li><li>Quand toute la signa se dressera devant toi, tu pourras relever la tête et regarder derrière toi tout le chemin que tu as pu accomplir. A cet instant seulement, tu pourras remonter sur <strike>ton fidèle destrier</strike>&nbsp;le 11m3, et rentrer au QG.</li><li>Rend les clés du 11m3 <strike>à Passe-Partout</strike> au maître des clés.</li><li>Pas le temps de t’apitoyer sur ton sort: dirige toi prestement vers ta tâche suivante</li></ul><div><u>Remarque Pignole :</u>&nbsp;Bon, faut pas non plus déconner. Tant que tu es au QG Orga, prend un peu à grailler. Une dure journée t''attends. Avec un peu de chance, les maman t''auront préparé un bon repas.</div><div><br></div><div><span style="color: rgb(37, 37, 37); font-family: sans-serif; font-size: 14px; line-height: 22.399999618530273px; background-color: rgb(255, 255, 255);"><i>"Ecoutez ma mie, il vaut mieux bouffer ça une fois par mois que de la merde tous les jours, je vais vous dire, à ce niveau là, c''est plus de la gastronomie, c''est de l''érotisme."</i></span><br></div><p></p>', NULL, 0, 'Tout partout', 2, 'non'),
(1042, 22, 399, NULL, 'Amener la signa course aux pédales', '<p></p><ul><li>Se rendre au QG orga</li><li>Demander les clés de la cave et du 11m3</li><li>Rouler jusqu''à la cave</li><li>Récupérer le carton "signa courses"</li><li>Rouler jusqu''au QG pédale pour leur deposer le carton de signa !</li><li>Retourner au QG Orga et rendre les clés.</li></ul><p></p>', NULL, 0, 'Tout partout', 3, 'non'),
(1043, 22, 399, NULL, 'Poser la signa des arches', '<p></p><ul><li>Se rendre au local des 24H</li><li>Demander les clés de la cave et celle d''une voiture</li><li>Aller chercher la signa des arches à la cave, la charger dans la voiture, et rouler jusqu''à l''entrée de la ZC</li><li>Installer la signa sur l''arche pendant qu''elle est posée à plat.</li><li>Retourner au local et render les clés.</li></ul><p></p>', NULL, 0, 'Local des 24H', 3, 'non'),
(1044, 197, 355, NULL, 'Accueil Gospel Scène Nord', '<p></p><ul><li>Rends toi vers la Rotonde et retrouve Gospel Colors (Andomalala Ratovelomanana 06 24 99 79 29)</li><li>Emmène-les sur la petite scène et confie-les à Jérémie pour les test sons (<span style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">06 45 52 58 66)</span></li><li><span style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">Lâche-leur ton 06, au cas où, et tire toi ! :)</span></li></ul><p></p>', NULL, 0, 'Salle René Char - Rotonde', 3, 'non'),
(1045, 21, 415, NULL, 'Al', 'bitepoilcul', NULL, 0, 'Local des 24H', -1, 'non'),
(1046, 21, 502, NULL, 'Aller chercher le frigo de l''AGORAE', '<p>Coucou,</p><div>Retrouve ton ami, 1 diable et les clefs du club rock au QG</div><div>Trouver&nbsp;Nils&nbsp;06 76 57 83 85 dans le local de Gaelis (Astrée) ou à l''agoraé</div><div>Récupérer 1 des 2 frigos, dire merci</div><div>L''emmener au club rock, bien refermer la salle du club rock</div><div>Rendre tout le matos au QG</div><div><br></div><p></p>', NULL, 0, 'Local des 24H', 3, 'non'),
(1047, 21, 415, NULL, 'Aller chercher le matos de Turbu', '<p>Retrouve Cetelem au local des 24 Heures (rdc bât D)</p><div>Trouver les clefs d''une voiture//caddie si tu as la foi et aller se poser le plus près possible de turbu (déambulatoire)</div><div>Trouver Vincent (06.84.64.25.47) et récupérer ses crépières, ses bâches et sa rallonge (de moulti mètres)</div><div>Ramener le matos au local et le "ranger" =)</div><p></p>', NULL, 0, 'Local des 24H', 3, 'non'),
(1048, 21, 415, NULL, 'Ramener le matos de Turbu', '<p>Retrouve Cetelem au local des 24 Heures (rdc bât D)</p><div>Trouver les clefs d''une voiture//caddie si tu as la foi et récupérer le matos de Turbu</div><div>Aller se poser le plus près possible de turbu (déambulatoire)</div><div>Trouver Vincent (06.84.64.25.47) et lui rendre ses crépières, ses bâches et sa rallonge (de moulti mètres)</div><div>Rentrer au local</div>', NULL, 0, 'Local des 24H', 3, 'non'),
(1049, 21, 415, NULL, 'Aller chercher le matos de l''AMEUSO', '<p>Retrouver Cetelem au local des 24</p><div>Trouver Josh et aller à l''AMEUSO</div><div><dd>AMEUSO<br>165 chemin du Petit Revoyet<br>69600 Oullins</dd><dt>Téléphone :</dt><dd>04.26.23.59.15</dd></div><div><dd><br></dd><dd>Récupérer 10 portants et une bonne dose de couscous</dd><dd>Rentrer sur le campus, déposer le matos au local et rendre les clefs aux humains.</dd><dd>Trouve Fatmoumoute, elle va t''aimer</dd></div><p></p>', NULL, 0, 'Local des 24H', 3, 'non'),
(1050, 12, 466, NULL, 'Aller chercher les talkies', '<p>Bref, on y va.</p>', NULL, 0, 'QG', 3, 'non'),
(1051, 21, 415, NULL, 'Conducteur 20m3 - Ramener le matos de l''AMEUSO', '<p>Retrouver Cetelem au local des 24</p><div>Trouver un 20m3, le matos de l''AMEUSO et y aller</div><div><br></div><div><dd>AMEUSO<br>165 chemin du Petit Revoyet<br>69600 Oullins</dd><dt>Téléphone :</dt><dd>04.26.23.59.15</dd><dd><br></dd><dd>Leur rendre le matos et leur faire des gros bibis !</dd></div>', NULL, 0, 'Local des 24H', 3, 'non');
INSERT INTO `Tache` (`id`, `responsable_id`, `groupetache_id`, `importid`, `nom`, `consignes`, `materielSupplementaire`, `permisNecessaire`, `lieu`, `statut`, `commentaireLog`) VALUES
(1052, 14, 347, NULL, 'Clés Creux GCU', '<P>Retrouver&nbsp;<SPAN style="BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: arial, sans-serif; COLOR: rgb(34,34,34); FONT-SIZE: 13px">Romain Trunfio</SPAN><BR style="BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: arial, sans-serif; COLOR: rgb(34,34,34); FONT-SIZE: 13px"><SPAN style="BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: arial, sans-serif; COLOR: rgb(34,34,34); FONT-SIZE: 13px">dans le Hall d''essais structures de GCU (l''atelier)</SPAN></P>\r\n<DIV><SPAN style="BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: arial, sans-serif; COLOR: rgb(34,34,34); FONT-SIZE: 13px">Tél:&nbsp;</SPAN><A style="BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: arial, sans-serif; COLOR: rgb(17,85,204); FONT-SIZE: 13px" href="tel:04%2072%2043%2079%2046" value="+33472437946">04 72 43 79 46</A><SPAN style="BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: arial, sans-serif; COLOR: rgb(34,34,34); FONT-SIZE: 13px"><BR></SPAN></DIV>\r\n<DIV><BR></DIV>\r\n<DIV>Lui demander les clés de la porte qui permet de rejoindre l''exterieur du creux GCU à l''interieur.</DIV>\r\n<DIV>Précise lui que tu lui rendra le mercredi 28 vers la même heure.</DIV>\r\n<DIV>Dis lui merci et <B>amène les clés aux huamains</B>.</DIV>\r\n<DIV><BR></DIV>\r\n<P></P>', NULL, 0, 'GCU', 3, 'non'),
(1053, 14, 347, NULL, 'Retour clés GCU', '<P>Va chercher la clés du creux GCU (qui permet de rejoindre l''exterieur du creux GCU à l''interieur) aux humains</P>\r\n<P>Retrouver&nbsp;<SPAN style="BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: arial, sans-serif; COLOR: rgb(34,34,34); FONT-SIZE: 13px">Romain Trunfio </SPAN><SPAN style="BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: arial, sans-serif; COLOR: rgb(34,34,34); FONT-SIZE: 13px">dans le Hall d''essais structures de GCU (l''atelier)</SPAN></P>\r\n<DIV><SPAN style="BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: arial, sans-serif; COLOR: rgb(34,34,34); FONT-SIZE: 13px">Tél:&nbsp;</SPAN><A style="BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: arial, sans-serif; COLOR: rgb(17,85,204); FONT-SIZE: 13px" href="tel:04%2072%2043%2079%2046" value="+33472437946">04 72 43 79 46</A><SPAN style="BACKGROUND-COLOR: rgb(255,255,255); FONT-FAMILY: arial, sans-serif; COLOR: rgb(34,34,34); FONT-SIZE: 13px"><BR></SPAN></DIV>\r\n<DIV>Lui donner les clés.<BR></DIV>\r\n<DIV>Dis lui merci !.</DIV>\r\n<DIV><BR></DIV>', NULL, 0, 'Local des 24H', 3, 'non'),
(1054, 31, 394, NULL, 'GMQ barrière', '<p>Coucou la pédale</p>\r\n<p>On va finir de barriérer le circuit !</p>\r\n<p>Alors prend ta bite et ton couteau, ta bonne humeur de pédale et soit prêt pour un barriérage de folie !</p><p>Pour Ron Dimanche : Gestion de la merde quotidienne des barrières entre le ciné, le feu et le circuit. (Papa Quentin) =)<br></p>', NULL, 0, 'Campus', 3, 'non'),
(1055, 227, 416, NULL, 'Chercher Fleurs', '<P>Aller chercher une voiture, se rendre chez Camille Fleurs ( voir adresse sur google map )</P>\r\n<DIV>Rentre dans le magasin, dire bonjour, récupérer les fleurs.</DIV>\r\n<DIV>Revenir au 24, mettre les fleurs au frais au village coureur</DIV>\r\n<P></P>', NULL, 2, 'Village Coureurs', 3, 'non'),
(1056, 21, 502, NULL, 'Rendre le frigo de l''AGORAE', '<p>RDV au local des 24 (rdc bât D)</p><div>Trouve l''Anguille, un diable et les clefs du club rock</div><div>Aller au club rock, récupérer le frigo de Gaelis, aller à l''Astrée pour y trouver Nils (06 76 57 83 85)</div><div>Leur rendre le frigo et leur faire des gros bibis !</div><div>Rentrer au local et dormir dans un canap =)</div><p></p>', NULL, 0, 'Local des 24H', 3, 'non'),
(1057, 16, 384, NULL, 'PS 7 Gaston Berger', '<ol><li>Rends toi au PS7 Gaston Berger (Sur la rue qui passe entre la BU Lyon 1et IF)&nbsp;</li><li>Récupère le gilet jaune et le talkie de l''équipe précédente</li><li>Demande l''Humain au talkie et préviens que tu es bien en poste</li></ol><div>Ta mission : Assurer la sécurité du festival et des courses en ne laissant entrer aucun véhicule excepté :<br></div><p></p><ul><li>Les véhicules des secours (Pompiers, Police, etc..)<br></li><li>Les véhicules des officiels (voitures avec chauffeurs et/ou escortés)&nbsp;</li><li>Ne laisse pas passer les véhicules qui cherchent une place pour se garer, redirige les vers le grand parking en gravier à coté du Beurk.&nbsp;</li></ul><div>Un exemple de pass sécu et l''autorisation de fermeture du campus sont disponibles sur place.<br><br></div><div>En cas de problème / de doute demande le responsable sécurité au Talkie.&nbsp;N''hésite pas à prévenir de tout comportement anormaux. Si le talkie bip demande qu''on t''amène une batterie.<br>Si le talkie ne passe pas téléphone au 06.59.90.44.19 ou au 06.76.99.09.64<br>En cas d''urgence appelle directement le PC sécu : 04.72.43.70.70</div><div>Reste bien à l''écoute de ce qui est dit au talkie cela te concerne peut être.</div><div><br></div><div><b><u>IMPORTANT :</u></b></div><div><ul><li><b><u>NE TE MET PAS EN DANGER (si le mec est un peu aigri laisse le&nbsp;tâter&nbsp;de la vauban et écarte toi)</u></b><br></li><li><b><u>NE QUITTE PAS TON POSTE TANT QUE LES SUIVANTS NE SONT PAS ARRIVES</u></b></li></ul></div>', NULL, 0, 'Gaston Berger', 3, 'non'),
(1058, 16, 384, NULL, 'PS 8 Parking Beurk', '<ol><li>Rends toi au PS8 Parking Beurk (Sur l''avenue Capelle, au niveau de l''entrée du parking, en face de GI)&nbsp;</li><li>Récupère le gilet jaune et le talkie de l''équipe précédente</li><li>Demande l''Humain&nbsp;et préviens que tu es bien en poste</li></ol><div>Ta mission : Assurer la sécurité du festival et des courses en ne laissant entrer aucun véhicule excepté :<br></div><p></p><ul><li>Les véhicules des secours (Pompiers, Police, etc..)<br></li><li>Les véhicules des officiels (voitures avec chauffeurs et/ou escortés)&nbsp;</li><li>Ne laisse pas passer les véhicules qui cherchent une place pour se garer, redirige les vers le grand parking en gravier à coté du Beurk.&nbsp;</li></ul><div>Un exemple de pass sécu et l''autorisation de fermeture du campus sont disponibles sur place.<br><br></div><div>En cas de problème / de doute demande le responsable sécurité au Talkie.&nbsp;N''hésite pas à prévenir de tout comportement anormaux. Si le talkie bip demande qu''on t''amène une batterie.<br>Si le talkie ne passe pas téléphone au 06.59.90.44.19 ou au 06.76.99.09.64<br>En cas d''urgence appelle directement le PC sécu : 04.72.43.70.70</div><div>Reste bien à l''écoute de ce qui est dit au talkie cela te concerne peut être.</div><div><br></div><div><b><u>IMPORTANT :</u></b></div><div><ul><li><b><u>NE TE MET PAS EN DANGER (si le mec est un peu aigri laisse le&nbsp;tâter&nbsp;de la vauban et écarte toi)</u></b><br></li><li><b><u>NE QUITTE PAS TON POSTE TANT QUE LES SUIVANTS NE SONT PAS ARRIVES</u></b></li></ul></div>', NULL, 0, 'Parking gravier à coté du beurk', 3, 'non'),
(1059, 3, 311, NULL, 'Nettoyer et rendre une chambre du Troll', '<p></p><ul><li>Récupérer les clés de la chambre concernée</li><li>Défaire le lit et laisser les draps pliés sur place</li><li>Descendre les poubelles</li><li>Faire le ménage : <b>cette chambre est restituée dans la foulée, elle doit être impeccable</b></li><li>Rendre les clés au régisseur</li><li>Faire un état des lieux avec lui s''il est chaud</li></ul><p></p>', 'La clé de la chambre', 0, 'Résidences INSA', 3, 'non'),
(1060, 3, 311, NULL, 'Récupérer les clés des chambres', '<p></p><ul><li>Se munir des autorisations de remise de clés fournies par la DDR</li><li>Se rendre au bâtiment C pour récupérer les clés auprès du régisseur (Jeudi 22 mai 2014)<br></li><li>Demander au régisseur s''il est possible de récupérer également les clés pour le lendemain (Vendredi 23 mai 2014)</li><li>Se rendre aux autres bâtiments où l''on a des chambres (ou les appeler) et demander aux régisseurs s''il est possible de récupérer les clés pour le lendemain</li><li>Si ce n''est pas possible, réitérer le lendemain (Vendredi 23 mai 2014)</li><li>Accrocher les clés obtenues sur le tableau à clés où il n''y aura que les clés des chambres (local ou QG orga)</li></ul><b>Ces clés doivent impérativement être sur le tableau à clés pour que l''installation des chambres puisse être faite !</b><br><p></p>', 'Les autorisations de remise de clés', 0, 'Résidences INSA', 3, 'non'),
(1061, 31, 394, NULL, 'Gros tas de vauban', '<p>choppe un 20 m3</p><div>fait des tas de vauban par 10</div><p></p>', NULL, 0, 'Campus', 0, 'non'),
(1062, 3, 309, NULL, 'Tâche sans nom', 'kjhgfds', NULL, 0, 'Petite scène', -1, 'non'),
(1063, 3, 311, NULL, 'Nettoyer et rendre la chambre du Troll', '<p></p><ul><li>Récupérer les clés de la chambre concernée</li><li>Défaire le lit et laisser les draps pliés sur place</li><li>Descendre les poubelles</li><li>Faire le ménage : <b>cette chambre est restituée dans la foulée, elle doit être impeccable</b></li><li>Rendre les clés au régisseur</li><li>Faire un état des lieux avec lui s''il est chaud</li></ul><p></p>', 'La clé de la chambre', 0, 'Résidences INSA', 3, 'non'),
(1064, 3, 311, NULL, 'Nettoyer les chambres INSA', '<p><i>Le but de cette tâche est de ranger et nettoyer toutes les chambres en résidences INSA qui devront être restituées le lundi 26 mai. Ces chambres doivent être impeccables si on ne veut pas que la Direction des Résidences nous rentre la merde !</i><br></p><ul><li>Aller au QG Orga (Agora)</li><li>Demander la fiche de répartition des chambres aux Orgas Humains (Hugo : 06 01 33 50 87 / Dina : 06 21 39 17 69)</li><li>Demander les clés des chambres à nettoyer aux Orgas Humains</li><li>Prendre 6 balais, 6 seaux, 6 serpillères, 6 pelles/balayettes, 6 éponges, 6 paires de gants et du produit nettoyant</li><li>Faire trois équipes : 1 Confiance et des Softs (et un caddie pour transporter le matériel)</li><li>Se rendre aux résidences où l''on a des chambres</li><li>Défaire les lits et laisser les draps pliés sur les lits</li><li>Descendre les poubelles</li><li>Regrouper les savons</li><li>Plier et regrouper les serviettes</li><li>Regrouper les rouleaux de papier toilette</li><li>Faire le ménage de toutes les chambres (y compris salle de bain et les WC) : <b>les chambres sont restituées le 26 mai, elle doivent être impeccables</b></li><li>S''assurer que toutes les chambres sont bien propres et qu''elles sont prêtes à être restituées</li><li>Couper les disjoncteur et laisser les frigos ouverts</li><li>Prendre les serviettes, savons et rouleaux de papier toilette ; seuls les draps restent dans les chambres</li><li>Fermer les chambres</li><li>Retourner au QG Orga</li><li>Restituer toutes les clés aux Orgas Humains</li><li>Remettre le matériel de nettoyage où il a été pris</li><li>Donner les serviettes, savons et rouleaux de papier toilette aux Orgas Humains pour qu''ils les gardent dans un endroit propre</li><li>Remettre les caddies où ils ont été pris</li></ul>', '6 paires de gants', 0, 'Résidences INSA', 3, 'non'),
(1065, 3, 311, NULL, 'Restitution des clés', '<p></p><ul><li>Se rendre au local et vérifier qu''il ne manque aucune clé sur le tableau à clés</li><li>Récupérer toutes les clés (sauf celle du Troll) et les rapporter aux différents régisseurs<br></li></ul><p></p>', NULL, 0, 'Résidences INSA', 3, 'non'),
(1066, 21, 415, NULL, 'Rendre les tentes du club Elek', '<p>RDV au local des 24</p><p>Retrouve tes co-tâches, les 7 tentes du club elek et un 20m3 ou des voitures si les 20m3 sont pris</p><p>Appeler Léonard - 06 85 21 11 47 - et lui dire que tu arrives au club elek (bâtiment SGM)</p><p>Lui rendre ses 7 tentes 2*3 et lui faire des gros bibis</p>', NULL, 0, 'Local des 24H', 3, 'non'),
(1067, 16, 384, NULL, 'PS 7 Gaston Berger Installation', '<ol><li>Rendez vous au QG Orga.<br></li><li>Retrouve ton co-orga.<br></li><li>Demande à l''Humain de vous donner 1 gilets jaunes et 1 talkie.<br></li><li>Rends toi au PS7 Gaston Berger&nbsp;(Sur la rue qui passe entre la BU Lyon 1et IF)&nbsp;</li><li>Prends les quelques barrière sur place et pose les au mileu de la route</li><li>Demande l''humain et préviens au talkie que tu es bien à poste<br></li></ol><p></p><p>Ta mission :&nbsp;Assurer la sécurité du festival et des courses en ne laissant passer aucun véhicule excepté&nbsp;:</p><p></p><ul><li>Les véhicules des secours (Pompiers, Police, etc..)<br></li><li>Les véhicules des officiels (voitures avec chauffeurs et/ou escortés)&nbsp;</li><li>Ne laisse pas passer les véhicules qui cherchent une place pour se garer, redirige les vers le grand parking en gravier à coté du Beurk.&nbsp;</li></ul><div>Un exemple de pass sécu et l''autorisation de fermeture du campus sont disponible sur place.<br></div><div><br></div><div><div>En cas de problème / de doute demande le responsable sécurité au Talkie.&nbsp;N''hésite pas à prévenir de tout comportement anormaux. Si le talkie bip demande qu''on t''amène une batterie.<br>Si le talkie ne passe pas téléphone au 06.59.90.44.19 ou au 06.76.99.09.64<br>En cas d''urgence appel directement le PC sécu : 04.72.43.70.70</div><div>Reste bien à l''écoute de ce qui est dit au talkie cela te concerne peut être.</div></div><div><br></div><div><b><u>IMPORTANT :</u></b></div><div><ul><li><b><u>NE TE MET PAS EN DANGER (si le mec est un peu aigri laisse le&nbsp;tâter&nbsp;de la vauban et écarte toi)</u></b><br></li><li><b><u>NE QUITTE PAS TON POSTE TANT QUE LES SUIVANTS NE SONT PAS ARRIVES</u></b></li></ul></div>', NULL, 0, 'QG orga', 3, 'non'),
(1068, 16, 384, NULL, 'PS 7 Gaston Berger rangement', '<ol><li>Rends toi au PS7 Gaston Berger (Sur la rue qui passe entre la BU Lyon 1et IF)&nbsp;</li><li>Récupère le gilet jaune et le talkie de l''équipe précédente</li><li>Demande l''humain au talkie et préviens que tu est bien en poste.</li></ol><div>Ta mission : Assurer la sécurité du festival et des courses en ne laissant passer aucun véhicule excepté :<br></div><p></p><ul><li>Les véhicules des secours (Pompiers, Police, etc..)<br></li><li>Les véhicules des officiels (voitures avec chauffeurs et/ou escortés)&nbsp;</li><li>Ne laisse pas passer les véhicules qui cherchent une place pour se garer, redirige les vers le grand parking en gravier à coté du Beurk.&nbsp;</li></ul><div>Un exemple de pass sécu et l''autorisation de fermeture du campus sont disponible sur place.<br></div><div><br></div>En cas de problème / de doute demande le responsable sécurité au Talkie.&nbsp;N''hésite pas à prévenir de tout comportement anormaux. Si le talkie bip demande qu''on t''amène une batterie.<br>Si le talkie ne passe pas téléphone au 06.59.90.44.19 ou au 06.76.99.09.64<div>En cas d''urgence appel directement le PC sécu : 04.72.43.70.70</div><div>Reste bien à l''écoute de ce qui est dit au talkie cela te concerne peut être.</div><div><br></div><div>A la fin de ta tache Vendredi à miniut:</div><div><ol><li>Préviens au talkie que tu va partir</li><li>Ouvre le passage en poussant les barrières sur la coté de la route.&nbsp;<br></li><li>Rentre au QG.<br></li><li>Dépose ton talkie et les gilets<br></li></ol></div><div><br></div><div><b><u>IMPORTANT :</u></b></div><div><ul><li><b><u>NE TE MET PAS EN DANGER (si le mec est un peu aigri laisse le&nbsp;tâter&nbsp;de la vauban et écarte toi)</u></b></li></ul></div>', NULL, 0, 'Gaston Berger', 3, 'non'),
(1069, 16, 384, NULL, 'PS 8 Parking beurk Installation', '<ol><li>Rendez vous au QG Orga.<br></li><li>Retrouve ton co-orga.<br></li><li>Demande à l''Humain de vous donner 1 gilet jaune et 1 talkie.<br></li><li>Rends toi au PS8 Parking beurk&nbsp;(Sur l''avenue Capelle, au niveau de l''entrée du parking, en face de GI)&nbsp;</li><li>Prends les quelques barrière sur place et pose les au mileu de la route</li><li>Demande l''humain et préviens au talkie que tu es bien à poste<br></li></ol><p></p><p>Ta mission :&nbsp;Assurer la sécurité du festival et des courses en ne laissant passer aucun véhicule excepté&nbsp;:</p><p></p><ul><li>Les véhicules des secours (Pompiers, Police, etc..)<br></li><li>Les véhicules des officiels (voitures avec chauffeurs et/ou escortés)&nbsp;</li><li>Ne laisse pas passer les véhicules qui cherchent une place pour se garer, redirige les vers le grand parking en gravier à coté du Beurk.&nbsp;</li></ul><div>Un exemple de pass sécu et l''autorisation de fermeture du campus sont disponible sur place.<br></div><div><br></div><div><div>En cas de problème / de doute demande le responsable sécurité au Talkie.&nbsp;N''hésite pas à prévenir de tout comportement anormaux. Si le talkie bip demande qu''on t''amène une batterie.<br>Si le talkie ne passe pas téléphone au 06.59.90.44.19 ou au 06.76.99.09.64<br>En cas d''urgence appel directement le PC sécu : 04.72.43.70.70</div><div>Reste bien à l''écoute de ce qui est dit au talkie cela te concerne peut être.</div></div><div><br></div><div><b><u>IMPORTANT :</u></b></div><div><ul><li><b><u>NE TE MET PAS EN DANGER (si le mec est un peu aigri laisse le&nbsp;tâter&nbsp;de la vauban et écarte toi)</u></b><br></li><li><b><u>NE QUITTE PAS TON POSTE TANT QUE LES SUIVANTS NE SONT PAS ARRIVES</u></b></li></ul></div>', NULL, 0, 'QG orga', 3, 'non'),
(1070, 16, 384, NULL, 'PS 8 Parking Beurk rangement', '<ol><li>Rends toi au PS8 parking beurk&nbsp;(Sur l''avenue Capelle, au niveau de l''entrée du parking, en face de GI)&nbsp;</li><li>Récupère le gilet jaune et le talkie de l''équipe précédente</li><li>Demande l''humain au talkie et préviens que tu est bien en poste.</li></ol><div>Ta mission : Assurer la sécurité du festival et des courses en ne laissant passer aucun véhicule excepté :<br></div><p></p><ul><li>Les véhicules des secours (Pompiers, Police, etc..)<br></li><li>Les véhicules des officiels (voitures avec chauffeurs et/ou escortés)&nbsp;</li><li>Ne laisse pas passer les véhicules qui cherchent une place pour se garer, redirige les vers le grand parking en gravier à coté du Beurk.&nbsp;</li></ul><div>Un exemple de pass sécu et l''autorisation de fermeture du campus sont disponible sur place.<br></div><div><br></div>En cas de problème / de doute demande le responsable sécurité au Talkie.&nbsp;N''hésite pas à prévenir de tout comportement anormaux. Si le talkie bip demande qu''on t''amène une batterie.<br>Si le talkie ne passe pas téléphone au 06.59.90.44.19 ou au 06.76.99.09.64<div>En cas d''urgence appel directement le PC sécu : 04.72.43.70.70</div><div>Reste bien à l''écoute de ce qui est dit au talkie cela te concerne peut être.</div><div><br></div><div>A la fin de ta tache Vendredi à miniut:</div><div><ol><li>Préviens au talkie que tu va partir</li><li>Ouvre le passage en poussant les barrières sur la coté de la route.&nbsp;<br></li><li>Rentre au QG.<br></li><li>Dépose ton talkie et les gilets<br></li></ol></div><div><br></div><div><b><u>IMPORTANT :</u></b></div><div><ul><li><b><u>NE TE MET PAS EN DANGER (si le mec est un peu aigri laisse le&nbsp;tâter&nbsp;de la vauban et écarte toi)</u></b></li></ul></div>', NULL, 0, 'Parking gravier à coté du beurk', 3, 'non'),
(1071, 210, 548, NULL, 'Accueil salon urbain', '<p></p><ul><li><br></li></ul><p></p>', NULL, 0, 'Parvis des Humas', -1, 'non'),
(1072, 210, 435, NULL, 'Accueil salon urbain', '<p></p><ul><li>En passant, vérifie que les softs ne sont pas trop en train de faire n''importe quoi sur l''emplacement du salon urbain (et qu''ils sont au bon endroit !)</li><li>A 13h, retrouve La Locomotive (Camille 0683214254). Ils devraient être sur la voie pompier sur la pelouse.<br></li><li>Indique-leur où est leur emplacement et dis-leur que des softs vont les aider.&nbsp;</li><li>Rappelle-leur qu''ils ne peuvent pas rester garé là, et qu''ils devront trouver une place vers la BU.</li><li>Souhaite leur une bonne après midi et file, tu es déjà en retard ! :)</li></ul><p></p>', NULL, 0, 'Parvis des Humas', 3, 'non'),
(1073, 210, 548, NULL, 'Installer le matos son', '<p></p><ul><li>Retrouve ton co-tâche au QG orga (+ les gens de K-le-son)</li><li>Emmène la sono pour le spectacle Djoha (4 enceintes, des câbles, 2 pieds +micros des zikets) sur le podium MDE</li><li>Branche ce que tu peux, et file. On verra ça plus tard, à 16h30</li></ul><div>[le matériel son ne doit pas rester sans surveillance. Assure toi qu''il y ait toujours un hard dans les parages]&nbsp;</div><p></p>', NULL, 0, 'QG orga', 3, 'non'),
(1074, 31, 525, NULL, 'rangement banderoles', 'Coucou<div>choppe une pince et va détacher la banderole TDR</div><div><br></div><div>ramène là au QG pédale</div><div><br></div><div>Retourne aider les autres pédales</div>', NULL, 0, 'Campus', 0, 'non'),
(1075, 19, 461, NULL, 'Ranger les 40 000 Gobelets à la cave', '<p>Rejoins les orgas bars au creux GCU.</p><div>- rempli le 20m3 de cartons pleins de gobelets</div><div>- décharge tout devant la cave du PC</div><div>(- un orga bar ramènera le 20m3 au local des 24 pendant que l''autre récupère la clé de la cave du PC à la DirPat)</div><div>- stocker les cartons au fond de la cave à l''abri de l''eau et de la moisissure !</div><div><br></div><div>Merci</div><p></p>', NULL, 1, 'Creux GCU', 3, 'non'),
(1076, 13, 458, NULL, 'Resp bar BDE dimanche', '<p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecté aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as déjà assisté au briefing et à la formation donc tu dois être bien au courant de comment ça va se passer. Amène ta fiche avec toi pour avoir toutes les infos qu’il te faut.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu es le contact privilégié des Orgas Bars (les charismatiques Choppy et Bruce Louis), d’où ton talkie et tu dois travailler main dans la main avec le Resp Orga Bar pour la bonne gestion du bar.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tes missions :</span></p><ul style="margin-top: 0pt; margin-bottom: 0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Chercher un talkie en début de créneau </span><span style="white-space: pre-wrap;"> au QG orga</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Annoncer aux orgas bars Choppy et Bruce Louis au talkie que tu es là</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Approvisionner en gobelet le bar. Pense à en prendre avant l’ouverture pour tenir un bon moment.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Approvisionner en soft, et veiller à ce que les frigos soit bien comme il faut (Facing de Red Bull notamment).</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Appeler le ravito arrrrrgent si les caisses sont vides (plus de pièces de 50ct par exemple) ou pleines à craquer. Le resp orga bar te préviendra si c’est le cas.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Gérer la sécurité des bars (personne passe derrière les bars) !</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Approvisionner en bière. Quand un fût est vide, change le avec un en stock, annonce au talkie que tu as besoin d’un fût, écoute la réponse des Orgas Bars, et rends toi au creux GCU. C’est toi qui percutes les fûts et les changes. Percute le premier fût avant l’ouverture du bar pour être tranquille à l’ouverture. </span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Superviser le bar en général, si tu te pignoles, aide à servir ou tirer.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Ranger après la fermeture </span><span style="white-space: pre-wrap;"> (le dimanche il faudra ramener les tables et les chaises de ton bars au dépôt AIP).</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Contacts : Bruce Louis 07 86 85 59 21 / Choppy </span><span style="font-size: 13px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">&nbsp;</span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">06 67 12 02 1</span>', NULL, 0, 'Devant le creux GCU', 3, 'non'),
(1077, 3, 310, NULL, 'Préparation des kits catering', '<p>Préparation des kits catering pour les artistes avec les courses qui ont été faites jeudi 22 mai.</p>', NULL, 0, 'Local', 3, 'non'),
(1078, 212, 485, NULL, 'accueil des pneus de drift trikes', '<p>- Attendre le coup de téléphone de drift trikes</p><div>- Quand ils sont là, ouvrir les barrières des courses au bout de la rue des Arts</div><div>- Les amener jusqu''à la kfet</div><div>- Les aider à déposer leur pneus à côté du dépôt barrières</div><div>- Quand c''est fini, fait les ressortir leur voiture (au moins en dehors du circuit). Leur véhicule ne peut pas rester à côté de la kfet non plus!!!! Il va nous casser les couilles pendant la journée après!!!</div><div>- Remet bien les barrières en place pour pas te faire rentrer la merde par les courses et va faire ta prochaine tâche</div><p></p>', NULL, 0, 'Parking Eiffel', 1, 'non'),
(1079, 223, 334, NULL, 'Va faire le meilleur Tiramisu du monde !', '<p>Va à la MdE avec ton matos de cuisinère de folie, taxe son matos au Troll, récupère les courses faites exprès pour le tiramisu de l''ambiance, et botte des culs !&nbsp;</p><div><br></div><div>Le jeudi, ton tiramisu sera élu meilleur Tiramisu du monde (en compétition avec celui du troll).</div><div><br></div><div>Just do it !&nbsp;</div><p></p>', NULL, 0, 'MdE', 3, 'non'),
(1080, 223, 341, NULL, 'Tri Restes du matos Bouffe', '<p>Va au Bocal, va dans la log, va dans l''armoire bouffe.&nbsp;</p><div>Prends le matos qui t''intéresse, et va le répartir entre les différentes Coms avec le matos du GR que Léo sera en train de trier dans Graine d''Images.&nbsp;</div><div><br></div><div>Tri bien, fais des cartons et écrit dessus pour qui c''est !&nbsp;</div><div><br></div><div>ATTENTION : MARQUER tout notre matos : prend du scotch, un marqueur, et écrit "24H" sur tout le matos qui est à nous et qu''on doit récupérer.</div><div><br></div><div><br></div><p></p>', NULL, 0, 'Bocal', 3, 'non'),
(1081, 206, 334, NULL, 'Réceptionner livraison Promocash', '<p>Rends-toi au QG orga et réceptionne la livraison de Promocash.</p><div>Décharge le camion et répartis les courses au QG entre les différentes com'' (tu auras la liste des produits à réceptionner et leurs destinataires).</div><p></p>', NULL, 0, 'La Rotonde', 3, 'non'),
(1082, 206, 341, NULL, 'Rapatriement matos GR', '<p>Rends-toi au local de GI, prends une voiture disponible et rapatrie tout le matos prêté par le GR du local de Graines d''Images vers le QG orga.</p>', NULL, 1, 'Local GI', 3, 'non'),
(1083, 201, 555, NULL, 'Barman Bar Vieux', '<p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecter aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">En arrivant au Bar, présente toi au Resp Orga Bar (crie “Resp Orga Bar si tu le trouve pas”). Il va te briefer et t’assigner à un des postes suivants : Tireur - Serveur - Pivot. Tu pourras changer après une heure si tu le souhaite ;).</span></p><div><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"><br></span></div><div><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"><p dir="ltr" style="font-family: ''Times New Roman''; font-size: medium; white-space: normal; line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Serveur :</span></p><ul style="font-family: ''Times New Roman''; font-size: medium; white-space: normal; margin-top: 0pt; margin-bottom: 0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu prends la commande des gens</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu encaisse l’argent et rends la monnaie</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Et finalement tu leur donne à boiiiiire</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">S’ils payent par CB appel le caissier spécial CB</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu danse et mets l’ambiance</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Apprends bien les prix</span></p></li></ul><p dir="ltr" style="font-family: ''Times New Roman''; font-size: medium; white-space: normal; line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Pivot :</span></p><ul style="font-family: ''Times New Roman''; font-size: medium; white-space: normal; margin-top: 0pt; margin-bottom: 0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu fais le lien entre les serveurs et les tireures</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu dispose sur la tables les différentes bières et tu dis au tireur ce qu’il faut</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu danse et mets l’ambiance</span></p></li></ul><br style="font-family: ''Times New Roman''; font-size: medium; white-space: normal;"><span style="font-size: 15px; vertical-align: baseline;"></span><p dir="ltr" style="font-family: ''Times New Roman''; font-size: medium; white-space: normal; line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tireur :</span></p><ul style="font-family: ''Times New Roman''; font-size: medium; white-space: normal; margin-top: 0pt; margin-bottom: 0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu tires les bières en fonction de ce que le pivot te dit</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Si tu as de l’avance (champion !) prépare les bières les plus demandé en avance</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Ton role = moins de mousse possible !</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tu danse et mets l’ambiance.</span></p></li></ul><div><span style="line-height: 15.681818008422852px;"><br></span></div><div><p dir="ltr" style="font-family: ''Times New Roman''; font-size: medium; white-space: normal; line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Diverses infos :</span></p><p dir="ltr" style="font-family: ''Times New Roman''; font-size: medium; white-space: normal; line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Dans tous les cas être souriant, joyeux, drôle avec les festivaliers. S’il y a quelqu’un completement ivre qui veux une bière tu vas voir les resp orga bar, il est ton principale interlocuteur et doit savoir tout sur tout. Pour les sirops, on fait les radins, c’est 1cm et pas plus :p. Dernier point, c’est pas open bar, ton resp orga bar te le rappellera.</span></p><p dir="ltr" style="font-family: ''Times New Roman''; font-size: medium; white-space: normal; line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"><br></span></p><p dir="ltr" style="font-family: ''Times New Roman''; font-size: medium; white-space: normal; line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">------------Si ton créneau couvre la fermeture tu devras assurer le nettoyage : pas de soucis, vous êtes beaucoup ça va aller vite --------------------------------------------- </span></p><br style="font-family: ''Times New Roman''; font-size: medium; white-space: normal;"><span style="font-size: 15px; vertical-align: baseline;"></span><p dir="ltr" style="font-family: ''Times New Roman''; font-size: medium; white-space: normal; line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></p></div></span></div>', NULL, 0, 'Bar vieux', 3, 'non'),
(1084, 201, 555, NULL, 'Resp Bar Vieux', '<p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecter aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as déjà assisté au briefing et à la formation donc tu dois être bien au courant de comment ça va se passer. Amènes ta fiche avec toi pour avoir toutes les infos qu’il te faut.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu es le contact privilégié des Orgas Bars (les charismatiques Choppy et Bruce Louis), d’où ton talkie, tu dois travailler main dans la main avec le Resp Orga Bar pour la bonne gestion du bar.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tes missions :</span></p><ul style="margin-top: 0pt; margin-bottom: 0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Chercher un talkie en début de créneau au QG orga</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Annoncer aux orgas bars Choppy et Bruce Louis au talkie que tu es là</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Approvisionner en gobelet le bar. Pense à en prendre avant l’ouverture pour tenir un bon moment.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Approvisionner en soft, et veiller à ce que les frigos soit bien comme il faut (Facing de Red Bull notamment.)</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Appeler le rativo arrrrrgent si les caisses sont vides (plus de pièces de 50ct par exemple) ou pleine à craquer. Le resp orga bar te préviendra si c’est le cas.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Gérer la sécurité des bars (personne passe derrière les bars) !</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Approvisionner en bière. Quand un fût est vide, change le avec un en stock, annonce au talkie que tu as besoin d’un fût, écoute la réponse des Orgas Bars, et rends toi au creux GCU. C’est toi qui percute les fûts et les change. Percute le premier fût avant l’ouverture du bar pour être tranquille à l’ouverture. </span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Superviser le bar en général, si tu te pignole aide à servir ou tirer.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Aider au rangement après la fermeture </span><span style="white-space: pre-wrap;"> (le samedi il faudra ramener les tables et les chaises de ton bars au dépôt AIP).</span></p></li><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Contacts : Bruce Louis 07 86 85 59 21 / Choppy </span><span style="font-size: 13px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">&nbsp;</span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">06 67 12 02 16</span></ul>', NULL, 0, 'Bar vieux', 3, 'non'),
(1085, 201, 555, NULL, 'Caissier Bar Vieux', '<p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecter aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Ta mission est de gérer la caisse du bar, voici le déroulement des taches :</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><ul style="margin-top: 0pt; margin-bottom: 0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">En arrivant au Bar présente toi au Resp Bar, c’est lui qui te briefera et te rappellera les consignes élémentaires.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Apprends aussi bien que tu peux les prix des différentes consos, ça va aller très vite et faudra pas faire d’erreur de calcul. Une fiche sera à ta disposition sur ta table.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Les serveurs vont venir vers toi pour te donner l’argent et c’est à toi de leur rendre la monnaie.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Si ta caisse commence à être bondée, ou s’il commence à plus y avoir de pièce de 50ct, don’t panic, appelle le Resp Bar pour qu’il contact le ravito argent !</span></p></li></ul><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; font-weight: bold; vertical-align: baseline; white-space: pre-wrap;">/!\\ La caisse ne doit jamais être laissée sans surveillance. Ne pars pas tant que la relève n’est pas arrivé, et n’arrive pas en retard à tes créneaux. Dans tous les cas se référer au Resp Bar s’il y a un problème /!\\</span></p><br><span style="font-size: 15px; font-family: Arial; font-weight: bold; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage.</span></p><div><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"><br></span></div>', NULL, 0, 'Bar vieux', 3, 'non');
INSERT INTO `Tache` (`id`, `responsable_id`, `groupetache_id`, `importid`, `nom`, `consignes`, `materielSupplementaire`, `permisNecessaire`, `lieu`, `statut`, `commentaireLog`) VALUES
(1086, 201, 555, NULL, 'Caissier TPE Bar Vieux', '<p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Bonjour et bienvenu(e) aux Bars !!!</span></p><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu as le privilège d’être affecté aux Bars ! Motive toi, le succès du bar dépend de toi ! </span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tu es responsable du payement par carte bancaire des festivaliers.</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Tes missions :</span></p><ul style="margin-top: 0pt; margin-bottom: 0pt;"><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Te présenter au resp orga bar à ton arrivée</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Récupérer ton matos, vas voir le resp Orga bar si tu as des doutes sur son utilisation (il est censé te former).</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Encaisser les commandes qui se font par carte bancaire.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Garder toujours le TPE avec toi, seuls les Resps ou Orga BarS ont le droit de le prendre à part toi !</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Tenir le TPE pendant le payement (les gens partent avec sinon...fail…).</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Donner le premier ticket au client et donner au caissier le deuxième.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Prévenir le resp Bar s’il y a un problème.</span></p></li><li dir="ltr" style="list-style-type: disc; font-size: 15px; font-family: Arial; vertical-align: baseline;"><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline; white-space: pre-wrap;">Servir normalement si tu te pignoles ;)</span></p></li></ul><div><font face="Arial"><span style="font-size: 15px; line-height: 17.25px; white-space: pre-wrap;"><br></span></font></div><div><font face="Arial"><span style="font-size: 15px; line-height: 17.25px; white-space: pre-wrap;"><b>NE PARS PAS TANT QUE LA RELEVE N''EST PAS ARRIVEE!!!!</b></span></font></div><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><p dir="ltr" style="line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Note : Si tu as créneau en Journée tu tiens en plus la caisse ! Le resp orga te briefera ;)</span></p><br><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;"></span><span style="font-size: 15px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;">Merci, bon courage, pas de Pression (Live) et “In Beer We Trust”.</span>', NULL, 0, 'Bar vieux', 3, 'non'),
(1087, 23, 480, NULL, 'Fermeture parking Piscine', '<p></p><ul><li>Rendez-vous au local des 24h de l''INSA au Bâtiment D pour retrouver ton co-tâche.</li><li>Récupérer dans le casier sécu</li><ul><li>les feuilles d''interdiction de stationnement<br></li><li>le papier "décision n°14/04/115" en A3 dans une pochette plastique</li><li>si tu ne le trouves pas appelle cheval au 06 76 99 09 64</li></ul><li>Récupère du scotch en rouleau</li><li>Récupérer des vaubans au point de&nbsp;dépôt&nbsp;le plus proche du parking Piscine, celui de la petite scène (si tu ne le trouve pas, appelle Guerric au 06 04 47 64 30)<br></li><li>Barrière le Parking pour laisser sortir les éventuelles voitures restantes. (laisse une ouverture de 1 vauban)<br></li><li>Accroche bien les vaubans entre elles</li><li>Si il n''y a plus de voitures, ferme le complètement ! On est chez nous !</li><li>Accrocher les feuilles d''interdiction de stationnement sur les barrières à l''aide de ton scotch supersonique<br></li><li>Accroche le papier&nbsp;"décision n°14/04/115" bien en vue sur une des vaubans, toujours avec ton scotch supersonique</li><li>Ramener tout le matos au local</li></ul><p></p>', NULL, 0, 'Local des 24h (bâtiment D)', 3, 'non'),
(1088, 14, 347, NULL, 'Récupération clés Dirpat', '<p>Regarder dans le dossier les clés à recup à la dirpat</p>', NULL, 0, 'dirpat', 3, 'non'),
